INSERT INTO `corine` (`CD_HAB`, `FG_VALIDITE`, `CD_TYPO`, `LB_CODE`, `LB_HAB_FR`, `LB_HAB_FR_COMPLET`, `LB_HAB_EN`, `LB_AUTEUR`, `NIVEAU`, `LB_NIVEAU`, `CD_HAB_SUP`, `PATH_CD_HAB`, `FRANCE`, `LB_DESCRIPTION`, `CRSP_PHYTO_CB91`, `DESCRIPTIF_CB97_FR`) VALUES
(4540, 'NR', 22, '45.42', '', '', 'Italian kermes oak woodland', '', 4, 'Niveau 4', 1381, '/68/517/1381/4540', 'false', 'Very local Quercus coccifera formations of Puglia and southern Sicily.', '', 'Pas de description disponible'),
(4541, 'NR', 22, '45.43', '', '', 'Portuguese kermes oak forest', '', 4, 'Niveau 4', 1381, '/68/517/1381/4541', 'false', 'Extremely isolated Quercus coccifera - dominated forest of Nazare, Monte de S. Bartolomeu, with Phillyrea media, Pistacia lentiscus, P. angustifolia, Arbutus unedo, Viburnum tinus, Smilax aspera, Asplenium onopteris.', 'Arisaro-Quercetum fagineae phillyretosum p.', 'Pas de description disponible'),
(4542, 'NR', 22, '42.84', 'Forêts de Pins d\'Alep', '', 'Aleppo pine forests', '', 4, 'Niveau 4', 1386, '/68/491/1386/4542', 'true', 'Woods of Pinus halepensis, a frequent colonist of thermo- and calcicolous meso-Mediterranean scrubs. The distinction between spontaneous forests and long-established formations of artificial origin is often difficult. The latter are thus included here, while recent, obviously artificial groves are not.', '', 'Bois de Pinus halepensis, un colonisateur fréquent des formations de matorrals thermo- et méso-méditerranénnes calcicoles. La distinction entre les formations spontanées et celles d\'origine artificielle établies depuis lontemps est souvent difficile. Ces derniers sont inclus ici, tandis que des boisements récents d\'origine artificielle évidente ne le sont pas.'),
(4543, 'NR', 22, '44.34', 'Galeries d\'Aulnes nord-ibériques', '', 'Northern Iberian alder galleries', '', 4, 'Niveau 4', 1389, '/68/515/1389/4543', 'true', 'Riparian alder or ash-alder woods of collinar and montane streams of the northern Iberian peninsula, with a pronounced medio-European influence marked in particular by the presence of Fraxinus excelsior (and not F. angustifolia). They are characteristic of streams originating in the Pyrenees, the Cantabrian Cordillera, the Northern Galician mountains and the Catalonian ranges. The canopy may include Ulmus glabra, Quercus robur and tall willows; the undergrowth contains Sambucus nigra, Corylus avellana, Cornus sanguinea, Rubus caesius, Carex pendula, C. remota, Festuca gigantea, Bromus ramosus, Lathraea clandestina, Circaea lutetiana, Hypericum androsaemum, Solanum dulcamara, Valeriana pyrenaica, Lysimachia nemorum, Saxifraga hirsuta, Galanthus nivalis, Athyrium filix-femina, Dryopteris dilatata, Osmunda regalis, Equisetum telmateia.', 'Hyperico androsaemi-Alnetum, Valeriano pyrenaicae-Alnetum, Scrophulario alpestris-Alnetum (Alnetum catalaunicum), Carici pendulae-Alnetum, Lamio flexuosi-Alnetum', 'Bois riverains d\'Aulnes ou de Frênes et d\'Aulnes des cours d\'eaux collinéens et montagnards du nord de la péninsule Ibérique, soumises à une influence médio-européenne profondément marquée en particulier par la présence de Fraxinus excelsior (et non de F. angustifolia). Ils sont caractéristiques des cours d\'eau originaires des Pyrénées. La canopée peut renfermer Ulmus glabra, Quercus robur et des grands Saules ; le sous-bois comprend Sambucus nigra, Corylus avellana, Cornus sanguinea, Rubus caesius, Carex pendula, C. remota, Festuca gigantea, Bromus ramosus, Lathraea clandestina, Circaea lutetiana, Hypericum androsaemum, Solanum dulcamara, Valeriana pyrenaica, Lysimachia nemorum, Saxifraga hirsuta, Galanthus nivalis, Athyrium filix-femina, Dryopteris dilatata, Osmunda regalis, Equisetum telmateia.'),
(4544, 'NR', 22, '45.11', 'Bois d\'Oliviers sauvages (oléastres)', '', 'Wild olive woodland', '', 4, 'Niveau 4', 1395, '/68/517/1395/4544', 'true', 'Olea europaea ssp. sylvestris - dominated formations. The most developed examples are found in southern Andalusia (Tamo communis - Oleetum sylvestris: extinct?), in Menorca (Prasio majoris - Oleetum sylvestris), Sardinia, Sicily, Calabria, Crete.', '', 'Formations dominées par Olea europaea subsp. sylvestris. Les exemples les plus développés se trouvent en Andalousie méridionale (Tamo communis-Oleetum sylvestris), à Minorque (Prasio majoris-Oleetum sylvestris), en Sardaigne, en Sicile, ...'),
(4545, 'NR', 22, '51.12', 'Tourbières basses (Schlenken)', '', 'Bog hollows (schlenken)', '', 4, 'Niveau 4', 1404, '/71/518/1404/4545', 'true', 'Temporarily or permanently rainwater-filled depressions of bogs, occupied by communities similar to those of larger intermediate mires (54.5, 54.6).', 'Scheuchzerietalia palustris p.', 'Dépressions de tourbières remplies temporairement ou en permanence d\'eau de pluie, occupées par des communautés similaires à celles des tourbières de transition plus vastes (54.5, 54.6).'),
(4546, 'NR', 22, '51.13', 'Mares de tourbières', '', 'Bog pools', '', 4, 'Niveau 4', 1404, '/71/518/1404/4546', 'true', 'Larger, deep, permanently filled depressions, usually distrophic, occurring near the centre of raised bogs or along tension lines. Their planctonic communities are original. Floating plant communities may sometimes develop, in particular those comprising Sparganium minimum and Utricularia spp. (22.45) and, sometimes, beds of Nymphaea spp. (22.4311).', '', 'Dépressions plus vastes, plus profondes, remplies en permanence d\'eau, généralement dystrophes, situées vers le centre des tourbières hautes ou le long de lignes de tension. Leurs communautés planctoniques sont originales. Des communautés de plantes flottantes peuvent parfois se développer, en particulier celles comprenant Sparganium minimum et Utricularia spp. et parfois des tapis de Nymphaea spp. (22.4311).'),
(4547, 'NR', 22, '51.14', 'Suintements et rigoles de tourbières', '', 'Bog seeps and soaks', '', 4, 'Niveau 4', 1404, '/71/518/1404/4547', 'true', 'Paths of water runoff carving the marginal slope of the bog, carrying water from the centre to the lagg. They are in part colonized by intermediate mire or acid fen vegetation (54.5, 54.4).', '', 'Lignes d\'écoulement d\'eau entamant la bordure périphérique de la tourbière, amenant l\'eau du centre vers la périphérie. Elles sont notamment colonisées par une végétation de tourbières de transition ou de bas-marais acides (54.5, 54.4).'),
(4548, 'NR', 22, '42.85', '', '', 'Aegean pine forests', '', 4, 'Niveau 4', 1386, '/68/491/1386/4548', 'false', 'Pinus brutia forests of Crete and eastern Aegean islands. Eastern vicariants of Aleppo pine forests (42.84), they comprise, however, taller, more luxuriant, and often extensive, formations.', '', 'Pas de description disponible'),
(4549, 'NR', 22, '44.41', 'Grandes forêts fluviales médio-européennes', '', 'Great medio-European fluvial forests', '', 4, 'Niveau 4', 1396, '/68/515/1396/4549', 'true', 'Fully developed, very tall, multi-layered, highly diverse riparian forests of oaks, ashes, elms, limes, maples, alders, poplars, cherries, apple, willows of the middle and lower courses of large medio-European river systems, in particular, the Rhine, the Danube, the Emst, the Elbe, the Saale, the Weser, the Loire, the Rhone-Saône systems. Their highly complex structure is formed of eight strata to which participate up to 50 species of trees and shrubs. The upper arborescent stratum includes Quercus robur, Fraxinus excelsior, Ulmus minor, U. laevis, U. glabra, Populus alba, P. tremula, P. canescens, P. nigra, Acer pseudoplatanus, A. platanoides, Salix alba, Alnus glutinosa, Prunus avium, the lower arborescent stratum Malus sylvestris, Tilia cordata, the sub-arborescent shrub layer Alnus incana, Prunus padus and Crataegus monogyna. There are very varied high and low shrub layers and numerous lianas, Clematis vitalba, Tamus communis, Humulus lupulus, Hedera helix and Vitis vinifera ssp. sylvestris. Most diverse, structurally, floristically and faunistically, of all European ecosystems, and closest in that respect to tropical communities and to the warm temperate forests of the Pleistocene, the great fluvial forests of Europe are reduced to a few highly vulnerable examples, located mainly within the Rhine, Danube and Elbe systems.', 'Querco-Ulmetum minoris', 'Forêts riveraines à très haute diversité spécifique de Chênes, Frênes, Ormes, Tilleuls, Erables, Aulnes, Peupliers, Pruniers, Pommiers, Saules. Elles sont bien développées, très hautes et multistrates installées le long des cours moyen et inférieur des grands systèmes fluviaux médio-européens, en particulier le Rhin, le système Rhône-Saône, ou atlantiques : Loire, Adour. Ce complexe hautement structuré est formé de huit strates auxquelles participent jusqu\'à une cinquantaine d\'espèces d\'arbres et d\'arbustes. La strate arborescente supérieure renferme Quercus robur, Fraxinus excelsior, Ulmus minor, U. laevis, U. glabra, Populus alba, P. tremula, P. canescens, P. nigra, Acer pseudoplatanus, A. platanoides, Salix alba, Alnus glutinosa, Prunus avium, la strate arborescente inférieure Malus sylvestris, Tilia cordata, la strate sous-arborescente arbustive Alnus incana, Prunus padus et Crataegus monogyna. Les strates arbustives haute et basse sont très variées et les lianes nombreuses parmi lesquelles Clematis vitalba, Tamus communis, Humulus lupulus, Hedera helix et Vitis vinifera spp. sylvestris. Ecosystèmes les plus diversifiés, structurellement, floristiquement et faunistiquement, de tous les écosystèmes européens et approchant le plus, de ce point de vue, les communautés tropicales et les forêts tempérées chaudes du Pleistocène. Les grandes forêts fluviales d\'Europe sont réduites à quelques exemples hautement vulnérables, localisées surtout à l\'intérieur des réseaux hydrographiques du Rhin, du Danube et de l\'Elbe.'),
(4550, 'NR', 22, '45.12', 'Bois de Caroubiers', '', 'Carob woodland', '', 4, 'Niveau 4', 1395, '/68/517/1395/4550', 'true', 'Ceratonia siliqua - dominated formations, often with Olea europaea ssp. sylvestris and Pistacia lentiscus. The most developed examples, some truly forest-like, are to be found in Mallorca (Cneoro tricocci - Ceratonietum siliquae), eastern Sardinia, southeastern Sicily, Puglia, Crete.', '', 'Formations dominées par Ceratonia siliqua, souvent avec Olea europaea subsp. sylvestris et Pistacia lentiscus. Les exemples les mieux développés (quelques-uns ayant l\'aspect d\'une forêt) se trouvent dans l\'île de Majorque (Cneoro tricocci-Ceratonietum siliquae), en Sardaigne orientale, en Sicile sud-orientale, dans les Pouilles.'),
(4551, 'NR', 22, '45.13', '', '', 'Canarian olive woodland', '', 4, 'Niveau 4', 1395, '/68/517/1395/4551', 'false', 'Olea europaea ssp. cerasiformis and Pistacia atlantica formations of the Canary Islands.', '', 'Pas de description disponible'),
(4552, 'NR', 22, '45.21', 'Forêts thyrrhéniennes de Chênes lièges', '', 'Tyrrhenian cork-oak forests', '', 4, 'Niveau 4', 1397, '/68/517/1397/4552', 'true', 'Mostly meso-Mediterranean Quercus suber forests of Italy, Sicily, Sardinia, Corsica, France and northeastern Spain. They are most often degraded to arborescent matorral (32.11).', 'Quercion suberis', 'Forêts de Quercus suber plutôt méso-méditerranéennes, de Corse et du continent français. Elles sont le plus souvent dégradées à l\'état de matorrals arborescents (32.11).'),
(4553, 'NR', 22, '45.91', '', '', 'Canarian fayal-brezal', '', 4, 'Niveau 4', 1385, '/68/517/1385/4553', 'false', 'Tall Erica arborea-dominated formations of Tenerife, La Palma, La Gomera, Gran Canaria and Hierro, with Myrica faya, Ilex canariensis, Rhamnus glandulosa, Viburnum tinus ssp. rigidum, Cedronella canariensis, Bystropogon canariensis, Isoplexis canariensis, Urtica morifolia, Teline canariensis, Sonchus abbreviatus, Hypericum glandulosum, Gesnouinia arborea and many species of the genus Pericallis, including several island or local endemics that characterize several differentiated communities; among these are Pericallis (Senecio) tussilaginis, P. webbii, P. cruenta, P. steetzii, P. murrayi.', 'Fayo-Ericetum arboreae i.a.', 'Pas de description disponible'),
(4554, 'NR', 22, '45.92', '', '', 'Hierran fayal', '', 4, 'Niveau 4', 1385, '/68/517/1385/4554', 'false', 'Tall Myrica faya formation of the southern slope of Hierro, almost devoid of Erica arborea.', 'Senecio murrayi-Myricetum fayae p.', 'Pas de description disponible'),
(4555, 'NR', 22, '45.93', '', '', 'Visnea-Arbutus forests', '', 4, 'Niveau 4', 1385, '/68/517/1385/4555', 'false', 'Formations characterized by the abundance of Arbutus canariensis and Visnea mocanera occurring, in particular, in the Valle de Guimar and Los Silos of Tenerife, and in the Ladera de Jinama of Hierro.', '', 'Pas de description disponible'),
(4556, 'NR', 22, '42.91', '', '', 'Canary pine-rockrose forests', '', 4, 'Niveau 4', 1398, '/68/491/1398/4556', 'false', 'Climax Pinus canariensis forests within the main zone of altitudinal occurrence, with an undergrowth characterized and often dominated by Cistus symphytifolius and comprising Chamaecytisus proliferus, Lotus campylocladus, L. hillebrandii, L. spartioides, Juniperus cedrus, Bystropogon origanifolius, Argyranthemum adauctum.', '', 'Pas de description disponible'),
(4557, 'NR', 22, '44.42', 'Forêts fluviales médio-européennes résiduelles', '', 'Residual medio-European fluvial forests', '', 4, 'Niveau 4', 1396, '/68/515/1396/4557', 'true', 'Fragments of oak-elm-ash forests of large medio-European river systems, very altered and with greatly reduced species richness.', '', 'Fragments de forêts de Chênes, d\'Ormes et de Frênes des grands systèmes fluviaux médio-européens, très altérés et avec une richesse en espèces fortement réduite.'),
(4558, 'NR', 22, '44.43', '', '', 'Balkanic ash-oak-alder forests', '', 4, 'Niveau 4', 1396, '/68/515/1396/4558', 'false', 'Quercus robur and Fraxinus angustifolia riparian forests of sub-Mediterranean regions of southeastern Europe.', '', 'Pas de description disponible'),
(4559, 'NR', 22, '44.44', '', '', 'Po oak-ash-alder forests', '', 4, 'Niveau 4', 1396, '/68/515/1396/4559', 'false', 'Relict forests of the alluvial plain of the Po and its main tributaries, remnants of the greatest fluviatile system of Europe. They are formed by meso-hygrophile, mesotrophic, multi-layered, oak-ash-hornbeam - dominated communities (Carpinion betuli: Poligonato multiflorae-Quercetum roboris), with facies richer in ashes, willows and, mostly, alders, in the wettest areas (Alno-Padion). Constituent trees include Quercus robur, Q. cerris, Fraxinus excelsior, F. ornus, Carpinus betulus, Ulmus minor, Populus alba, P. nigra, Acer campestre, A. pseudoplatanus, Prunus padus, P. avium, Alnus glutinosa, Salix alba, Corylus avellana, Sorbus torminalis, S. domestica, the shrub layers are formed, in particular, by Ruscus acueleatus, Cornus mas, C. sanguinea, Crataegus laevigata, C. monogyna, Pyracantha coccinea, Rubus fruticosus, R. ulmifolius, R. caesius, Ribes uva-crispi, Sambucus nigra, Daphne mezereum, Viburnum lantana, Mespilus germanica, Lonicera xylosteum, Ligustrum vulgare, Prunus spinosa, Rosa canina, Euonymus europaea, Rhamnus catharticus; lianas are abundant, in particular, Hedera helix, Tamus communis, Rubia peregrina, Bryonia cretica; in the herb layer occur, in particular, Equisetum hyemale, Symphytum officinale, Polygonatum multiflorum, Pulmonaria officinalis, Lathyrus vernus, Mercurialis perennis, Primula acaulis, Asarum europaeum, Euphorbia dulcis, Melittis melisophyllum, Erythronium dens-canis, Leucojum vernum, Brachypodium sylvaticum, Carex pilosa. These forests are the habitat of the endangered endemic frog Rana latastei.', 'Polygonato multiflorae-Quercetum roboris i.a.', 'Pas de description disponible'),
(4560, 'NR', 22, '45.22', '', '', 'South-western Iberian cork-oak forests', '', 4, 'Niveau 4', 1397, '/68/517/1397/4560', 'false', 'Quercus suber forests, often with Q. faginea or Q. canariensis, of the southwestern quadrant of the Iberian peninsula.', 'Quercion fagineo-suberis', 'Pas de description disponible'),
(4561, 'NR', 22, '45.23', '', '', 'North-western Iberian cork-oak woodland', '', 4, 'Niveau 4', 1397, '/68/517/1397/4561', 'false', 'Very local, exiguous Q. suber enclaves in the Q. pyrenaica forest area of the valleys of the Sil and of the Mino (Galicia).', 'Holco-Qercetum pyrenaicae p.', 'Pas de description disponible'),
(4562, 'NR', 22, '45.24', 'Forêts aquitaniennes de Chênes lièges', '', 'Aquitanian cork-oak woodland', '', 4, 'Niveau 4', 1397, '/68/517/1397/4562', 'true', 'Isolated Q. suber-dominated stands occurring either as a facies of dunal pine-cork oak forests or in a very limited area of the eastern Landes.', '', 'Stations isolées à Quercus suber dominant se rencontrant soit comme un faciès des pinèdes à Chênes lièges dunaires (42.812), soit dans une aire très limitée de l\'est des Landes.'),
(4563, 'NR', 22, '45.61', '', '', 'Azorean laurisilvas', '', 4, 'Niveau 4', 1394, '/68/517/1394/4563', 'false', 'Lauriphyllous forests of the Azores, with Laurus azorica, Myrica faya, Frangula azorica, Ilex perado ssp. azorica, Juniperus brevifolia, Picconia azorica, Prunus lusitanica ssp. azorica, Euphorbia stygiana, Viburnum tinus ssp. subcordatum, Vaccinium cylindraceum, Smilax divaricata. The humid forests of the coastal areas (\"Myrico-Pittosporietum undulati\" p.) have been totally or almost totally degraded, largely invaded by the introduced Australian Pittosporum undulatum. A better representation survives of the hyper-humid forests (Culcito-Juniperion brevifoliae p.) of higher elevations.', 'Ericetalia azoricae p.: Culcito-Juniperion brevifoliae p., Myrico-Pittosporion undulati p.', 'Pas de description disponible'),
(4564, 'NR', 22, '45.62', '', '', 'Madeiran laurisilvas', '', 4, 'Niveau 4', 1394, '/68/517/1394/4564', 'false', 'Lauriphyllous forests of Madeira with Laurus azorica, Persea indica, Ocotea foetens, Apollonias barbujana, Pittosporum coriaceum, Clethra arborea, Visnea mocanera, Picconia excelsa, Prunus lusitanica ssp. hixa, Heberdenia excelsa, Vaccinium padifolium, Ilex perado ssp. perado, I. canariensis, Myrica faya, Erica arborea, Hedera canariensis, Isolexis canariensis, Euphorbia mellifera, Sambucus lanceolata, Teline maderensis (=Cytisus maderensis), Sonchus fruticosus, Senecio auritus (= S. maderensis), Ruscus streptophyllus, Rubus bollei, Semele androgyna, Smilax canariensis, Tamus edulis, Carex peregrina and many ferns. These forests, which still occupy a relatively large surface, of the order of 10,000 ha (15% of their former surface), are the habitat of the threatened endemic Madeiran Pigeon, Columba trocaz.', 'Pruno-Lauretalia azoricae: Clethro-Laurion azoricae', 'Pas de description disponible'),
(4565, 'NR', 22, '45.63', '', '', 'Canarian laurisilvas', '', 4, 'Niveau 4', 1394, '/68/517/1394/4565', 'false', 'Lauriphyllous forests of the Canary Islands, with Laurus azorica, Picconia excelsa, Persea indica, Ocotea foetens, Apollonias barbujana, Visnea mocanera, Pleiomeris canariensis (= Myrsine canariensis), Ardisia bahamensis, Prunus lusitanica, Sambucus palmensis, Euphorbia melifera, Ixanthus viscosus, Rubus bollei, Convolvulus canariensis, Geranium canariensis, Hedera canariensis, Smilax aspera, S. canariensis, Canarina canariensis, Semele androgyna, Sideritis macrostachys, S. canariensis, Cryptotaenia elegans, Rubia peregrina, Carex canariensis, Asparagus fallax and many ferns. They are the habitat of the threatened endemic laurel pigeons Columba junionae and C. bollei, now limited to La Gomera, Tenerife and La Palma. The laurel forests of each island harbour a distinctive set of endemic plants and animals, as exemplified by the species of the composite genus Pericallis, the well-marked races of the chaffinch Fringilla coelebs or the carabid faunas. They are thus best listed separately. The total remnant surface of laurel forest for the four islands, La Gomera, Tenerife, La Palma and Hierro, does not exceed 5000 ha.', 'Ixantho-Laurion azoricae', 'Pas de description disponible'),
(4566, 'NR', 22, '42.92', '', '', 'Canary pine-dry scrub forests', '', 4, 'Niveau 4', 1398, '/68/491/1398/4566', 'false', 'Formations of dry, south-facing slopes in the lower part of the Pinus canariensis belt, transitional towards juniper formations and their degradation scrubs, with an undergrowth often formed by Cistus monspeliensis, Euphorbia obtusifolia ssp.regis-jubae, Salvia canariensis, Micromeria hyssopifolia, Echium aculeatum.', '', 'Pas de description disponible'),
(4567, 'NR', 22, '42.93', '', '', 'Canary pine-heath forests', '', 4, 'Niveau 4', 1398, '/68/491/1398/4567', 'false', 'Formations of humid, fogbound north- and northwest-facing slopes in the lower reaches of the Pinus canariensis belt, with an abundance of Erica arborea and Myrica faya, and occasionally with Ilex canariensis and Arbutus canariensis; epiphytic lichens are abundant, as are dense carpets of mosses, in particular, Hypnum cupressiforme. These woods are the main habitat of Regulus teneriffae.', '', 'Pas de description disponible'),
(4568, 'NR', 22, '42.94', '', '', 'Canary pine-broom woods', '', 4, 'Niveau 4', 1398, '/68/491/1398/4568', 'false', 'Formations of the highest altitudes of the Pinus canariensis belt, invaded by species of the supra-Canarian level, in particular Adenocarpus viscosus.', '', 'Pas de description disponible'),
(4569, 'NR', 22, '42.95', '', '', 'Canary pine-juniper woods', '', 4, 'Niveau 4', 1398, '/68/491/1398/4569', 'false', 'Pinus canariensis and Juniperus cedrus formations of steep, rocky slopes of high altitudes of Tenerife and La Palma.', 'Junipero cedri-Pinetum canariensis', 'Pas de description disponible'),
(4570, 'NR', 22, '42.A1', '', '', 'Cypress forests', '', 4, 'Niveau 4', 1400, '/68/491/1400/4570', 'false', 'Montane forests of Crete and a few eastern Aegean islands, dominated by Cupressus sempervirens.', 'Acero-Cupression', 'Pas de description disponible'),
(4571, 'NR', 22, '44.51', 'Galeries méridionales d\'Aulnes glutineux', '', 'Southern black alder galleries', '', 4, 'Niveau 4', 1399, '/68/515/1399/4571', 'true', 'Riparian Alnus glutinosa-dominated multilayered formations of the meso- and supra- Mediterranean levels of Italy, the Cévennes, the Iberian peninsula and Greece', '', 'Formations riveraines multi-strates à Alnus glutinosa dominant des étages méso- et supra-méditerranéens des Cévennes.'),
(4572, 'NR', 22, '44.52', '', '', 'Rhododendron-alder galleries', '', 4, 'Niveau 4', 1399, '/68/515/1399/4572', 'false', 'Highly remarkable, relict thermo- and meso-Mediterranean alder galleries of deep, steep-sided valleys of the sierras of the Campo de Gibraltar and of southern Portugal, with Rhododendron ponticum ssp. baeticum, Frangula alnus ssp. baetica, Arisarum proboscideum and a rich fern community including Pteris incompleta, Diplazium caudatum, Culcita macrocarpa. They are often in contact with humid to hyper-humid Quercus canariensis forests (41.773) and with Salix pedicellata formations (44.1271).', 'Frangulo baetici-Rhododentretum baetici', 'Pas de description disponible'),
(4573, 'NR', 22, '45.31', 'Forêts de Chêne verts', '', 'Meso-Mediterranean holm-oak forests', '', 4, 'Niveau 4', 1401, '/68/517/1401/4573', 'true', 'Rich meso-Mediterranean formations, penetrating locally, mostly in ravines, into the thermo-Mediterranean zone. They are often degraded to arborescent matorral (32.11), and some of the types listed below no longer exist in the fully developed forest state relevant to category 45; they have nevertheless been included, both to provide appropriate codes for use in 32.11, and because restoration may be possible.', '', 'Formations méso-méditerranéennes riches, pénétrant localement, surtout dans les ravins, dans la zone thermo-méditerranéenne. Elles sont souvent dégradées en matorrals arborescents (32.11), et quelques-uns des types catalogué ci-dessous n\'existent plus sous une forme forestière entièrement développée susceptible d\'être rattachée à la catégorie 45. Elles ont néanmoins été incluses, pour fournir des codes appropriés utilisables sous 32.1, et parce qu\'une restauration peut être possible.'),
(4574, 'NR', 22, '51.15', 'Garnitures de bordure (lagg)', '', 'Lagg', '', 4, 'Niveau 4', 1404, '/71/518/1404/4574', 'true', 'Ring of water surrounding raised bogs, often colonized by intermediatee mire or acid fen communities (54.5, 54.4), sometimes accompanied by more basicline species typical of neighbouring fens; Eriophorum angustifolium, E. vaginatum, Scirpus hudsonianus, Carex rostrata, C. flava, Parnassia palustris are frequent components.', '', 'Ceintures d\'eau entourant les tourbières bombées, souvent colonisés par des communautés de tourbière de transition ou de bas-marais acides (54.5, 54.4) parfois accompagnés par des espèces plus basiclines typiques des bas-marais voisins : Eriophorum angustifolium, E. vaginatum, Trichophorum alpinum, Carex rostrata, C. flava, Parnassia palustris en sont les composants fréquents.'),
(4575, 'NR', 22, '51.16', 'Pré-bois tourbeux', '', 'Bog pre-woods', '', 4, 'Niveau 4', 1404, '/71/518/1404/4575', 'true', 'Parts of raised bogs colonized by shrubs or small trees of Pinus rotundata, P. sylvestris var. turfosa, Picea abies, Betula pubescens, B. carpatica, eventually leading to bog woods (44.A).', 'Sphagnetum magellanici pinetosum rotundatae i.a.', 'Parties de tourbières bombées colonisées par des buissons ou des arbres bas de Pinus rotundata, P. sylvestris var. turfosa, Picea abies, Betula pubescens, B. carpatica, éventuellement aboutissant à des bois tourbeux (44.A).'),
(4576, 'NR', 22, '42.A2', 'Forêts de Juniperus thurifera', '', 'Spanish juniper woods', '', 4, 'Niveau 4', 1400, '/68/491/1400/4576', 'true', 'Forest formations dominated by Juniperus thurifera of Spain, southern France and Corsica. Many communities may be better described as arborescent matorrals, and listed under 32.136; geographical divisions can nevertheless be retained by appending the suffixes of 42.A2 to 32.136.', 'Juniperion thuriferae', 'Formations forestières dominées par Juniperus thurifera du sud de la France et de la Corse. De nombreuses communautés sont plutôt des matorrals arborescents et peuvent être classées sous 32.136 ; les divisions géographiques peuvent néanmoins être retenues par l\'adjonction des suffixes de 42.A2 à 32.136.'),
(4577, 'NR', 22, '44.53', 'Galeries corses d\'Aulnes glutineux et d\'Aulnes à feuilles cordées', '', 'Corsican black and cordate alder galleries', '', 4, 'Niveau 4', 1399, '/68/515/1399/4577', 'true', 'Collinar and montane riparian alder galleries of Corsica, dominated by Alnus cordata, with Alnus glutinosa.', 'Hyperico hircini-Alnenion', 'Galeries riveraines collinéennes et montagnardes de Corse, dominées par Alnus cordata, avec Alnus glutinosa.'),
(4578, 'NR', 22, '44.54', '', '', 'Oretanian birch galleries', '', 4, 'Niveau 4', 1399, '/68/515/1399/4578', 'false', 'Relict Betula parvibracteata riparian galleries limited to two stations of the Montes de Toledo (Cordillera Oretana), one in the Sierra de Rio Frio where a unique gallery of about 20 km in length survives, the other at the spring of the Estena. The dominant species, an extremely narrow endemic, is accompanied by Myrica gale, Frangula alnus, Salix atrocinerea, Galium broterianum, Scilla ramburei.', 'Galio broteriani-Betuletum parvibracteatae', 'Pas de description disponible'),
(4579, 'NR', 22, '51.11', 'Buttes, bourrelets et pelouses tourbeuses', '', 'Bog hummocks, ridges and lawns', '', 4, 'Niveau 4', 1404, '/71/518/1404/4579', 'true', 'Vegetation of the higher parts of the bog plateau and of its drier, marginal slope.', 'Sphagnion magellanici, Oxycocco-Ericion tetralicis p.', 'Végétations des parties hautes du plateau tourbeux et de ses versants périphériques plus secs.'),
(4580, 'NR', 22, '42.A3', '', '', 'Grecian juniper woods', '', 4, 'Niveau 4', 1400, '/68/491/1400/4580', 'false', 'Forest formations dominated by Juniperus excelsa, of the Ostryo-Carpinion zone of the mountains of northern Greece (up to 900-1000m, around lake Prespa). Arborescent matorrals, somewhat more widespread in Greece, have been listed under 32.1331.', 'Juniperetum excelsae', 'Pas de description disponible'),
(4581, 'NR', 22, '42.A4', '', '', 'Stinking juniper woods', '', 4, 'Niveau 4', 1400, '/68/491/1400/4581', 'false', 'Forest formations dominated by Juniperus foetidissima on adrets of the upper supra-Mediterranean level in Greece.Arborescent matorrals, somewhat more widespread in Greece, including the Aegean archipelagoes (Samos), have been listed under 32.1332.', '', 'Pas de description disponible'),
(4582, 'NR', 22, '42.A5', '', '', 'Syrian juniper woods', '', 4, 'Niveau 4', 1400, '/68/491/1400/4582', 'false', 'Juniperus drupacea woods of the northern slopes of Mount Parnon, Greece. Part of the formation takes the appearence of an arborescent matorral, listed under 32.135.', '', 'Pas de description disponible'),
(4583, 'NR', 22, '42.A6', '', '', 'Arbor-vitae forests', '', 4, 'Niveau 4', 1400, '/68/491/1400/4583', 'false', 'Xero-thermophile forests of Tetraclinis articulata, restricted to extreme southeastern Spain, are extinct in forest form. The relict formations dominated by this species, of exceptional bio-geographical and historical importance, constitute arborescent matorrals and have been listed under 32.15.', '', 'Pas de description disponible'),
(4584, 'NR', 22, '44.61', 'Forêts de Peupliers riveraines et méditerranéennes', '', 'Mediterranean riparian poplar forests', '', 4, 'Niveau 4', 1403, '/68/515/1403/4584', 'true', 'Riparian forests of base-rich soils submitted to seasonal, prolonged inundation with slow drainage, physiognomically dominated by tall Populus alba and/or P. nigra. Fraxinus angustifolia and Salix alba habitually accompany the poplars and may locally be quantitatively strongly dominant; such areas may, depending on their size, be treated as a local manifestation of a complex poplar ensemble, or listed under 44.63 or 44.141. The poplar forests are usually the tall ligneous vegetation belt closest to the water in riverside catenas.', 'Populenion albae', 'Forêts riveraines des sols riches en bases soumises à des inondations saisonnières, prolongées avec un drainage lent, physionomiquement dominées par la haute stature de Populus alba et/ou P. nigra. Fraxinus angustifolia et Salix alba accompagnent habituellement les peupliers et peuvent être localement quantitativement fortement dominants ; de telles formations doivent, selon leur taille, être traitées comme une manifestation locale d\'un ensemble complexe de Peupliers, ou cataloguées sous 44.63 ou 44.141. Les forêts de Peupliers forment habituellement la ceinture de végétation ligneuse la plus proche du cours d\'eau dans les catenas riveraines.'),
(4585, 'NR', 22, '42.5B', 'Forêts ibériques silicoles de Pins sylvestres', '', 'Iberian silicicolous Scots pine forests', '', 4, 'Niveau 4', 1263, '/68/491/1263/4585', 'true', 'Montane and oro-Mediterranean, xerocline, silicicolous Pinus sylvestris forests of the Iberian Range, the Cordillera Central and the southern flank of the Pyrenees.', 'Pino-Cytision purgantis i.a.', 'Forêts montagnardes et oro-méditerranéennes xéroclines et silicoles de Pinus sylvestris du domaine ibérique, des Cordillères centrales et du versant méridional des Pyrénées (et des Pyrénées-Orientales françaises).'),
(4586, 'NR', 22, '42.A7', 'Forêts d\'Ifs', '', 'Yew woods', '', 4, 'Niveau 4', 1400, '/68/491/1400/4586', 'true', 'Woods dominated by Taxus baccata, often with Ilex aquifolium, of very local occurrence.', '', 'Bois dominés par Taxus baccata, souvent avec Ilex aquifolium, se rencontrant très localement.'),
(4587, 'NR', 22, '42.A8', '', '', 'Macaronesian juniper woods', '', 4, 'Niveau 4', 1400, '/68/491/1400/4587', 'false', 'Juniper-dominated formations of the Atlantic islands. All such formations are listed here whether wood-like or scrub-like in physiognomy; ericoid-dominated facies of the same formations have been listed under 31.3.', '', 'Pas de description disponible'),
(4280, 'NR', 22, '37.84', '', '', 'Southern Iberian tall herb communities', '', 4, 'Niveau 4', 1275, '/67/496/1275/4280', 'false', 'Subalpine and alpine meso-hygrophile tall herb communities of the Sierra Nevada and other southern Iberian mountains, with the endemic Cirsium flavispina, Aconitum nevadense, Senecio elodes.', 'Cirsion flavispinae', 'Pas de description disponible'),
(4281, 'NR', 22, '37.85', 'Mégaphorbiaies corses à Cymbalaria', '', 'Corsican Cymbalaria tall herb communities', '', 4, 'Niveau 4', 1275, '/67/496/1275/4281', 'true', 'Formations of rocky or grassy corridors in Corsica.', 'Cymbalarion hepaticifoliae', 'Formations des corridors rocheux ou herbeux en Corse.'),
(4282, 'NR', 22, '37.86', 'Mégaphorbiaies corses à Doronicum', '', 'Corsican Doronicum tall herb communities', '', 4, 'Niveau 4', 1275, '/67/496/1275/4282', 'true', 'Riparian formations of Corsica.', 'Doronicion corsici', 'Formations riveraines de Corse.'),
(4283, 'NR', 22, '37.87', '', '', 'Greek tall herb communities', '', 4, 'Niveau 4', 1275, '/67/496/1275/4283', 'false', 'Montane riparian and spring-edge vegetation of Greek mountains, with Cirsium appendiculatum, Angelica sylvestris, Heracleum sphondylium, Geum coccineum.', 'Cirsion appendiculati, Geion coccinei', 'Pas de description disponible'),
(4284, 'NR', 22, '37.88', 'Communautés alpines à Patience alpine', '', 'Alpine dock communities', '', 4, 'Niveau 4', 1275, '/67/496/1275/4284', 'true', 'Alpine and subalpine nitrophilous tall herb formations characteristic of the vicinity of cattle and game resting places, with Rumex alpinus, Senecio alpinus, Cirsium spinosissimum, Peucedanum ostruthium.', 'Glechometalia hederaceae: Rumicion alpini', 'Mégaphorbiaies alpines et subalpines nitrophiles caractéristiques du voisinage du bétail et des reposoirs, avec Rumex alpinus, Senecio alpinus, Cirsium spinosissimum, Peucedanum ostruthium.'),
(4285, 'NR', 22, '35.11', 'Gazons à Nard raide', '', 'Mat-grass swards', '', 4, 'Niveau 4', 1276, '/67/493/1276/4285', 'true', 'Mesophile and xerophile Nardus stricta - dominated or -rich formations.', '', 'Formations mésophiles et xérophiles riches en, ou dominées par Nardus stricta.'),
(4286, 'NR', 22, '35.12', 'Pelouses à Agrostis-Festuca', '', 'Agrostis-Festuca grasslands', '', 4, 'Niveau 4', 1276, '/67/493/1276/4286', 'true', 'Closed mesophile grasslands formed by Agrostis spp. and Festuca spp.; in particular, widespread sheep-grazed upland pastures of the British Isles, and especially the Scottish Highlands, with abundant Agrostis capillaris, A. canina, Festuca ovina, and with Anthoxanthum odoratum, Holcus lanatus, Carex pilulifera, Alchemilla alpina s.l., Galium saxatile.', '', 'Pelouses mésophiles fermées, formées par Agrostis spp. et Festuca spp. ; en particulier, pâtures de montagnes à moutons largement répandues (dans les îles Britanniques et spécialement dans les Highlands écossais), avec une abondance d\'Agrostis capillaris, A. canina, Festuca ovina, et avec Anthoxanthum odoratum, Holcus lanatus, Carex pilulifera, Alchemilla alpina, Galium saxatile.'),
(4287, 'NR', 22, '36.41', 'Pelouses à laîche ferrugineuse et communautés apparentées', '', 'Rusty sedge meadows and related communities', '', 4, 'Niveau 4', 1277, '/67/495/1277/4287', 'true', 'Mesophile, mostly closed, vigorous, often grazed or mowed, grasslands on deep soils of the subalpine and lower alpine levels of the Alps, the Pyrenees and, locally, of the Apennines and the Jura.', 'Caricion ferrugineae, Primulion intricatae, Laserpitio-Ranunculion thorae, Caricion austroalpinae, Armerion cantabricae', 'Pelouses mésophiles, la plupart du temps fermées, vigoureuses, souvent pâturées ou fauchées, sur sols profonds, des étages subalpin et alpin inférieur des Alpes, des Pyrénées et localement du Jura.'),
(4288, 'NR', 22, '41.11', 'Hêtraies acidiphiles médio-européennes à Luzule blanchâtre du Luzulo-Fagenion', '', 'Central European acidophilous beech forests with woodrush', '', 4, 'Niveau 4', 1278, '/68/492/1278/4288', 'true', 'Medio-European beech and, in higher mountains, beech-fir or beech-fir-spruce forests on acid soils, with Luzula luzuloides, Polytrichum formosum, and often Deschampsia flexuosa, Vaccinium myrtillus, Pteridium aquilinum.', 'Luzulo-Fagenion', 'Hêtraies médio-européennes et, en altitude, hêtraies-sapinières ou pessières sur sols acides avec Luzula luzuloides, Polytrichum formosum et souvent Deschampsia flexuosa, Vaccinium myrtillus, Pteridium aquilinum.'),
(4289, 'NR', 22, '41.12', 'Hêtraies atlantiques acidiphiles', '', 'Atlantic acidophilous beech forests', '', 4, 'Niveau 4', 1278, '/68/492/1278/4289', 'true', 'Atlantic forests on acid soils, differing from 41.11 by the absence of Luzula luzuloides and a greater abundance of Ilex aquifolium.', 'Ilici-Fagenion', 'Forêts atlantiques sur sols acides différant de 41.11 par l\'absence de Luzula luzuloides et la grande abondance d\'Ilex aquifolium.'),
(4290, 'NR', 22, '34.34', 'Pelouses calcaréo-siliceuses de l\'Europe centrale', '', 'Central European calcaro-siliceous grasslands', '', 4, 'Niveau 4', 1236, '/67/490/1236/4290', 'true', 'Low-altitude xerophile, rupicolous or psammophilous, grasslands of slightly calcareous substrates, with Festuca heteropachys, F. trachyphylla, Koeleria macrantha (= K. gracilis), Phleum phleoides, Armeria elongata, Artemisia campestris, Aster linosyris, Lychnis viscaria, Silene otites, S. nutans, Chamaespartium sagittale, Campanula patula, Potentilla rupestris, Helianthemum nummularium ssp. obscurum, H. apenninum, Scleranthus perennis, Allium senescens ssp. montanum.', 'Koelerio-Phleion phleoidis (Armerion elongatae, Sedo-Cerastion p.)', 'Pelouses xérophiles, psammophiles ou rupicoles, de basse altitude, sur substrats légèrement calcaires, avec Festuca heteropachys, F. stricta subsp. trachyphylla, Koeleria macrantha (= K. gracilis), Phleum phleoides, Armeria elongata, Artemisia campestris, Aster linosyris, Silene viscaria, Silene otites, S. nutans, Genista sagittalis, Campanula patula, Potentilla rupestris, Helianthemum grandiflorum subsp. grandiflorum, H. apenninum, Scleranthus perennis, Allium senescens subsp. montanum.'),
(4291, 'NR', 22, '35.13', 'Pelouses à canche flexueuse', '', 'Deschampsia flexuosa grasslands', '', 4, 'Niveau 4', 1276, '/67/493/1276/4291', 'true', 'Communities dominated by Deschampsia flexuosa forming, in particular, as degradation stages of Calluna and other heaths.', '', 'Groupements dominés par Deschampsia flexuosa se constituant, en particulier, au stade de dégradation des landes à Calluna et autres landes.'),
(4292, 'NR', 22, '35.14', 'Pelouses intraforestières à Calamagrostis epigejos', '', 'Wood small-reed stands', '', 4, 'Niveau 4', 1276, '/67/493/1276/4292', 'true', 'Tall Calamagrostris epigejos-dominated facies of siliceous grasslands.', '', 'Faciès des pelouses intraforestières sur substrat siliceux dominées par la grande graminée Calamagrostis epigejos.'),
(4293, 'NR', 22, '35.15', 'Pelouses à laîche des sables', '', 'Sand sedge grasslands', '', 4, 'Niveau 4', 1276, '/67/493/1276/4293', 'true', 'Closed acidophilous grasslands on fixed sands dominated by Carex arenaria or Carex ligerica.', '', 'Pelouses acidiphiles fermées, sur sables fixés, dominées par Carex arenaria ou Carex ligerica.'),
(4294, 'NR', 22, '35.21', 'Prairies siliceuses à annuelles naines', '', 'Dwarf annual siliceous grasslands', '', 4, 'Niveau 4', 1279, '/67/493/1279/4294', 'true', 'Pioneer formations of typically dwarf annuals, often ephemeral and of very limited extent, characteristic in particular of fixed sands, with Aira caryophyllea, A. praecox, Nardurus lachenalii, Vulpia bromoides, V. myuros, Trisetum ovatum, Filago arvensis, F. gallica, F. lutescens, F. minima, F. pyramidata, F. vulgaris, Spergularia morisonii, Hypochoeris glabra, Evax carpetana, Moenchia erecta, Scleranthus polycarpos, Teesdalia nudicaulis, Myosotis discolor, M. stricta, Linaria elegans, L. amethystea, Sedum lagascae, S. pedicellatum, Ornithopus perpusillus, Trifolium striatum, T. arvense, T. dubium, T. campestre, T. micranthum, Tuberaria guttata; typical former crop-following species also find a refuge in these communities.', '', 'Formations pionnières typiquement constituées de plantes annuelles naines, souvent éphémères et d\'extension très restreinte, caractéristiques en particulier des sables fixés, avec Aira caryophyllea, A. praecox, Micropyrum tenellum, Vulpia bromoides, V. myuros, Logfia arvensis, L. gallica, Filago lutescens, Logfia minima, Filago pyramidata, F. vulgaris, Spergula morisonii, Hypochoeris glabra, Evax lasiocarpa, Moenchia erecta, Scleranthus polycarpos, Teesdalia nudicaulis, Myosotis discolor, M. stricta, Ornithopus perpusillus, Trifolium striatum, T. arvense, T. dubium, T. campestre, T. micranthum, Tuberaria guttata ; des espèces autrefois répandues dans les jachères postculturales, trouvent aussi un refuge dans ces groupements.'),
(4295, 'NR', 22, '37.24', 'Prairies à Agropyre et Rumex', '', 'Flood swards and related communities', '', 4, 'Niveau 4', 1270, '/67/496/1270/4295', 'true', 'Grasslands of occasionally flooded river and lake banks, of depressions where rain water collects, of disturbed humid areas and of pastures submitted to intensive grazing.', '', 'Prairies des berges de lacs et de rivières occasionnellement inondées, des dépressions collectant les eaux pluviales, des surfaces humides perturbées ou des pâtures soumises à un pâturage intensif.'),
(4296, 'NR', 22, '37.25', 'Prairies humides de transition à hautes herbes', '', 'Transitional tall herb humid meadows', '', 4, 'Niveau 4', 1270, '/67/496/1270/4296', 'true', 'Recently abandoned hay meadows evolving towards 37.1 or towards woodland, with invasion of Polygonum bistorta, Filipendula ulmaria, Phragmites communis, may, if useful, be coded under this subunit instead of 37.21.', 'Calthion palustris p. i.a.', 'Prairies récemment abandonnées évoluant vers 37.1 ou vers un boisement, avec invasion de Polygonum bistorta, Filipendula ulmaria, Phragmites communis ; elles peuvent, si nécessaire, être codées dans cette sous-unité à la place de 37.21.'),
(4297, 'NR', 22, '34.35', 'Pelouses à fétuque pâle', '', 'Pale fescue grasslands', '', 4, 'Niveau 4', 1236, '/67/490/1236/4297', 'true', 'Xeric, thermophile grasslands of middle European calcareous rock cracks, mostly dominated by the strong tufts of the glaucous Festuca pallens and F. pannonica and of the green Sesleria albicans, and with Dianthus gratianopolitanus, Melica ciliata, Aster alpinus, Artemisia campestris ssp. lednicensis, Hieracium spp., Biscutella laevigata ssp. varia, Teucrium botrys, Allium strictum, locally distributed in the Rhenish Schist Massif, the Pfälzerwald, the Rhine-Nahe-Mainz valleys, the Rhön, the Harz and its periphery, the Black Forest foothills, the French, Swabian and Franconian Juras. The communities of the Festucion pallescentis often occupy isolated stations and include rare or relictual species which impart to many of them a distinctive biogeographical and physiognomic individuality. In particular, rare and highly disjunct western outposts occur in the Meuse basin of the Belgian and French Ardennes, harbouring, among others, very isolated populations of Draba aizoides var. montana, Artemisia alba ssp. saxatilis and Hieracium vogesiacum.', 'Festucion pallentis (Seslerio-Festucion pallescentis)', 'Pelouses thermophiles, xériques des fissures rocheuses calcaires médio-européennes, principalement dominées par les touffes épaisses et glauques de Festuca pallens et les touffes vertes de Sesleria albicans, avec Dianthus gratianopolitanus, Melica ciliata, Aster alpinus, Hieracum spp., Biscutella laevigata subsp. varia, Teucrium botrys, Allium strictum, localement distribuées dans les vallées du Rhin, du Rhône, dans le Jura français. Les communautés du Festucion pallescentis occupent souvent des stations isolées et abritent des espèces rares ou relictuelles. Ceci confère à nombre d\'entre elles une individualité physionomique et biogéographique certaine. En particulier, des avants-postes occidentaux rares et très disjoints se rencontrent dans le bassin de la Meuse des Ardennes belges et françaises, abritant, entre autres, des populations très isolées de Draba aizoides var. montana, Artemisia alba subsp. saxatilis et Hieracium vogesiacum.'),
(4588, 'NR', 22, '42.A9', 'Bois de Genévriers oxycèdres', '', 'Prickly juniper woods', '', 4, 'Niveau 4', 1400, '/68/491/1400/4588', 'true', 'Woods dominated by Juniperus oxycedrus. Most J. oxycedrus formations are at most arborescent matorrl listed under 32.131. A few may, however, qualify as woodland, as, for instance, those of Monte Limbara in Sardinia.', '', 'Bois dominés par Juniperus oxycedrus. La plupart des formations de Juniperus oxycedrus sont au plus des matorrals arborescents catalogués sous 32.131. Quelques-uns, toutefois, peuvent être qualifiés de bois.'),
(4298, 'NR', 22, '35.22', 'Pelouses siliceuses ouvertes pérennes', '', 'Perennial open siliceous grasslands', '', 4, 'Niveau 4', 1279, '/67/493/1279/4298', 'true', 'Very open grasslands dominated by perennial grasses such as Agrostis capillaris, A. vinealis, A. delicatula, A. durieui, A. castellana, Poa angustifolia, Anthoxanthum odoratum, Festuca filiformis, Corynephorus canescens, Calamagrostis epigejos or Carex arenaria, forming a transition towards 35.1.', '', 'Pelouses très ouvertes dominées par des herbacées pérennes telles que Agrostis capillaris, A. vinealis, A. truncatula subsp. commista, A. castellana, Poa angustifolia, Anthoxanthum odoratum, Festuca filiformis, Corynephorus canescens, Calamagrostis epigejos ou Carex arenaria, formant une transition vers 35.1.'),
(4299, 'NR', 22, '35.23', 'Pelouses à Corynephorus', '', 'Corynephorus grasslands', '', 4, 'Niveau 4', 1279, '/67/493/1279/4299', 'true', 'Formations of sands with Corynephorus canescens; most are dunal and should be listed under 64 (Inland dunes).', '', 'Formations des sables avec Corynephorus canescens ; la plupart sont dunaires et devraient être répertoriées en 64 (dunes de l\'intérieur des terres).'),
(4300, 'NR', 22, '38.11', 'Pâturages continus', '', 'Unbroken pastures', '', 4, 'Niveau 4', 1282, '/67/494/1282/4300', 'true', 'Continuous pastureland, unreleived by networks of ditches.', '', 'Pâturages continus, non interrompus par des fossés d\'irrigation.'),
(4301, 'NR', 22, '38.12', 'Pâturages interrompus par des fossés', '', 'Ditch-broken pastures', '', 4, 'Niveau 4', 1282, '/67/494/1282/4301', 'true', 'Grasslands drained by a network of ditches, fleets, streams or pools.', '', 'Prairies drainées par un réseau de rigoles, de ruisselets, de ruisseaux ou de mares.'),
(4302, 'NR', 22, '38.13', 'Pâturages abandonnés', '', 'Overgrown pastures', '', 4, 'Niveau 4', 1282, '/67/494/1282/4302', 'true', 'Abandoned grasslands with ruderal species.', '', 'Prairies abandonnées envahies par des espèces rudérales.'),
(4303, 'NR', 22, '34.36', 'gazons à Brachypode de Phénicie', '', 'Phoenician torgrass swards', '', 4, 'Niveau 4', 1236, '/67/490/1236/4303', 'true', 'Closed, dry perennial grasslands of eutrophic soils within the meso- and thermo-Mediterranean zones, often on post-cultural land, formed by relatively tall grasses and usually dominated by Brachypodium phoenicoides, with, among many others, Phleum bertolonii (= P. nodosum, P. pratense), Elymus repens, Carex divisa, Carthamus lanatus, Diplotaxis viminea, Echinops ritro, Euphorbia serrata, Echium vulgare, E. pustulatum, Erodium acaule, Galactites tomentosa, Lepidium graminifolium, Medicago orbicularis, Salvia verbenaca, Foeniculum vulgare, Pallenis spinosa, Psoralea bituminosa, Seseli tortuosum, Tragopogon australis, Scabiosa atropurpurea, Verbascum sinuatum, Picris hieracioides, Calamintha nepeta, Centaurea aspera, Vicia hybrida, Phlomis herba-venti and many orchids.', 'Brachypodietalia phoenicoidis', 'Pelouses pérennes sèches, fermées, sur sols eutrophes au sein des étages méso- et thermo-méditerranéens, souvent en situation post-culturale, constituées de graminées relativement hautes, habituellement dominées par Brachypodium phoenicoides, avec, parmi d\'autres, Phleum pratense subsp. serotinum, Elytrigia repens, Carex divisa, Carthamus lanatus, Diplotaxis viminea, Echinops ritro, Euphorbia serrata, Echium vulgare, E. vulgare subsp. pustulatum, Erodium acaule, Galactites elegans, Lepidium graminifolium, Medicago orbicularis, Salvia verbenaca, Foeniculum vulgare, Pallenis spinosa, Psoralea bituminosa, Seseli tortuosum, Tragopogon porrifolius subsp. australis, Scabiosa atropurpurea, Verbascum sinuatum, Picris hieracioides, Calamintha nepeta, Centaurea aspera, Vicia hybrida, Phlomis herba-venti et de nombreuses orchidées.');
INSERT INTO `corine` (`CD_HAB`, `FG_VALIDITE`, `CD_TYPO`, `LB_CODE`, `LB_HAB_FR`, `LB_HAB_FR_COMPLET`, `LB_HAB_EN`, `LB_AUTEUR`, `NIVEAU`, `LB_NIVEAU`, `CD_HAB_SUP`, `PATH_CD_HAB`, `FRANCE`, `LB_DESCRIPTION`, `CRSP_PHYTO_CB91`, `DESCRIPTIF_CB97_FR`) VALUES
(4304, 'NR', 22, '36.42', 'Pelouses des crêtes à Elyna', '', 'Wind edge naked-rush swards', '', 4, 'Niveau 4', 1277, '/67/495/1277/4304', 'true', 'Meso-xerophile, relatively closed and unsculptured swards of Elyna myosuroides forming on deep, fine soils of protruding ridges and edges exposed to strong winds in the alpine and nival levels of the Alps, Pyrenees, Cantabrian Mountains and, very locally, the Abruzzi, with Oxytropis jacquinii (O. montana), O. pyrenaica, O. carinthiaca, O. foucaudii, O. halleri, Antennaria carpatica, Dryas octopetala, Draba carinthiaca, D. siliquosa, D. fladnizensis, D. aizoides, Gentiana tenella, Erigeron uniflorus, Dianthus glacialis, D. monspessulanus ssp. sternbergii, Potentilla nivea, Saussurea alpina, Geranium argenteum, Sesleria sphaerocephala, Carex atrata, C. brevicollis, C. foetida, C. capillaris, C. nigra and C. curvula ssp. rosae.', 'Oxytropo-Elynion', 'Pelouses méso-xérophiles, relativement fermées et non façonnées, à Elyna myosuroides se formant sur des sols profonds, à texture fine, sur les croupes et les crêtes saillantes exposées à des vents forts, dans les étages alpin et nival des Alpes, des Pyrénées, ..., avec Oxytropis jacquinii (O. montana), O. neglecta, O. foucaudii, O. halleri, Antennaria carpatica, Dryas octopetala, Draba siliquosa, D. fladnizensis, D. aizoides, Gentiana tenella, Erigeron uniflorus, Dianthus glacialis, Potentilla nivea, Saussurea alpina, Geranium argenteum, Sesleria sphaerocephala, Carex atrata, C. brevicollis, C. foetida, C. capillaris, C. nigra et C. curvula subsp. rosae.'),
(4305, 'NR', 22, '34.41', 'Lisières xéro-thermophiles', '', 'Xero-thermophile fringes', '', 4, 'Niveau 4', 1283, '/67/490/1283/4305', 'true', 'Hems of xero-thermic mixed oak woods of the Quercetalia pubescenti-petraeae and related communities, with Geranium sanguineum, Vincetoxicum hirundinaria, Tanacetum corymbosum, Bupleurum falcatum, B. longifolium, Origanum vulgare, Dictamnus albus, Anthericum ramosum, Fragaria viridis, Anemone sylvestris, Lathyrus pannonicus, Peucedanum officinale, P. cervaria, P. alsaticum, Laserpitium latifolium, Polygonatum odoratum, Rosa pimpinellifolia, Trifolium rubens, Clematis recta, Coronilla coronata, Melampyrum cristatum, Campanula bononiensis, C. rapunculoides, C. persicifolia, Veronica teucrium.', 'Geranion sanguinei', 'Ourlets des chênaies mixtes xéro-thermiques des Quercetalia pubescenti-petraea et des communautés apparentées, avec Geranium sanguineum, Vincetoxicum hirundinaria, Tanacetum corymbosum, Bupleurum falcatum, B. longifolium, Origanum vulgare, Dictamnus albus, Anthericum ramosum, Fragaria viridis, Anemone sylvestris, Lathyrus pannonicus, Peucedanum officinale, P. cervaria, P.  alsaticum, Laserpitium latifolium, Polygonatum odoratum, Rosa pimpinellifolia, Trifolium rubens, Clematis recta, Coronilla coronata, Melampyrum cristatum, Campanula bononiensis, C. rapunculoides, C. persicifolia, Veronica teucrium.'),
(4306, 'NR', 22, '34.42', 'Lisières mésophiles', '', 'Mesophile fringes', '', 4, 'Niveau 4', 1283, '/67/490/1283/4306', 'true', 'More mesophile hems of Carpinion and Fagion woods, developed on deeper soil, with Trifolium medium, T. ochroleucum, Campanula baumgartenii, Origanum vulgare, Melampyrum nemorosum, M. pratense, Valeriana wallrothii, Agrimonia eupatoria, Vicia cassubica, V. dumetorum, V. orobus, V. sylvatica, Lathyrus latifolius, Teucrium scorodonia.', 'Trifolion medii', 'Ourlets plus mésophiles des forêts du Carpinion et du Fagion, développés sur des sols plus profonds, avec Trifolium medium, T. ochroleucum, Campanula baumgartenii, Origanum vulgare, Melampyrum nemorosum, M. pratense, Valeriana officinalis subsp. tenuifolia, Agrimonia eupatoria, Vicia cassubica, V. dumetorum, V. orobus, V. sylvatica, Lathyrus latifolius, Teucrium scorodonia.'),
(4307, 'NR', 22, '35.71', '', '', 'Iberian montane mat-grass swards', '', 4, 'Niveau 4', 1287, '/67/493/1287/4307', 'false', 'Supra-Mediterranean acidophilous communities rich in Nardus stricta with an accompanying cortège similar to that of the Iberian subalpine Campanulo-Nardion (36.36), rather than to that of the Atlantic and sub-Atlantic Violion caninae (35.1), occurring in particular in the Quercus pyrenaica level of the Cordillera Central.', 'Campanulo-Nardion p.', 'Pas de description disponible'),
(4308, 'NR', 22, '35.72', '', '', 'Southern Italian mat-grass swards and related communities', '', 4, 'Niveau 4', 1287, '/67/493/1287/4308', 'false', 'Closed, mesophile grasslands of depressions, flats and snow patches of the beech level of the southern Apennines, with Luzula multiflora, L. pindica, Anthoxanthum odoratum, Festuca rubra, F. varia, F. violacea, Bellardiochloa (Poa) violacea, Alopecurus gerardii, Danthonia decumbens, Phleum alpinum, Carex leporina, Hypochoeris laevigata, Dianthus deltoides, Nardus stricta, Crocus vernus, Sedum atratum, Euphrasia minima, Ajuga tenorei (A. acaulis), Potentilla neumanniana var. rigoana, P. argentea var. calabra, Ranunculus sartorianus, R. polyanthemos ssp. thomasii, Meum athamanticum, Asphodelus albus var. pollinensis, Plantago brutia, Pedicularis petiolaris, Omalotheca sylvatica (Gnaphalium sylvaticum), Cirsium vallis-demoni, Viola calcarata, Armeria majellensis; they are widespread in the siliceous Sila range and also occur on deep decalcified soils of the piani of the calcareous Pollino range.', 'Ranunculo-Nardion p.', 'Pas de description disponible'),
(4309, 'NR', 22, '35.73', '', '', 'Balkanic montane mat-grass grasslands', '', 4, 'Niveau 4', 1287, '/67/493/1287/4309', 'false', 'Closed Nardus stricta-dominated grasslands of the Fagion moesiacum zone of the Balkan peninsula.', '', 'Pas de description disponible'),
(4310, 'NR', 22, '36.43', 'Pelouses en gradins et en guirlandes', '', 'Stepped and garland grasslands', '', 4, 'Niveau 4', 1277, '/67/495/1277/4310', 'true', 'Xero-thermophile, open, sculptured, stepped or garland grasslands of the Alps, the Pyrenees and the Mediterranean mountains, with very ocal outposts in the Jura.', 'Seslerietalia albicantis, Astragaletalia sempervirentis p., Festuco-Poetalia ligulatae p., Seslerietalia juncifoliae, Daphno-Festucetalia p.', 'Pelouses en gradins ou en guirlandes, xéro-thermophiles, ouvertes, érodées, des Alpes, des Pyrénées et des montagnes méditerranéennes, avec des avant-postes très locaux dans le Jura.'),
(4311, 'NR', 22, '37.31', 'Prairies à Molinie et communautés associées', '', 'Purple moorgrass meadows and related communities', '', 4, 'Niveau 4', 1280, '/67/496/1280/4311', 'true', 'Humid grasslands of soils poor in nutrients, unfertilized and with a fluctuating water level, with Molinia caerulea, Succisa pratensis, Deschampsia cespitosa, Potentilla erecta, Allium angulosum, A. suaveolens, Betonica officinalis, Cirsium dissectum, C. tuberosum, Dianthus superbus, Trollius europaeus, Galium boreale, Gentiana asclepiadea, G. pneumonanthe, Gladiolus palustris, Silaum silaus, Selinum carvifolia, Inula salicina, Iris sibirica, Laserpitium prutenicum, Lathyrus pannonicus, Tetragonolobus maritimus, Serratula tinctoria, Carex tomentosa, C. panicea, C. pallescens, Parnassia palustris, Platanthera bifolia, Colchicum autumnale, Ophioglossum vulgatum, Dactylorhiza maculata.', 'Molinietalia: Molinion caeruleae', 'Prairies humides des sols pauvres en nutriments, non fertilisées et soumises à une fluctuation du niveau de l\'eau, avec Molinia caerulea, Succisa pratensis, Deschampsia cespitosa, Potentilla erecta, Allium angulosum, A. suaveolens, Betonica officinalis, Cirsium dissectum, C. tuberosum, Dianthus superbus, Trollius europaeus, Galium boreale, Gentiana asclepiadea, G. pneumonanthe, Gladiolus palustris, Silaum silaus, Selinum carvifolia, Inula salicina, Iris sibirica, Laserpitium prutenicum, Lathyrus pannonicus, Tetragonolobus maritimus, Serratula tinctoria, Carex tomentosa, C. panicea, C. pallescens, Parnassia palustris, Platanthera bifolia, Colchicum autumnale, Ophioglossum vulgatum, Dactylorhiza maculata.'),
(4312, 'NR', 22, '34.51', 'Pelouses xériques de la Méditerranée occidentale', '', 'West Mediterranean xeric grasslands', '', 4, 'Niveau 4', 1291, '/67/490/1291/4312', 'true', 'Formations of Spain, southern France, the large west Mediterranean islands and Italy.', '', 'Formations du sud de la France et des grandes îles de l\'ouest de la Méditerranée.'),
(4313, 'NR', 22, '36.11', 'Communautés des combes à neige acidiphiles', '', 'Acid snow-patch communities', '', 4, 'Niveau 4', 1292, '/67/495/1292/4313', 'true', 'Snow-patch communities of acid soils.', 'Salicetalia herbaceae', 'Groupements des combes à neige sur sols acides.'),
(4314, 'NR', 22, '38.21', 'Prairies de fauche atlantiques', '', 'Atlantic hay meadows', '', 4, 'Niveau 4', 1293, '/67/494/1293/4314', 'true', 'Atlantic formations with Centaurea nemoralis, Rhinanthus lanceolatus, Oenanthe pimpinelloides, Brachypodium pinnatum.', 'Brachypodio-Centaureion nemoralis', 'Formations atlantiques avec Centaurea nemoralis, Rhinanthus glacialis, Oenanthe pimpinelloides, Brachypodium pinnatum.'),
(4315, 'NR', 22, '38.22', 'Prairies de fauche des plaines médio-européennes', '', 'Medio-European lowland hay meadows', '', 4, 'Niveau 4', 1293, '/67/494/1293/4315', 'true', 'Typical medio-European formations.', 'Arrhenatherion s.s.', 'Formations médio-européennes typiques.'),
(4316, 'NR', 22, '38.23', 'Prairies de fauche submontagnardes médio-européennes', '', 'Medio-European submontane hay meadows', '', 4, 'Niveau 4', 1293, '/67/494/1293/4316', 'true', 'Medio-European formations of mid-elevations, characteristic in particular of higher elevations of the lesser Hercynian ranges, intermediate between this unit and 38.3.', '', 'Formations médio-européennes d\'altitude moyenne, caractéristiques en particulier des plus hautes altitudes des basses montagnes hercyniennes, intermédiaires entre cette unité et 38.3.'),
(4317, 'NR', 22, '34.52', 'Pâtures pérennes du sud-ouest méditerranéen', '', 'South-western Mediterranean perennial pastures', '', 4, 'Niveau 4', 1291, '/67/490/1291/4317', 'false', 'Iberian xerophile, intensively grazed pastures of both siliceous and calcareous substrates, dominated by short, perennial grasses, rich in specialized annuals, in particular peas and composites.', 'Poetea bulbosae', 'Pelouses ibériques xérophiles intensivement pâturées des substrats calcaires et siliceux, dominées par de petites graminées vivaces et riches en annuelles spécialisées, en particulier des fabacées et des astéracées.'),
(4318, 'NR', 22, '36.12', 'Communautés de combes à neige sur substrats calcaires', '', 'Calcareous snow-patch communities', '', 4, 'Niveau 4', 1292, '/67/495/1292/4318', 'true', 'Snow-patch communitites of calcareous soils with Salix reticulata, S. retusa, Arabis caerulea, Carex atrata, Ranunculus alpestris, Saxifraga androsacea.', 'Arabidetalia caeruleae: Arabidion caeruleae', 'Communautés de combes à neige des sols calcaires avec Salix reticulata, S. retusa, Arabis caerulea, Carex atrata, Ranunculus alpestris, Saxifraga androsacea.'),
(4319, 'NR', 22, '37.61', '', '', 'Greek supra-Mediterranean humid meadows', '', 4, 'Niveau 4', 1290, '/67/496/1290/4319', 'false', 'Meso-hygrophile grasslands of alluvial and other high water-table sites of the Ostryo-Carpinion zone of Greece, particularly of Macedonia and Thrace, with Trifolium resupinatum, and several other Trifolium species, Alopecurus utriculatus, Hordeum murinum, Ranunculus marginatus, R. velutinus, Cirsium canum var. macedonicum, Narcissus poeticus, Leucojum aestivum.', 'Trifolion resupinati', 'Pas de description disponible'),
(4320, 'NR', 22, '37.62', '', '', 'Apennine humid meadows', '', 4, 'Niveau 4', 1290, '/67/496/1290/4320', 'false', 'Permanent humid grasslands of Apennine karstic basins, with Ranunculus velutinus, Bromus racemosus, Hordeum secalinum, Trifolium dubium, T. resupinatum, T. micranthum, T. patens, T. fragiferum, T. pratense, T. repens, Carex distans, Deschampsia cespitosa, Gaudinia fragilis, Ophioglossum vulgatum, Centaurea jacea, Holcus lanatus, Alopecurus utriculatus, Orchis laxiflora, Colchicum lusitanica.', 'Ranunculion velutini', 'Pas de description disponible'),
(4321, 'NR', 22, '37.71', 'Voiles des cours d\'eau', '', 'Watercourse veils', '', 4, 'Niveau 4', 1294, '/67/496/1294/4321', 'true', 'Screens or veils of perennial tall herbs, small bushes and lianas (Calystegia sepium, Cuscusta europaea) lining lowland watercourses, and sometimes other water bodies, with many ruderal and introduced plants (Aster spp., Rudbeckia spp., Solidago spp., Helianthus spp., Impatiens spp., Reynoutria japonica).', 'Senecion fluviatilis (Calystegion sepium), Convolvulion sepium p., Aegopodion podagrariae p.', 'Ourlets de grandes herbes pérennes, de petits buissons et de lianes (Calystegia sepium, Cuscuta europaea) suivant les cours d\'eau des plaines, et quelquefois d\'autres plans d\'eau, avec de nombreuses plantes rudérales et introduites (Aster spp., Rudbeckia spp., Solidago spp., Helianthus spp., Impatiens spp., Reynoutria japonica).'),
(4322, 'NR', 22, '34.53', '', '', 'East Mediterranean xeric grasslands', '', 4, 'Niveau 4', 1291, '/67/490/1291/4322', 'false', 'Formations of continental, peninsular and insular Greece.', 'Brachypodio-Chrysopogonetea p.: Cymbopogoni-Brachypodiotalia: Cymbopogoni-Brachypodion ramosi', 'Pas de description disponible'),
(4323, 'NR', 22, '36.31', 'Gazons à Nard raide et groupements apparentés', '', 'Mat-grass swards and related communities', '', 4, 'Niveau 4', 1297, '/67/495/1297/4323', 'true', 'Closed grasslands of deep, acid soils of the Alps, Pyrenees, northern Apennines, Jura and higher Hercynian ranges, developed mostly and abundantly in the subalpine level, dominated or co-dominated by Nardus stricta, Festuca eskia, F. nigrescens, F. rubra, Alopecurus gerardii, Bellardiochloa (Poa) violacea, Carex sempervirens, Anthoxanthum odoratum.', 'Nardion', 'Communautés denses sur sols acides profonds des Alpes, des Pyrénées, du Jura et des Vosges, développées principalement et abondamment à l\'étage subalpin, dominées ou codominées par Nardus stricta, Festuca eskia, F. nigrescens, F. rubra, Alopecurus gerardii, Bellardiochloa (Poa) variegata, Carex sempervirens, Anthoxanthum odoratum.'),
(4324, 'NR', 22, '36.44', 'Communautés alpines métallifères', '', 'Alpine heavy metal communities', '', 4, 'Niveau 4', 1277, '/67/495/1277/4324', 'true', 'Formations of heavy metal soils of the alpine and subalpine levels, with, among others, Dianthus sylvestris, Galium anisophyllum, Poa alpina and the very restricted southern Alpine endemic Viola dubyana.', 'Violetalia calaminariae: Galio anisophylli-Minuartion vernae i.a.', 'Formations des sols métallifères des étages alpin et subalpin, avec parmi d\'autres, Dianthus sylvestris, Galium anisophyllum, Poa alpina et Viola dubyana endémique très restreinte des Alpes du sud.'),
(4325, 'NR', 22, '36.51', 'Prairies subalpines à Trisetum flavescens', '', 'Subalpine yellow oatgrass hay meadows', '', 4, 'Niveau 4', 1298, '/67/495/1298/4325', 'true', 'Trisetum flavescens-dominated grasslands of the subalpine level. Yellow oatgrass hay meadows are typically montane and have been listed and described under 38.3; subalpine representatives may, however, be coded under this unit when useful to preserve the unity of subalpine habitat complexes.', 'Polygono-Trisetion p.', 'Prairies dominées par Trisetum flavescens de l\'étage subalpin. Ces prairies sont typiquement montagnardes et sont répertoriées et décrites en 38.3 ; les prairies subalpines représentatives peuvent, cependant, être codées sous ce numéro pour préserver l\'unité des complexes d\'habitats subalpins.'),
(4326, 'NR', 22, '36.52', 'Pâturages à Liondent hispide', '', 'Rough hawkbit pastures', '', 4, 'Niveau 4', 1298, '/67/495/1298/4326', 'true', 'Species-poor manured cattle pastures of the subalpine and lower alpine levels, with Agrostis alpina, Phleum alpinum, Poa alpina, Cerastium fontanum, Crepis aurea, Leontodon hispidus, Trifolium badium, T. thalii.', 'Poion alpinae', 'Pâturages à bovins, pauvres en espèces, enrichies en engrais, des étages subalpin et alpin inférieur, avec Agrostis alpina, Phleum alpinum, Poa alpina, Cerastium fontanum, Crepis aurea, Leontodon hispidus, Trifolium badium, T. thalii.'),
(4327, 'NR', 22, '34.61', '', '', 'Alpha steppes', '', 4, 'Niveau 4', 1295, '/67/490/1295/4327', 'false', 'Stipa tenacissima-dominated formations of Spain, distributed mostly on the Meseta, in the Maestrazgo, in the Guadalquivir basin, in Baetic regions and in the arid Iberian Southeast.', '', 'Pas de description disponible'),
(4328, 'NR', 22, '34.62', '', '', 'Esparto steppes', '', 4, 'Niveau 4', 1295, '/67/490/1295/4328', 'false', 'Lygeum spartum-dominated formations of the Ebro basin, the arid Iberian Southeast, the Guadalquivir basin, Sardinia, Sicily, southern Italy and Crete.', '', 'Pas de description disponible'),
(4329, 'NR', 22, '34.63', 'Steppes à Stipa, Ampelodesmos, Andropogon, fétuque', '', 'Berceales, feathergrass, diss, andropogonid, fescue steppes', '', 4, 'Niveau 4', 1295, '/67/490/1295/4329', 'true', 'Other Mediterranean tall-grass steppes.', '', 'Autres steppes méditerranéennes à grandes graminées.'),
(4330, 'NR', 22, '54.5F', 'Tourbières tremblantes à Scirpus hudsonianus', '', 'Alpine deergrass quaking bogs', '', 4, 'Niveau 4', 1341, '/71/504/1341/4330', 'true', 'Transition mire communities dominated by Scirpus hudsonianus. It is in these that the species finds its principal habitat.', '', 'Communautés de tourbières de transition dominées par Scirpus hudsonianus. C\'est dans celle-ci que l\'espèce trouve son habitat principal.'),
(4331, 'NR', 22, '54.5G', '', '', 'Iberian quaking bogs', '', 4, 'Niveau 4', 1341, '/71/504/1341/4331', 'false', 'Sphagnum communities of the collinar, and locally, montane, areas of northwestern Iberia, intermediate between transition mire and bog, with Drosera rotundifolia, Carex durieui, Narthecium ossifragum, Sphagnum tenellum, S. subnitens, Odontoschisma sphagni, Aulacomnium palustre.', 'Erico mackayanae-Sphagnetum papillosi i.a.', 'Pas de description disponible'),
(4332, 'NR', 22, '61.11', 'Eboulis siliceux alpins', '', 'Alpine siliceous screes', '', 4, 'Niveau 4', 1300, '/69/497/1300/4332', 'true', 'Siliceous, cool, damp screes of the sub-alpine and alpine levels of the Alps and the Pyrenees, with Androsace alpina, Achillea nana, Oxyria digyna, Geum reptans, Saxifraga bryoides, Ranunculus glacialis, Linaria alpina.', 'Androsacion alpinae', 'Eboulis siliceux , froids, humides des étages alpin et subalpin des Alpes et des Pyrénées, avec Androsace alpina, Achillea nana, Oxyria digyna, Geum reptans, Saxifraga bryoides, Ranunculus glacialis, Linaria alpina.'),
(4333, 'NR', 22, '53.12', 'Scirpaies lacustres', '', 'Common clubrush beds', '', 4, 'Niveau 4', 1368, '/71/513/1368/4333', 'true', 'Scirpus lacustris formations, intolerant of drying, tolerant of water circulation, and thus forming the outer belts of reedbeds.', 'Scirpetum lacustris (Scirpo-Phragmitetum p.)', 'Formations à Schoenoplectus lacustris, intolérantes à la sècheresse, tolérantes aux circulations d\'eau, et ainsi formant la ceinture externe des roselières.'),
(4334, 'NR', 22, '53.13', 'Typhaies', '', 'Reedmace beds', '', 4, 'Niveau 4', 1368, '/71/513/1368/4334', 'true', 'Typha latifolia, T. angustifolia, T. domingensis, T. laxmannii formations, usually extremely species-poor and sometimes almost pure, tolerant of extended periods of dryness and of pollution.', 'Typhetum angustifoliae, Typhetum latifoliae (Scirpo-Phragmitetum p.)', 'Formations de Typha latifolia, T. angustifolia, T. domingensis, T. laxmannii, habituellement extrêmement pauvres en espèces et quelquefois avec une seule espèce ; tolérantes à des périodes prolongées de sécheresse et à la pollution.'),
(4335, 'NR', 22, '53.14', 'Roselières basses', '', 'Medium-tall waterside communities', '', 4, 'Niveau 4', 1368, '/71/513/1368/4335', 'true', 'Formations of shorter, mostly non-graminoid helophytes emerging from mesotrophic or eutrophic, stagnant or slow-moving, shallow water, and constituting fringes or patches within or alongside reedbeds.', '', 'Formations de petits hélophytes le plus souvent non-graminoïdes, émergeant des eaux superficielles mésotrophes ou eutrophes, stagnantes ou à écoulement faible, et constituant des franges ou des plages à l\'intérieur ou le long des roselières.'),
(4336, 'NR', 22, '54.26', 'Bas-marais à Carex nigra', '', 'Black sedge alkaline fens', '', 4, 'Niveau 4', 1359, '/71/504/1359/4336', 'true', 'Rich fen communities dominated by Carex nigra, accompanied by calciphile species and brown mosses.', '', 'Communautés de bas-marais alcalins, dominées par Carex nigra, accompagné d\'espèces calciphiles et de mousses brunes.'),
(4337, 'NR', 22, '54.27', '', '', 'Russet sedge fens', '', 4, 'Niveau 4', 1359, '/71/504/1359/4337', 'false', 'Carex saxatilis-dominated mires of high calcareous mountains of the Central Highlands of Scotland, with Carex saxatilis, Juncus triglumis, J. castaneus, Saxifraga aizoides and brown mosses.', '', 'Pas de description disponible'),
(4338, 'NR', 22, '54.28', 'Bas-marais à Carex frigida', '', 'Ice sedge fens', '', 4, 'Niveau 4', 1359, '/71/504/1359/4338', 'true', 'Mostly sub-alpine formations dominated by Carex frigida, colonizing seepages and flushes on stony slopes of the Alps, the Pyrenees and the Black Forest, with Carex davalliana, C. demissa, C. panicea, C. nigra, Juncus triglumis, J. castaneus, Blysmus compressus, Tofieldia calyculata, Parnassia palustris, Pinguicula vulgaris, P. grandiflora, Primula farinosa, Saxifraga aizoides, Campylium stellatum.', 'Caricetum frigidae (Saxifrago-Caricetum frigidae, Tofieldio-Caricetum frigidae, Cariceto frigidae-Pinguiculo grandiflorae, Primulo-Caricetum frigidae, Soldanello-Caricetum frigidae)', 'Formations pour la plupart subalpines dominées par Carex frigida, colonisant des suintements et des ruissellements sur des versants caillouteux des Alpes, des Pyrénées et de la Forêt Noire, avec Carex davalliana, C. demissa, C. panicea, C. nigra, Juncus triglumis, Blysmus compressus, Tofieldia calyculata, Parnassia palustris, Pinguicula vulgaris, P. grandiflora, Primula farinosa, Saxifraga aizoides, Campylium stellatum.'),
(4339, 'NR', 22, '54.29', '', '', 'British saxifrage-sedge flushes', '', 4, 'Niveau 4', 1359, '/71/504/1359/4339', 'false', 'Carex demissa-Saxifraga aizoides communities of sub-montane base-rich seeps in northern Wales, northern England, southern Scotland and, mostly, the Scottish Highlands, with Juncus articulatus, Carex panicea, Eleocharis quinqueflora, Selaginella selaginoides and brown mosses. Montane saxifrage-sedge flushes with glacial relicts have been listed under 54.34.', '', 'Pas de description disponible'),
(4340, 'NR', 22, '54.2A', 'Bas-marais à Eleocharis quinqueflora', '', 'Spike-rush fens', '', 4, 'Niveau 4', 1359, '/71/504/1359/4340', 'true', 'Eleocharis quinqueflora-dominated rich fen communities, for the most part species-poor pioneering formations.', '', 'Communautés riches dominées par Eleocharis quinqueflora, pour la plupart formations pionnières pauvres en espèces.'),
(4341, 'NR', 22, '61.12', 'Eboulis siliceux des montagnes nordiques', '', 'Northern upland siliceous screes', '', 4, 'Niveau 4', 1300, '/69/497/1300/4341', 'true', 'Siliceous screes of hills of western and central Europe, with Epilobium collinum, Galeopsis segetum, Senecio viscosus, Anarrhinum bellidifolium, Cryptogramma crispa. Upland siliceous screes, often resulting from quarry activity, and colonized by very impoverished forms of the Alpine communities, usually rich in mosses, lichens and sometimes ferns, notably Cryptogramma crispa, are included.', 'Galeopsion segetum', 'Eboulis siliceux des collines de l\'Europe occidentale et centrale avec Epilobium collinum, Galeopsis segetum, Senecio viscosus, Anarrhinum bellidifolium, Cryptogramma crispa. Les éboulis siliceux montagnards sont souvent le résultat d\'une activité d\'extraction et sont colonisés par des formes tout à fait improvisées de communautés alpiennes, généralement riches en Mousses, Lichens, et quelquefois Fougères, comprenant notamment Cryptogramma crispa.'),
(4342, 'NR', 22, '61.21', 'Eboulis alpiens sur calcschistes', '', 'Alpine calcschist screes', '', 4, 'Niveau 4', 1301, '/69/497/1301/4342', 'true', 'Calcareous slate slope communities of the Alps, with Draba hoppeana, Campanula cenisia, Saxifraga biflora, Herniaria alpina, Trisetum spicatum.', 'Drabion hoppeanae', 'Communautés des versants couverts de schistes calcaires des Alpes, avec Draba hoppeana, Campanula cenisia, Saxifraga biflora, Herniaria alpina, Trisetum spicatum.'),
(4343, 'NR', 22, '53.11', 'Phragmitaies', '', 'Common reed beds', '', 4, 'Niveau 4', 1368, '/71/513/1368/4343', 'true', 'Beds of Phragmites australis.', 'Phragmitetum (Scirpo-Phragmitetum p., Typho-Phragmitetum maximi, Scirpo lacustris-Phragmitetum mediterraneum)', 'Roselière à Phragmites australis.'),
(4344, 'NR', 22, '53.15', 'Végétation à Glyceria maxima', '', 'Reed sweetgrass beds', '', 4, 'Niveau 4', 1368, '/71/513/1368/4344', 'true', 'Glyceria maxima formations, rather low, usually constituting strips in or along ditches or small streams, often in grasslands, requiring fairly constant inundation by eutrophic water and with a fairly rich associated flora.', 'Glycerietum maximae', 'Peuplements de Glyceria maxima, plutôt bas, constituant habituellement des bandes étroites dans ou le long de fossés ou de petits ruiseaux, souvent dans des systèmes prairiaux, exigeant une inondation relativement constante par des eaux eutrophes et avec une flore associée riche.'),
(4345, 'NR', 22, '54.2B', '', '', 'Greek flat sedge fens', '', 4, 'Niveau 4', 1359, '/71/504/1359/4345', 'false', 'Blysmus compressus-dominated communities of Greek mountains, with Parnassia palustris, Veronica balcanica, V. anagallis-aquatica, Eleocharis uniglumis, E. quinqueflora, Carex hirta, and with Juncus thomasii, Bellis perennis or Leontodon hispidus on limestone, Pinguicula hirtiflora, P. balcanica, Soldanella pindicola, Eriophorum latifolium, Carex nigra on ophiolites.', '', 'Pas de description disponible'),
(4346, 'NR', 22, '54.2C', 'Bas-marais alcalins à Carex rostrata', '', 'Bottle sedge alkaline fens', '', 4, 'Niveau 4', 1359, '/71/504/1359/4346', 'true', 'Carex rostrata-dominated formations of very wet sites in rich fens, usually with a carpet of brown mosses and few vascular plants other than the sedge; these grade into transition mire communities of 54.5.', '', 'Formations dominées par Carex rostrata dans de nombreux sites humides des bas-marais alcalins, généralement avec un tapis de mousses brunes et de plantes vasculaires de marécages autres que les Cypéracées ; cette unité fait la transition avec les communautés marécageuses de 54.5.'),
(4347, 'NR', 22, '54.2D', 'Tourbières basses alcalines à Scirpus hudsonianus', '', 'Alpine deergrass alkaline fens', '', 4, 'Niveau 4', 1359, '/71/504/1359/4347', 'true', 'Scirpus hudsonianus-dominated stands of fens, less common than those of transition mires (54.5).', '', 'Stations à Scirpus hudsonianus dominant des bas-marais alcalins, moins communs que ceux des marais de transition 54.5.'),
(4348, 'NR', 22, '54.2E', 'Bas-marais alcalins à Trichophorum cespitosum', '', 'Deergrass alkaline fens', '', 4, 'Niveau 4', 1359, '/71/504/1359/4348', 'true', 'Scirpus cespitosus stands of rich fens, other than those that occur as facies of Davall sedge fens.', '', 'Stations à Trichophorum cespitosum des bas-marais alcalins autres que ceux apparaissant comme un faciès des marais à Carex davalliana.'),
(4349, 'NR', 22, '54.2F', 'Bas-marais médio-européens à Blysmus compressus', '', 'Middle European flat sedge fens', '', 4, 'Niveau 4', 1359, '/71/504/1359/4349', 'true', 'Blysmus compressus-dominated stands of rich fens other than Greek flat sedge fens (54.2B).', '', 'Stations à Blysmus compressus dominant des bas-marais alcalins autres que ceux des marais à Blysmus de la Grèce.'),
(4350, 'NR', 22, '54.2G', 'Bas-marais alcalins à petites herbes', '', 'Small herb alkaline fens', '', 4, 'Niveau 4', 1359, '/71/504/1359/4350', 'true', '', '', 'Communautés simplifiées de bas-marais alcalin formées par quelques espèces non-graminoïdes, en particulier, Anagallis tenella et Parnassia palustris.'),
(4351, 'NR', 22, '54.2H', 'Bas-marais alcalins dunaires à Carex trinervis', '', 'Calcareous dunal rush-sedge fens', '', 4, 'Niveau 4', 1359, '/71/504/1359/4351', 'true', '', '', 'Formations de Carex trinervis, Juncus anceps, J. subnodulosus, Parnassia palustris, Gentianella amarella, Herminium monorchis, Depranocladus aduncus, Campylium stellatum, sans, ou avec un peu de Schoenus nigricans. Ces communautés sont caractéristiques de pannes dunaires calcaires belges et françaises septentrionales. Elles sont limitées à des systèmes dunaires et ce code sera donc utilisé en conjonction avec 16.33. Elles sont gravement menacées.'),
(4352, 'NR', 22, '54.2I', 'Bas-marais à hautes herbes', '', 'Tall herb fens', '', 4, 'Niveau 4', 1359, '/71/504/1359/4352', 'true', 'Fens invaded by Peucedanum palustre, Eupatorium cannabinum, Cicuta virosa, Symphytum officinale, Lysimachia vulgaris, Cladium mariscus, Phragmites australis, Glyceria maxima, Calamagrostis canescens.', '', 'Bas-marais envahis par Peucedanum palustre, Eupatorium cannabinum, Cicuta virosa, Symphytum officinale, Lysimachia vulgaris, Cladium mariscus, Phragmites australis, Glyceria maxima, Calamagrostis canescens.'),
(4353, 'NR', 22, '64.14', 'Fourrés sur dunes continentales', '', 'Inland dune thickets', '', 4, 'Niveau 4', 1367, '/69/512/1367/4353', 'true', 'Formations of large shrubs colonizing inland dunes', '', 'Formations de grandes broussailles colonisant des dunes continentales.'),
(4354, 'NR', 22, '64.15', '', '', 'Inland dune woods', '', 4, 'Niveau 4', 1367, '/69/512/1367/4354', 'false', 'Natural woods, usually birch-oak or, east of the Elbe, Pinus sylvestris, installed within inland dune systems. Their composition can be speccified by use of codes of 41 or 42.', '', 'Pas de description disponible'),
(4355, 'NR', 22, '64.16', '', '', 'Northern river dunes', '', 4, 'Niveau 4', 1367, '/69/512/1367/4355', 'false', 'Formations of the immediate vicinity of great rivers within the North Sea-Baltic plain, comprising, besides the communities of 64.11 to 64.15, slightly calcareous grasslands of 34.12 and 34.34.', '', 'Pas de description disponible'),
(4356, 'NR', 22, '61.22', 'Eboulis alpiens à Tabouret à feuilles rondes', '', 'Alpine pennycress screes', '', 4, 'Niveau 4', 1301, '/69/497/1301/4356', 'true', 'Unstable, hard limestone and dolomite coarse screes of the alpine and nival levels of the Alps, with Thlaspi rotundifolium, Papaver rhaeticum, P. sendtneri, Viola cenisia, Linaria alpina, Arabis alpina.', 'Thlaspion rotundifolii: Thlaspietum rotundifolii i.a.', 'Eboulis instables, à calcaires durs et dolomies grossières des étages alpin et nival des Alpes, avec Thlaspi rotundifolia, Papaver alpinum subsp. rhaeticum, Viola cenisia, Linaria alpina, Arabis alpina.'),
(4357, 'NR', 22, '61.23', 'Eboulis calcaires fins', '', 'Fine calcareous screes', '', 4, 'Niveau 4', 1301, '/69/497/1301/4357', 'true', 'Fine-element calcareous screes of the alpine, sub-alpine and high montane levels of the Alps and neighbouring ranges.', 'Petasition paradoxi, Thlaspion rotundifolii: Leontodontetum montani i.a.', 'Eboulis à éléments calcaires fins des étages alpin, subalpin et montagnard supérieur des Alpes et des régions avoisinantes.'),
(4358, 'NR', 22, '53.16', 'Végétation à Phalaris arundinacea', '', 'Reed canary-grass beds', '', 4, 'Niveau 4', 1368, '/71/513/1368/4358', 'true', 'Phalaris arundinacea formations, pure or mixed with Phragmites australis, very tolerant of drying, pollution and perturbance, susceptible of forming the landward belt of reedbeds and often characteristic of degraded systems.', 'Phalaridetum arundinaceae', 'Peuplements de Phalaris arundinacea, purs ou mixtes avec Phragmites australis, très résistants à la sècheresse, la pollution et aux autres perturbations, susceptibles de former la ceinture (côté terre) des roselières et souvent caractéristiques des systèmes dégradés.'),
(4359, 'NR', 22, '53.17', 'Végétation à Scirpes halophiles', '', 'Halophile clubrush beds', '', 4, 'Niveau 4', 1368, '/71/513/1368/4359', 'true', 'Formations of Scirpus Tabernaemontani, S. maritimus, S. triqueter, S. litoralis, S. pungens mostly characteristic of brackish or saline waters to 1.5 m deep.', 'Scirpion maritimi', 'Formations de Schoenoplectus tabernaemontani, Bolboschoenus maritimus, Schoenoplectus triqueter, S. litoralis, S. pungens plutôt caractéristiques des eaux saumâtres ou salées jusqu\'à une profondeur de 1,5 mètres.'),
(4360, 'NR', 22, '53.21', 'Peuplements de grandes Laîches (Magnocariçaies)', '', 'Large Carex beds', '', 4, 'Niveau 4', 1306, '/71/513/1306/4360', 'true', 'Formations of social sedges of genus Carex, usually dominated by one species that can be either tussock-forming or bed-forming. They can be arranged according to dominant species.', '', 'Formations de Cypéracées sociales du genre Carex, dominées généralement par une seule espèce qui peut indifféremment former des touradons ou des nappes. Elles peuvent être classées en fonction de l\'espèce dominante.'),
(4361, 'NR', 22, '54.31', 'Gazons riverains arctico-alpins à élyne fausse Laîche', '', 'Arcto-alpine riverine false sedge swards', '', 4, 'Niveau 4', 1307, '/71/504/1307/4361', 'true', 'Communities of Kobresia simpliciuscula, Carex microglochin, Scirpus pumilus, Tofieldia pusilla, Carex dioica.', 'Kobresietum simpliciusculae', 'Communautés à Kobresia simpliciuscula, Carex microglochin, Trichophorum pumilum, Tofieldia calyculata, Carex dioica.'),
(4362, 'NR', 22, '54.32', 'Gazons riverains arctico-alpins à Carex maritima', '', 'Arcto-alpine riverine curved sedge swards', '', 4, 'Niveau 4', 1307, '/71/504/1307/4362', 'true', 'Communities of Carex bicolor, C. maritima, C. atrofusca, Juncus arcticus.', 'Caricetum maritimae', 'Communautés de Carex bicolor, C. maritima, C. atrofusca, Juncus arcticus.'),
(4363, 'NR', 22, '54.33', 'Gazons riverains arctico-alpins à Typha', '', 'Arcto-alpine riverine Typha swards', '', 4, 'Niveau 4', 1307, '/71/504/1307/4363', 'true', 'Typha minima, T. shuttleworthii, Juncus alpinoarticulatus, Equisetum variegatum communities of cold slow-flowing waters.', 'Equiseto-Typhetum minimae', 'Communautés des eaux froides à courant lent de Typha minima, T. shuttleworthii, Equisetum variegatum.'),
(4364, 'NR', 22, '54.34', '', '', 'British mica flushes', '', 4, 'Niveau 4', 1307, '/71/504/1307/4364', 'false', 'Rare communities of micaceous stony flushes of the Highlands of Scotland and of upper Teesdale, with Carex atrofusca, C. microglochin, C. demissa, C. dioica, C. panicea, Juncus triglumis, J. biglumis, J. castaneus, Kobresia simpliciuscula, Tofieldia pusilla, Saxifraga aizoides, Thalictrum alpinum, Equisetum variegatum, E. hyemale and the moss Blindia acuta.', '', 'Pas de description disponible'),
(4365, 'NR', 22, '64.61', 'Dunes riveraines du Rhône', '', 'Rhône riverine dunes', '', 4, 'Niveau 4', 1309, '/69/512/1309/4365', 'true', 'Fossil dunes of the Camargue, built up by silty alluvial sands of the Rhône.', '', 'Dunes fossiles de la Camargue, construites par des sables alluviaux limoneux du Rhône.'),
(4366, 'NR', 22, '64.62', '', '', 'Southern Iberian inland dunes', '', 4, 'Niveau 4', 1309, '/69/512/1309/4366', 'false', 'Fossil dunes of the Coto Doñana and other areas of southwestern Iberia. They support very specialized brushes (32.2A) and open grasslands belonging to the Malcomietalia (35.4, 16.228).', '', 'Pas de description disponible'),
(4367, 'NR', 22, '61.31', 'Eboulis thermophiles péri-alpins', '', 'Peri-Alpine thermophilous screes', '', 4, 'Niveau 4', 1305, '/69/497/1305/4367', 'true', 'Mostly coarse, unstablized, sunny calcareous screes of the montane and sub-alpine levels of the Alps and of the uplands and lowlands of western and central middle Europe.', 'Stipion calamagrostidis, Leontodontion hyoseroidis', 'Eboulis calcaires le plus souvent grossiers, instables, ensoleillés des étages montagnard et subalpin des Alpes, des plateaux et plaines de l\'Europe moyenne, centrale et occidentale.'),
(4368, 'NR', 22, '61.32', 'Eboulis provençaux', '', 'Provençal screes', '', 4, 'Niveau 4', 1305, '/69/497/1305/4368', 'true', 'Screes of Mediterranean southeern France, with Gouffeia arenarioides, Ptychotis heterophylla, Linaria supina, Centranthus ruber, Crucianella latifolia.', 'Pimpinello-Gouffeion', 'Eboulis de la France méridionale méditerranéenne, avec Gouffeia arenarioides, Ptychotis saxifraga, Linaria supina, Centranthus ruber, Crucianella latifolia.'),
(4369, 'NR', 22, '54.41', 'Ceintures lacustres à Eriophorum scheuchzeri', '', 'Alpine cottongrass lake girdles', '', 4, 'Niveau 4', 1314, '/71/504/1314/4369', 'true', 'Almost pure swards of Eriophorum scheuchzeri fringing small, cold, acidic lakes above the tree limit. Permenently inundated, they include few other vascular plants, limited to a few individuals of Carex nigra, C. rostrata, C. lachenalii, C. brunnescens, Juncus filiformis, Eriophorum angustifolium; the moss Drepanocladus exannulatus is usually present and abundant.', 'Eriophoretum scheuchzeri', 'Gazons pratiquement purs d\'Eriophorum scheuchzeri bordant les petits lacs froids aux eaux acides au-dessus de la limite des arbres. Inondés en permanence, ils comprennent peu d\'autres plantes vasculaires, limités à un petit nombre d\'individus de Carex nigra, C. rostrata, C. lachenalii, C. brunnescens, Juncus filiformis, Eriophorum angustifolium ; la Mousse Drepanocladus exannulatus est généralement présente et abondante.'),
(4370, 'NR', 22, '54.42', 'Tourbières basses à Carex nigra, C. canescens et C. echinata', '', 'Black-white-star sedge fens', '', 4, 'Niveau 4', 1314, '/71/504/1314/4370', 'true', 'Acidic fen communities of middle Europe, the Alpine system, the Pyrenees and northern Iberia, rich in Carex nigra, C. canescens, C. echinata, often accompanied by Eriophorum angustifolium and Juncus spp., with a muscinal layer of brown mosses, sphagnums or both.', 'Caricetum fuscae s.l.', 'Communautés de bas-marais acides d\'Europe moyenne, du système alpien et des Pyrénées, riches en Carex nigra, C. canescens, C. echinata, souvent accompagnés d\'Eriophorum angustifolium et de Juncus spp., avec une strate muscinale de Mousses brunes, de Sphaignes ou d\'Hépatiques.'),
(4371, 'NR', 22, '66.61', '', '', 'Italian fumaroles', '', 4, 'Niveau 4', 1320, '/69/499/1320/4371', 'false', 'Fumaroles of the Italian peninsula and its small islands, in particular those of Isola d\'Ischia, with communities that include Cyperus polystachyos.', '', 'Pas de description disponible'),
(4372, 'NR', 22, '66.62', '', '', 'Etna fumaroles', '', 4, 'Niveau 4', 1320, '/69/499/1320/4372', 'false', 'Fumaroles of Mount Etna.', '', 'Pas de description disponible'),
(4373, 'NR', 22, '66.63', '', '', 'Pantelleria fumaroles', '', 4, 'Niveau 4', 1320, '/69/499/1320/4373', 'false', 'Fumaroles of Pantelleria. Their walls, mouth and immediate vicinity are colonized by a succession of microvegetation composed of bryophytes, ferns and a few angiosperms. Constituting plants include the endemic moss Calymperes sommieri, sole Mediterranean representative of a tropical genus, as well as Radiola linoides, Kickxia cirrhosa, Trifolium angustifolium, Centaurium maritimum.', 'Radiolo-Kickxietum cirrhosae', 'Pas de description disponible'),
(4374, 'NR', 22, '66.64', '', '', 'Canarian fumaroles', '', 4, 'Niveau 4', 1320, '/69/499/1320/4374', 'false', 'Fumaroles of the Canary Islands with, in particular, the endemic Gnaphalium teydeum.', '', 'Pas de description disponible'),
(4375, 'NR', 22, '61.33', 'Eboulis pyrénéo-alpiens siliceux thermophiles', '', 'Pyreneo-Alpine thermo-siliceous screes', '', 4, 'Niveau 4', 1305, '/69/497/1305/4375', 'true', 'Siliceous screes of warm slopes of the sub-alpine level of the Alps and of the alpine and sub-alpine levels of the Pyrenees, usually composed largely of big stones or boulders, with Senecio leucophyllus, Taraxacum pyrenaicum, Galeopsis pyrenaica, Xatartia scabra, Armeria alpina.', 'Senecion leucophyllae, Taraxacion pyrenaici', 'Eboulis siliceux sur les versants chauds de l\'étage subalpin des Alpes et des étages alpin et subalpin des Pyrénées, généralement composés de grosses pierres ou de gros blocs, avec Senecio leucophyllus, Galeopsis pyrenaica, Xatardia scabra, Armeria alpina.'),
(4376, 'NR', 22, '61.34', 'Eboulis calcaires pyrénéens', '', 'Pyrenean calcareous screes', '', 4, 'Niveau 4', 1305, '/69/497/1305/4376', 'true', 'Calcareous screes of the Pyrenees.', 'Iberidion spathulatae', 'Eboulis calcaires des Pyrénées.'),
(4377, 'NR', 22, '61.35', 'Eboulis calcaires oro-cantabriques', '', 'Oro-Cantabrian calcareous screes', '', 4, 'Niveau 4', 1305, '/69/497/1305/4377', 'true', 'Basiphile screes of the Cordillera Cantabrica.', 'Linarion filicaulis, Saxifragion praetermissae', 'Eboulis basiphiles de la cordillère Cantabrique.'),
(4378, 'NR', 22, '61.36', '', '', 'Oro-Cantabrian siliceous screes', '', 4, 'Niveau 4', 1305, '/69/497/1305/4378', 'false', 'Siliceous screes of the Cordillera Cantabrica; floristically rich formations of the \"dark\" screes of the Cordillera are related to those of 61.351, though somewhat intermediate towards 61.38; other more species-poor ones, characterized by Trisetum hispidum and Rumex suffruticosus, belong to the latter.', 'Linarion filicaulis p., Linario-Senecion carpetani p.', 'Pas de description disponible'),
(4379, 'NR', 22, '61.37', 'Eboulis ibériques à fougères', '', 'Iberian fern screes', '', 4, 'Niveau 4', 1305, '/69/497/1305/4379', 'true', 'Fern-dominated chaotic, boulder fields of siliceous and calcareous Iberian mountains.', 'Dryopteridion oreadis, Dryopteridion submontanae', 'Chaos de rochers dominés par des peuplements de fougères des montagnes ibériques siliceuses et calcaires.'),
(4380, 'NR', 22, '61.38', '', '', 'Carpetano-Iberian siliceous screes', '', 4, 'Niveau 4', 1305, '/69/497/1305/4380', 'false', 'Screes of the Cordillera Central, the Iberian Range, the Leonese mountains, with Linaria saxatilis, L. alpina, Digitalis purpurea var. carpetana, Senecio pyrenaicus ssp. carpetanus, Rumex suffruticosus, Santolina oblongifolia, Conopodium butinioides, Reseda gredensis.', 'Linario-Senecion carpetani', 'Pas de description disponible'),
(4381, 'NR', 22, '61.39', '', '', 'Nevadan siliceous screes', '', 4, 'Niveau 4', 1305, '/69/497/1305/4381', 'false', 'Siliceous screes of the high levels of the Sierra Nevada, very rich in endemics.', 'Holcion caespitosae', 'Pas de description disponible'),
(4382, 'NR', 22, '53.22', '', '', 'Tall galingale beds', '', 4, 'Niveau 4', 1306, '/71/513/1306/4382', 'false', 'Formations dominated by large perennial Cyperaceae of genus Cyperus other than Cyperus papyrus.', '', 'Pas de description disponible'),
(4383, 'NR', 22, '82.11', 'Grandes cultures', '', 'Field crops', '', 4, 'Niveau 4', 1323, '/70/501/1323/4383', 'true', 'Cereal and other crops grown on large, unbroken surfaces in open field landscapes.', '', 'Céréales et autres cultures sur de grandes surfaces non interrompues dans les paysages ouverts d\'open fields.'),
(4384, 'NR', 22, '82.12', 'Cultures et maraichage', '', 'Market gardens and horticulture', '', 4, 'Niveau 4', 1323, '/70/501/1323/4384', 'true', 'Intensive cultivation of vegetables, flowers, small fruits, usually in alternating strips of different crops.', '', 'Cultures intensives de légumes, de fleurs, petits fruits, habituellement en polycultures avec bandes où alternent différentes récoltes.'),
(4385, 'NR', 22, '82.41', 'Rizières', '', 'Rice fields', '', 4, 'Niveau 4', 1326, '/70/501/1326/4385', 'true', '', '', 'Pas de description disponible'),
(4386, 'NR', 22, '82.42', 'Cressonnières', '', 'Watercress beds', '', 4, 'Niveau 4', 1326, '/70/501/1326/4386', 'true', '', '', 'Pas de description disponible'),
(4387, 'NR', 22, '83.11', 'Oliveraies', '', 'Olive groves', '', 4, 'Niveau 4', 1327, '/70/502/1327/4387', 'true', 'Mediterranean formations of Olea europaea ssp. europaea.', '', 'Formations méditerranéennes d\'Olea europaea subsp. europaea.'),
(4388, 'NR', 22, '61.3A', '', '', 'Southern Iberian calcareous screes', '', 4, 'Niveau 4', 1305, '/69/497/1305/4388', 'false', 'Screes of the calcareous Baetic mountains of southern and southeastern Iberia.', 'Platycapno-Iberidion granatensis, Scrophularion sciaphilae', 'Pas de description disponible'),
(4389, 'NR', 22, '61.3B', '', '', 'Central Mediterranean screes', '', 4, 'Niveau 4', 1305, '/69/497/1305/4389', 'false', 'Screes of the Italian peninsula and of the large Mediterranean islands.', '', 'Pas de description disponible'),
(4390, 'NR', 22, '61.41', '', '', 'Greek limestone screes', '', 4, 'Niveau 4', 1328, '/69/497/1328/4390', 'false', 'Formations of the higher mountains of Greece, with Drypis spinosa, Ranunculus brevifolius, Senecio thapsoides, Aethionema saxatile.', 'Drypion spinosae (Silenion caesiae)', 'Pas de description disponible'),
(4391, 'NR', 22, '61.42', '', '', 'Greek serpentine screes', '', 4, 'Niveau 4', 1328, '/69/497/1328/4391', 'false', 'Less widespread formations restricted to serpentines of the Pindus, with Campanula hawkinsoniana, Arenaria serpentini, Cardamine glauca, Viola magellensis, Alyssum scardicum, Silene haussknechtii.', 'Campanulion hawkinsonianae', 'Pas de description disponible'),
(4392, 'NR', 22, '53.23', '', '', 'Papyrus swamp', '', 4, 'Niveau 4', 1306, '/71/513/1306/4392', 'false', 'Cyperus papyrus ssp. siculus gallery of the Cyane river in southeastern Sicily. Taxonomic and historical evidence strongly suggest that this unique station is of natural origin, an extraordinary relict of an extensive Tertiary distribution.', '', 'Pas de description disponible'),
(4393, 'NR', 22, '53.31', 'Cladiaies des bas-marais', '', 'Fen Cladium beds', '', 4, 'Niveau 4', 1329, '/71/513/1329/4393', 'true', 'Species-rich, fairly open Cladium mariscus beds of alkaline and sometimes acid fens, accompanied by cortèges of the Caricion davallianae or of the Caricion lasiocarpae. These formations are in grave decline throughout their range.', '', 'Nappes bien ouvertes riches en espèces de Cladium mariscus des bas-marais alcalins et quelquefois acides, accompagnées par les cortèges du Caricion davallianae ou du Caricion lasiocarpe. Ces formations sont en grave déclin dans l\'ensemble de leur aire de distribution.'),
(4394, 'NR', 22, '53.32', '', '', 'Valencia Cladium islands', '', 4, 'Niveau 4', 1329, '/71/513/1329/4394', 'false', 'Endangered endemic association of peaty islets of the Albufera de Valencia, with Kostelezkia pentacarpos.', 'Hydrocotylo-Cladietum marisci', 'Pas de description disponible'),
(4395, 'NR', 22, '53.33', 'Cladiaies riveraines', '', 'Riparian Cladium beds', '', 4, 'Niveau 4', 1329, '/71/513/1329/4395', 'true', 'Species-poor Cladium mariscus formations of mostly Mediterranean riversides or lakesides, with a Phragmition cortège.', '', 'Formations de Cladium mariscus pauvres en espèces, principalement liées aux bords des rivières ou des lacs méditerranéens, avec un cortège du Phragmition.'),
(4396, 'NR', 22, '54.43', '', '', 'Apennine acidic fens', '', 4, 'Niveau 4', 1314, '/71/504/1314/4396', 'false', 'Rare infra-aquatic acidic peat mire communities of the Apennines south to the Sila, with Carex nigra, C. echinata and C. panicea.', '', 'Pas de description disponible'),
(4397, 'NR', 22, '54.44', 'Pozzines complexes à Carex intricata', '', 'Intricated sedge pozzines', '', 4, 'Niveau 4', 1314, '/71/504/1314/4397', 'true', 'Oro-Mediterranean Carex intricata (Carex nigra ssp. intricata) - dominated formations of the Sierra Nevada, Corsica and the Nebrodi.', '', 'Formations oro-méditerranéennes dominées par Carex intricata (Carex nigra subsp. intricata) de la Corse.'),
(4398, 'NR', 22, '83.12', 'Châtaigneraies', '', 'Chestnut groves', '', 4, 'Niveau 4', 1327, '/70/502/1327/4398', 'true', '', '', 'Pas de description disponible'),
