(4400, 'NR', 22, '83.14', 'Vergers à Amandiers', '', 'Almond groves', '', 4, 'Niveau 4', 1327, '/70/502/1327/4400', 'true', '', '', 'Pas de description disponible'),
(4401, 'NR', 22, '83.15', 'Vergers', '', 'Fruit orchards', '', 4, 'Niveau 4', 1327, '/70/502/1327/4401', 'true', 'High-stem orchards of apple, pear, plum, apricot, peach and other Rosaceae.', '', 'Vergers de Pommiers, Poiriers, Pruniers, Abricotiers, Pêchers et autres Rosacées.'),
(4402, 'NR', 22, '83.16', 'Vergers à agrumes', '', 'Citrus orchards', '', 4, 'Niveau 4', 1327, '/70/502/1327/4402', 'true', '', '', 'Pas de description disponible'),
(4403, 'NR', 22, '83.17', '', '', 'Date palm groves', '', 4, 'Niveau 4', 1327, '/70/502/1327/4403', 'false', '', '', 'Pas de description disponible'),
(4404, 'NR', 22, '83.18', 'Autres vergers à hautes tiges', '', 'Other high-stem orchards', '', 4, 'Niveau 4', 1327, '/70/502/1327/4404', 'true', '', '', 'Pas de description disponible'),
(4405, 'NR', 22, '83.21', 'Vignobles', '', 'Vineyards', '', 4, 'Niveau 4', 1330, '/70/502/1330/4405', 'true', 'Plantations of vine.', '', 'Plantations de Vignes.'),
(4406, 'NR', 22, '83.22', 'Vergers de basses tiges', '', 'Low-stem orchards', '', 4, 'Niveau 4', 1330, '/70/502/1330/4406', 'true', 'Other small tree crops, in particular, espaliers of various Rosaceae.', '', 'Autres plantations de petits arbres, en particulier espaliers de différentes Rosacées.'),
(4407, 'NR', 22, '83.31', 'Plantations de conifères', '', 'Conifer plantations', '', 4, 'Niveau 4', 1331, '/70/502/1331/4407', 'true', '', '', 'Pas de description disponible');
INSERT INTO `corine` (`CD_HAB`, `FG_VALIDITE`, `CD_TYPO`, `LB_CODE`, `LB_HAB_FR`, `LB_HAB_FR_COMPLET`, `LB_HAB_EN`, `LB_AUTEUR`, `NIVEAU`, `LB_NIVEAU`, `CD_HAB_SUP`, `PATH_CD_HAB`, `FRANCE`, `LB_DESCRIPTION`, `CRSP_PHYTO_CB91`, `DESCRIPTIF_CB97_FR`) VALUES
(4408, 'NR', 22, '62.11', 'Falaises calcaires eu-méditerranéennes occidentales et oro-ibériques', '', 'Western eu-Mediterranean and oro-Iberian calcareous cliffs', '', 4, 'Niveau 4', 1332, '/69/503/1332/4408', 'true', 'Calcareous cliffs of the lower Mediterranean levels of the western Mediterranean and, locally, the northern Adriatic, and of Iberian mountains.', '', 'Falaises calcaires de l\'étage méditerranéen inférieur de la région méditerranéenne occidentale et, localement, du nord de l\'Adriatique, et des montagnes ibériques.'),
(4409, 'NR', 22, '53.61', 'Communautés avec les Cannes de Ravenne', '', 'Ravenna cane communities', '', 4, 'Niveau 4', 1335, '/71/513/1335/4409', 'true', 'Mediterranean tall cane formations of temporary water courses, formed by Imperata cylindrica, Saccharum (Erianthus) ravennae, S. strictum, Arundo plinii.', 'Imperato-Erianthion', 'Formations de grandes Cannes méditerranéennes des cours d\'eau temporaires, formés par Imperata cylindrica, Erianthus ravennae, Arundo plinii.'),
(4410, 'NR', 22, '53.62', 'Peuplements de Cannes de Provence', '', 'Provence cane beds', '', 4, 'Niveau 4', 1335, '/71/513/1335/4410', 'true', 'Very tall formations of the long-introduced Arundo donax along water courses.', '', 'Formations très hautes d\'Arundo donax introduite depuis longtemps, le long des cours d\'eau.'),
(4411, 'NR', 22, '54.45', 'Bas-marais acides à Trichophorum cespitosum', '', 'Deergrass acidic fens', '', 4, 'Niveau 4', 1314, '/71/504/1314/4411', 'true', 'Acidic fen communities dominated by Scirpus cespitosus.', '', 'Communautés de bas-marais acides dominées par Trichophorum cespitosum.'),
(4412, 'NR', 22, '83.32', 'Plantations d\'arbres feuillus', '', 'Plantations of broad-leaved trees', '', 4, 'Niveau 4', 1331, '/70/502/1331/4412', 'true', '', '', 'Pas de description disponible'),
(4413, 'NR', 22, '62.12', 'Falaises calcaires des Pyrénées centrales', '', 'Central Pyrenean calcareous cliffs', '', 4, 'Niveau 4', 1332, '/69/503/1332/4413', 'true', 'Calcareous cliffs of the central and eastern Pyrenees, with Saxifraga media, S. longifolia, S. aretioides, Potentilla alchimilloides, P. nivalis, Ramonda myconi, Asperula hirta.', 'Saxifragion mediae', 'Falaises calcaires des Pyrénées centrales et orientales, avec Saxifraga media, S. longifolia, S. aretioides, Potentilla alchimilloides, P. nivalis, Ramonda myconi, Asperula hirta.'),
(4414, 'NR', 22, '62.13', 'Falaises calcaires des Alpes ligures et des Apennins', '', 'Liguro-Apennine calcareous cliffs', '', 4, 'Niveau 4', 1332, '/69/503/1332/4414', 'true', 'Calcareous cliffs of the Maritime Alps and northern Apennines, with Saxifraga lingulata, Primula marginata, P. allionii, Phyteuma charmelii, P. villarsii, Silene campanula, Potentilla saxifraga, Ballota frutescens.', 'Saxifragion lingulatae', 'Falaises calcaires des Alpes maritimes et des Apennins septentrionaux, avec Saxifraga lingulata, Primula marginata, P. allionii, Phyteuma charmelii, P. villarsii, Silene campanula, Potentilla saxifraga, Ballota frutescens.'),
(4415, 'NR', 22, '62.14', '', '', 'Southern Italian calcareous cliffs', '', 4, 'Niveau 4', 1332, '/69/503/1332/4415', 'false', 'Calcareous cliffs of southern Italy and Sicily, with Dianthus rupicola.', 'Dianthion rupicolae', 'Pas de description disponible'),
(4416, 'NR', 22, '62.15', 'Falaises calcaires alpiennes et sub-méditerranéennes', '', 'Alpine and sub-Mediterranean calcareous cliffs', '', 4, 'Niveau 4', 1332, '/69/503/1332/4416', 'true', 'Calcareous cliffs of the Alps, of lesser satellite ranges and of sub-Mediterranean areas of the northern Tyrrhenian periphery.', 'Potentilletalia caulescentis p.', 'Falaises calcaires des Alpes, ou des chaînes voisines et des régions sub-méditerranéennes du nord de l\'espace tyrrhénien.'),
(4417, 'NR', 22, '54.11', 'Sources d\'eaux douces pauvres en bases', '', 'Soft water springs', '', 4, 'Niveau 4', 1340, '/71/504/1340/4417', 'true', 'Acid or neutral, oligotrophic to eutrophic non-calcareous springs. The specialized spring communities belong to the various associations of the Cardamino-Montion or, in Iberian mountains, the Myosotidion stoloniferae; some of them are individualized below. The associated swamp communities belong to the Caricetalia fuscae and their presence can be indicated by use, simultaneously with one of the codes of 54.11, of a code of 54.4.', 'Cardamino-Montion, Myosotidion stoloniferae i.a.', 'Sources d\'eaux acides ou neutres, oligotrophes à eutrophes non calcaires. Ces communautés spécialisées appartiennent à diverses associations du Cardamino-Montion ; quelques-unes sont individualisées. Les communautés de marais associées appartiennent aux Caricetalia fuscae et leur présence peut être indiquée par l\'emploi simultanément d\'un des codes de 54.11 ou de 54.4.'),
(4418, 'NR', 22, '54.46', 'Bas-marais à Eriophorum angustifolium', '', 'Eriophorum angustifolium mires', '', 4, 'Niveau 4', 1314, '/71/504/1314/4418', 'true', 'Eriophorum angustifolium-dominated swards of usually very wet sites within acidic fens, generally with a sphagnum carpet, formed in particular by Sphagnum cuspidatum.', '', 'Pelouses dominées par Eriophorum angustifolium sur des sites généralement très humides à l\'intérieur des bas-marais acides, généralement avec un tapis de Sphaignes, formé en particulier par Sphagnum cuspidatum.'),
(4419, 'NR', 22, '54.47', 'Bas-marais acides dunaires à Laîches', '', 'Dunal sedge acidic fens', '', 4, 'Niveau 4', 1314, '/71/504/1314/4419', 'true', 'Formations of Carex nigra, C. trinervis, C. x timmiana, Juncus anceps, J. subnodulosus and introduced Vaccinium macrocarpum, restricted to wet, peaty, acidified dune slacks of the continental North Sea coast. This unit is to be used in conjunction with 16.33.', 'Caricetum trinervi-fuscae', 'Formations de Carex nigra, C. trinervis, C. x timmiana, Juncus anceps, J. subnodulosus et de Vaccinium macrocarpum introduit, restreintes aux lettes dunaire humides, tourbeuse et acidifiées des côtes continentales de la mer du Nord. Cette unité doit être utilisée en croisement avec 16.33.'),
(4420, 'NR', 22, '85.11', 'Parcelles boisées de parcs', '', 'Park woodlots', '', 4, 'Niveau 4', 1344, '/70/506/1344/4420', 'true', '', '', 'Pas de description disponible'),
(4421, 'NR', 22, '85.12', 'Pelouses de parcs', '', 'Park lawns', '', 4, 'Niveau 4', 1344, '/70/506/1344/4421', 'true', '', '', 'Pas de description disponible'),
(4422, 'NR', 22, '85.13', 'Bassins de parcs', '', 'Park basins', '', 4, 'Niveau 4', 1344, '/70/506/1344/4422', 'true', '', '', 'Pas de description disponible'),
(4423, 'NR', 22, '85.14', 'Parterre de fleurs, avec arbres et avec bosquets en parc', '', 'Park flower beds, arbors and shrubbery', '', 4, 'Niveau 4', 1344, '/70/506/1344/4423', 'true', '', '', 'Pas de description disponible'),
(4424, 'NR', 22, '85.15', 'Communautés sub-naturelles des parcs', '', 'Park sub-natural communities', '', 4, 'Niveau 4', 1344, '/70/506/1344/4424', 'true', 'Elements of sub-natural communities enclaved in parks or colonizing their elements; codes from sections other than 8 are to be used to precise their nature.', '', 'Eléments de communautés sub-naturelles enclavés dans des parcs ou colonisant leurs éléments ; les codes des sections autres que 8 doivent être utilisés pour spécifier leur nature.'),
(4425, 'NR', 22, '85.31', 'Jardins ornementaux', '', 'Ornemental gardens', '', 4, 'Niveau 4', 1346, '/70/506/1346/4425', 'true', '', '', 'Pas de description disponible'),
(4426, 'NR', 22, '85.32', 'Jardins potagers de subsistance', '', 'Subsistence gardens', '', 4, 'Niveau 4', 1346, '/70/506/1346/4426', 'true', '', '', 'Pas de description disponible'),
(4427, 'NR', 22, '62.16', '', '', 'Eu-Mediterranean Greek calcareous cliffs', '', 4, 'Niveau 4', 1332, '/69/503/1332/4427', 'false', 'Calcareous cliffs of the thermo- and meso-Mediterranean zones of mainland Greece, up to the Abies cephalonica belt, with Campanula versicolor, C. rupestris, Sideritis roeseri, Stachys candida, Hypericum vesicuosum, Asperula arcadiensis, Galium boryanum, Centaurea pelia, Alkanna graeca, Alyssum orientale, Linaria microcalyx, Onosma frutescens, Inula candida, Centranthus ruber, Silene congesta, Teucrium flavum.', 'Campanulion versicoloris', 'Pas de description disponible'),
(4428, 'NR', 22, '62.17', '', '', 'Aegean cliffs', '', 4, 'Niveau 4', 1332, '/69/503/1332/4428', 'false', 'Calcareous cliffs of the Aegean archipelagoes, one of the most diverse and endemic-rich groups of communities.', 'Cirsietalia chamaepeucis', 'Pas de description disponible'),
(4429, 'NR', 22, '54.51', 'Pelouses à Carex lasiocarpa', '', 'Slender-sedge swards', '', 4, 'Niveau 4', 1341, '/71/504/1341/4429', 'true', 'Usually floating meadows of the medium sized Carex lasiocarpa associated with either sphagnums or pleurocarps and often accompanied by Eriophorum gracile, Menyanthes trifoliata.', 'Caricetum lasiocarpae', 'Prairies généralement flottantes de Carex lasiocarpa de taille moyenne associé à des Sphaignes ou à des Mousses pleurocarpes et souvent accompagné d\'Eriophorum gracile, Menyanthes trifoliata.'),
(4430, 'NR', 22, '86.41', 'Carrières', '', 'Quarries', '', 4, 'Niveau 4', 1351, '/70/507/1351/4430', 'true', '', '', 'Pas de description disponible'),
(4431, 'NR', 22, '86.42', 'Terrils crassiers et autres tas de détritus', '', 'Slag heaps and other detritus heaps', '', 4, 'Niveau 4', 1351, '/70/507/1351/4431', 'true', '', '', 'Pas de description disponible'),
(4432, 'NR', 22, '86.43', 'Voies de chemins de fer, gares de triage et autres espaces ouverts', '', 'Railroad switch yards and other open spaces', '', 4, 'Niveau 4', 1351, '/70/507/1351/4432', 'true', '', '', 'Pas de description disponible'),
(4433, 'NR', 22, '62.18', '', '', 'Southern Greek montane cliffs', '', 4, 'Niveau 4', 1332, '/69/503/1332/4433', 'false', 'Calcareous cliffs of high altitudes of the Peloponnese, Giona and Parnassus, with Silene auriculata, Achillea umbellata, Campanula rupicola, Saxifraga sibthorpii, S. marginata, S. spruneri, Minuartia stellata, Valeriana olenaea, Satureja parnassica, Rosa glutinosa, Viola poetica, Edraianthus parnassicus, Campanula aizoon.', 'Silenion auriculatae', 'Pas de description disponible'),
(4434, 'NR', 22, '62.19', '', '', 'Central Greek montane cliffs', '', 4, 'Niveau 4', 1332, '/69/503/1332/4434', 'false', 'Calcareous cliffs of the high altitudes of the central and northern Pindus and of the Thessalian Olympus system.', '', 'Pas de description disponible'),
(4435, 'NR', 22, '62.1A', '', '', 'Northern Greek calcareous cliffs', '', 4, 'Niveau 4', 1332, '/69/503/1332/4435', 'false', 'Calcareous cliffs of the Vermion and other Greek ranges, with Ramondia nathaliae, Campanula formanekiana, Alyssoides utriculata, Jurinea consanguinea, Micromeria cristata.', 'Ramondion nathaliae', 'Pas de description disponible'),
(4436, 'NR', 22, '62.1B', '', '', 'Lowland northern calcareous cliffs', '', 4, 'Niveau 4', 1332, '/69/503/1332/4436', 'false', 'Calcareous cliffs of the lowlands of northern and middle Europe colonized by communities referable to units other than 62; their nature can be specified by addition of the relevant codes.', '', 'Pas de description disponible'),
(4437, 'NR', 22, '62.21', 'Falaises siliceuses des montagnes médio-européennes', '', 'Middle European montane siliceous cliffs', '', 4, 'Niveau 4', 1356, '/69/503/1356/4437', 'true', 'Siliceous cliffs of the Alps, the Pyrenees and a few neighbouring ranges.', '', 'Falaises siliceuses des Alpes, des Pyrénées et des régions voisines.'),
(4438, 'NR', 22, '54.12', 'Sources d\'eaux dures', '', 'Hard water springs', '', 4, 'Niveau 4', 1340, '/71/504/1340/4438', 'true', 'Calcareous, often petrifying, springs. Their specialized communities, usually dominated by bryophytes, belong to the Cratoneurion commutati. Characteristic species are the mosses Cratoneuron filicinum, C. commutatum, C. commutatum var. falcatum, Catoscopium nigritum, Eucladium verticillatum, Gymnostomum recurvirostrae, with Equisetum telmateia, E. variegatum and flowering plants including Cochlearea pyrenaica, Arabis soyeri, Pinguicula vulgaris, Saxifraga aizoides. The associated swamp communities belong to the Caricetalia davallianae and their presence can be recorded by the use, simultaneously with one of the codes of 54.12, of a code of 54.2. Large petrifying springs form tufa cones that constitute singular habitats with several interacting plant and animal communities; they have thus been individualized below.', 'Cratoneurion i.a.', 'Sources calcaires souvent pétrifiantes. Leurs communautés spécialisées, généralement dominées par des Bryophytes, appartiennent au Cratoneurion commutati. Les espèces caractéristiques sont les mousses Cratoneurion filicinum, C. commutatum, C. commutatum var. falcatum, Catoscopium nigritum, Eucladium verticillatum, Gymnostomum recurvirostrae, avec Equisetum telmateia, E. variegatum et des plantes à fleurs parmi lesquelles Cochlearia pyrenaica, Arabis soyeri, Pinguicula vulgaris, Saxifraga aizoides. Les communautés de marais associées appartiennent aux Caricetalia davallianae et leur présence peut être notée par l\'emploi simultané d\'un code des subdivisions 54.12 ou 54.2. Les grandes sources pétrifiantes forment des cones de tufs qui constituent des habitats particuliers avec plusieurs communautés de plantes et d\'animaux en interaction ; celles-ci seront individualisées ci-dessous.'),
(4439, 'NR', 22, '54.52', 'Tourbières tremblantes à Carex diandra', '', 'Carex diandra quaking mires', '', 4, 'Niveau 4', 1341, '/71/504/1341/4439', 'true', 'Usually open swards formed by Carex diandra in association with C. lasiocarpa, C. appropinquata, C. limosa, C. lepidocarpa, Eriophorum gracile, E. angustifolia, Menyanthes trifoliata, Comarum palustre, Hydrocotyle vulgaris, Pedicularis palustris and an abundance of bryophytes, including the pleurocarps Campylium stellatum, Drepanocladus intermedius and the liverwort Riccardia pinguis. These mires are an important habitat for the threatened Liparis loeselii.', 'Caricetum diandrae (Scorpidio-Caricetum diandrae)', 'Tapis généralement ouverts formés de Carex diandra en association avec C. lasiocarpa, C. appropinquata, C. limosa, C. lepidocarpa, Eriophorum gracile, E. angustifolium, Menyanthes trifoliata, Comarum palustre, Hydrocotyle vulgaris, Pedicularis palustris et une abondance de Bryophytes, comprenant les pleurocarpes Campylium stellatum, Drepanocladus intermedius et l\'Hépatique Riccardia pinguis. Ces tourbières représentent un habitat important pour Liparis loeselii, espèce menacée.'),
(4440, 'NR', 22, '54.53', 'Tourbières tremblantes à Carex rostrata', '', 'Bottle sedge quaking mires', '', 4, 'Niveau 4', 1341, '/71/504/1341/4440', 'true', 'Usually sparse low formations of Carex rostrata on sphagnum or, sometimes, pleurocarp carpets.', '', 'Formations généralement légèrement clairsemées, basses, de Carex rostrata sur des tapis de Sphaignes ou, quelquefois, de Mousses pleurocarpes.'),
(4441, 'NR', 22, '89.11', 'Ports maritimes', '', 'Sea harbours', '', 4, 'Niveau 4', 1357, '/70/510/1357/4441', 'true', '', '', 'Pas de description disponible'),
(4442, 'NR', 22, '89.12', 'Salines', '', 'Saltworks', '', 4, 'Niveau 4', 1357, '/70/510/1357/4442', 'true', 'Active or recently abandoned salt-extraction evaporation basins. Detailed habitats can be specified by use of the subdivisions of 15 and 23 in conjunction with 89.12.', '', 'Bassins d\'évaporation en activité ou récemment abandonnés. Les habitats détaillés peuvent être codés par l\'utilisation de la subdivision de 15 et 23 en conjonction avec 89.12.'),
(4443, 'NR', 22, '89.13', 'Autres lagunes industrielles et canaux salins', '', 'Other saline industrial lagoons and canals', '', 4, 'Niveau 4', 1357, '/70/510/1357/4443', 'true', '', '', 'Pas de description disponible'),
(4444, 'NR', 22, '89.21', 'Canaux navigables', '', 'Navigable canals', '', 4, 'Niveau 4', 1358, '/70/510/1358/4444', 'true', '', '', 'Pas de description disponible'),
(4445, 'NR', 22, '89.22', 'Fossés et petits canaux', '', 'Ditches and small canals', '', 4, 'Niveau 4', 1358, '/70/510/1358/4445', 'true', '', '', 'Pas de description disponible'),
(4446, 'NR', 22, '89.23', 'Lagunes industrielles et bassins ornementaux', '', 'Industrial lagoons and ornemental ponds', '', 4, 'Niveau 4', 1358, '/70/510/1358/4446', 'true', '', '', 'Pas de description disponible'),
(4447, 'NR', 22, '89.24', 'Bassins de décantation et stations d\'épuration', '', 'Sewage farms and sewage works', '', 4, 'Niveau 4', 1358, '/70/510/1358/4447', 'true', '', '', 'Pas de description disponible'),
(4448, 'NR', 22, '62.22', '', '', 'Oro-Iberian siliceous cliffs', '', 4, 'Niveau 4', 1356, '/69/503/1356/4448', 'false', 'Siliceous cliffs of high altitudes of Iberian mountains.', '', 'Pas de description disponible'),
(4449, 'NR', 22, '62.23', 'Falaises siliceuses des Alpes sud-occidentales', '', 'South-western Alpine siliceous cliffs', '', 4, 'Niveau 4', 1356, '/69/503/1356/4449', 'true', 'Siliceous cliffs of the Maritime, Ligurian and Cottian Alps, with Saxifraga pedemontana.', 'Saxifragion pedemontanae', 'Falaises siliceuses des Alpes maritimes, ligures et cottiennes, avec Saxifraga pedemontana.'),
(4450, 'NR', 22, '62.24', 'Falaises des montagnes cyrno-sardes', '', 'Cyrno-Sardian montane cliffs', '', 4, 'Niveau 4', 1356, '/69/503/1356/4450', 'true', 'Siliceous cliffs of the mountains of Corsica and Sardinia, with Potentilla crassinervia.', 'Potentillion crassinerviae', 'Falaises siliceuses des montagnes de Corse et de Sardaigne, avec Potentilla crassinervia.'),
(4451, 'NR', 22, '62.25', '', '', 'Northern Greek siliceous cliffs', '', 4, 'Niveau 4', 1356, '/69/503/1356/4451', 'false', 'Siliceous cliffs of the mountains of northern Greece, with Silene lerchenfeldiana.', 'Silenion lerchenfeldianae', 'Pas de description disponible'),
(4452, 'NR', 22, '62.26', 'Falaises siliceuses catalano-languedociennes', '', 'Languedo-Catalan siliceous cliffs', '', 4, 'Niveau 4', 1356, '/69/503/1356/4452', 'true', 'Low altitude siliceous cliffs of the Cévennes and of Catalonian hills, with Antirrhinum asarina, Sedum hirsutum, Centaurea pectinata, Sempervivum arvernense, Dianthus graniticus, Saxifraga clusii, S. hypnoides.', 'Antirrhinion asarinae', 'Falaises siliceuses de basse altitude des Cévennes et des collines catalanes, avec Asarina procumbens, Sedum hirsutum, Centaurea pectinata, Sempervivum tectorum subsp. arvernense, Dianthus graniticus, Saxifraga clusii, S. hypnoides.'),
(4453, 'NR', 22, '62.27', '', '', 'Western Iberian siliceous cliffs', '', 4, 'Niveau 4', 1356, '/69/503/1356/4453', 'false', 'Siliceous cliffs of the meso-Mediterranean level of western Iberia, with Cheilanthes tinaei.', 'Cheilanthion hispanicae', 'Pas de description disponible'),
(4454, 'NR', 22, '54.21', 'Bas-marais à Schoenus nigricans (choin noir)', '', 'Black bog-rush fens', '', 4, 'Niveau 4', 1359, '/71/504/1359/4454', 'true', 'Schoenus nigricans- dominated or -rich communities, of wide distribution, though less common in Alpine and peri-Alpine regions than the next unit, and confined to lower altitudes. Rushes, Juncus subnodulosus in British and western continental inland fens, J. balticus in dune-slack fens, are often abundant. Other accompanying species include Carex lepidocarpa, C. hostiana, C. panicea, C. pulicaris, Eriophorum latifolium, Molinia caerulea, Dactylorhiza incarnata, D. praetermissa, D. purpurella, D. traunsteineri, D. traunsteinerioides, Epipactis palustris, Parnassia palustris, Pinguicula vulgaris, brown mosses and, locally, Pinguicula lusitanica and Drosera anglica. These communities have enormously regressed, particularly in northern and northwestern continental Europe, and are extinct in many regions.', 'Schoenetum nigricantis (Orchio-Schoenetum nigricantis, Schoeno-Juncetum subnodulosi, Junco baltici-Schoenetum nigricantis)', 'Communautés dominées ou richement pourvues en Schoenus nigricans, de large distribution, mais cependant moins communes dans les régions alpiennes et péri-alpiennes que les unités suivantes, et cantonnées aux basses altitudes. Les joncs, Juncus subnodulosus dans les bas-marais britanniques et d\'Europe continentale occidentale et Juncus balticus dans les pannes dunaires, sont souvent abondants. Les autres espèces compagnes comprennent Carex lepidocarpa, C. hostiana, C. panicea, C. pulicaris, Eriophorum latifolium, Molinia caerulea, Dactylorhiza incarnata, D. praetermissa, D. traunsteineri, Epipactis palustris, Parnassia palustris, Pinguicula vulgaris, des Mousses brunes et, localement, Pinguicula lusitanica et Drosera longifolia. Ces communautés ont énormément régressé, particulièrement dans le nord et le nord-est de l\'Europe continentale, et sont éteintes dans de nombreuses régions.'),
(4455, 'NR', 22, '54.22', 'Bas-marais à Schoenus ferrugineus', '', 'Brown bog-rush fens', '', 4, 'Niveau 4', 1359, '/71/504/1359/4455', 'true', 'Schoenus ferrugineus-dominated communities.', '', 'Communautés dominées par Schoenus ferrugineus.'),
(4456, 'NR', 22, '54.54', 'Pelouses à Carex limosa', '', 'Mud sedge swards', '', 4, 'Niveau 4', 1341, '/71/504/1341/4456', 'true', 'Low floating or quaking swards of Carex limosa.', 'Caricetum limosae p.', 'Tapis bas légèrement flottants ou tremblants de Carex limosa.'),
(4457, 'NR', 22, '62.28', 'Falaises siliceuses provenço-ibériques', '', 'Provenço-Iberian siliceous cliffs', '', 4, 'Niveau 4', 1356, '/69/503/1356/4457', 'true', 'Siliceous cliffs and rocks of low altitudes of Provence, Corsica and eastern Spain.', 'Phagnalo-Cheilanthion fragrantis', 'Falaises siliceuses et rochers de basse altitude de Provence, de Corse et de l\'est de l\'Espagne.'),
(4458, 'NR', 22, '62.29', '', '', 'Lowland northern siliceous cliffs', '', 4, 'Niveau 4', 1356, '/69/503/1356/4458', 'false', 'Siliceous cliffs of the hills of northern and middle Europe colonized by communities referable to units other than 62; their nature can be specified by addition of the relevant codes.', '', 'Pas de description disponible'),
(4459, 'NR', 22, '62.41', 'Falaises continentales calcaires nues', '', 'Limestone bare inland cliffs', '', 4, 'Niveau 4', 1361, '/69/503/1361/4459', 'true', 'Rocks colonized by communities of internal crustose lichens (Protoblastenia, Verrrucaria, Petractis, Polyblastia), external crustose lichens (Caloplaca, Xanthoria) or gelatinous (Collema) and foliose (Dermatocarpon) lichens.', 'Protoblastenietea immersae i.a.', 'Rochers colonisés par des communautés de Lichens crustacés endolithiques (Protoblastenia, Verrucaria, Petractis, Polyblastia), crustacés épilithiques (Caloplaca, Xanthoria) ou gélatineux (Collema) et foliacés (Dermatocarpon).'),
(4460, 'NR', 22, '62.42', 'Falaises continentales siliceuses nues', '', 'Siliceous bare inland cliffs', '', 4, 'Niveau 4', 1361, '/69/503/1361/4460', 'true', 'Rocks colonized by communities of external crustose lichens (Rhizocarpon), navel lichens (Umbilicaria) and fruticose lichens (Ramalina, Cornicularia, Rhizoplaca).', 'Rhizocarpetea geographici i.a.', 'Rochers colonisés par des colonies de Lichens crustacés épilithiques (Rhizocarpon), de Lichens umbiliqués (Umbilicaria) et de Lichens fruticuleux (Ramalina, Cornicularia, Rhizoplaca).'),
(4461, 'NR', 22, '54.55', 'Pelouses à Carex chordorrhiza', '', 'String sedge swards', '', 4, 'Niveau 4', 1341, '/71/504/1341/4461', 'true', 'Short to medium-tall, usually inundated, swards formed by the Scandinavian, pre-Alpine, eastern-Hercynian, and, very locally, Scottish Carex chordorrhiza, associated with Carex limosa and with varied pleurocarps, Scorpidium scorpioides, Calliergon trifarium, C. stramineum, Campylium stellatum, Paludella squarrosa, Drepanocladus exanulatus, D. revolvens, D. procerus or, occasionally, with sphagnums.', 'Drepanoclado-Caricetum chordorrhizae', 'Gazons bas à moyennement hauts, généralement inondés, formés par l\'espèce scandinave, pré-alpine, est-hercynienne et, très localement, écossaise, Carex chordorrhiza, associée à Carex limosa et à diverses Pleurocarpes, Scorpidium scorpioides, Calliergon trifarium, C. stramineum, Campylium stellatum, Paludella squarrosa, Drepanocladus exanulatus, D. revolvens, D. procerus ou, occasionnellement, à des Sphaignes.'),
(4462, 'NR', 22, '54.56', 'Pelouses à Carex heleonastes', '', 'Peat sedge swards', '', 4, 'Niveau 4', 1341, '/71/504/1341/4462', 'true', 'Short to medium-tall swards formed by Carex heleonastes, often associated with Meesea triquetra, in transition mires and in bog hollows of peri-Alpine areas.', 'Caricetum heleonastae', 'Pelouses basses à moyennement hautes, formées de Carex heleonastes, souvent associé à Meesea triquetra, dans des tourbières de transition et dans les dépressions des tourbières des régions péri-alpiennes.'),
(4463, 'NR', 22, '54.57', 'Tourbières tremblantes à Rhynchospora', '', 'Beak-sedge quaking bogs', '', 4, 'Niveau 4', 1341, '/71/504/1341/4463', 'true', 'Rhynchospora alba-rich formations of transition mires, with Drosera anglica, D. intermedia, D. rotundifolia, Vaccinium oxycoccos, Carex limosa, C. rostrata, Sphagnum recurvum and sometimes with Eleocharis quinqueflora, Eriophorum latifolium, Andromeda polifolia or Scheuchzeria palustris.', 'Sphagno-Rhynchosporetum albae', 'Formations des tourbières de transition riches en Rhynchospora alba, avec Drosera longifolia, D. intermedia, D. rotundifolia, Vaccinium oxycoccos, Carex limosa, C. rostrata, Sphagnum recurvum, et quelquefois avec Eleocharis quinqueflora, Eriophorum latifolium, Andromeda polifolia ou Scheuchzeria palustris.'),
(4464, 'NR', 22, '62.51', 'Falaises continentales humides méditerranéennes', '', 'Mediterranean wet inland cliffs', '', 4, 'Niveau 4', 1362, '/69/503/1362/4464', 'true', 'Wet inland cliffs of Mediterranean regions, with a specialized vegetation formed by Adiantum capillus-veneris, mosses, Borago pygmaea, Pinguicula grandiflora ssp. coenocantabrica.', 'Adiantetalia', 'Falaises continentales humides des régions méditerranéennes, avec une végétation spécialisée formée par Adiantum capillus-veneris, des Mousses, Borago pygmaea, Pinguicula grandiflora.'),
(4465, 'NR', 22, '62.52', 'Falaises continentales humides septentrionales', '', 'Northern wet inland cliffs', '', 4, 'Niveau 4', 1362, '/69/503/1362/4465', 'true', 'Wet inland cliffs of middle European hills and mountains. They are often colonized by unique plant assemblages, the components of which are, however, equally characteristic of other habitats; notable among such species are Saxifraga paniculata, Alchemilla glabra, Viola palustris, Phegopteris connectilis.', '', 'Falaises continentales humides des collines et des montagnes médio-européennes. Elles sont souvent colonisées par des assemblages uniques de plantes dont les composants, quels qu\'ils soient, sont cependant caractéristiques d\'autres habitats ; parmis ceux-ci, les espèces notables sont Saxifraga paniculata, Alchemilla glabra, Viola palustris, Phegopteris connectilis.'),
(4466, 'NR', 22, '54.23', 'Tourbières basses à Carex davalliana', '', 'Davall sedge fens', '', 4, 'Niveau 4', 1359, '/71/504/1359/4466', 'true', 'Diverse, often extensive, fen communities, with Carex davalliana, C. hostiana, C. lepidocarpa, C. capillaris, C. panicea, C. nigra, C. demissa, C. flava, C. pulicaris, Eriophorum latifolium, Blysmus compressus, Schoenus ferrugineus, Eleocharis quinqueflora, Juncus articulatus, Scirpus cespitosus, Molinia caerulea, Dactylorhiza traunsteineri, Tofieldia calyculata, Allium schoenoprasum, Potentilla erecta, Swertia perennis, Primula farinosa, Parnassia palustris, Pinguicula vulgaris and a moss layer formed by Drepanocladus intermedius, Cratoneuron glaucum, Campylium stellatum, mostly characteristic of Alpine and peri-Alpine regions, with outlyers in the Hercynian system. This extremely species-rich community is still represented by a few large, very well preserved examples on the Bavarian plateau. These are a refuge for many rare species, including the relict, threatened Pedicularis sceptrum-carolinum and the orchids Dactylorhiza traunsteineri, D. ochroleuca, D. incarnata, Herminium monorchis, Epipactis palustris. Elsewhere in their range, the Davall sedge fens have undergone a drastic reduction, leading to extinction in many areas.', 'Caricetum davallianae', 'Diverses communautés de bas-marais, souvent étendues, avec Carex davalliana, C. hostiana, C. lepidocarpa, C. capillaris, C. panicea, C. nigra, C. demissa, C. flava, C. pulicaris, Eriophorum latifolium, Blysmus compressus, Schoenus ferrugineus, Eleocharis quinqueflora, Juncus articulatus, Trichophorum cespitosum, Molinia caerulea, Dactylorhiza traunsteineri, Tofieldia calyculata, Allium schoenoprasum, Potentilla erecta, Swertia perennis, Primula farinosa, Parnassia palustris, Pinguicula vulgaris et une strate mucinale formée par Drepanocladus intermedius, Cratoneuron glaucum, Campylium stellatum, pour la plupart caractéristiques des régions alpiennes ou péri-alpiennes...'),
(4467, 'NR', 22, '54.58', 'Radeaux de Sphaignes et de Linaigrettes', '', 'Sphagnum and cottongrass rafts', '', 4, 'Niveau 4', 1341, '/71/504/1341/4467', 'true', 'Floating, sometimes drifting, carpets of sphagnums (Sphagnum cuspidatum, S. recurvum, S. obesum) or of sphagnums and Eriophorum angustifolium. They may form fairly large transition mire communities in permanent heath pools, peri-glacial palsas, large raised bog and blanket bog pools and in former peat extraction holes. They often constitute the stage succeeding 54.59 in the colonization process. They have an appearance that ranges from low, barely emerging sphagnum mats to fairly dense cottongrass beds. Drosera rotundifolia is often abundant. The sphagnum and common cottongrass communities are an important habitat for the threatened Hammarbya paludosa.', '', 'Tapis de Sphaignes (Sphagnum cuspidatum, S. recurvum, S. obesum) ou de Sphaignes et d\'Eriophorum angustifolium, flottants, parfois dérivants. Ils peuvent former des communautés de tourbières de transition assez grandes dans les mares permanentes des landes, les palses périglaciaires, les cuvettes des grandes tourbières bombées et des tourbières de couverture et dans les excavations formées pour l\'extraction de la tourbe. Ils constituent souvent l\'étape succédant à 54.59 dans les processus de colonisation. Ils se présentent sous l\'aspect de tapis bas de Sphaignes émergeant à peine, avec des parterres assez denses de Linaigrettes. Drosera rotundifolia est souvent abondant. Les communautés de Sphaignes et de Linaigrette commune sont un habitat important pour Hammarbya paludosa menacé.'),
(4468, 'NR', 22, '54.59', 'Radeaux à Menyanthes trifoliata et Potentilla palustris', '', 'Bog bean and marsh cinquefoil rafts', '', 4, 'Niveau 4', 1341, '/71/504/1341/4468', 'true', 'Pioneering floating carpets of Menyanthes trifoliata, Potentilla palustris (Comarum palustre), Hydrocotyle vulgaris, often with Equisetum fluviatile, Carex rostrata, Cicuta virosa or sphagnums, forming the transition between or amphibious communities and mire communites. Initial stages have Potamogeton polygonifolius or P. coloratus, late stages, Carex nigra, Juncus acutiflora, Molinia caerulea.', '', 'Tapis flottant pionniers de Menyanthes trifoliata, Potentilla palustris (Comarum palustre), Hydrocotyle vulgaris, souvent avec Equisetum fluviatile, Carex rostrata, Cicuta virosa ou des Sphaignes, formant la transition entre les communautés amphibies et les communautés de tourbière. Les stades initiaux renferment Potamogeton polygonifolius ou P. coloratus, les stades ultérieurs Carex nigra, Juncus acutiflorus, Molinia caerulea.'),
(4469, 'NR', 22, '54.5A', 'Tourbières à Calla', '', 'Bog arum mires', '', 4, 'Niveau 4', 1341, '/71/504/1341/4469', 'true', 'Floating meadows, quaking bogs or sphagnum mats dominated by or rich in Calla palustris, often with Potentilla palustris.', 'Calletum palustris i.a.', 'Prairies flottantes, tourbières tremblantes ou tapis de Sphaignes dominées par, ou riches en, Calla palustris, souvent avec Potentilla palustris.'),
(4470, 'NR', 22, '64.11', 'Pelouses pionnières des dunes continentales', '', 'Inland dune pioneer grasslands', '', 4, 'Niveau 4', 1367, '/69/512/1367/4470', 'true', 'Formations of inland sands with Corynephorus canescens, Carex arenaria, Spergula morisonii, Teesdalia nudicaulis and carpets of fruticose lichens (Cladonia, Cetraria) (cf. 35.23).', 'Corynephorion canescentis', 'Formations de sables continentaux avec Corynephorus canescens, Carex arenaria, Spergula morisonii, Teesdalia nudicaulis et des tapis de Lichens fruticuleux (Cladonia, Cetraria) (voir 35.23).'),
(4471, 'NR', 22, '64.12', 'Pelouses siliceuses des dunes intérieures', '', 'Inland dune siliceous grasslands', '', 4, 'Niveau 4', 1367, '/69/512/1367/4471', 'true', 'Other grasslands of inland dune systems with Agrostis spp. and Corynephorus canescens or other acidophilous grasses; their composition can be speccified by use of codes of 35 other than 35.23.', '', 'Autres pelouses de systèmes dunaires continentaux avec Agrostis spp. et Corynephorus canescens ou d\'autres graminées acidiphiles ; leur compositon peut être spécifiée par l\'utilisation des codes de 35 autres que 35.23.'),
(4472, 'NR', 22, '64.13', 'Landes sur dunes continentales', '', 'Inland dune heaths', '', 4, 'Niveau 4', 1367, '/69/512/1367/4472', 'true', 'Heaths colonizing inland dunes.', 'Genistion pilosae p.', 'Landes colonisant des dunes continentales.'),
(4473, 'NR', 22, '54.24', 'Bas-marais alcalins pyrénéens', '', 'Pyrenean rich fens', '', 4, 'Niveau 4', 1359, '/71/504/1359/4473', 'true', 'Uncommon calcareous fens of the Pyrenees, with Eriophorum latifolium, Carex davalliana, C. lepidocarpa, C. echinata, C. rostrata, C. flacca, C. panicea, C. paniculata, C. ovalis, Eleocharis quinqueflora, Juncus articulatus, J. inflexus, Tofieldia calyculata, Epipactis palustris, Crepis paludosa, Parnassia palustris, Succisa pratensis, Pinguicula grandiflora.', 'Carici davallianae-Eriophoretum latifoliae, Pinguiculo grandiflorae-Caricetum davallianae, Pediculari sylvaticae-Caricetum davallianae', 'Bas-marais calcaires peu communs des Pyrénées, avec Eriophorum latifolium, Carex davalliana, C. lepidocarpa, C. echinata, C. rostrata, C. flacca, C. panicea, C. paniculata, C. ovalis, Eleocharis quinqueflora, Juncus articulatus, J. inflexus, Tofieldia calyculata, Epipactis palustris, Crepis paludosa, Parnassia palustris, Succisa pratensis, Pinguicula grandiflora.'),
(4474, 'NR', 22, '54.25', 'Bas-marais à Carex dioica, C. pulicaris, C. flava', '', 'Dioecious-flea-yellow sedge fens', '', 4, 'Niveau 4', 1359, '/71/504/1359/4474', 'true', 'Diverse rich fen communities dominated by small sedges, among which Carex dioica, C. pulicaris or species of the Carex flava group, are usually prominent, but with little or no Carex davalliana. They mostly have a distinctly western distribution, occurring, in particular, in Denmark, on the western Hercynian periphery, in the Causses, in Iberia and in the British Isles.', '', 'Communautés diverses de bas-marais alcalins dominées par des petits Carex, parmi lesquels Carex dioica, C. pulicaris ou des espèces du groupe C. flava sont bien visibles, avec un peu ou non de Carex davalliana. Elles ont surtout une aire de distribution nettement occidentale, se rencontrant en particulier à la périphérie des chaînes hercyniennes occidentales, dans les Causses, dans la péninsule Ibérique et dans les Iles britanniques.'),
(4475, 'NR', 22, '54.5B', 'Tapis de Mousses brunes', '', 'Brown moss carpets', '', 4, 'Niveau 4', 1341, '/71/504/1341/4475', 'true', 'Formations dominated by Drepanocladus exannulatus, D. revolvens, Scorpidium scorpioides, Calliergon giganteum, C. cuspidatum, C. richardsonii, Campylium stellatum, Paludella squarrosa, associated with sparse Carex limosa, C. rostrata, C. lasiocarpa, C. chordorrhiza, C. aquatilis, sometimes with Potentilla palustris, Equisetum fluviatile, Sphagnum recurvum, S. dusenii, S. riparium, S. squarrosum, S. subsecundum or Sphagnum teres, S. warnstorfii, S. contortum, S. auriculatum, S. platyphyllum, characteristic of mesocline or basicline quaking bogs, often occurring in mosaic with Carex lasiocarpa or Carex diandra formations.', '', 'Formations dominées par Drepanocladus exannulatus, D. revolvens, Scorpidium scorpioides, Calliergon giganteum, C. cuspidatum, C. richardsonii, Campylium stellatum, Paludella squarrosa, associées à des pieds clairsemés de Carex limosa, C. rostrata, C. lasiocarpa, C. chordorrhiza, C. aquatilis, quelquefois avec Potentilla palustris, Equisetum fluviatile, Sphagnum recurvum, S. dusenii, S. riparium, S. squarrosum, S. subsecundum, ou Sphagnum teres, S. warnstorfii, S. contortum, S. auriculatum, S. platyphyllum, caractéristiques des tourbières tremblantes mésoclines ou basiclines, formant souvent des mosaïques avec les formations à Carex lasiocarpa ou Carex diandra.'),
(4476, 'NR', 22, '54.5C', 'Tourbières tremblantes à Eriophorum vaginatum', '', 'Harestail cottongrass quaking bogs', '', 4, 'Niveau 4', 1341, '/71/504/1341/4476', 'true', 'Transition mire communities in which the grass layer is dominated by Eriophorum vaginatum, on a thick mat of Sphagnum recurvum, with Polytrichum commune often forming a second moss layer. Associated plants include Carex nigra and Agrostis canina. Typical raised bog plants are few, often limited to Carex pauciflora and Vaccinium oxycoccos.', '', 'Communautés des tourbières de transition dans lesquelles la strate herbacée est dominée par Eriophorum vaginatum, sur un épais tapis de Sphagnum recurvum, avec souvent Polytrichum commune formant une seconde strate bryophytique. Les plantes associées renferment Carex nigra et Agrostis canina. Les plantes typiques des tourbières sont peu nombreuses, souvent limitées à Carex pauciflora et Vaccinium oxycoccos.'),
(4477, 'NR', 22, '54.5D', 'Tourbières tremblantes à Molinia caerulea', '', 'Purple moorgrass quaking bogs', '', 4, 'Niveau 4', 1341, '/71/504/1341/4477', 'true', 'Molinia caerulea-fdominated formation with Sphagnum cuspidatum, Eleocharis palustris, Rhynchospora alba, characteristic of lowlying areas in wet heaths and the periphery of fluctuating oligotrophic moor and heath pools.', '', 'Formations à Molinia caerulea dominante, avec Sphagnum cuspidatum, Eleocharis palustris, Rhynchospora alba, caractéristiques des dépressions dans les landes humides, de la périphérie des mares oligotrophes à niveau d\'eau fluctuant et de plans d\'eau dans les landes.'),
(4478, 'NR', 22, '54.5E', 'Tourbières tremblantes à Calamagrostis stricta', '', 'Narrow small-reed quaking bogs', '', 4, 'Niveau 4', 1341, '/71/504/1341/4478', 'true', 'Basicline transition mire communities characterized by the very rare, decreasing, threatened glacial relict Calamagrostis stricta, often associated with Carex diandra, of northern Ireland, northern Scotland, East Anglia, northern Netherlands, northern, eastern and pre-Alpine Germany.', '', 'Communautés de tourbières de transition basiclines caractérisées par la très rare relique glaciaire, en régression et menacée, Calamagrostis stricta, souvent associés avec Carex diandra, du nord de l\'Irlande, du nord de l\'Ecosse, ..., du nord des Pays-Bas, et de l\'Allemagne septentrionale, orientales et pré-alpine.'),
(4479, 'NR', 22, '52.21', '', '', 'Cottongrass-ling bogs', '', 4, 'Niveau 4', 1392, '/71/516/1392/4479', 'false', 'Upland blanket bogs dominated by Eriophorum vaginatum and Calluna vulgaris with Rubus chamaemorus, Sphagnum rubellum, Hypnum cupressiforme.', '', 'Pas de description disponible'),
(4480, 'NR', 22, '52.22', '', '', 'Cottongrass bogs', '', 4, 'Niveau 4', 1392, '/71/516/1392/4480', 'false', 'Species-poor upland blanket bogs, dominated by Eriophorum vaginatum, mostly widespread in the Pennines.', '', 'Pas de description disponible'),
(4481, 'NR', 22, '52.23', '', '', 'Upland sphagnum mats', '', 4, 'Niveau 4', 1392, '/71/516/1392/4481', 'false', 'Sphagnum papillosum, S. magellanicum, S. rubellum, S. imbricatum, S. fuscum carpets and hummocks of the cottongrass-ling blanket bogs.', '', 'Pas de description disponible'),
(4482, 'NR', 22, '52.24', '', '', 'Dwarf shrub-cottongrass bogs', '', 4, 'Niveau 4', 1392, '/71/516/1392/4482', 'false', 'Upland cottongrass-ling blanket bogs with an abundance of Empetrum hermaphroditum, E. nigrum, Betula nana, Vaccinium uliginosum, V. myrtillus, Arctostaphylos uva-ursi, A. alpina and Sphagnum fuscum.', '', 'Pas de description disponible'),
(4483, 'NR', 22, '52.25', '', '', 'Wooly fringe moss hummocks', '', 4, 'Niveau 4', 1392, '/71/516/1392/4483', 'false', 'Formations dominated by Rhacomitrium lanuginosum.', '', 'Pas de description disponible'),
(4484, 'NR', 22, '52.26', '', '', 'Blanket bog wet heath', '', 4, 'Niveau 4', 1392, '/71/516/1392/4484', 'false', 'Formations of Scirpus cespitosus, Myrica gale, Erica tetralix, Calluna vulgaris, Molinia caerulea, Sphagnum spp. (S. papillosum, S. rubellum, S. magellanicum, S. auriculatum), Rhacomitrium lanuginosum and lichens, similar to 31.1, integrated within blanket bog systems.', 'Ericion tetralicis', 'Pas de description disponible'),
(4485, 'NR', 22, '52.27', '', '', 'Flushes, deep hollows and pools', '', 4, 'Niveau 4', 1392, '/71/516/1392/4485', 'false', 'Wet depressions and seeps colonized by communities of the Scheuchzerietalia palustris (54.5, 54.6), the Caricetalia fuscae (54.4), the Utricularietalia intermedio-minoris (22.45), the Littorelletalia (22.31) or the Potamogetonetalia (22.43).', '', 'Pas de description disponible'),
(4486, 'NR', 22, '44.62', 'Forêts d\'Ormes riveraines et méditerranéennes', '', 'Mediterranean riparian elm forests', '', 4, 'Niveau 4', 1403, '/68/515/1403/4486', 'true', 'Ulmus minor-dominated woodlands, usually forming, on eutrophic soils, at the outer, drier, edge of the Mediterranean riparian or lacustrine galleries. Populus alba and Fraxinus angustifolia often participate in the tree-layer; Arum italicum, Ranunculus ficaria, Acanthus mollis, Brachypodium sylvaticum, Elymus caninus, Rubus ulmifolius are characteristic of the undergrowth. Dense and dark in natural form, these woods have been extremely reduced and degraded by human action. The most characteristic examples to remain are probably those of the Iberian peninsula, although fragments are still recorded in France, Italy and Greece.', 'Fraxino angustifoliae-Ulmenion minoris p. : Aro italici-Ulmetum, Acantho mollis-Ulmetum minoris', 'Bois dominés par Ulmus minor, formant habituellement des galeries riveraines ou lacustres, sur des sols eutrophes, sur la frange extérieure plus sèche en régime méditerranéen. Populus alba et Fraxinus angustifolia participent souvent à la strate arborée ; Arum italicum, Ranunculus ficaria, Acanthus mollis, Brachypodium sylvaticum, Elymus caninus, Rubus ulmifolius sont caractéristiques du sous-bois. Les formes naturelles de ces bois, denses et obscures ont été extrêmement réduites et dégradées par les actions humaines. Les exemples les plus caractéristiques qui subsistent sont probablement ceux de la pénisule Ibérique, bien que des fragments soient encore signalés en France.'),
(4487, 'NR', 22, '44.63', 'Bois de Frênes riverains et méditerranéens', '', 'Mediterranean riparian ash woods ', '', 4, 'Niveau 4', 1403, '/68/515/1403/4487', 'true', 'Riparian galleries dominated by tall Fraxinus angustifolia, mostly characteristic of less eutrophic soils than the elm and poplar galleries, and of drier stations, with shorter inundation periods, than those occupied by poplar woods.', 'Fraxino angustifoliae-Ulmetum minoris p., \"Fraxinion angustifoliae\"', 'Galeries riveraines dominées par les grands Fraxinus angustifolia, surtout caractéristiques des sols moins eutrophes que les galeries d\'Ormes et de Peupliers, et en stations plus sèches, avec des périodes d\'inondation plus courtes, que celles occupées par les bois de Peupliers.'),
(4488, 'NR', 22, '45.32', 'Forêts de Chênes verts supra-méditerranéennes', '', 'Supra-Mediterranean holm-oak forests', '', 4, 'Niveau 4', 1401, '/68/517/1401/4488', 'true', 'Formations of the supra-Mediterranean levels, often mixed with deciduous oaks, Acer spp. or Ostrya carpinifolia.', '', 'Formations de l\'étage supra-méditerranéen, souvent mêlées de Chênes caducifoliés, d\'Acer spp. ou d\'Ostrya carpinifolia.'),
(4489, 'NR', 22, '42.5C', '', '', 'Greek Scots pine forests', '', 4, 'Niveau 4', 1263, '/68/491/1263/4489', 'false', 'Pinus sylvestris forests of the mountains of northern Greece (Pieria, Olympus, Vermion, Voras, Laïla, Elatia range), often with Acer pseudoplatanus, Sorbus aucuparia, and sometimes Fagus sylvestris or Picea abies in the tree layer and with Vaccinium myrtillus and Rubus idaeus in the shrub layer.', '', 'Pas de description disponible'),
(4490, 'NR', 22, '42.5D', '', '', 'Po terrace Scots pine forests', '', 4, 'Niveau 4', 1263, '/68/491/1263/4490', 'false', 'Forests of Pinus sylvestris of the fluvio-glacial terraces that constitute the high plains of the Po river system, with Betula pendula, Quercus pubescens, Castanea sativa and a ground layer with Cytisus scoparia, Calluna vulgaris, Pteridium aquilinum, Deschampsia caespitosa, Molinia caerulea.', '', 'Pas de description disponible'),
(4491, 'NR', 22, '42.5E', 'Reboisement de Pins sylvestres', '', 'Scots pine reforestation', '', 4, 'Niveau 4', 1263, '/68/491/1263/4491', 'true', 'Pinus sylvestris plantations inside or near the present or recent natural range of the species. Other and very artificial P. sylvestris plantations should be listed under 83.', '', 'Plantations de Pinus sylvestris à l\'intérieur des limites ou à proximité de l\'aire naturelle actuelle ou récente de l\'espèce. Les plantations de Pinus sylvestris situées dans d\'autres régions et les formations très artificielles doivent être codées sous le n°83.'),
(4492, 'NR', 22, '42.61', '', '', 'Italian Pinus nigra forests', '', 4, 'Niveau 4', 1369, '/68/491/1369/4492', 'false', 'Pinus nigra s.s. forests of the eastern Italian Alps and the Apennines.', '', 'Pas de description disponible'),
(4493, 'NR', 22, '42.62', '', '', 'Greek Pinus nigra forests', '', 4, 'Niveau 4', 1369, '/68/491/1369/4493', 'false', 'Pinus nigra s.s. pine woods of northwestern Greece.', '', 'Pas de description disponible'),
(4494, 'NR', 22, '42.AA', 'Bois de Genévriers de Phénicie', '', 'Phoenician juniper woods ', '', 4, 'Niveau 4', 1400, '/68/491/1400/4494', 'true', 'Mediterranean formations dominated by Juniperus phoenicea are mostly arborescent matorrals and have been covered under 32.132. Exceptional, tall and dense formations, however, may be more appropriately characterized as woodland and listed in this unit.', '', 'Les formations méditerranéennes dominées par Juniperus phoenicea sont pour la plupart des matorrals arborescents et ont été intégrés en 32.132. Des formations exceptionnelles, hautes et denses, peuvent toutefois être plus correctement caractérisées en tant que bois et être classées dans cette unité.'),
(4495, 'NR', 22, '44.11', 'Saussaies pré-alpines', '', 'Pre-Alpine willow brush', '', 4, 'Niveau 4', 1378, '/68/515/1378/4495', 'true', 'Willow brush of fast, pebbly, summer-high rivers in Alpine and peri-Alpine valleys with Salix elaeagnos, S. purpurea ssp. gracilis, S. daphnoides, S. nigricans, Myricaria germanica and Hippophae rhamnoides.', 'Salicetea purpureae: Salicion elaeagni', 'Fourrés de Saules des rivières rapides, à crues estivales et à lit caillouteux, des vallées alpiennes et péri-alpiennes avec Salix eleagnos, S. purpurea subsp. gracilis, S. daphnoides, S. nigricans, Myricaria germanica et Hippophae rhamnoides.'),
(4496, 'NR', 22, '44.64', 'Galeries de Charmes Houblon', '', 'Hop-hornbeam galleries', '', 4, 'Niveau 4', 1403, '/68/515/1403/4496', 'true', 'Ostrya carpinifolia-dominated alluvial galleries of the Var, in southeastern france, with Ulmus minor, Populus alba, Salix elaeagnos, Alnus glutinosa, Fraxinus ornus, Acer campestre, A. opalus, Quercus pubescens, Cornus sanguinea, Ligustrum vulgare, Laurus nobilis, Tamus communis, Hedera helix, Viola reichenbachiana, Euphorbia dulcis, Brachypodium sylvaticum, Melica uniflora, Carex pendula, C. digitata and the rare Carex grioletii.', 'Melico uniflorae-Ostryetum', 'Galeries alluviales du Var dominées par Ostrya carpinifolia dans le sud-est de la France, avec Ulmus minor, Populus alba, Salix elaeagnos, Alnus glutinosa, Fraxinus ornus, Acer campestre A. opalus, Quercus pubescens, Cornus sanguinea, Ligustrum vulgare, Laurus nobilis, Tamus communis, Hedera helix, Viola reichenbachiana, Euphorbia dulcis, Brachypodium sylvaticum, Melica uniflora, Carex pendula, C. digitata et le rare Carex grioletii.'),
(4497, 'NR', 22, '44.71', '', '', 'Oriental plane woods', '', 4, 'Niveau 4', 1379, '/68/515/1379/4497', 'false', 'Forests of Platanus orientalis.', 'Platanion orientalis', 'Pas de description disponible'),
(4498, 'NR', 22, '45.33', 'Forêts aquitaniennes de Chênes verts', '', 'Aquitanian holm-oak woodland', '', 4, 'Niveau 4', 1401, '/68/517/1401/4498', 'true', 'Isolated Quercus ilex-dominated stands occurring as a facies of dunal pine-holm oak forests.', '', 'Formations isolées dominées par Quercus ilex apparaissant comme faciès des pinèdes dunaires aquitaniennes.'),
(4499, 'NR', 22, '45.34', '', '', 'Quercus rotundifolia woodland', '', 4, 'Niveau 4', 1401, '/68/517/1401/4499', 'false', 'Iberian forest communities formed by Q. rotundifolia. Generally, even in mature state, less tall, less luxuriant and drier than the fully developed forests that can be constituted by the closely related Q. ilex, they are, moreover, most often degraded into open woodland or even arborescent matorral. Species characteristic of the undergrowth are Arbutus unedo, Phillyrea angustifolia, Rhamnus alaternus, Pistacia terebinthus, Rubia peregrina, Jasminum fruticans, Smilax aspera, Lonicera etrusca, L. implexa.', '', 'Pas de description disponible');
INSERT INTO `corine` (`CD_HAB`, `FG_VALIDITE`, `CD_TYPO`, `LB_CODE`, `LB_HAB_FR`, `LB_HAB_FR_COMPLET`, `LB_HAB_EN`, `LB_AUTEUR`, `NIVEAU`, `LB_NIVEAU`, `CD_HAB_SUP`, `PATH_CD_HAB`, `FRANCE`, `LB_DESCRIPTION`, `CRSP_PHYTO_CB91`, `DESCRIPTIF_CB97_FR`) VALUES
(4500, 'NR', 22, '42.63', 'Forêts de Pins de Salzmann', '', 'Salzmann\'s pine forests', '', 4, 'Niveau 4', 1369, '/68/491/1369/4500', 'true', 'Pinus salzmannii forests of Spain and the Causses.', '', 'Forêts de Pinus salzmannii d\'Espagne et des Causses.'),
(4501, 'NR', 22, '44.12', 'Saussaies de plaine, collinéennes et méditerranéo-montagnardes', '', 'Lowland, collinar and Mediterraneo-montane willow brush', '', 4, 'Niveau 4', 1378, '/68/515/1378/4501', 'true', 'Linear shrubby willow formations of river banks in plains, hills and low mountains of middle Europe and the Mediterranean region, with Salix triandra, S. viminalis, S. purpurea.', 'Salicion triandro-viminalis, Salicenion angustifolii, Salicion salvifoliae (Salicion albae p.)', 'Formations arbustives linéaires de Saules des berges des rivières dans les plaines, les collines et les basses montagnes de l\'Europe centrale et de la région méditerranéenne, avec Salix triandra, S. viminalis, S. purpurea.'),
(4502, 'NR', 22, '44.72', '', '', 'Sweet gum woods', '', 4, 'Niveau 4', 1379, '/68/515/1379/4502', 'false', 'Liquidambar orientalis gallery of the Petaloudhes Valley, on Rhodes.', '', 'Pas de description disponible'),
(4503, 'NR', 22, '42.64', 'Forêts corses de Pins laricio', '', 'Corsican laricio pine forests', '', 4, 'Niveau 4', 1369, '/68/491/1369/4503', 'true', 'Pinus laricio forests of the mountains of Corsica. The nuthatch Sitta whiteheadi is endemic to these forests.', '', 'Forêts de Pinus laricio des montagnes de Corse. La sittelle corse Sitta whiteheadi est endémique de ces forêts.'),
(4504, 'NR', 22, '44.13', 'Forêts galeries de Saules blancs', '', 'White willow gallery forests', '', 4, 'Niveau 4', 1378, '/68/515/1378/4504', 'true', 'Arborescent galleries of tall Salix alba, S. fragilis and S. x rubens, sometimes including Populus nigra, along medio-European lowland, hill or sub-montane rivers, submitted to a regular regime of inundation.', 'Salicion albae: Salicetum albae, Salicetum fragilis', 'Galeries arborescentes avec Salix alba, S. fragilis et S. x rubens élevés, comprenant parfois Populus nigra, le long des rivières de plaine, des collines ou des basses montagnes de l\'Europe moyenne et soumises à un régime régulier d\'inondations.'),
(4505, 'NR', 22, '44.14', 'Galeries méditerranéennes de grands Saules', '', 'Mediterranean tall willow galleries', '', 4, 'Niveau 4', 1378, '/68/515/1378/4505', 'true', 'Arborescent willow formations bordering Mediterranean watercourses, willow-dominated belt or facies of the poplar-ash-elm forests.', 'Populetalia albae p.', 'Formations de Saules arborescents bordant les cours d\'eau méditerranéens, à ceinture ou faciès dominé par le Saule avec Peuplier, Frêne et Orme.'),
(4506, 'NR', 22, '44.81', 'Galeries de Laurier-roses, de Gattiliers et de Tamaris', '', 'Oleander, chaste tree and tamarix galleries', '', 4, 'Niveau 4', 1380, '/68/515/1380/4506', 'true', 'Thickets and galleries of Nerium oleander, Vitex agnus-castus or Tamarix spp., mostly of the thermo-Mediterranean zone.', 'Nerio-Tamaricetea', 'Fourrés et galeries de Nerium oleander, Vitex agnus-castus ou Tamarix spp., principalement de l\'étage thermo-méditerranéen.'),
(4507, 'NR', 22, '42.65', '', '', 'Calabrian laricio pine forests', '', 4, 'Niveau 4', 1369, '/68/491/1369/4507', 'false', 'Pinus laricio var. calabrica forests of the Sila, the Aspromonte and Etna.', '', 'Pas de description disponible'),
(4508, 'NR', 22, '42.66', '', '', 'Pallas\'s pine forests', '', 4, 'Niveau 4', 1369, '/68/491/1369/4508', 'false', 'Montane forests of Pinus pallasiana of Greece.', 'Pino-Chamaecytision', 'Pas de description disponible'),
(4509, 'NR', 22, '42.67', 'Reboisement en Pins noirs', '', 'Black pine reforestation', '', 4, 'Niveau 4', 1369, '/68/491/1369/4509', 'true', 'Plantations of pines of the P. nigra group, accompanied by semi-natural undergrowth formations. These are usually calciphilous communities when accompanying P. nigra, acidophilous ones when with P. laricio. In all cases they can be specified by codes borrowed from other units, used in conjunction with 42.67.', '', 'Plantations de Pins du groupe du Pinus nigra, accompagnés par des sous-bois semi-naturels. Ce sont habituellement des communautés calciphiles quand elles accompagnent Pinus nigra, acidiphiles quand elles accompagnent Pinus laricio. Dans tous les cas elles peuvent être spécifiées par des codes empruntés à d\'autres unités, utilisés en conjonction avec l\'unité 42.67.'),
(4510, 'NR', 22, '42.71', '', '', 'White-barked pine forests', '', 4, 'Niveau 4', 1382, '/68/491/1382/4510', 'false', 'Local treeline formations of Pinus heldreichii or P. leucodermis restricted to northern Greece and southern Italy, usually open and with an undergrowth formed by stripped grasslands on dry, often stony or rocky soils.', '', 'Pas de description disponible'),
(4511, 'NR', 22, '42.72', '', '', 'Macedonian pine woods', '', 4, 'Niveau 4', 1382, '/68/491/1382/4511', 'false', 'Pinus peuce formations, restricted to the sub-alpine zone of the high mountains of extreme northern Greece (Voras, Varnous).', 'Pinion peucis', 'Pas de description disponible'),
(4512, 'NR', 22, '45.71', '', '', 'Cretan palm groves', '', 4, 'Niveau 4', 1383, '/68/517/1383/4512', 'false', 'Relict Phoenix theophrasti woods of Crete, restricted to damp sandy coastal valleys; they include the extensive forest of Vai, where the luxuriant palm growth is accompanied by a thick shrubby undergrowth rich in Nerium oleander, and about four other smaller coastal groves, notably on the south coast of the prefectorate of Rethimnon.', '', 'Pas de description disponible'),
(4513, 'NR', 22, '45.72', '', '', 'Canarian palm groves', '', 4, 'Niveau 4', 1383, '/68/517/1383/4513', 'false', 'Relict Phoenix canariensis woods of the Canary Islands, mostly characteristic of the bottom of barrancos and of alluvial soils, below 600 metres. Palm groves are now very rare, but still exist in all the islands, with particularly representative examples at Haria on Lanzarote, Vega del Rio Palmas on Fuerteventura, Fataga, Maspalomas and the Barranco de Tirajana in Gran Canaria, Valle Gran Rey in La Gomera, Masca in Tenerife and Brena Alta in La Palma.', '', 'Pas de description disponible'),
(4514, 'NR', 22, '42.81', 'Forêts de Pins maritimes', '', 'Maritime pine forests', '', 4, 'Niveau 4', 1386, '/68/491/1386/4514', 'true', 'Woods and plantations of Pinus pinaster ssp. atlantica of southwestern France and the western Iberian peninsula.', '', 'Bois et plantations de Pinus pinaster subsp. atlantica du sud-ouest de la France et de l\'ouest de la péninsule Ibérique.'),
(4515, 'NR', 22, '44.15', '', '', 'Canarian willow galleries', '', 4, 'Niveau 4', 1378, '/68/515/1378/4515', 'false', 'Riparian communities forming mostly in ravines and gullies within the laurel forest belt of the Canary Islands and characterized by the presence of the tall endemic, Salix canariensis. The best preserved are found in the barranco de Los Cernicalos of Gran Canaria, in the caldera de Taburiente of La Palma and in the barranco del Infierne of Tenerife.', 'Rubo-Salicetum canariensis', 'Pas de description disponible'),
(4516, 'NR', 22, '44.21', 'Galeries montagnardes d\'Aulnes blancs', '', 'Montane grey alder galleries', '', 4, 'Niveau 4', 1387, '/68/515/1387/4516', 'true', 'Alnus incanus formations of the upper reaches of Alpine, particularly inner Alpine, valleys, replacing, colonizing or fringing the pioneer willow scrubs of the Salicion eleagni (44.11).', 'Calamagrosti variae-Alnetum incanae', 'Formations d\'Alnus incana des parties supérieures des vallées alpiennes, particulièrement intra-alpines, remplaçant, colonisant ou bordant les fourrés pionniers de Saules du Salicion eleagni (44.11).'),
(4517, 'NR', 22, '44.22', 'Galeries sub-montagnardes d\'Aulnes blancs', '', 'Sub-montane grey alder galleries', '', 4, 'Niveau 4', 1387, '/68/515/1387/4517', 'true', 'Alder formations of the middle course of rivers flowing from the Alps, in particular on the Bavarian plateau, the Rhine and Rhone systems.', 'Equiseto hyemalis-Alnetum incanae', 'Formations d\'Aulnes du cours moyen des rivières coulant des Alpes, en particulier des systèmes rhénans et rhodaniens.'),
(4518, 'NR', 22, '44.82', '', '', 'South-western Iberian tamujares', '', 4, 'Niveau 4', 1380, '/68/515/1380/4518', 'false', 'Low, spiny, almost monospecific fringes formed by the Ibero-African shrubby spurge Securinega tinctoria on the outer edge of temporary or permanent water courses of great seasonal amplitude in the southwestern quadrant of the Iberian peninsula (Montes de Toledo, Sierra Morena, Extremadura, southwestern Andalusia, southern Portugal). Among the few associated plants, are the lianas Bryonia cretica, Tamus communis and the endemic Clematis campaniflora. Pyrus bourganeana may transgress from neighbouring communities.', 'Securinegion tinctoriae: Pyro bourgaeanae-Securinegetum tinctoriae', 'Pas de description disponible'),
(4519, 'NR', 22, '44.83', '', '', 'Oretanian lauriphyllous galleries', '', 4, 'Niveau 4', 1380, '/68/515/1380/4519', 'false', 'Supra- and upper meso-Mediterranean riparian galleries of the Montes de Toledo (Cordillera Oretana), constituted by the lauriphyllous Prunus lusitanica and Viburnum tinus; they line water courses on the inner edge of alder galleries of 44.551 and 44.552, which they sometimes entirely replace.', 'Viburno tini-Prunetum lusitanicae', 'Pas de description disponible'),
(4520, 'NR', 22, '44.84', '', '', 'Oretanian bog-myrtle willow scrub', '', 4, 'Niveau 4', 1380, '/68/515/1380/4520', 'false', 'Tall scrub of Montes de Toledo streams, with Frangula alnus, Salix atrocinerea, S. salvifolia and Myrica gale.', 'Frangulo-Myricaetum galeae', 'Pas de description disponible'),
(4521, 'NR', 22, '42.82', 'Forêts de Pins mésogéens', '', 'Mesogean pine forests', '', 4, 'Niveau 4', 1386, '/68/491/1386/4521', 'true', 'Forests of Pinus pinaster ssp. pinaster (=Pinus mesogeensis) of the western Mediterranean, mostly in siliceous meso-Mediterranean, upper meso-Mediterranean and supra-Mediterranean situations of Spain, Corsica, southeastern France, northwestern Italy, Sardinia and Pantelleria.', '', 'Forêts de Pinus pinaster subsp. pinaster (Pinus mesogeensis) de la Méditerranée occidentale, développées surtout sur des substrats siliceux des étages méso-méditerranéen, méso-méditerranéen supérieur et supra-méditerranéen d\'Espagne, de Corse, du sud-est de la France ...'),
(4522, 'NR', 22, '44.31', 'Forêts de Frênes et d\'Aulnes des ruisselets et des sources (rivulaires)', '', 'Ash-alder woods of rivulets and springs', '', 4, 'Niveau 4', 1389, '/68/515/1389/4522', 'true', 'Fraxinus excelsior-Alnus glutinosa formations of springs and small streams of Atlantic, sub-Atlantic and sub-continental middle Europe, usually dominated by ashes, with Carex remota, C. pendula, C. strigosa, Equisetum telmateia, Rumex sanguineus, Lysimachia nemorum, Cardamine amara, Chrysosplenium oppositifolium, C. alternifolium, Impatiens noli-tangere, Ribes rubrum.', 'Carici remotae-Fraxinetum, Equiseto telmateiae-Fraxinetum, Ribeso sylvestris-Fraxinetum', 'Formations à Fraxinus excelsior et Alnus glutinosa des sources et des petits cours d\'eaux étroits d\'Europe moyenne atlantique, sub-atlantique et sub-continentale, généralement dominées par des Frênes, avec Carex remota, C. pendula, C. strigosa, Equisetum telmateia, Rumex sanguineus, Lysimachia nemorum, Cardamine amara, Chrysosplenium oppositifolium, C. alternifolium, Impatiens noli-tangere, Ribes rubrum.'),
(4523, 'NR', 22, '44.91', 'Bois marécageux d\'Aulnes', '', 'Alder swamp woods', '', 4, 'Niveau 4', 1388, '/68/515/1388/4523', 'true', 'Marshy Alnus glutinosa-dominated formations, usually with shrubby willows in the undergrowth.', 'Alnion glutinosae', 'Formations marécageuses d\'Alnus glutinosa dominant, habituellement avec des Saules arbustifs en sous-bois.'),
(4524, 'NR', 22, '44.92', 'Saussaies marécageuses', '', 'Mire willow scrub', '', 4, 'Niveau 4', 1388, '/68/515/1388/4524', 'true', 'Willow-dominated formations with Salix aurita, S. cinerea, S. atrocinerea, S. pentandra, Frangula alnus, Betula humilis, of fens, marshy floodplains and fringes of lakes and ponds.', 'Salicion cinereae (Frangulo-Salicion auritae)', 'Formations à Saules dominants avec Salix aurita, S. cinerea, S. atrocinera, S. pentandra, Frangula alnus, de bas-marais, de zones inondables, des marges de lacs et d\'étangs.'),
(4525, 'NR', 22, '42.83', 'Forêts de Pins parasols', '', 'Stone pine forests', '', 4, 'Niveau 4', 1386, '/68/491/1386/4525', 'true', 'Mediterranean forests and old naturalized plantations of Pinus pinea. Antique introduction in many areas makes the distinction between spontaneous forests and long-established formations of artificial origin often difficult. These are thus included here, while recent, obviously artificial groves are not.', '', 'Forêts méditerranéennes et anciennes plantations naturalisées de Pinus pinea. Son introduction antique dans plusieurs régions rend la distinction souvent difficile entre les forêts spontanées et les formations établies depuis longtemps d\'origine artificielle. Les boisements sont donc inclus ici tandis que les peuplements récents d\'origine artificielle évidente ne le sont pas.'),
(4526, 'NR', 22, '44.32', 'Bois de Frênes et d\'Aulnes des rivières à débit rapide', '', 'Ash-alder woods of fast-flowing rivers', '', 4, 'Niveau 4', 1389, '/68/515/1389/4526', 'true', 'Alder or ash-alder galleries of the banks of fast-flowing rivers and large brooks replacing the peri-Alpine Alnus incana galleries in hills of northern and western Europe. They are usually co-dominated by Alnus glutinosa, Fraxinus excelsior and Acer pseudoplatanus, accompanied by Acer platanoides, Ulmus glabra, U. laevis. Prunus padus is frequent in the undergrowth, shrubs include Ribes rubrum, R. uva-crispa, Corylus avellana; the herb layer comprises Stellaria nemorum, Impatiens noli-tangere, Aconitum vulparia, Allium ursinum, Geum rivale, Athyrium filix-femina, Dryopteris carthusiana, Matteuccia struthiopteris, Ranunculus platanifolius, Urtica dioica, Ranunculus ficaria, Primula elatior, Lamium galeobdolon or Filipendula ulmaria, Luzula sylvatica. The gallery may be enclosed within other forests or reduced to a thin line of alders along rivers traversing pastureland.', 'Stellario-Alnetum glutinosae', 'Galeries d\'Aulnes ou d\'Aulnes et de Frênes des berges des rivières à débit rapide et des ruisseaux larges, remplaçant les galeries péri-alpiennes d\'Alnus incana dans les collines du nord et de l\'ouest de l\'Europe ; elles sont généralement co-dominées par Alnus glutinosa, Fraxinus excelsior et Acer pseudoplatanus, accompagnés d\'Acer platanoides, Ulmus glabra, U. laevis. Prunus padus est fréquent en sous-strate, les arbustes comprenant Ribes rubrum, R. uva-crispa, Corylus avellana ; la strate herbacée renferme Stellaria nemorum, Impatiens noli-tangere, Aconitum vulparia, Allium ursinum, Geum rivale, Athyrium filix-femina, Dryopteris carthusiana, Matteucia struthiopteris, Ranunculus platanifolius, Urtica dioica, Ranunculus ficaria, Primula eliator, Lamiastrum galeobdolon, ou Filipendula ulmaria, Luzula sylvatica. Cette galerie peut être incluse dans d\'autres forêts ou réduite à un étroit cordon d\'Aulnes le long des rivières traversant un paysage de pâturages.'),
(4527, 'NR', 22, '44.33', 'Bois de Frênes et d\'Aulnes des rivières à eaux lentes', '', 'Ash-alder woods of slow rivers', '', 4, 'Niveau 4', 1389, '/68/515/1389/4527', 'true', 'Central, and locally western, European woods of large valleys of lowland slow and even-flowing rivers, with Fraxinus excelsior, Alnus glutinosa, Prunus padus, Ulmus laevis, Quercus robur, Humulus lupulus, Rubus idaeus, R. caesius, Ribes nigrum, R. rubrum, Sambucus nigra, Aegopodium podagraria, Peucedanum palustre, Glyceria maxima, Iris pseudacorus, Carex acutiformis, C. riparia, Phalaris arundinacea, Filipendula ulmaria, Cirsium oleraceum, C. palustre.', 'Pruno-Fraxinetum, Ulmo-Fraxinetum', 'Bois d\'Europe centrale et, localement, occidentale, liés aux rivières des larges vallées ou des plaines à courant faible et uniforme, avec Fraxinus excelsior, Alnus glutinosa, Prunus padus, Ulmus laevis, Quercus robur, Humulus lupulus, Rubus idaeus, R. caesius, Ribes nigrum, R. rubrum, Sambucus nigra, Aegopodium podagraria, Peucedanum palustre, Glyceria maxima, Iris pseudacorus, Carex acutiformis, C. riparia, Phalaris arundinacea, Filipendula ulmaria, Cirsium oleraceum, C. palustre.'),
(4528, 'NR', 22, '44.93', 'Bois marécageux de Bouleaux et de piment royal', '', 'Swamp bog-myrtle scrub', '', 4, 'Niveau 4', 1388, '/68/515/1388/4528', 'true', 'Myrica gale thickets of fringes of fens, drying fens and nascent or regenerating bogs of middle Europe, mostly characteristic of the Atlantic sector.', 'Salicion cinereae p.: Myricetum gale', 'Fourrés de Myrica gale des marges des bas-marais, de marécages s\'asséchant et de tourbières hautes naissantes ou se régénérant, de l\'Europe moyenne, surtout caractéristiques du secteur Atlantique.'),
(4529, 'NR', 22, '44.A1', 'Bois de Bouleaux à Sphaignes', '', 'Sphagnum birch woods', '', 4, 'Niveau 4', 1390, '/68/515/1390/4529', 'true', 'Forests of Betula pubescens or B. carpatica on peaty, humid and very acid soils, colonizing bogs of reduced peat building activity and acid fens, with Molinia caerulea, Vaccinium uliginosum, V. myrtillus, Empetrum nigrum, Trientalis europaea and many sphagnums, mosses and liverworts.', 'Betuletum pubescentis (Vaccinio uliginosi-Betuletum pubescentis); Sphagno palustris-Betuletum pubescentis i.a.', 'Forêts de Betula pubescens ou de Betula carpatica sur sols tourbeux, humides et très acides, colonisant les tourbières bombées à activité turfigène réduite et des bas-marais acides avec Molinia caerulea, Vaccinium myrtillus, Empetrum nigrum, Trientalis europaea et de très nombreuses Sphaignes, Mousses et Hépatiques.'),
(4530, 'NR', 22, '52.11', '', '', 'Black bog-rush swards', '', 4, 'Niveau 4', 1391, '/71/516/1391/4530', 'false', 'Schoenus nigricans-Rhacomitrium lanuginosum formations, particularly widespread on deep peat in the Galway and Mayo peninsulas of Ireland, local in Scotland. Pinguicula lusitanica and Pedicularis sylvatica may occur.', '', 'Pas de description disponible'),
(4531, 'NR', 22, '52.12', '', '', 'Sphagnum-algae carpets', '', 4, 'Niveau 4', 1391, '/71/516/1391/4531', 'false', 'Waterlogged pool edges and bog surfaces rich in Sphagnum magellanicum or S. papillosum, S. rubellum, S. cuspidatum, S. auriculatum, S. palustre and Zygogonium deposits, often with Drosera anglica, D. rotundifolia, Menyanthes trifoliata.', '', 'Pas de description disponible'),
(4532, 'NR', 22, '52.13', '', '', 'Deergrass swards', '', 4, 'Niveau 4', 1391, '/71/516/1391/4532', 'false', 'Scirpus cespitosus - dominated swards on slopes, tops of slopes, shallow peat, and slightly drier areas, particularly abundant in Scotland and Kerry. Carex panicea, Sphagnum compactum, Pinguicula grandiflora may be prominent.', '', 'Pas de description disponible'),
(4533, 'NR', 22, '52.14', '', '', 'Oblong-leaved sundew communities', '', 4, 'Niveau 4', 1391, '/71/516/1391/4533', 'false', 'Formations rich in Drosera intermedia, with Riccardia pinguis, Rhynchospora fusca or Carex limosa of slope areas submitted to surface water movement and shallow hollows.', '', 'Pas de description disponible'),
(4534, 'NR', 22, '52.15', '', '', 'Bulbous-rush communities', '', 4, 'Niveau 4', 1391, '/71/516/1391/4534', 'false', 'Formations of Juncus bulbosus, Eleocharis multicaulis and Carex panicea of shallow drainage channels and shallow pools.', '', 'Pas de description disponible'),
(4535, 'NR', 22, '52.16', '', '', 'Flushes, deep hollows and pools', '', 4, 'Niveau 4', 1391, '/71/516/1391/4535', 'false', 'Wet depressions and seeps colonized by communities of the Scheuchzerietalia palustris (54.5, 54.6), the Caricetalia fuscae (54.4), the Utricularietalia intermedio-minoris (22.45), the Littorelletalia (22.31) or the Potamogetonetalia (22.43), which can be noted by use of appropriate codes. Among important elements are Potamogeton polygonifolius, Eriocaulon aquaticum, Lobelia dortmanna, Menyanthes trifoliata.', '', 'Pas de description disponible'),
(4536, 'NR', 22, '44.A2', 'Bois tourbeux de Pins sylvestres', '', 'Scots pine bog woods', '', 4, 'Niveau 4', 1390, '/68/515/1390/4536', 'true', 'Pinus sylvestris formations of bogs and transition mires with Eriophorum vaginatum, Ledum palustre, Vaccinium uliginosum, Calluna vulgaris, Andromeda polifolia restricted to the plains of northern and eastern Germany and to isolated stations in the Hercynian arc.', 'Ledo-Pinetum (Vaccinio uliginosae-Pinetum sylvestris) i.a.', 'Formations de Pinus sylvestris de tourbières bombées et de tourbières de transition avec Eriophorum vaginatum, Vaccinium uliginosum, Calluna vulgaris, Andromeda polifolia restreintes aux plaines de l\'Allemagne nord-orientale et à des stations isolées de l\'arc hercynien.'),
(4537, 'NR', 22, '44.A3', 'Bois tourbeux de Pins de montagne', '', 'Mountain pine bog woods', '', 4, 'Niveau 4', 1390, '/68/515/1390/4537', 'true', 'Pinus rotundata (P. uncinata s.l., \"P. mugo\") woods (var. arborea) or scrubs (var. pseudopumilio) of bogs in the Alps and peri-Alpine areas, the Jura and the higher Hercynian ranges, with Eriophorum vaginatum, Vaccinium oxycoccos, V. uliginosum, V. myrtillus, Sphagnum spp. and sometimes Betula nana.', 'Vaccinio uliginosae-Pinetum rotundatae (Sphagno-Mugetum, Pino rotundatae-Sphagnetum p.)', 'Bois de Pinus rotundata (P. uncinata s.l., P. mugo) (var. arborea) ou arbustives (var. pseudopumilio) des tourbières hautes des Alpes et des régions péri-alpiennes, du Jura, des plus hauts massifs hercyniens, avec Eriophorum vaginatum, Vaccinium oxycoccos, V. uliginosum, V. myrtillus, Sphagnum spp. et parfois Betula nana.'),
(4538, 'NR', 22, '44.A4', 'Bois d\'Epicéas à Sphaignes', '', 'Sphagnum spruce woods', '', 4, 'Niveau 4', 1390, '/68/515/1390/4538', 'true', 'Picea abies woods with a Sphagnum-rich ground layer.', '', 'Bois de Picea abies avec un sous-bois riche en Sphaignes.'),
(4539, 'NR', 22, '45.41', '', '', 'Greek kermes oak forests', '', 4, 'Niveau 4', 1381, '/68/517/1381/4539', 'false', 'Arborescent Quercus coccifera-dominated formations of peninsular Greece, the Ionian and Aegean archipelagoes and of Crete. Extensive, fully-developed stands exist in several areas of Crete. The most representative forests occupy valleys in the 700-800 m range of the southern slopes of the Psiloriti mountains; Acer orientale, Cephalanthera cucullata and Epipactis cretica are associated. Other forests are found in the Lefka and Lassithi mountains; Pyrus amygdaliformis, Prunus webbii, Pistacia terebinthus, Phillyrea latifolia, Styrax officinalis are characteristic of various Cretan stands. Outside of Crete, forest stands are found sporadically, in particular on Ikaria, Samothrace and Mount Athos, where Q. coccifera is associated with Q. ilex, and at high elevations of Rhodes, where Q. coccifera forms woodland fragments with arborescent Phillyrea media. In many areas remnant tall Q. coccifera may form arborescent matorral; coppice-like formations of young trees also occur.', '', 'Pas de description disponible'),
(4239, 'NR', 22, '42.31', 'Forêts siliceuses orientales à Mélèze et Arolle', '', 'Eastern siliceous larch and arolla forests', '', 4, 'Niveau 4', 1267, '/68/491/1267/4239', 'false', 'Sub-alpine Larix decidua, Pinus cembra, or Larix decidua-Pinus cembra forests of the eastern and central Alps, mostly of the inner ranges, usually on siliceous substrates, with an often species-poor undergrowth comprising Vaccinium myrtillus, Rhododendron ferrugineum, Calamagrostis villosa, Luzula albida.', 'Larici-Cembretum', 'Forêts subalpines de Larix decidua, de Pinus cembra ou de Larix decidua-Pinus cembra des Alpes centrales et orientales, généralement dans les régions internes, habituellement sur des substrats siliceux, avec un sous-bois souvent spécifiquement pauvre comprenant Vaccinium myrtillus, Rhododendron ferrugineum, Calamagrostis villosa, Luzula luzuloides.'),
(4240, 'NR', 22, '41.31', '', '', 'Ash-rowan-mercury forests', '', 4, 'Niveau 4', 1266, '/68/492/1266/4240', 'false', 'Forests and woodland of Fraxinus excelsior, with some Ulmus glabra, Acer pseudoplatanus, Quercus petraea, Betula pubescens, Sorbus aucuparia and an understorey dominated by Corylus avellana, often accompanied by Crataegus monogyna or occasionally C. laevigata, characteristic of submontane climates and moist soils on calcareous bedrocks of the northern and western British Isles, particularly in valley heads of the upland fringes, distributed in Ireland, Scotland, northern England, Wales and locally Devon. Ferns (Athyrium filix-femina, Dryopteris spp., Blechnum spicant), grasses (Brachypodium sylvaticum, Deschampsia cespitosa, Poa trivialis, Arrhenatherum elatius, Dactylis glomerata, Holcus lanatus, H. mollis, Agrostis capillaris, Anthoxanthum odoratum), Oxalis acetosella are abundant and characteristic in the field layer, often with Hyacinthoides non-scripta, Mercurialis perennis, tall herbs (Crepis paludosa, C. mollis, Filipendula ulmaria, Conopodium majus, Trollius europaeus) and an extensive and diverse bryophyte flora.', '', 'Pas de description disponible'),
(4241, 'NR', 22, '41.32', '', '', 'British ash-field maple-mercury forests', '', 4, 'Niveau 4', 1266, '/68/492/1266/4241', 'false', 'Forests and woodland of Fraxinus excelsior, with Quercus robur (in the south-west), or Q. petraea, Acer pseudoplatanus, Ulmus glabra (in the north-west), with an understorey dominated by Corylus avellana, frequently accompanied by Crataegus monogyna, C. laevigata, Acer campestre, Sambucus nigra, characteristic of often calcareous base-rich soils in relatively warm and dry lowlands of southern Britain, distributed mostly in southern and central England, eastern Wales, southern and eastern Scotland. The field layer comprises Mercurialis perennis, Hyacinthoides non-scripta, Circaea lutetiana, Geum urbanum, Arum maculatum, Viola riviniana, V. reichenbachiana, Sanicula europaea, Lamium galeobdolon, Carex sylvatica; Primula vulgaris and Glechoma hederacea, Anemone nemorosa, Deschampsia cespitosa, Hedera helix, Geranium robertianum, Allium ursinum, Teucrium scorodonia characterize geographical and edaphic subtypes. In humid northern and western Britain, outside of the range of Fagus sylvatica and Carpinus betulus, the separation between this unit and the ravine forests of 41.41, developed on unstable screes and colluvions, is poorly marked.', '', 'Pas de description disponible'),
(4242, 'NR', 22, '41.33', 'Forêt de frênes pyrénéo-cantabriques', '', 'Pyreneo-Cantabrian ash forests', '', 4, 'Niveau 4', 1266, '/68/492/1266/4242', 'true', 'Fraxinus excelsior-dominated facies of the Pyreneo-Cantabrian ash-oak forests (41.29).', '', 'Faciès à Fraxinus excelsior dominant des chênaies-frênaies pyrénéo-cantabrique (41.29).'),
(4243, 'NR', 22, '41.34', '', '', 'Baltic moschatel ash-sycamore forests', '', 4, 'Niveau 4', 1266, '/68/492/1266/4243', 'false', 'Fraxinus excelsior forests of Baltic moraine hills (Mecklenburg), possibly related to the peri-Alpine slope-foot forests of 41.43.', '', 'Pas de description disponible'),
(4244, 'NR', 22, '41.35', 'Frênaies mixtes atlantiques à jacinthe', '', 'Mixed Atlantic bluebell ash forests', '', 4, 'Niveau 4', 1266, '/68/492/1266/4244', 'true', 'Fraxinus excelsior facies of the mixed Atlantic bluebell oak forests (41.21), including ash-dominated facies of British oak-bracken-bramble woodland.', '', 'Faciès des chênaies mixtes atlantiques à jacinthe dominés par Fraxinus excelsior.'),
(4245, 'NR', 22, '41.36', 'Frênaies d\'Aquitaine', '', 'Aquitanian ash forests', '', 4, 'Niveau 4', 1266, '/68/492/1266/4245', 'true', 'Fraxinus excelsior-dominated facies of Aquitanian ash-oak forests (41.22).', '', 'Faciès à Fraxinus excelsior dominant des chênaies-frênaies d\'Aquitaine.'),
(4246, 'NR', 22, '41.37', 'Frênaies sub-atlantiques', '', 'Sub-Atlantic ash forests', '', 4, 'Niveau 4', 1266, '/68/492/1266/4246', 'true', 'Fraxinus excelsior-dominated facies of sub-Atlantic oxlip oak forests (41.23).', '', 'Faciès à Fraxinus excelsior des chênaies sub-atlantiques à Primevère.'),
(4247, 'NR', 22, '41.74', '', '', 'Northern Italian Quercus cerris woods', '', 4, 'Niveau 4', 1265, '/68/492/1265/4247', 'false', 'Q. cerris forests of the upper supra-Mediterranean level of the northern and central Apennines and the Italian pre-Alps, with Ostrya carpinifolia, Carpinus betulus, Fraxinus excelsior, Quercus petraea, Tilia platyphyllos, Corylus avellana, Laburnum anagyroides; some central Apennine formations may be dominated by Quercus petraea.', 'Ostryo-Carpinion p.', 'Pas de description disponible'),
(4248, 'NR', 22, '41.75', '', '', 'Southern Quercus cerris-Q. frainetto woods', '', 4, 'Niveau 4', 1265, '/68/492/1265/4248', 'false', 'Quercus cerris, Q. frainetto, or, sometimes, Q. petraea, formations of the upper supra-Mediterranean level of southern Italy, southern continental Greece and the Peloponnese.', 'Melitto-Quercion frainetto', 'Pas de description disponible'),
(4249, 'NR', 22, '41.76', '', '', 'Balkanic thermophilous oak woods', '', 4, 'Niveau 4', 1265, '/68/492/1265/4249', 'false', 'Q. frainetto, Q. cerris and other deciduous oak forests of the supra-Mediterranean level of continental Greece except the extreme south.', 'Quercion frainetto', 'Pas de description disponible'),
(4250, 'NR', 22, '42.58', 'Forêts mésophiles de Pins sylvestres des Alpes sud-occidentales', '', 'South-western Alpine mesophile Scots pine forests', '', 4, 'Niveau 4', 1263, '/68/491/1263/4250', 'true', 'Mesophile montane forests with wintergreens occupying a broad belt on the southwestern flank of the Alps from Dauphiné to the Maritime Alps, differentiated from 42.54 by the absence of Erica herbacea; the undergrowh usually comprises Arctostaphylos uva-ursi, Centaurea scabiosa, Tolpis staticifolia (Hieracium staticifolium), Calluna vulgaris, Polygala chamaebuxus, Monotropa hypopitys, Goodyera repens, Epipactis atrorubens, Neottia nidus-avis.', '', 'Forêts mésophiles montagnardes à Pyroles, occupant une large zone sur le revers sud-ouest des Alpes depuis le Dauphiné jusqu\'aux Alpes maritimes, se différenciant de 42.54 par l\'absence d\'Erica herbacea ; la strate inférieure comprend habituellement Arctostaphylos uva-ursi, Centaurea scabiosa, Tolpis staticifolia, Calluna vulgaris, Polygala chamaebuxus, Monotropa hypopitys, Goodyera repens, Epipactis atrorubens, Neottia nidus-avis.'),
(4251, 'NR', 22, '42.59', 'Forêts supra-méditerranéennes de Pins sylvestres', '', 'Supra-Mediterranean Scots pine forests', '', 4, 'Niveau 4', 1263, '/68/491/1263/4251', 'true', 'Pinus sylvestris - dominated facies of the thermophilous, supra-Mediterranean oak woods (41.7), alternated, mixed or imbricated with Quercus pubescens or Q. faginea woods in the southwestern Alpine foothills, on the periphery of the Central Massif, along the southern flank of the Pyrenees and, locally, in the Ligurian and Insubrian Alps, in the western Alps of northern Dauphiné and Savoie, in the northern Apennines and on the northern flank of the Pyrenees. Buxus sempervirens is usually abundant in the undergrowth; other components of the shrub layer include Corylus avellana, Sorbus aria, S. torminalis, Acer opalus, A. campestre, A. monspessulanum, Evonymus latifolius, Genista cinerea, Juniperus communis.', 'Pinetum sylvestris, \"Buxo-Quercetum hylocomio-pinetosum\"', 'Faciès dominés par Pinus sylvestris des chênaies thermophiles supra-méditerranéennes (41.7), en alternance, mélanges ou imbrications avec des bois de Quercus pubescens dans les collines du piémont sud-occidental des Alpes, à la périphérie du Massif central, le long du versant sud des Pyrénées et, localement, dans les Alpes ligures, dans les Alpes occidentales du nord du Dauphiné et de Savoie, et sur le versant nord des Pyrénées. Le Buis est ordinairement abondant en sous-strate ; parmi les autres composants de la strate arbustive se trouvent Corylus avellana, Sorbus aria, S. torminalis, Acer opalus, A. campestre, A. monspessulanum, Euonymus latifolius, Genista cinerea, Juniperus communis.'),
(4252, 'NR', 22, '36.32', '', '', 'Oro-Caledonian grasslands', '', 4, 'Niveau 4', 1297, '/67/495/1297/4252', 'false', 'Boreo-alpine formations of the higher summits of Scotland, Cumbria, northern England and northern Wales with Juncus trifidus, Carex bigelowii, mosses and lichens.', '', 'Pas de description disponible'),
(3892, 'NR', 22, '15.56', 'Formations à annuelles sur laisses', '', 'Mediterranean saltmarsh driftlines', '', 4, 'Niveau 4', 1186, '/65/477/1186/3892', 'true', 'Communities of annuals forming on accumulations of organic debris in saltmarshes, with Atriplex, Suaeda, Kochia, Salsola soda.', 'Thero-Suaedion', 'Communautés d\'annuelles se constituant sur des accumulations de débris organiques dans les prés salés méditerranéens, avec Atriplex, Suaeda, Kochia, Salsola soda.'),
(3893, 'NR', 22, '15.57', 'Prés salés à chiendent et armoise', '', 'Saltmarsh couch-wormwood stands', '', 4, 'Niveau 4', 1186, '/65/477/1186/3893', 'true', 'Formations of Elymus or Artemisia fringing Mediterranean and interior Iberian saline wetlands.', 'Agropyro-Artemision coerulescentis i.a.', 'Formations à Elymus ou à Artemisia ceinturant les zones humides salées méditerranéennes.'),
(3894, 'NR', 22, '15.58', 'Formations à Juncus subulatus', '', 'Fine-leaved rush beds', '', 4, 'Niveau 4', 1186, '/65/477/1186/3894', 'true', 'Medium-tall Juncus subulatus beds, often forming facies within Arthrocnemum scrubs.', 'Arthrocnemetalia fruticosi p.', 'Zones à Juncus subulatus moyen à grand, formant souvent des faciès au sein de fourrés d\'Arthrocnemum.'),
(3895, 'NR', 22, '15.11', 'Gazons à Salicorne et Suaeda', '', 'Glasswort swards', '', 4, 'Niveau 4', 1189, '/65/477/1189/3895', 'true', 'Annual glasswort (Salicornia spp., Microcnemum coralloides) and seablite (Suaeda maritima) formations on periodically inundated muds of coastlands and inland salt-basins.', 'Thero-Salicornietalia', 'Formations à salicornes annuelles (Salicornia ssp.) et Suaeda (Suaeda maritima) sur des vases périodiquement inondées des bassins salés côtiers et de l\'intérieur.'),
(3896, 'NR', 22, '15.12', 'Groupements halonitrophiles à Frankenia', '', 'Halonitrophilous Frankenia communities', '', 4, 'Niveau 4', 1189, '/65/477/1189/3896', 'true', 'Formations of halonitrophilous annuals (Frankenia pulverulenta, Suaeda splendens, Salsola soda, Cressa cretica, Parapholis incurva, P. strigosa, Hordeum marinum, Sphenopus divaricatus) colonizing salt muds susceptible to temporary inundation and extreme drying, mostly characteristic of the Iberian peninsula, with irradiations notably in the Camargue, Italy, and on the Atlantic coast of France.', 'Frankenion pulverulentae', 'Formations d\'halonitrophiles annuelles (Frankenia pulverulenta, Suaeda splendens, Salsola soda, Cressa cretica, Parapholis incurva, P. strigosa, Hordeum marinum, Sphenopus divaricatus) colonisant les vases salées sensibles aux inondations temporaires et à des dessications extrêmes, principalement caractéristiques de la péninsule Ibérique, avec des irradiations notablement en Camargue, Italie, et sur la côte atlantique française.'),
(3897, 'NR', 22, '15.13', 'Groupements à Sagina et Cochlearia', '', 'Sea-pearlwort communities', '', 4, 'Niveau 4', 1189, '/65/477/1189/3897', 'true', 'Formations of annual pioneers (Sagina maritima, Cochlearia danica) of sands subject to variable salinity and humidity, in particular in the zone of contact between dune and salt marsh.', 'Saginion maritimae', 'Formations de pionnières annuelles (Sagina maritima, Cochlearia danica) des sables sujets à des humidité et salinité variables, en particulier dans la zone de contact entre la dune et les marais salés.'),
(3898, 'NR', 22, '15.71', '', '', 'Canarian xero-halophilous scrubs', '', 4, 'Niveau 4', 1191, '/65/477/1191/3898', 'false', 'Shrubby formations of Zygophyllum fontanesii, Chenoleoides tomentosa, sea-heath, saltworts and seablites of the vicinity of the coasts of the Canary Islands.', 'Chenoletalia tomentosae', 'Pas de description disponible'),
(3899, 'NR', 22, '15.72', 'Fourrés halonitrophiles méditerranéens', '', 'Mediterranean halo-nitrophilous scrubs', '', 4, 'Niveau 4', 1191, '/65/477/1191/3899', 'true', 'Nitrophilous scrubby formations typically of dry soils and arid climates, often greyish-white and semidesert-like, sometimes including taller, denser brushes. They are most frequent in the eastern Iberian peninsula, where characteristic shrubs include Peganum harmala, Artemisia herba-alba, Lycium intricatum, Capparis ovata and the Chenopodiaceae Salsola vermiculata, S. genistoides, S. verticillata, Suaeda pruinosa, Atriplex halimus, A. glauca, Camphorosma monspeliaca, Anabasis articulata and Haloxylon articulatum.', 'Salsolo-Peganetalia', 'Fourrés nitrophiles typiques des sols secs sous climats arides, souvent blanc-grisâtres et succulents, comprenant parfois des broussailles plus élevées et plus denses. Ils sont le plus fréquent dans l\'est de la péninsule Ibérique où les buissons caractéristiques comprennent Peganum harmala, Artemisia herba-alba, Lycium intricatum, Capparis ovata et les Chenopodiaceae Salsola vermiculata, S. genistoides, S. verticillata, Suaeda pruinosa, Atriplex halimus, A. glauca, Camphorosma monspeliaca, Anabasis articulata et Haloxylon articulatum.'),
(3900, 'NR', 22, '16.21', 'Dunes mobiles', '', 'Shifting dunes', '', 4, 'Niveau 4', 1195, '/65/478/1195/3900', 'true', 'Mobile sands, unvegetated or occupied by open grasslands; they may form tall dune ridges or, particularly along the Mediterranean, be limited to a fairly flat upper beach, still subject in part to inundation.', 'Agropyrion juncei, Ammophilion arenariae, Zygophyllion fontanesii', 'Sables mobiles, nus ou occupés par des pelouses ouvertes ; ils peuvent former des crêtes dunaires ou, particulièrement le long de la Méditerranée, être limités à une arrière plage relativement plate, encore sujette en partie aux inondations.'),
(3901, 'NR', 22, '15.81', 'Steppes à Lavande de mer', '', 'Sea-lavender salt steppes', '', 4, 'Niveau 4', 1192, '/65/477/1192/3901', 'true', 'Limonium-rich facies of the salt steppes.', '', 'Faciès riche en Limonium des steppes salées.'),
(3902, 'NR', 22, '15.82', '', '', 'Esparto salt steppes', '', 4, 'Niveau 4', 1192, '/65/477/1192/3902', 'false', 'Saltmarsh and saltmarsh fringe formations of Lygeum spartum of coastal Crete, coastal and interior Iberia', '', 'Pas de description disponible'),
(3903, 'NR', 22, '15.91', '', '', 'Central Iberian gypsum scrubs', '', 4, 'Niveau 4', 1193, '/65/477/1193/3903', 'false', 'Low garrigues dotted with occasional tall bushes, developed on gypseous soils which are often covered by a crust of lichens, generally rich in Centaurea hyssopifolia and often in Gypsophila struthium, Lepidium subulatum, Thymus zygis or Jurinea pinnata.They are limited to the meseta and eastern Andalusia.', 'Lepidion subulati', 'Pas de description disponible'),
(3904, 'NR', 22, '15.92', '', '', 'Ebro gypsum scrubs', '', 4, 'Niveau 4', 1193, '/65/477/1193/3904', 'false', 'Open low garrigues of eroded gypsiferous hills of the Ebro basin and of the upper Turia region, with Gypsophila hispanica.', 'Gypsophilion hispanicae', 'Pas de description disponible'),
(3905, 'NR', 22, '15.93', '', '', 'South-eastern gypsum scrubs', '', 4, 'Niveau 4', 1193, '/65/477/1193/3905', 'false', 'Low, open thyme, germander and rockrose garrigues colonizing poorly developed gypsiferous soils of the arid southeast of the Iberian peninsula (Alicante and Murcia). Characteristic elements are Teucrium libanitis (T. verticillatum), T. polium, T. pumilum, T. carthaginense, Thymus longiflorus, T. antoninae, Helianthemum lavandulifolium (H. racemosum), H. squamatum, Gypsophila hispanica, G. struthium, Astragalus alopecuroides. Grasses (Lygeum, Stipa, Brachypodium), wormwood (Artemisia) and Chenopodiaceae may be locally prominent.', 'Thymo-Teucrion verticillati', 'Pas de description disponible'),
(3906, 'NR', 22, '16.11', 'Plages de sable sans végétation', '', 'Unvegetated sand beaches', '', 4, 'Niveau 4', 1194, '/65/478/1194/3906', 'true', 'Sandy beaches devoid of phanerogamic vegetation. Mediolittoral (intertidal) and supralittoral invertebrate communities can be used to define subdivisions.', '', 'Plages sableuses dépourvues de phanérogames. Les groupements intertidaux et supralittoraux d\'invertébrés peuvent être utilisés pour définir des subdivisions.'),
(3907, 'NR', 22, '16.12', 'Groupements annuels des plages de sable', '', 'Sand beach annual communities', '', 4, 'Niveau 4', 1194, '/65/478/1194/3907', 'true', 'Formations mostly of annuals occupying accumulations of drift material and sands rich in nitrogenous organic matter; characteristic are Suaeda maritima, Bassia hirsuta, Cakile maritima, Salsola kali, Beta maritima, Atriplex spp., Glaucium flavum, Mertensia maritima, Polygonum spp. and, along Mediterranean coasts, Euphorbia peplis, E. paralias.', 'Cakiletea maritimae (Atriplici-Salsolion kali = Salsolo-Honkenyion peploidis, Thero-Suaedion, Euphorbion peplis p.)', 'Formations principalement d\'annuelles occupant des accumulations de matériel charrié et des sables riches en matières organiques azotées ; les plantes caractéristiques sont Suaeda maritima, Bassia hirsuta, Cakile maritima, Salsola kali, Beta maritima, Atriplex spp., Glaucium flavum, Mertensia maritima, Polygonum spp. et, le long des côtes méditerranéennes, Euphorbia peplis, E. paralias.'),
(3908, 'NR', 22, '16.13', 'Groupements vivaces des plages de sable', '', 'Sand beach perennial communities', '', 4, 'Niveau 4', 1194, '/65/478/1194/3908', 'true', 'Boreal halo-nitrophilous perennial vegetation of the upper beach formed by Leymus (Elymus) arenarius, Ammophila arenaria, Honkenya peploides, Elymus farctus, E. repens, Mertensia maritima, accompanied by Atriplex spp., Cakile maritima, Petasites spurius, limited to Baltic and northern North Sea.', 'Honkenyo-Elymion', 'Végétation vivace halonitrophile boréale des hauts de plage, formées par Leymus arenarius, Ammophila arenaria, Honkenya peploides, Elymus farctus, E. repens, Mertensia maritima, accompagnés d\'Atriplex sp. pl., Cakile maritima, … mer du Nord.'),
(3909, 'NR', 22, '15.62', 'Fourrés des marais salés atlantiques', '', 'Atlantic salt scrubs', '', 4, 'Niveau 4', 1185, '/65/477/1185/3909', 'true', 'Sea purslane, glasswort and seablite scrubs of northern Atlantic and North Sea coasts.', 'Halimionion portulacoidis', 'Fourrés à pourpier marin, Arthrocnemum et Suaeda des côtes de l\'Atlantique nord et de la mer du Nord.'),
(3910, 'NR', 22, '15.63', 'Fourrés à Limoniastrum', '', 'Limoniastrum scrubs', '', 4, 'Niveau 4', 1185, '/65/477/1185/3910', 'true', 'Formations of often large, silver-glaucous shrubs of Limoniastrum monopetalum with showy pink flowers in late spring, of drier parts of Mediterranean and Iberian salt marshes.', 'Limoniastrion monopetali i.a.', 'Formations d\'arbustes souvent grands, glauques et argentés, de Limoniastrum monopetalum aux fleurs rose-criard à la fin du printemps, des parties plus sèches des marais salés méditerranéens et ibériques.'),
(3911, 'NR', 22, '15.64', '', '', 'Canarian saltmarsh scrubs', '', 4, 'Niveau 4', 1185, '/65/477/1185/3911', 'false', 'Low shrubby expanses of woody glassworts, seablites, sea purslanes or Zygophyllum, characteristic of temporarily inundated salt marshes of Canary Island coasts.', 'Arthrocnemetalia fruticosi p.', 'Pas de description disponible'),
(3912, 'NR', 22, '16.25', 'Dunes avec fourrés, bosquets', '', 'Dune thickets', '', 4, 'Niveau 4', 1195, '/65/478/1195/3912', 'true', 'Dense formations of large shrubs including sea-buckthorn, privet, elder, willow, gorse or broom, often festooned with creepers such as honeysuckle or white bryony. Codes of 31.8 can be used, in addition to 16.252, to precise the habitat.', 'Prunetalia spinosae p. (Ligustro-Hippophaeion rhamnoidis, Lonicerion periclymeni, Pruno-Rubion ulmifolii p., \"Sambuco-Berberidion\")', 'Formations denses de grands arbustes incluant argousier, troène, sureau, saule, ajonc ou genêt, souvent ornées de plantes grimpantes telles que chèvrefeuille ou bryone. Les codes de 31.8 peuvent être utilisés, en complément de 16.252, pour spécifier les habitats.'),
(3913, 'NR', 22, '16.26', 'Dunes à Salix arenaria', '', 'Creeping-willow mats', '', 4, 'Niveau 4', 1195, '/65/478/1195/3913', 'true', 'Salix arenaria formations of both dry and humid dune depressions.', 'Salicion arenariae', 'Formations à Salix arenaria des dépressions dunaires sèches ou humides.'),
(3944, 'NR', 22, '22.33', 'Groupements à Bidens tripartitus', '', 'Bur marigold communities', '', 4, 'Niveau 4', 1204, '/66/484/1204/3944', 'true', 'Taller annual communities colonizing nitrogen-rich muds of dry medio-European ponds and lakes, formed by Bidens spp., Rorippa palustris, R. islandica, Chenopodium spp., Polygonum spp., Rumex maritimus, R. palustris, Ranunculus sceleratus, Senecio congestus, Catabrosa aquatica, Leersia oryzoides).', 'Bidention tripartitae', 'Communautés de plantes annuelles plus élevées colonisant les vases riches en azote des mares, étangs et des lacs médio-européens asséchés, constitués de Bidens spp., Rorippa palustris (R. islandica), Chenopodium spp., Polygonum spp., Rumex maritimus, R. palustris, Ranunculus sceleratus, Tephroseris palustris (Senecio congestus), Catabrosa aquatica, Leersia oryzoides.'),
(3945, 'NR', 22, '18.21', 'Groupements des falaises atlantiques', '', 'Atlantic cliff communities', '', 4, 'Niveau 4', 1198, '/65/480/1198/3945', 'true', 'Vegetated cliffs of Atlantic, Channel, Irish and North Sea coasts with Crithmum maritimum, Armeria maritima, Limonium spp., Brassica oleracea, Silene maritima, Cochlearia officinalis, Plantago maritima, Festuca rubra ssp. pruinosa, Daucus spp., Matricaria maritima, Asplenium marinum, Spergularia rupicola, Inula crithmoides, Sedum anglicum, Rhodiola rosea, Lavatera arborea.', 'Crithmo-Armerietalia', 'Falaises végétalisées des côtes de l\'Atlantique, de la Manche et de la mer du Nord avec Crithmum maritimum, Armeria maritima, Limonium spp., Brassica oleracea, Silene uniflora subsp. maritima, Cochlearia officinalis, Plantago maritima, Festuca rubra subsp. pruinosa, Daucus spp., Matricaria maritima, Asplenium marinum, Spergularia rupicola, Inula crithmoides, Sedum anglicum, Rhodiola rosea, Lavatera arborea.'),
(3946, 'NR', 22, '18.22', 'Groupements des falaises méditerranéennes', '', 'Mediterranean cliff communities', '', 4, 'Niveau 4', 1198, '/65/480/1198/3946', 'true', 'Vegetated cliffs and rocky shores of the Mediterranean and southwestern Iberia, with Crithmum maritimum, Plantago subulata, Silene sedoides, Sedum litoreum, Limonium spp., Armeria spp., Euphorbia spp., Daucus spp., Asteriscus maritimus. Many Limonium species, in particular, are endemics of extremely local occurrence.', 'Crithmo-Limonietalia', 'Côtes rocheuse et falaises végétalisées de la Méditerranée, avec Crithmum maritimum, Plantago subulata, Silene sedoides, Sedum litoreum, Limonium spp., Armeria spp., Euphorbia spp., Daucus spp., Asteriscus maritimus. De nombreuses espèces de Limonium, en particulier, sont des endémiques (aire de distribution limitée, très localisée).'),
(3947, 'NR', 22, '18.23', '', '', 'Macaronesian cliff communities', '', 4, 'Niveau 4', 1198, '/65/480/1198/3947', 'false', 'Sea-cliffs of the Atlantic islands (Canaries, Madeira), with Crithmum maritimum, Astydamia latifolia, Schizogyna sericea, Andryala glutinosa, Plantago coronopus, Tolpis fruticosa, Aizoon canariense, Campylanthus salsoloides, Limonium pectinatum, Frankenia ericifolia, Reichardia ligulata, Argyranthemum frutescens, Lotus spp., Asplenium marinum.', 'Frankenio-Astidamietalia latifoliae', 'Pas de description disponible'),
(3948, 'NR', 22, '18.24', '', '', 'Azorean cliff communities', '', 4, 'Niveau 4', 1198, '/65/480/1198/3948', 'false', 'Communities of the cliffs of the Azores dominated by the endemic Festuca petraea.', 'Festucion petraeae', 'Pas de description disponible'),
(3949, 'NR', 22, '22.11', 'Eaux oligotrophes pauvres en calcaire', '', 'Lime-deficient oligotrophic waters', '', 4, 'Niveau 4', 1206, '/66/484/1206/3949', 'true', 'Usually greenish to brownish clear waters poor in dissolved bases (pH often 5-6).', '', 'Eaux claires, habituellement verdâtres à brunâtres, pauvres en bases dissoutes (pH souvent de 3-5).'),
(3950, 'NR', 22, '22.44', 'Tapis immergés de Characées', '', 'Chandelier algae submerged carpets', '', 4, 'Niveau 4', 1215, '/66/484/1215/3950', 'true', 'Charophyte, Chara and Nitella, algal carpets of the bottom of unpolluted lime-rich lakes.', 'Charetea fragilis', 'Tapis algaux de Charophytes, Chara et Nitella des fonds de lacs non pollués riches en calcaire.'),
(3951, 'NR', 22, '22.45', 'Mares de tourbières à Sphaignes et Utriculaires', '', 'Peatmoss-bladderwort bog pools', '', 4, 'Niveau 4', 1215, '/66/484/1215/3951', 'true', 'Floating formations of Sphagnum, Scorpidium, Utricularia minor, U. intermedia, U. ochroleuca, typical habitat of Sparganium minimum.', 'Sphagno-Utricularion (Utricularion intermedio-minoris)', 'Formations flottantes de Sphagnum, Scorpidium, Utricularia minor, U. intermedia, U. ochroleuca, habitat typique de Sparganium minimum.'),
(3952, 'NR', 22, '23.11', 'Eau libre sans tapis de Charophytes', '', 'Open water without charophyte carpets', '', 4, 'Niveau 4', 1208, '/66/485/1208/3952', 'true', '', '', 'Pas de description disponible');
INSERT INTO `corine` (`CD_HAB`, `FG_VALIDITE`, `CD_TYPO`, `LB_CODE`, `LB_HAB_FR`, `LB_HAB_FR_COMPLET`, `LB_HAB_EN`, `LB_AUTEUR`, `NIVEAU`, `LB_NIVEAU`, `CD_HAB_SUP`, `PATH_CD_HAB`, `FRANCE`, `LB_DESCRIPTION`, `CRSP_PHYTO_CB91`, `DESCRIPTIF_CB97_FR`) VALUES
(3953, 'NR', 22, '23.12', 'Tapis algual de Charophyte', '', 'Charophyte algal carpets', '', 4, 'Niveau 4', 1208, '/66/485/1208/3953', 'true', '', '', 'Pas de description disponible'),
(3954, 'NR', 22, '23.21', 'Formations immergées des eaux saumâtres ou salées', '', 'Submerged formations', '', 4, 'Niveau 4', 1209, '/66/485/1209/3954', 'true', '', '', 'Pas de description disponible'),
(3955, 'NR', 22, '23.22', 'Scirpaies naines lagunaires', '', 'Lagoon dwarf spike-rush beds', '', 4, 'Niveau 4', 1209, '/66/485/1209/3955', 'true', 'Emergent formations of Eleocharis parvula.', 'Scirpion parvuli p.', 'Formations émergentes d\'Eleocharis parvula.'),
(3956, 'NR', 22, '24.11', 'Ruisselets', '', 'Rivulets', '', 4, 'Niveau 4', 1210, '/66/486/1210/3956', 'true', 'The highest reaches of mountain rivulets. Crenon zone.', '', 'Têtes des ruisselets de montagne. Zone du crénon.'),
(3957, 'NR', 22, '24.12', 'Zone à Truites', '', 'Trout zone', '', 4, 'Niveau 4', 1210, '/66/486/1210/3957', 'true', 'Upper and middle (epirhitral and metarhitral) zones of mountain and hill creeks. \"Group D\" rivers of Holmes (1983).', '', 'Zones supérieure et moyenne (épirhitron et métarhitron) des cours d\'eau montagnards et collinéens. Rivières du \"groupe D\" selon Holmes (1983).'),
(3958, 'NR', 22, '24.13', 'Zone à Ombres', '', 'Grayling zone', '', 4, 'Niveau 4', 1210, '/66/486/1210/3958', 'true', 'Lower (hyporhitral) zone of mountain and hill creeks. \"Group C\" rivers of Holmes (1983).', '', 'Zone inférieure (hyporhitron) des cours d\'eau montagnards et collinéens. Rivières du \"groupe C\" selon Holmes (1983).'),
(3959, 'NR', 22, '24.14', 'Zone à Barbeaux', '', 'Barbel zone', '', 4, 'Niveau 4', 1210, '/66/486/1210/3959', 'true', 'Upper (epipotamal) zone of lowland rivers. \"Group B\" rivers of Holmes (1983).', '', 'Zone supérieure (épipotamon) des rivières de plaine. Rivières du \"groupe B\" selon Holmes (1983).'),
(3960, 'NR', 22, '24.41', 'Végétation des rivières oligotrophes acidiphiles', '', 'Acid oligotrophic river vegetation', '', 4, 'Niveau 4', 1214, '/66/486/1214/3960', 'true', 'Communities characterized in particular by Myriophyllum alternifolium, Potamogeton polygonifolius, Callitriche hamulata, Littorella uniflora.', '', 'Groupements caractérisés en particulier par Myriophyllum alternifolium, Potamogeton polygonifolius, Callitriche hamulata, Littorella uniflora.'),
(3961, 'NR', 22, '24.42', 'Végétation des rivières oligotrophes riches en calcaire', '', 'Lime-rich oligotrophic river vegetation', '', 4, 'Niveau 4', 1214, '/66/486/1214/3961', 'true', 'Communities characterized in particular by Potamogeton coloratus and Chara hispida.', '', 'Groupements caractérisés en particulier par Potamogeton coloratus et Chara hispida.'),
(3962, 'NR', 22, '24.43', 'Végétation des rivières mésotrophes', '', 'Mesotrophic river vegetation', '', 4, 'Niveau 4', 1214, '/66/486/1214/3962', 'true', 'Communities characterized in particular by Sium erectum f. submersa, Mentha aquatica f. submersa, Groenlandia densa, Ranunculus peltatus, R. penicillatus, R. trichophyllus, Callitriche truncata, C. stagnalis.', '', 'Groupements caractérisés en particulier par Berula erecta (Sium erectum f. submersa), Mentha aquatica f. submersa, Groenlandia densa, Ranunculus peltatus, R. penicillatus, R. trichophyllus, Callitriche truncata, C. stagnalis.'),
(3963, 'NR', 22, '24.44', 'Végétation des rivières eutrophes', '', 'Eutrophic river vegetation', '', 4, 'Niveau 4', 1214, '/66/486/1214/3963', 'true', 'Communities characterized in particular by Ranunculus fluitans, Zannichellia palustris f. fluviatilis, Potamogeton nodosus, Callitriche obtusangula and the moss Fontinalis antipyretica.', '', 'Groupements caractérisés en particulier par Ranunculus fluitans, Zannichellia palustris f. fluviatilis, Potamogeton nodosus, Callitriche obtusangula, Fontinalis antipyretica.'),
(3964, 'NR', 22, '24.51', 'Dépôts nus d\'alluvions fluviatiles limoneuses', '', 'Unvegetated river mud banks', '', 4, 'Niveau 4', 1211, '/66/486/1211/3964', 'true', 'Bare alluvial muds.', '', 'Vases alluviales dépourvues de végétation.'),
(3965, 'NR', 22, '24.52', 'Groupements euro-sibériens annuels des vases fluviatiles', '', 'Euro-Siberian annual river mud communities', '', 4, 'Niveau 4', 1211, '/66/486/1211/3965', 'true', 'Pioneer formations of annuals on nitrogen-rich muds of middle European rivers (Bidens spp., Rorippa spp., Chenopodium spp., Polygonum spp., Xanthium spp.).', 'Bidention p., Chenopodion rubri p.', 'Formations pionnières de plantes annuelles sur alluvions riches en azote des rivières d\'Europe moyenne (Bidens spp., Rorippa spp., Chenopodium spp., Polygonum spp., Xanthium spp.).'),
(3966, 'NR', 22, '24.15', 'Zone à Brèmes', '', 'Bream zone', '', 4, 'Niveau 4', 1210, '/66/486/1210/3966', 'true', 'Middle and lower (metapotamal and hypopotamal) zones of lowland rivers. \"Group A\" rivers of Holmes (1983).', '', 'Zones moyenne et inférieure (métapotamon et hypopotamon) des rivières de plaines. Rivières du \"groupe A\" selon Holmes (1983).'),
(3967, 'NR', 22, '24.16', 'Cours d\'eau intermittents', '', 'Intermittent streams', '', 4, 'Niveau 4', 1210, '/66/486/1210/3967', 'true', 'Watercourses of which the flow is interrupted for part of the year, leaving a dry bed or pools; conditions during the period of flow can be indicated by one of the previous codes.', '', 'Cours d\'eau dont l\'écoulement est interrompu une partie de l\'année, laissant le lit à sec ou avec des flaques ou des mares ; les conditions durant la période d‘écoulement peuvent être précisées par l\'un des codes précédents.'),
(3968, 'NR', 22, '24.21', 'Bancs de graviers sans végétation', '', 'Unvegetated river gravel banks', '', 4, 'Niveau 4', 1212, '/66/486/1212/3968', 'true', 'Gravel banks devoid of vegetation.', '', 'Bancs de graviers des cours d\'eau dépourvus de végétation.'),
(3969, 'NR', 22, '24.22', 'Bancs de graviers végétalisés', '', 'Vegetated river gravel banks', '', 4, 'Niveau 4', 1212, '/66/486/1212/3969', 'true', 'Gravel banks of rivers occupied by specialized pioneer vegetation, at least in alpine and Mediterranean water courses, as well as any subsequent stages in the colonization sequence.', 'Epilobietalia fleischeri (Myricarietalia germanicae) i.a.', 'Bancs de graviers des rivières occupés par une végétation pionnière spécialisée, au moins dans les cours d\'eau alpins et méditerranéens, ainsi que toute autre étape de la série de colonisation.'),
(3970, 'NR', 22, '24.31', 'Bancs de sable des rivières sans végétation', '', 'Unvegetated river sand banks', '', 4, 'Niveau 4', 1213, '/66/486/1213/3970', 'true', 'River sand banks devoid of vegetation.', '', 'Bancs de sable riverains dépourvus de végétation.'),
(3971, 'NR', 22, '24.32', 'Bancs de sable riverains pourvus de végétation', '', 'Vegetated river sand banks', '', 4, 'Niveau 4', 1213, '/66/486/1213/3971', 'true', 'Sparsely-vegetated to wooded sand banks of large rivers. Appropriate codes from 22.3, 31 and 44 can be used to precise habitats.', '', 'Bancs de sable peu végétalisés ou boisés des grandes rivières. Les codes appropriés de 22.3, 31 et 44 peuvent être utilisés pour préciser les habitats.'),
(4253, 'NR', 22, '34.71', 'Steppes méditerranéo-montagnardes', '', 'Mediterraneo-montane steppes', '', 4, 'Niveau 4', 1269, '/67/490/1269/4253', 'true', 'Sparse or discontinuous xerophile grasslands of Stipa pennata, Festuca auquieri (F. duriuscula), F. hervieri, Koeleria vallesiana or Sesleria albicans var. elegantissima with Helianthemum apenninum, H. canum, Genista spp., Globularia spp., Ononis striata, Euphorbia seguieriana, Potentilla crantzii, Thymus dolomiticus, Plantago argentea, Rosa pimpinellifolia, Dianthus sylvestris, Lavandula angustifolia, Aster alpinus, Anthyllis spp., Carex humilis, best developed in the Causses, but also present locally in Provence and Languedoc, from the Alps to Catalonia.', 'Ononidion striatae', 'Pelouses xérophiles ouvertes ou discontinues à Stipa pennata, Festuca auquieri (F. duriuscula), F. hervieri, Koeleria vallesiana ou Sesleria albicans var. elegantissima, avec Helianthemum apenninum, H. canum, Genista spp., Globularia spp., Ononis striata, Euphorbia seguieriana, Potentilla crantzii, Thymus dolomiticus, Plantago argentea, Rosa pimpinellifolia, Dianthus sylvestris, Lavandula angustifolia, Aster alpinus, Anthyllis spp., Carex humilis, les plus développées dans les Causses, mais aussi présentes localement en Provence et Languedoc, des Alpes à la Catalogne.'),
(4254, 'NR', 22, '36.33', 'Pelouses siliceuses thermophiles subalpines', '', 'Subalpine thermophile siliceous grasslands', '', 4, 'Niveau 4', 1297, '/67/495/1297/4254', 'true', 'Subalpine thermophile formations on often skeletal soils of the southern Alps, the Pyrenees and, very locally, the Central Massif and the Apennines.', 'Festucion variae, Festucion eskiae, Poion violaceae, Festucion spadiceae', 'Formations thermophiles subalpines sur des sols souvent squelettiques du sud des Alpes, des Pyrénées et, très localement, du Massif central.'),
(4255, 'NR', 22, '37.21', 'Prairies humides atlantiques et subatlantiques', '', 'Atlantic and sub-Atlantic humid meadows', '', 4, 'Niveau 4', 1270, '/67/496/1270/4255', 'true', 'Lightly managed hay meadows and pastures on both basocline and acidocline, nutrient-rich soils of middle European lowlands, hills and low mountains under Atlantic or sub-Atlantic climatic conditions. Among the characteristic plant components of the highly diverse communities forming this unit are Caltha palustris, Cirsium palustre, C. rivularis, C. oleraceum, Epilobium parviflorum, Lychnis flos-cuculi, Mentha aquatica, Scirpus sylvaticus, Stachys palustris, Bromus racemosus, Crepis paludosa, Fritillaria meleagris, Geum rivale, Polygonum bistorta, Senecio aquaticus, Trollius europaeus, Lotus uliginosus, Trifolium dubium, Equisetum palustre, Myosotis palustris, Deschampsia cespitosa, Angelica sylvestris, Oenanthe silaifolia, Gratiola officinalis, Inula salicina, Succisella inflexa, Dactylorhiza majalis, Ranunculus acris, Rumex acetosa, Holcus lanatus, Alopecurus pratensis, Festuca pratensis, Juncus effusus, J. filiformis.', 'Calthion palustris, Bromion racemosi, Deschampsion cespitosae', 'Pâturages et prairies de fauche, gérées de façon extensive, sur des sols tant basiclines qu\'acidiclines, riches en nutriments, des plaines, collines et montagnes basses de l\'Europe sous des climats atlantique ou subatlantique. Parmi les plantes caractéristiques des très nombreuses communautés concernées, on peut citer : Caltha palustris, Cirsium palustre, C. rivularis, C. oleraceum, Epilobium parviflorum, Lychnis flos-cuculi, Mentha aquatica, Scirpus sylvaticus, Stachys palustris, Bromus racemosus, Crepis paludosa, Fritillaria meleagris, Geum rivale, Polygonum bistorta, Senecio aquaticus, Trollius europaeus, Lotus uliginosus, Trifolium dubium, Equisetum palustre, Myosotis palustris, Deschampsia cespitosa, Angelica sylvestris, Oenanthe silaifolia, Gratiola officinalis, Inula salicina, Succisella inflexa, Dactylorhiza majalis, Ranunculus acris, Rumex acetosa, Holcus lanatus, Alopecurus pratensis, Festuca pratensis, Juncus effusus, J. filiformis.'),
(4256, 'NR', 22, '34.72', 'Steppes supra-méditerranéennes et prairies à Aphyllanthes', '', 'Aphyllanthes grasslands and supra-Mediterranean steppes', '', 4, 'Niveau 4', 1269, '/67/490/1269/4256', 'true', 'Coarse or steppe-like grasslands rich in chamaephytes of pronounced Mediterranean affinities formed as a degradation stage of thermophile deciduous oak forests, or of Quercus rotundifolia forests, in the supra-Mediterranean belt of Iberia, southern France and Liguria; grassland facies of the supra-Mediterranean garrigues (32.6) and hedgehog heaths (31.7).', 'Aphyllanthion p.', 'Pelouses communes ou semblables aux steppes riches en chaméphytes, d\'affinités méditerranéennes prononcées, se formant comme stade de dégradation des chênaies thermophiles caducifoliées, dans le sud de la France ; faciès herbeux des garrigues supra-méditerranéennes (32.6) et des landes-hérissons (31.7).'),
(4257, 'NR', 22, '36.34', 'Pelouses à laîche courbée et communautés apparentées', '', 'Crooked-sedge swards and related communities', '', 4, 'Niveau 4', 1297, '/67/495/1297/4257', 'true', 'Mostly closed Carex curvula, Festuca spp., Oreochloa spp. or Juncus trifidus grasslands on siliceous soils of the alpine level of the Alps and the Pyrenees, with very local outposts in the great Hercynian ranges and the Cantabrian Range. Androsace obtusifolia, A. carnea ssp. laggeri, Campanula barbata, Juncus jacquinii, J. trifidus, Silene exscapa, Gentiana alpina, Achillea erba-rotta, Euphrasia minima, Luzula lutea, L. spicata, L. hispanica, Lychnis alpina, Minuartia recurva, M. sedoides, Pedicularis kerneri, P. pyrenaica, Phyteuma globulariifolium, Ph. hemisphaericum, Potentilla frigida, Armeria alpina, Senecio incanus, Trifolium alpinum, Veronica bellidioides, Ranunculus pyrenaicus are characteristic.', 'Caricion curvulae, Festucion supinae', 'Prairies principalement fermées à Carex curvula, Festuca spp., Oreochloa spp. ou Juncus trifidus sur sols siliceux de l\'étage alpin des Alpes et des Pyrénées, avec des avant-postes très locaux dans les montagnes hercyniennes. Les caractéristiques en sont Androsace obtusifolia, A. carnea subsp. laggeri, Campanula barbata, Juncus jacquinii, J. trifidus, Silene exscapa, Gentiana alpina, Achillea erba-rotta, Euphrasia minima, Luzula lutea, L. spicata, L. hispanica, Silene suecica, Minuartia recurva, M. sedoides, Pedicularis kerneri, P. pyrenaica, Phyteuma globulariifolium, Ph. hemisphaericum, Potentilla frigida, Armeria alpina, Senecio incanus, Trifolium alpinum, Veronica bellidioides, Ranunculus pyrenaeus.'),
(4258, 'NR', 22, '37.22', 'Prairies à Jonc acutiflore', '', 'Sharp-flowered rush meadows', '', 4, 'Niveau 4', 1270, '/67/496/1270/4258', 'true', 'Humid meadows dominated by, or rich in, Juncus acutiflorus. They are floristically and phytosociologically very varied and many are as related to the oligotrophic Molinion communities of 37.3 as to the more eutrophic Calthion ones of 37.2. Sharp-flowered rush meadows are particularly characteristic of the oceanic and suboceanic regions of the western seaboard of Europe from northwestern Iberia to the Low Countries.', 'Juncion acutiflori', 'Prairies humides dominées par, ou riches en, Juncus acutiflorus. Elles sont floristiquement et phytosociologiquement très variées et beaucoup sont apparentées aussi bien aux communautés oligotrophes du Molinion de 37.3 qu\'à celles plus eutrophes du Calthion de 37.2. Ces prairies sont particulièrement caractéristiques des régions océaniques et subocéaniques des bords de mer.'),
(4259, 'NR', 22, '34.73', '', '', 'Iberian fescue frost-grasslands', '', 4, 'Niveau 4', 1269, '/67/490/1269/4259', 'false', 'Supra-Mediterranean and montane psychro-xerophile, open perennial grasslands of the Cantabrian and Iberian ranges particularly characteristic of frost-fashioned, snow-free, superficial soils of the Juniperus thurifera and J. sabina environments, rich in Festuca hystrix, F. burnatii, Poa ligulata and with, among others, Armeria bigerrensis ssp. legionensis, Arenaria aggregata ssp. cantabrica, Centaurea janeri ssp. babiana, Draba cantabriae, Saxifraga conifera, Ononis striata, O. cristata, O. pusilla, Coronilla minima, Paronychia kapela ssp. serpyllifolia, Helianthemum canum, Carex humilis. They ascend to the oro-Mediterranean level and extend southeast to the eastern Baetic chains.', 'Festuco-Poetalia ligulatae: Festuco-Poion ligulatae p., Festucion burnatii p.', 'Pas de description disponible'),
(4260, 'NR', 22, '34.74', '', '', 'Central and southern Apennine dry grasslands', '', 4, 'Niveau 4', 1269, '/67/490/1269/4260', 'false', 'Open grasslands of calcareous substrates of the middle and southern Apennines, southern vicariant of the Xerobromion, with Bromus erectus, Sideritis syriaca and many Apennine endemics or subendemics such as Crepis lacera, Centaurea rupestris ssp. ceratophylla, Phleum ambiguum, Carex macrolepis. Many distinctive communities exist in this unit, some still covering vast expanses of land of exceptional biological significance such as Campo Imperatore in the Gran Sasso range; a few examples are cited below, others may be added.', 'Crepido lacerae-Phleion ambigui', 'Pas de description disponible'),
(4261, 'NR', 22, '36.35', '', '', 'Closed grasslands of Greek mountains', '', 4, 'Niveau 4', 1297, '/67/495/1297/4261', 'false', 'Dense, closed, usually unsculptured, chionophilous grasslands of acid and often deep soils over siliceous or calcareous substrates of the higher Greek mountains; they develop on decalcified colluvions, on damp soils of seeps or poorly drained areas, and in depressions and other situations where snow lingers. Characteristic are Alopecurus gerardii, Poa pumila, Anthoxanthum alpinum, Phleum alpinum, Nardus stricta, Bellardiochloa (Poa) violacea, Trisetum flavescens, Trifolium pallescens, T. parnassi, T. heldreichianum, T. alpestre, T. ottonis, Omalotheca supina, O. hoppeana, Herniaria parnassica, Ranunculus sartorianus, Lotus corniculatus, Thesium parnassi, Plantago lanceolata, P. atrata, P. holostea, Scleranthus perennis, Rorippa thracica, Erigeron epiroticus, Acinos alpinus, Luzula pindica, Crocus veluchensis, Scilla nivalis, Corydalis densiflora, C. parnassica, Beta nana, Trinia guicciardii, Botrychium lunaria.', 'Trifolion parnassi', 'Pas de description disponible'),
(4262, 'NR', 22, '37.23', 'Prairies subcontinentales à Cnidium', '', 'Subcontinental cnidium meadows', '', 4, 'Niveau 4', 1270, '/67/496/1270/4262', 'true', 'Moist-soil, flood-subjected meadows of river valleys under continental or subcontinental climatic conditions, with Cnidium dubium, Viola persicifolia, Allium angulosum, Iris sibirica, Oenanthe lachenalii, O. silaifolia, Gratiola officinalis, Juncus atratus, Leucojum aestivum, Carex praecox var. suzae, Lythrum virgatum.', 'Cnidion dubii', 'Prairies des sols humides, soumises aux inondations, des vallées riveraines sous climat continental ou subcontinental, avec Cnidium dubium, Viola persicifolia, Allium angulosum, Iris sibirica, Oenanthe lachenalii, O. silaifolia, Gratiola officinalis, Leucojum aestivum, Carex praecox var. suzae, Lythrum virgatum.'),
(3914, 'NR', 22, '16.27', 'Dunes à genévrier', '', 'Dune juniper thickets and woods', '', 4, 'Niveau 4', 1195, '/65/478/1195/3914', 'true', 'Juniper formations (Juniperus phoenicea, J. \"lycia\", J. macrocarpa, J. transtagana) of dune slacks and slopes in Mediterranean and thermo-Atlantic areas; J. communis formations of calcareous Jutland dunes.', 'Juniperion lyciae; Berberidion p.', 'Formations à genévriers (Juniperus phoenica, J. phoenica subsp. lycia, J. oxycedrus subsp. macrocarpa) des dépressions et des pentes dunaires des régions méditerranéennes et thermo-atlantiques.'),
(3915, 'NR', 22, '16.28', 'Fourrés dunaires à sclérophylles', '', 'Dune sclerophyllous scrubs', '', 4, 'Niveau 4', 1195, '/65/478/1195/3915', 'true', 'Sclerophyllous scrubs established on dunes in the Mediterranean region. Codes of 32 may be used in addition to 16.28 to precise the habitat.', 'Ononido-Rosmarinetea p., Quercetea ilicis p., Cisto-Lavanduletea p.', 'Fourrés ligneux sclérophylles établis sur les dunes de la région méditerranéenne. Les codes de 32 peuvent être utilisés en complément de 16.28 pour spécifier les habitats.'),
(3916, 'NR', 22, '16.29', 'Dunes boisées', '', 'Wooded dunes', '', 4, 'Niveau 4', 1195, '/65/478/1195/3916', 'true', 'Dunes colonised by woodland or riparian thickets. Codes of 41.5, 41.7, 42, 44, 45 can be used, in addition to 16.29, to precise the habitat.', '', 'Dunes colonisées par la forêt ou des fourrés humides. Les codes de 41.5, 41.7, 42, 44, 45 peuvent être utilisés en complément de 16.29 pour préciser les habitats.'),
(3917, 'NR', 22, '16.31', 'Mares des lettes dunaires', '', 'Dune-slack pools', '', 4, 'Niveau 4', 1196, '/65/478/1196/3917', 'true', 'Fresh-water aquatic communities (cf. 22.4) of permanent dune-slack water bodies.', '', 'Groupements aquatiques d\'eau douce (voir 22.4) des flaques d\'eau permanentes des lettes.'),
(3918, 'NR', 22, '18.11', 'Rochers et falaises de la frange médiolittorale', '', 'Mediolittoral fringe rocks', '', 4, 'Niveau 4', 1197, '/65/480/1197/3918', 'true', 'Cliffs and rocks of the lowest part of the mediolittoral zone, occupied by communities transitional to those of the infralittoral zone.', '', 'Rochers et falaises de la partie la plus basse de la zone médiolittorale, occupés par des communautés de transition avec ceux de la zone infralittorale.'),
(3919, 'NR', 22, '18.12', 'Rochers de l\'étage médiolittoral inférieur', '', 'Lower mediolittoral rocks', '', 4, 'Niveau 4', 1197, '/65/480/1197/3919', 'true', 'Cliffs and rocks of the lower part of the mediolittoral zone, occupied, in particular, by encrusting algae.', '', 'Rochers et falaises de la partie inférieure de la zone médiolittorale, occupés, en particulier, par des algues encroûtantes.'),
(3920, 'NR', 22, '18.13', 'Rochers de l\'étage médiolittoral supérieur', '', 'Upper mediolittoral rocks', '', 4, 'Niveau 4', 1197, '/65/480/1197/3920', 'true', 'Cliffs and rocks of the higher part of the mediolittoral zone, occupied by communities characterized, in particular, by cirriped crustaceans and soft algae.', '', 'Rochers et falaises de la partie haute de la zone médiolittorale, occupés par des communautés caractérisées, en particulier, par des crustacés cirripèdes et des algues molles.'),
(3921, 'NR', 22, '18.14', 'Surplombs, crevasses et grottes de l\'étage médiolittoral', '', 'Mediolittoral caves and overhangs', '', 4, 'Niveau 4', 1197, '/65/480/1197/3921', 'true', 'Mediolittoral overhangs, crevices and caves.', '', 'Surplombs, fentes et grottes de l\'étage médiolittoral.'),
(3922, 'NR', 22, '18.15', 'Mares permanentes des rochers de l\'étage médiolittoral', '', 'Mediolittoral rock pools', '', 4, 'Niveau 4', 1197, '/65/480/1197/3922', 'true', 'Permanent saline pools of the mediolittoral zone, fed by flood tides (tide pools).', '', 'Mares permanentes de la zone médiolittorale, alimentées par la marée haute.'),
(3923, 'NR', 22, '18.16', 'Rochers de l\'étage supralittoral', '', 'Supralittoral rocks', '', 4, 'Niveau 4', 1197, '/65/480/1197/3923', 'true', 'Cliffs and rocks of the supralittoral spray zone, mostly occupied by lichens (Verrucaria i. a.).', '', 'Rochers et falaises de la zone supralittorale des embruns, principalement occupés par des lichens (Verrucaria i.a.)'),
(3924, 'NR', 22, '18.17', 'Flaques des rochers de l\'étage supralittoral', '', 'Supralittoral rock pools', '', 4, 'Niveau 4', 1197, '/65/480/1197/3924', 'true', 'Pools of variable salinity fed by rainwater, spray and occasionally waves.', '', 'Flaques de salinité variable alimentées par les eaux de pluie, les embruns et occasionnellement les vagues.'),
(3925, 'NR', 22, '16.32', 'Gazons pionniers des lettes ou pannes humides', '', 'Dune-slack pioneer swards', '', 4, 'Niveau 4', 1196, '/65/478/1196/3925', 'true', 'Pioneer formations of humid sands with Samolus valerandi, Centaurium spp., Blackstonia perfoliata, Juncus bufonius (see 22.322).', 'Juncenion bufonii p.: Gentiano-Erythraeetum littoralis', 'Formations pionnières des sables humides avec Samolus valerandi, Centaurium spp., Blackstonia perfoliata, Juncus bufonius (voir 22.322).'),
(3926, 'NR', 22, '16.33', 'Bas-marais des pannes humides', '', 'Dune-slack fens', '', 4, 'Niveau 4', 1196, '/65/478/1196/3926', 'true', 'Calcareous and, occasionally, acidic fen formations (cf. 54.2, 54.4, in particular 54.21, 54.2H, 54.49), often invaded by creeping willow, occupying the wettest parts of dune-slacks.', '', 'Communautés de bas-marais alcalins et, occasionnellement, acides (voir 54.2, 54.4, et en particulier 54.21, 54.2H, 54.49), souvent envahies par le saule des sables, occupant les parties les plus humides des lettes.'),
(3927, 'NR', 22, '16.34', 'Prairies des lettes ou pannes humides', '', 'Dune-slack grasslands', '', 4, 'Niveau 4', 1196, '/65/478/1196/3927', 'true', 'Humid grasslands and rushbeds (see 37.31, 37.4) of dune-slacks, also often with creeping willows (Salix rosmarinifolia, S. arenaria).', '', 'Prairies humides et jonchaies humides (voir 37.31, 37.4) des pannes dunaires, assez souvent avec des saules rampants (Salix rosmarinifolia, S. arenaria).'),
(3928, 'NR', 22, '16.35', 'Roselières et cariçaies des lettes dunaires', '', 'Dune-slack reedbeds and sedgebeds', '', 4, 'Niveau 4', 1196, '/65/478/1196/3928', 'true', 'Reedbeds and tall-sedge communities (cf. 53.1, 53.2, 53.3) of dune-slacks.', '', 'Roselières et groupements de petites laîches (voir 53.1, 53.2, 53.3) des pannes dunaires.'),
(3929, 'NR', 22, '17.31', '', '', 'Baltic sea kale communities', '', 4, 'Niveau 4', 1201, '/65/479/1201/3929', 'false', 'Crambe-Honkenya formations with Leymus arenarius of the coasts of southern Baltic, the Kattegat and the baelts.', 'Elymo-Crambetum', 'Pas de description disponible'),
(3930, 'NR', 22, '17.32', 'Groupements à Crambe de la Manche', '', 'Channel sea kale communities', '', 4, 'Niveau 4', 1201, '/65/479/1201/3930', 'true', 'Crambe-Honkenya formations with Lathyrus japonicus of the southern North Sea and Channel coasts of southwestern England and, very locally, the Channel coast of France.', 'Lathyro-Crambetum', 'Formations à Crambe-Honkenya avec Lathyrus japonicus du sud de la mer du Nord et des côtes de la Manche du sud-ouest de l\'Angleterre et, très localement, des côtes françaises de la Manche.'),
(3931, 'NR', 22, '17.33', 'Groupements à Crambe de l\'Atlantique', '', 'Atlantic sea kale communities', '', 4, 'Niveau 4', 1201, '/65/479/1201/3931', 'true', 'Crambe-Honkenya formations with Crithmum maritimum of Brittany, the Cotentin peninsula and Anglesey.', 'Crithmo-Crambetum', 'Formations à Crambe-Honkenya avec Crithmum maritimum,de Bretagne et du Cotentin.'),
(3932, 'NR', 22, '17.41', 'Pelouses à Avoine élevée sur bancs de galets', '', 'Gravel bank false oatgrass swards', '', 4, 'Niveau 4', 1202, '/65/479/1202/3932', 'true', 'Swards of Arrhenatherum elatius of gravel banks.', '', 'Gazons à Arrhenatherum elatius des bancs de galets.'),
(3933, 'NR', 22, '17.42', 'Landes à Genêt à balais sur bancs de galets', '', 'Gravel bank broom mats', '', 4, 'Niveau 4', 1202, '/65/479/1202/3933', 'true', 'Prostrate Cytisus scoparius formations of gravel banks.', '', 'Peuplements prostrés à Cytisus scoparius des bancs de galets.'),
(3934, 'NR', 22, '16.22', 'Dunes grises', '', 'Grey dunes', '', 4, 'Niveau 4', 1195, '/65/478/1195/3934', 'true', 'Fixed dunes, stabilized and colonized by more or less closed perennial grasslands.', '', 'Dunes fixées, stabilisées et colonisées par des pelouses pérennes plus ou moins fermées.'),
(3935, 'NR', 22, '16.23', '', '', 'Crowberry brown dunes', '', 4, 'Niveau 4', 1195, '/65/478/1195/3935', 'false', 'Decalcified dunes colonized by Empetrum nigrum heaths, of the Frisian, German, Danish and Scottish coasts.', 'Empetrion nigri', 'Pas de description disponible'),
(3936, 'NR', 22, '16.24', 'Dunes brunes à bruyère', '', 'Heather brown dunes', '', 4, 'Niveau 4', 1195, '/65/478/1195/3936', 'true', 'Decalcified dunes of France and Britain, colonized by heaths of the Calluno-Genistion or the Ulicion minoris, and of Iberia, colonized by heaths of the Ericion umbellatae.', 'Calluno-Ulicetea p.', 'Dunes décalcifiées, colonisées par les landes du Calluno-Genistion ou de l\'Ulicion minoris, et dans la péninsule Ibérique, par l\'Ericion umbellatae.'),
(3937, 'NR', 22, '22.12', 'Eaux mésotrophes', '', 'Mesotrophic waters', '', 4, 'Niveau 4', 1206, '/66/484/1206/3937', 'true', 'Richer waters (pH often 6-7).', '', 'Eaux plus riches (pH souvent de 6-7).'),
(3938, 'NR', 22, '22.13', 'Eaux eutrophes', '', 'Eutrophic waters', '', 4, 'Niveau 4', 1206, '/66/484/1206/3938', 'true', 'Usually dirty grey to blue-green, more or less turbid, waters particularly rich in dissolved bases (pH usually > 7).', '', 'Eaux généralement, gris sale à bleu-verdâtre, plus ou moins turbides, particulièrement riches en bases dissoutes (pH habituellement >7).'),
(3939, 'NR', 22, '22.14', 'Eaux dystrophes', '', 'Dystrophic waters', '', 4, 'Niveau 4', 1206, '/66/484/1206/3939', 'true', 'Acidic waters with high humus content and often brown tinted (pH often 3-5).', '', 'Eaux acides caractérisées par une teneur en humus élevée, souvent colorées en brun (pH souvent de 3-5).'),
(3940, 'NR', 22, '22.15', 'Eaux oligo-mésotrophes riches en calcaire', '', 'Lime-rich oligo-mesotrophic waters', '', 4, 'Niveau 4', 1206, '/66/484/1206/3940', 'true', 'Usually blue to greenish, very clear, waters poor (to moderate) in nutrients, base-rich (pH often > 7.5).', '', 'Eaux habituellement très claires, bleues à vertes, pauvres à modérément riches en nutriments, basiques (pH souvent >7.5).'),
(3941, 'NR', 22, '22.31', 'Communautés amphibies pérennes septentrionales', '', 'Northern perennial amphibious communities', '', 4, 'Niveau 4', 1204, '/66/484/1204/3941', 'true', 'Carpets of perennials submerged for a considerable part of the year in oligotrophic or mesotrophic lakes, ponds and pools of the Euro-Siberian zone.', 'Littorelletalia', 'Tapis de végétaux vivaces submergés pendant une grande partie de l\'année par les eaux oligotrophes ou mésotrophes, de lacs, d\'étangs et de mares de la région euro-sibérienne.'),
(3942, 'NR', 22, '22.34', 'Groupements amphibies méridionaux', '', 'Southern amphibious communities', '', 4, 'Niveau 4', 1204, '/66/484/1204/3942', 'true', 'Perennial and annual communities of Mediterranean, thermo-Atlantic and Macaronesian temporary ponds and river banks.', 'Isoetalia', 'Communautés pérennes ou annuelles des berges et des mares temporaires méditerranéennes, thermo-atlantiques et macaronésiennes.'),
(3943, 'NR', 22, '22.32', 'Gazons amphibies annuels septentrionaux', '', 'Northern dwarf annual amphibious swards', '', 4, 'Niveau 4', 1204, '/66/484/1204/3943', 'true', 'Dwarf oligo-mesotrophic Euro-Siberian annual communities of recently emerged muds and sands.', 'Cyperetalia fusci (Nanocyperetalia)', 'Communautés de pelouses annuelles euro-sibériennes des vases et sables oligo-mésotrophes récemment émergés.'),
(3972, 'NR', 22, '22.41', 'Végétations flottant librement', '', 'Free-floating vegetation', '', 4, 'Niveau 4', 1215, '/66/484/1215/3972', 'true', 'Free-floating surface communities of waters more or less rich in nutrients.', 'Lemnion minoris (Hydrocharition)', 'Communautés flottant librement à la surface des eaux, plus ou moins riches en nutriments.'),
(3973, 'NR', 22, '22.42', 'Végétations enracinées immergées', '', 'Rooted submerged vegetation', '', 4, 'Niveau 4', 1215, '/66/484/1215/3973', 'true', 'Pondweed (Potamogeton)-dominated formations of submerged, rooted, perennial phanerogams with often emerging flower spikes.', 'Potamogetonion (Potamion)', 'Formations, dominées par des Potamots (Potamogeton), des phanérogames pérennes immergées, enracinées dont émergent souvent les épis de fleurs.'),
(3974, 'NR', 22, '22.43', 'Végétations enracinées flottantes', '', 'Rooted floating vegetation', '', 4, 'Niveau 4', 1215, '/66/484/1215/3974', 'true', 'Formations dominated by rooted aquatic plants with floating leaves.', 'Nymphaeion albae, Callitricho-Batrachion, Potamion graminei', 'Formations dominées par des plantes aquatiques enracinées avec des feuilles flottantes.'),
(3975, 'NR', 22, '31.22', 'Landes sub-atlantiques à Genêt et Callune', '', 'Sub-Atlantic Calluna-Genista heaths', '', 4, 'Niveau 4', 1217, '/67/487/1217/3975', 'true', 'Low Calluna heaths often rich in Genista, mostly of the North Sea lowlands. Similar formations occurring in British upland areas, montane zones of high mountains of the western Mediterranean basin and high rainfall Adriatic influenced areas are most conveniently listed here.', 'Calluno-Genistion pilosae p.', 'Landes basses à Callune, souvent riches en Genista, principalement représentées dans les plaines de la mer du Nord. Des formations similaires se rencontrent dans les zones montagnardes des hautes montagnes du bassin occidental de la Méditerranée...'),
(3976, 'NR', 22, '31.23', 'Landes atlantiques à Erica et Ulex', '', 'Atlantic Erica-Ulex heaths', '', 4, 'Niveau 4', 1217, '/67/487/1217/3976', 'true', 'Heaths rich in gorse (Ulex) of the Atlantic margins.', 'Ulicenion minoris; Daboecenion cantabricae p.; Ulicion maritimae p.', 'Landes riches en Ajoncs (Ulex) des bords de l\'Atlantique.'),
(3977, 'NR', 22, '31.24', 'Landes ibéro-atlantiques à Erica, Ulex et Cistus', '', 'Ibero-Atlantic Erica-Ulex-Cistus heaths', '', 4, 'Niveau 4', 1217, '/67/487/1217/3977', 'true', 'Aquitanian heaths with rock-roses. Iberian heaths with numerous species of heathers (notably Erica umbellata, E. aragonensis) and brooms, rock-roses and often Daboecia. When the rock-roses and other Mediterranean shrubs become dominant they should be classified under sclerophyllous scrubs (32).', 'Daboecenion cantabricae p.; Ericenion umbellatae p., Ericenion aragonensis; Ulicion maritimae p.; Genistion micrantho-anglicae p.', 'Landes aquitaniennes avec cistes. Quand les Cistes et les autres broussailles méditerranéennes deviennent dominants elles doivent être classées avec les fourrés sclérophylles (32).'),
(3978, 'NR', 22, '24.53', 'Groupements méditerranéens des limons riverains', '', 'Mediterranean river mud communities', '', 4, 'Niveau 4', 1211, '/66/486/1211/3978', 'true', 'Nitrophilous annual and perennial grass and sedge formations of the alluvial banks of great Mediterranean rivers, with Paspalum paspaloides, P. vaginatum, Polypogon viridis (= Agrostis semiverticillata), Cyperus fuscus.', 'Paspalo-Agrostidion', 'Formations de laîches et de graminées nitrophiles, annuelles ou vivaces des bancs d\'alluvions des rivières méditerranéennes, avec Paspalum distichum (paspalodes), P. vaginatum, Polypogon viridis (= Agrostis semiverticillata), Cyperus fuscus.'),
(3979, 'NR', 22, '31.11', 'Landes humides atlantiques septentrionales', '', 'Northern wet heaths', '', 4, 'Niveau 4', 1216, '/67/487/1216/3979', 'true', 'Wet heaths with Erica tetralix and sphagnums.', '', 'Landes humides avec Erica tetralix et Sphaignes.'),
(3980, 'NR', 22, '31.12', 'Landes humides atlantiques méridionales', '', 'Southern wet heaths', '', 4, 'Niveau 4', 1216, '/67/487/1216/3980', 'true', 'Wet heaths with Erica tetralix and E. ciliaris and sphagnums.', '', 'Landes humides avec Erica tetralix, E. ciliaris et Sphaignes.'),
(3981, 'NR', 22, '31.13', 'Landes humides à Molinia caerulea', '', 'Purple moorgrass wet heaths', '', 4, 'Niveau 4', 1216, '/67/487/1216/3981', 'true', 'Degraded facies of wet heaths, dominated by Molinia caerulea', '', 'Faciès dégradés de landes humides, dominés par Molinia caerulea.'),
(3982, 'NR', 22, '31.21', 'Landes submontagnardes à Vaccinium', '', 'Submontane Vaccinium heaths', '', 4, 'Niveau 4', 1217, '/67/487/1217/3982', 'true', 'Heaths rich in Vaccinium spp., usually with Calluna vulgaris, of the northern and western British Isles, the Hercynian ranges and the lower levels of the Alps, the Pyrenees and the Cordillera Cantabrica.', 'Calluno-Genistion pilosae p.; Vaccinion vitis-idaeae p.', 'Landes riches en Vaccinium spp., généralement avec Calluna vulgaris, des montagnes hercyniennes et des étages inférieurs des Alpes, des Pyrénées.'),
(3983, 'NR', 22, '31.49', 'Tapis à Dryade', '', 'Mountain avens mats', '', 4, 'Niveau 4', 1222, '/67/487/1222/3983', 'true', 'Dryas octopetala may form woody mats in various calcicolous alpine grasslands (36) or rock vegetations (62). If sufficiently extensive they can be listed as heaths under this heading, together with the distinctive British and Irish formations.', '', 'Dryas octopetala peut former des landines dans différents types de pelouses calcicoles alpines (36) ou des végétations de rocher (62). Si elles sont suffisamment vastes ces communautés peuvent être cataloguées comme des landes sous cet intitulé.'),
(3984, 'NR', 22, '31.4A', '', '', 'Apennine Vaccinium heaths', '', 4, 'Niveau 4', 1222, '/67/487/1222/3984', 'false', 'Dwarf mats of Vaccinium myrtillus, V. uliginosum s.l. and, locally, Empetrum nigrum of the northern and central Apennines.', '', 'Pas de description disponible'),
(3985, 'NR', 22, '31.51', 'Fourrés bas de Pins mugo des Alpes internes', '', 'Inner Alpine dwarf mountain pine scrub', '', 4, 'Niveau 4', 1218, '/67/487/1218/3985', 'true', 'Formations of the dry inner Alps.', '', 'Formations des Alpes internes sèches.'),
(3986, 'NR', 22, '31.52', '', '', 'Outer Alpine dwarf mountain pine scrub', '', 4, 'Niveau 4', 1218, '/67/487/1218/3986', 'false', 'Formations of the northern and southeastern outer Alps.', '', 'Pas de description disponible'),
(3987, 'NR', 22, '31.53', 'Fourrés bas de Pins mugo des Alpes sud-occidentales', '', 'South-western Alpine dwarf mountain pine scrub', '', 4, 'Niveau 4', 1218, '/67/487/1218/3987', 'true', 'Local formations of the southwestern Alps (Haute Roya, Ligurian Alps).', '', 'Formations locales des Alpes sud-occidentales (Haute Roya, Alpes ligures).'),
(3988, 'NR', 22, '31.54', '', '', 'Apennine dwarf mountain pine scrub', '', 4, 'Niveau 4', 1218, '/67/487/1218/3988', 'false', 'Rare and local Apennine formations of the Parmian Apennines, the Abruzzi and the Campanian Apennines.', '', 'Pas de description disponible'),
(3989, 'NR', 22, '31.61', 'Broussailles d\'Aulnes verts', '', 'Green alder brush', '', 4, 'Niveau 4', 1219, '/67/487/1219/3989', 'true', 'Dense thickets of green alders characteristic of the Alps and Corsica.', 'Alnetum viridis, Cymbalerion hepaticifoliae p.', 'Fourrés denses d\'Aulnes verts, caractéristiques des Alpes et de la Corse.'),
(3990, 'NR', 22, '31.62', 'Fourrés de Saules', '', 'Willow brush', '', 4, 'Niveau 4', 1219, '/67/487/1219/3990', 'true', 'Willow-dominated facies of the sub-alpine tall herb communities of higher medio-European mountains and of the northern British Isles.', 'Salicion arbusculae (Salicion waldsteinianae) i.a.', 'Faciès à Saules, dominant des communautés subalpines à hautes herbes des hautes montagnes médio-européennes et du nord des Iles britanniques.'),
(3991, 'NR', 22, '31.73', '', '', 'Nevadan hedgehog-heaths', '', 4, 'Niveau 4', 1220, '/67/487/1220/3991', 'false', 'Highly developed hedgehog formations of the Sierra Nevada with Erinacea anthyllis, Vella spinosa, Astragalus sempervirens ssp. nevadensis, A. granatensis ssp. granatensis (A. boissieri), Ptilotrichum spinosum, Bupleurum spinosum, Genista baetica. Associated dwarf suffrutescent formations of high slopes and crests.', 'Erinacetalia p., Lavandulo-Genistion boissieri p.', 'Pas de description disponible'),
(3992, 'NR', 22, '31.74', 'Landes épineuses franco-ibériques', '', 'Franco-Iberian hedgehog-heaths', '', 4, 'Niveau 4', 1220, '/67/487/1220/3992', 'true', 'Oro-Mediterranean and montane hedgehog-heaths of other Iberian ranges and of southern France.', '', 'Landes hérisson oro-méditerrannéennes et montagnardes du Sud de la France.'),
(3993, 'NR', 22, '31.63', 'Mégaphorbiaies subalpines avec buissons', '', 'Subalpine tall herbs with bushes', '', 4, 'Niveau 4', 1219, '/67/487/1219/3993', 'true', 'Other bushy facies (Vaccinium, Rubus, Sorbus) of the sub-alpine tall herb communities (cf. 37.8). Tall bushy facies of other sub-alpine associations, such as Amelanchier, Rhamnus, Sorbus thickets associated with Juniperus nana-Arctostaphylos uva-ursi heaths can be included.', '', 'Autres faciès buissonnants (Vaccinium, Rubus, Sorbus) des communautés de hautes herbes subalpines (voir aussi 37.9). Les faciès buissonnants hauts d\'autres associations subalpines, telles que les fourrés à Amelanchier, Rhamnus, Sorbus, associés aux landes à Juniperus nana et Arctostaphylos uva-ursi peuvent y être inclus.'),
(3994, 'NR', 22, '31.64', '', '', 'British roseroot community', '', 4, 'Niveau 4', 1219, '/67/487/1219/3994', 'false', 'Tall-herb dominated community with Rhodiola rosea, Alchemilla glabra, Rubus saxatilis, Geum rivale, Geranium sylvaticum, Angelica sylvestris, Vaccinium myrtillus, Heracleum sphondylium, Saussurea alpina, colonizing steep crags out of range of grazing, mostly characteristic of the Scottish Highlands with outposts in the Moffat Hills, Lakeland and North Wales.', '', 'Pas de description disponible'),
(3995, 'NR', 22, '31.71', 'Landes épineuses pyrénéennes', '', 'Pyrenean hedgehog-heaths', '', 4, 'Niveau 4', 1220, '/67/487/1220/3995', 'false', 'Echinospartum horridum formations of dry slopes of the supra-Mediterranean zone of the southern Pyrenees; accompanying the dense, spiny cushions are Juniperus hemisphaerica, Buxus sempervirens, Ononis fruticosa, Arctostaphylos uva-ursi ssp. crassifolia and Pinus sylvestris.', 'Junipero-Genistetum horridae', 'Formations d\'Echinospartum horridum des pentes sèches de l\'étage supra-méditerranéen des Pyrénées méridionales ; accompagnant ces denses buissons en coussinet épineux, Juniperus hemisphaerica, Buxus sempervirens, Ononis fructicosa, Arctostaphylos uva-ursi subsp. crassifolia et Pinus sylvestris.'),
(3996, 'NR', 22, '31.72', '', '', 'Cordilleran hedgehog-heaths', '', 4, 'Niveau 4', 1220, '/67/487/1220/3996', 'false', 'Formations of the Cordillera Central and adjacent areas dominated by diverse forms of Echinospartum.', 'Cytiso oromediterranei-Echinospartetum barnadesii, Echinosparto pulviniformis-Cytisetum oromediterranei, Teucrii salviastri-Echinospartetum pulviniformis, Genisto hystricis-Echinospartetum lusitanici', 'Pas de description disponible'),
(3997, 'NR', 22, '31.31', '', '', 'Canarian heaths', '', 4, 'Niveau 4', 1221, '/67/487/1221/3997', 'false', 'Low and medium-tall ericaceous formations of the cloud belt of the Canary Islands.', 'Andryalo-Ericetalia p.', 'Pas de description disponible'),
(4263, 'NR', 22, '37.32', 'Prairies à Jonc rude et pelouses humides à Nard', '', 'Heath rush meadows and humid mat-grass swards', '', 4, 'Niveau 4', 1280, '/67/496/1280/4263', 'true', 'Humid, often peaty or semipeaty swards with Nardus stricta, Juncus squarrosus, Festuca ovina, Gentiana pneumonanthe, Pedicularis sylvatica, Scirpus cespitosus and sometimes Sphagnum spp..', 'Nardetalia: Juncion squarrosi', 'Pelouses humides, souvent tourbeuses ou semi-tourbeuses, avec Nardus stricta, Juncus squarrosus, Festuca ovina, Gentiana pneumonanthe, Pedicularis sylvatica, Trichophorum cespitosum et quelquefois Sphagnum spp.'),
(4264, 'NR', 22, '34.75', '', '', 'Eastern sub-Mediterranean dry grasslands', '', 4, 'Niveau 4', 1269, '/67/490/1269/4264', 'false', 'Xeric grasslands of the sub-Mediterranean zones of Trieste and of the Ostryo-Carpinion zone of Greece, where they coexist with steppic grasslands of the Festucetalia valesiacae (34.311), developing in areas of lesser continentality than the latter, and incorporating a greater Mediterranean element than they do; like the steppic grasslands, however, they are often dominated by Carex humilis or Festuca rupicola.', 'Brachypodio-Chrysopogonetea p.', 'Pas de description disponible'),
(4265, 'NR', 22, '36.36', '', '', 'Acidophilous grasslands of high Iberian mountains', '', 4, 'Niveau 4', 1297, '/67/495/1297/4265', 'false', 'Cryoro- and oro-Mediterranean grasslands of acid substrates in the higher mountain ranges of the Iberian peninsula.', 'Nardetalia p., Festucetalia indigestae', 'Pas de description disponible'),
(4266, 'NR', 22, '38.41', '', '', 'Perennial vallicares', '', 4, 'Niveau 4', 1272, '/67/494/1272/4266', 'false', 'Perennial Agrostis castellana - dominated grasslands.', '', 'Pas de description disponible'),
(4267, 'NR', 22, '38.42', '', '', 'Annual vallicares', '', 4, 'Niveau 4', 1272, '/67/494/1272/4267', 'false', 'Annual Agrostis pourretii - dominated grasslands.', '', 'Pas de description disponible'),
(4268, 'NR', 22, '38.43', '', '', 'Andalusian thrift vallicares', '', 4, 'Niveau 4', 1272, '/67/494/1272/4268', 'false', 'Armeria gaditana, Gaudinia fragilis, Centaurea exarata and Asphodelus aestivus grasslands of southwestern Iberia.', '', 'Pas de description disponible'),
(4269, 'NR', 22, '34.33', 'Prairies calcaires subatlantiques très sèches', '', 'Sub-Atlantic very dry calcareous grasslands', '', 4, 'Niveau 4', 1236, '/67/490/1236/4269', 'true', 'Xerophile, open formations dominated by perennial, tuft-forming grasses, often rich in chamaephytes, colonizing superficial calcareous soils, often on steep slopes, clifftops or hilltops, in the sub-Atlantic domain of the Quercion pubescentii-petraeae and its northern irradiations and in the sub-Mediterranean mountains of the northern Italian peninsula, with Bromus erectus, Sesleria albicans, Koeleria vallesiana, Melica ciliata, Stipa pennata, S. bavarica, S. capillata, S. pulcherrima, Phleum phleoides, Brachypodium pinnatum, Carex humilis, Fumana procumbens, Globularia punctata, Ononis pusilla, Helianthemum apenninum, H. canum, H. nummularium, Linum tenuifolium, Teucrium chamaedrys, Allium sphaerocephalon, Arabis hirsuta, Anthericum liliago, Aster linosyris, Pulsatilla vulgaris, Biscutella laevigata, Orobanche teucrii, Artemisia alba, Sedum album, S. acre, Acinos arvensis, Hippocrepis comosa, Sanguisorba minor, Potentilla neumanniana, Scabiosa columbaria, Astragalus monspessulanus, Teucrium pyrenaicum, Ononis spinosa, O. natrix.', 'Xerobromion (Seslerio-Xerobromion)', 'Formations xérophiles ouvertes dominées par des graminées vivaces, cespiteuses, souvent riches en chaméphytes, colonisant des sols calcaires superficiels, souvent sur des pentes escarpées, au sommet de collines ou de falaises, dans le domaine sub-atlantique du Quercion pubescenti-petraea et de ses irradiations septentrionales, avec Bromus erectus, Sesleria albicans, Koeleria vallesiana, Melica ciliata, Stipa pennata, S. capillata, S. pennata subsp. grafiana, Phleum phleoides, Brachypodium pinnatum, Carex humilis, Fumana procumbens, Globularia punctata, Ononis pusilla, Helianthemum apennimum, H. canum, H. nummularium, Linum tenuifolium, Teucrium chamaedrys, Allium sphaerocephalon, Arabis hirsuta, Anthericum liliago, Aster linosyris, Pulsatilla vulgaris, Biscutella laevigata, Orobanche teucrii, Artemisia alba, Sedum album, S. acre, Acinos arvensis, Hippocrepis comosa, Sanguisorba minor, Potentilla neumanniana, Scabiosa columbaria, Astragalus monspessulanus, Teucrium pyrenaicum, Ononis spinosa, O. natrix.'),
(4270, 'NR', 22, '36.37', 'Pelouses des hautes montagnes corses', '', 'Grasslands of high Corsican mountains', '', 4, 'Niveau 4', 1297, '/67/495/1297/4270', 'true', 'Grasslands of the subalpine (oro-Mediterranean) and alpine levels of the highest mountains of Corsica.', '', 'Pelouses des étages subalpin (oro-méditerranéen) et alpin des plus hautes montagnes de Corse.'),
(4271, 'NR', 22, '37.72', 'Franges des bords boisés ombragés', '', 'Shady woodland edge fringes', '', 4, 'Niveau 4', 1294, '/67/496/1294/4271', 'true', 'Nitro-hygrophilous communities of usually large-leaved herbs developing along the shaded side of wooded stands and hedges, with Galium aparine, Glechoma hederacea, Geum urbanum, Aegopodium podagraria, Silene dioica, Carduus crispus, Chaerophyllum hirsutum, Lamium album, Alliaria petiolata, Lapsana communis, Geranium robertianum, Viola alba, V. odorata.', 'Aegopodion podagrariae p., Alliarion (Geo-Alliarion, Lapsano-Geranion robertiani)', 'Communautés nitro-hygrophiles d\'herbacées habituellement à grandes feuilles se développant du côté ombragé des peuplements ligneux et des haies, avec Galium aparine, Glechoma hederacea, Geum urbanum, Aegopodium podagraria, Silene dioica, Carduus crispus, Chaerophyllum hirsutum, Lamium album, Alliaria petiolata, Lapsana communis, Geranium robertianum, Viola alba, V. odorata.'),
(4272, 'NR', 22, '34.81', 'Groupements méditerranéens subnitrophiles de graminées', '', 'Mediterranean subnitrophilous grass communities', '', 4, 'Niveau 4', 1274, '/67/490/1274/4272', 'true', 'Graminoid formations with Bromus fasciculatus, B. madritensis, B. intermedius, B. alopecuros, B. rubens, B. hordeaceus, B. tectorum, Aegilops neglecta, A. geniculata, A. triuncialis, A. ventricosa, Taeniatherum caput-medusae, Avena sterilis, A. barbata, Lagurus ovatus, Lolium rigidum, Vulpia ciliata, V. bromoides, V. geniculata, Lamarckia aurea, Trisetum paniceum, Cynosurus echinatus, Stipa capensis, and with Scandix australis, Astragalus scorpioides, Trifolium cherleri, T. hirtum, T. striatum, T. campestre, T. arvense, T. glomeratum, Viccia lutea, Medicago rigidula, M. sativa, M. littoralis, Melilotus sulcata, Coronilla scorpioides, Filago minima, Paronychia argentea, particularly widespread in Iberia, southern Italy and Greece where they may cover vast expanses of post-cultural or extensive pasture lands, also locally represented in southern France and coastal northern Italy.', 'Taeniathero-Aegilopion geniculatae, Brachypodio-Chrysopogonetea p.', 'Formations graminoïdes avec Bromus fasciculatus, B. madritensis, B. intermedius, B. alopecuros, B. rubens, B. hordeaceus, B. tectorum, Aegilops neglecta, A. ovata, A. triuncialis, A. ventricosa, Taeniatherum caput-medusae, Avena sterilis, A. barbata, Lagurus ovatus, Lolium rigidum, Vulpia ciliata, V. bromoides, V. geniculata, Lamarckia aurea, Trisetum paniceum, Cynosurus echinatus, Stipa capensis, et avec Scandix australis, Astragalus scorpioides, Trifolium cherleri, T. hirtum, T. striatum, T. campestre, T. arvense, T. glomeratum, Vicia lutea, Medicago rigidula, M. sativa, M. littoralis, Melilotus sulcatus, Coronilla scorpioides, Logfia minima, Paronychia argentea, localement représentées dans le sud de la France.');
INSERT INTO `corine` (`CD_HAB`, `FG_VALIDITE`, `CD_TYPO`, `LB_CODE`, `LB_HAB_FR`, `LB_HAB_FR_COMPLET`, `LB_HAB_EN`, `LB_AUTEUR`, `NIVEAU`, `LB_NIVEAU`, `CD_HAB_SUP`, `PATH_CD_HAB`, `FRANCE`, `LB_DESCRIPTION`, `CRSP_PHYTO_CB91`, `DESCRIPTIF_CB97_FR`) VALUES
(4273, 'NR', 22, '34.82', '', '', 'Meseta subnitrophilous crucifer communities', '', 4, 'Niveau 4', 1274, '/67/490/1274/4273', 'false', 'Brassicoid formations of the Spanish Meseta with Brassica barrelieri, Andryala arenaria, Alyssum granatense, Rhynchosinapsis hispida, Euphorbia matritensis, Sisymbrium contortum, Papaver argemone, Hirschfeldia incana, Capsella rubella.', 'Alysso-Brassicion barrelieri', 'Pas de description disponible'),
(4274, 'NR', 22, '34.83', '', '', 'Iberian south-eastern subnitrophilous herb communities', '', 4, 'Niveau 4', 1274, '/67/490/1274/4274', 'false', 'Formations of the arid Iberian Southeast with Astragalus longidentatus, Brassica cossoniana, Carrichtera annua, Euphorbia dracunculoides, Lasiopogon muscoides, Leontodon salzmannii, Lotus edulis, Lycocarpus fugax, Matthiola lunata, M. parviflora, Notoceras bicorne, Volutaria (Amberboa) lippii.', 'Carrichtero-Amberboion', 'Pas de description disponible'),
(4275, 'NR', 22, '34.84', '', '', 'Eastern Mediterranean subnitrophilous herb communities', '', 4, 'Niveau 4', 1274, '/67/490/1274/4275', 'false', 'Annual herb formations of arid areas of the Aegean (e.g. eastern Crete), developed in particular as ultimate degradation of overgrazed phryganas.', '', 'Pas de description disponible'),
(4276, 'NR', 22, '36.38', '', '', 'Closed grasslands of the high Apennines', '', 4, 'Niveau 4', 1297, '/67/495/1297/4276', 'false', 'Mesophile, closed, short turfs of the subalpine and alpine levels of the southern and central Apennines, developed locally above treeline, on both calcareous and siliceous substrates.', '', 'Pas de description disponible'),
(4277, 'NR', 22, '37.81', 'Mégaphorbiaies des montagnes hercyniennes, du Jura et des Alpes', '', 'Hercynio-Alpine tall herb communities', '', 4, 'Niveau 4', 1275, '/67/496/1275/4277', 'true', 'Subalpine and alpine meso-hygrophile tall herb formations of moist hollows and gullies of the Alps, the Jura, the great Hercyninian ranges, the Central Massif and the Apennines.', 'Adenostylion alliariae', 'Formations subalpines et alpines mésohygrophiles de grandes herbes, des dépressions humides, ravins humides et ruisseaux, des Alpes, du Jura, des Vosges et du Massif central.'),
(4278, 'NR', 22, '37.82', 'Prairies subalpines à Calamagrostis arundinacea', '', 'Subalpine small reed meadows', '', 4, 'Niveau 4', 1275, '/67/496/1275/4278', 'true', 'Thermophile, meso-xerophile species-rich formations of steep adrets of the subalpine level of the Alps, the Jura, the great Hercynian ranges and the Central Massif, mostly dominated by Calamagrostis arundinacea, associated with plants such as Senecio doronicum, Digitalis grandiflora, Hieracium aurantiacum, Aconitum vulparia, Geranium sylvaticum, Bupleurum longifolium, Sorbus spp.', 'Calamagrostion arundinaceae', 'Formations thermophiles, méso-xérophiles riches en espèces des adrets escarpés de l\'étage subalpin des Alpes, du Jura, des Vosges et du Massif central, principalement dominées par Calamagrostis arundinacea, associé avec des plantes telles que Senecio doronicum, Digitalis grandiflora, Hieracium aurantiacum, Aconitum vulparia, Geranium sylvaticum, Bupleurum longifolium, Sorbus spp.'),
(4279, 'NR', 22, '37.83', 'Mégaphorbiaies pyrénéo-ibériques', '', 'Pyreneo-Iberian tall herb communities', '', 4, 'Niveau 4', 1275, '/67/496/1275/4279', 'true', 'Subalpine and alpine meso-hygrophile tall herb formations of the Pyrenees, the Cantabrian mountains, the Cordillera Central, the Iberian Range, with Valeriana pyrenaica and Adenostyles alliariae ssp. pyrenaica (hybrida).', 'Adenostylion pyrenaicae', 'Mégaphorbiaies, subalpines et alpines, mésohygrophiles, des Pyrénées, ..., avec Valeriana pyrenaica et Adenostyles alliariae subsp. pyrenaica (hybrida).'),
(3998, 'NR', 22, '31.32', '', '', 'Madeiran cloud heaths', '', 4, 'Niveau 4', 1221, '/67/487/1221/3998', 'false', 'Sometimes fairly tall, 2-3 metre high, Erica arborea, Myrica faya, Erica scoparia, Laurus azorica, Cletura arborea and Pteridium aquilinum heaths of the cloud zone of Madeira.', '', 'Pas de description disponible'),
(3999, 'NR', 22, '31.33', '', '', 'Madeiran summital heaths', '', 4, 'Niveau 4', 1221, '/67/487/1221/3999', 'false', 'Erica cinerea var. maderensis-dominated heaths of the highest peaks of Madeira.', '', 'Pas de description disponible'),
(4000, 'NR', 22, '31.34', '', '', 'Azorean lowland heaths', '', 4, 'Niveau 4', 1221, '/67/487/1221/4000', 'false', 'Erica azorica, Myrica faya and Laurus azorica heaths of the lower altitudes of the Azores.', '', 'Pas de description disponible'),
(4001, 'NR', 22, '31.35', '', '', 'Azorean \'upper woods\' heaths', '', 4, 'Niveau 4', 1221, '/67/487/1221/4001', 'false', 'Heath facies of the Erica azorica and Juniperus brevifolia \"upper woods\" of the Azores.', '', 'Pas de description disponible'),
(4002, 'NR', 22, '31.36', '', '', 'Azorean summital heaths', '', 4, 'Niveau 4', 1221, '/67/487/1221/4002', 'false', 'Calluna vulgaris, Daboecia azorica and Thymus caespititius communities of the highest altitudes of the Azores (1200 - 1500 m).', '', 'Pas de description disponible'),
(4003, 'NR', 22, '31.41', 'Landes naines à Azalée et à Vaccinium', '', 'Dwarf azalea and Vaccinium heaths', '', 4, 'Niveau 4', 1222, '/67/487/1222/4003', 'true', 'Trailing azalea, Loiseleuria procumbens, and lichen mats of high windswept localities in the Alps and Pyrenees, often with Vaccinium.', 'Loiseleurio-Vaccinion', 'Landines d\'Azalée naine, Loiseleuria procumbens et tapis de lichens des stations balayées par le vent dans les Alpes et les Pyrénées, souvent avec Vaccinium.'),
(4004, 'NR', 22, '31.42', 'Landes à Rhododendron', '', 'Alpenrose heaths', '', 4, 'Niveau 4', 1222, '/67/487/1222/4004', 'true', 'Rhododendron ferrugineum-dominated heaths of acid podsols in the Alps and Pyrenees, often with Vaccinium, sometimes with Pinus mugo. They often alternate in mosaic with 31.431 and 31.44.', 'Rhododendro-Vaccinion', 'Landes à Rhododendron ferrugineum dominant, développées sur des podzols acides dans les Alpes et les Pyrénées, souvent avec Vaccinium, parfois avec Pinus mugo ; ces landes alternent en mosaïques, souvent avec 31.431 et 31.44.'),
(4005, 'NR', 22, '31.43', 'Fourrés à Genévriers nains', '', 'Dwarf juniper scrub', '', 4, 'Niveau 4', 1222, '/67/487/1222/4005', 'true', 'Usually dense formations of prostrate junipers.', 'Juniperion nanae, Pino-Juniperion sabinae p., Pino-Cytision purgantis p.', 'Formations généralement denses de Genévriers prostrés.'),
(4006, 'NR', 22, '31.44', 'Landes à Empetrum et Vaccinium', '', 'Empetrum-Vaccinium heaths', '', 4, 'Niveau 4', 1222, '/67/487/1222/4006', 'true', 'Dwarf heaths dominated by Empetrum hermaphroditum, Vaccinium uliginosum, Arctostaphylos alpina and lycopodes (Huperzia selago, Diphasiastrum alpinum) of the Alps, Pyrenees, Central Massif, Jura, Northern Apennines.', 'Empetro-Vaccinietum', 'Landes naines dominées par Empetrum hermaphroditum, Vaccinium uliginosum, Arctostaphylos alpina avec des Lycopodes (Huperzia selago, Diphasiastrum alpinum), des Alpes, du Massif central, des Pyrénées, du Jura.'),
(4007, 'NR', 22, '31.45', '', '', 'Boreo-alpine Scottish heaths', '', 4, 'Niveau 4', 1222, '/67/487/1222/4007', 'false', 'Alpine heaths of the highlands and islands of Scotland, with Juniperus nana, Loiseleuria procumbens, Empetrum hermaphroditum, Arctostaphylos uva-ursi, A. alpina and elements of Alpine flora.', '', 'Pas de description disponible'),
(4008, 'NR', 22, '31.46', '', '', 'Bruckenthalia heaths', '', 4, 'Niveau 4', 1222, '/67/487/1222/4008', 'false', 'Balkanic heaths with Bruckenthalia spiculifolia, Vaccinium myrtillus.', '', 'Pas de description disponible'),
(4009, 'NR', 22, '31.47', 'Landes à Arctostaphylos uva-ursi', '', 'Bearberry heaths', '', 4, 'Niveau 4', 1222, '/67/487/1222/4009', 'true', 'Alpine and sub-alpine mats of Arctostaphylos uva-ursi or A. alpina.', 'Mugo-Rhodoretum hirsuti p., Juniperion nanae p., i.a.', 'Landes alpines et subalpines à Arctostaphylos uva-ursi ou A. alpina.'),
(4010, 'NR', 22, '31.48', 'Landes à Rhododendron hirsutum', '', 'Hairy alpenrose heaths', '', 4, 'Niveau 4', 1222, '/67/487/1222/4010', 'true', 'Forest substitution heaths, treeline fringe formations and alpine heaths or mats dominated by Rhododendron hirsutum of calcareous soils in the Alps. Erica herbacea and Rhodothamnus chamaecistus may be constituents of the heaths.', 'Mugo-Rhodoretum hirsuti p.', 'Landes de substitution, formations de la limite des arbres et landes alpines (éventuellement prostrées) dominées par Rhododendron hirsutum et croissant sur sols calcaires dans les Alpes avec Erica herbacea.'),
(4011, 'NR', 22, '31.75', 'Landes épineuses cyrno-sardes', '', 'Cyrno-Sardian hedgehog-heaths', '', 4, 'Niveau 4', 1220, '/67/487/1220/4011', 'true', 'Expanses of small, compact bushes with Astragalus sirinicus ssp. genargenteus, Rosa seraphini, Anthyllis hermanniae, Thymus herba-barona, Cerastium boissieri, Genista salzmannii, G. corsica, Berberis aetnensis, Prunus prostrata and Daphne oleoides, of Sardinian and Corsican mountains.', 'Carici-Genistetalia (Carlinetalia macrocephalae)', 'Etendues de petits buissons compacts avec Astragalus sirinicus subsp. gennargenteus, Rosa serafinii, Anthyllis hermanniae, Thymus herba- barona, Cerastium boissieri, Genista salzmannii, G. corsica, Berberis aetnensis, Prunus prostrata et Daphne oleoides, des montagnes corses.'),
(4012, 'NR', 22, '31.76', '', '', 'Mount Etna hedgehog-heaths', '', 4, 'Niveau 4', 1220, '/67/487/1220/4012', 'false', 'Lava-colonising formations with cushions of Astragalus granatensis ssp. siculus, Berberis aetnensis, Juniperus hemisphaerica, Genista aetnensis, Adenocarpus bivonae, Viola aethnensis.', 'Astragaletum siculi', 'Pas de description disponible'),
(4013, 'NR', 22, '31.77', '', '', 'Madonie and Apennine hedgehog-heaths', '', 4, 'Niveau 4', 1220, '/67/487/1220/4013', 'false', 'Hedgehog-heaths formed by Astragalus spp. or Genista spp., of the mountains of the southern Italian peninsula and Sicily, except Etna.', '', 'Pas de description disponible'),
(4014, 'NR', 22, '31.78', '', '', 'Subalpine Peloponnese hedgehog-heaths', '', 4, 'Niveau 4', 1220, '/67/487/1220/4014', 'false', 'Hedgehog-dominated facies of mostly secondary grassland-scrubland communities replacing Abies cephalonica forests in the 1500 - 1800 m altitudinal range of Peloponnese mountains, in particular, Taygetos, Parnon and Kyllini, composed of Stipa pulcherrima and Morina persica, with bushes and cushion-shaped perennials including Astragalus angustifolius, Daphne oleoides, Juniperus haemispherica, Berberis cretica, Anthemis montana, Ribes uva-crispi, Prunus cocomilla.', 'Daphno-Festucetea: Stipo-Morinion p.', 'Pas de description disponible'),
(4015, 'NR', 22, '31.79', '', '', 'Lower alpine Greek hedgehog-heaths', '', 4, 'Niveau 4', 1220, '/67/487/1220/4015', 'false', 'Hedgehog-heaths developed on relatively humus-rich soils above treeline, in the 1700-2200 m altitudinal range of high Greek mountains; hedgehog facies of associated grasslands; similar, impoverished formations descending into the forest belts of the same mountains, with the exception of those of the Peloponnese, where they are replaced by distinctive formations, listed under 31.78.', 'Daphno-Festucetea: Eryngio-Bromion p.', 'Pas de description disponible'),
(4016, 'NR', 22, '31.7A', '', '', 'Upper alpine Greek hedgehog-heaths', '', 4, 'Niveau 4', 1220, '/67/487/1220/4016', 'false', 'Shrubby formations colonizing the altitudinal range immediately above that occupied by the communities of 31.79, as well as stony slopes with shallow soil, loose screes and humus-deficient soils within the main 1700-2200 m range of these communities. Included are true spiny hedgehog-heaths, cushony formations of dwarf suffrutescents and bush-dominated facies of stripped grasslands. Astragalus angustifolius, Acantholimon androsaceum, Astragalus lacteus, Convolvulus cochlearis, Rindera graeca, Aster alpinus, Globularia stygia, Minuartia stellata, Erysimum pusillum, Thymus teucrioides, Alyssum kionae, Paronychia kapela, Thymus hirsutus, Anthyllis aurea, Achillea ageratifolia, Sideritis scardica, Linum flavum, Thymus boissieri, Sesleria caerulans are characteristic.', 'Daphno-Festucetea: Astragalo-Seslerion', 'Pas de description disponible'),
(4017, 'NR', 22, '31.7B', '', '', 'Cretan hedgehog-heaths', '', 4, 'Niveau 4', 1220, '/67/487/1220/4017', 'false', 'Hedgehog-heaths of high mountains of Crete, in the 1500-2500 m altitudinal range, with Astragalus creticus ssp. creticus, A. angustifolius, Acantholimon androsaceum, Atraphaxis billardieri, Berberis cretica, Chamaecytisus creticus, Daphne oleoides, Prunus prostrata, Euphorbia acanthothamnos, Verbascum spinosum, Sideritis syriaca, Satureja spinosa, Asperula idaea, Rhamnus prunifolius, Pimpinella tragium, Acinos alpinus.', 'Saturejetea spinosae', 'Pas de description disponible'),
(4018, 'NR', 22, '31.7C', '', '', 'Aegean summital hedgehog-heaths', '', 4, 'Niveau 4', 1220, '/67/487/1220/4018', 'false', 'Isolated, endemic-rich, mostly summital hedgehog-heaths of calcareous mountains of Aegean islands and Mount Athos.', '', 'Pas de description disponible'),
(4019, 'NR', 22, '31.7D', '', '', 'Montane Genista acanthoclada hedgehog-heaths', '', 4, 'Niveau 4', 1220, '/67/487/1220/4019', 'false', 'Formations dominated by hemispherical shrubs of Genista acanthoclada of the middle levels (about 800 - 1200 m) of mountains and plateaux of the Peloponnese.', '', 'Pas de description disponible'),
(4020, 'NR', 22, '31.7E', 'Landes épineuses à Astragalus sempervirens', '', 'Astragalus sempervirens hedgehog-heaths', '', 4, 'Niveau 4', 1220, '/67/487/1220/4020', 'true', 'Astragalus sempervirens ssp. sempervirens, ssp. muticus, ssp. cephalonicus formations of the southern Alps, the eastern Pyrenees, Iberia, the Apennines and Greece, transitional between the alpine and sub-alpine heaths of 31.4 and the true Mediterranean hedgehog-heaths of 31.7.', '', 'Formations du sud des Alpes, de l\'est des Pyrénées, de l\'Espagne... à Astragalus sempervirens subsp. sempervirens, subsp. catalaunicus ... assurant la transition entre les landes alpines et subalpines de 31.4 et les véritables landes à xérophytes épineuses en coussinet méditerranéennes de 31.7.'),
(4021, 'NR', 22, '31.7F', '', '', 'Canarian cushion-heaths', '', 4, 'Niveau 4', 1220, '/67/487/1220/4021', 'false', 'Open formations dominated by broom-like plants of the montane zone (above 1900 m) of the Canary Islands, with many endemic species.', 'Spartocytision nubigeni', 'Pas de description disponible'),
(4022, 'NR', 22, '31.82', 'Fruticées à Buis', '', 'Box thickets', '', 4, 'Niveau 4', 1223, '/67/487/1223/4022', 'true', 'Box-dominated formations of 31.81, 31.89, 31.8A or 31.8B.', 'Berberidion p.', 'Faciès dominés par le Buis de 31.81, 31.89, 31.8A ou 31.8B.'),
(4023, 'NR', 22, '31.83', 'Fruticées atlantiques des sols pauvres', '', 'Atlantic poor soil thickets', '', 4, 'Niveau 4', 1223, '/67/487/1223/4023', 'true', 'Thickets of Rubus spp., Frangula alnus, Sorbus aucuparia, Corylus avellana, Lonicera periclymenum, Cytisus scoparius, characteristic of forest edges, hedges and (mostly Quercion) woodland recolonization developed on soils relatively poor in nutrients, usually acid, mostly under climates with strong Atlantic influence.', 'Prunetalia p.: Pruno-Rubion fruticosi p.; Frangulo-Rubenion (Rubion subatlanticum; Franguletalia)', 'Fruticées à Rubus spp., Frangula alnus, Sorbus aucuparia, Corylus avellana, Lonicera periclymenum, caractéristiques des lisières forestières, des haies et des bois (principalement Quercion) de recolonisation forestière développées sur des sols relativement pauvres en nutriments, habituellement acides, principalement sous des climats soumis à une forte influence atlantique.'),
(4024, 'NR', 22, '31.84', 'Landes à Genêts', '', 'Broom fields', '', 4, 'Niveau 4', 1223, '/67/487/1223/4024', 'true', 'Formations with an upper stratum dominated by tall brooms.', 'Cytisetalia scopario-striati', 'Formations dont la strate supérieure est dominée par de grands Genêts.'),
(4025, 'NR', 22, '31.88', 'Fruticées à Genévriers communs', '', 'Common juniper scrub', '', 4, 'Niveau 4', 1223, '/67/487/1223/4025', 'true', 'Middle Euroopean lowland and montane communities dominated by Juniperus communis.', '', 'Communautés de plaines et de montagnes dominées par Juniperus communis.'),
(4026, 'NR', 22, '31.89', 'Fourrés caducifoliés sub-méditerranéens sud-occidentaux', '', 'South-western sub-Mediterranean deciduous thickets', '', 4, 'Niveau 4', 1223, '/67/487/1223/4026', 'true', 'Mostly deciduous shrubs and hedges, usually tall and luxuriant, often very rich in lianas, of Mediterranean France, of sub-Mediterranean areas of the Iberian peninsula and of moist stations in the Mediterranean zone of the Iberian peninsula.', 'Pruno-Rubion ulmifolii, Lonicero-Berberidion hispanicae', 'Arbrisseaux et haies pour la plupart caducifoliés, généralement hauts et luxuriants, souvent très riches en lianes, de la France méditerranéenne.'),
(4027, 'NR', 22, '31.85', 'Landes à Ajoncs', '', 'Gorse thickets', '', 4, 'Niveau 4', 1223, '/67/487/1223/4027', 'true', 'Ulex europaeus thickets of the Atlantic domaine (including British Ulex europaeus-Rubus fruticosus scrub p.)', '', 'Fruticées à Ulex europaeus du domaine atlantique'),
(4028, 'NR', 22, '31.86', 'Landes à Fougères', '', 'Bracken fields', '', 4, 'Niveau 4', 1223, '/67/487/1223/4028', 'true', 'Extensive, often closed communities of the large fern Pteridium aquilinum.', '', 'Communautés de grande étendue, souvent fermées, avec la grande fougère Pteridium aquilinum.'),
(4029, 'NR', 22, '31.87', 'Clairières forestières', '', 'Woodland clearings', '', 4, 'Niveau 4', 1223, '/67/487/1223/4029', 'true', 'Communities colonizing medio-European and sub-Mediterranean deciduous or coniferous woodland clearings, clear-felled or burnt areas.', 'Epilobietea angustifolii', 'Communautés colonisant les clairières de forêts caducifoliées ou de conifères médio-européennes et sub-méditerranéennes, les coupes d\'éclaircies ou des zones incendiées.'),
(4030, 'NR', 22, '31.81', 'Fourrés médio-européens sur sol fertile', '', 'Medio-European rich-soil thickets', '', 4, 'Niveau 4', 1223, '/67/487/1223/4030', 'true', 'Thickets of Prunus spinosa, P. mahaleb, Rosa spp., Cornus mas, C. sanguinea, Sorbus aria, Crataegus spp., Lonicera xylosteum, Rhamnus catharticus, R. alpinus, Clematis vitalba, Ligustrum vulgare, Viburnum lantana, V. opulus, Rubus spp., Amelanchier ovalis, Cotoneaster integerrimus, C. nebrodensis, Pyrus pyraster, Malus sylvestris, Euonymus europaeus, Corylus avellana, Ulmus minor, Acer campestre, A. monspessulanum, Carpinus betulus characteristic of forest edges, hedges and (mostly Carpinion or Quercion pubescenti-petraeae) woodland recolonization, developed on soils relatively rich in nutrients, neutral or calcareous.', 'Prunetalia: Pruno-Rubion fruticosip., Berberidion', 'Fourrés de Prunus spinosa, P. mahaleb, Rosa spp., Cornus mas, C. sanguinea, Sorbus aria, Crataegus spp., Lonicera xylosteum, Rhamnus catharticus, R. alpinus, Clematis vitalba, Ligustrum vulgare, Viburnum lantana, V. opulus, Rubus spp., Amelanchier ovalis, Cotoneaster integerrimus, C. nebrodensis, Pyrus pyraster, Malus sylvestris, Euonymus europaeus, Corylus avellana, Ulmus minor, Acer campestre, A. monspessulanum, Carpinus betulus, caractéristiques des lisières forestières, des haies (principalement Carpinion ou Quercion pubescenti-petraeae) et des recolonisations des terrains boisés, développés sur des sols riches en nutriments, neutres ou calcaires.'),
(4031, 'NR', 22, '31.8D', 'Recrûs forestiers caducifoliés', '', 'Deciduous scrub woodland', '', 4, 'Niveau 4', 1223, '/67/487/1223/4031', 'true', 'Early stages of deciduous tall forest regrowth or colonization composed predominantely of young individuals of tall forest species. The type of scrub woodland can be precised by placing at the third, fourth and fifth decimal places of 31.8D the first three digits after the decimal point of 41 that characterize the corresponding tall forest type.', '', 'Premiers stades de régénérations de forêts caducifoliées ou de reconquête, composés principalement de jeunes individus de grandes espèces forestières. Ce type de boisement peut être précisé par l\'emploi de la troisième, la quatrième ou cinquième décimale dans le code 31.8D, les trois premières indications après le point décimal de 41 permettant de caractériser le type forestier correspondant.'),
(4032, 'NR', 22, '31.8E', 'Taillis', '', 'Coppice', '', 4, 'Niveau 4', 1223, '/67/487/1223/4032', 'true', 'Regrowth stages of woodland treated in coppice without standards. The type of coppice can be precised by placing at the third, fourth and fifth decimal places of 31.8E the first three digits after the decimal point of 41 that characterize the corresponding tall forest type.', '', 'Stade de régénération des bois traités en taillis simple. Le type de taillis peut être précisé en plaçant aux 3ème, 4ème et 5ème rangs décimaux de 31.8E les 3 premiers chiffres décimaux de 41, caractéristiques du type forestier correspondant.'),
(4033, 'NR', 22, '31.8F', 'Fourrés mixtes', '', 'Mixed scrub woodland', '', 4, 'Niveau 4', 1223, '/67/487/1223/4033', 'true', 'Early stages of mixed tall forest regrowth or colonization composed predominantely of young individuals of tall forest species. The type of scrub woodland can be precised by placing at the third, fourth and fifth decimal places of 31.8F the first three digits after the decimal point of 41 that characterize the corresponding tall forest type.', '', 'Premiers stades de régénération ou de la colonisation des forêts mélangées marqués par la prédominance de jeunes individus d\'espèces forestières. Pour la cotation, voir ci-dessus 31.8D avec la base 31.8F.'),
(4034, 'NR', 22, '31.8G', 'Prébois de résineux', '', 'Coniferous scrub woodland', '', 4, 'Niveau 4', 1223, '/67/487/1223/4034', 'true', 'Early stages of conifer forest regrowth or colonization composed predominantely of young individuals of tall forest species. The type of scrub woodland can be precised by placing at the third, fourth and fifth decimal places of 31.8G the first three digits after the decimal point of 42 that characterize the corresponding tall forest type.', '', 'Premiers stades de la régénération forestière ou de la colonisation, marqués par la prédominance de jeunes individus d\'espèces forestières. Pour la cotation, voir ci-dessus 31.8D avec la base 31.8G.'),
(4035, 'NR', 22, '32.14', 'Matorral à Pins', '', 'Pine matorral', '', 4, 'Niveau 4', 1224, '/67/488/1224/4035', 'true', 'Mediterranean and sub-Mediterranean sclerophyllous brush and scrub dotted by pines. Mixed dominance can be indicated by combination of codes.', '', 'Fruticées et broussailles sclérophylles et sempervirentes méditerranéennes et sub-méditerranéennes parsemées de Pins. Une dominance mélangée peut être indiquée par la combinaison de codes.'),
(4036, 'NR', 22, '32.15', '', '', 'Arbor-vitae matorral', '', 4, 'Niveau 4', 1224, '/67/488/1224/4036', 'false', 'Relict Tetraclinis articulata forest remnants of the Sierras de Cartagena in the arid Iberian Southeast, with a low, open vegetation of Arisarum vulgare, Periploca laevigata, Chamaerops humilis, Rhamnus oleoides, Asparagus stipularis, A. albus, Lithodora fruticosa, Brachypodium retusum, Lavandula dentata, Thymus glandulosus, Teucrium carthaginense and an admixture of Tetraclinis of varied age, from seedlings to old trees; Pinus halepensis (a man-encouraged competitor), Olea europaea ssp. sylvestris and Quercus ilex may be part of the arborescent layer. This formation is of exceptional bio-geographical and historical importance.', 'Arisaro vulgare-Tetraclinidetum articulatae', 'Pas de description disponible'),
(4037, 'NR', 22, '32.11', 'Matorral à Chênes sempervirents', '', 'Evergreen oak matorral', '', 4, 'Niveau 4', 1224, '/67/488/1224/4037', 'true', 'Meso-Mediterranean arborescent matorral organized around evergreen oaks. Dense, low, coppice-like woods of evergreen oaks.', '', 'Matorrals arborescents méso-méditerranéens organisés autour des Chênes sempervirents. Bois de Chênes sempervirents denses, bas, à aspect de taillis.'),
(4038, 'NR', 22, '32.12', 'Matorral à Oliviers et Lentisques', '', 'Olive and lentisc matorral', '', 4, 'Niveau 4', 1224, '/67/488/1224/4038', 'true', 'Thermo-Mediterranean or thermo-Canarian arborescent matorral with Olea europaea ssp. sylvestris, O. europaea ssp. cerasiformis, Ceratonia siliqua, Pistacia lentiscus, P. atlantica or Myrtus communis (cf. 45.1).', '', 'Matorrals arborescents thermo-méditerranéens composés d\'Olea europaea subsp. sylvestris, Ceratonia siliqua, Pistacia lentiscus ou Myrtus communis (voir 45.1).'),
(4039, 'NR', 22, '32.13', 'Matorral à Genévriers', '', 'Juniper matorral', '', 4, 'Niveau 4', 1224, '/67/488/1224/4039', 'true', 'Mediterranean and sub-Mediterranean evergreen sclerophyllous bush and scrub organized around arborescent junipers. Mixed dominance can be indicated by combination of codes.', '', 'Broussailles et fruticées sclérophylles sempervirentes méditerranéennes et sub-méditerranéennes organisées autour de Genévriers arborescents. Les mélanges de dominance peuvent être indiqués par des combinaisons de codes.'),
(4040, 'NR', 22, '31.8A', 'Fourrés tyrrhéniens subméditerranéens caducifoliés', '', 'Tyrrhenian sub-Mediterranean deciduous thickets', '', 4, 'Niveau 4', 1223, '/67/487/1223/4040', 'true', 'Formations of peninsular Italy, Sicily, Sardinia and Corsica.', '', 'Formations de la péninsule italienne, de Sicile, Sardaigne et Corse.'),
(4041, 'NR', 22, '31.8B', 'Fourrés caducifoliés sub-méditerranéens sud-orientaux', '', 'South-eastern sub-Mediterranean deciduous thickets (schibljak)', '', 4, 'Niveau 4', 1223, '/67/487/1223/4041', 'false', 'Deciduous pre- and post-forest formations, forest edges, hedges and woodland recolonization of the Quercion frainetto and Ostryo-Carpinion zones of the Balkan peninsula, with very local irradiations in central Europe, extreme northeastern Italy and the Aegean.', 'Prunion fruticosae', 'Formations caducifoliées pré- et post-forestières, recolonisation en bord de forêts (manteaux), en haies et en bois de la zone du Quercion frainetto et Ostryo-Carpinion ... ; sans doute non présents en France.'),
(4042, 'NR', 22, '31.8C', 'Fourrés de Noisetiers', '', 'Hazel thickets', '', 4, 'Niveau 4', 1223, '/67/487/1223/4042', 'true', 'Thickets or brush, often very extensive, composed exclusively or predominantly of Corylus spp., a frequent facies of 31.81, 31.83, 31.89, 31.8A, and 31.8B.', '', 'Fourrés ou taillis, souvent très étendus, composés exclusivement, ou montrant une prédominance absolue, de Corylus avellana, faciès fréquents de 31.81, 31.83, 31.89, 31.8A et 31.8B.'),
(4043, 'NR', 22, '32.25', '', '', 'Pre-desert scrub', '', 4, 'Niveau 4', 1225, '/67/488/1225/4043', 'false', 'Shrub formations constituting, with the halo-nitrophilous scrubs (15.724) and the localized gypsum scrubs (15.93), much of the natural and semi-natural vegetation of the arid zone of southeastern Spain (Almeria, Murcia, Alicante), a highly distinctive region of unique climatological, biological and landscape character within Europe, extremely rich in African and endemic species. Several of the most remarkable formations remain in only a few undisturbed localities and are gravely at risk. Outposts of these communities exist in Sicily, the Egadi islands and Pantelleria.', 'Periplocion angustifoliae, Anthyllidetalia terniflorae', 'Pas de description disponible'),
(4044, 'NR', 22, '32.22', 'Formations à Euphorbes', '', 'Tree-spurge formations', '', 4, 'Niveau 4', 1225, '/67/488/1225/4044', 'true', 'Stands of Euphorbia dendroides, remarkable tertiary relict of Macaronesian origin; they occur as a facies of the thermo-Mediterranean brushes of the Balearics, Corsica, Sardinia, Sicily, Islas Eolie, Egadi, Pelagi, Pantelleria, Crete, and, very locally, of those of the coasts of northern Catalonia, southeastern France, peninsular Italy and its islands, central Greece, notably on slopes facing the gulf of Corinth, the Peloponnese and the Aegean archipelagoes. Particularly extensive and robust stands occur in Sicily, Sardinia and Crete where they may extend to relatively high altitudes.', '', 'Stations à Euphorbia dendroides, remarquable relique tertiaire d\'origine Macaronésienne ; elles sont présentes en tant que faciès des fruticées thermo-méditerranéennes de Corse, et très localement des côtes nord de Catalogne, du sud-est de la France.'),
(4045, 'NR', 22, '32.23', 'Garrigues à Ampelodesmos mauritanica', '', 'Diss-dominated garrigues', '', 4, 'Niveau 4', 1225, '/67/488/1225/4045', 'true', 'Garrigues invaded and dominated by the high tussocks of Ampelodesmos mauritanica; typically thermo-Mediterranean, they also occur extensively in the meso-Mediterranean zone. They are most prevalent on the Tyrrhenian coast of central and southern Italy and in Sicily.', '', 'Garrigues envahies et dominées par de grandes touffes d\'Ampelodesmos mauritanica ; quoique typiquement thermoméditerranéennes, elles sont aussi très répandues dans la région mésoméditerranéenne.'),
(4046, 'NR', 22, '32.24', 'Fruticée à Palmier nain', '', 'Palmetto brush', '', 4, 'Niveau 4', 1225, '/67/488/1225/4046', 'true', 'Chamaerops humilis -dominated formations; other thermo-Mediterranean brushes or garrigues rich in the physiognomically important palmetto can be identified by a combination of this code and that of the other appropriate subdivision of 32.2. Palmetto brushes are best represented in the coastal areas of southwestern, southern and eastern Iberia, the Balearics, Sicily and its satellite islands, with more sporadic occurrences in the Guadalquivir basin, Sardinia, and the Tyrrhenian coasts and islands of peninsular Italy.', '', 'Formations dominées par Chamaerops humilis ; d\'autres fruticées ou garrigues thermoméditerranéennes où le Palmier nain est physionomiquement important peuvent être notées par une combinaison de ce code et d\'un autre code approprié d\'une subdivision de 32.2. Les fruticées à Palmier nain sont le mieux représentées dans les régions côtières de l\'Ibérie sud‑occidentale, méridionale et orientale, des Baléares, de la Sicile et de ses îles satellites, avec une présence plus sporadique dans le bassin du Guadalquivir, en Sardaigne, et sur les côtes et les îles tyrrhéniennes de l\'Italie péninsulaire.'),
(4047, 'NR', 22, '32.16', 'Matorral arborescent à chênes caducifoliés', '', 'Deciduous oak matorral', '', 4, 'Niveau 4', 1224, '/67/488/1224/4047', 'true', 'Formations dominated by semi-deciduous or deciduous oaks.', '', 'Formations dominées par des chênes caducifoliés.'),
(4048, 'NR', 22, '32.17', '', '', 'Arid zone matorral', '', 4, 'Niveau 4', 1224, '/67/488/1224/4048', 'false', 'Pre-desert brush of Periploca laevigata, Lycium intricatum, Asparagus stipularis, A. albus, Withania frutescens (32.25) with tall Ziziphus lotus, confined to the arid Iberian Southeast.', 'Ziziphetum loti p.', 'Pas de description disponible'),
(4049, 'NR', 22, '32.18', 'Matorral à Lauriers', '', 'Laurel matorral', '', 4, 'Niveau 4', 1224, '/67/488/1224/4049', 'true', 'Humid arborescent matorral with tall laurel (Laurus nobilis) developed locally in Sardinia, Sicily, Campania, in particular.', '', 'Matorral humide arborescent à grands Lauriers (Laurus nobilis) à rechercher en France.'),
(4050, 'NR', 22, '32.19', '', '', 'Cypress matorral', '', 4, 'Niveau 4', 1224, '/67/488/1224/4050', 'false', 'Maquis dominated by native (in the Aegean; cf. 42.A1) or planted cypress (Cupressus).', '', 'Pas de description disponible'),
(4051, 'NR', 22, '32.1A', '', '', 'Zelkova matorral', '', 4, 'Niveau 4', 1224, '/67/488/1224/4051', 'false', 'Formations of the mountains of Crete, for the most part hedgehog-heaths, dominated by sparse to moderately closed stands of Zelkova abelicea, a rare, declining Tertiary relict of Pontic affinities, often associated with Acer sempervirens.', 'Zelkovo-Aceretum sempervirentis, Vincetoxico-Zelkovetum abeliceae', 'Pas de description disponible'),
(4052, 'NR', 22, '32.21', 'Fruticées, fourrés et landes-garrigues thermo-méditerranéennes', '', 'Thermo-Mediterranean brushes, thickets and heath-garrigues', '', 4, 'Niveau 4', 1225, '/67/488/1225/4052', 'true', 'Lentisc-dominated or lentisc-rich brushes and related formations with Olea europaea ssp. sylvestris, Pistacia lentiscus, Rhamnus alaternus, R. lycioides sspp. lycioides, oleoides, velutinus, graecus, Myrtus communis, Rubia peregrina, R. tenuifolia, Thymus capitatus, Prasium majus, Asparagus stipularis, A. acutifolius, A. albus, A. aphyllus, Cneorum tricoccon, Daphne gnidium, Phillyrea angustifolia, P. latifolia, Osyris quadripartita, O. alba, Bupleurum fruticosum, B. gibraltaricum, Ephedra fragilis, Chamaerops humilis, various oaks (Quercus ilex, Q. rotundifolia, Q. suber, Q. coccifera; Q. fruticosa), Sarcopoterium spinosum, Calicotome villosa, C. spinosa, widespread in the thermo-Mediterranean zone of the Iberian peninsula (except the arid Iberian Southeast: 32.25), of the Balearics, Corsica, Sardinia and Sicily, of continental France and Italy, of peninsular and archipelagic Greece. A few extremely distinctive habitats formed by facies of these formations, distributed throughout large portions of their range, are separated under 32.22, 32.23 and 32.24. Other characteristic habitats are listed below as subdivisions of 32.21.', 'Oleo-Ceratonion, Asparago-Rhamnion, Ceratonio-Rhamnion, Juniperion lyciae p., Rhamno-Quercion cocciferae p.', 'Fruticées dominées ou riches en Lentisques et formations liées avec Olea europaea subsp. sylvestris, Pistacia lentiscus, Rhamnus alaternus, R. lycioides subsp. lycioides, Myrtus communis, Rubia peregrina, Thymus capitatus, Prasium majus, Asparagus acutifolius, A. albus, Cneorum tricoccon, Daphne gnidium, Phillyrea angustifolia, P. latifolia, Osyris alba, Bupleurum fruticosum, Chamaerops humilis, différents Chênes (Quercus ilex, Q. suber, Q. coccifera; Q. fruticosa), Sarcopoterium spinosum, Calicotome villosa, C. spinosa, répandues dans la zone thermo-méditerranéenne de Corse et de la France continentale. Quelques habitats extrêmement distincts formés par des faciès de ces formations, répandus dans de grandes parties de leur aire de distribution, sont cités sous 32.22, 32.23 et 32.24. D\'autres habitats caractéristiques sont catalogués ci-dessous comme des subdivisions de 32.21.'),
(4053, 'NR', 22, '32.27', 'Landes à ajoncs méditerranéens', '', 'Mediterranean gorse-heaths', '', 4, 'Niveau 4', 1225, '/67/488/1225/4053', 'true', 'Western Mediterranean formations, for the most part limited to the lower meso-Mediterranean and thermo-Mediterranean zones of the western Iberian peninsula, dominated by gorse (Ulex spp., Stauracanthus spp.) of thermo-Mediterranean affinities, or by the spiny, globular broom Genista hirsuta, accompanied by a cortège of plants characteristic of the meso- and thermo-Mediterranean cistus maquis (32.33), thermo-Mediterranean brushes (32.21) or, occasionally, meso-Mediterranean garrigues (32.4). Other thermo-Mediterranean gorse formations will be found among the more specialized extreme southern Iberian endemic communities listed under 32.25, 32.28, 32.29, 32.2A, 32.2B and 32.2C.', 'Ulici argentei-Cistion ladaniferi p. i.a.', 'Formations ouest-méditerranéennes, limitées surtout aux étages mésoméditerranéen inférieur et thermo-méditerranéen, dominées par des ajoncs, accompagnés par un cortège de plantes caractéristiques des garrigues méso-méditerranéennes.'),
(4054, 'NR', 22, '32.31', 'Maquis hauts', '', 'High maquis', '', 4, 'Niveau 4', 1226, '/67/488/1226/4054', 'true', 'Highest formations, with a tall stratum of Erica arborea, Arbutus unedo and Quercus spp. but no or few emergent oaks, in contrast to 32.1.', '', 'Formations les plus hautes, pourvues d\'une strate élevée à Erica arborea, Arbutus unedo et Quercus spp., et d\'où émergent ou non un très petit nombre de Chênes, contrairement à 32.1.'),
(4055, 'NR', 22, '32.28', '', '', 'Iberian thermo-Mediterranean garrigues', '', 4, 'Niveau 4', 1225, '/67/488/1225/4055', 'false', 'Mostly calcicolous, open garrigues of the extreme south of the Iberian peninsula characterized by the abundance of Phlomis purpurea ssp. purpurea, Ulex parviflorus ssp. willkommii, Genista umbellata ssp. equisetiformis, Thymus eryanthus, Thymus capitatus, Micromeria graeca, Teucrium polium, Calicotome villosa, Asperula hirsuta.', 'Phlomidetalia purpureae', 'Pas de description disponible'),
(4056, 'NR', 22, '32.29', '', '', 'Gibraltar Stauracanthus gorse-heaths', '', 4, 'Niveau 4', 1225, '/67/488/1225/4056', 'false', 'Highly distinctive formations, dominated by the endemic gorse Stauracanthus boivinii, limited to a few locations with siliceous, oligotrophic soils and high precipitation of the thermo- and lower meso-Mediterranean zone of the vicinity of the Straits of Gibraltar.', 'Stauracanthion boivinii', 'Pas de description disponible'),
(4057, 'NR', 22, '32.2A', '', '', 'South-western Iberian xero-psammitic brushes', '', 4, 'Niveau 4', 1225, '/67/488/1225/4057', 'false', 'Open brushes formed by Stauracanthus genistoides ssp. genistoides, Halimium halimifolium, H. commutatum and Cistus bourgaeanus, highly adapted to the extreme aridity and oligotrophy of fossil dunes and other deep, fixed sands with very low water table of the coastal areas of the south-western Iberian peninsula.', 'Stauracantho genistoidis-Halimion halimifolii', 'Pas de description disponible'),
(4058, 'NR', 22, '32.2B', '', '', 'Cabo de São Vicente brushes', '', 4, 'Niveau 4', 1225, '/67/488/1225/4058', 'false', 'Low brush and garrigue formations of the dolomitic tableland, karsts, sands and terra-rosas of the vicinity of Cape San Vicente, with dwarf Juniperus phoenicea ssp. lycia, Cistus palhinhae, Ulex argenteus ssp. erinaceus, rich in endemics.', 'Junipero-Cistetum palhinhae, Asparago-Rhamnetum oleoidis juniperetosum lyciae i.a.', 'Pas de description disponible'),
(4059, 'NR', 22, '32.2C', '', '', 'Thermo-Mediterranean heaths', '', 4, 'Niveau 4', 1225, '/67/488/1225/4059', 'false', 'Closed formations of heather, gorse and halimium constituting the extensive monte negro of the Coto Doñana; alternating with the xerophile monte blanco (32.2A1), they occupy deep, sandy, oligotrophic soils with a water table close to the surface; their composition includes an admixture of thermo-Mediterranean and Atlantic heath species together with local endemics. Particularly characteristic in the Guadalquivir area, they are locally represented north to the Sado-Tago river area of coastal Portugal.', 'Ericion umbellatae: Erico scopariae-Ulicetum australis; Genistion micrantho-anglicae: Erico ciliaris-Ulicetum lusitanici', 'Pas de description disponible'),
(4060, 'NR', 22, '32.26', 'Rétamaies thermoméditerranéennes', '', 'Thermo-Mediterranean broom fields (retamares)', '', 4, 'Niveau 4', 1225, '/67/488/1225/4060', 'true', 'Formations dominated by retamas (Lygos spp.) or by large, non-spiny thermo-Mediterranean brooms of genera Cytisus and Genista.', '', 'Formations dominées par des Rétams (Lygos spp.) ou par les grand Genêts non épineux thermoméditerranéens des genres Cytisus et Genista.'),
(4061, 'NR', 22, '32.35', 'Maquis bas à Cistus-Lavandula stoechas', '', 'Low Cistus-Lavandula stoechas maquis', '', 4, 'Niveau 4', 1226, '/67/488/1226/4061', 'true', 'Usually varied west-Mediterranean maquis rich in Lavandula stoechas, accompanied by Cistus spp., Erica spp., brooms (Genista spp., Cytisus spp. i.a.). The subspecies of L. stoechas can be used to characterize regional groups of communities otherwise differing by the assembly of accompanying species. In all cases, pure or almost pure Lavandula formations can be identified by addition of digit 1 in the fourth decimal place, digit 2 denoting the varied formations.', '', 'Habituellement divers maquis ouest-méditerranéens riches en Lavandula stoechas, accompagnés de Cistus spp., Erica spp., genêts (Genista spp., Cytisus spp. i.a.). Les sous-espèces de L. stoechas peuvent être utilisées pour caractériser les groupements régionaux qui ne diffèrent par ailleurs que par leurs espèces accompagnatrices. Dans tous les cas, les formations pures ou quasiment pures de Lavandula peuvent être identifiées en ajoutant le chiffre 1 à la place de la quatrième décimale, le chiffre 2 identifiant la formation variée.'),
(4062, 'NR', 22, '32.36', 'Maquis bas épars', '', 'Low sparse maquis', '', 4, 'Niveau 4', 1226, '/67/488/1226/4062', 'true', 'Sparse, low silicicolous formations of Helichrysum spp., Cistus spp., Erica spp. physiognomically similar to calcicolous garrigues.', '', 'Formations basses, ouvertes, silicicoles d\'Helichrysum sp., Cistus sp., Erica sp. physionomiquement similaires aux garrigues calcaires.'),
(4063, 'NR', 22, '32.37', 'Maquis dominés par des genêts', '', 'Broom-dominated maquis', '', 4, 'Niveau 4', 1226, '/67/488/1226/4063', 'true', 'Low, west-Mediterranean maquis dominated by leguminous shrubs (Cytisus, Teline, Genista, Adenocarpus, Calicotome spinosa).', '', 'Maquis bas, ouest-méditerranéens dominés par des arbustes de la famille des Fabacées (Cytisus, Genista, Adenocarpus, Calicotome spinosa).'),
(4064, 'NR', 22, '32.46', 'Garrigues à lavande', '', 'Lavender garrigues', '', 4, 'Niveau 4', 1227, '/67/488/1227/4064', 'true', 'Meso-, or sometimes thermo-, Mediterranean garrigues rich in calciphile Lavandula latifolia or, occasionally, L. angustifolia; almost pure fields of L. latifolia may form, in particular, as a facies of calcareous grasslands.', '', 'Garrigues méso-, et quelquefois thermo-, méditerranéennes riches en Lavandula latifolia calciphile ou, occasionnellement, L. angustifolia ; des peuplements quasi purs de L. latifolia peuvent se former, en particulier, comme faciès des pelouses calcaires.'),
(4065, 'NR', 22, '32.47', 'Garrigues à thym, sauge, germandrée et autres labiées', '', 'Thyme, sage, germander and other labiate garrigues', '', 4, 'Niveau 4', 1227, '/67/488/1227/4065', 'true', 'Characteristically very low, open garrigues of which the main components are labiate shrubs of Thymus (e.g. T. piperella, T. funkii, T. zygis, T. vulgaris, T. capitatus, T. mastigophorus), Salvia (e.g. S. lavandulifolia, S. officinalis), Teucrium (e.g. T. polium, T. marum, T. subspinosum, T. aragonense, T. gnaphalodes, T. chamaedrys, T. montanum), Sideritis (e.g. S. scordioides, S. incana), Micromeria (e.g. M. fruticosa, M. graeca, M. juliana), Satureja (e.g. S. montana), Stachys (e.g. S. glutinosa), Nepeta (e.g. N. foliosa) or other genera (except Lavandula and Rosmarinus).', '', 'Garrigues typiquement très basses et ouvertes, dont les constituants principaux sont des arbrisseaux de la famille des Lamiacées : Thymus (par ex. T. piperella, T. vulgaris, T. capitatus), Salvia (par ex. S. lavandulifolia, S. officinalis), Teucrium (par ex. T. polium, T. marum, T. chamaedrys, T. montanum), Sideritis (par ex. S. scordioides), Micromeria (par ex. M. graeca, M. juliana), Satureja (par ex. S. montana), Stachys (par ex. S. glutinosa), ou d\'autres genres (exceptés Lavandula et Rosmarinus).'),
(4066, 'NR', 22, '32.48', 'Garrigues à Genista', '', 'Genista garrigues', '', 4, 'Niveau 4', 1227, '/67/488/1227/4066', 'true', 'Formations characterized by the abundance of small, spiny brooms such as Genista scorpius, G. hispanica, G. corsica, G. lucida.', '', 'Formations caractérisées par l\'abondance de petits genêts épineux tels que Genista scorpius, G. hispanica, G. corsica.'),
(4067, 'NR', 22, '32.49', 'Garrigues à Calicotome', '', 'Calicotome garrigues', '', 4, 'Niveau 4', 1227, '/67/488/1227/4067', 'true', 'Meso-Mediterranean formations dominated by Calicotome spinosa.', '', 'Formations mésoméditerranéennes dominées par Calicotome spinosa.'),
(4068, 'NR', 22, '32.4A', 'Garrigues à Composées', '', 'Composite garrigues', '', 4, 'Niveau 4', 1227, '/67/488/1227/4068', 'true', 'Meso-Mediterranean garrigue formations dominated by members of various genera of the family Asteraceae.', '', 'Formations méso-méditerranéennes de garrigue dominées par les divers genres de la famille des Astéracées.'),
(4069, 'NR', 22, '32.41', 'Garrigues à chênes kermès', '', 'Kermes oak garrigues', '', 4, 'Niveau 4', 1227, '/67/488/1227/4069', 'true', 'Formations, usually relatively closed and tall, dominated by Quercus coccifera with no, or little, Pistacia lentiscus or other thermo-Mediterranean shrubs, very widespread in the meso-Mediterranean zone of the Iberian peninsula and southern France.', '', 'Formations, habituellement relativement fermées et élevées, dominées par Quercus coccifera avec peu ou pas de Pistacia lentiscus ou d\'autres arbustes thermo-méditerranéens, très largement répandues dans la zone méso-méditerranéenne du sud de la France.'),
(4070, 'NR', 22, '32.42', 'Garrigues à romarin', '', 'Rosemary garrigues', '', 4, 'Niveau 4', 1227, '/67/488/1227/4070', 'true', 'Formations, usually relatively tall, dominated by Rosmarinus officinalis.', '', 'Formations, habituellement relativement élevées, dominées par Rosmarinus officinalis.'),
(4071, 'NR', 22, '32.43', 'Garrigues à cistes', '', 'Cistus garrigues', '', 4, 'Niveau 4', 1227, '/67/488/1227/4071', 'true', 'Formations, mostly meso-Mediterranean, but often also thermo- or supra-Mediterranean, dominated by the low, calciphilous Cistus albidus or C. clusii, or occasionally by indifferent species, usually accompanied by a more varied flora than that of the silicicolous cistus maquis, though sometimes capable of forming dense cistus fields. These can be identified by use of digit 1 in the fourth decimal place, digit 2 being reserved for more varied formations.', '', 'Formations, principalement méso-méditerranéennes, mais souvent aussi thermo- ou supraméditerranéennes, dominées par les petits Cistes calciphiles Cistus albidus, ou occasionnellement par des espèces indifférentes, habituellement accompagnées par une flore plus variée que celle des maquis silicicoles à cistes, pourtant capables quelquefois de former des peuplements denses de cistes. Ils peuvent être identifiés en utilisant le chiffre 1 à la place de la quatrième décimale, le chiffre 2 étant réservé pour les formations plus variées.'),
(4072, 'NR', 22, '32.44', 'Garrigues à euphorbes', '', 'Spurge garrigues', '', 4, 'Niveau 4', 1227, '/67/488/1227/4072', 'true', 'Formations dominated by bushy or robust perennial Euphorbia species.', '', 'Formations dominées par des espèces d\'Euphorbia pérennes, robustes ou buissonnantes.'),
(4073, 'NR', 22, '32.45', 'Garrigues à genévrier oxycèdre', '', 'Prostrate juniper garrigues', '', 4, 'Niveau 4', 1227, '/67/488/1227/4073', 'true', 'Meso-Mediterranean garrigues dominated by Juniperus oxycedrus or other low, shrubby junipers.', '', 'Garrigues méso-méditerranéennes dominées par Juniperus oxycedrus ou d\'autres petits genèvriers arbustifs.'),
(4074, 'NR', 22, '32.32', 'Maquis bas à Ericacées', '', 'Low ericaceous maquis', '', 4, 'Niveau 4', 1226, '/67/488/1226/4074', 'true', 'Lower (usually less than one metre) maquis rich in Calluna vulgaris, Erica scoparia, E. cinerea or sometimes low E. arborea, often accompanied by Cistus spp., Lavandula stoechas and various brooms.', 'Erico scopariae-Lavandulo stoechidis, Ampelodesmo-Ericetum scopariae, Erico scopariae-Cistetum populifolii i.a.', 'Maquis plus bas (généralement inférieur à 1 mètre), riche en Calluna vulgaris, Erica scoparia, E. cinerea et parfois E. arborea bas, souvent accompagnés de Cistus spp., Lavandula stoechas et divers Genêts.'),
(4075, 'NR', 22, '32.33', 'Maquis hauts à Cistus', '', 'Tall cistus maquis', '', 4, 'Niveau 4', 1226, '/67/488/1226/4075', 'true', 'Meso-, thermo- and occasionally supra-Mediterranean formations of Iberia and southern France, in which the tall, large-flowered Cistus ladanifer is prominent. Included are more or less dense, homogeneous fields of C. ladanifer, which can be identified by addition of digit 1 in the fourth decimal place of any of the subdivisions below, and more varied formations dominated by tall clumps of C. ladanifer, which can be identified by addition of digit 2 in the fourth decimal place of these subdivisions.', '', 'Formations méso-, thermo- et occasionellement supra-méditerranéennes du sud de la France, dans lesquelles Cistus ladanifer, ciste élevé, à grandes fleurs, est prééminent. Sont inclus les peuplements de C. ladanifer homogènes et plus ou moins denses, qui peuvent être identifiés par l\'addition du chiffre 1 à la quatrième décimale des subdivisions ci-dessous, et les formations plus variées dominées par de grandes touffes de C. ladanifer, qui peuvent être identifiées par l\'addition du chiffre 2 à la quatrième décimale de ces subdivisions.');
INSERT INTO `corine` (`CD_HAB`, `FG_VALIDITE`, `CD_TYPO`, `LB_CODE`, `LB_HAB_FR`, `LB_HAB_FR_COMPLET`, `LB_HAB_EN`, `LB_AUTEUR`, `NIVEAU`, `LB_NIVEAU`, `CD_HAB_SUP`, `PATH_CD_HAB`, `FRANCE`, `LB_DESCRIPTION`, `CRSP_PHYTO_CB91`, `DESCRIPTIF_CB97_FR`) VALUES
(4076, 'NR', 22, '32.34', 'Maquis bas à Cistes (Cistus sp. pl.)', '', 'Low cistus maquis', '', 4, 'Niveau 4', 1226, '/67/488/1226/4076', 'true', 'Western Mediterranean formations of small or medium Cistus spp., most characteristic of the siliceous soils of the meso-Mediterranean zone, but also widely occurring in the thermo-Mediterranean zone and in the siliceous supra-Mediterranean zone. Formations of mostly calciphile Cistus species (e.g. C. albidus, C. clusii) and of indifferent species accompanied by strongly calciphile floras are listed under 32.4; formations of entirely thermo-Mediterranean species (e.g. Cistus bourgaeanus, C. palhinhae, C. heterophyllus) and of widespread species associated with co-dominant thermo-Mediterranean species have been listed under 32.2. Included here are all other formations; homogeneous, more or less dense cistus fields can be identified by addition of digit 1 in the fourth decimal place of the subdivisions below, more varied maquis of which the relevant cistus species is an essential element, by addition of digit 2 in the fourth decimal place of these subdivisions.', '', 'Formations de la Méditerranée occidentale à Cistus spp. petits ou moyens, principalement caractéristiques des sols siliceux de l\'étage méso-méditerranéen, qui peuvent aussi se trouver largement dans l\'étage thermo-méditerranéen et dans l\'étage supra-méditerranéen sur silice. Les formations composées d\'espèces de Cistus calciphiles principalement (par ex. C. albidus) et d\'espèces indifférentes accompagnées par une flore calciphile forte sont listées sous 32.4 ; les formations entièrement constituées d\'espèces thermo-méditerranéennes, et d\'espèces largement répandues associées avec des espèces thermo-méditerranéennes codominantes, ont été listées en 32.2. Ici sont incluses toutes les autres formations ; des peuplements homogènes, plus ou moins denses de Cistus peuvent être identifiés en ajoutant le chiffre 1 à la place de la quatrième décimale des subdivisions suivantes, les maquis plus variés dans lesquels les espèces pertinentes de ciste concernées forment un élément essentiel, peuvent être identifiés par addition du chiffre 2 à la quatrième décimale de ces subdivisions.'),
(4077, 'NR', 22, '32.57', '', '', 'Eastern sage and other labiates garrigues', '', 4, 'Niveau 4', 1233, '/67/488/1233/4077', 'false', 'Garrigues of which the main components are labiate shrubs or robust perennials (except Lavandula and Rosmarinus).', '', 'Pas de description disponible'),
(4078, 'NR', 22, '32.58', 'Garrigues à épine du Christ', '', 'Christ\'s thorn garrigues', '', 4, 'Niveau 4', 1233, '/67/488/1233/4078', 'true', 'Garrigues dominated by Paliurus spina-christi.', '', 'Garrigues dominées par Paliurus spina christi introduit.'),
(4079, 'NR', 22, '32.59', '', '', 'Eastern broom garrigues ', '', 4, 'Niveau 4', 1233, '/67/488/1233/4079', 'false', 'Formations characterized by the abundance of broom-like shrubs of genera Genista, Chamaecytisus, Teline or others.', '', 'Pas de description disponible'),
(4080, 'NR', 22, '32.5A', '', '', 'Ebenus brushes', '', 4, 'Niveau 4', 1233, '/67/488/1233/4080', 'false', 'Formations of Crete dominated by Ebenus cretica.', '', 'Pas de description disponible'),
(4081, 'NR', 22, '32.5B', '', '', 'Eastern Helichrysum and other composite garrigues', '', 4, 'Niveau 4', 1233, '/67/488/1233/4081', 'false', 'Usually low, open garrigues formed by dwarf, shrubby composites of genera Helichrysum, Phagnalon (P. graecum), Scorzonera.', '', 'Pas de description disponible'),
(4082, 'NR', 22, '32.5C', '', '', 'Eastern Erica garrigues', '', 4, 'Niveau 4', 1233, '/67/488/1233/4082', 'false', 'Meso-Mediterranean formations dominated by the heather Erica manipuliflora.', '', 'Pas de description disponible'),
(4083, 'NR', 22, '32.5D', '', '', 'Andrachne garrigues', '', 4, 'Niveau 4', 1233, '/67/488/1233/4083', 'false', 'Garrigues characterized by richness in low bushes of Arbutus andrachne.', '', 'Pas de description disponible'),
(4084, 'NR', 22, '32.5E', '', '', 'Eastern Globularia garrigues', '', 4, 'Niveau 4', 1233, '/67/488/1233/4084', 'false', 'Formations dominated by Globularia alypum.', '', 'Pas de description disponible'),
(4085, 'NR', 22, '32.5F', '', '', 'Eastern Helianthemum and Fumana garrigues', '', 4, 'Niveau 4', 1233, '/67/488/1233/4085', 'false', 'Formations dominated by small or dwarf shrubs of the genera Helianthemum or Fumana.', '', 'Pas de description disponible'),
(4086, 'NR', 22, '32.5G', '', '', 'Eastern Thymelaea garrigues', '', 4, 'Niveau 4', 1233, '/67/488/1233/4086', 'false', 'Formations rich in shrubs of genus Thymelaea (e.g. T. tartonraira).', '', 'Pas de description disponible'),
(4087, 'NR', 22, '32.5H', '', '', 'Eastern Bupleurum garrigues', '', 4, 'Niveau 4', 1233, '/67/488/1233/4087', 'false', 'Often tall, sometimes very tall, dense formations dominated by Bupleurum fruticosum.', '', 'Pas de description disponible'),
(4088, 'NR', 22, '32.84', '', '', 'Canarian Launaea scrub', '', 4, 'Niveau 4', 1232, '/67/488/1232/4088', 'false', 'Steppic grasslands of the Canary Islands invaded and dominated by Launaea arborescens.', '', 'Pas de description disponible'),
(4089, 'NR', 22, '32.85', '', '', 'Madeiran spurge formations', '', 4, 'Niveau 4', 1232, '/67/488/1232/4089', 'false', 'Shrubby formations of the low slopes (0-350 m) of Madeira with Euphorbia piscatoria, Globularia salicina, Phyllis nobla, Myrtus communis, Chamaemeles coriacea, Rubus ulmifolius, Olea europea ssp. maderensis, Bencomia codata, Echium nervosum.', 'Aeonio-Lytanthion p.', 'Pas de description disponible'),
(4090, 'NR', 22, '32.86', '', '', 'Madeiran saxicolous formations', '', 4, 'Niveau 4', 1232, '/67/488/1232/4090', 'false', 'Formations colonizing rocks and volcanic ash deposits in the xerophytic zone of Madeira with Aeonium glutinosum, Plantago arborescens ssp. maderensis, Helichrysum spp., Sonchus ustulatus, Phagnalon spp. Tolpis fruticosa, Sedum brissemoretii, Davallia canariensis or Musschia aurea and Aeonium glandulosum.', '', 'Pas de description disponible'),
(4091, 'NR', 22, '32.87', '', '', 'Desertas dry scrub', '', 4, 'Niveau 4', 1232, '/67/488/1232/4091', 'false', 'Formation with Madeiran endemics Artemisia argentea, Calandula maderensis, Andryala glandulosa, Jasminum odoratissimum and introduced plants.', '', 'Pas de description disponible'),
(4092, 'NR', 22, '32.61', 'Garrigues à Lavande vraie', '', 'True-lavender garrigues', '', 4, 'Niveau 4', 1230, '/67/488/1230/4092', 'true', 'Montane formations dominated by Lavandula angustifolia (\"L. vera\") with Genista cinerea ssp. cinerea, Buxus sempervirens (both sometimes co-dominant), Astragalus purpureus, Onobrychis supina, Satureja montana, Catananche caerulea, Aphyllanthes monspeliensis, Thymus vulgaris characteristic of great surfaces of the supra-Mediterranean level of southern France.', 'Lavandulo-Astragaletum', 'Formations montagnardes dominées par Lavandula angustifolia (L. vera) avec Genista cinerea subsp. cinerea, Buxus sempervirens (les deux parfois codominants), Astragalus purpureus, Onobrychis supina, Satureja montana, Catananche caerulea, Aphyllanthes monspeliensis, Thymus vulgaris caractéristiques des grandes surfaces de l\'étage supra-méditerranéen du sud de la France.'),
(4093, 'NR', 22, '32.62', 'Garrigues à Genista cinerea', '', 'Genista cinerea garrigues', '', 4, 'Niveau 4', 1230, '/67/488/1230/4093', 'true', 'Supra-Mediterranean garrigues or grasslands of the southwestern Alps, Haute Provence, the southern Central Massif, the Corbières and the eastern Pyrenees dominated by Genista cinerea ssp. cinerea, including the broom-rich facies of the French lavender garrigues and the White Quercy broom-fields.', '', 'Prairies ou garrigues supra-méditerranéennes du sud-ouest des Alpes, de Haute-Provence, du sud du Massif central, des Corbières et des Pyrénées orientales dominées par Genista cinerea subsp. cinerea, comprenant les faciès riches en genêts des garrigues françaises à lavande et des champs de genêts du Quercy Blanc.'),
(4094, 'NR', 22, '32.63', 'Garrigues montagnardes à Thyms', '', 'Montane thyme garrigues', '', 4, 'Niveau 4', 1230, '/67/488/1230/4094', 'true', 'Low formations of the supra-Mediterranean levels of the Iberian Meseta and its surrounding mountains and of northern Spain and southern France, rich in small labiate shrubs of genera Thymus (e.g. T. serpolifolium, T. vulgaris, T. loscosii), Teucrium (e.g. T. aureum, T. aragonense, T. gnaphalodes, T. polium), Salvia (e.g. S. lavandulifolia, S. phlomoides), Satureja (e.g. S. montana), Sideritis (e.g. S. incana), Lavandula (L. angustifolia, L. lanata, L. latifolia), accompanied by leguminous shrubs (e.g. Genista scorpius, G. pilosa, G. pseudopilosa, G. cinerea ssp. speciosa, Coronilla minima) and various grasses (e.g. Stipa spp., Brachypodium spp.). In the north they often have an important, sometimes predominant, grass element and their impoverished shrub component is sometimes reduced to an almost monospecific Thymus formation; southwards, they become progressively more dominated by a richer constellation of shrub species.', 'Aphyllantion p., Lavandulo-Genistion boissieri p.', 'Formations basses de l\'étage supra-méditerranéen du sud de la France, riches en petites Lamiacées buissonnantes des espèces des genres Thymus (par ex. T. vulgaris), Teucrium (par ex. T. aureum, T. polium), Salvia (par ex. S. lavandulifolia, S. phlomoides), Lavalandula (L. angustifolia, L. lanata, L. latifolia), accompagnées de buissons de la famille des Fabacées (par ex. Genista scorpius, G. pilosa, Coronilla minima) et de graminées variées (par ex. Stipa spp., Brachypodium spp.). Au nord, leur élément graminéen est souvent important, quelquefois prédominant, et leur composante arbustive appauvrie est quelquefois réduite à une formation quasi monospécifique à Thymus ; vers le sud, elles évoluent progressivement vers des formations dominées par une constellation plus riche d\'espèces arbustives.'),
(4095, 'NR', 22, '32.64', 'Broussailles supra-méditerranéennes à Buis', '', 'Supra-Mediterranean box scrub', '', 4, 'Niveau 4', 1230, '/67/488/1230/4095', 'true', 'Box thickets of the supra-Mediterranean zone, occurring as facies within several formations of southern France such as French lavender garrigues and supra-Mediterranean steppic grassland complexes, in northeastern Spanish ranges and in isolated stations of the Apennines.', '', 'Fourrés de buis de l\'étage supra-méditerranéen, apparaissant en tant que faciès au sein de nombreuses formations du sud de la France telles que les garrigues à lavande (et des complexes de pelouses steppiques supra-méditerranéennes).'),
(4096, 'NR', 22, '32.65', '', '', 'Italian supra-Mediterranean garrigues', '', 4, 'Niveau 4', 1230, '/67/488/1230/4096', 'false', 'In the supra-Mediterranean level of Italy and the large central Mediterranean islands, the substitution stages of the thermophile deciduous forests are mostly grasslands or shrubby grasslands, hedgehog heaths, deciduous shrubs, semi-maquis or occasionally embryonic garrigues that differ little from those of the meso-Mediterranean level. A few formations, in particular with labiates of genera Thymus, Teucrium, Salvia, Lavandula and others, with Helichrysum spp. or with Euphorbia spp. may warrant separate listing under this heading.', '', 'Pas de description disponible'),
(4097, 'NR', 22, '32.81', '', '', 'Western Canarian spurge communities', '', 4, 'Niveau 4', 1232, '/67/488/1232/4097', 'false', 'Open, varied formations of arid, stony slopes of the lower, 0-700 m, level of the western and central Canarian islands, characterized by the abundance of fleshy-stemmed, aphyllous, or small-leafed species, in particular Euphorbia spp., Senecio kleinia, Periploca laevigata, Cneorum pulverulentum, Messerschmidta fruticosa, Echium giganteum, Convolvulus floridus, Allagopappus dichotomus, Rhamnus crenulata, Rubia fruticosa, Argyranthemum spp., Artemisia canariensis, Sonchus leptocephalus, Asparagus arborescens, Rumex lunaria, Micromeria spp., Paronychia canariensis.', '', 'Pas de description disponible'),
(4098, 'NR', 22, '32.82', '', '', 'Western Canarian saxicolous formations', '', 4, 'Niveau 4', 1232, '/67/488/1232/4098', 'false', 'Formations colonizing hard rock faces, lava flows and ravine walls within the xerophytic zone of the western and central Canary Islands.', '', 'Pas de description disponible'),
(4099, 'NR', 22, '32.83', '', '', 'Eastern Canarian xerophytic communities', '', 4, 'Niveau 4', 1232, '/67/488/1232/4099', 'false', 'Open formations of semi-desertic Fuerteventura and Lanzarote, with high endemism; characteristic of various groupings are Euphorbia obtusifolia, Senecio kleinia, Asparagus pastorianus, Kickxia heterophylla , Echium bonnetii, Caralluma burchardii, the cactiform spurge Euphorbia handiensis, Pulicaria burchardii, P. canariensis, Argyranthemum winteri, Echium handiense, Bupleurum handiense, Sideritis massoniana, Asteriscus sericeus, A. schultzii, Minuartia platiphylla, Reichardia famarae, Aichryson tortuosum, Aeonium lancerottense, A. balsamiferum, Limonium bourgaei, Echium decaisnei ssp. purpuriense, Argyranthemum ochroleucum, Helichrysum gossypium, H. monogynum, Ferula lancerottensis, Sedum lancerottense, Thymus origanoides, Lavandula pinnata, Echium pitardii, Limonium puberulum', '', 'Pas de description disponible'),
(4100, 'NR', 22, '32.4B', 'Garrigues à Erica', '', 'Erica garrigues', '', 4, 'Niveau 4', 1227, '/67/488/1227/4100', 'true', 'Meso-Mediterranean formations dominated by the calciphile heathers Erica multiflora or E. manipuliflora.', '', 'Formations méso-méditerranéennes dominées par la bruyère calciphile Erica multiflora.'),
(4101, 'NR', 22, '32.4C', 'Garrigues à Globularia', '', 'Globularia garrigues', '', 4, 'Niveau 4', 1227, '/67/488/1227/4101', 'true', 'Formations dominated by Globularia alypum.', '', 'Formations dominées par Globularia alypum.'),
(4102, 'NR', 22, '32.4D', 'Garrigues à Helianthemum et Fumana', '', 'Helianthemum and Fumana garrigues', '', 4, 'Niveau 4', 1227, '/67/488/1227/4102', 'true', 'Formations dominated by small or dwarf shrubs of the genera Helianthemum (e.g. H. asperum, H. pilosum, H. oelandicum, H. marifolium, H. cinereum, H. lavandulifolium, H. nummularium, H. caput-felis) or Fumana (e.g. F. ericoides, F. laevipes, F. thymifolia).', '', 'Formations dominées par de petits arbrisseaux parfois nains des espèces des genres Helianthemum (par ex. H. oelandicum, H. marifolium, H. syriacum, H. nummularium) ou Fumana (par ex. F. ericoides, F. laevipes, F. thymifolia).'),
(4103, 'NR', 22, '32.4E', 'Garrigues à grémil', '', 'Gromwell garrigues', '', 4, 'Niveau 4', 1227, '/67/488/1227/4103', 'true', 'Formations dominated by Lithodora fruticosa of Spain and southern France.', '', 'Formations dominées par Lithodora (Lithospermum) fruticosa du sud de la France.'),
(4104, 'NR', 22, '32.4F', 'Garrigues à Thymelaea', '', 'Thymelaea garrigues', '', 4, 'Niveau 4', 1227, '/67/488/1227/4104', 'true', 'Meso-Mediterranean formations rich in shrubs of genus Thymelaea (e.g. T. tinctoria, T. nitida, T. pubescens).', '', 'Formations méso-méditerranéennes riches en arbrisseaux du genre Thymelaea (par ex. T. tinctoria).'),
(4105, 'NR', 22, '32.4G', 'Garrigues à Bupleurum', '', 'Bupleurum garrigues', '', 4, 'Niveau 4', 1227, '/67/488/1227/4105', 'true', 'Often tall, sometimes very tall, dense formations dominated by Bupleurum fruticosum.', '', 'Formations souvent grandes, quelquefois très grandes, denses, dominées par Bupleurum fruticosum.'),
(4106, 'NR', 22, '32.4H', 'Garrigues à Ajonc', '', 'Gorse garrigues', '', 4, 'Niveau 4', 1227, '/67/488/1227/4106', 'true', 'Meso-Mediterranean formations dominated by Ulex parviflorus.', '', 'Formations méso-méditerranéennes dominées par Ulex parviflorus.'),
(4107, 'NR', 22, '32.4I', 'Garrigues à Ononis fruticosa', '', 'Restharrow garrigues', '', 4, 'Niveau 4', 1227, '/67/488/1227/4107', 'true', 'Formations dominated by Ononis fruticosa of Iberia.', '', 'Formations dominées par Ononis fruticosa.'),
(4108, 'NR', 22, '32.4J', 'Garrigues à Anthyllis', '', 'Anthyllis garrigues', '', 4, 'Niveau 4', 1227, '/67/488/1227/4108', 'true', 'Formations of Anthyllis cytisoides.', '', 'Formations à Anthyllis cytisoides'),
(4109, 'NR', 22, '32.4K', '', '', 'Dictamnus garrigues', '', 4, 'Niveau 4', 1227, '/67/488/1227/4109', 'false', 'Formations of Dictamnus albus (D. hispanicus) of stony terrains of eastern Spain.', '', 'Pas de description disponible'),
(4110, 'NR', 22, '32.51', '', '', 'Eastern kermes oak garrigues', '', 4, 'Niveau 4', 1233, '/67/488/1233/4110', 'false', 'Formations, usually relatively closed and tall, dominated by Quercus coccifera with no, or little, Pistacia lentiscus or other thermo-Mediterranean shrubs; kermes oak garrigues are by far the most widespread xerophyllous shrub formations in the eastern meso-Mediterranean zone. They are also well represented in the supra- Mediterranean and thermo-Mediterranean zones. Formations pertaining to the latter, when rich in other, more restrictively thermophile shrubs, have been listed as 32.2193.', '', 'Pas de description disponible'),
(4111, 'NR', 22, '32.52', '', '', 'Eastern rosemary garrigues', '', 4, 'Niveau 4', 1233, '/67/488/1233/4111', 'false', 'Formations, usually relatively tall, dominated by Rosmarinus officinalis.', '', 'Pas de description disponible'),
(4112, 'NR', 22, '32.53', '', '', 'Eastern Cistus garrigues', '', 4, 'Niveau 4', 1233, '/67/488/1233/4112', 'false', 'Formations dominated by or rich in Cistus species. Dense cistus fields can be identified by use of digit 1 in the fourth decimal place, digit 2 being reserved for more varied formations.', '', 'Pas de description disponible'),
(4113, 'NR', 22, '32.54', '', '', 'Eastern spurge garrigues', '', 4, 'Niveau 4', 1233, '/67/488/1233/4113', 'false', 'Formations dominated by bushy or robust perennial Euphorbia species.', '', 'Pas de description disponible'),
(4114, 'NR', 22, '32.55', '', '', 'Eastern prostrate juniper garrigues', '', 4, 'Niveau 4', 1233, '/67/488/1233/4114', 'false', 'Garrigues dominated by low, shrubby Juniperus oxycedrus, J. communis or J. phoenicea.', '', 'Pas de description disponible'),
(4115, 'NR', 22, '32.56', '', '', 'Eastern lavender garrigues', '', 4, 'Niveau 4', 1233, '/67/488/1233/4115', 'false', 'Garrigues rich in Lavandula stoechas or, occasionally, L. angustifolia.', '', 'Pas de description disponible'),
(4116, 'NR', 22, '34.11', 'Pelouses médio-européennes sur débris rocheux', '', 'Middle European rock debris swards', '', 4, 'Niveau 4', 1234, '/67/490/1234/4116', 'true', 'Open lowland and hill formations of sub-oceanic climates, formed mostly by annuals and succulents or semi-succulents on decomposed rock surfaces of edges, ledges or knolls, with calcareous or siliceous soils frequently disturbed by erosion or rabbits. They comprise a great variety of distinct and often very local, isolated communities harbouring many characteristic species, among which numerous rare forms including both relict and evolutionarily recent taxa.', 'Alysso-Sedion albi, Sedo albi-Veronicion dillenii, Sedo-Scleranthion p., Sedion pyrenaici p.', 'Formations ouvertes des plaines et collines en climat sub-océanique, dominées principalement par des plantes annuelles et des plantes succulentes ou semi-succulentes sur les surfaces rocheuses décomposées des arêtes, des corniches ou des proéminences rocheuses aux sols calcaires ou siliceux fréquemment perturbés par l\'érosion ou les lapins. Elles comprennent une grande variété de communautés distinctes et souvent à aire très localisée, abritant de nombreuses espèces caractéristiques, parmi lesquelles de nombreuses formes rares comprenant aussi bien des taxons relictuels que des taxons d\'évolution récente.'),
(4117, 'NR', 22, '34.12', 'Pelouses des sables calcaires', '', 'Calcareous sand swards', '', 4, 'Niveau 4', 1234, '/67/490/1234/4117', 'true', 'Open grasslands of strongly to slightly calcareous inland sands with Helichrysum arenarium, Silene otites, S. chlorantha, Dianthus deltoides, Astragalus arenarius, Onosma arenaria, Jurinea cyanoides, Koeleria glauca, Festuca psammophila, F. polesica, F. duvalii and the Brandenburg endemic Stipa borysthenica ssp. germanica, sometimes interspersed with annual formations with Cerastium semidecandrum, Vicia lathyroides, Silene conica, Phleum arenarium, Petrorhagia prolifera. Dunal formations can be characterized by conjunction of this code with those of 64.', 'Koelerion glaucae, Sileno conicae-Cerastion semidecandri (Sedo-Cerastion) p.', 'Prairies découvertes sur des sables situés à l\'intérieur des terres légèrement à fortement calcaires avec Helichrysum arenarium, Silene otites, Dianthus deltoides, Onosma arenaria, Koeleria glauca, F. duvalii, parfois parsemées de formations annuelles avec Cerastium semidecandrum, Vicia lathyroides, Silene conica, Phleum arenarium, Petrorhagia prolifera. Les formations dunaires peuvent être caractérisées par la juxtaposition de ce code avec ceux de 64.'),
(4118, 'NR', 22, '34.32', 'Pelouses calcaires sub-atlantiques semi-arides', '', 'Sub-Atlantic semi-dry calcareous grasslands', '', 4, 'Niveau 4', 1236, '/67/490/1236/4118', 'true', 'More or less mesophile, closed formations dominated by perennial, tuft-forming grasses, colonizing relatively deep, mostly calcareous soils in the sub-Atlantic domaine of the Quercion pubescenti-petraeae and its northern irradiations and in the sub-Mediterranean mountains of the Italian peninsula, with Bromus erectus, Brachypodium pinnatum, Koeleria pyramidata, Festuca guestfalica, F. lemanii, Avenula pubescens, Sesleria albicans, Briza media, Carex caryophyllea, C. flacca, Gentianella germanica, G. ciliata, Gentiana cruciata, Trifolium montanum, Lotus corniculatus, Ononis repens, Medicago lupulina, Ranunculus bulbosus, Sanguisorba minor, Cirsium acaule, Euphrasia stricta, Dianthus deltoides, Potentilla neumanniana (= P. tabernaemontani, P. verna), Anthyllis vulneraria, Galium verum, Euphorbia brittingeri (E. verrucosa), Hippocrepis comosa, Helianthemum nummularium, Thymus praecox, Salvia pratensis, Linum catharticum, Scabiosa columbaria, Centaurea scabiosa, Carlina vulgaris, Viola hirta, Plantago media, Primula veris and numerous orchids such as Coeloglossum viride, Ophrys apifera, O. holoserica, O. insectifera, O. sphegodes, Aceras anthropophorum, Himantoglossum hircinum, Anacamptis pyramidalis, Orchis morio, O. ustulata, O. militaris, O. simia, Gymnadenia conopsea, Platanthera chlorantha, Herminium monorchis, Dactylorhiza fuchsii. Generally species-rich, these communities may be overwhelmed by the highly social Brachypodium pinnatum. Their range extends from the British Isles, Denmark, the Low Countries and northern Germany to the Cantabric range, the Pyrenees, Catalonia, the southern Alps, and the Central Apennines. Forming a bridge between the Mediterranean region and thermophile sites to the north, they can be identified by their high representation of Mediterranean species in the north and of Euro-Siberian ones in the south.', 'Mesobromion (Seslerio-Mesobromion, Potentillo-Brachypodion pinnati)', 'Formations plus ou moins mésophiles, fermées, dominées par des graminées vivaces, cespiteuses, colonisant des sols relativement profonds, principalement calcaires dans le domaine sub-atlantique du Quercion pubescenti-petraea et dans ses irradiations septentrionales ainsi que dans les montagnes sub-méditerranéennes de la péninsule italienne, avec Bromus erectus, Brachypodium pinnatum, Koeleria pyramidata, F. lemanii, Avenula pubescens, Sesleria albicans, Briza media, Carex caryophyllea, C. flacca, Gentianella germanica, G. ciliata, Gentiana cruciata, Trifolium montanum, Lotus corniculatus, Ononis repens, Medicago lupulina, Ranunculus bulbosus, Sanguisorba minor, Cirsium acaule, Euphrasia stricta, Dianthus deltoides, Potentilla neumanniana, Anthyllis vulneraria, Galium verum, Euphorbia brittingeri (E. verrucosa), Hippocrepis comosa, Helianthemum nummularium, Thymus praecox, Salvia pratensis, Linum catharticum, Scabiosa columbaria, Centaurea scabiosa, Carlina vulgaris, Viola hirta, Plantago media, Primula veris et de nombreuses orchidées telles que Coeloglossum viride, Ophrys apifera, O. fuciflora, O. insectifera, O. sphegodes, Aceras anthropophorum, Himantoglossum hircinum, Anacamptis pyramidalis, Orchis morio, O. ustulata, O. militaris, O. simia, Gymnadenia conopsea, Platanthera chlorantha, Herminium monorchis, Dactylorhiza fuchsii. Généralement riches en espèces, ces groupements peuvent être envahis par le très social Brachypodium pinnatum. Leur aire s\'étend des îles Britanniques, Danemark, Pays-Bas, nord de l\'Allemagne à la région cantabrique, aux Pyrénées, à la Catalogne, aux Alpes du sud, et aux Apennins centraux. Assurant la transition entre la région méditerranéenne et les sites thermophiles plus nordiques, elles peuvent être identifiées par leur forte représentation en espèces méditerranéennes au nord, et par les euro-sibériennes au sud.'),
(4119, 'NR', 22, '34.21', '', '', 'British heavy metal grasslands', '', 4, 'Niveau 4', 1235, '/67/490/1235/4119', 'false', 'Formations, in particular of Wales and the Pennines, developed in the vicinity of former mining operations or on river gravels, with Minuartia verna, Thlaspi caerulescens, Armeria maritima, Viola lutea, Festuca ovina s.l., F. rubra s.l., Agrostis tenuis.', '', 'Pas de description disponible'),
(4120, 'NR', 22, '34.22', 'Pelouses calaminaires', '', 'Calaminarian grasslands', '', 4, 'Niveau 4', 1235, '/67/490/1235/4120', 'true', 'Open formations colonizing heavy metal soils, either natural or resulting from past mining operations, in rapid regression and limited to a few stations in eastern Belgium, western Rhineland, Westphalia and Lower Saxony, and to one station in the southern Netherlands, comprised of a highly specialized flora with the endemics Viola calaminaria, V. guestphalica, Thlaspi caerulescens (= T. alpestre) ssp. calaminare and Festuca aquisgranensis (F. ophioliticola ssp. calaminaria), with Minuartia verna var. hercynica, Silene vulgaris ssp. humilis and Armeria halleri, limited to this formation and the next, and with the steppic, central European Festuca valesiaca.', 'Thlaspion calaminariae: Violetum calaminariae, Violetum guestphalicae', 'Formations ouvertes colonisant les sols riches en métaux lourds, soit naturelles soit résultant d’opérations minières anciennes, en régression rapide et limitées à quelques stations en Belgique orientale, en Rhénanie occidentale, en Westphalie et Basse Saxe, et à une station au sud des Pays-Bas. Elles comprennent une flore hautement spécialisée avec les espèces endémiques Viola calaminaria, Viola guestphalica, Thlaspi caerulescens = T. alpestre) ssp. calaminare et Festuca aquisgranensis (Festuca ophioliticola ssp. calaminaria), avec Minuartia verna var. hercynica, Silene vulgaris ssp. humilis et Armeria halleri, limitées à cette formation et à la suivante, et avec l’espèce steppique d’Europe centrale Festuca valesiaca.'),
(4121, 'NR', 22, '34.23', 'Pelouses métallifères d\'Europe centrale', '', 'Central European heavy metal grasslands', '', 4, 'Niveau 4', 1235, '/67/490/1235/4121', 'true', 'Formations of Saxony and of the Hartz with the endemic or near endemic Armeria halleri, A. bottendorfensis, A. hornburgensis and with Minuartia verna var. hercynica, Silene vulgaris ssp. humilis.', 'Armerion halleri: Armerietum halleri, Armerietum bottendorfensis, Armerietum hornburgensis', 'Formations de Saxe et du Hartz avec les endémiques ou quasi-endémiques Armeria halleri, A. bottendorfensis, A. hornburgensis et avec Minuartia verna var. hercynica, Silene vulgaris ssp. humilis.'),
(4122, 'NR', 22, '34.31', 'Pelouses steppiques sub-continentales', '', 'Sub-continental steppic grasslands', '', 4, 'Niveau 4', 1236, '/67/490/1236/4122', 'true', 'Open grasslands of sub-continental climates with Festuca valesiaca, F. rupicola, F. pseudovina, F. duvalii, F. trachyphylla, Stipa capillata, S. joannis, S. pulcherrima, S. tirsa (= S. stenophylla), S. dasyphylla, Chrysopogon gryllus, Danthonia alpina, Koeleria macrantha, Agrostis capillaris, Poa bulbosa, P. molinerii (= P. badensis var. xerophila), P. perconcinna (= P. carniolica), Melica ciliata, Brachypodium pinnatum, Carex supina, C. stenophylla, C. humilis and herbs such as Adonis vernalis, Pulsatilla montana, P. pratensis, P. grandis, P. patens, P. pusilla, Veronica spicata, Allium flavum, A. sphaerocephalon, Silene otites, Artemisia campestris, Achillea collina, A. nobilis, A. setacea, Centaurea rhenana (C. stoebe), Inula spiraeifolia, Verbascum phoeniceum, Armeria alliacea, Kochia prostrata, Euphorbia seguieriana, E. cyparissias, Campanula sibirica, Iris pumila, I. variegata, Linum flavum, Onosma taurica, O. arenaria, Silene otites, Potentilla arenaria, P. cinerea, Aster linosyris, Onobrychis arenaria, Oxytropis pilosa, O. halleri, Ononis pusilla, O. cenisia, Astragalus onobrychis, A. exscapus, A. danicus, A. vesicarius, A. austriacus, A. alopecuroides, Eryngium campestre, Dianthus carthusianorum, often of oriental, mostly sarmatic, affinities.', 'Festucetalia valesiacae', 'Pelouses ouvertes des climats subcontinentaux avec Festuca valesiaca, F. duvalii, F. lemanii, Stipa capillata, S. pennata subsp. pennata, S. pennata subsp. grafiana, S. tirsa (= S. stenophylla), Chrysopogon gryllus, Danthonia alpina, Koeleria macrantha, Agrostis capillaris, Poa bulbosa, P. badensis subsp. xerophila, P. perconcinna (= P. carniolica), Melica ciliata, Brachypodium pinnatum, Carex humilis et des herbacées telles que Adonis vernalis, Pulsatilla montana, P. pratensis, Veronica spicata, Allium flavum, A. sphaerocephalon, Silene otites, Artemisia campestris, Achillea nobilis, Centaurea rhenana (C. stoebe), Inula spiraeifolia, Armeria alliacea, Bassia prostrata, Euphorbia seguieriana, E. cyparissias, Iris lutescens, Linum flavum, Onosma arenaria, Silene otites, Potentilla arenaria, P. cinerea, Aster linosyris, Onobrychis arenaria, Oxytropis pilosa, O. halleri, Ononis pusilla, O. cristata (cenisia), Astragalus onobrychis, A. exscapus, A. danicus, A. vesicarius, A. austriacus, A. alopecurus, Eryngium campestre, Dianthus carthusianorum, souvent d\'affinités orientales, principalement sarmatiques.'),
(4123, 'NR', 22, '33.11', 'Phryganes de la Provence calcaire', '', 'Calcareous Provence phrygana', '', 4, 'Niveau 4', 1237, '/67/489/1237/4123', 'true', 'Very rare formations of the Marseilles coast of Provence (les Goudes), with Astragalus massiliensis, Thymelaea tartonraira and Plantago subulata.', '', 'Formations très rares de la côte provençale marseillaise (Les Goudes), avec Astragalus tragacantha (massiliensis), Thymelaea tartonraira et Plantago subulata.'),
(4124, 'NR', 22, '33.12', 'Phryganes de la Provence cristalline', '', 'Crystalline Provence phrygana', '', 4, 'Niveau 4', 1237, '/67/489/1237/4124', 'true', 'Formations of the maritime façade of the Maures and the Estérel, with Anthyllis barba-jovis and Thymelaea hirsuta.', '', 'Formations de la façade maritime des Maures et de l\'Estérel, avec Anthyllis barba-jovis et Thymelaea hirsuta.'),
(4125, 'NR', 22, '33.13', 'Phryganes du Cap Corse', '', 'Cap Corse phrygana', '', 4, 'Niveau 4', 1237, '/67/489/1237/4125', 'true', 'Formations of Cap Corse, with Anthyllis hermanniae.', '', 'Formations du Cap Corse, avec Anthyllis hermanniae.'),
(4126, 'NR', 22, '33.14', 'Phryganes du détroit de Bonifacio', '', 'Straits of Bonifacio phrygana', '', 4, 'Niveau 4', 1237, '/67/489/1237/4126', 'true', 'Formations of the southern tip of Corsica and the extreme northern coast of Sardinia, with Astragalus massiliensis.', '', 'Formations de la pointe sud de la Corse et de l\'extrême nord de la Sardaigne, avec Astragalus tragacantha (massiliensis).'),
(4127, 'NR', 22, '33.15', '', '', 'Cabo de Creus phrygana', '', 4, 'Niveau 4', 1237, '/67/489/1237/4127', 'false', 'Isolated formation of the Cabo de Creus promontory in Catalonia, with Astragalus massiliensis, Pistacia lentiscus, Cistus albidus, C. salvifolius, Phillyrea angustifolia, Juniperus oxycedrus.', '', 'Pas de description disponible'),
(4128, 'NR', 22, '33.16', '', '', 'Cabo de São Vicente phrygana', '', 4, 'Niveau 4', 1237, '/67/489/1237/4128', 'false', 'Very isolated formations of the Cabo de Sao Vicente and the Ponta de Sagres, with Astragalus massiliensis and Crithmum maritimum.', '', 'Pas de description disponible'),
(4129, 'NR', 22, '33.31', '', '', 'Sarcopoterium phryganas', '', 4, 'Niveau 4', 1239, '/67/489/1239/4129', 'false', 'Sarcopoterium spinosum -dominated formations, by far the commonest phrygana facies, widespread in the Aegean archipelagoes and Crete, with local outposts in peninsular Greece and the Ionian islands.', '', 'Pas de description disponible'),
(4130, 'NR', 22, '33.32', '', '', 'Maritime Centaurea spinosa phryganas', '', 4, 'Niveau 4', 1239, '/67/489/1239/4130', 'false', 'Rare, relict formations on coastal sands and gravels of Egina, Attica, Euboea, Skyros, Samos, Lesbos, Lemnos, Samothrace and Crete, dominated by the large, silvery hemispherical cushions of Centaurea spinosa ssp. spinosa, sometimes accompanied by Sarcopoterium spinosum or Euphorbia acanthoclada.', '', 'Pas de description disponible'),
(4131, 'NR', 22, '33.33', '', '', 'Lesbian Centaurea spinosa phryganas', '', 4, 'Niveau 4', 1239, '/67/489/1239/4131', 'false', 'Phryganas often rich in Centaurea spinosa ssp. spinosa, mixed with Sarcopoterium spinosum, Satureja timbra, Ballota acetabulosa of Lesbos, extending from the coast to the highest hills in the arid western part of the island; covering a relatively vast expanse, they harbour a highly distinctive flora and fauna as well as remnants of fossil forest.', '', 'Pas de description disponible'),
(4132, 'NR', 22, '33.34', '', '', 'Cycladian Centaurea phryganas', '', 4, 'Niveau 4', 1239, '/67/489/1239/4132', 'false', 'Formations of the Cyclades, rich in Centaurea spinosa ssp. cycladum, extending from coastal areas to the highest elevations.', '', 'Pas de description disponible'),
(4133, 'NR', 22, '33.35', '', '', 'Heather phryganas', '', 4, 'Niveau 4', 1239, '/67/489/1239/4133', 'false', 'Phryganas in which E. manipuliflora plays an important role, often associated with Sarcopoterium spinosum, Genista acanthoclada, Pistacia lentiscus, Ballota acetabulosa, Cistus creticus, C. parviflorus, C. salvifolius, a facies of the Sarcopoterium phrygana developing locally notably in eastern Crete and the Cyclades.', '', 'Pas de description disponible'),
(4134, 'NR', 22, '33.36', '', '', 'Thyme phryganas', '', 4, 'Niveau 4', 1239, '/67/489/1239/4134', 'false', 'Phryganas dominated or formed by Thymus capitatus.', '', 'Pas de description disponible'),
(4135, 'NR', 22, '33.37', '', '', 'Genista phryganas', '', 4, 'Niveau 4', 1239, '/67/489/1239/4135', 'false', 'Genista acanthoclada formations of the thermo-Mediterranean zone.', '', 'Pas de description disponible'),
(4136, 'NR', 22, '33.38', '', '', 'Savory phryganas', '', 4, 'Niveau 4', 1239, '/67/489/1239/4136', 'false', 'Facies of the phryganas in which Satureja thymbra becomes locally dominant.', '', 'Pas de description disponible'),
(4137, 'NR', 22, '33.39', '', '', 'Spiny spurge phryganas', '', 4, 'Niveau 4', 1239, '/67/489/1239/4137', 'false', 'Euphorbia acanthothamnos -dominated formations.', '', 'Pas de description disponible'),
(4138, 'NR', 22, '33.3A', '', '', 'Gromwell phryganas', '', 4, 'Niveau 4', 1239, '/67/489/1239/4138', 'false', 'Lithospermum hispidulum -dominated phryganas, limited to southeastern Aegean islands.', '', 'Pas de description disponible'),
(4139, 'NR', 22, '33.3B', '', '', 'Anthyllis phryganas', '', 4, 'Niveau 4', 1239, '/67/489/1239/4139', 'false', 'Anthyllis hermanniae -dominated or -rich phryganas, widespread, in particular in the northern Aegean.', '', 'Pas de description disponible'),
(4140, 'NR', 22, '41.77', '', '', 'Iberian Quercus faginea and Q. canariensis forests', '', 4, 'Niveau 4', 1265, '/68/492/1265/4140', 'false', 'Iberian forests and woods dominated by Quercus faginea or Q. canariensis. The humid formations of southwestern Iberia (41.772 and 41.773) are forest types of unique character in Europe and of extreme biological importance; also highly distinctive and vulnerable are the Baetic formations listed under 41.7714 and 41.7715.', 'Aceri-Quercion fagineae p., Quercion fagineae, Quercion fagineo-suberis', 'Pas de description disponible'),
(4141, 'NR', 22, '41.78', '', '', 'Macedonian-oak woodland', '', 4, 'Niveau 4', 1265, '/68/492/1265/4141', 'false', 'Woods dominated by the semi-deciduous Quercus trojana.', 'Ostryo-Carpinion p.: Quercetum trojanae i.a.', 'Pas de description disponible'),
(4142, 'NR', 22, '41.79', '', '', 'Valonia oak woodland', '', 4, 'Niveau 4', 1265, '/68/492/1265/4142', 'false', 'Woods dominated by the semi-deciduous Quercus macrolepis, often fairly open, of the mostly meso-Mediterranean zone of Greece and, very locally, southern Italy.', '', 'Pas de description disponible'),
(4143, 'NR', 22, '41.81', 'Bois de Charmes houblon', '', 'Hop-hornbeam woods', '', 4, 'Niveau 4', 1247, '/68/492/1247/4143', 'true', 'Formations dominated by Ostrya carpinifolia.', '', 'Formations dominées par Ostrya carpinifolia.'),
(4144, 'NR', 22, '41.13', 'Hêtraies neutrophiles', '', 'Neutrophilous beech forests', '', 4, 'Niveau 4', 1278, '/68/492/1278/4144', 'true', 'Medio-European and Atlantic forests, on neutral or near-neutral soils, with mild humus (mull), characterized by a strong representation of species belonging to the ecological groups of Anemone nemorosa, of Lamium galeobdolon, of Galium odoratum and Melica uniflora and, in mountains, various Dentaria, forming a richer and more abundant herb layer than in 41.11 and 41.12.', 'Asperulo-Fagenion (Galio odorati-Fagenion)', 'Forêts médio-européennes ou atlantiques sur sols neutres ou voisins de la neutralité, avec humus doux (mull), caractérisées par une forte représentation d\'espèces appartenant aux groupes écologiques d\'Anemone nemorosa, ou Lamiastrum galeobdolon, ou Galium odoratum et Melica uniflora, et, dans les montagnes, divers Dentaria ; formation à strate herbacée plus riche et plus abondante que 41.11 et 41.12.'),
(4145, 'NR', 22, '41.38', 'Frênaies calciphiles lutétiennes', '', 'Lutetian calciphile ash forests', '', 4, 'Niveau 4', 1266, '/68/492/1266/4145', 'true', 'Fraxinus excelsior-dominated facies of calciphile oak-ash forests (41.273), characteristic of the French Paris basin, particularly on chalk deposits; their affinities are with the south-eastern British formations of 41.31.', '', 'Faciès à Fraxinus excelsior dominant des chênaies-frênaies calciphiles, caractéristiques du Bassin parisien français, en particulier sur craies ; elles ont leurs affinités avec les formations britanniques du sud-est de 41.31.'),
(4146, 'NR', 22, '41.39', 'Bois de frênes post-culturaux', '', 'Post-cultural ash woods', '', 4, 'Niveau 4', 1266, '/68/492/1266/4146', 'true', 'Pioneer formations of Fraxinus excelsior occupying abandoned agricultural land.', 'Corylo-Fraxinenalia', 'Formations pionnières de Fraxinus excelsior occupant des terrains agricoles abandonnés.'),
(4147, 'NR', 22, '41.41', 'Forêts de ravin à Frêne et Sycomore', '', 'Ravine ash-sycamore forests', '', 4, 'Niveau 4', 1248, '/68/492/1248/4147', 'true', 'Atlantic and medio-European forests of Fraxinus excelsior, Acer pseudoplatanus, A. platanoides, Ulmus glabra, Tilia platyphyllos, Fagus sylvatica, Quercus robur, on unstable scree or colluvions of abrupt, shady and humid slopes, with abundant ferns, characterized by Asplenium scolopendrium and the ecological group of Actaea spicata, Lunaria rediviva and Helleborus viridis.', 'Fraxino-Aceretum pseudoplatani (Phyllitido-Fraxinetum, Tilio-Aceretum, Ulmo-Aceretum, Dicrano-Aceretum, Arunco-Aceretum, Lunario-Aceretum, Aceri-Fraxinetum)', 'Forêts atlantiques et médio-européennes de Fraxinus excelsior, Acer pseudoplatanus, A. platanoides, Ulmus glabra, Tilia platyphyllos, Fagus sylvatica, Quercus robur, sur éboulis instables ou sur des colluvions de versants abrupts, ombragés et humides, avec des fougères abondantes, caractérisées par Asplenium scolopendrium et le groupe écologique d\'Actaea spicata, Lunaria rediviva et Helleborus viridis.'),
(4148, 'NR', 22, '41.82', '', '', 'Oriental hornbeam woods', '', 4, 'Niveau 4', 1247, '/68/492/1247/4148', 'false', 'Low formations dominated by Carpinus orientalis, particulary abundant in Greece.', '', 'Pas de description disponible'),
(4149, 'NR', 22, '41.83', '', '', 'Thermophilous maple woods', '', 4, 'Niveau 4', 1247, '/68/492/1247/4149', 'false', 'Formations dominated by Acer spp..', '', 'Pas de description disponible'),
(4150, 'NR', 22, '41.84', 'Bois de Tilleuls méditerranéens', '', 'Mediterranean lime woods', '', 4, 'Niveau 4', 1247, '/68/492/1247/4150', 'true', 'Supra- or meso-Mediterranean formations dominated by Tilia spp..', '', 'Formations supra- ou méso-méditerranéennes dominées par Tilia spp.'),
(4151, 'NR', 22, '41.85', 'Micocoulaies', '', 'Nettle-tree woods', '', 4, 'Niveau 4', 1247, '/68/492/1247/4151', 'true', 'Formations rich in Celtis australis.', '', 'Formations riches en Celtis australis.'),
(4152, 'NR', 22, '41.86', 'Bois de Frênes thermophiles', '', 'Thermophilous ash woods', '', 4, 'Niveau 4', 1247, '/68/492/1247/4152', 'true', 'Non-alluvial, non-ravine formations dominated by Fraxinus angustifolia or F. ornus, often mixed with Quercus pubescens or Q. pyrenaica.', '', 'Formations non-alluviales, non installées en ravins, dominées par Fraxinus angustifolia ou F. ornus, souvent mélangées avec Quercus pubescens ou Q. pyrenaica.'),
(4153, 'NR', 22, '41.87', '', '', 'Other or very mixed woods', '', 4, 'Niveau 4', 1247, '/68/492/1247/4153', 'false', '', '', 'Pas de description disponible'),
(4154, 'NR', 22, '42.5A', 'Forêts ibériques de Pins sylvestres sur calcaires', '', 'Iberian calcareous Scots pine woods', '', 4, 'Niveau 4', 1263, '/68/491/1263/4154', 'true', 'Montane and oro-Mediterranean, xerocline, calcicolous Pinus sylvestris forests of the Iberian Range, the Baetic ranges and the southern flank of the Pyrenees.', 'Pino-Juniperion sabinae i.a.', 'Forêts montagnardes et oro-méditerranéennes, xéroclines, calcicoles de Pinus sylvestris, de l\'espace ibérique, du domaine bétique et du versant sud des Pyrénées.'),
(4155, 'NR', 22, '41.42', 'Forêts de pente hercyniennes', '', 'Hercynian slope forests', '', 4, 'Niveau 4', 1248, '/68/492/1248/4155', 'true', 'Mixed forests of Quercus robur, Q. petraea, Fagus sylvatica, Ulmus glabra, Acer pseudoplatanus, A. platanoides, Tilia platyphyllos, Fraxinus excelsior, Carpinus betulus, Alnus glutinosa, with Hedera helix, Polygonatum verticillatum, Galium odoratum, Ranunculus platanifolius, Centaurea montana, Poa chaixii, Pulmonaria montana, Circaea alpina, Sambucus racemosa of large, shaded slopes of the Ardennes and Lorraine, probably also represented in other Hercynian ranges and their periphery, within the zone of transition from oceanic to continental climates.', 'Carpineto-Fraxinetum', 'Forêts mixtes de Quercus robur, Q. petraea, Fagus sylvatica, Ulmus glabra, Acer pseudoplatanus, A. platanoides, Tilia platyphyllos, Fraxinus excelsior, Carpinus betulus, Alnus glutinosa, avec Hedera helix, Polygonatum verticillatum, Galium odoratum, Ranunculus platanifolius, Centaurea montana, Poa chaixii, Pulmonaria montana, Circaea alpina, Sambucus racemosa sur les grands versants ombragés des Ardennes et de la Lorraine, probablement aussi représentées dans d\'autres massifs hercyniens et leur périphérie, dans la zone de transition entre le climat océanique et le climat continental.'),
(4156, 'NR', 22, '41.43', 'Forêts de pente alpiennes et péri-alpiennes', '', 'Alpine and peri-Alpine slope forests', '', 4, 'Niveau 4', 1248, '/68/492/1248/4156', 'true', 'Mixed forests of Acer pseudoplatanus, A. platanoides, Fraxinus excelsior, Ulmus glabra, Fagus sylvatica, Carpinus betulus, Quercus robur developed on colluvial deep soils at the foot of very rainy slopes of the collinar to submontane belts of the Alps and neighbouring ranges, often with Allium ursinum, Mercurialis perennis or the ecological group of Corydalis solida in the luxuriant herb layer; more montane form of 41.42.', 'Aceri-Fraxinetum sensu Etter, 1947', 'Forêts mixtes d\'Acer pseudoplatanus, A. platanoides, Fraxinus excelsior, Ulmus glabra, Fagus sylvatica, Carpinus betulus, Quercus robur, développées sur des sols colluviaux profonds au pied de versants très arrosés, des étages collinéens à sub-montagnards des Alpes et des régions voisines, souvent avec Allium ursinum, Mercurialis perennis ou le groupe écologique de Corydalis solida au sein d\'une strate herbacée luxuriante ; forme plus montagnarde de 41.42 (forêts de pente hercyniennes).'),
(4157, 'NR', 22, '41.44', 'Forêts mixtes pyrénéo-cantabriques de Chênes et d\'Ormes', '', 'Pyreneo-Cantabrian mixed elm-oak forests', '', 4, 'Niveau 4', 1248, '/68/492/1248/4157', 'true', 'Mixed forests of Ulmus glabra, Acer campestre, A. opalus, Fraxinus excelsior, Fagus sylvatica, Quercus petraea, Q. robur, Tilia cordata, T. platyphyllos, Sorbus aria, S. mougeotii, Alnus glutinosa, Pinus sylvestris, Hedera helix, with an understorey comprising numerous shrubs, such as Corylus avellana and Crataegus monogyna, and a rich and luxuriant herb layer including numerous ferns, characteristic of the bottom colluvions of steep, shaded valleys, canyons and gorges of the collinar to montane levels of the Pyrenean and Cantabrian ranges.', 'Androsaemo-Ulmetum', 'Forêts mixtes d\'Ulmus glabra, Acer campestre, A. opalus, Fraxinus excelsior, Fagus sylvatica, Quercus petraea, Q. robur, Tilia cordata, T. platyphyllos, Sorbus aria, S. mougeotii, Alnus glutinosa, Pinus sylvestris, Hedera helix, avec une sous-strate comprenant de nombreux arbustes tels que Corylus avellana et Crataegus monogyna et avec une strate herbacée riche et luxuriante comprenant de nombreuses fougères ; caractéristiques des bases de versants avec colluvions dans des vallées ombragées escarpées, des canyons et des gorges des étages collinéen et montagnard des Pyrénées.'),
(4158, 'NR', 22, '42.32', 'Forêts orientales, calcicoles de Mélèzes et d\'Arolles', '', 'Eastern calcicolous larch and arolla forests', '', 4, 'Niveau 4', 1267, '/68/491/1267/4158', 'false', 'Sub-alpine and montane Larix decidua, Larix decidua - Picea abies, Pinus cembra or Larix decidua-Pinus cembra forests of the eastern and central Alps, mostly of the outer ranges, on calcareous substrates, with a usually species-rich undergrowth including Erica herbacea, Polygala chamaebuxus, Rhododendron hirsutum or Pinus mugo.', 'Laricetum, Larici-Cembretum rhododendretosum hirsuti', 'Forêts subalpines et montagnardes de Larix decidua, de Larix decidua-Picea abies, de Pinus cembra ou Larix decidua-Pinus cembra des Alpes centrales et orientales, surtout des secteurs externes, sur des substrats calcaires avec usuellement une sous-strate riche en espèces incluant Erica herbacea, Polygala chamaebuxus, Rhododendron hirsutum ou Pinus mugo.'),
(4159, 'NR', 22, '41.B1', 'Bois de bouleaux de plaine et colline', '', 'Lowland and collinar birch woods', '', 4, 'Niveau 4', 1251, '/68/492/1251/4159', 'true', 'Pioneer and sub-climax birch formations of the North Sea - Baltic plains, the lower Hercynian slopes, the periphery of the Paris Basin, southwestern France, northwestern Iberia and Insubria, within the range of Atlantic and sub-Atlantic acidophilous oak woods.', 'Quercion robori-petraeae p., i.a.', 'Formations pionnières et sub-climaciques de Bouleaux du nord de la plaine de la mer Baltique, des pentes hercyniennes plus basses, de la périphérie du Bassin parisien, du sud-ouest de la France, du nord-ouest ibérique et insubrien, à l\'intérieur du secteur des bois de Chênes acidiphiles atlantiques et sub-atlantiques.'),
(4160, 'NR', 22, '41.14', 'Hêtraies neutrophiles pyrénéo-cantabriques', '', 'Pyreneo-Cantabrian neutrophile beech forests', '', 4, 'Niveau 4', 1278, '/68/492/1278/4160', 'true', 'Neutrophile beech forests of the southwestern Central Massif, the Pyrenees, the Cantabrian mountains, and, very locally, the Northern Iberian Range.', 'Scillo-Fagenion', 'Hêtraies neutrophiles du sud-ouest du Massif central, des Pyrénées, des montagnes cantabriques et, très localement, du domaine nord ibérique.');
INSERT INTO `corine` (`CD_HAB`, `FG_VALIDITE`, `CD_TYPO`, `LB_CODE`, `LB_HAB_FR`, `LB_HAB_FR_COMPLET`, `LB_HAB_EN`, `LB_AUTEUR`, `NIVEAU`, `LB_NIVEAU`, `CD_HAB_SUP`, `PATH_CD_HAB`, `FRANCE`, `LB_DESCRIPTION`, `CRSP_PHYTO_CB91`, `DESCRIPTIF_CB97_FR`) VALUES
(4161, 'NR', 22, '41.45', 'Forêts thermophiles alpiennes et péri-alpiennes mixtes de Tilleuls', '', 'Thermophilous Alpine and peri-Alpine mixed lime forests', '', 4, 'Niveau 4', 1248, '/68/492/1248/4161', 'true', 'Thermophilous forests of Tilia cordata, T. platyphyllos, Acer platanoides, Fraxinus excelsior, Ulmus glabra, Fagus sylvatica with Euonymus latifolia, Corylus avellana, restricted to the warm valleys of the Alpine system and some peripheral ranges, characterized by Asperula taurina, Cyclamen purpurascens and numerous transgressives of the Quercetalia pubescenti-petraeae. These remarkable relict forests are particularly characteristic of the föhn valleys of the Insubrian and northern Alps; they occur in similar situations in the Jura and the Hercynian ranges, north to the Harz.', 'Asperulo-Tilietum, Seslerio-Tilietum', 'Forêts thermophiles de Tilia cordata, T. platyphyllos, Acer platanoides, Fraxinus excelsior, Ulmus glabra, Fagus sylvatica, avec Euonymus latifolia, Corylus avellana, limitées aux vallées chaudes du système alpien et de quelques régions périphériques, caractérisées par Asperula taurina, Cyclamen purpurascens et de nombreuses transgressives des Quercetalia pubescenti-petraeae. Ces remarquables forêts relictuelles sont particulièrement caractéristiques des vallées des Alpes insubriennes et septentrionales soumises au fœhn ; elles se rencontrent dans des situations similaires dans le Jura et dans les massifs hercyniens.'),
(4162, 'NR', 22, '41.46', '', '', 'Greek chasm forests', '', 4, 'Niveau 4', 1248, '/68/492/1248/4162', 'false', 'Formations of Aesculus hippocastanum, Juglans regia, Fraxinus excelsior of narrow, warm, humid, shaded ravines, gorge walls and abrupt slopes of the beech zone of the Pindus.', '', 'Pas de description disponible'),
(4163, 'NR', 22, '41.B2', '', '', 'Sub-boreal birch woods', '', 4, 'Niveau 4', 1251, '/68/492/1251/4163', 'false', 'Birch woods, often extensive and pure, formed by Betula pubescens (B. odorata, B. carpatica) or B. pendula, beyond and above the present range of oak woods in Scotland and northern England.', '', 'Pas de description disponible'),
(4164, 'NR', 22, '41.B3', 'Bois de Bouleaux montagnards et subalpins', '', 'Montane and subalpine birch woods', '', 4, 'Niveau 4', 1251, '/68/492/1251/4164', 'true', 'Birch stands of the montane and sub-alpine levels of the Alps, the Apennines, the Pyrenees, the Jura and the Hercynian ranges, mostly sub-climax formations of stations with anomalous edaphic and microclimatic conditions.', '', 'Stations de Bouleaux des étages montagnard et sub-alpin des Alpes, des Pyrénées, du Jura et des massifs hercyniens, la plupart du temps formations sub-climaciques ou stations avec des conditions édaphiques et microclimatiques anormales.'),
(4165, 'NR', 22, '41.15', 'Hêtraies subalpines', '', 'Subalpine beech woods', '', 4, 'Niveau 4', 1278, '/68/492/1278/4165', 'true', 'Woods usually composed of low, low-branching trees, with much sycamore (Acer pseudoplatanus) situated near the tree limit, mostly in low mountains with oceanic climate (Vosges, Black Forest, Rhön, Jura, outer Alps, Central Massif, Pyrenees). Herb layer similar to that of 41.13 or locally 41.11 and with elements of adjacent open grasslands.', 'Aceri-Fagenion', 'Forêts habituellement composées d\'arbres bas, bas-branchus, avec de nombreux érables sycomores (Acer pseudoplatanus), situées près de la limite des arbres, la plupart dans des montagnes basses à climat océanique (Vosges, Forêt-Noire, Rhône, Jura, Alpes externes, Massif central, Pyrénées). Strate herbacée identique à celle de 41.13 ou, localement, de 41.11 avec des éléments des prairies ouvertes adjacentes.'),
(4166, 'NR', 22, '41.16', 'Hêtraies sur calcaire', '', 'Beech forests on limestone', '', 4, 'Niveau 4', 1278, '/68/492/1278/4166', 'true', 'Xero-thermophile medio-European and Atlantic forests on calcareous, often superficial, soils, usually of steep slopes, with a generally abundant herb and shrub undergrowth, characterized by sedges (Carex digitata, C. flacca, C. montana, C. alba), grasses (Sesleria albicans, Brachypodium pinnatum), orchids (Cephalanthera spp., Neottia nidus-avis, Epipactis leptochila, E. microphylla) and thermophile species, transgressive of the Quercetalia pubescenti-petraeae. The bush-layer includes several calcicolous species (Ligustrum vulgare, Berberis vulgaris) and Buxus sempervirens can dominate.', 'Cephalanthero-Fagenion', 'Forêts medio-européennes et atlantiques xéro-thermophiles sur sols calcaires, souvent superficiels, généralement sur des pentes escarpées, avec une sous-strate habituellement garnie d\'herbacées et d\'arbrisseaux abondants, caractérisée par des Laîches (Carex digitata, C. flacca, C. montana, C. alba), des Graminées (Sesleria albicans, Brachypodium pinnatum), des Orchidées (Cephalanthera spp., Neottia nidus-avis, Epipactis leptochila, E. microphylla) et des espèces thermophiles, transgressives des Quercetalia pubescenti-petraeae. La strate arbustive renferme plusieurs espèces calcicoles (Ligustrum vulgare, Berberis vulgaris) et Buxus sempervirens peut dominer.'),
(4167, 'NR', 22, '41.51', 'Bois de Chênes pédonculés et de Bouleaux', '', 'Pedunculate oak and birch woods', '', 4, 'Niveau 4', 1252, '/68/492/1252/4167', 'true', 'Acidophilous forests of the Baltic-North Sea plain, composed of Quercus robur, Betula pendula and B. pubescens, often mixed with Sorbus aucuparia and Populus tremula, on very oligotrophic, often sandy and podsolized or hydromorphic soils; the bush layer, poorly developed, includes Frangula alnus; the herb layer, formed by the group of Deschampsia flexuosa, always includes Molinia caerulea and is often invaded by bracken. Forests of this type often prevail in the northern European plain, from Jutland to Flanders; they occupy more limited edaphic enclaves in the Ardennes, in northwestern France, Normandy, Brittany, the Paris basin, the Morvan and Great Britain.', 'Querco-Betuletum, Trientalo-Quercetum roboris', 'Forêts acidiphiles de la plaine de la mer du Nord et de la mer Baltique, composées de Quercus robur, Betula pendula et B. pubescens, souvent mélangées avec Sorbus aucuparia et Populus tremula, sur des sols très oligotrophes, souvent sableux et podzolisées ou hydromorphes ; la strate arbustive peu développée comprend Frangula alnus ; la strate herbacée formée par le groupe de Deschampsia flexuosa, comprend toujours Molinia caerulea et est souvent envahie par des fougères. Les forêts de ce type sont souvent prédominantes dans la plaine européenne nordique, du Jutland aux Flandres ; elles occupent des enclaves édaphiques plus limitées dans les Ardennes, dans le nord-ouest de la France, la Normandie, la Bretagne, le Bassin parisien, le Morvan et la Grande-Bretagne.'),
(4168, 'NR', 22, '41.52', 'Chênaies acidiphiles atlantiques à Hêtres', '', 'Atlantic acidophilous oak forests with beech', '', 4, 'Niveau 4', 1252, '/68/492/1252/4168', 'true', 'Forests analogous to those of the Ilici-Fagion but dominated by Quercus petraea, accompanied by Q.robur and Fagus sylvatica. They differ from 41.51 by the representation of the group of Maianthemum bifolium in the herb layer.', 'Fago-Quercetum (Ilici-Quercetum, Polypodio-Quercetum, Convallario-Quercetum, Violo-Quercetum, Holco-Quercetum)', 'Forêts analogues à celle de l\'Ilici-Fagion mais dominées par Quercus petraea, accompagné de Quercus robur et de Fagus sylvatica. Elles diffèrent de 41.51 par la représentation du groupe de Maianthemum bifolium dans la strate herbacée.'),
(4169, 'NR', 22, '42.33', 'Forêts occidentales de Mélèzes, de Pins de montagne et d\'Arolles', '', 'Western larch, mountain pine and arolla forests', '', 4, 'Niveau 4', 1267, '/68/491/1267/4169', 'true', 'Sub-alpine Larix decidua, Larix decidua-Pinus cembra, Larix decidua-mountain pine, Pinus cembra and Pinus cembra-mountain pine forests of the western, and mostly southwestern Alps, in regions where Pinus uncinata usually associates with Larix decidua and/or Pinus cembra. Characteristically xeric, open formations, they are best characterized by their understorey.', '', 'Forêts subalpines de Larix decidua, Laris decidua et Pinus cembra,de Larix decidua et de Pins de montagne, de Pinus cembra, de Pinus cembra et Pins de montagne, des Alpes occidentales, et le plus souvent sud-occidentales, dans des régions dans lesquelles Pinus uncinata est généralement associé avec Larix decidua et/ou Pinus cembra. Formations ouvertes, nettement xériques, bien caractérisées par leur sous-bois.'),
(4170, 'NR', 22, '41.B4', 'Bois de Bouleaux corses', '', 'Corsican birch woods', '', 4, 'Niveau 4', 1251, '/68/492/1251/4170', 'true', 'Betula pendula formations of the upper montane level of Corsica, forming extensive sub-climax belts on rocky, rapidly eroding soils at the upper forest limit, as well as transition communities in the evolution of laricio pine or beech forests.', '', 'formations de Betula pendula de l\'étage montagnard supérieur de la Corse, formant tant des ceintures sub-climaciques extensives sur des sols rocheux, rapidement érodés à la limite supérieure de la forêt, que des communautés de transition dans l\'évolution de forêts de Pin Laricio ou de Hêtres.'),
(4171, 'NR', 22, '41.B5', '', '', 'Montane Betula celtiberica woodlands', '', 4, 'Niveau 4', 1251, '/68/492/1251/4171', 'false', 'Formations of the upper montane and supra-Mediterranean levels of Iberia dominated by the endemic Betula celtiberica.', '', 'Pas de description disponible'),
(4172, 'NR', 22, '41.B6', '', '', 'Mount Etna birch stands', '', 4, 'Niveau 4', 1251, '/68/492/1251/4172', 'false', 'Endemic Betula aetnensis formations of Mount Etna lavas, limited to the 1200-2000 metre level.', '', 'Pas de description disponible'),
(4173, 'NR', 22, '41.C1', 'Bois d\' Alnus cordata', '', 'Alnus cordata woods', '', 4, 'Niveau 4', 1253, '/68/492/1253/4173', 'true', 'Alnus cordata-dominated formations of slopes with deep, loose, moist soils, endemic to the Campanian, Lucanian and Calabrian Apennines and the Castaniccia and San Petrone ranges of Corsica.', '', 'Formations à Alnus cordata dominant des pentes à sols profonds, meubles et humides, endémiques des massifs de la Castaniccia et de San Petrone en Corse.'),
(4174, 'NR', 22, '41.C2', 'Bois d\'Alnus glutinosa', '', 'Alnus glutinosa woods', '', 4, 'Niveau 4', 1253, '/68/492/1253/4174', 'true', 'Non-riparian, non-marshy formations dominated by Alnus glutinosa, including Sambucus nigra sub-community of Atlantic Alnus glutinosa-Urtica dioica woodland.', '', 'Formations non riveraines, non marécageuses dominées par Alnus glutinosa, incluant la sous-communauté à Sambucus nigra de la formation atlantique à Alnus glutinosa-Urtica dioica.'),
(4175, 'NR', 22, '41.17', 'Hêtraies médio-européennes méridionales', '', 'Southern medio-European beech forests', '', 4, 'Niveau 4', 1278, '/68/492/1278/4175', 'true', 'Forests of the southern flanks of the Alps and the western Mediterranean mountains with an often species-rich herb layer composed of an admixture of medio-European, Mediterranean and local endemic species.', 'Fagion sylvaticae p.', 'Forêts des montagnes ouest-méditerranéennes et du versant méridional des Alpes avec une strate herbacée souvent floristiquement riche, composée d\'un mélange d\'espèces médio-européennes, méditerranéennes et d\'endémiques locales.'),
(4176, 'NR', 22, '41.53', 'Forêts de Chênes sessiles britanniques et irlandaises', '', 'British and Irish sessile oak woods', '', 4, 'Niveau 4', 1252, '/68/492/1252/4176', 'true', 'Acidophilous Q. petraea woods of the British Isles, with low, low-branched, trees, with many ferns, mosses, lichens and evergreen bushes; the herb layer is formed by the group of Deschampsia flexuosa.', 'Blechno-Quercetum petraeae', 'Forêts acidiphiles à Q. petraea des îles Britannniques, avec des arbres bas, aux branches basses, avec un grand nombre de fougères, de mousses, de lichens et de buissons sempervirents ; la strate herbacée est formée par le groupe de Deschampsia flexuosa.'),
(4177, 'NR', 22, '42.34', 'Formations secondaire de Mélèzes', '', 'Secondary larch formations', '', 4, 'Niveau 4', 1267, '/68/491/1267/4177', 'true', 'Formations of Larix decidua colonizing abandoned fields and pastures in lower levels of the Alps. Alpine Larix decidua plantations; plantations of Larix decidua out of range and of other Larix spp. or hybrids should be listed under 83.', '', 'Formations de Larix decidua colonisant les champs et les pâturages abandonnés dans les étages inférieurs des Alpes. Plantations alpiennes de Larix decidua ; plantations de Larix decidua en dehors de son aire naturelle, et d\'autres espèces de Larix ou hybrides, à coder sous le numéro 83.'),
(4178, 'NR', 22, '41.D1', 'Bois de Trembles intra-alpins', '', 'Inner Alpine aspen woods', '', 4, 'Niveau 4', 1255, '/68/492/1255/4178', 'true', 'Woods of Populus tremula and Corylus avellana, accompanied by a xerophile flora, of dry inner Alpine valleys.', 'Corylo-Populetum tremulae', 'Bois de Populus tremula et Corylus avellana, accompagnés d\'une flore xérophile, localisés dans les vallées intra-alpines.'),
(4179, 'NR', 22, '41.D2', 'Bois de Trembles de plaine', '', 'Lowland aspen woods', '', 4, 'Niveau 4', 1255, '/68/492/1255/4179', 'true', 'Pioneer and sub-climax Populus tremula formations of plains and hills, in particular the North Sea - Baltic plain and lower Hercynian slopes, within the range of Atlantic and sub-Atlantic acidophilous oak woods, and the large alluvial systems such as that of the Po.', 'Quercion robori-petraeae p.', 'Formations pionnières et sub-climaciques de Populus tremula de plaines et de collines, en particulier ... des pentes inférieures des massifs hercyniens, à l\'intérieur de l\'aire des chênaies atlantiques et sub-atlantiques acidiphiles, et des grands systèmes alluviaux comme celui du Pô.'),
(4180, 'NR', 22, '41.D3', 'Stations de Trembles montagnardes', '', 'Montane aspen stands', '', 4, 'Niveau 4', 1255, '/68/492/1255/4180', 'true', 'Populus tremula formations of mountainous areas, in particular, within the beech belt of high southern mountains.', '', 'Formations de Populus tremula des régions montagnardes, en particulier à l\'intérieur de l\'étage du Hêtre dans les hautes montagnes méridionales.'),
(4181, 'NR', 22, '41.D4', 'Stations de Trembles supra-méditerranéennes', '', 'Supra-Mediterranean aspen stands', '', 4, 'Niveau 4', 1255, '/68/492/1255/4181', 'true', 'Populus tremula formations occurring within the supra-Mediterranean environment of the mixed deciduous broad-leaved forests.', '', 'Formations de Populus tremula existant sous conditions supra-méditerranéennes (au sein de forêts mixtes caducifoliées).'),
(4182, 'NR', 22, '41.F1', 'Bois d\'Ormes à petites feuilles', '', 'Small-leaved elm woods', '', 4, 'Niveau 4', 1257, '/68/492/1257/4182', 'true', 'Ulmus minor (U. carpinifolia) or U. procera woods of base- and nutrient-rich, often ruderal, terrain, dispersed along the western seaboard of Europe, usually rich in species of southern affinities.', '', 'Bois à Ulmus minor (U. carpinifolia ou U. procera) de terrain riche en bases et en nutriments, souvent rudéralisés, dispersés le long de la côte ouest de l\'Europe, usuellement riches en espèces d\'affinités méridionales.'),
(4183, 'NR', 22, '41.54', 'Chênaies aquitano-ligériennes sur podzols', '', 'Aquitano-Ligerian oak forests on podsols', '', 4, 'Niveau 4', 1252, '/68/492/1252/4183', 'true', 'Forests of Q. robur and, sporadically Q. pyrenaica or hybrids, on podzols of southwestern France, with an herb layer constituted by the group of Deschampsia flexuosa, with Molinia caerulea and Peucedanum gallicum.', 'Peucedano-Quercetum roboris', 'Forêts de Quercus robur et, sporadiquement de Q. petraea ou de leurs hybrides, sur podzols du sud-ouest de la France, avec une strate herbacée constituée par le groupe de Deschampsia flexuosa, avec Molinia caerulea et Peucedanum gallicum.'),
(4184, 'NR', 22, '42.41', 'Forêts de Pins de montagne à Rhododendron ferrugineux', '', 'Rusty alpenrose mountain pine forests', '', 4, 'Niveau 4', 1254, '/68/491/1254/4184', 'true', 'Pinus uncinata forests of the western outer Alps, the Jura and Pyrenean ubacs, developed on siliceous or decalcified soils of the sub-alpine level with a predominately ericaceous undergrowh comprising Rhododendron ferrugineum (dominant), Vaccinium myrtillus, V. uliginosum, Calluna vulgaris, Homogyna alpina, Deschampsia flexuosa, Lycopodium annotinum.', 'Rhododendro-Vaccinion p.', 'Forêts de Pinus uncinata des Alpes externes occidentales, du Jura et des ombrées pyrénéennes, développées sur des sols siliceux ou décalcifiés de l\'étage subalpin avec un sous-bois à prédominance d\'Ericacées comprenant Rhododendron ferrugineum (dominant), Vaccinium myrtillus, V. uliginosum, Calluna vulgaris, Homogyne alpina, Deschampsia flexuosa, Lycopodium annotinum.'),
(4185, 'NR', 22, '41.F2', 'Bois d\'Ormes blancs et d\'Ormes diffus', '', 'Wych elm and fluttering elm woods', '', 4, 'Niveau 4', 1257, '/68/492/1257/4185', 'true', 'Non-riparian, non-ravine Ulmus glabra or U. laevis -dominated formations of northern and central Europe.', '', 'Formations à Ulmus glabra ou U. laevis non riveraines, non installées en ravins de l\'Europe centrale et nordique.'),
(4186, 'NR', 22, '42.11', 'Sapinières neutrophiles', '', 'Neutrophilous silver fir forests', '', 4, 'Niveau 4', 1260, '/68/491/1260/4186', 'true', 'Fir (Abies alba) and fir-spruce forests developed on neutral or near-neutral soils of the Alps, the Pyrenees, the Jura, the Hercynian ranges and the northern Apennines.', '', 'Sapinières et sapinières-pessières (Abies alba) développées sur des sols neutres ou voisins de la neutralité des Alpes, des Pyrénées, du Jura, des massifs hercyniens.'),
(4187, 'NR', 22, '41.18', '', '', 'Southern Italian beech forests', '', 4, 'Niveau 4', 1278, '/68/492/1278/4187', 'false', 'Forests of Italian mountains, south of 42[0]N. They are highly fragmented and harbour many endemics. Altidudinal and hygric variants can be distinguished.', 'Geranio versicolori-Fagion', 'Pas de description disponible'),
(4188, 'NR', 22, '41.55', 'Chênaies aquitano-ligériennes sur sols lessivés ou acides', '', 'Aquitano-Ligerian oak forests on leached or acid soils', '', 4, 'Niveau 4', 1252, '/68/492/1252/4188', 'true', 'Silicicolous thermocline forests of Quercus petraea, Q. robur, Sorbus torminalis, S. domestica, Pyrus communis, Malus acerba, Ilex aquifolium, Mespilus germanica with an undergrowth of Ruscus aculeatus, Festuca heterophylla, Pulmonaria longifolia, Melica uniflora and the Deschampsia flexuosa and Convallaria majalis groups of the Quercion.', 'Rusco-Quercetum petraeae', 'Forêts siliceuses thermoclines de Quercus petraea, Q. robur, Sorbus torminalis, S. domestica, Pyrus communis, Malus acerba, Ilex aquifolium, Mespilus germanicaavec une sous-strate de Ruscus aculeatus, Festuca heterophylla, Pulmonaria longifolia, Melica uniflora et les groupes de Deschampsia flexuosa et Convollaria majalis du Quercion.'),
(4189, 'NR', 22, '41.56', 'Chênaies acidiphiles ibéro-atlantiques', '', 'Ibero-Atlantic acidophilous oak forests', '', 4, 'Niveau 4', 1252, '/68/492/1252/4189', 'true', 'Forests or tall coppice of Quercus robur or Quercus petraea of the Pyrenees and northwestern Iberia, with an often species-poor herb layer formed by the groups of Deschampsia flexuosa and of Hypericum pulchrum, by Ruscus aculeatus and often various ericaceous plants including Daboecia cantabrica.', 'Blechno-Quercetum roboris, Tamo-Quercetum roboris, Linario-Quercetum petraeae, Teucrio-Quercetum petraeae, Veronico-Betuletum, Rusco-Quercetum roboris p., Vaccinio-Quercetum roboris, Narcisso-Quercetum roboris', 'Forêts ou taillis élevés de Quercus robur ou de Q. petraea des Pyrénées et du nord de l\'Espagne, avec une strate herbacée souvent pauvre en espèces formée des groupes de Deschampsia flexuosa et d\'Hypericum pulchrum, aux côtés de Ruscus aculeatus et souvent d\'Ericacées comprenant Daboecia cantabrica.'),
(4190, 'NR', 22, '42.42', 'Forêts de Pins de montagne xéroclines', '', 'Xerocline mountain pine forests', '', 4, 'Niveau 4', 1254, '/68/491/1254/4190', 'true', 'Pinus uncinata forests of the inner Alps, of the western outer Alps and the Jura, and of Pyrenean adrets, accompanied by a shrubby undergrowth in which Rhododendron ferrugineum is absent or rare, while Juniperus nana, J. hemisphaerica, Arctostaphylos uva-ursi, A. alpina, Erica herbacea, Rhododendron hirsutum, Cotoneaster integerrimus, Daphne striata, Dryas octopetala or Polygala chamaebuxus may be prominent.', 'Junipero-Pinion p., Erico-Pinion p.', 'Forêts de Pinus uncinata des Alpes internes, des Alpes externes occidentales, du Jura et des soulanes pyrénéennes, accompagnées par un sous-bois buissonnant dans lequel Rhododendron ferrugineum est absent ou rare, tandis que Juniperus nana, J. hemisphaerica, Arctostaphylos uva-ursi, A. alpina, Erica herbacea, Rhododendron hirsutum, Cotoneaster integerrimus, Daphne striata, Dryasoctopetala ou Polygala chamaebuxus peuvent être dominants.'),
(4191, 'NR', 22, '42.12', 'Sapinières calciphiles', '', 'Calciphilous silver fir forests', '', 4, 'Niveau 4', 1260, '/68/491/1260/4191', 'true', 'Fir (Abies alba) and fir-spruce forests developed on calcareous soils of the Alps, the Pyrenees, the Jura and the Hercynian ranges.', '', 'Sapinières (Abies alba) et sapinières-pessières développées sur des sols calcaires des Alpes, des Pyrénées, du Jura et des massifs hercyniens.'),
(4192, 'NR', 22, '41.19', '', '', 'Balkanic beech forests', '', 4, 'Niveau 4', 1278, '/68/492/1278/4192', 'false', 'Forests of the mountains of northeastern Greece (Vermion, Vernon, border ranges of northern Macedonia, the Chalkidiki, Thrace, and locally, Olympus and Ossa), with a pronounced medio-European character, marked by the frequency of Acer pseudoplatanus, Quercus petraea, Fragaria vesca, Oxalis acetosella, mostly without fir, or, very locally, with Abies alba.', 'Fagion moesiacum', 'Pas de description disponible'),
(4193, 'NR', 22, '41.1A', '', '', 'Hellenic beech forests', '', 4, 'Niveau 4', 1278, '/68/492/1278/4193', 'false', 'Forests of the central Pindus, the Smolikas, the Grammos, the Hasia and Olympus, with reduced medio-European character and high endemism, characterized by Abies borisii-regis, Doronicum caucasicum, Galium laconicum, Lathyrus venetus, Helleborus cyclophyllus.', 'Fagion hellenicum', 'Pas de description disponible'),
(4194, 'NR', 22, '41.1B', '', '', 'Beech forests with Hungarian oak', '', 4, 'Niveau 4', 1278, '/68/492/1278/4194', 'false', 'More thermophile forests of the transition zone between the supra-Mediterranean and montane levels of Thrace and Macedonia, characterized by the presence of numerous species of the Quercion frainetto.', 'Quercion frainetto p.', 'Pas de description disponible'),
(4195, 'NR', 22, '42.13', 'Sapinières acidiphiles', '', 'Acidophilous silver fir forests', '', 4, 'Niveau 4', 1260, '/68/491/1260/4195', 'true', 'Fir (Abies alba) and fir-spruce forests developed on acid soils of the Alps, the Pyrenees, the Jura, the Hercynian ranges and the northern Apennines.', '', 'Sapinières (Abies alba) et sapinières-pessières développées sur des sols acides des Alpes, des Pyrénées, du Jura, des massifs hercyniens.'),
(4196, 'NR', 22, '41.21', 'Chênaies atlantiques mixtes à Jacinthes des bois', '', 'Mixed Atlantic bluebell oak forests', '', 4, 'Niveau 4', 1261, '/68/492/1261/4196', 'true', 'Atlantic forests of the British Isles, western Belgium and northwestern France, mostly on more or less water-retaining soils, characterized by a diverse tree layer, dominated by Quercus robur and rich in Fraxinus excelsior, and by an herb layer rich in species of the group of Hyacinthoides non-scripta. Included are British Quercus robur-Pteridium aquilinum-Rubus fruticosus woodlands.', 'Endymio-Carpinetum, Corylo-Fraxinetum p.', 'Forêts atlantiques des îles Britanniques, de la Belgique occidentale et du nord-ouest de la France, principalement sur des sols plus ou moins hydromorphes, caractérisées par une strate arborescente hétérogène, dominées par Quercus robur et riche en Fraxinus excelsior, et par une strate herbacée riche en espèces du groupe de Hyacinthoides non-scripta.'),
(4197, 'NR', 22, '41.57', 'Chênaies acidiphiles médio-européennes', '', 'Medio-European acidophilous oak forests', '', 4, 'Niveau 4', 1252, '/68/492/1252/4197', 'true', 'Medio-European acidophilous forests of Quercus petraea, sometimes accompanied by Fagus sylvatica and Q. robur, with a shrub layer comprising Sorbus aucuparia, Frangula alnus, often Ilex aquifolium, and an herb layer similar to that of the Luzulo-Fagion, of which they often constitute a substitution formation.', 'Luzulo-Quercetum (Genisto tinctoriae-Quercetum petraeae), Sileno-Quercetum petraeae, Calamagrostio-Quercetum', 'Forêts acidiphiles médio-européennes de Quercus petraea, quelquefois accompagné de Fagus sylvatica et Quercus robur avec une strate arbustive comprenant Sorbus aucuparia, Frangula alnus, et souvent Ilex aquifolium, et une strate herbacée similaire à celle du Luzulo-Fagenion, dont elles constituent souvent une formation de substitution.'),
(4198, 'NR', 22, '41.58', '', '', 'Subcontinental pine-oak forests', '', 4, 'Niveau 4', 1252, '/68/492/1252/4198', 'false', 'Acidophilous forests of Quercus robur, Q. petraea and Pinus sylvestris on sandy substrates and granitic arenas of subcontinental climate regions in High-Palatinate, Erz, Vogtland, the southern Saxony hills and Brandenburg, with an undergrowth of Vaccinium myrtillus, V. vitis-idaea, Calluna vulgaris, Deschampsia flexuosa, Melampyrum pratense, Luzula luzuloides, Dicranum spp., Polytrichum spp.', 'Vaccinio vitis-idaeae-Quercetum (Pino-Quercetum)', 'Pas de description disponible'),
(4199, 'NR', 22, '42.14', 'Sapinières corses', '', 'Corsican silver fir forests', '', 4, 'Niveau 4', 1260, '/68/491/1260/4199', 'true', 'Fir woods and forests locally replacing, mostly in cool stations, the acidophilous beech forests of the montane level of Corsica.', 'Poo-Fagetum abietetosum', 'Bois et forêts de Sapins remplaçant localement, surtout dans les stations fraîches, les hêtraies acidiphiles du niveau montagnard de Corse.'),
(4200, 'NR', 22, '42.15', '', '', 'Southern Apennine silver fir forests', '', 4, 'Niveau 4', 1260, '/68/491/1260/4200', 'false', 'Relict fir woods associated with the beech forests of the Geranio versicolori-Fagion of the Lucano-Calabrian Apennines (Pollino, Sila, Aspromonte).', 'Geranio versicolori-Fagion p.', 'Pas de description disponible'),
(4201, 'NR', 22, '42.16', '', '', 'Greek silver fir forests', '', 4, 'Niveau 4', 1260, '/68/491/1260/4201', 'false', 'Very local, calciphilous, Abies alba forests of extreme northern Greece.', 'Fagion moesiacum p.', 'Pas de description disponible'),
(4202, 'NR', 22, '42.17', '', '', 'Forests of King Boris\'s fir', '', 4, 'Niveau 4', 1260, '/68/491/1260/4202', 'false', 'Fir forests of the Pindus with Abies borisii-regis, adjacent to beech and beech-fir forests of the Fagion hellenicum.', 'Fagion hellenicum p.', 'Pas de description disponible'),
(4203, 'NR', 22, '42.18', '', '', 'Forests of Grecian fir', '', 4, 'Niveau 4', 1260, '/68/491/1260/4203', 'false', 'Endemic Abies cephalonica or mixed A. cephalonica and A. borisii-regis forests of the southern Pindus, the Parnassus, Cephalonia and the Peloponnese, outside of the range of beeches, Fagus spp.', 'Abietion cephalonicae', 'Pas de description disponible'),
(4204, 'NR', 22, '42.19', '', '', 'Pinsapo fir forests', '', 4, 'Niveau 4', 1260, '/68/491/1260/4204', 'false', 'Forests and stands of the endemic Abies pinsapo of the supra-meso-Mediterranean level of Andalucia.', '', 'Pas de description disponible'),
(4205, 'NR', 22, '41.22', 'Frênaies-chênaies et chênaies-charmaies aquitaniennes', '', 'Aquitanian ash-oak and oak-hornbeam forests', '', 4, 'Niveau 4', 1261, '/68/492/1261/4205', 'true', 'Ash-oak forests of valley bottoms and cool, damp lower slopes of Southwestern France, south to the Pyrenean piedmont, with Sorbus torminalis, Ruscus aculeatus and many thermocline, acidocline and Mediterraneo-Atlantic species.', 'Rusco-Carpinetum, Saniculo-Carpinetum', 'Frênaies-chênaies de fonds de vallée et de la base des versants, frais et humides du sud-ouest de la France, du piedmont pyrénéen, avec Sorbus torminalis, Ruscus aculeatus et d\'autres espèces thermoclines, acidoclines et méditerranéo-atlantiques.'),
(4206, 'NR', 22, '41.23', 'Frênaies-chênaies sub-atlantiques à primevère', '', 'Sub-Atlantic oxlip ash-oak forests', '', 4, 'Niveau 4', 1261, '/68/492/1261/4206', 'true', 'Oak-hornbeam forests rich in ash, on more or less wet, meso-eutrophic soils, in regions of moderate Atlantic influence, characterized by the abundance of species of the ecological groups of Primula elatior, of Lamium galeobdolon, of Anemone nemorosa and by the absence of Hyacinthoides non-scripta.', 'Primulo-Carpinetum', 'Chênaies-charmaies riches en Frênes, sur des sols méso-eutrophes plus ou moins humides, dans des régions sous influence atlantique modérée, caractérisées par l\'abondance des espèces des groupes écologiques : Primula elatior, Lamiastrum galeobdolon, Anemone nemorosa et par l\'absence de Hyacinthoides non-scripta.'),
(4207, 'NR', 22, '41.24', 'Chênaies-charmaies à Stellaire sub-atlantiques', '', 'Sub-Atlantic stitchwort oak-hornbeam forests', '', 4, 'Niveau 4', 1261, '/68/492/1261/4207', 'true', 'Sub-Atlantic and medio-European forests of Quercus robur and Quercus petraea, on meso-oligotrophic and less hydromorphic soils, characterized by the replacement of the groups of Primula elatior and Lamium galeobdolon by those of Deschampsia flexuosa and of Maianthemum bifolium, transgressives from the Quercion.', 'Stellario-Carpinetum s. l.', 'Forêts subatlantique et médio-européenne à Quercus robur et Quercus petraea, sur des sols méso-oligotrophes, plus ou moins hydromorphes, caractérisées par le remplacement des groupes à Primula elatior et Lamiastrum galeobdolon par ceux à Deschampsia flexuosa et Maianthemum bifolium, transgressives du Quercion robori-petraeae.'),
(4208, 'NR', 22, '41.59', '', '', 'Insubrian acidophilous oak forests', '', 4, 'Niveau 4', 1252, '/68/492/1252/4208', 'false', 'Acidophilous forests of Quercus petraea, often mixed with Castanea sativa, of the southern foothills of the Alps in Liguria, Piedmont and Lombardy. The herbaceous layer is often dominated by Festuca ovina (s.l.) and the undergrowth includes, in addition to plants characteristic of the Quercion, transgressives of the Fagion and of the Quercetalia pubescenti-petraeae.', 'Castaneo-Quercetum', 'Pas de description disponible'),
(4209, 'NR', 22, '41.5A', '', '', 'Portuguese pedunculate oak forests', '', 4, 'Niveau 4', 1252, '/68/492/1252/4209', 'false', 'Relict forests of Q. robur of central Portugal, often mixed with Q. suber, Q. pyrenaica or Castanea sativa and with a luxuriant understory rich in lauriphyllous and xerophyllous lustrous-leaved shrubs and small trees such as Prunus lusitanica, Arbutus unedo, Viburnum tinus, Ilex aquifolium, Laurus nobilis, Myrtus communis and Ruscus aculeatus, limited to the basins of the Mondego and the Zezere, reduced to a very few, extremely fragile stands of exceptional biological and aesthetic value.', 'Rusco-Quercetum roboris viburnetosum', 'Pas de description disponible'),
(4210, 'NR', 22, '41.61', '', '', 'Central Iberian Quercus pyrenaica forests', '', 4, 'Niveau 4', 1262, '/68/492/1262/4210', 'false', 'Supra- and sometimes meso-Mediterranean Quercus pyrenaica forests of western Iberia, the Leonese interior, the Cordillera Central, the Iberian Range, the Montes de Toledo and the Sierra Morena.', '', 'Pas de description disponible'),
(4211, 'NR', 22, '42.43', 'Reboisement de Pins de montagne', '', 'Mountain pine reforestation', '', 4, 'Niveau 4', 1254, '/68/491/1254/4211', 'true', 'Pinus uncinata plantations in or near the natural range of the species.', '', 'Plantations de Pinus uncinata à l\'intérieur, ou au voisinage, de l\'aire naturelle de l\'espèce.'),
(4212, 'NR', 22, '42.51', '', '', 'Caledonian forest', '', 4, 'Niveau 4', 1263, '/68/491/1263/4212', 'false', 'Relict, indigenous Scots pine forests of endemic Pinus sylvestris var. scotica, limited to the central and northeastern Grampians of Scotland. They are mostly open and have a ground layer usually rich in ericaceous species and mosses, in particular, Hylocomium splendens, and often harbouring, together with abundant Deschampsia flexuosa, Goodyera repens, Listera cordata, Corallorhiza trifida, Linnaea borealis, Trientalis europaea, Pyrola minor, Moneses uniflora, Orthilia secunda. Accompanying, dominated, tree species include Juniperus communis, Sorbus aucuparia, Betula pubescens, B. pendula, Ilex aquifolium, Populus tremula.', '', 'Pas de description disponible'),
(4213, 'NR', 22, '42.1A', '', '', 'Relict Nebrodi fir stands', '', 4, 'Niveau 4', 1260, '/68/491/1260/4213', 'false', 'Surviving stands of the endangered Abies nebrodensis in the Madonie mountains of Sicily.', '', 'Pas de description disponible'),
(4214, 'NR', 22, '42.1B', 'Reboisement en Sapins', '', 'Fir reforestation', '', 4, 'Niveau 4', 1260, '/68/491/1260/4214', 'true', 'Plantations of European firs within or near their area of present or recent natural occurrence. Other plantations of these species and plantations of non-European firs should be noted as 83.', '', 'Plantations de Sapins européens à l\'intérieur ou au voisinage de leur aire de répartition actuelle présente ou récente. D\'autres plantations de ces espèces et d\'autres plantations de Sapins non-européens doivent être notées comme 83.'),
(4215, 'NR', 22, '42.21', 'Pessières sub-alpines des Alpes', '', 'Sub-alpine spruce forests of the Alps', '', 4, 'Niveau 4', 1264, '/68/491/1264/4215', 'true', 'Picea abies forests of the lower sub-alpine level, and of anomalous stations in the montane level, of the outer, intermediate and inner Alps; in the latter, they are often in continuity with the montane spruce forests of 42.22. The spruces are often stunted or columnar; they are accompanied by an undergrowth of decidedly sub-alpine affinities.', 'Piceetum subalpinum', 'Forêts d\'Epicéas de l\'étage subalpin inférieur et de stations anormales de l\'étage montagnard des Alpes externes, intermédiaires et internes ; dans ce dernier cas il s\'agit souvent de communautés en continuité avec les pessières montagnardes de 42.22. Les Epicéas sont souvent rabougris ou columnaires ; ils sont accompagnés d\'un sous-bois aux affinités nettement subalpines.'),
(4216, 'NR', 22, '41.25', 'Chênaies-charmaies faméniennes', '', 'Famennian oak-hornbeam forests', '', 4, 'Niveau 4', 1261, '/68/492/1261/4216', 'true', 'Sub-Atlantic forests, generally with a low canopy, on soils with an alternating hydric regime, characterized by the abundance of Carex flacca and the coexistence of acidocline and calcicline species.', 'Stellario-Carpinetum caricetosum', 'Forêts subatlantiques, généralement avec une canopée basse, sur sols à régime hydrique alternant, caractérisées par l\'abondance de Carex flacca et la coexistence d\'espèces acidiclines et calciclines.'),
(4217, 'NR', 22, '41.26', 'Chênaies-charmaies orientales', '', 'Eastern oak-hornbeam forests', '', 4, 'Niveau 4', 1261, '/68/492/1261/4217', 'true', 'Sub-continental and continental forests dominated by Quercus petraea and richer in lime, Tilia cordata, than the previous formations.', 'Galio-Carpinetum, Tilio-Carpinetum', 'Forêts sub-continentales et continentales dominées par Quercus petraea et plus riches en Tilleuls, Tilia cordata, que les formations précédentes.'),
(4218, 'NR', 22, '41.62', '', '', 'Cantabrian Quercus pyrenaica forests', '', 4, 'Niveau 4', 1262, '/68/492/1262/4218', 'false', 'Quercus pyrenaica formations of medio-European character, of the collinar and montane levels of the Cantabrian chain and its satellite ranges west to the Sierra de Picos de Ancares in Galicia, characteristic of areas with comparatively low precipitation, in the rain shadow of the coastward ranges or the interior oro-Cantabrian hills.', 'Melampyro pratense-Quercetum pyrenaicae, Linario triornithophorae-Quercetum pyrenaicae', 'Pas de description disponible'),
(4219, 'NR', 22, '41.63', '', '', 'Maestrazgan Quercus pyrenaica forests', '', 4, 'Niveau 4', 1262, '/68/492/1262/4219', 'false', 'Quercus pyrenaica forests of the sub-Mediterranean siliceous enclaves of the Maestrazgo and eastern Catalonian ranges, reduced to a very few relicts in the Penagolosa and Prades massifs.', 'Cephalanthero rubrae-Quercetum pyrenaicae', 'Pas de description disponible'),
(4220, 'NR', 22, '41.64', '', '', 'Baetic Quercus pyrenaica forests', '', 4, 'Niveau 4', 1262, '/68/492/1262/4220', 'false', 'Quercus pyrenaica forests of siliceous supra-Mediterranean areas with sub-humid climate of the western Sierra Nevada, the Sierra de Alfacar, the northern flancs of the Sierra de Cazulas and the Sierra Tejeda; in more humid locations Fraxinus angustifolius and Acer granatense accompany Q. pyrenaica.', 'Adenocarpo decorticantis-Quercetum pyrenaicae', 'Pas de description disponible'),
(4221, 'NR', 22, '41.65', 'Forêts françaises de Quercus pyrenaica', '', 'French Quercus pyrenaica forests', '', 4, 'Niveau 4', 1262, '/68/492/1262/4221', 'true', 'Quercus pyrenaica forests of southwestern France north to the Sologne where they constitute relatively estensive formations on poor soils, with Betula pendula, Lonicera periclymenum, Deschampsia flexuosa, Holcus mollis, Molinia caerulea, Teucrium scorodonia.', 'Betulo-Quercetum pyrenaica i.a.', 'Forêts de Quercus pyrenaica du sud-ouest de la France, au nord jusqu\'en Sologne où elles constituent des formations relativement étendues sur des sols pauvres, avec Betula pendula, Lonicera periclymenum, Deschampsia flexuosa, Holcus mollis, Molinia caerulea, Teucrium scorodonia.'),
(4222, 'NR', 22, '42.52', 'Forêts de Pins sylvestres médio-européennes', '', 'Middle European Scots pine forests', '', 4, 'Niveau 4', 1263, '/68/491/1263/4222', 'true', 'Indigenous Pinus sylvestris forests of the lowlands of northern and middle Europe and of the montane level of the central European Hercynian ranges.', '', 'Forêts indigènes de Pinus sylvestris des plaines de l\'Europe septentrionale et centrale et de l\'étage montagnard des massifs hercyniens du centre de l\'Europe.'),
(4223, 'NR', 22, '42.22', 'Pessières montagnardes des Alpes internes', '', 'Montane spruce forests of the inner Alps', '', 4, 'Niveau 4', 1264, '/68/491/1264/4223', 'true', 'Picea abies forests of the montane level of the inner Alps, characteristic of regions climatically unfavorable to both beech and fir.', 'Piceetum montanum', 'Forêts de Picea abies de l\'étage montagnard des Alpes internes, caractéristiques des régions climatiquement défavorables au Hêtre et au Sapin.'),
(4224, 'NR', 22, '41.27', 'Chênaies-charmaies et frênaies-charmaies calciphiles', '', 'Calciphile oak-hornbeam and ash-oak forests', '', 4, 'Niveau 4', 1261, '/68/492/1261/4224', 'true', 'Often low, open formations dominated by Quercus robur or Q. petraea, developed on superficial to deep soils associated with calcareous substrates in southern Germany, eastern and southern Belgium, eastern and central France; they generally constitute substitution forests of the Cephalanthero-Fagion, either regressive phases brought about by coppicing or recolonisation phases permitted by abandonment of Bromion grasslands.', 'Antherico-carpinetum, Carici-Carpinetum (Ligustro-Carpinetum), Scillo-Carpinetum p., i.a.', 'Formations souvent basses, ouvertes dominées par Quercus robur ou Q. petraea, développées sur des sols superficiels à profonds associés à des substrats calcaires dans le sud de l\'Allemagne, l\'est et le sud de la Belgique, l\'est et le centre de la France ; elles constituent généralement des forêts de substitution du Cephalanthero-Fagion, soit des phases régressives entretenues par le traitement en taillis, soit des phases de recolonisation après l\'abandon de pelouses de Bromion erecti.'),
(3857, 'NR', 22, '11.41', 'Groupements marins à Ruppia maritima', '', 'Marine tasselweed communities', '', 4, 'Niveau 4', 1177, '/65/475/1177/3857', 'true', 'Submerged Ruppia maritima (or R. cirrhosa) beds and Chara formations of the open Baltic and of pools on mud flats or sand flats of other seas.', 'Ruppion maritimae p.', 'Formations immergées à Ruppia maritima (ou R. cirrhosa) et formations à Chara de pleine mer de la Baltique et des mares des vasières ou estrans (bancs sableux) des autres mers.'),
(3858, 'NR', 22, '11.42', 'Formations à Petit souchet', '', 'Dwarf spike-rush beds', '', 4, 'Niveau 4', 1177, '/65/475/1177/3858', 'true', 'Emergent Eleocharis parvula formations of the open Baltic or of tidal flats.', 'Scirpion parvuli p.', 'Pas de description disponible'),
(3859, 'NR', 22, '13.11', 'Eau saumâtre des cours d\'eau soumis à marées', '', 'Brackish water', '', 4, 'Niveau 4', 1178, '/65/474/1178/3859', 'true', '', '', 'Pas de description disponible'),
(3860, 'NR', 22, '13.12', 'Eau douce des cours d\'eau soumis à marées', '', 'Fresh water', '', 4, 'Niveau 4', 1178, '/65/474/1178/3860', 'true', '', '', 'Pas de description disponible'),
(3861, 'NR', 22, '11.11', 'Eaux océaniques', '', 'Oceanic waters', '', 4, 'Niveau 4', 1180, '/65/475/1180/3861', 'true', 'Waters beyond the continental shelf.', '', 'Eaux au-delà du plateau continental.'),
(3862, 'NR', 22, '11.12', 'Eaux du talus et du plateau continental (= eaux néritiques)', '', 'Shelf and slope waters', '', 4, 'Niveau 4', 1180, '/65/475/1180/3862', 'true', 'Waters of the continental shelf, underwater plateau extending from the coast to a depth of about 100 fathoms, beyond which the continental slope falls steeply toward the ocean bottom.', '', 'Eaux de la plate-forme continentale, plateau sous-marin allant de la côte jusqu\'à une profondeur d\'environ 180 mètres, au-delà de laquelle le talus continental descend à pic vers le fond océanique.'),
(3863, 'NR', 22, '11.21', 'Fonds sous-marins profonds', '', 'Deep sea floor', '', 4, 'Niveau 4', 1181, '/65/475/1181/3863', 'true', 'Bathyal, abyssal, hadal and hydro-thermal benthic communities, of the continental slope, the abyssal plain and its features, respectively.', '', 'Communautés benthiques bathyales, abyssales, hadales et hydro-thermales, respectivement du talus continental, de la plaine abyssale et de ses accidents de reliefs.'),
(3864, 'NR', 22, '11.22', 'Zones benthiques sublittorales sur sédiments meubles', '', 'Sublittoral soft seabeds', '', 4, 'Niveau 4', 1181, '/65/475/1181/3864', 'true', 'Mostly animal communities colonizing soft sediments such as mud, sand or gravel of the infralittoral and circalittoral zones.', '', 'Communautés principalement constituées d\'animaux colonisant les sédiments meubles tels que des limons, des sables ou graviers des zones infralittorales et circalittorales.'),
(3865, 'NR', 22, '11.23', 'Zones benthiques sublittorales sur cailloutis', '', 'Sublittoral pebbly seabeds', '', 4, 'Niveau 4', 1181, '/65/475/1181/3865', 'true', 'Communities of mostly annual algae and invertebrates developing on pebble formations of the infralittoral and circalittoral zones.', '', 'Communautés principalement d\'algues annuelles et d\'invertébrés se développant sur des formations de galets des zones infralittorales et circalittorales.'),
(3866, 'NR', 22, '11.24', 'Zones benthiques sublittorales sur fonds rocheux', '', 'Sublittoral rocky seabeds', '', 4, 'Niveau 4', 1181, '/65/475/1181/3866', 'true', 'Varied, strongly stratified communities colonizing underwater cliffs, reefs and rocky continental shelf seabeds.', '', 'Communautés variées, fortement stratifiées colonisant falaises sous-marines, récifs et fonds rocheux du plateau continental.'),
(3867, 'NR', 22, '11.25', 'Formations sublittorales de concrétions organogéniques', '', 'Sublittoral organogenic concretions', '', 4, 'Niveau 4', 1181, '/65/475/1181/3867', 'true', 'Continental shelf colonies of lower plants or animals resulting in concretions and encrustations.', '', 'Colonies de plantes ou d\'animaux inférieurs conduisant à des concrétions et des incrustations sur le plateau continental.'),
(3868, 'NR', 22, '11.26', 'Grottes sous-marines', '', 'Undersea caves', '', 4, 'Niveau 4', 1181, '/65/475/1181/3868', 'true', '', '', 'Pas de description disponible'),
(3869, 'NR', 22, '11.31', 'Herbiers atlantiques à Zostères', '', 'Atlantic eelgrass meadows', '', 4, 'Niveau 4', 1182, '/65/475/1182/3869', 'true', 'Eelgrass beds dominated by Zostera marina, established between the base of the intertidal zone and a depth of about 10 metres in Atlantic and North Sea waters.', 'Zosterion marinae: Zosteretum marinae', 'Végétation de Zostères dominées par Zostera marina, établies entre la base de la zone intertidale et une profondeur d\'environ 10 mètres, dans les eaux de l\'Atlantique et de la mer du Nord.'),
(4225, 'NR', 22, '42.53', 'Forêts steppiques intra-alpines à Ononis', '', 'Inner-Alpine restharrow steppe forests', '', 4, 'Niveau 4', 1263, '/68/491/1263/4225', 'true', 'Xerophile, often calcicolous, open Pinus sylvestris or P. sylvestris and P. uncinata forests of the montane level of inner Alpine valleys submitted to extreme continental climate (upper Durance, Ubaye, upper Tinée, Val di Susa, Maurienne, Val d\'Aoste, Alto Adige (Val Venosta)), rich in leguminous plants such as Ononis rotundifolia, O. cenisia, Astragalus austriacus, A. purpurea, Coronilla minima, Onobrychis saxatilis and with a shrub layer comprising Juniperus communis, J. sabina, Berberis vulgaris, Amelanchier ovalis.', 'Ononido-Pinion', 'Forêts ouvertes xérophiles, souvent calcicoles, de Pinus sylvestris ou de P. sylvestris et P. uncinata de l\'étage montagnard des vallées intra-alpines soumises à un climat continental extrême (Haute Durance, Ubaye, Haute-Tinée, Maurienne, val d\'Aoste...). Ces pinèdes sont riches en légumineuses comme Ononis rotundifolia, O. cenisia, Astragalus austriacus, A. purpurea, Coronilla minima, Onobrychis saxatiliset pourvues d\'une strate arbustive comprenant Juniperus communis, J. sabina, Berberis vulgaris, Amelanchier ovalis.'),
(4226, 'NR', 22, '42.23', 'Forêts subalpines hercyniennes', '', 'Subalpine Hercynian forests', '', 4, 'Niveau 4', 1264, '/68/491/1264/4226', 'false', 'Sub-alpine Picea abies forests of high Hercynian ranges.', '', 'Forêts de Picea abies subalpines des hauts massifs hercyniens.'),
(4227, 'NR', 22, '42.24', '', '', 'Southern spruce forests', '', 4, 'Niveau 4', 1264, '/68/491/1264/4227', 'false', 'Outlying Picea abies formations of the Apennines and Rhodope, at the southern limit of the range of the species.', '', 'Pas de description disponible'),
(4228, 'NR', 22, '41.28', 'Chênaies-charmaies sud-alpines', '', 'Southern Alpine oak-hornbeam forests', '', 4, 'Niveau 4', 1261, '/68/492/1261/4228', 'true', 'Fragmentary mesophile or mesohygrophile formations of the Insubrian pre-Alps, the Ligurian Apennines, the Esterel and the Tanneron and very locally, the southern French Alps (forêt du Saou, Drôme), with Quercus petraea, Q. robur, Fraxinus excelsior, Tilia platyphyllos, T. cordata and Carpinus betulus, developed on deep soils in conditions of sufficient atmospheric and edaphic humidity.', 'Salvio-Fraxinetum, Physospermo-Quercetum petraeae, Euphorbio-Carpinetum', 'Formations mésophiles ou méso-hygrohiles fragmentaires des Pré-Alpes insubriennes, des Apennins ligures, de l\'Estérel et du Tanneron et, très localement, des Alpes du sud-est de la France (forêt du Saou, Drôme) avec Quercus petraea, Q. robur, Fraxinus excelsior, Tilia platyphyllos, T. cordata et Carpinus betulus, développées sur des sols profonds dans des conditions suffisantes d\'humidité atmosphérique et édaphique.'),
(4229, 'NR', 22, '41.71', 'Chênaies blanches occidentales et communautés apparentées', '', 'Western white oak woods and related communities', '', 4, 'Niveau 4', 1265, '/68/492/1265/4229', 'true', 'Quercus pubescens forests and woods of the supra-Mediterranean zone of France, west of the Alpine arc, and of northeastern Spain, with irradiations to southern Germany and Belgium. Low medio-European forests of Q. petraea or Q. robur occupying warm exposures beyond the range of Q. pubescens and linked to the Quercion pubescenti-petraeae by the presence of Buxus sempervirens or other thermophile calcicolous plants (Limodorum abortivum, Melittis melissophyllum).', 'Quercion pubescenti-petraeae: Buxo-Quercetum, Lithospermo-Quercetum petraeae, Potentillo albae-Quercetum, Pteridio-Quercetum pubescentis, Aceri-Quercetum petraeae; Quercion ilicis p.', 'Forêts et bois de Quercus pubescens de l\'étage supra-méditerranéen en France, de l\'est de l\'arc alpin et du nord-est de l\'Espagne, avec des irradiations jusqu\'au sud de l\'Allemagne et la Belgique. Forêts basses médio-européennes de Quercus petraea ou de Q. robur occupant les expositions chaudes au-delà du domaine de Quercus pubescens et faisant transition avec le Quercion pubescenti-petraea par la présence de Buxus sempervirens ou d\'autres plantes calcicoles thermophiles (Limodorum abortivum, Melittis melissophyllum).');
INSERT INTO `corine` (`CD_HAB`, `FG_VALIDITE`, `CD_TYPO`, `LB_CODE`, `LB_HAB_FR`, `LB_HAB_FR_COMPLET`, `LB_HAB_EN`, `LB_AUTEUR`, `NIVEAU`, `LB_NIVEAU`, `CD_HAB_SUP`, `PATH_CD_HAB`, `FRANCE`, `LB_DESCRIPTION`, `CRSP_PHYTO_CB91`, `DESCRIPTIF_CB97_FR`) VALUES
(4230, 'NR', 22, '42.54', 'Forêts de Pins sylvestre à Erica herbacea', '', 'Spring heath Scots pine forests', '', 4, 'Niveau 4', 1263, '/68/491/1263/4230', 'true', 'Mesophile, mostly calcicolous, Pinus sylvestris forests of the intermediate Alps, and, locally, of the inner Alps, the northern outer Alps, the southeastern outer Alps, the Bavarian plateau, the serpentines of northern Bavaria, the Lake Constance area, the Baar plateau and the Jura, characterised by the presence of Erica herbacea and acompanied by Juniperus communis, Berberis vulgaris, Sorbus aria, Amelanchier ovalis, Chamaecytisus nigricans, Polygala chamaebuxus, Goodyera repens, Pyrola chlorantha, Epipactis atrorubens, Melampyrum pratense, M. sylvaticum, Carex alba, C. ornithopoda, C. humilis, C. flacca, Molinia caerulea, Calamagrostis varia, Sesleria caerulea.', 'Erico-Pinion', 'Forêts mésophiles, pour la plupart calcicoles, de Pinus sylvestris des Alpes intermédiaires et, localement, des Alpes internes, des Alpes externes septentrionales, des Alpes sud-orientales, du Jura, caractérisées par la présence d\'Erica herbacea et accompagnées de Juniperus communis, Berberis vulgaris, Sorbus aria, Amelanchier ovalis, Polygala chamaebuxus, Goodyera repens, Pyrola chlorantha, Epipactis atrorubens, Melampyrum pratense, M. sylvaticum, Carex alba, C. ornithopoda, C. humilis, C. flacca, Molinia caerulea, Calamagrostis varia, Sesleria caerulea.'),
(4231, 'NR', 22, '42.55', 'Forêts steppiques intra-alpines à Minuartia', '', 'Inner Alpine sandwort steppe forests', '', 4, 'Niveau 4', 1263, '/68/491/1263/4231', 'true', 'Xerophile, acidophilous, Pinus sylvestris forests of the montane level of southwestern inner Alpine valleys (Maurienne, Guisane, Dora-Riparia, Chisone) where they replace the formations of the Ononido-Pinion on strongly siliceous adrets, with Deschampsia flexuosa and Minuartia laricifolia dominant.', 'Deschampsio-Pinion', 'Forêts acidiphiles xérophiles de Pinus sylvestris ou de l\'étage montagnard des vallées intra-alpines sud-occidentales (Maurienne, Guisane) dans lesquelles les formations de l\'Ononido-Pinion se situent sur les adrets strictement siliceux, avec Deschampsia flexuosa et Minuartia laricifolia dominants.'),
(4232, 'NR', 22, '42.25', 'Pessières extrazonales', '', 'Enclave spruce forests', '', 4, 'Niveau 4', 1264, '/68/491/1264/4232', 'true', 'Other spontaneous Picea abies formations occupying outlying altitudinal or edaphic enclaves within the range of more predominant vegetation types.', '', 'Autres formations spontanées de Picea abies occupant des enclaves altitudinales ou édaphiques isolées à l\'intérieur de zones où prédominent d\'autres types de végétations.'),
(4233, 'NR', 22, '42.26', 'Reboisement d\'Epicéas', '', 'Spruce reforestation', '', 4, 'Niveau 4', 1264, '/68/491/1264/4233', 'true', 'Plantations of Picea abies in or near the present or recent natural range of the species, including all Hercynian and peri-Hercynian formations accompanied by semi-natural undergrowth. Intensive, very dense and out-of-station plantations of Picea abies and plantations of other Picea spp. should be listed as 83.', '', 'Plantations de Picea abies dans ou près des secteurs de spontanéité de l\'espèce, incluant les formations hercyniennes et péri-hercyniennes accompagnées par un sous-bois semi-naturel. Des plantations de Picea abies intensives, très denses et en dehors de l\'aire naturelle et des plantations d\'autres Picea spp. doivent être cataloguées comme 83.'),
(4234, 'NR', 22, '41.29', 'Chênaies-frênaies pyrénéo-cantabriques', '', 'Pyreneo-Cantabrian oak-ash forests', '', 4, 'Niveau 4', 1261, '/68/492/1261/4234', 'true', 'Forests dominated by Quercus robur, or, in parts of the Pyrenees and in the Oro-Cantabrian interior, Q. petraea, with Fraxinus excelsior, Tilia platyphyllos, Corylus avellana, Acer campestre, A. pseudoplatanus, Prunus avium, Ulmus glabra, many shrubs and lianas, abundant Hedera helix, many ferns, such as Polystichum setiferum, Dryopteris affinis, D. dilatata, Asplenium scolopendrium, and with Arum italicum, Veronica montana, Hypericum androsaemum, Primula vulgaris, Pulmonaria longifolia, Helleborus viridis ssp. occidentalis, Isopyrum thalictroides, Ajuga reptans, Carex sylvatica, Bromus racemosus, Melica uniflora, of the collinar, submontane and, in a somewhat impoverished form with Crataegus laevigata, montane levels of the piedmont of the Cordillera Cantabrica, in Navarra, Guipuzcoa, Vizcaya, Cantabria, Asturias and Castilla-Leon, as well as of the submontane level of the northern slope, and locally in Navarra and Catalonia, the southern slope of the Pyrenees.', 'Polysticho setiferi-Fraxinetum excelsioris, Crataego laevigatae-Quercetum roboris, Mercurialidi perennis-Fraxinetum excelsioris, Isopyro-Quercetum roboris', 'Forêts dominées par Quercus robur, ou, dans certaines parties des Pyrénées et à l\'intérieur des montagnes cantabriques, par Q. petraea, avec Fraxinus excelsior, Tilia platyphyllos, Corylus avellana, Acer campestre, A. pseudoplatanus, Prunus avium, Ulmus glabra, de nombreux arbustes et lianes, Hedera helix abondant, de nombreuses fougères comme Polystichum setiferum, Dryopteris affinis, D. dilatata, Asplenium scolopendrium, et avec Arum italicum, Veronica montana, Hypericum androsaemum, Primula vulgaris, Pulmonaria longifolia, Helleborus viridis subsp. occidentalis, Isopyrum thalictroides, Ajuga reptans, Carex sylvatica, Bromus racemosus, Melica uniflora, des étages collinéens, sub-montagnard et, sous une forme quelque peu appauvrie avec Crataegus laevigata, de l\'étage montagnard du piémont des Pyrénées.'),
(4235, 'NR', 22, '41.72', 'Chênaies pubescentes cyrno-sardes', '', 'Cyrno-Sardian white oak woods', '', 4, 'Niveau 4', 1265, '/68/492/1265/4235', 'true', 'Quercus pubescens (with Q. virgiliana, Q. congesta) woods of Sardinia and Corsica.', 'Lathyrion veneti', 'Bois de Quercus pubescens de Corse.'),
(4236, 'NR', 22, '41.73', 'Chênaies pubescentes orientales', '', 'Eastern white oak woods', '', 4, 'Niveau 4', 1265, '/68/492/1265/4236', 'true', 'Often varied forests of the supra-Mediterranean (mostly lower supra-Mediterranean), and occasionally meso- or thermo-Mediterranean, levels of Greece and Italy, in which Quercus pubescens or its allies are the dominant deciduous oaks, usually associated with Ostrya carpinifolia, Carpinus orientalis, C. betulus, Fraxinus ornus and other species.', 'Ostryo-Carpinion p., Cyclamino-Quercion brachyphyllae p., Cyclamino-Quercion ilicis p.', 'Forêts souvent variées des étages supra-méditerranéen (principalement le supra-méditerranéen inférieur), et occasionnellement méso- ou thermo-méditerranéen, de Grèce et d\'Italie, dans lesquelles Quercus pubescens ou ses hybrides sont les Chênes caducifoliés dominants, habituellement associés à Ostrya carpinifolia, Carpinus orientalis, C. betulus, Fraxinus ornus et d\'autres espèces.'),
(4237, 'NR', 22, '42.56', 'Forêts mésophiles pyrénéennes de Pins sylvestres', '', 'Pyrenean mesophile Scots pine forests', '', 4, 'Niveau 4', 1263, '/68/491/1263/4237', 'true', 'Montane, mossy Pinus sylvestris forests of the Pyrenees; characteristic of regions with a moderately dry, sunny climate, they occur, at all exposures but mostly on ubacs, in a wide belt on the south flank of the range, with limited outposts on the north flank. Characteristic is the abundance of wintergreens (Pyrola chlorantha, P. minor, Moneses uniflora, Orthilia secunda) and of mosses (Hylocomium splendens, Rhytidiadelphus triquetrus, Pleurozium schreberi); Vaccinium myrtillus, Luzula nivea, Hepatica nobilis are usually present.', 'Hepatico-Pinetum, Hylocomio-Pinetum, Polygalo-Pinetum', 'Forêts montagnardes moussues de Pinus sylvestris des Pyrénées, caractéristiques des régions soumises à des sécheresses modérées, à climat ensoleillé, présentes à toutes les expositions mais principalement sur les ombrées selon une large ceinture, avec des avant-postes de faible étendue sur le versant nord de la chaîne. L\'abondance des Pyroles (Pyrola chlorantha, P. minor, Moneses uniflora, Orthilia secunda) et des mousses (Hylocomium splendens, Rhytidiadelphus triquetrus, Pleurozium schreberi) est caractéristique ; Vaccinium myrtillus, Luzula nivea, Hepatica nobilis sont généralement présents.'),
(4238, 'NR', 22, '42.57', 'Forêts de Pins sylvestres du Massif central', '', 'Central Massif Scots pine forests', '', 4, 'Niveau 4', 1263, '/68/491/1263/4238', 'true', 'Montane Pinus sylvestris forests of interior, relatively dry, regions of the Central Massif in the upper Loire basin (Velay and neighbouring regions) and the Causse Méjean.', '', 'Forêts montagnardes de Pinus sylvestris de l\'intérieur, en régions relativement sèches du Massif central dans le bassin supérieur de la Loire (Velay et régions avoisinantes) et sur le Causse Méjean.'),
(3870, 'NR', 22, '11.32', 'Herbiers atlantiques à Zostères naines', '', 'Atlantic dwarf eelgrass meadows', '', 4, 'Niveau 4', 1182, '/65/475/1182/3870', 'true', 'Eelgrass beds dominated by Zostera noltii or Z. angustifolia, mostly characteristic of the low part of the intertidal zone in Atlantic and North Sea waters, sometimes permanently submerged.', 'Zosterion marinae: Zosteretum noltii', 'Végétation de Zostères dominées par Zostera noltii, principalement caractéristiques de la partie basse de la zone intertidale des eaux de l\'Atlantique et de la mer du Nord, parfois immergées en permanence.'),
(3871, 'NR', 22, '11.33', 'Herbiers méditerranéens à Cymodocea et Zostera', '', 'Mediterranean Cymodocea and Zostera beds', '', 4, 'Niveau 4', 1182, '/65/475/1182/3871', 'true', 'Beds of Cymodocea nodosa and Zostera noltii or Z. marina, permanently submerged in waters down to 10 metres deep, often in sheltered areas behind Posidonia reefs.', 'Cymodoceion nodosae p.', 'Végétations à Cymodocea nodosa et Zostera noltii ou Z. marina, immergées en permanence dans des eaux pouvant atteindre 10 mètres de profondeur, souvent dans des zones abritées en arrière des prairies de Posidonia.'),
(3872, 'NR', 22, '11.34', 'Herbiers de Posidonia', '', 'Posidonia beds', '', 4, 'Niveau 4', 1182, '/65/475/1182/3872', 'true', 'Beds of the Mediterranean and thermo-Atlantic endemic, Posidonia oceanica, permanently submerged in waters down to 100 metres deep.', 'Posidonion oceanicae', 'Végétation constituée par l\'endémique méditerranéenne et thermo-atlantique, Posidonia oceanicae, immergées en permanence jusqu\'à 100 mètres de profondeur.'),
(3873, 'NR', 22, '11.35', '', '', 'Macaronesian Cymodocea beds', '', 4, 'Niveau 4', 1182, '/65/475/1182/3873', 'false', 'Formations of Cymodocea nodosa or Cymodocea and Caulerpa spp., in particular Caulerpa prolifera, occupying large surfaces on sandy substrates at depths of 1-15 metres, around the Macaronesian Islands.', 'Cymodoceion nodosae p.', 'Pas de description disponible'),
(3874, 'NR', 22, '11.36', '', '', 'Halophila beds', '', 4, 'Niveau 4', 1182, '/65/475/1182/3874', 'false', 'Deep water colonies of Halophila spp..', '', 'Pas de description disponible'),
(3875, 'NR', 22, '15.21', 'Prairies à Spartine à feuilles plates', '', 'Flat-leaved cordgrass swards', '', 4, 'Niveau 4', 1190, '/65/477/1190/3875', 'true', 'Perennial pioneer grasslands of coastal salt muds, dominated by flat-leaved Spartina maritima, S. townsendii, S. anglica, S. alterniflora.', '', 'Prairies de pionnières pérennes des vases salées côtières, dominées par Spartina maritima, S. townsendii, S. anglica, S. alterniflora.'),
(3876, 'NR', 22, '15.22', '', '', 'Rush-leaved cordgrass swards', '', 4, 'Niveau 4', 1190, '/65/477/1190/3876', 'false', 'Perennial pioneer grasslands of southern Iberian coastal salt muds, dominated by the junciform-leaved Spartina densiflora.', '', 'Pas de description disponible'),
(3877, 'NR', 22, '15.31', 'Prés salés avec Puccinellia maritima', '', 'Saltmarsh grass meadows', '', 4, 'Niveau 4', 1183, '/65/477/1183/3877', 'true', 'Bright green lawns of Puccinellia maritima of the lower and middle schorre.', 'Puccinellion maritimae', 'Pelouses vert-vif de Puccinellia maritima du schorre bas et moyen.'),
(3878, 'NR', 22, '15.32', 'Groupements à Puccinellia maritima des prés salés', '', 'Saltmarsh grass communities', '', 4, 'Niveau 4', 1183, '/65/477/1183/3878', 'true', 'Facies of the saltmarsh grass meadows, transitional or not to other communities, in which species other than Puccinellia maritima take on an important physiognomic role.', 'Puccinellion maritimae p.', 'Faciès de prés salés avec des graminées, en transition avec d\'autres groupements ou non, dans lesquels des espèces autres que Puccinellia maritima, revêtent un rôle physionomique important.'),
(3879, 'NR', 22, '15.33', 'Communautés du schorre supérieur', '', 'Upper schorre communities', '', 4, 'Niveau 4', 1183, '/65/477/1183/3879', 'true', 'Often relatively species-rich, grassy, flowery formations of upper salt meadows, with Armeria maritima, Glaux maritima, Plantago maritima, Frankenia laevis, Artemisia maritima, Festuca rubra, Agrostis stolonifera, Juncus gerardii, Carex extensa and Blysmus rufus. The dominance of various species induces distinctive facies, among which:', 'Armerion maritimae', 'Formations souvent relativement riches en espèces, verdoyantes, fleuries, des prés salés supérieurs, avec Armeria maritima, Glaux maritima, Plantago maritima, Frankenia laevis, Artemisia maritima, Festuca rubra, Agrostis stolonifera, Juncus gerardii et Carex extensa. La dominance de diverses espèces induit des faciès distincts, parmi lesquels :'),
(3880, 'NR', 22, '15.34', 'Prés salés à Puccinellia et Spergularia marina', '', 'Pearlwort-saltmarsh grass swards', '', 4, 'Niveau 4', 1183, '/65/477/1183/3880', 'true', 'Puccinellia swards with Spergularia marina, Puccinellia distans, P. fasciculata, P. retroflexa, P. maritima, Triglochin maritima, Potentilla anserina and Halimione portulacoides, occupying zones of varying salinity and humidity, in particular in estuarine saltmarshes.', 'Puccinellio-Spergularion salinae', 'Pelouses à Puccinellia avec Spergularia marina, Puccinellia distans, P. fasciculata, P. maritima, Triglochin maritima, Potentilla anserina et Halimione portulacoides, occupant des zones de salinité et d\'humidité variables, en particulier dans les prés salés des estuaires.'),
(3881, 'NR', 22, '15.35', 'Végétation à Elymus pycnanthus', '', 'Saltmarsh couch beds', '', 4, 'Niveau 4', 1183, '/65/477/1183/3881', 'true', 'Nitrophilous tall grass communities with Elymus pycnanthus (= Agropyron pungens) or E. repens.', 'Agropyrion pungentis', 'Groupements nitrophiles de hautes herbes avec Elymus pycnanthus (Elytrigia atherica) ou E. repens (Elytrigia repens).'),
(3882, 'NR', 22, '15.36', 'Laisses de mer des prés salés atlantiques', '', 'Atlantic saltmarsh driftlines', '', 4, 'Niveau 4', 1183, '/65/477/1183/3882', 'true', 'Annual formations of pioneers colonizing driftlines forming within saltmarshes, with Atriplex littoralis, A. hastata, Beta maritima, Matricaria maritima.', '', 'Formations annuelles de pionnières colonisant les laisses des marées, se constituant au sein des marais salés, avec Atriplex littoralis, A. prostrata, Beta vulgaris subsp. maritima, Matricaria maritima.'),
(3883, 'NR', 22, '15.61', 'Fourrés des marais salés méditerranéens', '', 'Mediterranean salt scrubs', '', 4, 'Niveau 4', 1185, '/65/477/1185/3883', 'true', 'Low shrubby expanses of woody glassworts, seablites, sea purslanes or Halocnemum, characteristic of temporarily inundated salt marshes of Mediterranean coasts, southwestern Iberian coasts and interior Iberian basins. They can be further subdivided according to dominant species, generally associated with patterns of inundation. Cistanche lutea characterises many southern formations.', 'Arthrocnemion fruticosi, Suaedion brevifoliae', 'Formations basses, broussailleuses à Arthrocnemum, Suaeda, pourpier marin, caractéristiques des sansouires, étendues salées temporairement inondées, des côtes méditerranéennes. Elles peuvent être davantage subdivisées selon les espèces dominantes, généralement au rythme des inondations.'),
(3884, 'NR', 22, '15.41', 'Prés salés continentaux avec Puccinellia distans', '', 'Interior saltmarsh grass meadows', '', 4, 'Niveau 4', 1184, '/65/477/1184/3884', 'true', 'Meadows of Puccinellia distans occupying the lower levels of interior salt basins with fairly extended periods of inundation.', 'Puccinellion distantis', 'Prés avec Puccinellia distans occupant le niveau inférieur des bassins salés intérieurs avec des périodes d\'inondations assez prolongées.'),
(3885, 'NR', 22, '15.42', 'Prés salés continentaux à jonc et Elymus', '', 'Interior saltmarsh rush and couch beds', '', 4, 'Niveau 4', 1184, '/65/477/1184/3885', 'true', 'Formations dominated by Juncus gerardii or Elymus repens of the upper levels of interior salt basins on damp, less saline soils.', 'Juncion gerardii p.', 'Formations dominées par Juncus gerardii ou Elymus repens du niveau supérieur des bassins salés intérieurs sur sols humides, moins salés.'),
(3886, 'NR', 22, '15.43', '', '', 'Interior stalked orache beds', '', 4, 'Niveau 4', 1184, '/65/477/1184/3886', 'false', 'Formations dominated by the threatened Halimione pedunculata restricted to saltmarshes east and south of the Harz.', '', 'Pas de description disponible'),
(3887, 'NR', 22, '15.51', 'Prés salés méditerranéens à Juncus maritimus et J. acutus', '', 'Mediterranean tall rush saltmarshes', '', 4, 'Niveau 4', 1186, '/65/477/1186/3887', 'true', 'Beds of Juncus maritimus or J. acutus of periodically inundated depressions, with Carex extensa, Iris spuria, Gladiolus communis, Aster tripolium, Sonchus maritimus, S. crassifolius.', 'Juncion maritimi p.', 'Zones à Juncus maritimus ou J. acutus des dépressions périodiquement inondées, avec Carex extensa, Iris spuria, Gladiolus communis, Aster tripolium, Sonchus maritimus.'),
(3888, 'NR', 22, '15.52', 'Prés salés à Juncus gerardii et Carex divisa', '', 'Mediterranean short rush, sedge, barley and clover saltmarshes', '', 4, 'Niveau 4', 1186, '/65/477/1186/3888', 'true', 'Humid meadows of low vegetation dominated by Juncus gerardii, Carex divisa, C. extensa, Hordeum marinum or Trifolium spp. and Lotus spp. of the edges of brackish lagoons.', 'Trifolion maritimi, Juncion maritimi p.', 'Prés humides à végétation basse dominée par Juncus gerardii, Carex divisa, C. extensa, Hordeum marinum ou Trifolium spp. et Lotus spp. des bords des lagunes saumâtres.'),
(3889, 'NR', 22, '15.53', 'Prés méditerranéens halo-psammophiles', '', 'Mediterranean halo-psammophile meadows', '', 4, 'Niveau 4', 1186, '/65/477/1186/3889', 'true', 'Drier, dense formations of sandy soils at the foot of dunes, or between dunes and lagoons, with Plantago crassifolia, Schoenus nigricans, Juncus acutus, J. littoralis, Spartina versicolor, all of which may dominate and form physiognomically distinct, sometimes almost monospecific, facies.', 'Plantaginion crassifoliae', 'Formations plus sèches, denses des sols sableux au pied des dunes, ou entre dunes et lagunes, avec Plantago crassifolia, Schoenus nigricans, Juncus acutus, J. littoralis, Spartina versicolor, chacune de ces espèces peut dominer et former des faciès physionomiquement distincts, quelquefois presque monospécifiques.'),
(3890, 'NR', 22, '15.54', '', '', 'Interior Iberian salt pan meadows', '', 4, 'Niveau 4', 1186, '/65/477/1186/3890', 'false', 'Salt meadows peculiar to the lowest, wettest parts of interior Iberian depressions, dominated by Puccinellia fasciculata or Aeluropus littoralis in the very lowest areas, or, slightly higher, by Juncus gerardii. The higher, drier ground that surrounds them is occupied either by other salt meadow communities that are less differentiated from the coastal communities (15.51 - 15.53) or by salt scrubs (15.615).', 'Puccinellion fasciculatae', 'Pas de description disponible'),
(3891, 'NR', 22, '15.55', 'Prés salés méditerranéens à Puccinellia', '', 'Mediterranean saltmarsh grass swards', '', 4, 'Niveau 4', 1186, '/65/477/1186/3891', 'true', 'Dense formations of Puccinellia festuciformis and Aeluropus littoralis along Mediterranean coasts and coastal lagoons.', 'Puccinellion festuciformis', 'Formations denses de Puccinellia festuciformis et Aeluropus littoralis le long des côtes méditerranéennes et des lagunes côtières.'),
(65, 'NR', 22, '1', 'Habitats littoraux et halophiles', '', 'Coastal and halophytic communities', '', 1, 'Niveau 1', 65, '/65', 'true', '', '', 'Pas de description disponible'),
(66, 'NR', 22, '2', 'Milieux aquatiques non marins', '', 'Non-marine waters', '', 1, 'Niveau 1', 66, '/66', 'true', '', '', 'Pas de description disponible'),
(67, 'NR', 22, '3', 'Landes, fruticées, pelouses et prairies', '', 'Scrub and grassland', '', 1, 'Niveau 1', 67, '/67', 'true', '', '', 'Pas de description disponible'),
(68, 'NR', 22, '4', 'Forêts', '', 'Forests', '', 1, 'Niveau 1', 68, '/68', 'true', '', '', 'Pas de description disponible'),
(69, 'NR', 22, '6', 'Rochers continentaux, éboulis et sables', '', 'Inland rocks, screes and sands', '', 1, 'Niveau 1', 69, '/69', 'true', '', '', 'Pas de description disponible'),
(70, 'NR', 22, '8', 'Terres agricoles et paysages artificiels', '', 'Agricultural land and artificial landscapes', '', 1, 'Niveau 1', 70, '/70', 'true', 'Cultivated or built-up areas under the overwhelming influence of human activity; the natural vegetation cover has been totally replaced as a result of agricultural practices, urbanization or industrialization. A natural flora and fauna subsists mainly in areas of extensive and traditional cultivation and dwelling. Wild plants may grow among crops, in hedges, along roads, on walls and in fallow fields. Many animals have, during the course of the past few thousand years, adapted to these man-created habitats.', '', 'Surfaces cultivées ou construites sous l\'influence prédominante de l\'activité humaine ; la couverture de végétation naturelle a été totalement remplacée en raison des pratiques agricoles, de l\'urbanisation ou de l\'industrialisation. Une flore et une faune naturelle subsistent principalement dans des régions de cultures extensives et traditionnelles. Des plantes sauvages peuvent pousser entre les cultures, dans les haies, le long des routes, sur des murs et sur des terrains en friche. De nombreux animaux, durant les derniers millénaires, se sont adaptés à ces habitats créés par l\'homme.'),
(71, 'NR', 22, '5', 'Tourbières et marais', '', 'Bogs and marshes', '', 1, 'Niveau 1', 71, '/71', 'true', '', '', 'Pas de description disponible'),
(490, 'NR', 22, '34', 'Pelouses calcicoles sèches et steppes', '', 'Dry calcareous grasslands and steppes', '', 2, 'Niveau 2', 67, '/67/490', 'true', 'Dry thermophilous grasslands of the lowlands, hills and montane zone, on mostly calcareous soils, sands, decomposed rock surfaces; pseudosteppes; thermophile forest fringe formations.', '', 'Pelouses sèches et thermophiles des plaines, collines (étage collinéen) et étage montagnard, sur des sols principalement calcaires, sur sables, à la surface de rochers décomposés ; steppes ; formations de lisières forestières thermophiles.'),
(491, 'NR', 22, '42', 'Forêts de conifères', '', 'Coniferous woodland', '', 2, 'Niveau 2', 68, '/68/491', 'true', 'Forests and woodland of native coniferous trees other than floodplain and mire woods; formations dominated by coniferous trees, but comprising broad-leaved evergreen trees, are included.', '', 'Forêts et bois de conifères indigènes, à l\'exception des forêts riveraines et des forêts marécageuses ; formations dominées par des conifères, y compris celles incluant des feuillus sempervirents.'),
(492, 'NR', 22, '41', 'Forêts caducifoliées', '', 'Broad-leaved deciduous forests', '', 2, 'Niveau 2', 68, '/68/492', 'true', 'Forests and woodland of native deciduous trees, other than floodplain or mire woods; forests dominated by broad-leaved deciduous trees, but comprising broad-leaved evergreen trees, are included.', '', 'Forêts et terrains boisés d\'arbres indigènes caducifoliés (autres que des forêts riveraines ou de terrains marécageux). Les forêts dominées par des feuillus caducifoliés mais comprenant des espèces sempervirentes sclérophylles sont incluses.'),
(493, 'NR', 22, '35', 'Pelouses silicicoles sèches', '', 'Dry siliceous grasslands', '', 2, 'Niveau 2', 67, '/67/493', 'true', 'Poor Atlantic and sub-Atlantic mat-grasslands of strongly acid soils; grasslands of decalcified sands; Mediterranean siliceous grasslands.', '', 'Pelouses atlantiques et sub-atlantiques des sols fortement acides et pauvres ; pelouses des sables décalcifiés ; pelouses silicicoles méditerranéennes.'),
(494, 'NR', 22, '38', 'Prairies mésophiles', '', 'Mesophile grasslands', '', 2, 'Niveau 2', 67, '/67/494', 'true', 'Lowland and montane mesophile pastures and hay meadows.', '', 'Pâturages et prairies fauchées mésophiles de plaine et de montagne.'),
(495, 'NR', 22, '36', 'Pelouses alpines et subalpines', '', 'Alpine and subalpine grasslands', '', 2, 'Niveau 2', 67, '/67/495', 'true', 'Grasslands of the alpine and subalpine levels of the Alps, Pyrenees, Cantabrian range, Jura, Central Massif and northern Apennines, with very fragmentary outposts in the great Hercynian ranges of middle Europe, Bayerischer Wald, Harz, Black Forest, Erz-Riesengebirge and in the Caledonian system of Britain; grasslands of the oro- and cryoro-Mediterranean levels (sensu Peinado Lorca and Rivas- Martinez,1987) or of the alti-Mediterranean level (sensu Ozenda, 1975, 1985) of the Iberian mountains, of the Apennines and of the Greek ranges.', '', 'Pelouses des étages alpin et subalpin des Alpes, des Pyrénées, du Jura, du Massif central, avec des avants-postes très fragmentaires dans la grande région hercynienne de l\'Europe moyenne ; pelouses des étages oro-méditerranéen et cryo-méditerranéen (sensu Peinadi Lorca et Rivas-Martinez, 1987) de Corse, ... .'),
(496, 'NR', 22, '37', 'Prairies humides et mégaphorbiaies', '', 'Humid grasslands and tall herb communities', '', 2, 'Niveau 2', 67, '/67/496', 'true', 'Unimproved or lighly improved wet meadows; tall herb communities.', '', 'Prairies humides non fertilisées ou faiblement fertilisées ; mégaphorbiaies.'),
(497, 'NR', 22, '61', 'Eboulis', '', 'Screes', '', 2, 'Niveau 2', 69, '/69/497', 'true', 'Vegetated or sparsely vegetated and frequently unstable areas of stones, boulders or rubble on steep slopes, produced by erosion in mountainous terrain. They are mostly developed in the Alps, the Pyrenees and the Mediterranean mountains and hills.', 'Thlaspietea rotundifolii p., Drypetea spinosae i.a.', 'Surfaces végétalisées ou partiellement végétalisées et fréquemment instables constituées de pierres, de blocs, de galets ou de débris rocheux sur les versants escarpés, engendrées par l\'érosion en terrain montagneux. Elles sont bien dévéloppées dans les Alpes, les Pyrénées et les montagnes méditerranéennes ainsi que dans les collines.'),
(498, 'NR', 22, '65', 'Grottes', '', 'Caves', '', 2, 'Niveau 2', 69, '/69/498', 'true', 'Any natural caves or cave systems. They harbour varied communities of animals that are strictly restricted to them. A classification of caves based on the presence of these communities should be used to subdivide this unit. Provisionally, the following, containing unique endemic vertebrates must, at the very least, be distinguished.', '', 'Toute grotte naturelle ou tout système cavernicole naturel. Ils donnent asile à diverses communautés animales qui leurs sont strictement inféodées. La classification des grottes basée sur la présence de ces communautés doit être utilisée pour subdiviser cette unité. Provisoirement, ce qui suit, contenant uniquement des vertébrés endémiques, doit, au bas mot, être distingué.'),
(499, 'NR', 22, '66', 'Communautés des sites volcaniques', '', 'Volcanic features', '', 2, 'Niveau 2', 69, '/69/499', 'true', 'Sites and products of recent volcanic activity harbouring distinct biological communities.', '', 'Sites et produits de l\'activité volcanique récente hébergeant des communautés biologiques distinctes.'),
(500, 'NR', 22, '81', 'Prairies améliorées', '', 'Improved grasslands', '', 2, 'Niveau 2', 70, '/70/500', 'true', 'Heavily fertilized or reseeded permanent grasslands, sometimes even treated by selective herbicides, with very impoverished flora and fauna.', '', 'Prairies permanentes semées ou très fortement fertilisées, parfois aussi traitées avec des herbicides sélectifs, avec une flore et une faune appauvries.'),
(501, 'NR', 22, '82', 'Cultures', '', 'Crops', '', 2, 'Niveau 2', 70, '/70/501', 'true', 'Fields of cereals, beets, sunflowers, leguminous fodder, potatoes and other annually harvested plants. Faunal and floral quality and diversity depend on the intensity of agricultural use and on the presence of borders of natural vegetation between fields. If a tree layer is present, it can be indicated by simultaneous use of a code of 83 or 84 with the present one.', '', 'Champs de céréales, betteraves, tournesols, légumineuses fourragères, pommes de terre et autres plantes récoltées annuellement. La qualité et la diversité faunistiques et floristiques dépendent de l\'intensité des pratiques agricoles et de la présence de marges ou de bordures de végétation naturelle entre les champs. Si des arbres sont présents, ils peuvent être indiqués simultanément par l\'usage des codes 83 ou 84 en complément du présent code.'),
(502, 'NR', 22, '83', 'Vergers, bosquets et plantations d\'arbres', '', 'Orchards, groves and tree plantations', '', 2, 'Niveau 2', 70, '/70/502', 'true', 'Ligneous crops. Extensive orchards and old plantations may support a rich flora and fauna; it is in particular the case of ancient olive groves and old poplar plantations with tall herb undergrowth.', '', 'Cultures de ligneux. Des vergers extensifs et des vieilles plantations peuvent supporter une flore et une faune riches ; c\'est, en particulier, le cas d\'anciens vergers à Oliviers et de vieilles plantations de Peupliers avec une strate inférieure à hautes herbes.'),
(503, 'NR', 22, '62', 'Falaises continentales et rochers exposés', '', 'Inland cliffs and exposed rocks', '', 2, 'Niveau 2', 69, '/69/503', 'true', 'Cliffs, rock faces, limestone pavements, the plant communities that colonize their cracks, and their associated animal communities.', 'Asplenietea trichomanis, Adiantetea capilli-veneris i.a.', 'Falaises, parois rocheuses, dalles calcaires, les communautés végétales qui colonisent leurs fissures, et les communautés animales qui leurs sont associées.'),
(504, 'NR', 22, '54', 'Bas-marais, tourbières de transition et sources', '', 'Fens, transition mires and springs', '', 2, 'Niveau 2', 71, '/71/504', 'true', 'Small-sedge and related communities of fens, transition mires and quaking bogs; vegetation of springs.', '', 'Communautés de bas-marais à petites laîches et apparentées, des tourbières de transition et des marais tremblants ; végétation de sources.'),
(505, 'NR', 22, '84', 'Alignements d\'arbres, haies, petits bois, bocage, parcs', '', 'Tree lines, hedges, small woods, bocage, parkland, dehesa', '', 2, 'Niveau 2', 70, '/70/505', 'true', 'Wooded habitats of small size, arranged in a linear, reticulated or insular manner, closely interwoven with grassy or cultivated habitats. Also, combinations of such elements and mixed agricultural formations, containing both ligneous and herbaceous layers. Landscapes in which pastures, crops and woodland elements are intimately mixed can be described by use of the first three codes below (if useful, specified by codes from 31.8, 41, 42 and 83) in conjunction with other codes from section 8 and other open habitat sections. Extensive surfaces characterized by mixed agricultural formations, and in particular, those that combine ligneous and herbaceous elements on the same surfaces can be designated by one of the codes 84.4, 84.5 or 84.6 and their elements specified by use of other codes from section 8 or any other.', '', 'Habitats boisés de petite taille, disposés de façon linéaire, en réseaux ou en îlots, intimement entremêlés d\'habitats herbeux ou de cultures. Egalement les combinaisons de ces éléments, et des formations agricoles, composées de strates ligneuse et herbacée. Les paysages dans lesquels les pâturages, les cultures et les bois sont intimement mélangés peuvent être décrits par l\'utilisation des trois premiers codes ci-dessous (si nécessaire, précisés par des codes de 31.8, 41, 42 et 83) en conjonction avec d\'autres codes de la section 8 et d\'autres sections d\'habitats ouverts. Les surfaces extensives caractérisées par des formations agricoles mélangées, et en particulier celles qui combinent des éléments ligneux et herbacés sur les mêmes surfaces, peuvent être désignées par l\'un des codes 84.4, 84.5 ou 84.6 et leurs éléments spécifiés par l\'utilisation d\'autres codes de la section 8 ou d\'autres.'),
(506, 'NR', 22, '85', 'Parcs urbains et grands jardins', '', 'Urban parks and large gardens', '', 2, 'Niveau 2', 70, '/70/506', 'true', 'Usually varied formations, created for recreational use. The vegetation, usually composed mainly of introduced species or cultivars, can nevertheless include many native plants and supports a varied fauna when not intensively managed. The heterogeneity of the habitat engenders a high faunal diversity with, however, a preponderance of common species. The frequent presence of old trees favours the installation of rarer species.', '', 'Formations habituellement variées, créées à des fins récréatives. La végétation, habituellement surtout composée d\'espèces introduites ou cultivées, peut néanmoins comprendre beaucoup de plantes indigènes et peut supporter une faune variée quand elle n\'est pas intensivement gérée. L\'hétérogénéité des habitats engendre une grande diversité faunistique avec, quoi qu\'il en soit, une prépondérance des espèces communes. La présence fréquente des vieux arbres favorise l\'installation d\'espèces plus rares.'),
(507, 'NR', 22, '86', 'Villes, villages et sites industriels', '', 'Towns, villages, industrial sites', '', 2, 'Niveau 2', 70, '/70/507', 'true', 'Areas used for human occupation and industrial activities. A considerable fauna has adapted to buildings. Birds such as Apus apus, Tyto alba and Hirundo rustica nest nearly exclusively in them, using mostly structures with traditional architecture. Other species, of montane rocky habitats, such as Phoenicurus ochruros, have colonized lowlands in villages and towns. Bats roost in buildings. Rock plants colonize old walls and roofs.', '', 'Aires utilisées pour l\'occupation humaine et les activités industrielles. Une faune considérable s\'est adaptée aux constructions. Des oiseaux comme Apus apus, Tyto alba et Hirundo rustica y nichent presque exclusivement, utilisant surtout les structures dont l\'architecture est traditionnelle. D\'autres espèces, des habitats rocheux de montagne, comme Phoenicurus ochruros, ont colonisés dans les villages et les villes des basses altitudes. Des Chauves-Souris se logent dans les constructions. Les plantes de rochers colonisent les vieux murs et les toits.'),
(508, 'NR', 22, '87', 'Terrains en friche et terrains vagues', '', 'Fallow land, waste places', '', 2, 'Niveau 2', 70, '/70/508', 'true', 'Fields abandoned or left to rest, roadsides and other interstitial spaces on disturbed ground. They are colonised by numerous pioneering, introduced or nitrophilous plants. They sometimes provide habitats that can be used by animals of open spaces.', '', 'Champs abandonnés ou au repos (jachères), bords de route et autres espaces interstitiels sur des sols perturbés. Ils sont colonisés par de nombreuses plantes pionnières introduites ou nitrophiles. Ils fournissent parfois des habitats qui peuvent être utilisés par des animaux d\'espaces ouverts.'),
(509, 'NR', 22, '88', 'Mines et passages souterrains', '', 'Mines and underground passages', '', 2, 'Niveau 2', 70, '/70/509', 'true', 'Artificial underground spaces. They may constitute important substitute habitats for cave-dwelling animals such as bats.', '', 'Espaces souterrains artificiels. Ils peuvent constituer des habitats de substitution pour des animaux habitant dans des cavernes comme les Chauves-Souris.'),
(510, 'NR', 22, '89', 'Lagunes et réservoirs industriels, canaux', '', 'Industrial lagoons and reservoirs, canals', '', 2, 'Niveau 2', 70, '/70/510', 'true', 'Very artificial aquatic habitats; semi-natural communities that might colonize them can be indicated by use of codes of 15, 22, 23 or 24.', '', 'Habitats aquatiques très artificiels ; les communautés semi-naturelles qui peuvent les coloniser peuvent être indiquées par l\'utilisation des codes de 15, 22.'),
(511, 'NR', 22, '63', 'Neiges et glaces éternelles', '', 'Eternal snow and ice', '', 2, 'Niveau 2', 69, '/69/511', 'true', 'High mountain zones occupied by glaciers or by perennial snow. They are inhabited by algae (eg. Chlamydomonas nivalis) and invertebrates.', '', 'Zones de haute montagnes occupées par des glaciers ou par des neiges permanentes. Elles sont habitées par des algues (p.ex. Chlamydomonas nivalis) et des invertébrés.'),
(512, 'NR', 22, '64', 'Dunes sableuses continentales', '', 'Inland sand-dunes', '', 2, 'Niveau 2', 69, '/69/512', 'true', 'Sand bodies of eolian origin, possessing constructional relief and separated from the coast and its dune cordons by non-dunal habitats. They support a vegetation which differs markedly from coastal sand dune communities.', '', 'Dépôts sableux d\'origine éolienne, formant des reliefs construits, et séparés de la côte et du cordon de dunes par des habitats non-dunaires. Elles servent de support à des végétations qui diffèrent manifestement des communautés de dunes sableuses littorales.'),
(513, 'NR', 22, '53', 'Végétation de ceinture des bords des eaux', '', 'Water-fringe vegetation', '', 2, 'Niveau 2', 71, '/71/513', 'true', 'Reed beds and large sedge communities of the margins of lakes, rivers, and brooks and of fens and eutrophic marshes.', 'Phragmitetea', 'Communautés de Roseaux (roselières) et de grandes Laîches (cariçaies) de bordure des lacs, des rivières, des ruisseaux et des marais, des marécages eutrophes.'),
(514, 'NR', 22, '43', 'Forêts mixtes', '', 'Mixed woodland ', '', 2, 'Niveau 2', 68, '/68/514', 'true', 'Forest and woodland of mixed deciduous and coniferous trees. Detailed habitats can be coded by transposing subdivisions of division 41, simply replacing prefix 41 by prefix 43. Mixed coniferous and broad-leaved evergreen woodland should not be listed under 43, but under 42 or 45, depending on dominance.', '', 'Forêts et bois mixtes d\'essences caducifoliés et de résineux en mélange. Les habitats spécifiques peuvent être codés par la transposition des subdivisions de la division 41, en remplaçant simplement le préfixe 41 par le préfixe 43. Les forêts mixtes de résineux et d\'essences sclérophylles sempervirentes ne sont pas classées sous 43, mais sous 42 ou 45 en fonction de la dominance.'),
(515, 'NR', 22, '44', 'Forêts riveraines, forêts et fourrés très humides', '', 'Alluvial and very wet forests and brush', '', 2, 'Niveau 2', 68, '/68/515', 'true', 'Tree and shrub vegetation of flood plains, marshes, fens and bogs.', '', 'Végétation arborescente et arbustive des plaines inondables, des marais, des marécages et des tourbières.'),
(516, 'NR', 22, '52', 'Tourbières de couverture', '', 'Blanket bogs', '', 2, 'Niveau 2', 71, '/71/516', 'true', 'Communities similar to raised bogs, on flat or gently sloping ground with poor surface drainage, in oceanic climates with heavy rainfall, characteristic of the western and northern British Isles. In spite of some lateral water flow, blanket bogs are mostly ombrotrophic. They often cover extensive areas with local topographic features supporting distinct communities. Sphagnums (S. papillosum, S. tenellum, S. compactum, S. magellanicum) play an important role in all of them, accompanied by Narthecium ossifragum, Molinia caerulea, Scirpus cespitosus, Schoenus nigricans, Eriophorum angustifolium, E. vaginatum. High and low altitude forms and numerous variants can be distinguished. Blanket bogs constitute a habitat endemic to northwestern Europe, of which intact examples are relatively uncommon.', 'Sphagnetalia magellanici: Oxycocco-Ericion tetralicis (Calluno-Sphagnion papillosi, Erico-Sphagnion papillosi) p.; Scheuchzerietalia palustris p., Utricularietalia intermedio-minoris p., Caricetalia fuscae p.', 'Communautés semblables à celles des tourbières bombées, développées sur des substrats plats ou faiblement inclinés avec un mauvais drainage de surface, sous des climats océaniques (avec de fortes précipitations), caractéristiques des îles Britanniques septentrionales et occidentales. En dépit d\'un certain écoulement latéral, les tourbières de couverture sont généralement ombrotrophes. Elles couvrent souvent des surfaces étendues, dont les accidents topographiques et supportent des communautés distinctes. Les Sphaignes (S. papillosum, S. tenellum, S. compactum, S. magellanicum) jouent un rôle important dans tous les cas, accompagnées de Narthecium ossifragum, Molinia caespitosa, Trichophorum cespitosum, Schoenus nigricans, Eriophorum angustifolium, E. vaginatum. Des formes de haute et basse altitude et de nombreuses variantes peuvent être distinguées. Les tourbières de couverture constituent un habitat endémique de l\'Europe nord-occidentale, dont les exemples de conservation sont relativement rares.'),
(517, 'NR', 22, '45', 'Forêts sempervirentes non résineuses', '', 'Broad-leaved evergreen woodland', '', 2, 'Niveau 2', 68, '/68/517', 'true', 'Mediterranean forests dominated by broad-leaved evergreen trees.', '', 'Forêts méditerranéennes dominées par des feuillus sempervirents et sclérophylles.'),
(518, 'NR', 22, '51', 'Tourbières hautes', '', 'Raised bogs', '', 2, 'Niveau 2', 71, '/71/518', 'true', 'Highly oligotrophic, strongly acidic communities composed mainly of sphagnum growing on, and forming, peat and deriving moisture and nutrients only from rainfall (ombrotrophic). They form only in cool climates with heavy rainfall and are characteristic of lowlands and hills of northwestern and northern Europe, the adjacent Hercynian ranges, the Jura and the Alps. Their independence from ground water is the result either of upward growth or of changes in the water table. Bogs harbour, in addition to various sphagnum species, which are abundant, dominant and the major component of their formation, a small number of acidophilous plants such as Eriophorum vaginatum, Scirpus (Trichophorum) cespitosus, Carex pauciflora, C. paupercula, Ledum palustre, Vaccinium oxycoccos, Andromeda polifolia, Drosera rotundifolia and lichens. Animal species are not numerous but those that are adapted to bogs are highly specialised. Among typical invertebrates figure dragonflies (Leucorrhinia dubia, Aeshna subarctica, A. caerulea, A. juncea, Somatochlora arctica, S. alpestris), lepidopterans (Colias palaeno, Boloria aquilonaris, Coenonympha tullia, Vacciniina optilete, Hypenodes turfosalis, Eugraphe subrosea), beetles, ants (Formica exsecta), bugs and spiders (Pardosa sphagnicola, Glyphesis cottonae).  Most of the species that bogs harbour are rare and their populations fragmented into isolated relictual elements; several are threatened. The remaining intact or nearly intact communities are exceptional.', 'Sphagnetalia magellanici, Scheuchzerietalia palustris p., Utricularietalia intermedio-minoris p., Caricetalia fuscae p.', 'Communautés très oligotrophes, strictement acidiphiles, composées surtout de Sphaignes édifiant des tourbières et dont l\'eau et les nutriments sont d\'origine uniquement pluviale (ombrotrophes). Elles se forment seulement sous des climats froids à précipitations élevées et sont caractéristiques des plaines et des collines du nord-ouest et du nord de l\'Europe et des massifs hercyniens voisins, du Jura et des Alpes. Leur indépendance vis-à-vis de l\'eau du sol est le résultat de leur croissance en hauteur ou du changement du régime des eaux. Les tourbières abritent, outre différentes espèces de Sphaignes, dont l\'abondance et la dominance en font la composante principale de ces formations, un nombre restreint de plantes acidiphiles telles que Eriophorum vaginatum, Trichophorum cespitosum, Carex pauciflora, Vaccinium oxycoccos, Andromeda polifolia, Drosera rotundifolia et des Lichens. Les espèces animales ne sont pas nombreuses en raison de la haute spécialisation que requiert l\'adaptation aux tourbières. Parmi les invertébrés typiques figurent les Libellules (Odonates : Leucorrhinia dubia, Aeshna subartica, A. caerulae, A. juncea, Somatochora arctica, S. alpestris), des Lépidoptères (Colias palaeno, Boloria aquilonaris, Coenonympha tullia, Vacciniina optilete, Hypenodes turfosalis, Eugraphe subrosea), des Demoiselles, des Fourmis (Formica exsecta), des Punaises et des Araignées (Pardosa shagnicola, Glyphesiscottonae). La plupart de ces espèces qui vivent dans les tourbières sont rares et leurs populations sont fragmentées en éléments isolés relictuels ; plusieurs sont menacées. Les communautés intactes ou à peu près intactes sont devenues exceptionnelles.'),
(473, 'NR', 22, '12', 'Bras de mer', '', 'Sea inlets', '', 2, 'Niveau 2', 65, '/65/473', 'true', 'Bays and narrow channels, including sea lochs or loughs, fiords or fiards, rias and straits but excluding estuaries. Detailed habitats can be coded by transposing subdivisions of prefix 11, simply replacing prefix 11 by prefix 12.', '', 'Baies et chenaux étroits, incluant les lochs marins, fjords, rias et détroits mais excluant les estuaires. Le détail des habitats peut être indiqué en transposant les subdivisions du code 11, remplaçant simplement le préfixe 11 par le préfixe 12.'),
(474, 'NR', 22, '13', 'Estuaires et rivières tidales (soumises à marées)', '', 'Tidal rivers and estuaries', '', 2, 'Niveau 2', 65, '/65/474', 'true', 'River channels below the tidal limit, including the water and the channel bed but not the fringing vegetation.', '', 'Lits des rivières jusqu\'à la limite d\'influence des marées, incluant les eaux et le lit mais pas les communautés de végétation riveraine.'),
(475, 'NR', 22, '11', 'Mers et océans', '', 'Ocean and seas', '', 2, 'Niveau 2', 65, '/65/475', 'true', 'Oceanic and continental shelf waters, their associated open-water and bottom communities, and marine vascular vegetation beds.', '', 'Eaux océaniques et du plateau continental, leurs communautés associées pélagiques et benthiques et les herbiers de phanérogames marines.'),
(476, 'NR', 22, '14', 'Vasières et bancs de sable sans végétations', '', 'Mud flats and sand flats', '', 2, 'Niveau 2', 65, '/65/476', 'true', 'Sands and muds, submerged for part of every tide, devoid of vascular plants, but usually coated by blue algae and diatoms. They are of particular importance as feeding grounds for wildfowl and waders. The diverse intertidal communities of invertebrates and algae that occupy them can be used to define subdivisions of 14. Eelgrass communities that may be exposed for a few hours in the course of every tide have been listed under 11.3, 12.3 or 13.3, depending on the physical location of the flats.', '', 'Sables, vases, sablons, tangues, inondés une partie de la marée, dépourvus de plantes vasculaires, mais habituellement colonisés par des algues bleues et des diatomées. Ils ont une importance particulière comme source de nourriture pour les anatidés et les limicoles. Les communautés intertidales avec divers invertébrés et algues qui les occupent peuvent être utilisés pour définir les subdivisions de 14. Les communautés à Zostères qui peuvent être découverts durant quelques heures à chaque marée ont été listés en 11.3, 12.3 ou 13.3, selon la localisation physique des bancs.'),
(477, 'NR', 22, '15', 'Marais salés, prés salés (schorres), steppes salées et fourrés sur gypse', '', 'Salt marshes, salt steppes and gypsum scrubs', '', 2, 'Niveau 2', 65, '/65/477', 'true', 'Plant communities which are submerged by high tides at some stage of the annual tidal cycle. Also continental and coastal halophile and gypsophile communities.', '', 'Communautés végétales inondées lors des grandes marées d\'équinoxe. Egalement communautés continentales et côtières, halophiles et gypsophiles.'),
(478, 'NR', 22, '16', 'Dunes côtières et plages de sable', '', 'Coastal sand-dunes and sand beaches', '', 2, 'Niveau 2', 65, '/65/478', 'true', 'Sand-covered shorelines in general, but in particular, onshore areas of sand created by the action of wind and often colonised and stabilised by communities of coarse maritime grasses.', '', 'Ligne de rivage couverte de sable ; zones sableuses créées par l\'action du vent et souvent colonisées et stabilisées par des communautés de graminées maritimes communes.'),
(479, 'NR', 22, '17', 'Plages de galets', '', 'Shingle beaches', '', 2, 'Niveau 2', 65, '/65/479', 'true', 'Beaches covered by pebbles, or sometimes boulders, usually formed by wave action.', '', 'Plages couvertes de galets petits ou gros, habituellement formées par l\'action des vagues.'),
(480, 'NR', 22, '18', 'Côtes rocheuses et falaises maritimes', '', 'Cliffs and rocky shores', '', 2, 'Niveau 2', 65, '/65/480', 'true', 'Rock exposures adjacent to the sea or to saline lakes, or separated from them by a narrow shoreline. In addition to their botanical significance, they are often important as nesting sites for sea birds.', '', 'Rochers exposés en bordure de mer ou de lacs salés, ou séparés d\'eux par une étroite ligne de rivage. Au-delà de leur intérêt botanique, ce sont souvent des sites d\'importance pour la nidification des oiseaux marins.');
INSERT INTO `corine` (`CD_HAB`, `FG_VALIDITE`, `CD_TYPO`, `LB_CODE`, `LB_HAB_FR`, `LB_HAB_FR_COMPLET`, `LB_HAB_EN`, `LB_AUTEUR`, `NIVEAU`, `LB_NIVEAU`, `CD_HAB_SUP`, `PATH_CD_HAB`, `FRANCE`, `LB_DESCRIPTION`, `CRSP_PHYTO_CB91`, `DESCRIPTIF_CB97_FR`) VALUES
(481, 'NR', 22, '19', 'Ilots, bancs rocheux et récifs', '', 'Islets and rock stacks', '', 2, 'Niveau 2', 65, '/65/481', 'true', 'Small islands in the sea or in large bodies of water, mostly important as sites for water bird colonies. Other codes, in particular those of 18, can be used to indicate the habitats supported.', '', 'Petites îles en mer ou dans de grandes étendues d\'eau, surtout importantes, comme sites pour les colonies d\'oiseaux aquatiques. D\'autres codes, en particulier ceux de 18, peuvent être utilisés pour signaler ces habitats.'),
(482, 'NR', 22, '1A', '', '', 'Machair', '', 2, 'Niveau 2', 65, '/65/482', 'false', 'Plains behind dunes especially characteristic of the western seaboard of the Outer Hebrides. Wind-blown calcareous sands deposited on peat support a flower-rich, and correspondingly insect-rich, dune grassland studded with shallow lochs and cultivated on a strip rotation. The grassland is dominated by Poa pratensis and Festuca rubra, accompanied by Thalictrum minus ssp. arenarium, Thymus praecox ssp. arcticus (T. drucei), Bellis perennis, Prunella vulgaris, Erodium cicutarium, Trifolium spp., Euphrasia spp. and many orchids, among which Dactylorhiza fuchsii ssp. hebridensis, D. purpurella, Gymnadenia conopsea, Coeloglossum viride, Platanthera chlorantha and Orchis mascula are the most prominent. This grassland harbours a plant community of very restricted distribution comprising vulnerable species; Cochlearia scotica, Euphrasia marshallii and Dactylorhiza fuchsii ssp. hebridensis are endemic. Other elements of the ecosystem, such as pools and fallow fields, can be noted by addition of codes from other units (22, 16.2, 34, 37, 53, 54, 82, 87). As a whole, machair is an essential habitat for breeding waders such as Haematopus ostralegus, Vanellus vanellus, Charadrius hiaticula, Calidris alpina, Tringa totanus and Gallinago gallinago; it supports the healthiest European population of the threatened corncrake Crex crex.', '', 'Pas de description disponible'),
(483, 'NR', 22, '21', 'Lagunes', '', 'Lagoons', '', 2, 'Niveau 2', 66, '/66/483', 'true', 'Saline or hypersaline coastal waters, often formed from sea inlets by silting and cut off from the sea by sand or mud banks. The presence of vegetation can be indicated by addition of codes 23.21 or 23.22.', '', 'Eaux côtières salées voire hypersalines, souvent issues d\'anciens bras de mer envasés et isolés par un cordon de sable ou de vase. La présence de végétation peut être précisée par l\'addition des codes 23.21 ou 23.22.'),
(484, 'NR', 22, '22', 'Eaux douces stagnantes', '', 'Standing fresh water', '', 2, 'Niveau 2', 66, '/66/484', 'true', 'Lakes, ponds and pools of natural origin containing fresh (i.e. non-saline) water. Man-made fresh water bodies, including reservoirs and canals.', '', 'Lacs, étangs et mares d\'origine naturelle contenant de l\'eau douce. Pièces d\'eau douce artificielles, incluant réservoirs et canaux.'),
(485, 'NR', 22, '23', 'Eaux stagnantes, saumâtres et salées', '', 'Standing brackish and salt water', '', 2, 'Niveau 2', 66, '/66/485', 'true', 'Brackish, saline or hypersaline lakes, pools and ditches.', '', 'Lacs, mares et fossés saumâtres, salés et hypersalés.'),
(486, 'NR', 22, '24', 'Eaux courantes', '', 'Running water', '', 2, 'Niveau 2', 66, '/66/486', 'true', 'All rivers and streams.', '', 'Toutes les rivières et tous les cours d\'eau.'),
(487, 'NR', 22, '31', 'Landes et fruticées', '', 'Heath and scrub', '', 2, 'Niveau 2', 67, '/67/487', 'true', 'Temperate shrubby areas: Atlantic and alpine heaths, sub-alpine bush and tall herb communities, deciduous forest recolonisation, hedgerows, dwarf conifers.', '', 'Etendues couvertes de végétaux ligneux bas, tempérées ; landes atlantiques et alpines, fourrés subapins et communautés de hautes herbes ; recolonisation forestière décidue, haies, résineux nains.'),
(488, 'NR', 22, '32', 'Fruticées sclérophylles', '', 'Sclerophyllous scrub', '', 2, 'Niveau 2', 67, '/67/488', 'true', 'Mediterranean and sub-Mediterranean evergreen sclerophyllous bush and scrub (maquis, garrigue, matorral, phrygana sensu lato), recolonisation and degradation stages of broad-leaved evergreen forests, supra-Mediterranean garrigues, pseudo-maquis, Macaronesian xerophytic communities.', '', 'Brousses, buissons et fruticées sclérophylles sempervirents méditerranéens et sub-méditerranéens (maquis, garrigue, matorral, phrygane sensu lato), stades de recolonisation et de dégradation des forêts sempervirentes, garrigues supra-méditerranéennes, pseudo-maquis...'),
(489, 'NR', 22, '33', 'Phryganes', '', 'Phrygana', '', 2, 'Niveau 2', 67, '/67/489', 'true', 'Cushion-forming thermo-Mediterranean sclerophyllous formations, often thorny and summer deciduous. They are best developed in the eastern Mediterranean, where they may occupy considerable surfaces in coastal areas and occasionally inland. They also include a few rare, relict associations of the west Mediterranean, mostly characteristic of the edge of seashores and of maritime cliffs, where they constitute an often narrow belt between the cliff communities and thermo-Mediterranean brushes, incorporating, in addition to characteristic, often endemic or very rare, hemispherical cushion-forming species, an admixture of species belonging to these two vegetation complexes.', '', 'Formations sclérophylles thermo-méditerranéennes en coussinets, souvent épineuses et à défoliation estivale. Elles sont surtout développées en Méditerranée orientale, où elles peuvent occuper des surfaces considérables dans les régions côtières et occasionnellement à l\'intérieur des terres. Elles comprennent aussi quelques rares associations relictuelles de l\'ouest méditerranéen, principalement caractéristiques des rivages et des falaises maritimes, où elles constituent une ceinture souvent étroite entre les communautés des falaises et les broussailles thermo-méditerranéennes, incorporant, en plus des espèces caractéristiques, souvent endémiques ou très rares, formant des coussins hémisphériques, un mélange d\'espèces appartenant à ces deux complexes de végétation.'),
(1177, 'NR', 22, '11.4', 'Herbiers des eaux saumâtres', '', 'Brackish sea vascular vegetation', '', 3, 'Niveau 3', 475, '/65/475/1177', 'true', 'Submerged or slightly emergent vascular vegetation of open brackish waters. Characteristic of open Baltic waters, Ruppietea communities may also occur in permanent pools of mud or sand flats (11.4 p.), as well as in inlets or estuaries where they should be coded as 12.4 or 13.4, respectively. Similar vegetation in landlocked pools is listed under 23.2.', 'Ruppietea maritimae p.', 'Végétation vasculaire immergée ou légèrement émergée des eaux saumâtres ouvertes. Les groupements des Ruppieta peuvent se rencontrer dans les flaques permanentes des vasières et estrans (bancs sableux) (11.4 p.), ainsi que dans les baies ou estuaires où ils devraient être respectivement codés en 12.4 ou 13.4. Une végétation similaire dans les mares ou lagunes à l\'intérieur des terres est listée en 23.2.'),
(1178, 'NR', 22, '13.1', 'Fleuves et rivières soumis à marées', '', 'Tidal rivers', '', 3, 'Niveau 3', 474, '/65/474/1178', 'true', 'Portions of rivers subject to the tide, upstream from the estuary.', '', 'Portions de rivières sujettes à la marée en amont de l\'estuaire.'),
(1179, 'NR', 22, '13.2', 'Estuaires', '', 'Estuaries', '', 3, 'Niveau 3', 474, '/65/474/1179', 'true', 'Broadening of rivers entering the sea. Detailed habitats can be coded by transposing subdivisions of prefix 11.2, simply replacing prefix 11.2 by prefix 13.2.', '', 'Embouchures des rivières à leur arrivée dans la mer. Les habitats détaillés peuvent être codés en transposant le préfixe 11.2, simplement en remplaçant le préfixe 11.2 par le préfixe 13.2.'),
(1180, 'NR', 22, '11.1', 'Eaux marines', '', 'Open marine waters', '', 3, 'Niveau 3', 475, '/65/475/1180', 'true', 'Pelagic biocoenoses. They can be characterized by their planktonic communities and by the composition of their nektonic or surface-feeding faunas of cephalopods, fish, sea mammals and seabirds.', '', 'Biocénoses pélagiques. Elles peuvent être caractérisées par leurs communautés planctoniques et par leur necton (ou faune se nourrissant en surface) de céphalopodes, poissons, mammifères marins et oiseaux de mer.'),
(1181, 'NR', 22, '11.2', 'Benthos (Fonds marins)', '', 'Seabed', '', 3, 'Niveau 3', 475, '/65/475/1181', 'true', 'Benthic communities of animals and algae occupying the sea floor in the infralittoral, circalittoral and deeper zones. This unit should be subdivided into a number of habitats characterized by depth, substrate, geographical location, water movement and the distinct biocoenoses they support. A basic framework is outlined below; divisions such as those proposed by Augier (1982) for Mediterranean biocoenoses can be easily, and without transformation, incorporated in it to provide further divisions.', '', 'Communautés benthiques d\'animaux et d\'algues occupant le fond marin de l\'infra-littoral, circalittoral et des zones plus profondes. Cette unité devrait être subdivisée en un certain nombre de types d\'habitat caractérisés par la profondeur, le substrat, la localisation géographique, les courants marins et les biocénoses distinctes qu\'elles font vivre. Une classification de base est ébauchée ici ; les divisions telles que celles proposées par Augier (1982) pour les biocénoses méditerranéennes peuvent être facilement, et sans transformation, incorporées pour donner davantage de divisions.'),
(1182, 'NR', 22, '11.3', 'Herbiers marins à plantes vasculaires', '', 'Marine vascular vegetation', '', 3, 'Niveau 3', 475, '/65/475/1182', 'true', 'Beds of submerged marine vascular vegetation, except those of brackish seas.', 'Zosteretea marinae, Posidonietea, Halodulo-Thalassietea', 'Herbiers (à plantes vasculaires marines submergées), à l\'exception de ceux des eaux saumâtres.'),
(1183, 'NR', 22, '15.3', 'Prés salés atlantiques', '', 'Atlantic salt meadows', '', 3, 'Niveau 3', 477, '/65/477/1183', 'true', 'Salt meadows of Baltic, North Sea, Channel and Atlantic shores. Aster tripolium can be present or abundant in most subdivisions.', 'Glauco-Puccinellietalia maritimae', 'Prés salés des côtes de la Baltique, de la mer du Nord, de la Manche et de l\'Atlantique. Aster tripolium peut être présent voire abondant dans la plupart des subdivisions.'),
(1184, 'NR', 22, '15.4', 'Prés salés continentaux', '', 'Continental salt meadows', '', 3, 'Niveau 3', 477, '/65/477/1184', 'true', 'Salt meadows of salt basins of interior middle Europe. Continental saltmarshes are remarkable, extremely threatened communities occurring in a few isolated stations of Saxony and Lower Saxony, Schleswig-Holstein, Thuringe, Hesse, Lorraine, Auvergne and the Midlands. They comprise this unit and continental glasswort swards (15.112).', 'Puccinellietalia distantis', 'Prés salés des bassins salifères de l\'Europe moyenne intérieure. Les prés salés continentaux sont remarquables ; ces groupements extrêmement menacés se rencontrent dans quelques stations isolées de Lorraine et d\'Auvergne. Elles englobent cette unité et les pelouses continentales à salicorne (15.112).'),
(1185, 'NR', 22, '15.6', 'Fourrés des prés salés (hygro-halophiles)', '', 'Saltmarsh scrubs', '', 3, 'Niveau 3', 477, '/65/477/1185', 'true', 'Scrubby formations of woody glassworts (Arthrocnemum), seablites (Suaeda), Halimione, Halocnemum or Limoniastrum of saltmarshes and of their immediate vicinity.', 'Arthrocnemetea fruticosi', 'Formations suffrutescentes halophiles méditerranéennes et thermo-atlantiques avec Arthrocnemum, Suaeda, Halimione, Limoniastrum des prés salés et de leur voisinage immédiat.'),
(1186, 'NR', 22, '15.5', 'Prés salés méditerranéens', '', 'Mediterranean salt meadows', '', 3, 'Niveau 3', 477, '/65/477/1186', 'true', 'Salt meadows of the Mediterranean coasts and of interior Iberian salt basins.', 'Juncetalia maritimi', 'Prés salés des côtes, lagunes, estuaires et deltas méditerranéens et des bassins salés ibériques intérieurs.'),
(1187, 'NR', 22, '13.3', 'Herbiers marins submergés', '', 'Submerged beds of vascular marine vegetation', '', 3, 'Niveau 3', 474, '/65/474/1187', 'true', 'Subdivisions of 11.3 can be transposed to precise communities (13.31 to 13.36).', '', 'Les subdivisions de 11.3 peuvent être transposées pour préciser les groupements (13.31 à 13.36).'),
(1188, 'NR', 22, '13.4', 'Herbiers saumâtres submergés', '', 'Submerged beds of vascular brackish vegetation', '', 3, 'Niveau 3', 474, '/65/474/1188', 'true', 'Subdivisions of 11.4 can be transposed to precise communities (13.41 to 13.42).', '', 'Les subdivisions de 11.4 peuvent être transposées pour préciser les communautés (13.41 à 13.42).'),
(1189, 'NR', 22, '15.1', 'Gazons pionniers salés', '', 'Salt pioneer swards', '', 3, 'Niveau 3', 477, '/65/477/1189', 'true', 'Formations of Salicornia and other annuals colonizing periodically inundated muds and sands of marine or interior salt marshes.', 'Thero-Salicornietalia, Frankenion pulverulentae, Saginion maritimae', 'Formations de Salicornia et autres annuelles colonisant les vases et sables périodiquement inondés des marais salés intérieurs ou côtiers.'),
(1190, 'NR', 22, '15.2', 'Prairies à Spartine', '', 'Cordgrass swards', '', 3, 'Niveau 3', 477, '/65/477/1190', 'true', 'Perennial pioneer Spartina grasslands of coastal salt muds.', 'Spartinion maritimae', 'Prairie avec les pionnières pérennes (Spartina) des vases salées côtières.'),
(1191, 'NR', 22, '15.7', 'Fourrés halophiles semi-désertiques', '', 'Semi-desert salt scrubs', '', 3, 'Niveau 3', 477, '/65/477/1191', 'true', 'Halophile shrub formations of dry ground in low-precipitation areas of the Iberian peninsula, Sicily and the Macaronesian Islands.', '', 'Fourrés halophiles des sols secs dans des zones à faibles précipitations de la péninsule Ibérique, de la Sicile et des îles macaronésiennes.'),
(1192, 'NR', 22, '15.8', 'Steppes salées méditerranéennes', '', 'Mediterranean salt steppes', '', 3, 'Niveau 3', 477, '/65/477/1192', 'true', 'Associations rich in perennial, rosette-forming Limonium spp. or esparto grass, Lygeum spartum, occupying, along Mediterranean coasts and on the fringes of Iberian salt basins, soils temporarily permeated (though not in undated) by saline water and subject to extreme summer drying, with formation of salt efflorescences.', 'Limonietalia', 'Associations riches en Limonium spp., plantes pérennes, en rosettes, ou riches en Lygeum spartum occupant, le long des côtes méditerranéennes et sur la frange des bassins salés ibériques, les sols temporairement imprégnés d\'eau salée (bien que non inondés) et soumis aux sécheresses estivales extrêmes, avec formations d\'efflorescences salées.'),
(1193, 'NR', 22, '15.9', '', '', 'Iberian gypsum scrubs', '', 3, 'Niveau 3', 477, '/65/477/1193', 'false', 'Garrigues occupying gypsum-rich soils of the Iberian peninsula, usually very open and floristically characterised by the presence of numerous gypsophilous species, among which Gypsophila struthium, G. hispanica, Centaurea hyssopifolia, Teucrium libanitis, Ononis tridentata, Lepidium subulatum, Herniaria fruticosa, Reseda stricta, Helianthemum squamatum. They are often rich in thymes (Thymus), germanders (Teucrium), rockroses (Helianthemum), composites (Centaurea, Jurinea, Santolina), Frankenia.', 'Gypsophiletalia', 'Pas de description disponible'),
(1194, 'NR', 22, '16.1', 'Plages de sable', '', 'Sand beaches', '', 3, 'Niveau 3', 478, '/65/478/1194', 'true', 'Gently sloping sand-covered shorelines fashioned by wave action.', '', 'Lignes de rivage couvertes de sable, légèrement inclinées, formées par l\'action des vagues.'),
(1195, 'NR', 22, '16.2', 'Dunes', '', 'Dunes', '', 3, 'Niveau 3', 478, '/65/478/1195', 'true', 'Onshore wind-carried sand deposits arranged in cordons of ridges parallel to the coast.', '', 'Dépôts de sable, apporté par le vent du large, arrangés en cordons de rides parallèles à la côte.'),
(1196, 'NR', 22, '16.3', 'Lettes dunaires humides (= Pannes humides, = Dépressions humides intradunales)', '', 'Humid dune-slacks', '', 3, 'Niveau 3', 478, '/65/478/1196', 'true', 'Humid depressions of the dunal systems. The most important habitats are included in the following units. If the divisions proposed are not sufficient, appropriate codes from 22.4, 22.3, 54.2, 54.4, 53 can be used in conjunction with them. Humid dune-slaks are extremely rich and specialized habitats very threatened by the lowering of water tables.', '', 'Dépressions humides des systèmes dunaires. Les habitats les plus importants sont compris dans les unités suivantes. Si les divisions proposées ne suffisent pas, les codes appropriés de 22.4, 22.3, 54.2, 54.4, 53 peuvent être utilisés conjointement avec elles. Les lettes dunaires humides sont des habitats extrêmement riches et spécialisés très menacés par l\'abaissement du niveau de la nappe aquifère.'),
(1197, 'NR', 22, '18.1', 'Falaises maritimes nues', '', 'Bare cliffs', '', 3, 'Niveau 3', 480, '/65/480/1197', 'true', 'Cliffs and rocky shores devoid of vascular vegetation. The mediolittoral (intertidal or wave-washed) and supralittoral (spray) zones are inhabited by rich and diverse communities of invertebrates and algae that can be used to define subdivisions. A basic framework is proposed below; further subdivisions, such as the biocoenoses and facies listed by Augier (1982) for the Mediterranean, can be easily integrated.', '', 'Côtes rocheuses et falaises dépourvues de plantes vasculaires. Les étages médiolittoral (étage intertidal ou battu par les vagues) et supralittoral (zone des embruns) sont habités par des communautés riches en divers invertébrés et algues qui peuvent être utilisés pour définir des subdivisions. Une structure de base est proposée plus loin ; davantage de divisions, telles que les biocénoses et les faciès listés par Augier (1982) pour la Méditerranée, peuvent être facilement intégrées.'),
(1198, 'NR', 22, '18.2', 'Côtes rocheuses et falaises avec végétation', '', 'Vegetated sea cliffs and rocky shores', '', 3, 'Niveau 3', 480, '/65/480/1198', 'true', 'Cliffs and rocky shores colonized by disjunct assemblages of aerohaline chasmophytes or by more or less closed aerohaline grasslands.', '', 'Côtes rocheuses et falaises colonisées par des assemblages disjoints de chasmophytes aérohalines ou de pelouses plus ou moins fermées aérohalines.'),
(1199, 'NR', 22, '17.1', 'Plages de galets sans végétation', '', 'Unvegetated shingle beaches', '', 3, 'Niveau 3', 479, '/65/479/1199', 'true', 'Shingle beaches devoid of phanerogamic vegetation. Mediolittoral (intertidal) and supralittoral invertebrate communities can be used to define subdivisions.', '', 'Plages de galets dépourvues de phanérogames. Les groupements médiolittoraux (intertidaux) et supralittoraux d\'invertébrés peuvent être utilisés pour définir les subdivisions.'),
(1200, 'NR', 22, '17.2', 'Végétation annuelle des laisses de mer sur plages de galets', '', 'Shingle beach drift lines', '', 3, 'Niveau 3', 479, '/65/479/1200', 'true', 'Formations of annuals occupying accumulations of drift material and gravels rich in nitrogenous organic matter; characteristic are Cakile maritima, Salsola kali, Atriplex spp. (particularly A. glabriuscula), Polygonum spp., Euphorbia peplis, Mertensia maritima, Glaucium flavum, Matthiola sinuata.', 'Cakiletea maritimae p.', 'Formations de plantes annuelles occupant les accumulations de matériaux charriés et de graviers riches en matières organiques azotées ; les plantes caractéristiques sont Cakile maritima, Salsola kali, Atriplex spp. (particulièrement A. glabriuscula), Polygonum spp., Euphorbia peplis, Glaucium flavum, Matthiola sinuata.'),
(1201, 'NR', 22, '17.3', 'Végétation vivace des bancs de galets à Crambe', '', 'Sea kale communities', '', 3, 'Niveau 3', 479, '/65/479/1201', 'true', 'Halo-nitrophilous perennial vegetation of the upper beach formed by Crambe maritima, Honkenya peploides and species characteristic of the regional communities as indicated below.', 'Honkenyo-Crambion', 'Végétation pérenne halo-nitrophile de la partie supérieure des plages formée par Crambe maritima, Honkenya peploides et des espèces caractéristiques des groupements régionaux comme indiqué plus loin.'),
(1202, 'NR', 22, '17.4', 'Prairies et landes des bancs de galets', '', 'Gravel bank heaths and grasslands', '', 3, 'Niveau 3', 479, '/65/479/1202', 'true', 'Grasslands and heaths of the landward expanses of large gravel banks.', '', 'Prairies et landes des grands bancs de galets s\'étendant vers l\'intérieur des terres.'),
(1203, 'NR', 22, '22.2', 'Galets ou vasières non végétalisés', '', 'Unvegetated muds or shingles', '', 3, 'Niveau 3', 484, '/66/484/1203', 'true', 'Unvegetated lake-bottoms or lake-shores and muds or shingle temporarily exposed by artificial or natural fluctuations of the water level, often important as feeding grounds for migrating waders.', '', 'Fonds ou rivages des lacs non végétalisés et galets ou vases temporairement soumis aux fluctuations naturelles ou artificielles du plan d\'eau, souvent importants comme sites d\'alimentation des limicoles migrateurs.'),
(1204, 'NR', 22, '22.3', 'Communautés amphibies', '', 'Amphibious communities', '', 3, 'Niveau 3', 484, '/66/484/1204', 'true', 'Temporarily exposed lake bottoms or lake shores and other periodically or occasionally inundated muddy, sandy or stony basins colonized by phanerogamic vegetation (see also 22.432).', '', 'Fonds et bords des lacs temporairement exondés, bassins vaseux, sableux ou pierreux, périodiquement ou occasionnellement inondés, colonisés par une végétation phanérogamique (voir aussi 22.432).'),
(1205, 'NR', 22, '18.3', '', '', 'Vegetated cliffs of saline lakes', '', 3, 'Niveau 3', 480, '/65/480/1205', 'false', 'Endemic Limonium secundirameum - dominated formations of the cliffs overlooking Bagno dell\' Acqua, Pantelleria.', 'Crithmo-Limonietalia: Limonietum secundiramei', 'Pas de description disponible'),
(1206, 'NR', 22, '22.1', 'Eaux douces', '', 'Fresh waters', '', 3, 'Niveau 3', 484, '/66/484/1206', 'true', 'The water body itself, regardless of vegetation belts.', '', 'La pièce d\'eau elle-même, indépendamment des ceintures végétales.'),
(1240, 'NR', 22, '33.4', '', '', 'Mid-elevation phryganas of Crete', '', 3, 'Niveau 3', 489, '/67/489/1240', 'false', 'Varied formations of supra- and oro- Mediterranean levels of Crete resulting from the broad contact between phryganas and hedgehog-heaths (32.7), with Euphorbia acanthothamnos, Verbascum spinosum, Berberis cretica, Phlomis cretica, Satureja biroi, Sideritis syriaca, Hypericum empetrifolia, Origanum microphyllum, Micromeria juliana, Helichrysum italicum ssp. microphyllum, Genista acanthoclada.', 'Euphorbio-Verbascion, i.a.', 'Pas de description disponible'),
(1241, 'NR', 22, '33.5', '', '', 'Hypericum phryganas', '', 3, 'Niveau 3', 489, '/67/489/1241', 'false', 'Extremely rare, local colonies of hemispherical shrubs of Hypericum aegyptiacum forming open phryganas on calcareous rocks by the sea in the Ionian islands, western Crete, Sardinia and Lampedusa.', '', 'Pas de description disponible'),
(1242, 'NR', 22, '33.6', '', '', 'Italian Sarcopoterium spinosum phryganas', '', 3, 'Niveau 3', 489, '/67/489/1242', 'false', 'Very local, impoverished Sarcopoterium spinosum formations of Capo St. Elia (southern Sardinian coast) and of the Gulf of Taranto (Puglia, Calabria).', '', 'Pas de description disponible'),
(1243, 'NR', 22, '33.7', '', '', 'Sardinian Genista acanthoclada phrygana', '', 3, 'Niveau 3', 489, '/67/489/1243', 'false', 'Very local Genista acanthoclada ssp. sardoa-dominated communities of northwestern Sardinia.', '', 'Pas de description disponible'),
(1244, 'NR', 22, '33.8', '', '', 'Balearic clifftop phryganas', '', 3, 'Niveau 3', 489, '/67/489/1244', 'false', 'Formations of the coasts of Mallorca and Minorca dominated by the cushion-forming Balearic endemics Launaea cervicornis, Astragalus balearicus, Centaurea balearica, Anthyllis fulgurans, A. hermanniae ssp. hystrix, Teucrium subspinosum.', 'Launaeetum cervicornis', 'Pas de description disponible'),
(1245, 'NR', 22, '33.9', 'Phryganes cyrno-sardes à Genista', '', 'Cyrno-Sardian Genista phryganas', '', 3, 'Niveau 3', 489, '/67/489/1245', 'true', 'Thermo-Mediterranean formations of headlands and peninsulas of Corsica and Sardinia dominated by cushion-forming spiny Genista corsica or G. morisii. These endemic species participate in the constitution of hedgehog-heaths (31.75) as well as in that of the coastal formations listed here, which assume an evident phrygana appearance; they may also enter in the composition of mid-elevation formations of less distinctive appearance which can be listed under 32.482.', '', 'Formations thermoméditerranéennes des caps et péninsules de Corse et de Sardaigne dominées par les genêts épineux en coussins Genista corsica ou G. morisii. Ces espèces endémiques participent à la constitution des landes-hérisson (31.75) aussi bien qu\'à celle des formations côtières classées ici, qui montrent un aspect évident de phrygane; ils peuvent aussi entrer dans la composition de formations d\'altitude moyenne, d\'aspect moins distinct et qui peuvent être classées sous 32.482.'),
(1246, 'NR', 22, '33.A', '', '', 'Pantelleria phrygana', '', 3, 'Niveau 3', 489, '/67/489/1246', 'false', 'Coastal formation of hemispherical shrubs with the Pantelleria endemics Helichrysum saxatile ssp. errerae and Matthiola pulchella, vicariant of the west Mediterranean, Balearic and Sardinian clifftop phryganas.', 'Matthiolo-Helichrysetum errerae', 'Pas de description disponible'),
(1247, 'NR', 22, '41.8', 'Forêts de Charmes houblon, de Charmes orientaux et thermophiles mixtes', '', 'Hop-hornbeam, oriental hornbeam and mixed thermophilous forests', '', 3, 'Niveau 3', 492, '/68/492/1247', 'true', 'Non-alluvial formations of the meso- and supra-Mediterranean zones dominated by Ostrya carpinifolia, Carpinus orientalis, Acer spp., Fraxinus spp., Tilia spp. or Celtis australis.', 'Ostryo-Carpinion p., Aceri-Quercion fagineae p., Quercion frainetto p. i.a.', 'Formations non riveraines des étages méso- et supra-méditerranéens dominées par Ostrya carpinifolia, Acer spp., Fraxinus spp., Tilia spp., ou Celtis australis.'),
(1248, 'NR', 22, '41.4', 'Forêts mixtes de pentes et ravins', '', 'Mixed ravine and slope forests', '', 3, 'Niveau 3', 492, '/68/492/1248', 'true', 'Cool, moist forests with a multispecific tree layer of variable dominance, most often on more or less abrupt slopes.', 'Tilio-Acerion, Carpinion betuli p.', 'Forêts fraîches et humides possédant une strate arborée plurispécifique de dominance variable, le plus souvent installées sur des pentes plus ou moins abruptes.'),
(1249, 'NR', 22, '41.9', 'Bois de Châtaigniers', '', 'Chesnut woods', '', 3, 'Niveau 3', 492, '/68/492/1249', 'true', 'Castanea sativa dominated formations.', '', 'Formations dominées par Castanea sativa.'),
(1250, 'NR', 22, '41.A', 'Bois de Charmes', '', 'Hornbeam woods', '', 3, 'Niveau 3', 492, '/68/492/1250', 'true', 'Pure or almost pure formations of Carpinus betulus.', '', 'Formations pures ou presque pures de Carpinus betulus.'),
(1251, 'NR', 22, '41.B', 'Bois de Bouleaux', '', 'Birch woods', '', 3, 'Niveau 3', 492, '/68/492/1251', 'true', 'Formations dominated by Betula pendula, B. pubescens, or their allies, on non-marshy terrain.', '', 'Formations dominées par Betula pendula, B. pubescens ou leurs hybrides planitiaires, sur des terrains non marécageux.'),
(1252, 'NR', 22, '41.5', 'Chênaies acidiphiles', '', 'Acidophilous oak forests', '', 3, 'Niveau 3', 492, '/68/492/1252', 'true', 'Forests of Quercus robur or Q. petraea on acid soils with an herb layer mostly constituted by the ecological groups of Deschampsia flexuosa, Vaccinium myrtillus, Pteridium aquilinum, Lonicera periclymenum, Holcus mollis, and of Maianthemum bifolium, Convallaria majalis, Hieracium sabaudum, Hypericum pulchrum, Luzula pilosa, and the mosses Polytrichum formosum and Leucobryum glaucum.', 'Quercion robori-petraeae', 'Forêts à Quercus robur ou à Q. petraea sur sols acides avec une strate herbacée la plupart du temps constituée des groupes écologiques à : Deschampsia flexuosa, Vaccinium myrtillus, Pteridium aquilinum, Lonicera periclymenum, Holcus mollis, et de Maianthemum bifolium, Convallaria maialis, Hieracium sabaudum, Hypericum pulchrum, Luzula pilosa et des mousses Polytrichum formosum et Leucobryum glaucum.'),
(1253, 'NR', 22, '41.C', 'Aulnaies', '', 'Alder woods', '', 3, 'Niveau 3', 492, '/68/492/1253', 'true', 'Non-riparian, non-marshy formations dominated by Alnus spp..', '', 'Formations non riveraines, non marécageuses dominées par des Aulnes spp.'),
(1254, 'NR', 22, '42.4', 'Forêts de Pins de montagne', '', 'Mountain pine forests', '', 3, 'Niveau 3', 491, '/68/491/1254', 'true', 'Mostly sub-alpine forests of the Alps, the Jura, the Pyrenees and the Iberian Range, dominated by Pinus uncinata, usually open and with a very developed shrubby understory.', '', 'Forêts pour la plupart subalpines, des Alpes, du Jura et des Pyrénées, dominées par Pinus uncinata, généralement ouvertes et avec un sous-bois buissonnant très développé.'),
(1255, 'NR', 22, '41.D', 'Bois de Trembles', '', 'Aspen woods', '', 3, 'Niveau 3', 492, '/68/492/1255', 'true', 'Formations dominated by Populus tremula.', '', 'Formations dominées par Populus tremula.'),
(1256, 'NR', 22, '41.E', 'Bois de Sorbiers sauvages', '', 'Rowan woods', '', 3, 'Niveau 3', 492, '/68/492/1256', 'true', 'Sorbus aucuparia-dominated formations, characteristic in particular of the Scottish Highlands.', '', 'Formations à Sorbus aucuparia dominant.'),
(1257, 'NR', 22, '41.F', 'Bois d\'Ormes', '', 'Elm woods', '', 3, 'Niveau 3', 492, '/68/492/1257', 'true', 'Non-riparian, non-ravine Ulmus spp.-dominated formations.', '', 'Formations à Ulmus spp. dominant, non riveraines, non installées en ravins.'),
(1258, 'NR', 22, '41.G', 'Bois de Tilleuls', '', 'Lime woods', '', 3, 'Niveau 3', 492, '/68/492/1258', 'true', 'Non-riparian, non-ravine Tilia spp.-dominated formations.', '', 'Formations dominées par Tilia spp. non riveraines, non installées en ravins.'),
(1259, 'NR', 22, '41.H', 'Autres bois caducifoliés', '', 'Other deciduous woods', '', 3, 'Niveau 3', 492, '/68/492/1259', 'true', '', '', 'Pas de description disponible'),
(1260, 'NR', 22, '42.1', 'Sapinières', '', 'Fir forests', '', 3, 'Niveau 3', 491, '/68/491/1260', 'true', 'Conifer forests dominated by firs (Abies spp.).', '', 'Forêts de conifères dominées par des Sapins (Abies spp.).'),
(1261, 'NR', 22, '41.2', 'Chênaies-charmaies', '', 'Oak-hornbeam forests', '', 3, 'Niveau 3', 492, '/68/492/1261', 'true', 'Atlantic and medio-European forests dominated by Quercus robur or Q. petraea, on eutrophic or mesotrophic soils, with usually ample and species-rich herb and bush layers. Carpinus betulus is generally present. They occur under climates too dry or on soils too wet or too dry for beech or as a result of forestry practices favoring oaks.', 'Carpinion betuli', 'Forêts atlantiques et médio-européennes dominées par Quercus robur ou Q. petraea sur des sols eutrophes ou mésotrophes avec généralement des strates herbacée et arbustive bien développées et spécifiquement riches. Carpinus betulus est généralement présent. Elles se forment sous des climats trop secs ou sur des sols trop humides ou trop secs pour le hêtre ou encore à la faveur de pratiques forestières visant à favoriser les Chênes.'),
(1262, 'NR', 22, '41.6', 'Forêts de Chêne tauzin', '', 'Quercus pyrenaica forests', '', 3, 'Niveau 3', 492, '/68/492/1262', 'true', 'Q. pyrenaica -dominated forests of the Iberian peninsula and, locally, southwestern France.', 'Quercion robori-pyrenaicae', 'Forêts de Quercus pyrenaica dominant de la péninsule Ibérique et, localement, du sud-ouest de la France.'),
(1263, 'NR', 22, '42.5', 'Forêts de Pins sylvestres', '', 'Scots pine forests', '', 3, 'Niveau 3', 491, '/68/491/1263', 'true', 'Forests dominated by Pinus sylvestris.', '', 'Forêts dominées par Pinus sylvestris.'),
(1264, 'NR', 22, '42.2', 'Pessières', '', 'Spruce forests', '', 3, 'Niveau 3', 491, '/68/491/1264', 'true', 'Conifer forests dominated by Picea abies.', 'Vaccinio-Piceion i.a.', 'Forêts de conifères dominées par Picea abies.'),
(1265, 'NR', 22, '41.7', 'Chênaies thermophiles et supra-méditerranéennes', '', 'Thermophilous and supra-Mediterranean oak woods', '', 3, 'Niveau 3', 492, '/68/492/1265', 'true', 'Forests or woods of sub-Mediterranean climate regions and supra-Mediterranean altitudinal levels, dominated by deciduous or semi-deciduous thermophilous oak species; they may, under local microclimatic or edaphic conditions, replace the evergreen oak forests in meso-Mediterranean or thermo-Mediterranean areas, and irradiate far north into medio-European or sub-Atlantic regions.', 'Quercetalia pubescenti-petraeae', 'Forêts ou bois des régions de climat sub-méditerranéen et de l\'étage supra-méditerranéen, dominés par des Chênes caducifoliés ou semi-caducifoliés thermophiles ; ceux-ci en outre remplacent, dans des conditions locales micro-climatiques ou édaphiques, les forêts de Chênes sempervirents dans les aires méso-méditerranéennes ou thermo-méditerranéennes, et s\'irradient au loin vers le nord jusque dans les régions médio-européennes ou sub-atlantiques.'),
(1266, 'NR', 22, '41.3', 'Frênaies', '', 'Ash forests', '', 3, 'Niveau 3', 492, '/68/492/1266', 'true', 'Non-alluvial Atlantic or sub-Atlantic forests dominated by Fraxinus excelsior, particulary characterisric of Britain, of the northwestern Iberian peninsula and of the Baltic moraine hills of Mecklenburg. Secondary formations pioneering on abandoned cultivated land (e.g. Belgian Condroz) are included.', 'Carpinion betuli (Fraxino-Carpinion): Corylo-Fraxinetum p., Polysticho setiferi-Fraxinetum excelsioris p., Mercurialidi perennis-Fraxinetum excelsioris p., Isopyro-Quercetum roboris, Adoxo-Aceretum', 'Forêts atlantiques ou sub-atlantiques non-alluviales dominées par Fraxinus excelsior, caractéristiques en particulier de la Grande-Bretagne, du nord-ouest de la péninsule Ibérique. Sont incluses les formations pionnières secondaires sur des terrains de cultures abandonnés (ex. Condroz belge).'),
(1267, 'NR', 22, '42.3', 'Forêts de Mélèzes et d\'Arolles', '', 'Larch-arolla forests', '', 3, 'Niveau 3', 491, '/68/491/1267', 'true', 'Forests of the sub-alpine and sometimes montane levels of the Alps, dominated by Larix decidua or Pinus cembra; the two species may form either pure or mixed stands, and may be associated with Picea abies or, in the western Alps, Pinus uncinata.', 'Laricio-Cembrion', 'Forêts des étages subalpin et parfois montagnard des Alpes, dominées par Larix decidua ou Pinus cembra, les deux espèces pouvant former des boisements purs de l\'une ou de l\'autre, ou des peuplements où elles sont mélangées, et pouvant être aussi associées avec Picea abies ou, dans les Alpes occidentales, avec Pinus uncinata.'),
(1268, 'NR', 22, '37.1', 'Communautés à Reine des prés et communautés associées', '', 'Meadowsweet stands and related communities', '', 3, 'Niveau 3', 496, '/67/496/1268', 'true', 'Hygrophile tall herb strips of fertile alluvial stream banks, often dominated by Filipendula ulmaria, and tall herb stands (F. ulmaria, Angelica sylvestris) colonizing humid hay meadows and pastures after more or less long discontinuation of mowing or grazing; characteristic species are Filipendula ulmaria, Achillea ptarmica, Angelica sylvestris, Cirsium palustre, Deschampsia cespitosa, Epilobium hirsutum, Geranium palustre, Veronica longifolia, Scutellaria hastifolia, Eupatorium cannabinum, Lysimachia vulgaris, Lythrum salicaria, Phalaris arundinacea, Polygonum bistorta, Valeriana officinalis.', 'Filipendulion ulmariae i.a.', 'Prairies hygrophiles de hautes herbes, installées sur les berges alluviales fertiles, souvent dominées par Filipendula ulmaria, et mégaphorbiaies (F. ulmaria, Angelica sylvestris) colonisant des prairies humides et des pâturages, après une plus ou moins longue interruption du fauchage ou du pâturage ; les espèces caractéristiques sont Filipendula ulmaria, Achillea ptarmica, Angelica sylvestris, Cirsium palustre, Deschampsia cespitosa, Epilobium hirsutum, Geranium palustre, Veronica longifolia, Scutellaria hastifolia, Eupatorium cannabinum, Lysimachia vulgaris, Lythrum salicaria, Phalaris arundinacea, Polygonum bistorta, Valeriana officinalis.'),
(1269, 'NR', 22, '34.7', 'Pelouses méditerranéo-montagnardes', '', 'Mediterraneo-montane grasslands', '', 3, 'Niveau 3', 490, '/67/490/1269', 'true', 'Open perennial grasslands, often rich in chamaephytes, most characteristic of the thermophilous oak level of Iberia, southern France, southern Italy and Greece. Some of the largest remaining expanses of unbroken grasslands in Europe, of evident importance as faunal habitats, belong to this division.', 'Ononido-Rosmarinetea p.', 'Pelouses vivaces ouvertes, souvent riches en chaméphytes, principalement caractéristiques de l\'étage des chênaies thermophiles du sud de la France, ... Certaines des plus grandes étendues restantes de pelouses ininterrompues d\'Europe, d\'une importance évidente comme habitats de la faune, appartiennent à cette unité.'),
(1270, 'NR', 22, '37.2', 'Prairies humides eutrophes', '', 'Eutrophic humid grasslands', '', 3, 'Niveau 3', 496, '/67/496/1270', 'true', 'Meadows developed on moderately to very nutrient-rich, alluvial or fertilized, wet or damp soils, often inundated at least in winter, and relatively lightly mowed or grazed, in lowland, collinar and montane western and central Europe, south to western Iberia. They form a transition between the false oatgrass mesophile meadows, the oligotrophic Molinion formations and the small sedge and large sedge communities. They include a large number of distinctive and often species-rich communities, many of which harbour specialized, rare and threatened species of plants and animals.', 'Molinietalia: Calthion palustris, Bromion racemosi, Deschampsion cespitosae, Juncion acutiflori, Cnidion dubii; Agrostietalia stoloniferae: Agropyro-Rumicion p.', 'Prairies développées sur des sols modérément à très riches en nutriments, alluviaux ou fertilisés, mouillés ou humides, souvent inondées au moins en hiver, et relativement légèrement fauchées ou pâturées, dans les plaines, les collines et les montagnes de l\'Europe occidentale. Ces formations assurent la transition entre les prairies mésophiles à Arrhenaterum, les formations oligotrophes du Molinion et les communautés à petites et grandes laîches. Elles comprennent un grand nombre de communautés distinctes et souvent riches en espèces, dont beaucoup abritent des espèces de plantes et d\'animaux spécialisées, rares et menacées.'),
(1271, 'NR', 22, '38.3', 'Prairies de fauche de montagne', '', 'Mountain hay meadows', '', 3, 'Niveau 3', 494, '/67/494/1271', 'true', 'Species-rich mesophile hay meadows of the montane and sub-alpine levels (mostly above 600 metres) usually dominated by Trisetum flavescens and with Heracleum sphondylium, Viola cornuta, Astrantia major, Carum carvi, Crepis mollis, C. pyrenaica, Polygonum bistorta, Silene dioica, S. vulgaris, Campanula glomerata, Salvia pratensis, Centaurea nemoralis, Anthoxanthum odoratum, Crocus albiflorus, Geranium phaeum, G. sylvaticum, Narcissus poeticus, Malva moschata, Valeriana repens, Trollius europaeus, Pimpinella major, Muscari botryoides, Lilium bulbiferum, Thlaspi caerulescens, Viola tricolor ssp. subalpina, Phyteuma halleri, P. orbiculare, Primula elatior, Chaerophyllum hirsutum and many others.', 'Polygono-Trisetion (Triseto-Polygonion bistorti)', 'Prairies de fauche, mésophiles, riches en espèces, des étages montagnard et subalpin (principalement au-dessus de 600 m) habituellement dominées par Trisetum flavescens et avec Heracleum sphondylium, Viola cornuta, Astrantia major, Carum carvi, Crepis mollis, C. pyrenaica, Polygonum bistorta, Silene dioica, S. vulgaris, Campanula glomerata, Salvia pratensis, Centaurea nemoralis, Anthoxanthum odoratum, Crocus albiflorus, Geranium phaeum, G. sylvaticum, Narcissus poeticus, Malva moschata, Valeriana repens, Trollius europaeus, Pimpinella major, Muscari botryoides, Lilium bulbiferum, Thlapsi caerulescens, Viola tricolor subsp. subalpina, Phyteuma halleri, P. orbiculare, Primula elatior, Chaerophyllum hirsutum et beaucoup d\'autres.'),
(1272, 'NR', 22, '38.4', '', '', 'Iberian vallicares', '', 3, 'Niveau 3', 494, '/67/494/1272', 'false', 'Summer pastures of the Iberian peninsula, submitted to poor drainage, brief flooding and rapid dessication with the first heat, constituted by perennial and annual grasses, most commonly by Agrostis castellana, A. pourretii (A. salmantica), Gaudinia fragilis, Festuca ampla, Periballia involucrata, Vulpia ciliata, V. myuros, V. bromoides, Holcus setiglumis, Molineriella minuta, Anthoxanthum aristatum, A. ovatum and often with Juncus capitatus and clovers such as Trifolium campestre.', 'Agrostietalia castellanae', 'Pas de description disponible'),
(1273, 'NR', 22, '38.5', '', '', 'Macaronesian mesophile grasslands', '', 3, 'Niveau 3', 494, '/67/494/1273', 'false', 'Secondary grasslands of the highest levels of the Atlantic islands.', '', 'Pas de description disponible'),
(1274, 'NR', 22, '34.8', 'Pelouses méditerranéennes subnitrophiles', '', 'Mediterranean subnitrophilous grasslands', '', 3, 'Niveau 3', 490, '/67/490/1274', 'true', 'Formations composed mostly of annuals, in particular, grasses of genera Bromus, Aegilops, Avena, Vulpia, crucifers and leguminous plants, that occupy considerable expanses of the western, central and eastern meso- and thermo-Mediterranean zones on soils slightly enriched in nitrates. These communities develop as pioneers of bare soils slightly nitrified by aeration or organic addition, along roads, on land-fills and in interstitial spaces of cultivation. They also replace the oligotrophic annual communities included in the Mediterranean xeric grasslands (34.51, 34.53) under the influence of pastoral activities. They are widespread as post-cultural formations. They evolve through intensive grazing into perennial pastures of the Poetalia bulbosae and related communities (34.52), through increased nitrification into ruderal formations (87), through an increase in edaphic humidity into amphibious communities (22.3) and perennial andropogonid steppes (34.634) or Phoenician torgrass swards (34.36). Ligneous recolonization may lead either to halo-nitrophilous scrubs of the Salsolo-Peganetalia (15.17), or to maquis and garrigues of the Rosmarinetalia, Lavanduletalia or Gypsophiletalia (32, 15.19).', 'Brometalia rubenti-tectori i.a.', 'Formations composées principalement de graminées en particulier annuelles des genres Bromus, Aegilops, Avena, Vulpia, de crucifères et de légumineuses. Ces formations occupent des étendues considérables dans les étages méso- et thermo-méditerranéens occidentaux, centraux et orientaux sur des sols légèrement enrichis en nitrates. Ces groupements se développent comme pionniers des sols nus légèrement nitrifiés par des aérosols ou par des apports de matières organiques, le long des routes, sur les remblais de terre et dans les espaces interstitiels des cultures. Elles remplacent aussi les groupements annuels oligotrophes inclus dans les pelouses xériques méditerranéenes (34.51) sous l\'influence des activités pastorales. Elles sont largement répandues comme formations post-culturales. A travers un pâturage intensif, elles évoluent vers des pâtures pérennes des Poetalia bulbosae et des communautés apparentées (34.52), suite à une nitrification accrue en formations rudérales (87), suite à un accroissement de l\'humidité édaphique, vers des groupements amphibies (22.3) et des steppes pérennes à Andropogon (34.634) ou des gazons à Brachypode de Phénicie (34.36). La recolonisation ligneuse peut conduire soit aux broussailles halo-nitrophiles du Salsolo-Peganetalia (15.17), soit aux maquis et garrigues des Rosmarinetalia, Lavanduletalia ou Gypsophiletalia (32, 15.19).'),
(1275, 'NR', 22, '37.8', 'Mégaphorbiaies alpines et subalpines', '', 'Subalpine and alpine tall herb communities', '', 3, 'Niveau 3', 496, '/67/496/1275', 'true', 'Luxuriant tall herb formations of deep, humid soils in the montane to alpine, but mostly sub-alpine, levels of the higher mountains, with Cicerbita alpina, C. plumieri,Cirsium helenioides, C. spinosissimum, C. flavispina, Geranium sylvaticum, Polygonatum verticillatum, Ranunculus platanifolius, Aconitum vulparia, A. napellus, A. nevadense, Adenostyles alliariae, Senecio elodes, Veratrum album, Trollius europaeus, Peucedanum ostruthium, Doronicum austriacum, Pedicularis foliosa, Eryngium alpinum, Centaurea rhapontica, Valeriana pyrenaica, Tozzia alpina. Groupings of these plants can invade the Aceri-Fagion and reappear, along streams, lower down in montane beech forests. If useful, their presence can be noted by combining a code of 37.8 with the appropriate forest code.', 'Betulo-Adenostyletea p.; Rumicion alpini', 'Formations luxuriantes à grandes herbes des sols profonds, humides, des étages montagnard à alpin, mais principalement subalpin, des hautes montagnes, avec Cicerbita alpina, C. plumieri, Cirsium heterophyllum, C. spinosissimum, C. pyrenaicum, Geranium sylvaticum, Polygonatum verticillatum, Ranunculus platanifolius, Aconitum vulparia, A. napellus, Adenostyles alliariae, Veratrum album, Trollius europeaus, Peucedanum ostruthium, Doronicum austriacum, Pedicularis foliosa, Eryngium alpinum, Centaurea rhapontica, Valeriana pyrenaica, Tozzia alpina. Les groupements de ces plantes peuvent s\'introduire dans l\'Aceri-Fagion et réapparaitre, le long de cours d\'eau, loin en aval dans les forêts montagnardes de hêtres. Si nécessaire, leur présence peut être notée en combinant un code de 37.8 avec le code des formations forestières approprié.'),
(1276, 'NR', 22, '35.1', 'Pelouses atlantiques à Nard raide et groupements apparentés', '', 'Atlantic mat-grass swards and related communities', '', 3, 'Niveau 3', 493, '/67/493/1276', 'true', 'Closed, dry or mesophile, perennial grasslands occupying acid soils in Atlantic or sub-Atlantic lowland, collinar and montane regions of middle Europe and western Iberia, with Nardus stricta, Festuca filiformis (F. tenuifolia), F. ovina, F. rubra, Agrostis capillaris, Danthonia decumbens, Anthoxanthum odoratum, Deschampsia flexuosa, Poa angustifolia, Galium saxatile, Polygala vulgaris, Viola canina, Meum athamanticum, Arnica montana, Centaurea nigra, Dianthus deltoides, Gentianella campestris, Chamaespartium sagittale, Jasione laevis, Potentilla erecta, Carex pilulifera. Any of the grasses listed can dominate or co-dominate distinctive facies; Calamagrostis epigejos or Carex arenaria also can invade and dominate some formations.', 'Nardetalia: Violo-Nardion (Nardo-Galion saxatilis, Violion caninae)', 'Pelouses pérennes fermées, sèches ou mésophiles, occupant des sols acides dans les plaines, collines et montagnes atlantiques ou sub-atlantiques de l\'Europe moyenne, avec Nardus stricta, Festuca filiformis (F. tenuifolia), F. ovina, F. rubra, Agrostis capillaris, Danthonia decumbens, Anthoxanthum odoratum, Deschampsia flexuosa, Poa angustifolia, Galium saxatile, Polygala vulgaris, Viola canina, Meum athamanticum, Arnica montana, Centaurea nigra, Dianthus deltoides, Gentianella campestris, Genista sagitallis, Jasione laevis, Potentilla erecta, Carex pilulifera. Chacune des graminées citées peut dominer ou codominer des faciès distincts ; Calamagrostis epigejos ou Carex arenaria peuvent aussi envahir et dominer certaines formations.'),
(1277, 'NR', 22, '36.4', 'Pelouses calcicoles alpines et subalpines', '', 'Alpine and subalpine calciphilous grasslands', '', 3, 'Niveau 3', 495, '/67/495/1277', 'true', 'Alpine and subalpine grasslands of base-rich soils with Dryas octopetala, Gentiana nivalis, G. campestris, Alchemilla hoppeana, A. conjuncta, A. flabellata, Anthyllis vulneraria, Astragalus alpinus, Aster alpinus, Draba aizoides, Globularia nudicaulis, Helianthemum nummularium ssp. grandiflorum, H. oelandicum ssp. alpestre, Pulsatilla alpina ssp. alpina, Phyteuma orbiculare, Astrantia major, Polygala alpestris.', 'Elyno-Seslerietea', 'Pelouses alpines et subalpines des sols riches en bases avec Dryas octopetala, Gentiana nivalis, G. campestris, Alchemilla hoppeana, A. conjuncta, A. flabellata, Anthyllis vulneraria, Astragalus alpinus, Aster alpinus, Draba aizoides, Globularia nudicaulis, Helianthemum grandiflorum, H. oelandicum subsp. alpestre, Pulsatilla alpina subsp. alpina, Phyteuma orbiculare, Astrantia major, Polygala alpestris.'),
(1278, 'NR', 22, '41.1', 'Hêtraies', '', 'Beech forests', '', 3, 'Niveau 3', 492, '/68/492/1278', 'true', 'Forests dominated by Fagus sylvatica or, in Greece, F. orientalis or F. moesiaca. Many montane formations are beech-fir or beech-fir-spruce forests, to be noted as 43 (mixed forests), but with the suffixes below; they are discussed with the corresponding deciduous forest.', '', 'Forêts dominées par Fagus sylvatica. De nombreuses formations montagnardes sont des forêts de Hêtre et de Sapin ou de Hêtre, de Sapin et d\'Epicéa, elles sont notées 43 (forêts mixtes) ; elles seront traitées en même temps que les forêts caducifoliées correspondantes.');
INSERT INTO `corine` (`CD_HAB`, `FG_VALIDITE`, `CD_TYPO`, `LB_CODE`, `LB_HAB_FR`, `LB_HAB_FR_COMPLET`, `LB_HAB_EN`, `LB_AUTEUR`, `NIVEAU`, `LB_NIVEAU`, `CD_HAB_SUP`, `PATH_CD_HAB`, `FRANCE`, `LB_DESCRIPTION`, `CRSP_PHYTO_CB91`, `DESCRIPTIF_CB97_FR`) VALUES
(1279, 'NR', 22, '35.2', 'Pelouses siliceuses ouvertes médio-européennes', '', 'Medio-European open siliceous grasslands', '', 3, 'Niveau 3', 493, '/67/493/1279', 'true', 'Open formations of dry, siliceous soils, of Atlantic, sub-Atlantic and Mediterraneo-montane distribution, often species-poor and with a strong representation of annuals.', 'Thero-Airion i.a.', 'Formations ouvertes des sols siliceux secs, de distribution atlantique, sub-atlantique et méditerranéo-montagnarde, souvent pauvres en espèces et avec une forte représentation de plantes annuelles.'),
(1280, 'NR', 22, '37.3', 'Prairies humides oligotrophes', '', 'Oligotrophic humid grasslands', '', 3, 'Niveau 3', 496, '/67/496/1280', 'true', 'Humid grasslands of middle Europe and northwestern Iberia, on soils very poor in nutrients.', 'Molinion caeruleae, Juncion squarrosi', 'Prairies humides d\'Europe moyenne, sur sols très pauvres en nutriments.'),
(1281, 'NR', 22, '35.3', 'Pelouses siliceuses méditerranéennes', '', 'Mediterranean siliceous grasslands', '', 3, 'Niveau 3', 493, '/67/493/1281', 'true', 'West Mediterranean annual-rich grasslands of siliceous gravelly, sandy or silty, usually shallow, soils that remain cohesive during the dry season; characteristic are Tuberaria guttata, Helianthemum sanguineum, Jasione montana, Paronychia cymosa, P. echinulata, Pterocephalus diandrus, Prolongoa pectinata, Senecio minutus, Tolpis barbata, Filago gallica, F. minima, Teesdalia coronopifolia, Sedum caespitosum, S. arenarium, S. andegavense, Crassula tillaea, Saxifraga carpetana, Radiola linoides, Silene gallica, S. psammitis, S. portensis, Linum gallicum, Linaria pelisseriana, L. arvensis, Plantago bellardi, Galium divaricatum, Trifolium cherleri, T. strictum, T. suffocatum, T. arvense, T. bocconei, T. purpureum, Lathyrus angulatus, Ornithopus pinnatus, O. sativus, Lupinus hispanicus, L. angustifolius, Anthyllis cornicina, Coronilla dura and the grasses Corynephorus divaricatus, Aira cupaniana, A. tenorei, A. caryophyllea, Airopsis tenella, Molineria minuta, M. laevis, Vulpia geniculata, V. membranacea, V. bromoides, V. myuros, Briza maxima, Anthoxanthum aristatum, Micropyrum tenellum.', 'Helianthemion guttati (Tuberarion guttatae)', 'Pelouses de l\'ouest méditerranéen, riches en plantes annuelles, sur sols siliceux graveleux, sableux ou limoneux, habituellement superficiels, qui restent cohérents pendant la saison sèche ; en sont caractéristiques : Tuberaria guttata, Jasione montana, Paronychia cymosa, P. echinulata, Tolpis barbata, Logfia gallica, L. minima, Teesdalia coronopifolia, Sedum caespitosum, S. andegavense, Crassula tillaea, Radiola linoides, Silene gallica, S. portensis, Linum gallicum, Linaria pelisseriana, L. arvensis, Plantago bellardi, Galium divaricatus, Trifolium cherleri, T. strictum, T. suffocatum, T. arvense, T. bocconei, T. purpureum, Lathyrus angulatus, Ornithopus pinnatus, O. sativus, Lupinus angustifolius, et les graminées Corynephorus divaricatus, Aira cupaniana, A. tenorii, A. caryophyllea, Airopsis tenella, Molineriella minuta, M. laevis, Vulpia geniculata, V. membranacea, V. bromoides, V. myuros, Briza maxima, Anthoxanthum aristatum, Micropyrum tenellum.'),
(1282, 'NR', 22, '38.1', 'Pâtures mésophiles', '', 'Mesophile pastures', '', 3, 'Niveau 3', 494, '/67/494/1282', 'true', 'Regularly grazed mesophile pastures, fertilized and on well-drained soils, with Lolium perenne, Cynosurus cristatus, Poa spp., Festuca spp., Trifolium repens, Leontodon autumnalis, Bellis perennis, Ranunculus repens, R. acris, Cardamine pratensis; they are most characteristic of the Euro-Siberian zone, but extend to Atlantic Iberia and the Cordillera Central, the Apennines and the supra-Mediterranean zone of Greece.', 'Cynosurion', 'Pâturages mésophiles fertilisées, régulièrement pâturées, sur des sols bien drainés, avec Lolium perenne, Cynosurus cristatus, Poa ssp., Festuca ssp., Trifolium repens, Leontodon autumnalis, Bellis perennis, Ranunculus repens, R. acris, Cardamine pratensis ; ils sont bien caractéristiques de la zone euro-sibérienne.'),
(1283, 'NR', 22, '34.4', 'Lisières (ou ourlets) forestières thermophiles', '', 'Thermophile forest fringes', '', 3, 'Niveau 3', 490, '/67/490/1283', 'true', 'Woodland edge (hem) communities of warmth-requiring drought-resistant herbaceous perennials and frutescent vegetation forming a belt between dry or mesophile grasslands and the shrubby forest mantle, on the sunny side, where the nutrient supply is limited, or, sometimes, pioneering the woodland colonization into the grasslands.', 'Trifolio-Geranietea', 'Communautés des lisières forestières formées de plantes herbacées vivaces thermophiles, résistantes à la sécheresse, et de plantes frutescentes ; ces espèces requièrent de la chaleur. Elles constituent une ceinture entre les pelouses sèches ou mésophiles et le manteau forestier arbustif, du côté ensoleillé, là où l\'alimentation en nutriments est limitée. Quelquefois, elles forment la phase pionnière de colonisation forestière au sein des pelouses.'),
(1284, 'NR', 22, '35.4', 'Communautés annuelles méditerranéennes des sables profonds', '', 'Mediterranean annual deep-sand communities', '', 3, 'Niveau 3', 493, '/67/493/1284', 'true', 'Open, spring-blooming communities of annuals developed on deep sands of Iberia and very locally of southern France and Italy, with Malcolmia lacera, M. ramosissima, Anthyllis hamosa, Maresia nana, Erodium laciniatum, E. cicutarium ssp. bipinnatum, Arenaria emarginata, Hymenostemma pseudoanthemis, Loeflingia baetica, L. spartea, L. tavaresiana, L. hispanica, Linaria donyana, L. pedunculata, Vulpia membranacea, Ononis variegata, O. baetica, O. cossoniana, O. subspicata, Coronilla repanda, Evax astericiflora, E. lusitanica, Leucojum trichophyllum. Many are dunal and have been listed under 16.228.', 'Malcolmietalia', 'Communautés ouvertes de plantes annuelles à floraison printanière développées sur les sables profonds de la péninsule Ibérique, et très localement du sud de la France, avec Malcolmia ramosissima, Malcolmia nana, Erodium laciniatum, E. cicutarium subsp. bipinnatum, Loeflingia hispanica, Vulpia membranacea, Ononis variegata. Beaucoup sont dunaires et ont été répertoriées en 16.228.'),
(1285, 'NR', 22, '35.5', '', '', 'Iberian fescue-plantain swards', '', 3, 'Niveau 3', 493, '/67/493/1285', 'false', 'Open perennial formations colonizing arenaceous or skeletal, often unstable, siliceous soils of the supra-Mediterranean levels of Iberian mountains, rich in cushion-forming, rosette-leaved chamaephytes (Jasione crispa ssp. sessiliflora, Plantago radicata, Scleranthus perennis) and cespitose, rough perennial grasses (Festuca costei, F. indigesta, F. summilusitana, Corynephorus canescens, Koeleria caudata ssp. crassipes). Various formations, characterized by, among others, Hieracium castellanum, Leucanthemopsis pulverulenta, Dianthus merinoi, D. laricifolius, Armeria caballeroi, A. alliacea, Thymus serpylloides ssp. gadorensis, Teucrium aureum are distributed in the Cantabrian range, the southern Galician and Leonese mountains, the Iberian Range, the Cordillera Central, the Montes de Toledo, the Sierra Nevada.', 'Corynephoro-Plantaginion radicatae', 'Pas de description disponible'),
(1286, 'NR', 22, '35.6', '', '', 'Iberian tall fescue grasslands', '', 3, 'Niveau 3', 493, '/67/493/1286', 'false', 'Perennial grasslands dominated by the tall cespitose Festuca elegans of the supra-Mediterranean Quercus pyrenaica level of the Cordillera Central and Sierra Nevada with, among others, Geum heterocarpum, Trifolium ochroleucon and Paeonia coriacea of deep, siliceous soils.', 'Festucion elegantis', 'Pas de description disponible'),
(1287, 'NR', 22, '35.7', 'Pelouses méditerranéo-montagnardes', '', 'Mediterraneo-montane mat-grass swards', '', 3, 'Niveau 3', 493, '/67/493/1287', 'true', 'Nardus stricta-dominated grasslands and related communities of the supra-Mediterranean level of the mountains of the Mediterranean peninsulas, either developed on siliceous soils, or, rarely, on calcareous substrates.', '', 'Pelouses dominées par Nardus stricta et groupements apparentés de l\'étage supraméditerranéen des montagnes des péninsules méditerranéennes, développées surtout sur des sols siliceux ou, rarement, sur des substrats calcaires.'),
(1288, 'NR', 22, '37.4', 'Prairies humides méditerranéennes à grandes herbes', '', 'Mediterranean tall humid grasslands', '', 3, 'Niveau 3', 496, '/67/496/1288', 'true', 'Mediterranean humid grasslands of tall grasses and rushes with Scirpus holoschoenus (Holoschoenus vulgaris), Agrostis stolonifera, A. reuteri, Galium debile, Molinia caerulea, Briza minor, Melica cupanii, Cyperus longus, Linum tenue, Trifolium resupinatum, Schoenus nigricans, Peucedanum hispanicum, Carex mairii, Juncus maritimus, J. acutus, Asteriscus aquaticus, Hypericum tomentosum, H. tetrapterum, Inula viscosa, Oenanthe pimpinelloides, O. lachenalii, Eupatorium cannabinum, Prunella vulgaris, Pulicaria dysenterica, Tetragonolobus maritimus, Orchis laxiflora, Dactylorhiza elata, Succisa pratensis, Sonchus maritimus ssp. aquatilis, Silaum silaus, Sanguisorba officinalis, Serratula tinctoria, Genista tinctoria, Cirsium monspessulanum, C. pyrenaicum, Senecio doria, Dorycnium rectum, Erica terminalis, Euphorbia pubescens, Lysimachia ephemerum.', 'Holoschoenetalia: Molinio-Holoschoenion', 'Prairies humides méditerranéennes de grands joncs et graminées avec Scirpoides holoschoenus (Holoschoenus vulgaris), Agrostis stolonifera, Galium debile, Molinia caerulea, Briza minor, Cyperus longus, Trifolium resupinatum, Schoenus nigricans, Carex mairii, Juncus maritimus, J. acutus, Asteriscus aquaticus, Hypericum tomentosum, H. quadrangulum, Dittrichia viscosa, Oenanthe pimpinelloides, O. lachenalii, Eupatorium cannabinum, Prunella vulgaris, Pulicaria dysenterica, Tetragonolobus maritimus, Orchis laxiflora, Dactylorhiza elata, Succisa pratensis, Sonchus maritimus subsp. aquatilis, Silaum silaus, Sanguisorba officinalis, Serratula tinctoria, Genista tinctoria, Cirsium monspessulanus, C. pyrenaicum, Senecio doria, Dorycnium rectum, Erica terminalis, Euphorbia hirsuta, Lysimachia ephemerum.'),
(1289, 'NR', 22, '37.5', 'Prairies humides méditerranéennes rases', '', 'Mediterranean short humid grasslands', '', 3, 'Niveau 3', 496, '/67/496/1289', 'true', 'Very short grasslands of impermeable compact soils or marls, wet for a large part of the year, and dessicated in summer, with Deschampsia media, Centaurium pulchellum, Lotus tenuis, Trifolium lappaceum, Prunella hyssopifolia, Plantago serpentina, Centaurea timbali.', 'Holoschoenetalia: Deschampsion mediae', 'Prairies rases des marnes ou sols imperméables compacts, humides une grande partie de l\'année, et desséchées en été, avec Deschampsia media, Centaurium pulchellum, Lotus tenuis, Trifolium lappaceum, Prunella hyssopifolia, Plantago maritima subsp. serpentina, Centaurea timbalii.'),
(1290, 'NR', 22, '37.6', '', '', 'Eastern supra-Mediterranean humid meadows', '', 3, 'Niveau 3', 496, '/67/496/1290', 'false', 'Humid meadows rich in clover of the Balkan peninsula and the Apennines, mostly developed at collinar levels.', 'Trifolio-Hordeetalia: Trifolion resupinati, Ranunculion velutini', 'Pas de description disponible'),
(1291, 'NR', 22, '34.5', 'Pelouses méditerranéennes xériques', '', 'Mediterranean xeric grasslands', '', 3, 'Niveau 3', 490, '/67/490/1291', 'true', 'Meso- and thermo-Mediterranean xerophile, mostly open, short-grass perennial grasslands rich in therophytes; therophyte communities of oligotrophic soils on base-rich, often calcareous substrates.', 'Thero-Brachypodietea', 'Pelouses xérophiles méso- et thermo-méditerranéennes, souvent ouvertes, formées de petites graminées pérennes et riches en thérophytes ; communautés thérophytiques des sols oligotrophes sur substrats riches en bases, souvent calcaires.'),
(1292, 'NR', 22, '36.1', 'Communautés des combes à neige', '', 'Snow-patch communities', '', 3, 'Niveau 3', 495, '/67/495/1292', 'true', 'Vegetation of areas that retain late-lying snow. These formations are mostly characteristic of the alpine level of the Alps and Pyrenees; they extend to the Macedonian mountains and are represented by relict outposts in the Sierra Nevada, the Cordillera Central, the Monti Sibillini and Abruzzi; they occur locally in the Scottish Highlands.', 'Salicetea herbaceae', 'Végétations des zones où se conserve tardivement une couche de neige. Ces formations sont principalement caractéristiques de l\'étage alpin des Alpes et des Pyrénées.'),
(1293, 'NR', 22, '38.2', 'Prairies de fauche de basse altitude', '', 'Lowland hay meadows', '', 3, 'Niveau 3', 494, '/67/494/1293', 'true', 'Mesophile hay meadows of low altitudes, fertilized and well-drained, with Arrhenatherum elatius, Trisetum flavescens, Anthriscus sylvestris, Heracleum sphondylium, Daucus carota, Crepis biennis, Knautia arvensis, Leucanthemum vulgare, Pimpinella major, Trifolium dubium, Geranium pratense; they are most characteristic of the Euro-Siberian zone, but extend to Atlantic Iberia, the Cordillera Central and Montseny, to the Apennines and to the supra-Mediterranean zone of Greece.', 'Arrhenatherion, Brachypodio-Centaureion nemoralis', 'Prairies de fauche mésophiles, de basse altitude, fertilisées et bien drainées, avec Arrhenaterum elatius, Trisetum flavescens, Anthriscus sylvestris, Heracleum sphondylium, Daucus carota, Crepis biennis, Knautia arvensis, Leucanthemum vulgare, Pimpinella major, Trifolium dubium, Geranium pratense ; elles sont bien caractéristiques de la zone euro-sibérienne.'),
(1294, 'NR', 22, '37.7', 'Lisières humides à grandes herbes', '', 'Humid tall herb fringes', '', 3, 'Niveau 3', 496, '/67/496/1294', 'true', 'Watercourse veil and shady woodland edge communities', 'Convolvuletalia sepium, Glechometalia hederaceae p. (Calystegio-Alliarietalia)', 'Communautés des lisières boisées ombragés et voiles des cours d\'eau.'),
(1295, 'NR', 22, '34.6', 'Steppes méditerranéennes à Graminées', '', 'Mediterranean tall-grass steppes', '', 3, 'Niveau 3', 490, '/67/490/1295', 'true', 'Meso-, thermo- and sometimes supra-Mediterranean formations physiognomically dominated by tall grasses, between which may grow communities of annuals or sometimes chamaephytes; they are most characteristic of the Iberian peninsula, with local representations in southern Provence, Sardinia, southern peninsular Italy, Sicily and Greece. They include silicicolous as well as basiphile formations.', 'Lygeo-Stipetea, Rosmarinetalia p.: Brachypodio-Chrysopogonetea p.', 'Formations méso-, thermo-, et quelquefois supra-méditerranéennes dominées physionomiquement par de grandes graminées, entre lesquelles peuvent se développer des communautés de plantes annuelles et quelquefois des chaméphytes ; elles sont principalement caractéristiques de la péninsule Ibérique, avec des représentations locales dans le sud de la Provence, ... Elles comprennent des formations silicicoles aussi bien que basiphiles.'),
(1296, 'NR', 22, '36.2', 'Communautés des affleurements et rochers désagrégés alpins', '', 'Alpine weathered rock and outcrop communities', '', 3, 'Niveau 3', 495, '/67/495/1296', 'true', 'Stonecrop and houseleak communities colonizing both calcareous and siliceous rocky outcrops of the subalpine and alpine levels of higher mountains.', 'Sedo-Scleranthion, Sedion pyrenaici p.', 'Communautés d\'orpins et de Joubarbes colonisant les affleurements rocheux aussi bien calcaires que siliceux des étages alpin et subalpin des plus hautes montagnes.'),
(1297, 'NR', 22, '36.3', 'Pelouses acidiphiles alpines et subalpines', '', 'Alpine and subalpine acidophilous grasslands', '', 3, 'Niveau 3', 495, '/67/495/1297', 'true', 'Alpine and sub-alpine grasslands developed over crystalline rocks and other lime-deficient substrates or on decalcified soils of the calcareous ranges, with Armeria alpina, Armeria montana, Euphrasia minima, Gentiana alpina, Geum montanum, Juncus trifidus, Lychnis alpina, Pedicularis pyrenaica, Phyteuma hemisphaericum, Pulsatilla alpina ssp. sulfurea, Ranunculus pyrenaicus, Sempervivum montanum, Botrychium lunaria.', 'Caricetea curvulae', 'Pelouses alpines et subalpines développées sur des roches cristallines et d\'autres substrats dépourvus de calcaire ou sur des sols décalcifiés des régions calcaires, avec Armeria alpina, Euphrasia minima, Gentiana alpina, Geum montanum, Juncus trifidus, Silene suecica, Pedicularis pyrenaica, Phyteuma hemisphaericum, Pulsatilla alpina subsp. sulfurea, Ranunculus pyrenaeus, Sempervivum montanum, Botrychium lunaria.'),
(1298, 'NR', 22, '36.5', 'Prairies alpines et subalpines fertilisées', '', 'Alpine and subalpine fertilized grasslands', '', 3, 'Niveau 3', 495, '/67/495/1298', 'true', 'Enriched hay meadows and pastures of the subalpine and lower alpine levels.', 'Arrhenatheretalia elatioris p.', 'Pâtures et prairies à fourrage enrichies des étages alpin et subalpin.'),
(1299, 'NR', 22, '54.6', 'Communautés à Rhynchospora alba', '', 'White beak-sedge communities', '', 3, 'Niveau 3', 504, '/71/504/1299', 'true', 'Highly constant pioneer communities of humid exposed peat or, sometimes, sand, with Rhynchospora alba, R. fusca, Drosera intermedia, D. rotundifolia, Lycopodiella inundata, forming on stripped areas of blanket bogs or raised bogs, but also on naturally seep- or frost-eroded areas of wet heaths and bogs, in flushes and in the fluctuation zone of oligotrophic pools with sandy, slightly peaty substratum. These communities are similar, and closely related, to those of shallow bog hollows (51.122) and of transition mires (54.57).', 'Rhynchosporion albae', 'Communautés pionnières hautement constantes sur les tourbières humides exposées, ou parfois, des sables, avec Rhynchospora alba, R. fusca, Drosera intermedia, D. rotundifolia, Lycopodiella inundata. Elles se développent sur des zones dénudées des tourbières de couverture ou des tourbières bombées, mais aussi sur des surfaces naturellement érodées par le ruissellement ou par le gel dans les landes humides et les tourbières, dans les suintements et dans les zones de fluctuation des mares oligotrophes avec des substrats sableux, légèrement tourbeux. Ces communautés sont similaires et sont en relations étroites avec celles des cuvettes de tourbières peu profondes (51.122) et des tourbières de transition (54.57).'),
(1300, 'NR', 22, '61.1', 'Eboulis siliceux alpins et nordiques', '', 'Alpine and northern siliceous screes', '', 3, 'Niveau 3', 497, '/69/497/1300', 'true', 'Siliceous screes of high altitudes and cool sites within the Alpine system and the Pyrenees, of the Jura and Hercynian ranges and of middle European uplands.', 'Androsacetalia alpinae p., Galeopsietalia segetum', 'Eboulis siliceux de haute altitude et stations froides à l\'intérieur du système alpien et dans les Pyrénées, le Jura et les montagnes hercyniennes et les montagnes de l\'Europe moyenne.'),
(1301, 'NR', 22, '61.2', 'Eboulis calcaires alpiens', '', 'Alpine calcareous screes', '', 3, 'Niveau 3', 497, '/69/497/1301', 'true', 'Calcareous and calcschist screes of high altitudes and cool sites of the Alps and, locally, of peri-Alpine ranges.', 'Thlaspietalia rotundifolii p., Drabetalia hoppeanae', 'Eboulis calcaires et calcschisteux des hautes altitudes et des sites froids des Alpes et, localement, des régions péri-alpiennes.'),
(1302, 'NR', 22, '64.2', '', '', 'Breckland inland dunes', '', 3, 'Niveau 3', 512, '/69/512/1302', 'false', 'Remnants of the once vast Breckland inland dune system, of similar glacial origin to that of the continental fluvio-glacial dunes of 64.1, and like them, colonized by acidophilous grasslands and heaths.', '', 'Pas de description disponible'),
(1303, 'NR', 22, '64.3', 'Dunes paléo-côtières', '', 'Palaeo-coastal dunes', '', 3, 'Niveau 3', 512, '/69/512/1303', 'true', 'Dune cordons marking former, though post-glacial, seashores. They are strongly decalcified and the communities that occupy them are similar to those of continental dunes, though floristically more influenced by the proximity of the sea, and often related to the decalcified inner fringes of the coastal dunes. Subhabitats may be indicated by use of the same codes as in 64.1 (replacing the prefix 64.1 by 64.3), speccified by those of 35.2, 31.2, 31.8, 41, 42 or 16.2.', '', 'Cordons de dunes, le long des rivages anciens, mais post-glaciaires. Ils sont fortement décalcifiés et les communautés qui les occupent sont similaires à celles des dunes continentales, bien que floristiquement plus influencés par la proximité de la mer, et souvent apparentés aux franges internes décalcifiées des dunes côtières. Des subdivisions peuvent être indiquées par l\'utilisation des mêmes codes que dans 64.1 (en remplaçant le préfixe 64.1 par 64.3), et spécifiés par ceux de 35.2, 31.2, 31.8, 41, 42 ou 16.2.'),
(1304, 'NR', 22, '64.4', 'Dunes fluviatiles', '', 'Fluviatile dunes', '', 3, 'Niveau 3', 512, '/69/512/1304', 'true', 'Dunes of the great rivers of middle Europe (Seine, Loire, Saone, Rhine). Like the fluvio-glacial dunes of northern Europe, they carry specialized and rare ecosystems. They are much more calcareous than the northern inland dunes and their grasslands (34.12, 34.34 i.a.) have a sub-steppic character contrasting with that of neighbouring regions. They are highly vulnerable. A small remnant exists in the Po plain of northern Italy.', '', 'Dunes des grandes rivières de l\'Europe centrale (Seine, Loire, Saône, Rhin). Comme les dunes fluvio-glaciaires du nord de l\'Europe, elles hébergent des écosystèmes rares et spécialisés. Elles sont beaucoup plus calcaires que les dunes continentales septentrionales et leurs pelouses (34.12, 34.34 i.a.) ont un caractère sub-steppique contrastant avec celui des régions avoisinantes. Elles sont hautement vulnérables. Un petit vestige existe dans la plaine du Pô et en Italie septentrionale.'),
(1305, 'NR', 22, '61.3', 'Eboulis ouest-méditerranéens et éboulis thermophiles', '', 'Western Mediterranean and thermophilous screes', '', 3, 'Niveau 3', 497, '/69/497/1305', 'true', 'Screes of warm exposures in the Alps and the Pyrenees, of calcareous substrates in the Pyrenees, of Mediterranean mountains, hills and lowlands and, locally, of warm, sunny middle European upland or lowland sites.', 'Androsacetalia alpinae p., Thlaspietalia rotundifolii p., Stipetalia calamagrostis, Polystichetalia lonchitis', 'Eboulis des expositions chaudes des Alpes et des Pyrénées, sur substrats calcaires dans les Pyrénées, des montagnes des collines et des bas pays méditerranéens, et, localement, des montagnes ou des sites de plaines ensoleillés médio-européens.'),
(1306, 'NR', 22, '53.2', 'Communautés à grandes Laîches', '', 'Large sedge communities', '', 3, 'Niveau 3', 513, '/71/513/1306', 'true', 'Formations of large Cyperaceae of genera Carex or Cyperus occupying the edge or the entirety of humid depressions, oligotrophic mires and rich fens, on ground that can be dry for part of the year. They occur, in particular, on the landward side of reedbeds in waterside successions and as colonists of humid depressions on mineral soils, or of acid and alkaline fens.', 'Magnocaricion', 'Formations à grandes cypéracées des genres Carex ou Cyperus occupant la périphérie ou la totalité des dépressions humides, des bourbiers oligotrophes et des bas-marais alcalins, sur des sols pouvant s\'assécher pendant une partie de l\'année. Elles se développent, en particulier, sur le flanc interne des roselières dans les successions riveraines, et comme colonisatrices des dépressions humides sur sols minéraux, ainsi que des bas-marais acides et alcalins.'),
(1307, 'NR', 22, '54.3', 'Gazons riverains arctico-alpins', '', 'Arcto-alpine riverine swards', '', 3, 'Niveau 3', 504, '/71/504/1307', 'true', 'Rare Alpine, peri-Alpine and northern British communities of glacial relicts colonizing neutral or basic gravelly, sandy, stoney, sometimes somewhat argilous or peaty substrates soaked by cold water, in moraines and on edges of springs, rivulets, glacial torrents of the alpine or sub-alpine levels, or on alluvial sands of pure, cold, slow-flowing rivers and calm backwaters. The highly characteristic constituents are Carex bicolor, C. microglochin, C. maritima, C. atrofusca, C. vaginata, Kobresia simpliciuscula, Scirpus pumilus, Juncus arcticus, J. alpinoarticulatus, J. castaneus, J. triglumis, Typha minima, T. lugdunensis, T. shuttleworthii, Tofieldia pusilla; they are often accompanied by Carex davalliana, C. dioica, C. capillaris, C. panicea, C. nigra, Blysmus compressus, Eleocharis quinqueflora, Scirpus cespitosus, Primula farinosa, Equisetum variegatum, Drepanocladus intermedius, Campylium stellatum.', 'Caricion bicolori-atrofuscae', 'Rares communautés alpiennes, péri-alpiennes et du nord des Iles britanniques composées de reliques glaciaires, et colonisant des substrats neutres ou basiques graveleux, sableux, pierreux, parfois un peu argileux ou tourbeux, imbibés par de l\'eau froide. Elles se développent dans les moraines et sur les bords des sources, des ruisselets, de torrents glaciaires aux étages alpin et subalpin, ou sur les sables alluviaux des rivières claires, froides, à courant lent et des bras morts. Les constituants les plus caractéristiques sont Carex bicolor, C. microglochin, C. maritima, C. atrofusca, C. vaginata, Kobresia simpliciuscula, Trichophorum pumilum, Juncus arcticus, J. triglumis, Typha minima, T. minima subsp. gracilis, T. shuttle worthii, Tofieldia pusilla ; ils sont souvent accompagnés de Carex davalliana, C. dioica, C. capillaris, C. panicea, C. nigra, Blysmus compresus, Eleocharis quinqueflora, Trichophorum cespitosum, Primula farinosa, Equisetum variegatum, Drepanocladus intermedius, Campylium stellatum.'),
(1308, 'NR', 22, '64.5', 'Dunes d\'origine lacustre', '', 'Lacustrine dunes', '', 3, 'Niveau 3', 512, '/69/512/1308', 'true', 'Unique dunes of the Savoie shore of Lake Geniva (Excenevex).', '', 'Dunes exceptionnelles de la rive savoyarde du Lac de Genève.'),
(1309, 'NR', 22, '64.6', 'Dunes continentales méditerranéennes', '', 'Mediterranean inland dunes', '', 3, 'Niveau 3', 512, '/69/512/1309', 'true', 'Inland dunes of Mediterranean climates.', '', 'Dunes continentales sous climats méditerranéens.'),
(1310, 'NR', 22, '65.1', '', '', 'Italian caves with Proteus anguinus', '', 3, 'Niveau 3', 498, '/69/498/1310', 'false', '', '', 'Pas de description disponible'),
(1311, 'NR', 22, '65.2', 'Grottes de l\'Italie septentrionale et du sud-est de la France avec Hydromantes italicus', '', 'Northern Italian and south-eastern French caves with Hydromantes italicus', '', 3, 'Niveau 3', 498, '/69/498/1311', 'true', '', '', 'Pas de description disponible'),
(1312, 'NR', 22, '65.3', '', '', 'Sardinian caves with Hydromantes genei', '', 3, 'Niveau 3', 498, '/69/498/1312', 'false', '', '', 'Pas de description disponible'),
(1313, 'NR', 22, '65.4', 'Autres grottes', '', 'Other caves', '', 3, 'Niveau 3', 498, '/69/498/1313', 'true', '', '', 'Pas de description disponible'),
(1314, 'NR', 22, '54.4', 'Bas-marais acides', '', 'Acidic fens', '', 3, 'Niveau 3', 504, '/71/504/1314', 'true', 'Topogenous or soligenous valley, basin or spring mire systems fed by waters poor in bases. As in the rich fens, the water level is at or near the surface of the substratum and peat formation is infra-aquatic. The mire communities themselves, dominated by small sedges and brown mosses or sphagnum, belong to the Caricetalia fuscae, but, in large fen systems, they are accompanied by acidocline wet grasslands (Molinietalia caeruleae), large sedge beds (Magnocaricion) and reed or related communities (Phragmition). Sphagnum hummocks (51.11) form locally and transition mires (54.5) or aquatic (22.3), amphibian (22.2) and spring (54.1) communities colonize small depressions. Thus, codes from all the above categories are used in conjunction with the ones below to completely describe the fen. The subdivisions listed here are, in any case, understood to include, besides strict mire communities, their transitions to humid grasslands, and groupings phytosociologically affiliated with Molinion associations, but rich in species of the Caricion fuscae, provided they are integrated in a fen system (somewhat paralleling the Junco acutiflori-Caricetalia nigrae of Rameau et al., 1989). Acidic fen communities also occur on small surfaces or within mosaics in other ecosystems, in particular in typical humid grasslands (37), humid woodlands and thickets (44), decalcified dune slacks (16.3) and spring systems (54.1).  Their presence can be indicated by codes from this unit used in conjunction with the relevant main codes. Characteristic species of acidic mire communities are Carex canescens, C. echinata, C. nigra, Eriophorum angustifolium,  E. scheuchzeri, Scirpus cespitosus, Juncus filiformis, Agrostis canina, Viola palustris, Cardamine pratensis, Ranunculus flammula and the mosses Calliergon sarmentosum, C. stramineum, C. cuspidatum, Drepanocladus exannulatus, D. fluitans, Sphagnum recurvum, S. auritum, S. cuspidatum, S. subsecundum, S. apiculatum, S. papillosum, S. russowii.', 'Caricetalia fuscae, Caricion fuscae', 'Systèmes de marais topogènes ou soligènes, des vallées ou des sources alimentées par des eaux pauvres en bases. Comme dans le cas des bas-marais alcalins, le niveau de l\'eau est à la surface, ou proche de la surface du substrat et la formation de tourbe est infra-aquatique. Ces communautés de bas-marais acides dominées par de petits Carex et des Mousses brunes ou des Sphaignes, appartiennent aux Caricetalia fuscae. Mais, dans des grands systèmes de bas-marais, elles sont accompagnées de prairies acidoclines humides (Molinietalia caeruleae), de magnocariçaies (Magnocaricion) et/ou en relation avec des phragmitaies (Phragmition) ou des communautés apparentées. Des buttes de Sphaignes (51.11) se forment localement et des tourbières de transition (54.5) ou des communautés aquatiques (22.3), amphibies (22.2) et de sources (54.1) colonisent les petites dépressions. Par conséquent les codes de toutes les catégories ci-dessus sont utilisés en conjonction avec ceux qui suivent pour décrire le marais d\'une façon complète. Les subdivisions présentées ici, sont, dans tous les cas comprises, de manière à inclure outre les communautés strictement de bas-marais, leurs transitions vers les prairies humides et les groupements phytosociologiquement proches des associations du Molinion mais riches en espèces du Caricion fuscae, pour autant que ces communautés soient intégrées dans un système de bas-marais (quelque peu analogue au Junco acutiflori-Caricetalia nigrae de Rameau et al, 1989). Les communautés des bas-marais acides occupent ainsi des surfaces restreintes ou se trouvent au sein de mosaïques avec d\'autres écosystèmes, en particulier dans les prairies humides typiques (37), les bois et les fourrés humides (44), les pannes dunaires décalcifiées (16.3) et les systèmes de sources (54.1). Leur présence peut être indiquée par les codes de ces unités, associés à ceux relevant du code principal. Les espèces caractéristiques de ces communautés de marais acides sont Carex canescens, C. echinata, C. nigra, Eriophorum angustifolium, E. scheuchzeri, Trichophorum cespitosum, Juncus filiformis, Agrostis canina, Viola palustris, Cardamine pratensis, Ranunculus flammula et les Mousses Calliergon sarmentosum, C. stramineum, C. cuspidatum, Drepanocladus exannulatus, D. fluitans, Sphagnum recurvum, S. auritum, S. cuspidatum, S. subsecundum, S. apiculatum, S. papillosum, S. russowii.'),
(1315, 'NR', 22, '66.1', '', '', 'Teide violet community', '', 3, 'Niveau 3', 499, '/69/499/1315', 'false', 'Very open formation of the summit of the Teide volcano of Tenerife, above (2700) 3000 metres, with Viola cheiranthifolia and a few individuals of Silene nocteolens and Argyranthemum teneriffae.', 'Violetea cheiranthifoliae', 'Pas de description disponible'),
(1316, 'NR', 22, '66.2', '', '', 'Etna summital communities', '', 3, 'Niveau 3', 499, '/69/499/1316', 'false', 'Communities of Mount Etna, above the limit of hedgehog-heaths.', '', 'Pas de description disponible'),
(1317, 'NR', 22, '66.3', '', '', 'Barren lava fields', '', 3, 'Niveau 3', 499, '/69/499/1317', 'false', 'Almost bare lava formations of other volcanoes, and of lower altitudes on Etna and Teide, colonized by, besides communities related to ones covered in other sections, lichens (e.g. Stereocaulon vesubianum) and invertebrates.', '', 'Pas de description disponible'),
(1318, 'NR', 22, '66.4', '', '', 'Volcanic ash and lapilli fields', '', 3, 'Niveau 3', 499, '/69/499/1318', 'false', '', '', 'Pas de description disponible'),
(1319, 'NR', 22, '66.5', '', '', 'Lava tubes', '', 3, 'Niveau 3', 499, '/69/499/1319', 'false', 'Caves formed by hollow basaltic tubes resulting from the cooling of the surface of lava flows whose moulten interior continued to flow. The very large tube created by the volcano La Corona of Lanzarote harbours unique communities of invertebrates, in particular, the decapode crustacean Munidopsis polymorpha, endemic to that locality, and several crustaceans of the genus Speleonectes.', '', 'Pas de description disponible'),
(1320, 'NR', 22, '66.6', 'Fumerolles', '', 'Fumaroles', '', 3, 'Niveau 3', 499, '/69/499/1320', 'true', 'Orifices in volcanic areas through which escape hot gases and vapours. Their very extreme environment is colonized by paucispecific but highly distinct communities.', '', 'Orifices dans les zones volcaniques d\'où s\'échappent vapeurs et gaz chauds. Leur environnement extrême est colonisé par des communautés paucispécifiques mais hautement différenciées.'),
(1321, 'NR', 22, '81.1', 'Prairies sèches améliorées', '', 'Dry improved grasslands', '', 3, 'Niveau 3', 500, '/70/500/1321', 'true', 'Dry or mesophile intensive pastures.', '', 'Pâturages intensifs secs ou mésophiles.'),
(1322, 'NR', 22, '81.2', 'Prairies humides améliorées', '', 'Humid improved grasslands', '', 3, 'Niveau 3', 500, '/70/500/1322', 'true', 'Humid intensive pastures, often scored with drainage ditches, and capable of harbouring breeding waders or wintering waterfowl, in particular, geese.', '', 'Pâturages intensifs humides, souvent drainés, et capables d\'abriter la reproduction d\'échassiers ou l\'hivernage du gibier d\'eau, en particulier des oies.'),
(1323, 'NR', 22, '82.1', 'Champs d\'un seul tenant intensément cultivés', '', 'Unbroken intensive cropland', '', 3, 'Niveau 3', 501, '/70/501/1323', 'true', 'Intensive cultivation, involving moderate to high chemical or organic fertilization and/or systematic use of pesticides, with complete ground occupation on dry land.', '', 'Cultures intensives, impliquant une fertilisation chimique ou organique modérée à importante et/ou une utilisation systématique de pesticides, avec une occupation complète du sol sur terrains secs.'),
(1324, 'NR', 22, '82.2', 'Cultures avec marges de végétation spontanée', '', 'Field margin cropland', '', 3, 'Niveau 3', 501, '/70/501/1324', 'true', 'Intensively treated crops interspersed with strips of spontaneous vegetation.', '', 'Cultures traitées intensivement, entremêlées avec des bandes de végétation spontanée.'),
(1207, 'NR', 22, '22.5', 'Masses d\'eau temporaires', '', 'Temporary water bodies', '', 3, 'Niveau 3', 484, '/66/484/1207', 'true', 'Bodies of water that are completely and recurrently emptied of water for part of the time such as Irish furloughs. The characteristics of each stage of the cycle can be defined by use of codes 22.1, 22.2, 22.3, 22.4, and, if appropriate 37, 38, 53, 54, or 8.', '', 'Pièces d\'eau s\'asséchant complètement et périodiquement de manière intermittente comme les turloughs irlandais. Les caractéristiques de chaque stade du cycle peuvent être définis en utilisant les codes 22.1, 22.2, 22.3, 22.4, et, si cela est approprié, 37, 38, 53, 54 ou 8.'),
(1208, 'NR', 22, '23.1', 'Eaux saumâtres ou salées sans végétation', '', 'Unvegetated brackish and salt waters', '', 3, 'Niveau 3', 485, '/66/485/1208', 'true', 'Open water with no or no detected floating or submerged vegetation other than algae.', '', 'Eau libre sans végétation flottante ou immergée (ou non détectée) autre que des algues.'),
(1209, 'NR', 22, '23.2', 'Eaux saumâtres ou salées végétalisées', '', 'Vegetated brackish and salt waters', '', 3, 'Niveau 3', 485, '/66/485/1209', 'true', 'Expanses of water with submerged or emergent vascular vegetation.', '', 'Pièces d\'eau abritant une végétation vasculaire immergée ou émergée.'),
(1210, 'NR', 22, '24.1', 'Lits des rivières', '', 'River course', '', 3, 'Niveau 3', 486, '/66/486/1210', 'true', 'River courses, regardless of submerged vegetation. The subdivisions are based on slope, width and water temperature according to usual ichthyological practice. Classifications based on flora, such as that of Holmes (1983) for British streams, give broadly similar results. For each of the divisions below, subdivisions can be introduced to take into account the morphodynamics of the stream as proposed, for instance, by Malavoi (1989).', '', 'Lits de rivières quelle que soit la végétation immergée. Les subdivisions sont basées sur la pente, la largeur et la température de l\'eau en fonction des pratiques habituelles de l\'ichtyologie. Les classifications basées sur la végétation, comme celle de Holmes (1983) pour les rivières britanniques donnent des résultats généralement identiques. Pour chacune des divisions ci-dessous, des subdivisions peuvent être introduites pour tenir compte des paramètres morphodynamiques du courant comme l\'a proposé, par exemple, Malavoi, 1989.'),
(1211, 'NR', 22, '24.5', 'Dépôts d\'alluvions fluviatiles limoneuses', '', 'River mud banks', '', 3, 'Niveau 3', 486, '/66/486/1211', 'true', 'Alluvial muds exposed by stream level fluctuations (see also 37.7).', '', 'Vases alluviales exondées du fait des fluctuations du niveau des cours d\'eau (voir alors 37.7).'),
(1212, 'NR', 22, '24.2', 'Bancs de graviers des cours d\'eau', '', 'River gravel banks', '', 3, 'Niveau 3', 486, '/66/486/1212', 'true', 'Small stone deposits of river beds.', '', 'Dépôts de petites pierres dans le lit des rivières.'),
(1213, 'NR', 22, '24.3', 'Bancs de sable des rivières', '', 'River sand banks', '', 3, 'Niveau 3', 486, '/66/486/1213', 'true', 'Sand deposits in river beds, particularly significant in large river systems such as the Loire.', '', 'Dépôts de sables dans les lits de cours d\'eau, particulièrement importants dans les grands systèmes fluviaux tels que celui de la Loire.'),
(1214, 'NR', 22, '24.4', 'Végétation immergée des rivières', '', 'Submerged river vegetation', '', 3, 'Niveau 3', 486, '/66/486/1214', 'true', 'Beds of water crowfoots, pondweeds, water starworts and other aquatic vegetation of streams comprising in particular Butomus umbellatus f. valisneriifolius, Callitriche cophocarpa, C. hamulata, C. obtusangula, C. stagnatilis, Groenlandia densa, Potamogeton coloratus, P. helveticus, P. natans var. prolixus, P. nodosus, Ranunculus fluitans, R. penicillatus, R. trichophyllus, Sagittaria sagittifolia var. vallisneriifolia, Schoenoplectus lacustris var. fluitans, Sparganium emersum ssp. fluitans. For fringing vegetation use codes of 53.', 'Ranunculion fluitantis', 'Tapis de Renoncules aquatiques, de Potamots, de Callitriches et autres plantes aquatiques des cours d\'eau comprenant en particulier Butomus umbellatus f. vallisneriifolius, Callitriche cophocarpa, C. hamulata, C. obtusangula, C. stagnatilis, Groenlandia densa, Potamogeton coloratus, P. pedinatus, P. natans var. prolixus, P. nodosus, Ranunculus fluitans, R. penicillatus, R. trichophyllus, Sagittaria sagittifolia var. vallisneriifolia, Schoenoplectus lacustris, var. fluitans, Sparganium emersum subsp. fluitans. Pour la végétation de bordure, se rapporter aux codes de 53.'),
(1215, 'NR', 22, '22.4', 'Végétations aquatiques', '', 'Aquatic vegetation', '', 3, 'Niveau 3', 484, '/66/484/1215', 'true', 'Areas of lakes, ponds, pools or canals occupied by floating or permanently submerged vegetation.', '', 'Régions de lacs, d\'étangs, de marais ou de canaux occupés par une végétation flottante ou constamment immergée.'),
(1216, 'NR', 22, '31.1', 'Landes humides', '', 'Wet heaths', '', 3, 'Niveau 3', 487, '/67/487/1216', 'true', 'Humid, peaty or semi-peaty heaths (other than blanket bogs).', 'Ericion tetralicis; Ulicion minoris p.; Genistion micrantho-anglicae p.', 'Landes humides, tourbeuses ou semi-tourbeuses (autres que les tourbières de couverture).'),
(1217, 'NR', 22, '31.2', 'Landes sèches', '', 'Dry heaths', '', 3, 'Niveau 3', 487, '/67/487/1217', 'true', 'Mesophile or xerophile heaths on siliceous, podsolic soils in moist Atlantic and sub-Atlantic climates of plains and low mountains.', 'Calluno-Ulicetea', 'Landes mésophiles ou xérophiles sur sols siliceux, podzoliques sous la plupart des climats atlantiques et subatlantiques des plaines et des basses montagnes.'),
(1218, 'NR', 22, '31.5', 'Fourré bas de Pins mugo', '', 'Dwarf mountain pine scrub', '', 3, 'Niveau 3', 487, '/67/487/1218', 'true', 'Pinus mugo brushes of well-drained, often calcareous, soils in the Alps and Appenines, frequently accompanied by Rhododendron hirsutum, Erica herbacea, Arctostaphylos uva-ursi, A. alpina, Rhodothamnus chamaecistus.', 'Mugo-Rhodoretum hirsuti', 'Fourrés de Pinus mugo sur sols calcaires bien drainés des Alpes, accompagnés fréquemment de Rhododendron hirsutum, Erica herbacea, Arctostaphylos uva-ursi, A. alpina.'),
(1219, 'NR', 22, '31.6', 'Fourrés subalpins et communautés de hautes herbes (mégaphorbiaies)', '', 'Subalpine bush and tall herb communities', '', 3, 'Niveau 3', 487, '/67/487/1219', 'true', 'Bushy facies of the tall herb communities (Betulo-Adenostyletea) of moist, rich soils mostly of the sub-alpine zone of higher mountain ranges (cf. 37.8).', 'Betulo-Adenostyletea p.', 'Faciès buissonnants de communautés de hautes herbes (Betulo-Adenostyletea) sur des sols humides, la plupart du temps riches, de la zone subalpine des secteurs de haute montagne (voir 37.8).'),
(1220, 'NR', 22, '31.7', 'Landes épineuses (= Landes hérisson)', '', 'Hedgehog-heaths', '', 3, 'Niveau 3', 487, '/67/487/1220', 'true', 'Primary cushion heaths of the high, dry mountains of the Mediterranean region, with low, cushion-forming, often spiny shrubs, such as Acantholimon, Astragalus, Erinacea, Vella, Bupleurum, Ptilotrichum, Genista, Echinospartum, Anthyllis and various composites and labiates; secondary, zoogenic cushion heaths of the same regions, either downslope extensions of the oro-Mediterranean formations, and dominated by the same species, or specifically montane, often Genista-dominated.', '', 'Landes primaires des hautes montagnes sèches de la région méditerranéenne constituées de coussinets bas souvent épineux comprenant notamment des représentants des genres Acantholimon, Astragalus, Erinacea, Bupleurum, Ptilotrichum, Genista, Echinospartum, Anthyllis et diverses Composées et Labiées ; landes secondaires sympatriques en coussinets zoogènes, les unes et les autres étant des extensions vers le bas des formations oro-méditerranéennes, dominées par les mêmes espèces, ou bien spécifiques aux montagnes et souvent dominées par les Genista.'),
(1221, 'NR', 22, '31.3', '', '', 'Macaronesian heaths', '', 3, 'Niveau 3', 487, '/67/487/1221', 'false', 'Heaths of the Canary Islands, Azores and Madeira.', '', 'Pas de description disponible'),
(1222, 'NR', 22, '31.4', 'Landes alpines et boréales', '', 'Alpine and boreal heaths', '', 3, 'Niveau 3', 487, '/67/487/1222', 'true', 'Small, dwarf or prostrate shrub formations of the alpine and sub-alpine zones dominated by ericaceous species, Dryas octopetala or dwarf junipers; Dryas heaths of the British Isles.', '', 'Formations d\'arbrisseaux bas, nains ou prostrés des étages alpin ou subalpin dominées par des Ericacées, par Dryas octopetala ou par des genévriers nains.'),
(1223, 'NR', 22, '31.8', 'Fourrés', '', 'Thickets', '', 3, 'Niveau 3', 487, '/67/487/1223', 'true', 'Pre- and post-forest formations, mostly deciduous, of Atlantic or medio-European affinities, characteristic of the deciduous forest zone, but also colonizing cool, moist or disturbed stations of the Mediterranean evergreen forest zone.', 'Prunetalia, Cytisetalia scopario-striati, Epilobietea angustifolii', 'Formations pré- et postforestières, la plupart du temps caducifoliées, d\'affinités atlantiques ou médio-européennes, caractéristiques de la zone de forêts caducifoliées, mais colonisant aussi des stations fraîches, humides ou perturbées de la zone forestière sempervirente méditerranéenne.'),
(1224, 'NR', 22, '32.1', 'Matorral arborescent', '', 'Arborescent matorral', '', 3, 'Niveau 3', 488, '/67/488/1224', 'true', 'Pre- or post-forest formations with a more or less dense arborescent cover and with a usually thick, high evergreen shrub stratum. They are mostly degradation or reconstitution stages of the broad-leaved evergreen forests (45) or their substitution, intermediate between them and maquis (32.2 to 32.5); some are substitution stages of thermophilous deciduous (41) or conifer (42) forests.', 'Quercetalia ilicis, Pistacio-Rhamnetalia alaterni i.a.', 'Formations pré- ou postforestières constituées par un couvert arboré plus ou moins dense avec une strate buissonnante généralement dense, et haute. Il s\'agit le plus généralement des étapes de dégradation ou de reconstitution de forêts sempervirentes (45) ou de faciès de substitution intermédiaires entre celle-ci et le maquis (de 32.2 à 32.5) ; certains sont des stades de substitution de forêts thermophiles caducifoliées ou résineuses.'),
(1225, 'NR', 22, '32.2', 'Formations arbustives thermo-méditerranéennes', '', 'Thermo-Mediterranean shrub formations', '', 3, 'Niveau 3', 488, '/67/488/1225', 'true', 'Shrub formations characteristic of the thermo-Mediterranean zone. Included here are those formations, for the most part indifferent to the siliceous or calcareous nature of the substrate, that reach their greatest extention or optimal development in the thermo-Mediterranean zone. Also included are the numerous, strongly characterized, thermophile formations endemic to the south of the Iberian peninsula, mostly thermo-Mediterranean but sometimes meso-Mediterranean; in their great local diversity they are a western counterpart of, and sometimes approach in appearance, the mostly eastern Mediterranean phryganas, which, however, on account of their strong structural singularity, are listed separately under 33.', 'Pistacio-Rhamnetalia alaterni: Oleo-Ceratonion, Asparago-Rhamnion oleoidis, Periplocion angustifoliae, Rhamno-Quercion cocciferae p., Juniperion lyciae p., Ceratonio-Rhamnion; Phlomidetalia purpureae; Anthyllidetalia terniflorae; Calluno-Ulicetalia: Stauracanthenion boivinii, Ericenion umbellatae p.; Lavanduletalia stoechidis: Stauracantho genistoidis-Halimion halimifolii, Ulici argentei-Cistion ladaniferi p.', 'Formations arbustives caractéristiques de l\'étage thermo-méditerranéen. Sont incluses ici les formations, pour la plupart indifférentes à la nature siliceuse ou calcaire du substrat, qui atteignent leur plus grande extension ou leur développement optimal dans l\'étage thermo-méditerranéen. Sont aussi incluses les nombreuses formations thermophiles endémiques hautement caractérisées, du sud de la péninsule Ibérique, plutôt thermo-méditerranéennes mais parfois méso-méditerranéennes ; dans leur grande diversité locale elles forment le pendant occidental des phryganes est-méditerranéennes, qui, compte tenu de leur grande singularité structurale, sont cataloguées séparément sous 33.'),
(1226, 'NR', 22, '32.3', 'Maquis silicicoles méso-méditerranéens', '', 'Meso-Mediterranean silicicolous maquis', '', 3, 'Niveau 3', 488, '/67/488/1226', 'true', 'Shrubby formations, often tall, on mostly siliceous soils of the meso-Mediterranean zone of the Iberian peninsula, France, Italy and the large western Mediterranean islands, degradation stages of evergreen oak forests. Very similar formations of the thermo-Mediterranean zone and of the eastern Mediterranean are included.', 'Cisto-Lavanduletea, Pistacio-Rhamnetalia alaterni: Ericenion arboreae', 'Formations arbustives, souvent élevées, sur des sols généralement siliceux de l\'étage méso-méditerranéen de la France... représentant divers stades de dégradation des forêts de chênes sempervirents.'),
(1227, 'NR', 22, '32.4', 'Garrigues calcicoles de l\'étage méso-méditerranéen occidental', '', 'Western meso-Mediterranean calcicolous garrigues', '', 3, 'Niveau 3', 488, '/67/488/1227', 'true', 'Shrubby formations, often low, on mostly calcareous soils of the meso- Mediterranean zone of the Iberian peninsula, France, Italy and the large western Mediterranean islands. Included here are those formations that reach their optimal development within the meso-Mediterranean zone although they often enter the thermo- or supra-Mediterranean levels. The subdivisions proposed are based on the physiognomically most significant dominants; co-dominance can be indicated by use of multiple codes.', 'Rosmarinetalia: Rosmarino-Ericion, Aphyllanthion p.', 'Formations arbustives, souvent basses, sur sols principalement calcaires de l\'étage méso-méditerranéen de la péninsule Ibérique, de la France, de l\'Italie et des grandes îles ouest-méditerranéennes. Sont comprises ici les formations qui atteignent leur développement optimal à l\'étage mésoméditerranéen bien qu\'elles pénètrent souvent dans les niveaux thermo- ou supraméditerranéens. Les subdivisions proposées sont basées sur les dominances les plus significatives physionomiquement ; les codominances peuvent être précisées par l\'utilisation de multiples codes.');
INSERT INTO `corine` (`CD_HAB`, `FG_VALIDITE`, `CD_TYPO`, `LB_CODE`, `LB_HAB_FR`, `LB_HAB_FR_COMPLET`, `LB_HAB_EN`, `LB_AUTEUR`, `NIVEAU`, `LB_NIVEAU`, `CD_HAB_SUP`, `PATH_CD_HAB`, `FRANCE`, `LB_DESCRIPTION`, `CRSP_PHYTO_CB91`, `DESCRIPTIF_CB97_FR`) VALUES
(1228, 'NR', 22, '32.9', 'Champs d\'Asphodèles, de Phlomis, de Chardons, de Ferula', '', 'Fields of asphodel, Phlomis, thistle, Ferula', '', 3, 'Niveau 3', 488, '/67/488/1228', 'true', 'Over-browsed and over-grazed garrigues physiognomically transformed into fields of asphodel, Phlomis, thistle or Ferula.', '', 'Garrigues surpâturées et surabrouties, physionomiquement transformées en champs d\'asphodèles, de Phlomis, de chardon ou de Ferula.'),
(1229, 'NR', 22, '32.A', 'Champs de Spartium junceum', '', 'Spanish-broom fields', '', 3, 'Niveau 3', 488, '/67/488/1229', 'true', 'Formations of Spanish broom, Spartium junceum, in Mediterranean and sub-Mediterranean areas.', '', 'Formations de Spartium junceum des étages méditerranéen et sub-méditerranéen.'),
(1230, 'NR', 22, '32.6', 'Garrigues supra-méditerranéennes', '', 'Supra-Mediterranean garrigues', '', 3, 'Niveau 3', 488, '/67/488/1230', 'true', 'Low shrub formations with pronounced Mediterranean affinities formed as a degradation stage of thermophile deciduous forests (Quercion pubescentis, Ostryo-Carpinion) or sometimes of Quercus rotundifolia forests in the supra-Mediterranean belt. Included here are only those formations that are characteristic of the supra-Mediterranean level; formations, particularly of the lower supra-Mediterranean, that are closely related to meso-Mediterranean communities have been included under 32.4 and 32.5.', 'Ononidion striatae p., Aphyllanthion p., Lavandulo-Genistion boissieri', 'Formations arbustives basses, ayant des affinités méditerranéennes prononcées ; stade de dégradation des forêts thermophiles caducifoliées (Quercion pubescentis, Ostryo-Carpinion) ou parfois des forêts de Quercus ilex de l\'étage supra-méditerranéen ; on n\'inclut ici que les formations qui sont caractéristiques de l\'étage supra-méditerranéen. Les formations particulières aux étages inférieurs au supra-méditerranéen, qui sont étroitement apparentées aux communautés méso-méditerranéennes, ont été incorporées sous les numéros 32.4 et 32.5.'),
(1231, 'NR', 22, '32.7', '', '', 'Pseudomaquis', '', 3, 'Niveau 3', 488, '/67/488/1231', 'false', 'Shrub formations intermediate between Mediterranean maquis and schibljak, resulting from the degradation of the Ostryo-Carpinion of Greece, the Balkans and Italy, with a mixture of evergreen and deciduous bushes including Quercus coccifera, Juniperus oxycedrus, Quercus trojana, Carpinus orientalis, Ostrya carpinifolia, Pistacia terebinthus, Buxus sempervirens. Similar Iberian formations with Amelanchier ovalis, Prunus lusitanica, Ilex aquifolium. French and Italian formations with Quercus pubescens and Quercus ilex.', '', 'Pas de description disponible'),
(1232, 'NR', 22, '32.8', '', '', 'Macaronesian xerophytic communities', '', 3, 'Niveau 3', 488, '/67/488/1232', 'false', 'Xerophytic scrub formations of the lower slopes of the Canary Islands, Madeira and the Salvagen Islands, rich in succulents, in particular cactiform or dendroid spurges Euphorbia spp., rosette-forming Aeonium spp. and composites.', 'Kleinio-Euphorbietea canariensis', 'Pas de description disponible'),
(1233, 'NR', 22, '32.5', 'Garrigues orientales', '', 'Eastern garrigues', '', 3, 'Niveau 3', 488, '/67/488/1233', 'true', 'Shrubby formations, often low, of the meso-, thermo- and occasionally supra-Mediterranean zones of Greece. Included here are all sclerophyllous formations, regardless of substrate, except those with conspicuous cushion structure (phryganas s.s., listed in 33, and hedgehog-heaths, listed in 31.7), those with abundant Pistacia lentiscus, Myrtus communis or other thermo-Mediterranean brush elements (Phillyrea spp., Erica manipuliflora, Styrax officinalis, Genista fasselata, Euphorbia dendroides, Calicotome villosa, Sarcopoterium spinosum) listed in 32.2 and high maquis with Erica arborea and Arbutus spp., listed in 32.3. The subdivisions proposed are based on the physiognomically most significant dominants; co-dominance can be indicated by use of multiple codes.', 'Micromerietea p.', 'Pas de description disponible'),
(1234, 'NR', 22, '34.1', 'Pelouses pionnières médio-européennes', '', 'Middle European pioneer swards', '', 3, 'Niveau 3', 490, '/67/490/1234', 'true', 'Open, thermophile formations of sandy or rocky ground in non-Mediterranean lowland to montane areas.', 'Sedo-Scleranthetea p.', 'Formations thermophiles ouvertes des substrats sableux ou rocheux, des plaines aux territoires montagnards, en dehors de la région méditerranéenne.'),
(1235, 'NR', 22, '34.2', 'Pelouses métallifères de basse altitude', '', 'Lowland heavy metal grasslands', '', 3, 'Niveau 3', 490, '/67/490/1235', 'true', 'Dry, short grasslands, often rich in lichens and mosses, colonizing western and central European soils with a high content in heavy metals such as zinc and lead, and comprising uniquely adapted species, ecotypes or populations mostly related to, or derived from, otherwise montane, boreo-montane or steppic species.', '', 'Pelouses sèches, basses, souvent riches en lichens et en mousses, colonisant les sols (en Europe centrale et occidentale) contenant une haute teneur en métaux lourds tels que zinc et plomb, et comprenant uniquement des espèces adaptées, écotypes ou populations principalement apparentées à, ou dérivées, des espèces par ailleurs montagnardes, boréomontagnardes ou steppiques. Non signalées en France.'),
(1236, 'NR', 22, '34.3', 'Pelouses pérennes denses et steppes médio-européennes', '', 'Dense perennial grasslands and middle European steppes', '', 3, 'Niveau 3', 490, '/67/490/1236', 'true', 'Dry closed thermophilous grasslands of middle European or Mediterranean lowlands and hills, up to the montane zone, dominated by perennial grasses; steppic grasslands of continental middle European affinities.', 'Festuco-Brometea', 'Pelouses sèches thermophiles, fermées des plaines et collines méditerranéennes ou médio-européennes, jusqu\'à l\'étage montagnard, dominées par des graminées vivaces ; pelouses steppiques d\'affinités continentales médio-européennes.'),
(1237, 'NR', 22, '33.1', 'Phryganes ouest méditerranéennes des sommets de falaises', '', 'West Mediterranean clifftop phryganas', '', 3, 'Niveau 3', 489, '/67/489/1237', 'true', 'Rare, extremely local and isolated associations of clifftops and adjacent areas dispersed along the coasts of Provence, Cap Corse, the Straits of Bonifacio, Catalonia (Cabo de Creus) and extreme south-western Portugal, characterized by the presence of Astragalus massiliensis or Anthyllis hermanniae, variously accompanied by Thymelaea hirsuta, Helichrysum italicum, Plantago subulatum, Armeria ruscinonensis.', 'Astragalo-Plantaginetum subulatae, Anthyllido-Thymelaeetum hirsutae, Thymelaeo-Helichrysetum, Armerietum ruscinonensis', 'Associations rares, extrêmement locales et isolées, des sommets de falaises et des zones adjacentes dispersées le long des côtes de Provence, du Cap Corse et du détroit de Bonifacio, caractérisées par la présence d\'Astragalus tragacantha (massiliensis) ou Anthyllis hermanniae, accompagnés par Thymelaea hirsuta, Helichrysum italicum, Plantago subulata, Armeria ruscinonensis.'),
(1238, 'NR', 22, '33.2', '', '', 'Sardinian Centaurea horrida phryganas', '', 3, 'Niveau 3', 489, '/67/489/1238', 'false', 'Highly threatened formations of the promontories of northern Sardinia, limited to the peninsulas of Stintino and Capo Caccia and the islands of Asinara and Tavola, dominated by the large, silvery-blue, hemispherical cushions of the endemic Tertiary relict Centaurea horrida, associated with many other endemic or restricted relict species including Astragalus massiliensis, Erodium corsicum, Limonium acutifolium, Nananthea perpusilla, Evax rotundata, Armeria pungens.', 'Centaureetum horridae', 'Pas de description disponible'),
(1239, 'NR', 22, '33.3', '', '', 'Aegean phryganas', '', 3, 'Niveau 3', 489, '/67/489/1239', 'false', 'Low, thorny formations of hemispherical shrubs of the coastal thermo-Mediterranean zone of Greece and its islands with Sarcopoterium spinosum, Centaurea spinosa,Satureja thymbra, Thymus capitatus, Genista acanthoclada, Anthyllis hermanniae, Euphorbia acanthothamnos, Stachys spinosa, Ballota pseudodictamnus, B. acetabulosa, Erica manipuliflora, Rhamnus oleoides, Lithospermum hispidulum, Fumana arabica, F. thymifolia, Cistus creticus, C. parviflorus, C. salvifolius, Pistacia lentiscus, Teucrium brevifolium, T. divaricatum, T. polium, Calicotome villosa, Micromeria graeca, M. juliana, M. nervosa, Salvia triloba, Ononis spinosa, Helichrysum italicum ssp. microphyllum, and ssp. italicum, Phagnalion graecum, much more widespread and diverse than the western Mediterranean formations. The subdivisions proposed are based on physiognomically significant dominants; co-dominance can be indicated by use of multiple codes.', 'Cisto-Micromerietea, \"Sarcopoterietalia spinosi\"', 'Pas de description disponible'),
(1325, 'NR', 22, '82.3', 'Culture extensive', '', 'Extensive cultivation', '', 3, 'Niveau 3', 501, '/70/501/1325', 'true', 'Traditionally and extensively cultivated crops, in particular, of cereals, harbouring a rich and threatened flora of field weeds including Agrostemma githago, Centaurea cyanus, Legousia speculum-veneris, Chrysanthemum segetum, Calendula arvensis, Adonis spp., Consolida spp., Delphinium spp., Nigella spp., Papaver spp.; their varied range of associations can be indicated by subdivisions.', '', 'Champs, en particulier de céréales, cultivées traditionnellement et extensivement, abritant une riche flore menacée de mauvaises herbes messicoles incluant Agrostemma githago, Centaurea cyanus, Legousia speculum-veneris, Chrysanthemum segetum, Calendula arvensis, Adonis spp., Consolida spp., Delphinium spp., Nigella spp., Papaver spp. Leurs gammes variées d\'associations peuvent être indiquées par des subdivisions.'),
(1326, 'NR', 22, '82.4', 'Cultures inondées', '', 'Flooded crops', '', 3, 'Niveau 3', 501, '/70/501/1326', 'true', 'Rice fields and other inundated or inundatable croplands.', '', 'Champs de riz et d\'autres cultures inondées ou inondables.'),
(1327, 'NR', 22, '83.1', 'Vergers de hautes tiges', '', 'High-stem orchards', '', 3, 'Niveau 3', 502, '/70/502/1327', 'true', 'Tree crops of standards, cultivated for fruit production.', '', 'Cultures d\'arbres de haute tige cultivés pour la production de fruits.'),
(1328, 'NR', 22, '61.4', '', '', 'Eastern Mediterranean screes', '', 3, 'Niveau 3', 497, '/69/497/1328', 'false', 'Screes of the high Greek mountains.', 'Drypetalia spinosae', 'Pas de description disponible'),
(1329, 'NR', 22, '53.3', 'Végétation à Cladium mariscus', '', 'Fen-sedge beds', '', 3, 'Niveau 3', 513, '/71/513/1329', 'true', 'Cladium mariscus-dominated formations, mostly limited in the northern part of their range, where they have a distincty relict distribution, to alkaline and sometimes acid fens and to the land-building zone of calcareous lakes, somewhat more widespread in the Mediterranean region as a waterside vegetation.', 'Cladietum marisci i.a.', 'Formations dominées par Cladium mariscus. Dans la partie septentrionale de leur aire de distribution, où elles ont une distribution nettement relicte, elles sont le plus souvent limitées aux bas-marais alcalins et quelquefois acides, et aux zones atterries des lacs à eaux calcaires. Elles sont un peu plus répandues dans la région méditerranéenne, comme végétation du bord des eaux.'),
(1330, 'NR', 22, '83.2', 'Vergers à arbustes', '', 'Shrub orchards', '', 3, 'Niveau 3', 502, '/70/502/1330', 'true', 'Ligneous plantations of dwarf trees, shrubs, espaliers and climbers.', '', 'Plantations ligneuses d\'arbres nains, d\'arbustes, d\'espaliers et de plantes grimpantes.'),
(1331, 'NR', 22, '83.3', 'Plantations', '', 'Plantations', '', 3, 'Niveau 3', 502, '/70/502/1331', 'true', 'Cultivated ligneous formations planted most often for the production of wood, composed of exotic species or of native species out of their natural range and habitat.', '', 'Formations de ligneux cultivés, plantés le plus souvent, pour la production de bois, composées d\'espèces exotiques ou d\'espèces naturelles en dehors de leur aire naturelle et de leur habitat naturel.'),
(1332, 'NR', 22, '62.1', 'Végétation des falaises continentales calcaires', '', 'Vegetated calcareous inland cliffs', '', 3, 'Niveau 3', 503, '/69/503/1332', 'true', 'Dry, calcareous inland cliffs and their communities. Specific plant associations colonize montane and Mediterranean cliffs. Most of the subdivisions below refer to them. Northern lowland cliffs usually support fragments of communities listed in other chapters.', 'Potentilletalia caulescentis, Asplenietalia glandulosae, Onosmetalia frutescentis, Potentilletalia speciosae', 'Falaises continentales calcaires sèches et leurs communautés. Associations végétales spécifiques colonisant les falaises montagnardes et méditerranéennes. La plupart des subdivisions ci-dessous s\'y réfèrent. Les falaises septentrionales de basse altitude supportent souvent des fragments de communautés répertoriées dans d\'autres chapitres.'),
(1333, 'NR', 22, '53.4', 'Bordures à Calamagrostis des eaux courantes', '', 'Small reed beds of fast-flowing waters', '', 3, 'Niveau 3', 513, '/71/513/1333', 'true', 'Formations of small helophytes, Glyceria fluitans, G. plicata, G. nemoralis, G. declinata, Leersia oryzoides, Catabrosa aquatica, Sparganium neglectum, S. microcarpum, Nasturtium officinale, N. microphyllum, Veronica beccabunga, V. anagallis-aquatica, Apium nodiflorum, Sium erectum occupying, throughout the Community, the banks of small rivers or springs on alluvial or peaty soils.', 'Glycerio-Sparganion', 'Formations de petits hélophytes, Glyceria fluitans, G. notata, G. declinata, Leersia oryzoides, Catabrosa aquatica, Sparganium erectum subsp. neglectum, S. erectum subsp. microcarpum, Nasturtium officinale, N. microphyllum, Veronica beccabunga, V. anagallis-aquatica, Apium nodiflorum, Berula erecta, occupant partout dans la communauté les marges des rivières étroites ou les sources sur des sols alluviaux ou tourbeux.'),
(1334, 'NR', 22, '53.5', 'Jonchaies hautes', '', 'Tall rush swamps', '', 3, 'Niveau 3', 513, '/71/513/1334', 'true', 'Formations of Juncus invading heavily grazed and trampled marshes or fens or (with Juncus effusus) eutrophized poor fens and bogs as in the vicinity of bird colonies. Similar formations developing within the environment of wet meadows have been listed under 37.241.', 'Agropyro-Rumicion crispi p.', 'Formations de Juncus envahissant des marais ou bas-marais très pâturés et piétinés ou des bas-marais acides ou (avec Juncus effusus) eutrophisés et des tourbières au voisinage des colonies d\'oiseaux. Des formations similaires développées dans le cadre des prairies humides ont été codées sous le numéro 37.241.'),
(1335, 'NR', 22, '53.6', 'Formations riveraines de Cannes', '', 'Riparian cane formations', '', 3, 'Niveau 3', 513, '/71/513/1335', 'true', 'Mediterranean beds of tall canes along permanent or temporary water courses.', '', 'Peuplements méditerranéens de grandes cannes le long des cours d\'eau permanents ou temporaires.'),
