(1339, 'NR', 22, '84.4', 'Bocages', '', 'Bocage', '', 3, 'Niveau 3', 505, '/70/505/1339', 'true', 'Reticulated landscape of tree-lines, hedgerows, small woods, pastures and crops, characteristic, in particular of southern England and western France.', '', 'Paysages réticulés de lignes d\'arbres, de haies, de petits bois, de pâturages et de cultures, caractéristiques, en particulier, de l\'ouest de la France.'),
(1340, 'NR', 22, '54.1', 'Sources', '', 'Springs', '', 3, 'Niveau 3', 504, '/71/504/1340', 'true', 'Gushing springs (rheocrenes,), spring basins (limnocrenes) and seepages (helocrenes) and the communities closely associated with them and dependant on the peculiar microclimatic and hydrological situation created by the spring. These comprise the specialized spring communities (Montio-Cardaminetea) as well as the fen communities (Caricetalia davallianae, 54.2, Caricetalia fuscae, 54.4) or other communities (Caricion bicoloris-atrofuscae, 54.3, Festuco-Brometea, 34.3) ), that are interwoven with them.', 'Montio-Cardaminetea i.a.', 'Sources jaillissantes (rhéocrènes), submergées (limnocrènes) et en suintements (hélocrènes) et leurs communautés étroitement associées, dont la composition dépend des conditions microclimatiques et hydrologiques particulières engendrées par la source. Celles-ci comprennent des communautés spécialisées de sources (Montio-Cardaminetea) ainsi que les communautés de bas-marais (Caricetalia davallianae, 54.2, Caricetalia fuscae, 54.4) ou d\'autres communautés (Caricion bicoloris-atrofuscae, 54.3, Festuco-Brometea, 34.3) qui s\'entremêlent avec elles.'),
(1341, 'NR', 22, '54.5', 'Tourbières de transition', '', 'Transition mires', '', 3, 'Niveau 3', 504, '/71/504/1341', 'true', 'Wetlands mostly or largely occupied by peat-forming plant communities developed at the surface of oligotrophic or meso-oligotrophic water reaching a level above, sometimes well above, the substratum, providing little or no mineral or nutrient supply. Their characteristics are thus intermediate between those of soligenous and topogenous mires and those of strictly ombrogenous bogs. In large systems, the most prominent communities are swaying swards, floating carpets or quaking mires formed by medium sized or small sedges, associated with sphagnums or brown mosses. They are accompanied by aquatic and amphibious communities (22.3, 22.4) and by formations transitional to these on the one hand, to fens (54.2, 54.4), bogs (51.1) or humid grasslands (37) on the other; sphagnum buttes (51.11), in particular, are often an important feature. Tall sedge and reed communities (53), willow and alder carrs (44) invade part of the peatland. Transition mires form mostly as colonists of oligotrophic ponds and lakes, large bog pools or laggs. Their distribution is mostly northern peri-Alpine, peri-Hercynian and northern European. Outside of transition mire systems, their communities can be found in bog hollows (51.12), in blanket bogs (52), in depressions of rich or acidic fens (54.2, 54.4), in spring systems (54.1), in humid heaths (31.1) and a few other habitats. Characteristic species include Eriophorum gracile, Carex lasiocarpa, C. chordorrhiza, C. limosa, Scheuchzeria palustris, Hammarbya paludosa, Liparis loeselii, Calla palustris. Transition mires are an extremely important refuge of specialized, threatened species of both plants and animals; their richness and diversity in remarkable invertebrates, dragonflies among others, is even greater than that of most other mire ecosystems.', 'Scheuchzerietalia palustris: Caricion lasiocarpae, Rhynchosporion albae p. i.a.', 'Zones humides, occupées principalement ou en grande partie par des communautés de plantes turfigènes, se développant à la surface des eaux oligotrophes ou méso-oligotrophes, le substrat n\'apportant que pas ou peu d\'approvisionnement minéral ou de nutriments. Leurs caractéristiques sont donc intermédiaires entre celles des marais soligènes et topogènes et celles des tourbières strictement ombrogènes. Dans les grands systèmes, les communautés les plus remarquables sont les pelouses tremblantes, les tapis flottants ou des tourbières tremblantes formés de Cypéracées de taille moyenne ou petite, associés à des Sphaignes ou des Mousses brunes. Celles-ci sont accompagnées par des communautés aquatiques et amphibies (22.3, 22.4) et par des formations de transition vers celles-ci d\'une part, vers des marécages (54.2, 54.4), des tourbières (51.1), et, d\'autre part, des prairies humides (37) ; les buttes de Sphaignes (51.11), en particulier, sont souvent une composante caractéristique et importante. Les grands Carex et les roselières (53), les saulaies et les aulnaies envahissent une partie des tourbières. Les tourbières de transition se forment pour la plupart en colonisant les mares et lacs oligotrophes, et les mares et lagg des grandes tourbières. Leur distribution est surtout nord péri-alpienne, péri-hercynienne et nord-européenne. Les espèces caractéristiques comprennent Eriophorum gracile, Carex lasiocarpa, C. chordorrhiza, C. limosa, Scheuchzeria palustris, Hammarbya paludosa, Liparis loeselii, Calla palustris. Les tourbières de transition sont un refuge extrêmement important d\'espèces spécialisées menacées, de plantes et d\'animaux ; leur richesse et leur diversité en invertébrés remarquables, des libellules notamment, est bien plus grande que celle de la plupart des autres écosystèmes de tourbières.'),
(1342, 'NR', 22, '84.5', 'Parcs boisés', '', 'Parkland', '', 3, 'Niveau 3', 505, '/70/505/1342', 'false', 'Park-like grassland dotted with trees, characteristic of the British Isles.', '', 'Prairies parsemés d’arbres ressemblant à des parcs, caractéristiques des îles Britanniques.'),
(1343, 'NR', 22, '84.6', '', '', 'Dehesa', '', 3, 'Niveau 3', 505, '/70/505/1343', 'false', 'A characteristic landscape of the south-western quadrant of the Iberian peninsula in which crops, pasture land or Mediterranean scrub, in juxtaposition or rotation, are shaded by a fairly closed to very open canopy of native oaks, Quercus suber, Q. rotundifolia, Q. pyrenaica, Q. faginea. It is an important habitat of raptors, including the threatened Iberian endemic eagle Aquila adalberti, of the crane Grus grus, of large insects and their predators and of the endangered felid Lynx pardinus.', '', 'Pas de description disponible'),
(1344, 'NR', 22, '85.1', 'Grands parcs', '', 'Large parks', '', 3, 'Niveau 3', 506, '/70/506/1344', 'true', 'Large, varied green spaces. Their constituting elements can be specified by use of the codes below.', '', 'Espaces verts grands et variés. Leurs éléments constitutifs peuvent être spécifiés par l\'utilisation des codes ci-dessous.'),
