(1356, 'NR', 22, '62.2', 'Végétation des falaises continentales siliceuses', '', 'Vegetated siliceous inland cliffs', '', 3, 'Niveau 3', 503, '/69/503/1356', 'true', 'Dry, siliceous inland cliffs and their communities. Specific plant associations colonize montane and Mediterranean cliffs. Most of the subdivisions below refer to them. Northern lowland cliffs usually support fragments of communities listed in other chapters.', 'Androsacetalia vandellii, Asplenietalia lanceolato-obovati, Asplenietalia billotii', 'Falaises siliceuses sèches et leurs communautés. Associations végétales spécifiques colonisant les falaises montagnardes et méditerranéennes. La plupart des subdivisions qui suivent ci-dessous correspondent à ces associations. Les falaises continentales septentrionales hébergent généralement des fragments de communautés codées dans d\'autres chapitres.'),
