(1359, 'NR', 22, '54.2', 'Bas-marais alcalins (tourbières basses alcalines)', '', 'Rich fens', '', 3, 'Niveau 3', 504, '/71/504/1359', 'true', 'Wetlands mostly or largely occupied by peat- or tufa-producing small sedge and brown moss communities developed on soils permanently waterlogged, with a soligenous or topogenous base-rich, nutrient-poor, often calcareous water supply, and with the water table at, or slightly above or below, the substratum. Peat formation, when it occurs, is infra-aquatic. Calciphile small sedges and other Cyperaceae usually dominate the mire communities, which belong to the Caricion davallianae, characterized by a usually prominent \"brown moss\" carpet formed by Campylium stellatum, Drepanocladus intermedius, D. revolvens, Cratoneuron commutatum, Acrocladium cuspidatum, Ctenidium molluscum, Fissidens adianthoides, Bryum pseudotriquetrum and others, a grasslike growth of Schoenus nigricans, S. ferrugineus, Eriophorum latifolium, Carex davalliana, C. flava, C. lepidocarpa, C. hostiana, C. panicea, Juncus subnodulosus, Scirpus cespitosus, Eleocharis quinqueflora, and a very rich flora including Tofieldia calyculata, Dactylorhiza incarnata, D. traunsteineri, D. traunsteinerioides, D. russowii, D. majalis ssp. brevifolia, D. cruenta, Liparis loeselii, Herminium monorchis, Epipactis palustris, Pinguicula vulgaris, Pedicularis sceptrum-carolinum, Primula farinosa, Swertia perennis. Wet grasslands (Molinietalia caerulaea, 37), tall sedge beds (Magnocaricion, 53.2), reed formations (Phragmition, 53.1), fen sedge beds (Cladietum mariscae, 53.3), may form part of the fen system, with communities related to transition mires (54.5, 54.6) and amphibious or aquatic vegetation (22.3, 22.4) or spring communities (54.1) developing in depressions.  The subunits below, which can, alone or in combination, and together with codes selected from the categories just mentioned, precise the composition of the fen, are understood to include the mire communities sensu stricto (Caricion davallianae), their transition to the Molinion, and assemblages that, although they may be phytosociologically referrable to alkaline Molinion associations, contain a large representation of the Caricion davallianae species listed, in addition to being integrated in the fen system; this somewhat parallels the definition of an integrated class Molinio-Caricetalia davallianae in Rameau et al., 1989.  Outside of rich fen systems, fen communities can occur on small surfaces in dune slack systems (16.3), in transition mires (54.5), in wet grasslands (37), on tufa cones (54.121) and in a few other situations. The codes below can be used, in conjunction with the principal code relevant, to signal their presence. Rich fens are exceptionally endowed with spectacular, specialized, strictly restricted species. They are among the habitats that have undergone the most serious decline. They are essentially extinct in several regions and gravely endangered in most. A very few large systems remain, in particular in pre-Alpine Bavaria, in the Italian pre-Alps, in collinar and montane eastern France, in northeastern Germany, in the coastal marshes of northern France, in southeastern and northern England, in Wales and in Ireland.', 'Tofieldietalia (Caricetalia davallianae): Caricion davallianae', 'Zones humides occupées principalement ou en grande partie par des communautés de petites Laîches et de Mousses brunes productrices de tourbes ou de tufs. Ces formations se développent sur des sols gorgés d\'eau en permanence, avec une alimentation en eau soligène ou topogène très alcaline, pauvre en nutriments, souvent calcaire. La nappe d\'eau est au niveau ou légèrement au-dessous ou au-dessus du sol. La formation de tourbe, quand elle se produit, se fait sous l\'eau. Des petits Carex calciphiles et autres Cyperacées sont généralement dominants dans les communautés des bas-marais, qui appartiennent au Caricion davallanae, caractérisées par un tapis généralement dominant de \"Mousses brunes\", formé par Campylium stellatum, Drepanocladus intermedius, D. revolvens, Cratoneuron commutatum, Acrocladium cuspidatum, Ctenidium molluscum, Fissidens adianthoide, Bryum pseudotriquetrum et autres, des végétations herbacées de Schoenus nigricans, S. ferrugineus, Eriophorum latifolium, Carex davalliana, C. flava, C. lepidocarpa, C. hostiana, C. panicea, Juncus subnodulosus, Trichophorum cespitosum, Eleocharis quinqueflora et une très riche flore comprenant Tofieldia calyculata, Dactylorhiza incarnata, D. traunsteineri, D. cruenta, Liparis loselii, Herminium monorchis, Epipactis palustris, Pinguicula vulgaris, Primula farinosa, Swertia perennis. Les prairies humides (Molinietalia caerulaeae, 37), les peuplement de grands Carex (Magnocaricion, 53.2), les roselières (53.1), les cladiaies (Cladietum mariscae, 53.3) peuvent faire partie du système du bas-marais, avec des communautés apparentées aux marais de transition (54.5, 54.6) aux végétations amphibies ou aquatiques (22.3, 22.4) ou aux communautés de sources (54.1) développées dans les dépressions. Les subdivisions reprises ci-dessous qui, seules ou combinées entre elles et combinées avec les codes issus des catégories qui viennent d\'être mentionnées, peuvent préciser la composition du marais. Ces unités sont conçues de manière à inclure les communautés des bas-marais alcalins (Caricion davallianae), leur transition vers le Molinion, ainsi que des ensembles intégrés dans le système du bas-marais qui, quoique phytosociologiquement pouvant être rattachés aux associations alcalines du Molinion, contiennent une grande représentation des espèces du Caricion davallianae. Ceci équivaut en quelque sorte à la définition d\'une classe synthétique des Molinio-Caricetalia davallianae dans Rameau et al., 1989. Outre les systèmes de bas-marais alcalins riches, des communautés de bas-marais peuvent exister sur des petites surfaces à l\'intérieur des systèmes de pannes dunaires (16.3), des tourbières de transition (54.5), des prairies humides (37), sur des cônes de tufs (54.121) et dans quelques autres situations. Les codes ci-dessous peuvent être utilisés en association avec le code principal approprié pour indiquer leur présence. Les bas-marais alcalins riches sont exceptionnels car dotés en espèces spectaculaires, spécialisées, de répartition strictement limitées. Ils font partie des habitats qui ont subi la régression la plus grave. Ils ont pratiquement disparu de certaines régions et sont gravement menacés dans d\'autres. Il ne reste que très peu de grands systèmes, en particulier dans les collines et montagnes de l\'est de la France, ...'),
(1360, 'NR', 22, '62.3', 'Dalles rocheuses', '', 'Pavements', '', 3, 'Niveau 3', 503, '/69/503/1360', 'true', 'Almost bare rock pavements and lapiaz. Cracks and superficially decomposed areas may be colonized by communities belonging, in particular to the Sedo-Scleranthion, the Alysso-Sedion albi or the Sedo albi-Veronicion dillenii (34.11, 36.2).', '', 'La circulaire (Directive Habitats) manque de précisions et précise sous un numéro erroné (62.4) une priorité pour les dalles rocheuses. Dalles de rochers et lapiaz à peu près nus. Les fissures et zones superficiellement décomposées peuvent être colonisées par des communautés rentrant dans la catégorie, en particulier, des Sedo-Scleranthetea, de l\'Alysso-Sedion albi ou du Sedo albi-Veronicion dillenii (34.11, 36.2).'),
(1361, 'NR', 22, '62.4', 'Falaises continentales dénudées', '', 'Bare inland cliffs', '', 3, 'Niveau 3', 503, '/69/503/1361', 'true', 'Cliffs, in particular of very high altitudes, devoid of vascular vegetation. They are usually colonized by lichen crusts and \"ink stains\".', '', 'Falaises dépourvues de végétation vasculaire, en particulier aux très hautes altitudes ; elles sont habituellement colonisées par des Lichens crustacés et en \"taches d\'encre\".'),
(1362, 'NR', 22, '62.5', 'Falaises continentales humides', '', 'Wet inland cliffs', '', 3, 'Niveau 3', 503, '/69/503/1362', 'true', 'Very wet, dripping, overhanging or vertical rocks of hills, mountains and Mediterranean lowlands.', '', 'Rochers très humides, suintants, surplombants ou verticaux des collines, des montagnes et des régions méditerranéennes.'),
(1363, 'NR', 22, '62.6', '', '', 'Macaronesian inland cliffs', '', 3, 'Niveau 3', 503, '/69/503/1363', 'false', 'Inland cliffs of the Canary Islands, Madeira and the Açores, extremely rich in endemic species of both plants and animals, including vertebrates (the endangered Pterodroma madeira). The genus Aeonium is particularly representative.', 'Aeonio-Greenovietae', 'Pas de description disponible'),
(1364, 'NR', 22, '63.1', 'Névés', '', 'Snow packs', '', 3, 'Niveau 3', 511, '/69/511/1364', 'true', 'Quasi-permanent snow packs, in particular in avalanche corridors.', '', 'Névés quasi-permanents, en particulier dans les couloirs d\'avalanches.'),
(1365, 'NR', 22, '63.2', 'Glaciers rocheux', '', 'Rock glaciers', '', 3, 'Niveau 3', 511, '/69/511/1365', 'true', '', '', 'Pas de description disponible'),
(1366, 'NR', 22, '63.3', 'Glaciers', '', 'True glaciers', '', 3, 'Niveau 3', 511, '/69/511/1366', 'true', '', '', 'Pas de description disponible'),
(1367, 'NR', 22, '64.1', 'Dunes fluvio-glaciaires', '', 'Fluvio-glacial dunes', '', 3, 'Niveau 3', 512, '/69/512/1367', 'true', 'Dunes of the North Sea and Baltic plains, formed of quartzic sands originating in redeposited and reworked glacial drift and outwash. These highly siliceous dunes are characteristic of the Netherlands, northern Belgium and northern Germany. The dune systems, particularly the large ones, harbour a unique ensemble of interacting communities and harbour many specialized and restricted organisms. They have considerably regressed and the remaining examples are fragile and often threatened. The presence of the various elements of the ecosystem can be indicated by simultaneous use of the codes below and of those relevant to the types of plant communities they represent.', '', 'Dunes de la mer du Nord et de la Plaine Baltique, formées de sables quartzeux ayant pour origines des moraines et des alluvions glaciaires redéposées et retravaillées. Ces dunes très siliceuses sont caractéristiques des Pays-Bas, de la Belgique et de l\'Allemagne septentrionales. Les sytèmes dunaires, les grands en particulier, abritent un ensemble unique de communautés interactives et de nombreux organismes spécialisés à aire de distribution limitée. Ils ont considérablement régressé et les exemples restant sont fragiles et menacés. La présence des différents éléments de l\'écosystème peuvent être indiqués par l\'utilisation simultanée des codes ci-dessous et de ceux qui ont un rapport avec les types de communautés de plantes qu\'ils représentent.'),
(1368, 'NR', 22, '53.1', 'Roselières', '', 'Reed beds', '', 3, 'Niveau 3', 513, '/71/513/1368', 'true', 'Reed bed formations of tall helophytes, usually species-poor and often dominated by one species, growing in stagnant or slowly flowing water of fluctuating depths, and sometimes on waterlogged ground. They can be classified according to the dominant species, which gives them a distinctive appearance.', 'Phragmition australis, Scirpion maritimi', 'Roselières avec grands hélophytes, habituellement pauvres en espèces (souvent dominées par une seule espèce), elles croissent dans les eaux stagnantes ou à écoulement lent, de profondeur fluctuante et quelquefois sur des sols hydromorphes. Elles peuvent être classées selon les espèces dominantes qui confère à chacune d\'elles une apparence propre.'),
(1369, 'NR', 22, '42.6', 'Forêts de Pins noirs', '', 'Black pine forests', '', 3, 'Niveau 3', 491, '/68/491/1369', 'true', 'Forests dominated by pines of the Pinus nigra group.', '', 'Forêts dominées par des Pins du groupe de Pinus nigra.'),
(1370, 'NR', 22, '43.1', 'Hêtraies mixtes', '', '', '', 3, 'Niveau 3', 514, '/68/514/1370', 'true', '', '', 'Pas de description disponible'),
(1371, 'NR', 22, '43.2', 'Chênaies-charmaies mixtes', '', '', '', 3, 'Niveau 3', 514, '/68/514/1371', 'true', '', '', 'Pas de description disponible'),
(1372, 'NR', 22, '43.5', 'Chênaies acidiphiles mixtes', '', '', '', 3, 'Niveau 3', 514, '/68/514/1372', 'true', '', '', 'Pas de description disponible'),
(1373, 'NR', 22, '43.7', 'Chênaies mixtes thermophiles et supra-méditerranéennes', '', '', '', 3, 'Niveau 3', 514, '/68/514/1373', 'true', '', '', 'Pas de description disponible'),
(1374, 'NR', 22, '43.9', 'Forêts mixtes de châtaigniers', '', '', '', 3, 'Niveau 3', 514, '/68/514/1374', 'true', '', '', 'Pas de description disponible'),
(1375, 'NR', 22, '43.A', 'Charmaies mixtes', '', '', '', 3, 'Niveau 3', 514, '/68/514/1375', 'true', '', '', 'Pas de description disponible'),
(1376, 'NR', 22, '43.B', 'Boulaies mixtes', '', '', '', 3, 'Niveau 3', 514, '/68/514/1376', 'true', '', '', 'Pas de description disponible'),
(1377, 'NR', 22, '43.H', 'Autres forêts mixtes', '', '', '', 3, 'Niveau 3', 514, '/68/514/1377', 'true', '', '', 'Pas de description disponible'),
(1378, 'NR', 22, '44.1', 'Formations riveraines de Saules', '', 'Riparian willow formations', '', 3, 'Niveau 3', 515, '/68/515/1378', 'true', 'Salix spp. brush or arborescent formations, lining flowing water and submitted to periodic flooding.', 'Salicetea purpureae; Populetalia albae p.', 'Formations arbustives ou arborescentes à Salix spp., le long des cours d\'eau et soumises à des inondations périodiques.'),
(1379, 'NR', 22, '44.7', '', '', 'Oriental plane and sweet gum woods', '', 3, 'Niveau 3', 515, '/68/515/1379', 'false', 'Forests and woods, for the most part riparian, dominated by Platanus orientalis or Liquidambar orientalis.', '', 'Pas de description disponible'),
(1380, 'NR', 22, '44.8', 'Galeries et fourrés riverains méridionaux', '', 'Southern riparian galleries and thickets', '', 3, 'Niveau 3', 515, '/68/515/1380', 'true', 'Low ligneous formations of wetlands of the thermo-Mediterranean zone and of southwestern Iberia.', '', 'Formations ligneuses basses des zones humides de l\'étage thermo-méditerranéen.'),
(1381, 'NR', 22, '45.4', '', '', 'Kermes oak forests', '', 3, 'Niveau 3', 517, '/68/517/1381', 'false', 'Forest or woodland formations dominated by arborescent Quercus coccifera (Q. \"calliprinos\", Q. \"pseudococcifera\").', '', 'Pas de description disponible'),
(1382, 'NR', 22, '42.7', '', '', 'High oro-mediterranean pine forests', '', 3, 'Niveau 3', 491, '/68/491/1382', 'false', 'Woods of Pinus heldreichii, P. leucodermis or P. peuce.', '', 'Pas de description disponible'),
(1383, 'NR', 22, '45.7', '', '', 'Palm groves', '', 3, 'Niveau 3', 517, '/68/517/1383', 'false', 'Woods, often riparian, formed by the two endemic palm trees of the Community, Phoenix teophrasti of Crete, and P. canariensis of the Canary Islands.', '', 'Pas de description disponible'),
(1384, 'NR', 22, '45.8', 'Bois de Houx', '', 'Holly woods', '', 3, 'Niveau 3', 517, '/68/517/1384', 'true', 'Woods dominated by tall arborescent Ilex aquifolium, present in the supra-Mediterranean level of Sardinia and Corsica and in Atlantic mountains of northwestern Spain; they usually constitute a facies of the relict yew-holly forests (42.A7).', '', 'Bois dominés par Ilex aquifolium arborescent présents dans la zone supraméditerranéenne de Corse. Ils constituent généralement un faciès des forêts relictes d\'if à houx (42.A7).'),
(1385, 'NR', 22, '45.9', '', '', 'Canarian heath forests', '', 3, 'Niveau 3', 517, '/68/517/1385', 'false', 'Very tall, forest-like, formations dominated by Erica arborea, Myrica faya, Arbutus canariensis or Visnea mocanera, occurring naturally in the most wind-exposed and the driest stations within the \"monte verde\" of the Canary Island cloud belt; they also form extensively as degradation stages of the laurisilva or as secondary colonists.', 'Fayo-Ericion arboreae', 'Pas de description disponible'),
(1386, 'NR', 22, '42.8', 'Bois de Pins méditerranéens', '', 'Mediterranean pine woods', '', 3, 'Niveau 3', 491, '/68/491/1386', 'true', 'Mediterranean and thermo-Atlantic woods of thermophilous pines, mostly appearing as substitution or paraclimactic stages of forests of the Quercetalia ilicis or Ceratonio-Rhamnetalia. Long-established plantations of these pines, within their natural area of occurrence, and with an undergrowth basically similar to that of paraclimactic formations, are included.', '', 'Bois méditerranéens et thermo-atlantiques de Pins thermophiles, s\'implantant surtout comme étapes de substitution ou paraclimaciques des forêts des Quercetalia ilicis ou Ceratonio-Rhamnetalia. Des plantations de ces Pins établies depuis longtemps, à l\'intérieur de leur aire naturelle de répartition, et avec une strate inférieure essentiellement similaire à celle des formations paraclimaciques, sont incluses.'),
(1387, 'NR', 22, '44.2', 'Galeries d\'Aulnes blancs', '', 'Grey alder galleries', '', 3, 'Niveau 3', 515, '/68/515/1387', 'true', 'Riparian woods of Alnus incana of montane and sub-montane rivers of the Alps, the northern Apennines and neighbouring regions.', 'Alnion incanae (Alnetum incanae s.l.)', 'Bois riverains d\'Alnus incana des rivières montagnardes et sub-montagnardes des Alpes et des régions voisines.'),
(1388, 'NR', 22, '44.9', 'Bois marécageux d\'Aulne, de Saule et de Myrte des marais', '', 'Alder, willow and bog-myrtle swamp woods', '', 3, 'Niveau 3', 515, '/68/515/1388', 'true', 'Woods and scrubs of marshy ground, waterlogged for most of the year, colonizing fens and marshy or permanently inundated alluvial terraces of rivers.', 'Alnetea glutinosae', 'Bois et fourrés des sols marécageux, gorgés d\'eau pour la plus grande partie de l\'année, colonisant les bas-marais et les terrasses alluviales marécageuses ou en permanence inondées.'),
(1389, 'NR', 22, '44.3', 'Forêt de Frênes et d\'Aulnes des fleuves médio-européens', '', 'Medio-European stream ash-alder woods', '', 3, 'Niveau 3', 515, '/68/515/1389', 'true', 'Riparian forests of Fraxinus excelsior and Alnus glutinosa, sometimes Alnus incana, of middle European and northern Iberian lowland or hill watercourses, on soils periodically inundated by the annual rise of the river level, but otherwise well-drained and aerated during low-water; they differ from riparian alder woods within 44.9 by the strong representation in the dominated layers of forest species not able to grow in permanently waterlogged soils.', 'Alno-Padion p. (Fraxino-Alnion glutinosae)', 'Forêts riveraines de Fraxinus excelsior et Alnus glutinosa, quelquefois accompagnés par Alnus incana, des plaines et collines de l\'Europe moyenne, sur des sols périodiquement inondés lors des crues annuelles, mais cependant bien drainés et aérés durant les basses eaux ; elles diffèrent des forêts marécageuses d\'Aulnes de 44.9 par la forte représentation dans les étages dominés d\'espèces forestières qui ne sont pas capables de croître sur des sols engorgés en permanence.'),
(1390, 'NR', 22, '44.A', 'Forêts marécageuses de Bouleaux et de Conifères', '', 'Birch and conifer swamp woods', '', 3, 'Niveau 3', 515, '/68/515/1390', 'true', 'Woods of Betula pubescens, Pinus spp. or Picea abies colonizing bogs and acid fens.', 'Vaccinio-Piceetea: Piceo-Vaccinienion uliginosi (Betulion pubescentis, Ledo-Pinion) i.a.', 'Bois de Betula pubescens, Pinus spp. ou de Picea abies colonisant les tourbières et les marécages acides.'),
(1391, 'NR', 22, '52.1', '', '', 'Lowland blanket bogs', '', 3, 'Niveau 3', 516, '/71/516/1391', 'false', 'Hyper-Atlantic blanket bogs of the western coastlands of Ireland, western Scotland and its islands, Cumberland, northern Wales and Devon, developed under very high rainfall climates. The main vascular plants are Molinia caerulea, Eriophorum angustifolium, E. vaginatum, Scirpus cespitosus, Schoenus nigricans, Rhynchospora alba, Narthecium ossifragum, Carex panicea, Calluna vulgaris, Erica tetralix, Myrica gale, Pedicularis sylvatica, Potentilla erecta, Polygala serpyllifolia, Pinguicula lusitanica, Drosera rotundifolia. The colourful mucinal layer comprises the black and crimson liverwort Pleurozia purpurea, the black and gold moss Campylopus atrovirens, the wooly fringe moss Rhacomitrium lanuginosum; it is often dominated by sphagnums (Sphagnum auriculatum, S. magellanicum, S. compactum, S. papillosum, S. nemoreum, S. rubellum, S. tenellum, S. subnitens), or, particularly in parts of western Ireland, mucilaginous algal deposits (Zygogonium). Some of the distinctive features of the blanket bog can be, as in 52.1, individualized by the codes below.', 'Sphagnetalia magellanici: Pleurozio purpureae-Ericetum tetralicis; Scheuchzerietalia palustris p., Caricetalia fuscae p., Utricularietalia intermedio-minoris p., Littorelletalia, Potamogetonetalia', 'Pas de description disponible'),
(1392, 'NR', 22, '52.2', '', '', 'Upland blanket bogs', '', 3, 'Niveau 3', 516, '/71/516/1392', 'false', 'Blanket bogs of high ground, hills and mountains in Scotland, Ireland, western England and Wales. Characteristic species are Eriophorum vaginatum, Calluna vulgaris, Erica tetralix, Rubus chamaemorus, Narthecium ossifragum, Scirpus cespitosus, Drosera rotundifolia, Rhacomitrium lanuginosum and abundant sphagnum mosses.', 'Sphagnetalia magellanici: Vaccinio-Ericetum tetralicis; Ericion tetralicis p., Scheuchzerietalia palustris p., Caricetalia fuscae p., Utricularietalia intermedio-minoris p., Littorelletalia, Potamogetonetalia', 'Pas de description disponible'),
(1393, 'NR', 22, '45.5', 'Forêts de Chênes et Lauriers', '', 'Continental laurel-oak woodland', '', 3, 'Niveau 3', 517, '/68/517/1393', 'true', 'Laurus nobilis-dominated facies of evergreen oak forests, in particular, in coastal Asturias (cf.45.311) and Andalusia.', 'Lauro nobilis-Quercetum ilicis p. i.a.', 'Faciès des chênaies sempervirentes dominés par Laurus nobilis, en particulier, sur les côtes d\'Asturie (voir 45.311) et d\'Andalousie. Présence de peuplement à Quercus ilex et Laurus nobilis en Provence.'),
(1394, 'NR', 22, '45.6', '', '', 'Macaronesian laurel forests', '', 3, 'Niveau 3', 517, '/68/517/1394', 'false', 'Humid to hyper-humid, mist-bound, luxuriant, evergreen, lauriphyllous forests of the cloud belt of the Macaronesian islands, extremely rich in floral and faunal species, among which many are restricted to these communities. Genera such as Picconia, Semele, Gesnouinia, Lactucosonchus, Ixanthus are entirely endemic to these communnities, while others, such as Isoplexis, Visnea and Phyllis reach in them their maximum development; in addition, each of the formations of the various archipelagoes harbours distinctive endemic species. Laurel forests are the most complex and remarkable relict of the humid sub-tropical vegetation of the Mioceno-Pliocene late Tertiary of southern Europe. Areas of intact forests have been drastically reduced to a level below which the preservation of their elements could not be sustained.', 'Pruno-Lauretalia', 'Pas de description disponible'),
(1395, 'NR', 22, '45.1', 'Forêts d\'Oliviers et de Caroubiers', '', 'Olive-carob forests', '', 3, 'Niveau 3', 517, '/68/517/1395', 'true', 'Thermo-Mediterranean or thermo-Canarian woodland dominated by arborescent Olea europaea ssp. sylvestris, Ceratonia siliqua, Pistacia lentiscus, Myrtus communis or, in the Canary Islands, by Olea europaea ssp. cerasiformis and Pistacia atlantica. Most formations will be listed as arborescent matorral (35.12), but a few stands may have a sufficiently tall, closed canopy to qualify for this unit.', 'Oleo-Ceratonion, Ceratonio-Rhamnion, Kleinio-Euphorbietea canariensis p.', 'Bois thermo-méditerranéen dominé par Olea europaea subsp. sylvestris arborescent, Ceratonia siliqua, Pistacia lentiscus, Myrtus communis. La plupart des formations sont cataloguées comme des matorrals arborescents (35.12), mais quelques stations peuvent avoir une canopée suffisamment élevée et fermée pour être classées dans cette unité.');
INSERT INTO `corine` (`CD_HAB`, `FG_VALIDITE`, `CD_TYPO`, `LB_CODE`, `LB_HAB_FR`, `LB_HAB_FR_COMPLET`, `LB_HAB_EN`, `LB_AUTEUR`, `NIVEAU`, `LB_NIVEAU`, `CD_HAB_SUP`, `PATH_CD_HAB`, `FRANCE`, `LB_DESCRIPTION`, `CRSP_PHYTO_CB91`, `DESCRIPTIF_CB97_FR`) VALUES
(1396, 'NR', 22, '44.4', 'Forêts mixtes de Chênes, d\'Ormes et de Frênes des grands fleuves', '', 'Mixed oak-elm-ash forests of great rivers', '', 3, 'Niveau 3', 515, '/68/515/1396', 'true', 'Diverse riparian forests of the middle courses of great rivers, inundated only by large floods.', 'Ulmenion minoris', 'Forêts riveraines des cours moyens des grands fleuves, inondés seulement lors des grandes crues, à haute diversité spécifique.'),
(1397, 'NR', 22, '45.2', 'Forêts de Chênes lièges (suberaies)', '', 'Cork-oak forests ', '', 3, 'Niveau 3', 517, '/68/517/1397', 'true', 'West-Mediterranean silicicolous forests dominated by Quercus suber, usually more thermophile and hygrophile than 45.3.', '', 'Forêts silicicoles ouest-méditerranéennes dominées par Quercus suber, habituellement plus thermophiles et plus hygrophiles que celles de 45.3.'),
(1398, 'NR', 22, '42.9', '', '', 'Canary Island pine forests', '', 3, 'Niveau 3', 491, '/68/491/1398', 'false', 'Forests of endemic Pinus canariensis, of the dry montane level at around 800 to 2000 metres (locally down to 500 and up to 2500 metres) in Tenerife, La Palma, Gran Canaria and Hierro, with Chamaecytisus proliferus, Adenocarpus foliolosus, Cistus symphytifolius, Lotus campylocladus, L. hillebrandii, L. spartioides, Daphne gnidium, Juniperus cedrus, Micromeria spp.; these forests, of which well-preserved examples have become rare, are the only habitat of Fringilla teydea, Dendrocopos major canariensis and D. m. thanneri.', 'Cytiso-Pinetea canariensis: Cisto-Pinion canariensis', 'Pas de description disponible'),
(1399, 'NR', 22, '44.5', 'Galeries méridionales d\'Aulnes et de Bouleaux', '', 'Southern alder and birch galleries', '', 3, 'Niveau 3', 515, '/68/515/1399', 'true', 'Riparian formations of Alnus glutinosa, locally of A. cordata or Betula spp. of the Mediterranean basin and of western Iberia, often with Fraxinus angustifolia and Osmunda regalis.', 'Osmundo-Alnion', 'Formations riveraines d\'Alnus glutinosa, localement d\'Alnus cordata ou Betula spp. du bassin méditerranéen, souvent avec Fraxinus angustifolia et Osmunda regalis.'),
(1400, 'NR', 22, '42.A', 'Forêts dominées par les Cyprès, les Genévriers et les Ifs', '', 'Cypress, juniper and yew forests', '', 3, 'Niveau 3', 491, '/68/491/1400', 'true', 'Woods dominated by Cupressus sempervirens, Juniperus spp. or Taxus baccata.', '', 'Bois dominés par Cupressus sempervirens, Juniperus spp. ou Taxus baccata.'),
(1401, 'NR', 22, '45.3', 'Forêts de Chênes verts méso- et supra méditerranéennes', '', 'Meso- and supra-Mediterranean holm-oak forests', '', 3, 'Niveau 3', 517, '/68/517/1401', 'true', 'Forests dominated by Quercus ilex or Q. rotundifolia, often, but not necessarily, calcicolous.', 'Quercion ilicis', 'Forêts surtout méso- et supraméditerranéennes dominées par Quercus ilex, souvent, mais non nécessairement calcicoles.'),
(1402, 'NR', 22, '51.2', 'Tourbières à Molinie bleue', '', 'Purple moorgrass bogs', '', 3, 'Niveau 3', 518, '/71/518/1402', 'true', 'Drying, mowed or burned bogs invaded by Molinia caerulea.', 'Ericion tetralicis p.', 'Tourbières asséchées, fauchées ou brûlées, envahies par Molinia caerulea.'),
(1403, 'NR', 22, '44.6', 'Forêts méditerranéennes de Peupliers, d\'Ormes et de Frênes', '', 'Mediterranean poplar-elm-ash forests', '', 3, 'Niveau 3', 515, '/68/515/1403', 'true', 'Mediterranean multi-layered alluvial forests with Populus alba, Fraxinus angustifolia, Ulmus minor, Salix alba, Salix spp., Alnus spp., lianas and often species of the Quercetalia ilicis. Populus alba, usually dominant in height, may be absent or sparse in some associations which are then dominated by Fraxinus angustifolia, Ulmus minor and/or Salix spp.', 'Populion albae', 'Forêts alluviales méditerranéennes multi-strates avec Populus alba, Fraxinus angustifolia, Ulmus minor, Salix alba, Salix spp., Alnus spp., des lianes et souvent des espèces des Quercetalia ilicis. Populus alba, habituellement dominant en hauteur, peut être absent ou rare dans quelques formations qui sont alors dominées par Fraxinus angustifolia, Ulmus minor et/ou Salix spp.'),
(1404, 'NR', 22, '51.1', 'Tourbières hautes à peu près naturelles', '', 'Near-natural raised bogs', '', 3, 'Niveau 3', 518, '/71/518/1404', 'true', 'Undisturbed, or little disturbed, peat-forming bogs, often taking the shape of a convex lens. Such intact or nearly intact systems have become very rare or even exceptional. They are composed of a number of communities, which form and occupy the topological features of the bog. These communities are interrelated and function as a unit, so that they cannot be regarded as separate subhabitats; their presence and combination, however, characterizes the various types of bogs. Simultaneous use of an appropriate selection of the subunits below can thus contribute to a description of individual bog systems.', '', 'Tourbières hautes non ou très peu dégradées, ayant souvent la forme d\'une lentille convexe. De tels systèmes intacts ou à peu près intacts sont extrêmement rares, pour ne pas dire exceptionnels. Ils sont composés de nombreuses communautés dont la forme et la localisation sont fonction de la morphologie topographique de la tourbière. Ces communautés sont interconnectées et fonctionnent comme une seule unité de sorte qu\'il n\'est pas possible de distinguer des sous-habitats séparés. Leur présence et leurs combinaisons sont, en quelque sorte, caractéristiques des divers types de tourbières. L\'usage simultané d\'un choix approprié de ces sous-unités peut ainsi contribuer à la description de systèmes de tourbières particuliers.'),
(9913, 'NR', 22, '34.742', '', '', 'Lower central Apennine dry grasslands', '', 5, 'Niveau 5', 4260, '/67/490/1269/4260/9913', 'false', 'Grasslands of the lower sectors of the central Apennines (average 800 m) developed on well-exposed surfaces and somewhat marly calcareous soils with Trigonella monspeliaca, T. gladiata, Sideritis syriaca, Ononis variegata.', 'Trigonello monspeliacae-Sideritum syriacae', 'Pas de description disponible'),
(9914, 'NR', 22, '36.343', 'Pelouses à Festuca airoides', '', 'Festuca airoides grasslands', '', 5, 'Niveau 5', 4257, '/67/495/1297/4257/9914', 'true', 'Low, fairly dry swards of the alpine zone of the eastern Pyrenees dominated by Festuca airoides (F. supina), with Carex ericetorum, Avenula versicolor, Silene ciliata, Lychnis alpina, Arenaria grandiflora, Jasione humilis, Hieracium breviscapum (H. pumilum).', 'Festucion supinae: Pumilieto-Festucetum supinae, Luzulo-Festucetum supinae', 'Pelouses rases, relativement sèches de l\'étage alpin des Pyrénées orientales dominées par Festuca airoides (F. supina), avec Carex ericetorum, Avenula versicolor, Silene ciliata, Silene suecica, Arenaria grandiflora, Jasione humilis, Hieracium breviscapum (H. pumilum).'),
(9915, 'NR', 22, '36.344', 'Pelouses à Festuca borderei', '', 'Festuca borderi swards', '', 5, 'Niveau 5', 4257, '/67/495/1297/4257/9915', 'true', 'Sub-nival formations of the Pyrenees with Potentilla frigida, Erigeron uniflorus, Carex rupestris and many cushion plants such as Saxifraga bryoides, S. oppositifolia, Minuartia sedoides, Silene acaulis.', '', 'Formations sub-nivales des Pyrénées avec Potentilla frigida, Erigeron uniflorus, Carex rupestris et de nombreuses plantes en coussin telles que Saxifraga bryoides, S. oppositifolia, Minuartia sedoides, Silene acaulis.'),
(9916, 'NR', 22, '36.345', 'Pelouses à Oreochloa disticha de l\'Allgau', '', 'Allgau Oreochloa disticha swards', '', 5, 'Niveau 5', 4257, '/67/495/1297/4257/9916', 'true', 'Oreochloa disticha-dominated formations, developed in particular in the northern Alps (Allgau).', '', 'Formations dominées par Oreochloa disticha, développées en particulier dans le nord des Alpes (Allgau).'),
(9917, 'NR', 22, '36.346', '', '', 'Bayerischer Wald Juncus trifidus swards', '', 5, 'Niveau 5', 4257, '/67/495/1297/4257/9917', 'false', 'Formations of the Bayerischer Wald and the Riesengebirge, dominated by Juncus trifidus.', '', 'Pas de description disponible'),
(9918, 'NR', 22, '36.347', '', '', 'Cantabrian Oreochloa blanka swards', '', 5, 'Niveau 5', 4257, '/67/495/1297/4257/9918', 'false', 'Oreochloa blanka and Juncus trifidus formations of the alpine level of the Cantabrian Range.', 'Festucion supinae: Junco trifidi-Oreochloetum blankae', 'Pas de description disponible'),
(9919, 'NR', 22, '36.351', '', '', 'Greek mat-grass swards', '', 5, 'Niveau 5', 4261, '/67/495/1297/4261/9919', 'false', 'Nardus stricta- dominated formations mostly occupying humid ground in the high ranges of, in particular, the Peloponese, the central and northern Pindus and locally the southern Pindus.', '', 'Pas de description disponible'),
(9920, 'NR', 22, '36.352', '', '', 'Greek Poa violacea swards', '', 5, 'Niveau 5', 4261, '/67/495/1297/4261/9920', 'false', 'Bellardiochloa violacea-dominated formations usually occupying slightly more basic soils, found, in particular, in the Pindus, on Olympus and in the Vermion.', '', 'Pas de description disponible'),
(9921, 'NR', 22, '36.353', '', '', 'Greek foxtail swards', '', 5, 'Niveau 5', 4261, '/67/495/1297/4261/9921', 'false', 'Alopecurus gerardii-dominated formations mostly of areas of prolonged snow cover on Olympus, Taiyetos, Killini, Parnassus, and in the central and northern Pindus.', '', 'Pas de description disponible'),
(9922, 'NR', 22, '37.312', 'Prairies à Molinie acidiphiles', '', 'Acid purple moorgrass meadows', '', 5, 'Niveau 5', 4311, '/67/496/1280/4311/9922', 'true', 'Less species-rich formations of acid soils with Viola persiciflora, V. palustris, Galium uliginosum, Cirsium dissectum, Crepis paludosa, Luzula multiflora, Juncus subuliflorus (= J. conglomeratus), Ophioglossum vulgatum, Inula britannica, Lotus uliginosus, Dianthus deltoides, Potentilla erecta, P. anglica, Carex pallescens.', 'Junco-Molinion', 'Formations moins riches en espèces des sols acides avec Viola persiciflora, V. palustris, Galium uliginosum, Cirsium dissectum, Crepis paludosa, Luzula multiflora, Juncus conglomeratus, Ophioglossum vulgatum, Inula britannica, Lotus uliginosus, Dianthus deltoides, Potentilla erecta, P. anglica, Carex pallescens.'),
(9923, 'NR', 22, '34.327', '', '', 'Insubrian Mesobromion grasslands', '', 5, 'Niveau 5', 4118, '/67/490/1236/4118/9923', 'false', 'Species-rich hill and montane grasslands of Lago di Garda, Lago di Como and neighbouring areas with Chrysopogon gryllus, Bromus erectus, Festuca rubra s.l., Agrostis capillaris, Brachypodium pinnatum, Carex humilis and many orchids including the endemic Ophrys benacensis and Serapias vomeracea ssp. vomeracea.', 'Carici humilis-Chrysopogetum grylli fumanetosum, Andropogonetum grylli insubricum orchidetosum, i.a.', 'Pas de description disponible'),
(9924, 'NR', 22, '34.743', '', '', 'Apennine brushy dry grasslands', '', 5, 'Niveau 5', 4260, '/67/490/1269/4260/9924', 'false', 'Chamaephyte-rich grasslands of the central-southern and southern Apennines, generally below the level of 34.744, with Satureja montana, Sideritis syriaca, Plantago sempervirens, Globularia punctata, Chamaecytisus spinescens,C. hirsutus, Scabiosa crenata, Helichrysum italicum, Lavandula angustifolia, Teucrium montanum, Asphodeline lutea, Stipa pennata, Bromus erectus, B. caprinus, Avenula pretutiana.', 'Saturejo montanae-Brometum erecti', 'Pas de description disponible'),
(9925, 'NR', 22, '34.744', '', '', 'Apennine upper montane dry grasslands', '', 5, 'Niveau 5', 4260, '/67/490/1269/4260/9925', 'false', 'Grasslands of high montane zones (upper fringe of the beech zone, average 1250 m) of the central and southern Apennines, transitional towards alpine grasslands (36), with Sesleria nitida, S. tenuifolia, Festuca dimorpha, Potentilla cinerea, Carex macrolepis, Chamaecytisus polytrichus.', 'Seslerio nitidae-Brometum erecti', 'Pas de description disponible'),
(9926, 'NR', 22, '36.354', '', '', 'Giona Trisetum-Poa swards', '', 5, 'Niveau 5', 4261, '/67/495/1297/4261/9926', 'false', 'Formations of Giona with Trifolium heldreichianum, T. alpestre, T. parnassi, Plantago lanceolata var. capitata, Poa pratensis, Anthoxanthum odoratum, Phleum pratense, Trisetum flavescens.', '', 'Pas de description disponible'),
(9927, 'NR', 22, '36.361', '', '', 'Oro-Iberian acidophilous stripped grasslands', '', 5, 'Niveau 5', 4265, '/67/495/1297/4265/9927', 'false', 'Thermophile, open, stripped and garland fescue grasslands of siliceous upper slopes and summits of the high Mediterranean mountains of the Iberian peninsula, locally extending into the Euro-Siberian domaine in the subalpine level of the Cantabrian mountains.', 'Festucetalia indigestae', 'Pas de description disponible'),
(9928, 'NR', 22, '34.328', '', '', 'Central Apennine Mesobromion grasslands', '', 5, 'Niveau 5', 4118, '/67/490/1236/4118/9928', 'false', 'Closed mesophile grasslands of the piani of the beech level of the Monti Sibillini and adjacent regions of the central Apennines, with a rich floristic cortège including many higher altitude species and Apennine endemics, dominated by the grasses Bromus erectus, Festuca circummediterranea, Brachypodium pinnatum, Poa pratensis, Briza media, Festuca pratensis, with Filipendula vulgaris, Alchemilla glaucescens, Scabiosa columbaria, Trifolium montanum, Lotus corniculatus, Thymus longicaulis, Rhinanthus personatus, Cerastium fontanum, Galium anisophyllum, and with the central Italian endemic Gentiana columnae on summits and slopes, Asphodelus albus and Fritillaria tenella in plains and gullies.', 'Filipendulo vulgaris-Trifolietum montani i.a.', 'Pas de description disponible'),
(9929, 'NR', 22, '36.362', '', '', 'Oro-Iberian mat-grass swards', '', 5, 'Niveau 5', 4265, '/67/495/1297/4265/9929', 'false', 'Nardus-dominated and related closed, dense grasslands of oro- and cryoro-Mediterranean levels of high Iberian mountains, characteristic of seeps, poorly drained soils and areas with prolonged snow cover.', 'Nardetalia strictae p. (Udo-Nardetalia): Campanulo-Nardion, Plataginion nivalis', 'Pas de description disponible'),
(9930, 'NR', 22, '36.371', 'Pelouses écorchées en gradins, oro-méditerranéennes de Corse', '', 'Corsican oro-Mediterranean stripped grasslands', '', 5, 'Niveau 5', 4270, '/67/495/1297/4270/9930', 'true', 'Stripped grasslands of adrets of the oro-Mediterranean level of Corsican mountains with Plantago subulata ssp. insularis, Sagina pilifera, Armeria multiceps, Paronychia polygonifolia, Bellardiochloa violacea, Festuca indigesta, associated with hedgehog heaths (31.75).', '', 'Pelouses en gradins des adrets de l\'étage oro-méditerranéen des montagnes corses avec Plantago sarda, Sagina pilifera, Armeria multiceps, Paronychia polygonifolia, Bellardiochloa variegeta, Festuca indigesta associées avec des landes-hérissons (31.75).'),
(9931, 'NR', 22, '36.372', 'Nardaies des pozzines corses', '', 'Corsican pozzine mat-grasslands', '', 5, 'Niveau 5', 4270, '/67/495/1297/4270/9931', 'true', 'Nardus stricta grasslands of the pozzines, wet depressions surrounding glacial lakes and basins, of the subalpine level of Corsican mountains.', '', 'Pelouses à Nardus stricta des pozzines, dépressions humides entourant les bassins et lacs glaciaires, de l\'étage subalpin des montagnes corses.'),
(10159, 'NR', 22, '44.126', '', '', 'Iberian sage-leaved willow scrub', '', 5, 'Niveau 5', 4501, '/68/515/1378/4501/10159', 'false', 'Small or medium-sized willow scrub of meso-Mediterranean and, locally, supra-Mediterranean, zones of central Iberia (Castellano-Leonese sectors, Extremadura), characterized by the presence of the Iberian endemic Salix salvifolia and S. x secalliana, together with S. atrocinerea, S. x matritensis, S. neotricha, S. purpurea ssp. lambertiana, S. triandra ssp. discolor; they line, mostly on siliceous sandy soils, small oligotrophic rivers with strong seasonal amplitude, or form behind the taller curtain of the Populo nigrae-Salicetum neotrichae along large water courses of argilous base-rich soils.', 'Salicetum purpureo-salvifoliae (Salicetum lambertiano-salvifoliae)', 'Pas de description disponible'),
(10160, 'NR', 22, '44.127', '', '', 'Pedicellated willow scrub', '', 5, 'Niveau 5', 4501, '/68/515/1378/4501/10160', 'false', 'Willow scrub of stream courses of extreme southern Europe, characterized by the presence of the southwestern Mediterranean and North African Salix pedicellata.', '', 'Pas de description disponible'),
(10161, 'NR', 22, '44.811', 'Galeries de Laurier-rose', '', 'Oleander galleries', '', 5, 'Niveau 5', 4506, '/68/515/1380/4506/10161', 'true', 'Nerium oleander cordons and screens, often with Tamarix spp., Vitex agnus-castus, Dittrichia viscosa, Saccharum ravennae, Arundo donax, Rubus ulmifolius, most typical of temporary water courses, but also lining small and sometimes large rivers, marking springs and areas of high water table in southern and eastern Iberia, very locally in eastern Provence, Liguria and Corsica (Saint-Florent), in southern Italy, Sardinia and Sicily, in southern and western Greece, the Aegean and Ionian archipelagoes, and Crete. They are particularly abundant in the south and east of Iberia, in Sicily and in the Aegean region.', 'Nerion oleandri p.', 'Cordons, rideaux et galeries de Nerium oleander, souvent avec Tamarix spp., Vitex agnus-castus, Dittrichia viscosa, Erianthus ravennae, Arundo donax, Rubus ulmifolius, plutôt typiques des cours d\'eaux temporaires, mais aussi longeant les petites et quelquefois grandes rivières, et marquant les sources et les zones à nappe phréatique élevée, très localement en provence orientale et en Corse (Saint Florent),...'),
(10162, 'NR', 22, '44.812', 'Fourrés de Gattiliers', '', 'Chaste tree thickets', '', 5, 'Niveau 5', 4506, '/68/515/1380/4506/10162', 'true', 'Vitex agnus-castus formations of temporary water courses and other humid sites within, mostly, the thermo-Mediterranean zone. They occur, though uncommonly, in the Mediterranean south and east of Spain and in the Balearics; they are local and rare in eastern Provence, the Tyrrhenian coast of Italy, Puglia, the gulf of Taranto, Corsica, Sardinia and Sicily. They are frequent in Greece, particularly along the Ionian coasts, where they can constitute dense thickets, uncommon again in the Aegean archipelagoes and Crete.', 'Nerion oleandri p.: Vinco majoris-Viticetum agni-casti i.a.', 'Peuplements de Vitex agnus-castus de cours d\'eaux temporaires et d\'autres sites humides, plutôt à l\'intérieur de l\'étage thermo-méditerranéen. Ils sont présents, quoique non généralement, dans le sud méditérranéen ; ils sont localisés et rares en Provence orientale..., en Corse...'),
(10163, 'NR', 22, '45.344', '', '', 'South-western Quercus rotundifolia woodland', '', 5, 'Niveau 5', 4499, '/68/517/1401/4499/10163', 'false', 'Forests and woodland of Q. rotundifolia developed in the thermo-Mediterranean zone of Andalusia and neighbouring areas. Well-preserved examples are extremely rare.', '', 'Pas de description disponible'),
(10164, 'NR', 22, '45.345', '', '', 'Valencian Quercus rotundifolia woodland', '', 5, 'Niveau 5', 4499, '/68/517/1401/4499/10164', 'false', 'Thermo-Mediterranean, basophilous forests and woodland of Q. rotundifolia characteristic of the southeastern maritime façade of the Iberian peninsula in Valencia and Levante, rich in shrubs and lianas, with Rubia peregrina ssp. longifolia, Osyris quadripartita, Chamaerops humilis, Phillyrea angustifolia, Clematis flammula. Well-preserved examples survived until recently in, among others, the Sierra del Ave y Cortes de Pallas, in the Pobla Tornesa, in Millares, in Montduver. This community now appears extinct in its full forest form.', 'Rubio longifoliae-Quercetum rotundifoliae', 'Pas de description disponible'),
(10165, 'NR', 22, '45.346', '', '', 'Balearic Quercus rotundifolia woodland', '', 5, 'Niveau 5', 4499, '/68/517/1401/4499/10165', 'false', 'Forests or woodland of Q. rotundifolia occupying deep soils in the dry thermo-Mediterranean areas of the Balearic islands. Reasonably preserved examples are extremely rare.', 'Clematidi cirrhosae-Quercetum rotundifoliae', 'Pas de description disponible'),
(10166, 'NR', 22, '42.651', '', '', 'Sila and Aspromonte laricio forests', '', 5, 'Niveau 5', 4507, '/68/491/1369/4507/10166', 'false', 'Pinus laricio forests of the Sila Greca, the Sila Grande, the Sila Piccola and the Aspramonte, where they replace beech forests in drier areas within the montane zone, forming at times, particularly in the Sila Grande, imposing expanses.', '', 'Pas de description disponible'),
(10167, 'NR', 22, '42.652', '', '', 'Etna laricio forests', '', 5, 'Niveau 5', 4507, '/68/491/1369/4507/10167', 'false', 'Pinus laricio forests of the north flank of Mount Etna.', '', 'Pas de description disponible'),
(10168, 'NR', 22, '42.711', '', '', 'Italian white-barked pine forests', '', 5, 'Niveau 5', 4510, '/68/491/1382/4510/10168', 'false', 'Rare white-barked pine formations of high southern Italian mountains, limited to the Abruzzian Appenines (Montagna della Maiella), the Campanian Apennines (monti Picentini) and the Lucano-Calabrian Apennines (Pollino, monti Alpi di Latronico, monte la Spina, monti di Orsomarso, monte Montea, serra delle Ciavole).', '', 'Pas de description disponible'),
(10169, 'NR', 22, '42.712', '', '', 'Pindus white-barked pine forests', '', 5, 'Niveau 5', 4510, '/68/491/1382/4510/10169', 'false', 'White-barked pine formations of high elevations of the Pindus, mostly on ophiolites, at altitudes above 1600 metres.', '', 'Pas de description disponible'),
(10170, 'NR', 22, '42.713', '', '', 'Olympus white-barked pine forests', '', 5, 'Niveau 5', 4510, '/68/491/1382/4510/10170', 'false', 'White-barked pine formations of Mount Olympus, mostly on jurassic and triassic limestones at altitudes above 1350 metres, with an undergrowth including Juniperus nana, Daphne laureola, D. mezereum, D. oleoides, Genista radiata, Buxus sempervirens, Cotoneaster integerrimus.', '', 'Pas de description disponible'),
(10171, 'NR', 22, '44.141', 'Galeries méditerranéennes de Saules blancs', '', 'Mediterranean white willow galleries', '', 5, 'Niveau 5', 4505, '/68/515/1378/4505/10171', 'true', 'Riparian forests of Iberia and the Mediterranean basin dominated by Salix alba or its relatives.', '', 'Forêts riveraines ... du bassin méditerranéen dominées par Salix alba (ou d\'autres de la même famille).'),
(10172, 'NR', 22, '44.142', 'Bois riverains de Saules à feuilles d\'Olivier et de Saules cendrés', '', 'Olive-leaved and ashy willow riparian woods', '', 5, 'Niveau 5', 4505, '/68/515/1378/4505/10172', 'true', 'Woods of arborescent willows, physiognomically dominated by Salix atrocinerea or S. cinerea, forming, in thermo-, meso- or supra-Mediterranean areas, on the banks of slow water courses; similar woods occupy soggy depressions (44.92).', 'Rubo corylifolii-Salicetum atrocinereae, Viti viniferae-Salicetum atrocinereae', 'Bois de Saules arborescents, physionomiquement dominés par Salix atrocinera ou S. cinerea, se formant, dans les étages thermo-, méso- ou supra-méditerranéens sur les rives des cours d\'eaux lents ; des bois semblables occupent des dépressions marécageuses (44.92).'),
(10173, 'NR', 22, '44.813', 'Fourrés de Tamaris', '', 'Tamarisk thickets', '', 5, 'Niveau 5', 4506, '/68/515/1380/4506/10173', 'true', 'Formations, mostly of Mediterranean and thermo-Atlantic coasts and lowlands, dominated by Tamarix spp..', '', 'Formations dominées par Tamarix spp., plutôt des côtes et des plaines méditerranéennes et thermo-atlantiques.'),
(10174, 'NR', 22, '45.632', '', '', 'Laurisilvas of Tenerife', '', 5, 'Niveau 5', 4565, '/68/517/1394/4565/10174', 'false', 'Laurel forests of Tenerife, mostly restricted to the Anaga range and Los Silos, with a few smaller patches in Guimar ravines and at a few north slope sites in the La Esperanza - Agua Garcia area and the Barranco de San Antonio - Icod area. There are good representations of til (Ocotea foetens) forests (Anaga), as well as of drier Picconia excelsa-Apollonias barbujana forests (Los Silos).', '', 'Pas de description disponible'),
(10175, 'NR', 22, '45.633', '', '', 'Laurisilvas of La Palma', '', 5, 'Niveau 5', 4565, '/68/517/1394/4565/10175', 'false', 'Laurel forests of La Palma essentially restricted to a few large, deep ravines of the northern slope, particularly in the Las Sauces area, including both Lauro-Perseetum vinyatigo-laurel and Athyrio-Ocoteetum til stands.', '', 'Pas de description disponible'),
(10176, 'NR', 22, '45.634', '', '', 'Laurisilvas of Hierro', '', 5, 'Niveau 5', 4565, '/68/517/1394/4565/10176', 'false', 'Laurel forests of Hierro, very small and limited to cliff sides in the Ensenada El Golfo area of the north coast.', '', 'Pas de description disponible'),
(9565, 'NR', 22, '31.8A1', 'Fourrés cyrno-sardes subméditerranéens caducifoliés', '', 'Cyrno-Sardian sub-Mediterranean deciduous thickets', '', 5, 'Niveau 5', 4040, '/67/487/1223/4040/9565', 'true', 'Formations of Corsica and Sardinia with Rubus ulmifolius, Rosa agrestis, R. canina, R. serafini, Prunus spinosa, Crataegus monogyna, Clematis vitalba, Pyrus amygdaliformis, Rhamnus persicifolius.', '', 'Formations de Corse et de Sardaigne avec Rubus ulmifolius, Rosa agrestis, R. canina, R. serafini, Prunus spinosa, Crataegus monogyna, Clematis vitalba, Pyrus amygdaliformis, Rhamnus persicifolius.'),
(9566, 'NR', 22, '31.8A2', '', '', 'Italo-Sicilian sub-Mediterranean deciduous thickets', '', 5, 'Niveau 5', 4040, '/67/487/1223/4040/9566', 'false', 'Formations of the Italian peninsula and Sicily with Rubus ulmifolius, Rosa sempervirens, R. arvensis, Pyrus amygdaliformis, P. communis, Malus sylvestris, Amelanchier ovalis, Cotoneaster integerrimus, C. nebrodensis, Pyracantha coccinea, Crataegus monogyna, C. laciniata, Prunus spinosa, P. cocomilia, P. mahaleb, Coriaria myrtifolia, Cotinus coggygria, Pistacia terebinthus, Euonymus europaeus, Paliurus spina-christi, Rhamnus catharticus, Lonicera xylosteum, L. etrusca.', '', 'Pas de description disponible'),
(9567, 'NR', 22, '31.8B1', '', '', 'Central European sub-Mediterranean deciduous thickets', '', 5, 'Niveau 5', 4041, '/67/487/1223/4041/9567', 'false', 'Prunus fruticosa formations of dry, continental Central European areas, notably east of the Harz mountains.', 'Prunetum fruticosae', 'Pas de description disponible'),
(9568, 'NR', 22, '31.8B2', '', '', 'Illyrian sub-Mediterranean deciduous thickets', '', 5, 'Niveau 5', 4041, '/67/487/1223/4041/9568', 'false', 'Prunus fruticosa formations of northeastern Italy', '', 'Pas de description disponible'),
(9569, 'NR', 22, '31.8B3', '', '', 'Greek sub-Mediterranean deciduous thickets', '', 5, 'Niveau 5', 4041, '/67/487/1223/4041/9569', 'false', 'Varied, often species-rich formations of temperate and sub-Mediterranean areas of continental Greece and the northern Aegean with Prunus spinosa, P. fruticosa, P. mahaleb, P. cerasifera, P. cocomilia, Pyrus amygdaliformis, Pyracantha coccinea, Crataegus monogyna, C. laciniata, Sorbus domestica, Rosa sempervirens , R. canina agg., R. rubiginosa agg., Rubus ulmifolius, Euonymus spp., Cornus mas, Cornus sanguinea, Ligustrum vulgare, Rhamnus saxatilis, Berberis vulgaris, Clematis vitalba, Paliurus spina-christi, Cotinus coggygria, Rhus coriaria, Coriaria myrtifolia, Syringa vulgaris, Cercis siliquastrum, Coronilla emerus, Colutea arborescens, Juniperus oxycedrus, J. communis, Buxus sempervirens, Corylus spp., Acer spp., Fraxinus ornus, Ulmus minor, Carpinus spp., Ostrya carpinifolia, Quercus spp..', '', 'Pas de description disponible'),
(9570, 'NR', 22, '31.8B4', '', '', 'Aegean sub-Mediterranean deciduous thickets', '', 5, 'Niveau 5', 4041, '/67/487/1223/4041/9570', 'false', 'Southern and eastern Aegean formations with Crataegus monogyna, C. azarolus, Prunus cocomilia, P. webbii, P. prostrata, P. discolor, Pyrus amygdaliformis, Rubus ulmifolius, Rosa sempervirens, Berberis cretica, Rhododendron flavum, Acer sempervirens, Quercus brachyphylla, Q. infectoria.', '', 'Pas de description disponible'),
(9571, 'NR', 22, '32.212', 'Landes-garrigues thermo-méditerranéennes', '', 'Thermo-Mediterranean heath-garrigues', '', 5, 'Niveau 5', 4052, '/67/488/1225/4052/9571', 'true', 'Formations dominated by the thermophile, often calciphile, heathers Erica multiflora and E. manipuliflora, best developed in the thermo-Mediterranean zones of southern and eastern Spain, the Balearics, Sardinia, Sicily, Pantelleria, southern Italy, southern Greece and the Aegean. Western meso-Mediterranean formations are listed under 32.4B.', '', 'Formations dominées par des landes thermophiles, souvent calciphiles à Erica multiflora... Les formations occidentales méso-méditerranéennes sont cataloguées sous 32.4B.'),
(9572, 'NR', 22, '32.213', '', '', 'Thorny burnet brush', '', 5, 'Niveau 5', 4052, '/67/488/1225/4052/9572', 'false', 'Non-cushion formations dominated by Sarcopoterium spinosum of the eastern Mediterranean.', '', 'Pas de description disponible'),
(9573, 'NR', 22, '32.214', 'Fruticée à Lentisques', '', 'Lentisc brush', '', 5, 'Niveau 5', 4052, '/67/488/1225/4052/9573', 'true', 'Pistacia lentiscus -dominated or -rich formations, widespread and abundant in thermo-Mediterranean and coastal meso-Mediterranean zones of the entire Mediterranean basin; locally, similar formations may appear in warm inland meso-Mediterranean areas. Often low and sometimes very open, the lentisc brush can in favourable situations reach a height of several metres, grading into arborescent matorral (32.123).', '', 'Formations dominées ou riches en Pistacia lentiscus, répandues et abondantes dans l\'étage thermo-méditerranéen et zones côtières méso-méditerranéennes de tout le bassin méditerranéen ; localement, des formations similaires peuvent apparaître dans les régions méso-méditerranéennes chaudes de l\'intérieur des terres. Souvent basse et parfois très ouverte, la fruticée à Lentisque peut, en situations favorables, atteindre une hauteur de plusieurs mètres, s\'intégrant ainsi au matorral arborescent (32.123).'),
(9574, 'NR', 22, '32.215', 'Fruticée à Calicotome', '', 'Calicotome brush', '', 5, 'Niveau 5', 4052, '/67/488/1225/4052/9574', 'true', 'Thermo-Mediterranean formations physiognomically dominated by the brilliantly flowering Calicotome villosa or C. spinosa.', '', 'Formations thermo-méditerranéennes physionomiquement dominées par la floraison éclatante de Calicotome villosa ou de C. spinosa.'),
(9575, 'NR', 22, '32.216', 'Fourrés à Lauriers', '', 'Laurel thickets', '', 5, 'Niveau 5', 4052, '/67/488/1225/4052/9575', 'true', 'Laurus nobilis thickets of humid or fresh stations, lower facies of 32.18.', '', 'Fourrés à Laurus nobilis des stations fraîches et humides, faciès plus bas que 32.18.'),
(9576, 'NR', 22, '32.217', 'Garrigues côtières à Helichrysum', '', 'Coastal Helichrysum garrigues', '', 5, 'Niveau 5', 4052, '/67/488/1225/4052/9576', 'true', 'Low formations of Helichrysum (H. italicum ssp. microphyllum, H. italicum ssp. italicum) with spurges (Euphorbia pithyusa, i.a.), Pistacia lentiscus, Camphorosma monspeliaca, Artemisia densiflora or Thymelaea passerina, T. hirsuta, T. tartonraira of the immediate vicinity of sea cliffs, forming the transition between cliff vegetations or clifftop phryganas and thermo-Mediterranean brushes; they are particularly characteristic of the large Mediterranean islands.', '', 'Formations basses à Helichrysum (H. italicum subsp. microphyllum, H. italicum subsp. italicum) avec des Euphorbes (Euphorbia pithyusa, i.a.), Pistacia lentiscus, Camphorosma monspeliaca, Artemisia densiflora, Thymelea passerina, T. hirsuta, T. tartonraira à proximité de falaises de bord de mer, formant la transition entre les végétations de falaises ou les phryganes de haut de falaise et les fruticées thermo-méditerranéennes ; elles sont particulièrement caractéristiques des grandes îles méditerranéennes.'),
(9577, 'NR', 22, '32.218', 'Fourrés à Myrtes', '', 'Myrtle thickets', '', 5, 'Niveau 5', 4052, '/67/488/1225/4052/9577', 'true', 'Myrtus communis -dominated brush. Particularly noteworthy formations occur in the Balearics (Clematidi-Myrtetum), in southern Iberia, in Sardinia, in the Aegean. Myrtle thickets can in favourable situations reach a height of a few metres, grading into arborescent matorral (32.124).', '', 'Buissons dominés par Myrtus communis. Les fourrés de Myrtes peuvent en situations favorables, atteindre une hauteur de quelques mètres, s\'intégrant ainsi au matorral arborescent (32.124).'),
(9578, 'NR', 22, '32.219', 'Buissons thermo-méditerranéens à Chênes kermès', '', 'Thermo-Mediterranean kermes oak brushes', '', 5, 'Niveau 5', 4052, '/67/488/1225/4052/9578', 'true', 'Quercus coccifera thickets rich in thermo-Mediterranean elements, in particular, Pistacia lentiscus, Chamaerops humilis, Rhamnus lycioides ssp. lycioides, R. l. ssp. oleoides, Asparagus albus, A. acutifolius, Bupleurum gibraltariensis.', '', 'Fourrés de Quercus coccifera riches en éléments thermo-méditerranéens, en particulier, Pistacia lentiscus, Chamaerops humilis, Asparagus albus, A. acutifolius.'),
(9579, 'NR', 22, '32.21A', 'Fourrés à Phillyrea', '', 'Phillyrea thickets', '', 5, 'Niveau 5', 4052, '/67/488/1225/4052/9579', 'true', 'Phillyrea angustifolia or P. media-dominated formations; they constitute facies, in particular of the southern Iberian Asparago-Rhamnion and of the Aegean Ceratonio-Rhamnion, notably on Samothrace and Rhodes; they constitute also remarkable coastal formations on Minorca, based on the endemic P. media var. rodriguezii, and in Valencia.', '', 'Formations dominées par Phillyrea angustifolia ou Phillyrea media. Elles constituent un faciès, en particulier de l’Asparago-Rhamnion sud ibérique et du Ceratonio-Rhamnion égéen, notamment de Samothrace et Rhodes ; elles représentent également des formations littorales remarquables de Minorque, fondées sur le taxon endémique Phillyrea media var. rodriguezii, et à Valence.'),
(9580, 'NR', 22, '32.251', '', '', 'Iberian jujube brush', '', 5, 'Niveau 5', 4043, '/67/488/1225/4043/9580', 'false', 'Communities dominated by hummocks of the lotus tree Ziziphus lotus, usually with Lycium intricatum, Withania frutescens, Asparagus albus, A. stipularis, Rhamnus lycioides, of the arid Iberian Southeast. Very tall stands can be coded as 32.17.', 'Ziziphetum loti', 'Pas de description disponible'),
(9581, 'NR', 22, '32.252', '', '', 'Sicilian jujube brush', '', 5, 'Niveau 5', 4043, '/67/488/1225/4043/9581', 'false', 'Ziziphus lotus formations of western Sicily.', '', 'Pas de description disponible'),
(9582, 'NR', 22, '32.253', '', '', 'Maytenus brushes', '', 5, 'Niveau 5', 4043, '/67/488/1225/4043/9582', 'false', 'More or less dense, spiny brushes limited to very restricted areas of the Almerian and Carthagenian coasts of the arid Iberian Southeast, dominated by the shrub of African affinities Maytenus senegalensis var. europaeus with Rhamnus oleoides ssp. angustifolia and ssp. velutinus, Asparagus albus, A. stipularis, A. horridus, Chamaerops humilis and occasionally Buxus balearica.', 'Rhamno angustifoliae-Maytenetum europaei', 'Pas de description disponible'),
(10196, 'NR', 22, '44.921', 'Saussaies marécageuses à Saule cendré', '', 'Grey willow scrub', '', 5, 'Niveau 5', 4524, '/68/515/1388/4524/10196', 'true', 'Mesotrophic or eutrophic Salix cinerea or S. aurita and Alnus glutinosa scrubs of mires, fens, and water fringes.', '', 'Formations arbustives de Salix cinerea ou S. aurita et Alnus glutinosa, mésotrophes ou eutrophes, des bas-marais et zones d\'atterrissements des plans d\'eau.'),
(10197, 'NR', 22, '44.922', 'Saussaies à sphaigne', '', 'Sphagnum willow scrub', '', 5, 'Niveau 5', 4524, '/68/515/1388/4524/10197', 'true', 'Oligotrophic Salix aurita or S. cinerea and Betula pubescens or B. carpatica scrubs, rich in sphagnum, of bog edges and acid fens.', '', 'Formations arbustives oligotrophes de Salix aurita ou B. carpatica, riches en sphaignes, de bord de bas-marais et de marécages acides, des marges de tourbières bombées.'),
(10198, 'NR', 22, '44.923', 'Saussaies marécageuses à Saule laurier', '', 'Bay willow scrub', '', 5, 'Niveau 5', 4524, '/68/515/1388/4524/10198', 'true', 'Tall Salix pentandra formations.', '', 'Formations avec de grands Salix pentandra.'),
(10199, 'NR', 22, '44.924', 'Saussaies naines marécageuses', '', 'Dwarf mire willow scrub', '', 5, 'Niveau 5', 4524, '/68/515/1388/4524/10199', 'true', 'Dwarf Salix repens, S. rosmarinifolia and Betula humilis scrubs of bogs and fens.', '', 'Formations arbustives naines de Salix repens, S. rosmarinifolia et Betula humilis des marais et marécages, des tourbières bombées.'),
(10200, 'NR', 22, '51.112', 'Bases des buttes et pelouses de Sphaignes vertes', '', 'Green sphagnum hummock bases and lawns', '', 5, 'Niveau 5', 4579, '/71/518/1404/4579/10200', 'true', 'Green or yellow Sphagnum cuspidatum, S. apiculatum, S. pulchrum, S. papillosum i. a. communities forming in the transition zone between hollows and hummocks; Drosera rotundifolia, Eriophorum vaginatum, Andromeda polifolia, Vaccinium oxycoccos are often common.', '', 'Communautés de sphaignes vertes ou jaunes dont : Sphagnum cuspidatum, S. apiculatum, S. pulchrum, S. papillosum, etc. développées dans la zone de transition entre les cuvettes et les buttes ; Drosera rotundifolia, Eriophorum vaginatum, Andromeda polifolia, Vaccinium oxycoccos y sont souvent communes.'),
(10201, 'NR', 22, '51.113', 'Buttes à buissons nains', '', 'Dwarf shrub hummocks', '', 5, 'Niveau 5', 4579, '/71/518/1404/4579/10201', 'true', 'Ericaceous dwarf shrub communities forming on the top of drying hummocks, often with the moss Polytrichum strictum.', '', 'Communautés d\'Ericacées en buissons nains se formant sur le sommet des buttes en voie de dessication, souvent avec la mousse Polytrichum strictum.'),
(10202, 'NR', 22, '51.114', 'Communautés de tourbières bombées à Trichophorum cespitosum', '', 'Bog deergrass communities', '', 5, 'Niveau 5', 4579, '/71/518/1404/4579/10202', 'true', 'Scirpus cespitosus-dominated bogs or parts of bogs, mostly characteristic of Hercynian and peri-Alpine regions.', 'Eriophoro-Trichophoretum cespitosi', 'Tourbières ou parties de tourbières dominées par Trichophorum cespitosum, caractéristiques principalement des régions hercyniennes et péri-alpiennes.'),
(10203, 'NR', 22, '51.115', 'Tourbières bombées à Erica et Sphagnum', '', 'Bog Erica-Sphagnum communities', '', 5, 'Niveau 5', 4579, '/71/518/1404/4579/10203', 'true', 'Bogs or parts of bogs dominated by Erica tetralix and Sphagnum papillosum, characteristic of raised bog systems of Atlantic regions, particularly the British Isles.', 'Erico-Sphagnetum p.', 'Tourbières ou partie de tourbières dominées par Erica tetralix et Sphagnum papillosum, caractéristiques des systèmes de tourbières hautes des régions atlantiques.'),
(10204, 'NR', 22, '42.831', '', '', 'Iberian stone pine forests', '', 5, 'Niveau 5', 4525, '/68/491/1386/4525/10204', 'false', 'Pinus pinea forests of the Iberian peninsula, where they reach their greatest development.', '', 'Pas de description disponible'),
(10205, 'NR', 22, '42.832', '', '', 'Balearic stone pine woods', '', 5, 'Niveau 5', 4525, '/68/491/1386/4525/10205', 'false', 'Pinus pinea formations of the Balearic Islands, native only on Ibiza and Formentera.', '', 'Pas de description disponible'),
(10206, 'NR', 22, '44.A11', 'Forêts de Bouleaux à Sphaignes et Linaigrettes', '', 'Cottongrass sphagnum birch woods', '', 5, 'Niveau 5', 4529, '/68/515/1390/4529/10206', 'true', 'Sphagnum-rich Betula pubescens or B. carpatica woods in which bog species, in particular Eriophorum vaginatum and Vaccinium oxycoccos, are prominent.', 'Sphagno-Betuletum eriophoretosum vaginati, Erico-Sphagnetum betuletosum).', 'Bois de Betula pubescens ou de B. carpatica riches en Sphaignes dans lesquels prédominent les espèces des tourbières bombées, en particulier Eriophorum vaginatum et Vaccinium oxycoccos.'),
(10207, 'NR', 22, '44.A12', 'Bois de Bouleaux à Sphaignes et à Laîches', '', 'Sedge sphagnum birch woods', '', 5, 'Niveau 5', 4529, '/68/515/1390/4529/10207', 'true', 'Sphagnum-rich Betula pubescens or B. carpatica woods in which Molinia caerulea is accompanied by a cortège of acid fen species, in particular, Carex rostrata, C. nigra, C. echinata, Juncus acutiflorus, Agrostis canina, Narthecium ossifragum, Calamagrostis canescens.', 'Sphagno-Betuletum agrostido-caricetosum nigrae', 'Bois de Betula pubescensou de B. carpatica riches en Sphaignes dans lesquels Molinia caerulea est accompagnée d\'un cortège floristique d\'espèces de bas-marais acides, et en particulier Carex rostrata, C. nigra, C. echinata, Juncus acutiflorus, Agrostis canina, Narthecium ossifragum, Calamagrostis canescens.'),
(10208, 'NR', 22, '42.833', 'Bois provençaux de Pins parasols', '', 'Provence stone pine woods', '', 5, 'Niveau 5', 4525, '/68/491/1386/4525/10208', 'true', 'Pinus pinea formations of Provence, possibly spontaneous on coastal sands and in the Maures area.', '', 'Formations de Pinus pinea de Provence, pouvant être spontanées sur les sables côtiers et dans la région de Maures.'),
(10209, 'NR', 22, '42.834', 'Bois de Pins parasols corses', '', 'Corsican stone pine woods', '', 5, 'Niveau 5', 4525, '/68/491/1386/4525/10209', 'true', 'Pinus pinea formations of the littoral of Corsica, some of which may be of natural origin, in particular on old dunes of the east coast.', '', 'Formations de Pinus pinea du littoral de la Corse, dont certaines peuvent être d\'origine naturelle, en particulier sur des vieilles dunes de la côte est.'),
(10210, 'NR', 22, '42.835', '', '', 'Sardinian stone pine forests', '', 5, 'Niveau 5', 4525, '/68/491/1386/4525/10210', 'false', 'Pinus pinea formations of Sardinia.', '', 'Pas de description disponible'),
(10211, 'NR', 22, '42.836', '', '', 'Sicilian stone pine forests', '', 5, 'Niveau 5', 4525, '/68/491/1386/4525/10211', 'false', 'Pinus pinea formations of the Monti Peloritani, northwestern Sicily, of probable native origin.', '', 'Pas de description disponible'),
(10212, 'NR', 22, '42.837', '', '', 'Peninsular Italian stone pine forests', '', 5, 'Niveau 5', 4525, '/68/491/1386/4525/10212', 'false', 'Large, ancient, Pinus pinea plantations of the Tyrennian, and locally, Adriatic coasts of the Italian peninsula, in Liguria, Toscany, Latium, Campania, Emilia-Romana (Ravenna) and Friuli-Venetia Giulia (Grado).', '', 'Pas de description disponible'),
(10213, 'NR', 22, '42.838', '', '', 'Greek stone pine forests', '', 5, 'Niveau 5', 4525, '/68/491/1386/4525/10213', 'false', 'Pinus pinea woods of the littoral and coastal hills of the Peloponnese, Chalcidice, Crete and Aegean islands, rather local but probably in part, at least, spontaneous; a splendid example exists, in particular, on Skiathos.', '', 'Pas de description disponible'),
(10214, 'NR', 22, '44.331', 'Bois de Frênes et d\'Aulnes des rivières médio-européennes à eaux lentes à cerisiers à grappes', '', 'Central European slow river ash-alder woods', '', 5, 'Niveau 5', 4527, '/68/515/1389/4527/10214', 'true', 'Alnus glutinosa-Fraxinus excelsior forests with Prunus padus, often extensive, and capable of occupying floodplains well beyond the riparian gallery, progressively richer in Quercus robur and Carpinion species towards the exterior.', 'Pruno-Fraxinetum', 'Forêts d\'Alnus glutinosa et de Fraxinus excelsior avec Prunus padus, souvent étendues et capables d\'occuper des plaines inondables bien au-delà des galeries riveraines, s\'enrichissant progressivement vers l\'extérieur en Quercus robur et en espèces du Carpinion.'),
(10215, 'NR', 22, '44.332', 'Bois de Frênes et d\'Aulnes à hautes herbes', '', 'West European tall herb ash-alder woods', '', 5, 'Niveau 5', 4527, '/68/515/1389/4527/10215', 'true', 'Alnus glutinosa or Fraxinus excelsior-Alnus glutinosa-Ulmus riparian woods on eutrophic, moist soils of alluvial terraces, levees and flood-plains of the lower courses of rivers of Atlantic and sub-Atlantic regions of the British Isles and the western seaboard of the European mainland, with Salix cinerea and Urtica dioica, often rich in tall herbs, in particular Cirsium oleraceum, Eupatorium cannabinum, Epilobium hirsutum, Dipsacus pilosus, Symphytum officinale, Aconitum napellus, and in creepers, Humulus lupulus, Solanum dulcamara, Calystegia sepium; Ribes rubrum, Iris pseudacorus, Equisetum telmateia, E. fluviatile are locally characteristic; tall sedges, in particular Carex acutiformis and C. paniculata dominate some of the wettest communities. Typical sub-communities of British Alnus glutinosa-Urtica dioica woodland are included, as are drier Sambucus nigra sub-communities in situations where they are adjacent. Formations of this unit are now rare, having for the most part been replaced by poplar plantations.', 'Macrophorbio-Alnetum (Ulmo-Fraxinetum = Aegopodio-Fraxinetum, Alno-Macrophorbietum)', 'Bois riverains d\'Alnus glutinosa ou de Fraxinus excelsior, Alnus glutinosa-Ulmus sur des sols eutrophes humides ou des terrasses alluviales, levées de terres et zones inondables des cours inférieurs des rivières des régions atlantiques ou sub-atlantiques des régions côtières occidentales du continent européen, avec Salix cinerea et Urtica dioica, souvent riches en hautes herbes, en particulier Cirsium oleraceum, Eupatorium cannabinum, Epilobium hirsutum, Dipsacus pilosus, Symphytum officinale, Aconitum napellus et, parmi les plantes grimpantes, Humulus lupulus, Solanum dulcamara, Calystegia sepium. Ribes rubrum, Iris pseudacorus, Equisetum telmateia, E. fluviatile sont localement caractéristiques ; les laîches hautes, en particulier Carex acutiformis et C. paniculata dominent quelques-unes des communautés les plus humides. Les formations de cette unité sont maintenant rares, ayant été remplacées pour la plupart par des plantations de Peupliers.'),
(10216, 'NR', 22, '44.A13', 'Bois de Bouleaux à Sphaignes méso-acidiphiles', '', 'Meso-acidophilous sphagnum birch woods', '', 5, 'Niveau 5', 4529, '/68/515/1390/4529/10216', 'true', 'Sphagnum-rich Betula pubescens or B. carpatica woods in which the presence of species characteristic of sub-humid mineral soils indicate a transition towards acidophilous birch and oak woods; Salix cinerea, Alnus glutinosa, Lysimachia vulgaris, Luzula sylvatica, Oxalis acetosella, Deschampsia flexuosa may be prominent, next to Molinia caerulea.', '', 'Bois de Betula pubescens ou de B. carpatica riches en Sphaignes dans lesquels on note la présence d\'espèces caractéristiques de sols minéraux sub-humides indicatrices d\'une transition entre les bois acidiphiles de Bouleaux et les bois de Chênes ; Salix cinerea, Alnus glutinosa, Lysimachia vulgaris, Luzula sylvatica, Oxalis acetosella, Deschampsia flexuosapeuvent être dominants, aux côtés de Molinia caerulea.'),
(10177, 'NR', 22, '45.635', '', '', 'Laurisilvas of Gran Canaria', '', 5, 'Niveau 5', 4565, '/68/517/1394/4565/10177', 'false', 'Laurel forests of Gran Canaria, extinct. Very small, but fully expressed, fragments existed until very recently, notably at Los Tiles, but now appear to have been totally degraded.', '', 'Pas de description disponible'),
(10178, 'NR', 22, '42.811', 'Forêts de Pins et de Chênes verts des Charentes', '', 'Charente pine-holm oak forests', '', 5, 'Niveau 5', 4514, '/68/491/1386/4514/10178', 'true', 'Pinus pinaster ssp. atlantica forests with a subcanopy of Quercus ilex, Arbutus unedo and sometimes Quercus pubescens or Q. robur and an undergrowth of Rubia peregrina, Cistus salvifolius, Daphne gnidium and, in the more acid stands, Ulex europaeus, Cytisus scoparius, Erica scoparia or, in more calcareous ones, Hedera helix, Ruscus aculeatus, developed on mostly calcareous inner dunes of the low-rainfall coasts of Vendée, Charente-maritime and northern Gironde, including the islands of Noirmoutier, Yeu, Ré and Oléron.', 'Pino pinastri-Quercetum ilicis', 'Forêts de Pinus pinaster ssp. atlantica avec une sous-strate de Quercus ilex, Arbutus unedo et quelquefois Quercus pubescens ou Q. robur et un sous-bois de Rubia peregrina, Cistus salviifolius, Daphne gnidium et, dans les stations les plus acides, Ulex europeus, Cytisus scoparius, Erica scoparia ou, dans les plus calcaires Hedera helix, Ruscus aculeatus. Ces forêts sont développées surtout dans les dunes internes calcaires de la côte vendéenne peu pluvieuse, de la Charente-Maritime et du nord de la Gironde, en incluant les îles de Noirmoutier, Yeu, Ré et Oléron.'),
(10179, 'NR', 22, '42.812', 'Forêts de Pins et de Chênes lièges aquitaniennes', '', 'Aquitanian pine-cork oak forests', '', 5, 'Niveau 5', 4514, '/68/491/1386/4514/10179', 'true', 'Pinus pinaster ssp. atlantica forests with a subcanopy of Quercus suber, Arbutus unedo and sometimes Quercus robur and an undergrowth of Erica cinerea, Pteridium aquilinum, Frangula alnus, Rubia peregrina and, in the more open stands, Cistus salvifolius, Cytisus scoparius, Erica scoparia, Calluna vulgaris or, in more closed ones, Hedera helix, Ruscus aculeatus, Ilex aquifolium, developed on acidocline inner dunes of the warmer, more humid coasts of the Marensin, between the Eyre and the Adour river mouths.', 'Pino pinastri-Quercetum suberis', 'Forêts de Pinus pinaster subsp. atlantica avec un sous-bois de Quercus suber, Arbutus unedo et quelquefois Quercus robur et une sous-strate d\'Erica cinerea, Pteridium aquilinum, Frangula alnus, Rubia peregrina et, dans les stations les plus ouvertes, Cistus salviifolius, Cytisus scoparius, Erica scoparia, Calluna vulgaris ou, dans les plus fermées, Hedera helix, Ruscus aculeatus, Ilex aquifolium. Ces forêts sont développées dans les dunes internes acidoclines des côtes les plus chaudes et les plus humides du Marensin, entre les embouchures de l\'Eyre et de l\'Adour.');
INSERT INTO `corine` (`CD_HAB`, `FG_VALIDITE`, `CD_TYPO`, `LB_CODE`, `LB_HAB_FR`, `LB_HAB_FR_COMPLET`, `LB_HAB_EN`, `LB_AUTEUR`, `NIVEAU`, `LB_NIVEAU`, `CD_HAB_SUP`, `PATH_CD_HAB`, `FRANCE`, `LB_DESCRIPTION`, `CRSP_PHYTO_CB91`, `DESCRIPTIF_CB97_FR`) VALUES
(10180, 'NR', 22, '42.813', 'Plantations de Pins maritimes des Landes', '', 'Landes maritime pine plantations', '', 5, 'Niveau 5', 4514, '/68/491/1386/4514/10180', 'true', 'Pinus pinaster ssp. atlantica woodland of southwestern France other than the dunal formations listed in 42.811 and 42.812.', '', 'Bois de Pinus pinaster subsp. atlantica du sud-ouest de la France autres que les formations dunaires cataloguées dans 42.811 et 42.812. Elles sont entièrement ou presque entièrement d\'origine artificielle.'),
(10181, 'NR', 22, '42.814', '', '', 'Iberian maritime pine forests', '', 5, 'Niveau 5', 4514, '/68/491/1386/4514/10181', 'false', 'Pinus pinaster ssp. atlantica forests of Galicia, Portugal and neighbouring areas.', '', 'Pas de description disponible'),
(10182, 'NR', 22, '42.821', '', '', 'Iberian mesogean pine forests', '', 5, 'Niveau 5', 4521, '/68/491/1386/4521/10182', 'false', 'Pinus pinaster forests of the Iberian peninsula, appearing mostly as substitution communities of Quercus rotundifolia, Q. pyrenaica or, locally, Q. suber, Q. faginea woodlands.', '', 'Pas de description disponible'),
(10183, 'NR', 22, '44.311', 'Forêts de Frênes et d\'Aulnes à Laîches', '', 'Sedge ash-alder woods', '', 5, 'Niveau 5', 4522, '/68/515/1389/4522/10183', 'true', 'Formations of Fraxinus excelsior and Alnus glutinosa with an abundance of Carex remota, C. strigosa, C. pendula, C. sylvatica.', 'Carici remotae-Fraxinetum caricetosum', 'Formations à Fraxinus excelsior et Alnus glutinosa avec abondance de Carex remota, C. strigosa, C. pendula, C. sylvatica.'),
(10184, 'NR', 22, '44.911', 'Bois d\'Aulnes marécageux méso-eutrophes', '', 'Meso-eutrophic swamp alder woods', '', 5, 'Niveau 5', 4523, '/68/515/1388/4523/10184', 'true', 'Mesotrophic and meso-eutrophic Alnus glutinosa swamp woods of marshy depressions, with Carex elongata, Thelypteris palustris, Dryopteris cristata, Osmunda regalis, Solanum dulcamara, Calystegia sepium, Ribes nigrum, and often, in acidocline variants, Betula pubescens. The constancy of Carex elongata is characteristic on the continent, less so in Britain. Tall sedges, Carex paniculata, C. acutiformis, C. elata, often dominate the herb layer in the most humid types.', 'Carici elongatae-Alnetum (Irido-Alnenion)', 'Bois marécageux mésotrophes et méso-eutrophes d\'Alnus glutinosa de dépressions marécageuses, avec Carex elongata, Thelypteris palustris, Dryopteris cristata, Osmunda regalis, Solanum dulcamara, Calystegia sepium, Ribes nigrum, et souvent, dans les variantes acidoclines, Betula pubescens. La constance de Carex elongata est caractéristique sur le continent, elle l\'est moins en Grande-Bretagne. Les grandes laîches, Carex paniculata, C. acutiformis, C. elata, dominent souvent la strate herbacée dans les types les plus humides.'),
(10185, 'NR', 22, '42.822', 'Pinèdes de Pin mésogéen des Corbières', '', 'Corbières mesogean pine forests', '', 5, 'Niveau 5', 4521, '/68/491/1386/4521/10185', 'true', 'Isolated Pinus pinaster - dominated woods of the Corbières.', '', 'Bois isolés des Corbières dominés par Pinus pinaster.'),
(10186, 'NR', 22, '42.823', 'Forêts de Pins mésogéens franco-italiennes', '', 'Franco-Italian mesogean pine forests', '', 5, 'Niveau 5', 4521, '/68/491/1386/4521/10186', 'true', 'Pinus pinaster forests of siliceous lower meso-Mediterranean areas of Provence, of marls and limestones of the uppr meso-Mediterranean level of the Maritime Alps and the Ligurian Alps, and of mostly siliceous or clayey soils of the hills of Liguria and Tuscany.', '', 'Forêts de Pinus pinaster des basses régions siliceuses de l\'étage méso-méditerranéen de Provence, des marnes et calcaires de l\'étage méso-méditerranéen supérieur des Alpes maritimes et des Alpes ligures, et des sols surtout siliceux et argileux des collines ligure et toscanes.'),
(10187, 'NR', 22, '42.824', 'Forêts corses de Pins mésogéens', '', 'Corsican mesogean pine forests', '', 5, 'Niveau 5', 4521, '/68/491/1386/4521/10187', 'true', 'Pinus pinaster-dominated forests of the meso- and supra-Mediterranean levels of Corsica, mostly on granitic substrates; they are very developed, accompanied by a maquis-like understorey, in the meso-Mediterranean zone, mostly at its upper tier; they occur locally within the supra-Mediterranean zone, on adrets and at lower altitudes, as facies of laricio pine forests.', 'Pinetum pinastri, Erico-Arbutetum p., Galio-Pinetum p.', 'Forêts de Pinus pinaster dominant, des étages méso- et supra-méditerranéen de Corse, surtout sur des substrats granitiques ; elles sont très développées, accompagnées par un maquis en sous-bois, dans l\'étage méso-méditerranéen, surtout à son niveau supérieur. Elles existent localement à l\'étage supra-méditerranéen, sur des adrets et à des altitudes moindres, comme faciès de forêts de Pins laricio.'),
(10188, 'NR', 22, '42.825', '', '', 'Sardinian mesogean pine forests', '', 5, 'Niveau 5', 4521, '/68/491/1386/4521/10188', 'false', 'Pinus pinaster formations on granitic substrates of northern Sardinia, with Arbutus unedo, Quercus ilex, Rosmarinus officinalis, Erica arborea, Genista corsica, Lavandula stoechas, Rubia peregrina, Calicotome spinosa, Pistacia lentiscus, Teucrium marum.', '', 'Pas de description disponible'),
(10189, 'NR', 22, '42.826', '', '', 'Pantellerian mesogean pine forests', '', 5, 'Niveau 5', 4521, '/68/491/1386/4521/10189', 'false', 'Pinus pinaster woods of Pantelleria.', '', 'Pas de description disponible'),
(10190, 'NR', 22, '44.312', 'Forêts de Frênes et d\'Aulnes fontinales', '', 'Fontinal ash-alder woods', '', 5, 'Niveau 5', 4522, '/68/515/1389/4522/10190', 'true', 'Fraxinus excelsior-Alnus glutinosa woods with a wetter soil occupied by Cardamine amara and Chrysosplenium spp., and often by Impatiens noli-tangere.', 'Carici remotae-Fraxinetum chrysosplenietosum', 'Forêts de Fraxinus excelsior et d\'Alnus glutinosa sur des sols plus humides occupés par Cardamine amara et Chrysosplenium spp., et avec souvent Impatiens noli-tangere.'),
(10191, 'NR', 22, '44.313', 'Forêts de Frênes et d\'Aulnes à Cirse des maraîchers', '', 'Cabbage thistle ash-alder woods', '', 5, 'Niveau 5', 4522, '/68/515/1389/4522/10191', 'true', 'Fraxinus excelsior-Alnus glutinosa woods with the tall Cirsium oleraceum and Eupatorium cannabinum and usually Carex acutiformis; these constitute a transition towards 44.332.', 'Carici remotae-Fraxinetum cirsietosum', 'Forêts de Fraxinus excelsior et Alnus glutinosa avec les grands Cirsium oleraceum et Eupatorium cannabinum et généralement Carex acutiformis ; elles constituent la transition vers 44.332.'),
(10192, 'NR', 22, '44.314', 'Forêts de Frênes et d\'Aulnes des bords de sources à groseillers', '', 'Hillside spring ash-alder woods', '', 5, 'Niveau 5', 4522, '/68/515/1389/4522/10192', 'true', 'Fraxinus excelsior-Alnus glutinosa woods of seeping hillside depressions and of moist peaty ground, with Ribes rubrum.', 'Ribeso sylvestris-Fraxinetum', 'Bois de Fraxinus excelsior et Alnus glutinosa des bords de dépressions suintantes et des creux tourbeux humides, avec Ribes rubrum.'),
(10193, 'NR', 22, '44.315', 'Forêts de Frênes et d\'Aulnes à grande Prêle', '', 'Great horsetail ash-alder woods', '', 5, 'Niveau 5', 4522, '/68/515/1389/4522/10193', 'true', 'Fraxinus excelsior - Alnus glutinosa woods of calcareous tuffs.', 'Equiseto telmateiae-Fraxinetum', 'Bois de Fraxinus excelsior et d\'Alnus glutinosa sur des tufs calcaires.'),
(10194, 'NR', 22, '44.912', 'Bois d\'Aulnes marécageux oligotrophes', '', 'Oligotrophic swamp alder woods', '', 5, 'Niveau 5', 4523, '/68/515/1388/4523/10194', 'true', 'Oligotrophic or meso-oligotrophic, acidocline Alnus glutinosa woods of fens and poorly drained banks of brooks or small rivers, mostly characteristic of siliceous regions and Atlantic climates, south to Galicia. Betula pubescens and Frangula alnus often accompany the alders. The ground layer is usually rich in Sphagnum spp. and includes Carex laevigata, Equisetum sylvaticum and many ferns, including Oreopteris limbosperma, Blechnum spicant, Athyrium filix-femina, Dryopteris cristata and D. carthusiana.', 'Carici laevigatae-Alnetum (Blechno-Alnenion: Blechno-Alnetum, Sphagno-Alnetum)', 'Bois d\'Alnus glutinosa acidoclines, oligotrophes ou méso-oligotrophes des bas-marais et des berges mal drainées des ruisseaux ou des petites rivières, plutôt caractéristiques des régions siliceuses et des climats atlantiques. Betula pubescens et Frangula alnus accompagnent souvent les Aulnes. La strate herbacée est habituellement riche en Sphagnum spp. et inclut Carex laevigata, Equisetum sylvaticum et beaucoup d\'autres fougères, incluant Oreopteris limbosperma, Blechnum spicant, Athyrium filix-femina, Dryopteris cristata et Dryopteris carthusiana.'),
(10195, 'NR', 22, '44.913', '', '', 'Mediterranean swamp alder woods', '', 5, 'Niveau 5', 4523, '/68/515/1388/4523/10195', 'false', 'Rare swamp woods of the Mediterranean evergreen oak zone, such as the Athos peninsula swamp wood with Arundo donax, Equisetum telmateia, Carex pendula, C. remota, Humulus lupulus, Osmunda regalis.', '', 'Pas de description disponible'),
(9583, 'NR', 22, '32.254', '', '', 'Iberian Periploca scrubs', '', 5, 'Niveau 5', 4043, '/67/488/1225/4043/9583', 'false', 'Open, sometimes sparse brush dominated by Periploca laevigata ssp. angustifolia with Osyris quadripartita, Chamaerops humilis, Pistacia lentiscus, Rhamnus lycioides and locally Calicotome infesta ssp. intermedia, Tetraclinis articulata, Maytenus senegalensis or Lycium intricatum, limited to very arid coastal areas of Murcia and Almeria.', 'Gymnosporio europaeae-Periplocetum angustifoliae', 'Pas de description disponible'),
(9584, 'NR', 22, '32.255', '', '', 'Pantellerian Periploca scrubs', '', 5, 'Niveau 5', 4043, '/67/488/1225/4043/9584', 'false', 'Summer deciduous shrub formations of Periploca laevigata ssp. angustifolia, Lycium intricatum, Euphorbia dendroides with Prasium majus, Pistacia lentiscus, Asparagus acutifolius, Phillyrea angustifolia, Calicotome villosa of the southwestern coast of Pantelleria and of the Egadi islands.', 'Periploco-Euphorbietum dendroidis', 'Pas de description disponible'),
(9585, 'NR', 22, '32.256', '', '', 'Tall arid brushes', '', 5, 'Niveau 5', 4043, '/67/488/1225/4043/9585', 'false', 'Communities essentially endemic to the province of Almeria, constituted by Phlomis purpurea ssp. almeriensis, P. caballeroi, Genista spartioides ssp. retamoides, G. umbellata, G. ramosissima, G. cinerea ssp. valentina, Launaea arborescens, L. lanifera, Lavatera oblongifolia, Linum suffruticosum, Salsola webbii, Salvia candelabrum, Sideritis foetens, Thymelaea tartonraira, Ulex parviflorus ssp. canescens, Frankenia webbii, Anthyllis terniflora. Formations belonging to this alliance dominated by large, non-spiny brooms are listed separately under 32.26.', 'Anthyllidetalia terniflorae: Genisto-Phlomidion almeriensis', 'Pas de description disponible'),
(9586, 'NR', 22, '32.21B', 'Fruticées à Nerprun et asperges', '', 'Buckthorn-asparagus brushes', '', 5, 'Niveau 5', 4052, '/67/488/1225/4052/9586', 'true', 'Thermo-Mediterranean formations in which Asparagus spp. and/or Rhamnus lycioides predominate.', '', 'Formations thermo-méditerranéennes dans lesquelles Asparagus sp.pl et/ou Rhamnus lycioides prédominent.'),
(9587, 'NR', 22, '32.21C', 'Buissons à Osyris', '', 'Osyris brushes', '', 5, 'Niveau 5', 4052, '/67/488/1225/4052/9587', 'true', 'Formations dominated by Osyris alba or O. tripartita.', '', 'Formations dominées par Osyris alba ou O. tripartita.'),
(9588, 'NR', 22, '32.21D', 'Fourrés à Aliboufier', '', 'Storax thickets', '', 5, 'Niveau 5', 4052, '/67/488/1225/4052/9588', 'true', 'Styrax officinalis-dominated formations of thermo- and meso-Mediterranean areas of the eastern Mediterranean.', '', 'Formations dominées par Styrax officinalis des régions thermo- et méso-méditerranéennes.'),
(9589, 'NR', 22, '32.21E', '', '', 'Buxus balearica box thickets', '', 5, 'Niveau 5', 4052, '/67/488/1225/4052/9589', 'false', 'Buxus balearica formations of coastal regions of Andalusia, bordering the Sea of Alboran, and of the Balearics.', 'Cneoro-Buxetum balearicae; Aceri-Buxetum', 'Pas de description disponible'),
(9590, 'NR', 22, '32.21F', '', '', 'Dwarf oak scrub', '', 5, 'Niveau 5', 4052, '/67/488/1225/4052/9590', 'false', 'Formations of the semi-evergreen shrub Quercus fruticosa of southern Portugal and western Andalusia.', '', 'Pas de description disponible'),
(9591, 'NR', 22, '32.21G', '', '', 'Tall spiny broom brush', '', 5, 'Niveau 5', 4052, '/67/488/1225/4052/9591', 'false', 'Brushes dominated by tall, spiny species of Genista.', '', 'Pas de description disponible'),
(9592, 'NR', 22, '32.21H', '', '', 'Corema brush', '', 5, 'Niveau 5', 4052, '/67/488/1225/4052/9592', 'false', 'Corema album -dominated formations of the southwestern coasts of the Iberian peninsula. Most of them are dunal and can be listed under 16.28, completed by this code.', '', 'Pas de description disponible'),
(9593, 'NR', 22, '32.21I', 'Brousses thermo-méditerranéennes à Genévriers', '', 'Thermo-Mediterranean juniper brushes', '', 5, 'Niveau 5', 4052, '/67/488/1225/4052/9593', 'true', 'Formations rich in thermo-Mediterranean elements dominated by prostrate or low shrubby Juniperus oxycedrus or J. phoenicea. Many of them are dunal and can be listed under 16.28, completed by this code. See also 32.2B2.', '', 'Formations riches en éléments thermo-méditerranéens, dominées par des individus prostrés ou bas et buissonnants de Juniperus oxycedrus ou de Juniperus phoenicea. Beaucoup sont dunaires et peuvent être classés en 16.28, complété par ce code.'),
(9594, 'NR', 22, '32.161', '', '', 'Eastern deciduous oak matorral', '', 5, 'Niveau 5', 4047, '/67/488/1224/4047/9594', 'false', 'Mediterranean or sub-Mediterranean evergreen sclerophyllous bush and scrub organized around eastern Mediterranean deciduous or semi-evergreen oaks (Quercus macrolepis, Q. trojana, Q. anatolica, i.a.).', '', 'Pas de description disponible'),
(9595, 'NR', 22, '32.162', 'Matorral occidental à Chênes caducifoliés', '', 'Western deciduous oak matorral', '', 5, 'Niveau 5', 4047, '/67/488/1224/4047/9595', 'true', 'Mediterranean or sub-Mediterranean evergreen sclerophyllous bush and scrub organized around western thermo-Mediterranean, meso-Mediterranean and sometimes supra-Mediterranean deciduous or semi-evergreen oaks (Q. canariensis, Q. faginea, Q. pyrenaica, Q. pubescens, i. a.).', '', 'Fruticées et broussailles sempervirentes méditerranéennes ou sub-méditerranéennes organisées autour de Chênes caducifoliés (Q. pyrenaica, Q. pubescens, i.a.) du thermo-méditerranéen occidental, du méso-méditerranéen, et quelques fois supra-méditerranéen.'),
(9596, 'NR', 22, '32.211', 'Fruticées à Oliviers et Lentisques', '', 'Oleo-lentisc brush', '', 5, 'Niveau 5', 4052, '/67/488/1225/4052/9596', 'true', 'Usually pluri-specific brushes in which Olea europea ssp. sylvestris accompanied by Pistacia lentiscus plays a determinant physiognomic role. Almost entirely restricted to the thermo-Mediterranean zone, they are represented by particularly well-developed, extensive stands in southern Iberia, the Balearics, Sardinia, Sicily, southern Greece and the Aegean. When the characteristic species increase in height they grade into arborescent matorral (32.12).', '', 'Fruticées habituellement pluri-spécifiques dans lesquelles Olea europaea subsp. sylvestris accompagnés de Pistacia lentiscus joue un rôle physionomique déterminant. Presque entièrement limitées à l\'étage thermo-méditerranéen, elles sont représentées par des formations extensives particulièrement bien développées en Sardaigne, en Sicile... Quand les espèces caractéristiques augmentent en hauteur, elles s\'intègrent au matorral arborescent (32.12).'),
(9597, 'NR', 22, '32.265', '', '', 'Genista retamoides broom fields', '', 5, 'Niveau 5', 4060, '/67/488/1225/4060/9597', 'false', 'Formations of the coast of the Sea of Alboran and of the arid Iberian Southeast dominated by the endemic Genista spartioides ssp. retamoides.', 'Genisto-Phlomidion almeriensis p.; Phlomidetalia purpureae: Lavandulo dentatae-Genistetum retamoidis', 'Pas de description disponible'),
(9598, 'NR', 22, '32.266', '', '', 'Genista haenseleri broom fields', '', 5, 'Niveau 5', 4060, '/67/488/1225/4060/9598', 'false', 'Open formations of abrupt, hot, sunny slopes of the sierras de Ojen, Mijas (Unidad Blanca), southern Andalusia characterized by the presence of the striking, tall endemic broom Genista haenseleri, associated with Phlomis purpurea ssp. purpurea, Ulex parviflorus ssp. willkommii, Genista umbellata ssp. equisetiformis, Thymus capitatus, Teucrium fruticans.', 'Phlomidetalia purpureae: Corodothymo capitati-Genistetum haenseleri', 'Pas de description disponible'),
(9599, 'NR', 22, '32.267', '', '', 'Genista ramosissima broom fields', '', 5, 'Niveau 5', 4060, '/67/488/1225/4060/9599', 'false', 'Formations characterized by the presence of the usually dominant, non-spiny broom Genista ramosissima of south-eastern Spain and North Africa, limited to the hills of the Rio Aguas basin and the Macizo de Bedar; Thymelaea tartonraira, Phlomis purpurea ssp. almeriensis may be very abundant.', 'Genisto-Phlomidion almeriensis: Thymelaeo-Genistetum ramosissimae', 'Pas de description disponible'),
(9600, 'NR', 22, '32.268', '', '', 'Sicilian retama brush', '', 5, 'Niveau 5', 4060, '/67/488/1225/4060/9600', 'false', 'Retama fields formed on maritime sands of southern Sicily by Lygos raetam ssp. gussonei, European and Sicilian endemic related to Lygos raetam of the southern palaearctic sub-desert belt.', '', 'Pas de description disponible'),
(9601, 'NR', 22, '32.269', '', '', 'Eolian broom fields', '', 5, 'Niveau 5', 4060, '/67/488/1225/4060/9601', 'false', 'Thermo-Mediterranean formations of volcanic rocks and sands of Stromboli and Vulcano dominated by the very tall Eolian endemic broom Cytisus aeolicus, with the Tyrrhenian insular endemic Centaurea aeolica.', '', 'Pas de description disponible'),
(9602, 'NR', 22, '32.26A', '', '', 'Genista ephedroides broom fields', '', 5, 'Niveau 5', 4060, '/67/488/1225/4060/9602', 'false', 'Formations dominated by the Tyrrhenian endemic Genista ephedroidres, restricted to a few localities on western and northern Sardinian headlands, the north coast of Sicily, the Eolian and Ponsian islands and the Cilento coast (Campania).', '', 'Pas de description disponible'),
(9603, 'NR', 22, '32.26B', '', '', 'Ibiza broom fields', '', 5, 'Niveau 5', 4060, '/67/488/1225/4060/9603', 'false', 'Formations characterized by the remarkable, tall Ibiza endemic Genista dorycnifolia, accompanied by the eastern Iberian Chronanthus biflorus (Cytisus fontanesii).', 'Cytiso fontanesii-Genistetum dorycnifoliae', 'Pas de description disponible'),
(10217, 'NR', 22, '42.841', '', '', 'Iberian Aleppo pine forests', '', 5, 'Niveau 5', 4542, '/68/491/1386/4542/10217', 'false', 'Pinus halepensis forests of Spain, considered native for at least two-thirds of their considerable expanse; they are mostly restricted to eastern regions on the Mediterranean slope of the Catalonian mountains, the Maestrazgo, the pre-Baetic ranges of the upper Guadalquivir basin, the southern Andalusian mountains; they penetrate farther inland in the Ebro basin and around the headwaters of the Tagus and Guadalquivir systems.', '', 'Pas de description disponible'),
(10218, 'NR', 22, '42.842', '', '', 'Balearic Aleppo pine forests', '', 5, 'Niveau 5', 4542, '/68/491/1386/4542/10218', 'false', 'Pinus halepensis formations of the Balearics, present and probably native on all the major islands.', '', 'Pas de description disponible'),
(10219, 'NR', 22, '42.843', 'Forêts de Pins d\'Alep provenço-liguriennes', '', 'Provenço-Ligurian Aleppo pine forests', '', 5, 'Niveau 5', 4542, '/68/491/1386/4542/10219', 'true', 'Mostly lower meso-Mediterranean Pinus halepensis forests of Provence and of the lower slopes and coastlines of the Maritime and Ligurian Alps, extensive and undoubtedly native.', '', 'Forêts de Pinus halepensis provençales et des pentes inférieures et du littoral des Alpes maritimes et ligures, généralement liées à la zone mésoméditerranéenne inférieure. Ces forêts sont étendues et incontestablement indigènes.'),
(10220, 'NR', 22, '42.844', 'Bois de Pins d\'Alep corses', '', 'Corsican Aleppo pine woods', '', 5, 'Niveau 5', 4542, '/68/491/1386/4542/10220', 'true', 'Rare and local Pinus halepensis woods of the Corsican coasts, some, at least, possibly natural.', '', 'Bois de Pinus halepensis des côtes corses. Ces bois sont rares et localisés ; quelques uns, au moins, peuvent être naturels.'),
(10221, 'NR', 22, '42.845', '', '', 'Sardinian Aleppo pine woods', '', 5, 'Niveau 5', 4542, '/68/491/1386/4542/10221', 'false', 'Pinus halepensis formations of Sardinia, where certainly native woods occur on Isola di San Pietro and the Sulcis coast of Iglesiente.', '', 'Pas de description disponible'),
(10222, 'NR', 22, '42.846', '', '', 'Sicilian Aleppo pine woods', '', 5, 'Niveau 5', 4542, '/68/491/1386/4542/10222', 'false', 'Pinus halepensis formations of Sicily and peripheral islands.', '', 'Pas de description disponible'),
(10223, 'NR', 22, '44.341', '', '', 'Galicio-Cantabrian alder galleries', '', 5, 'Niveau 5', 4543, '/68/515/1389/4543/10223', 'false', 'Northern Galician and western Cantabrian Alnus glutinosa galleries, with Carex acuta ssp. broteriana.', 'Valeriano pyrenaicae-Alnetum', 'Pas de description disponible'),
(10224, 'NR', 22, '44.342', 'Galeries d\'Aulnes pyrénéo-cantabriques', '', 'Pyreneo-Cantabrian alder galleries', '', 5, 'Niveau 5', 4543, '/68/515/1389/4543/10224', 'true', 'Eastern Cantabrian and western Pyrenean Alnus glutinosa galleries.', 'Hyperico androsaemi-Alnetum', 'Galeries d\'Alnus glutinosa de l\'ouest des Pyrénées.'),
(10225, 'NR', 22, '44.343', 'Galeries d\'Aulnes pyrénéo-catalanes', '', 'Pyreneo-Catalonian alder galleries', '', 5, 'Niveau 5', 4543, '/68/515/1389/4543/10225', 'true', 'Eastern Pyrenean and Catalonian Alnus glutinosa galleries.', 'Scrophulario alpestris-Alnetum (Alnetum catalaunicum), Carici pendulae-Alnetum, Lamio flexuosi-Alnetum', 'Galeries d\'Alnus glutinosa de l\'est des Pyrénées et de la Catalogne.'),
(10226, 'NR', 22, '44.A41', 'Pessières à Sphaignes montagnardes', '', 'Montane sphagnum spruce woods', '', 5, 'Niveau 5', 4538, '/68/515/1390/4538/10226', 'true', 'Often dense Picea abies forests on peaty soils carpeted with sphagnum and mosses, accompanied by an understorey of Maianthemum bifolium, Vaccinium myrtillus, V. vitis-idae, Deschampsia flexuosa, Calamagrostis villosa, Blechnum spicant and Listera cordata.', 'Sphagno-Piceetum, Soldanello-Piceetum bazzanietosum i.a.', 'Forêts souvent denses de Picea abies sur sols tourbeux recouverts de Sphaignes et de Mousses avec une sous-strate de Maianthemum bifolium, Vaccinium myrtillus, Vaccinium vitis- idaea, Deschampsia flexuosa, Calamagrostis villosa, Blechnum spicant et Listera cordata.'),
(10227, 'NR', 22, '44.A42', 'Tourbières boisées à Epicéas', '', 'Bog spruce woods', '', 5, 'Niveau 5', 4538, '/68/515/1390/4538/10227', 'true', 'Picea abies formations colonizing raised bogs, with Betula pubescens, B. carpatica, Vaccinium uliginosum, V. vitis-idaea, V. myrtillus, V. oxycoccos, Eriophorum vaginatum, Sphagnum magellanicum and other sphagnums.', '', 'Formations de Picea abies colonisant les tourbières hautes, avec Betula pubescens, B. carpatica, Vaccinium uliginosum, V. vitis-idaea, V. myrtillus, V. oxycoccos, Eriophorum vaginatum, Sphagnum magellanicum et autres Sphaignes.'),
(10228, 'NR', 22, '51.121', 'Chenaux, cuvettes profondes', '', 'Deep schlenken', '', 5, 'Niveau 5', 4545, '/71/518/1404/4545/10228', 'true', 'Constantly submerged hollows with bright green Sphagnum cuspidatum, S. recurvum, S. dusenii and with Drepanocladus fluitans, Lophozia inflata, Eriophorum angustifolium, Rhynchospora alba, Menyanthes trifoliata, Carex limosa, C. paupercula, C. pauciflora, Scheuchzeria palustris.', 'Caricetum limosae p.', 'Dépressions constamment submergées, renfermant des sphaignes vert clair : Sphagnum cuspidatum, S. recurvum, S. dusenii et Drepanocladus fluitans, Lophozia inflata, Eriophorum angustifolium, Rhynchospora alba, Menyanthes trifoliata, Carex limosa, C. pauciflora, Scheuchzeria palustris.'),
(10229, 'NR', 22, '51.122', 'Chenaux superficiels, cuvettes peu profondes', '', 'Shallow schlenken', '', 5, 'Niveau 5', 4545, '/71/518/1404/4545/10229', 'true', 'Temporily inundated shallow hollows with Rhynchospora alba, R. fusca, Drosera intermedia, Lycopodiella inundata.', 'Rhynchosporetum albae', 'Dépressions peu profondes inondées temporairement, avec Rhynchospora alba, R. fusca, Drosera intermedia, Lycopodiella inundata.'),
(10230, 'NR', 22, '51.131', 'Dépressions tourbeuses (Kolk)', '', 'Bog eye (kolk)', '', 5, 'Niveau 5', 4546, '/71/518/1404/4546/10230', 'true', 'Large pools or lakes occurring near the centre of central European raised bogs, often with relatively firm, steep banks colonized by trees or scrub forming a ring of woodland.', '', 'Vastes dépressions (mares) ou lacs développés vers le centre des tourbières bombées d\'Europe centrale, souvent avec des rives escarpées, relativement fermes, colonisés par des arbres ou des buissons formant une ceinture boisée.'),
(10231, 'NR', 22, '51.132', 'Autres mares de tourbières', '', 'Other bog pools', '', 5, 'Niveau 5', 4546, '/71/518/1404/4546/10231', 'true', '', '', 'Pas de description disponible'),
(10232, 'NR', 22, '42.847', '', '', 'Peninsular Italian Aleppo pine forests', '', 5, 'Niveau 5', 4542, '/68/491/1386/4542/10232', 'false', 'Pinus halepensis formations of the Italian peninsula; extensive, probably at least partially native ones are individualized in the subdivisions below.', '', 'Pas de description disponible'),
(10233, 'NR', 22, '42.848', '', '', 'Greek Aleppo pine forests', '', 5, 'Niveau 5', 4542, '/68/491/1386/4542/10233', 'false', 'Pinus halepensis formations of Greece, where the species is relatively widespread, particularly in Attica, Thessaly, the coasts of the Peloponnese and of central continental Greece, the Ionian islands, Chalcidici, the northern Sporades, Euboea and Skiros.', '', 'Pas de description disponible'),
(10234, 'NR', 22, '42.851', '', '', 'Aegean pine forests of Crete', '', 5, 'Niveau 5', 4548, '/68/491/1386/4548/10234', 'false', 'Pinus brutia-dominated forests of Crete and its satellite islands Gavdos and Gaidaronisi, pure or mixed with Cupressus sempervirens; they are widespread in particular in the White Mountains, the Psiloriti range, the Dikti range and, locally, in the Sitia mountains and the Asterousia mountains.', '', 'Pas de description disponible'),
(10235, 'NR', 22, '42.852', '', '', 'Aegean pine forests of Lesbos', '', 5, 'Niveau 5', 4548, '/68/491/1386/4548/10235', 'false', 'Extensive Pinus brutia forests of Lesbos, occupying Mount Olympus and surrounding hills in the southeastern quadrant of the island, as well as parts of the Kuratsonas range in the northwest; these forests harbour the only European population of the nuthatch Sitta krueperi and the most significant one of the orchid Comperia comperiana.', '', 'Pas de description disponible'),
(10236, 'NR', 22, '45.211', 'Forêts provençales de Chênes lièges', '', 'Provençal cork-oak woodland', '', 5, 'Niveau 5', 4552, '/68/517/1397/4552/10236', 'true', 'Formations of crystalline Provence (Maures, Esterel), no longer represented by fully developed, mature stands.', '', 'Formations de Provence cristalline (Maures, Esterel), elles ne comprennent actuellement plus de peuplements pleinement développés arrivés à maturité.'),
(10237, 'NR', 22, '45.212', 'Forêts corses de Chênes lièges', '', 'Corsican cork-oak woodland', '', 5, 'Niveau 5', 4552, '/68/517/1397/4552/10237', 'true', 'Formations of the lower meso-Mediterranean level of Corsica, developed on deep siliceous soils, mostly of the southeastern part of the island; better preserved than on the continent, they are nevertheless almost never represented by fully developed, extensive forest.', '', 'Formations de l\'étage méso-méditerranéen inférieur de Corse, développées sur des sols siliceux profonds, plutôt dans la partie sud-est de l\'île ; mieux préservées que sur le continent, elles ne sont néanmoins jamais représentées par des forêts étendues entièrement développées.'),
(10238, 'NR', 22, '45.213', '', '', 'Sardinian cork-oak forests', '', 5, 'Niveau 5', 4552, '/68/517/1397/4552/10238', 'false', 'Extensive, widespread and varied forests of Sardinia, extending from sea level to about 900 m in noncalcareous mountains. Q. suber is sometimes associated with Q. ilex or Q. pubescens. These forests include luxuriant, fully developed, mature formations, by far the best-preserved cork-oak forests in the central Mediterranean basin.', '', 'Pas de description disponible'),
(10239, 'NR', 22, '42.853', '', '', 'Aegean pine forests of Samos', '', 5, 'Niveau 5', 4548, '/68/491/1386/4548/10239', 'false', 'Pinus brutia forests covering large expanses of Samos, in particular in the Ambelos range, the Kerki mountains, the southern hills and the northeastern peninsula.', '', 'Pas de description disponible'),
(9604, 'NR', 22, '32.271', '', '', 'Monchique Ulex argenteus gorse-heaths', '', 5, 'Niveau 5', 4053, '/67/488/1225/4053/9604', 'false', 'Ulex argenteus ssp. argenteus -dominated or -rich formations of low slopes of the Serra da Monchique and neighbouring areas of Algarve and southwest Alentejo, usually with Cistus ladanifer. The gorse is endemic to the area; the communities inhabited by its two equally restricted relatives, U. argenteus ssp. subsericeus and U. argenteus ssp. erinaceus are listed under 32.2A3, 32.2B4 and 32.2563.', 'Cisto ladaniferae-Ulicetum argentei', 'Pas de description disponible'),
(9605, 'NR', 22, '32.2C1', '', '', 'Dry Andalusian monte negro', '', 5, 'Niveau 5', 4059, '/67/488/1225/4059/9605', 'false', 'Formations of higher ground with the endemic gorse Ulex australis, Erica scoparia, Calluna vulgaris, Genista triacanthos, Erica umbellata, Halimium halimifolium, Cistus salvifolius.', 'Erico scopariae-Ulicetum australis', 'Pas de description disponible'),
(9606, 'NR', 22, '32.2C2', '', '', 'Humid Andalusian monte negro', '', 5, 'Niveau 5', 4059, '/67/488/1225/4059/9606', 'false', 'Formations of semipeaty edges of fresh-water lagoons and depressions where the winter and spring water table reaches the surface, with Ulex minor var. lusitanicus, Erica ciliaris, E. scoparia, Calluna vulgaris, Genista anglica, Molinia caerulea, Pteridium aquilinum, Cistus salvifolius.', 'Erico ciliaris-Ulicetum lusitanici', 'Pas de description disponible'),
(9607, 'NR', 22, '32.311', 'Maquis hauts de Méditerranée occidentale', '', 'Western Mediterranean high maquis', '', 5, 'Niveau 5', 4054, '/67/488/1226/4054/9607', 'true', 'Formations with Erica arborea, Arbutus unedo, Quercus ilex, Phillyrea angustifolia, P. media, Viburnum tinus, Rhamnus alaternus, Juniperus oxycedrus, Fraxinus ornus.', 'Ericenion arboreae: Phillyreo angustifoliae-Arbutetum unedi, Phillyreo rodriguezi-Arbutetum unedi, Erico arboreae-Arbutetum unedi i.a.', 'Formations avec Erica arborea, Arbutus unedo, Quercus ilex, Phyllirea angustifolia, P. media, Viburnum tinus, Rhamnus alaternus, Juniperus oxycedrus, Fraxinus ornus.'),
(9608, 'NR', 22, '32.272', '', '', 'Lusitanian Ulex densus gorse-heaths', '', 5, 'Niveau 5', 4053, '/67/488/1225/4053/9608', 'false', 'Cushion-heaths of Ulex densus formed in substitution stages of the Melico-Cocciferetum on dry, calcareous coastal hills of the Tejo and Estremadura regions of central-western Portugal; the gorse is endemic to the area.', '', 'Pas de description disponible'),
(9609, 'NR', 22, '32.273', '', '', 'Morena Ulex eriocladus gorse heaths', '', 5, 'Niveau 5', 4053, '/67/488/1225/4053/9609', 'false', 'Formations of the western Sierra Morena (Sierra de Aracena, Badajos region, southeastern Portugal) dominated by Ulex eriocladus, developed mostly in the meso-Mediterranean zone and locally in contact with Erica umbellata heaths; the gorse is endemic to the area.', 'Ulici eriocladi-Cistetum ladaniferae p., Ulici eriocladi-Ericetum umbellatae p., Helianthemo-Saturejetum micranthae p.', 'Pas de description disponible'),
(9610, 'NR', 22, '32.274', 'Landes à Ulex parviflorus franco-ibériennes', '', 'Franco-Iberian Ulex parviflorus gorse-heaths', '', 5, 'Niveau 5', 4053, '/67/488/1225/4053/9610', 'true', 'Ulex parviflorus ssp. parviflorus -dominated formations of central-western Portugal, southern and eastern Spain and southern France, locally distributed on calcareous or siliceous substrates of the thermo-Mediterranean and lower meso-Mediterranean zones, occasionally ascending to higher elevations. Communities including the related Ulex parviflorus ssp. willkommii, U. baeticus and U. australis are listed under 32.28, 32.2A and 32.2C, clearly meso-Mediterranean formations under 32.4H.', '', 'Formations dominées par Ulex parviflorus subsp. parviflorus de la France méridionale, distribuées localement sur des substrats calcaires ou siliceux des étages thermo-méditerranéen et méso-méditerranéen inférieur, montant occasionnellement à de plus hautes altitudes.'),
(9611, 'NR', 22, '32.275', '', '', 'Alentejo Stauracanthus gorse-heaths', '', 5, 'Niveau 5', 4053, '/67/488/1225/4053/9611', 'false', 'Stauracanthus genistoides ssp. spectabilis-dominated formations of the coast of Alentejo; the gorse has a very restricted distribution: outside of its Alentejo stations it occurs only in Morocco.', '', 'Pas de description disponible'),
(9612, 'NR', 22, '32.276', '', '', 'Luso-Extremaduran Genista hirsuta gorse-heaths', '', 5, 'Niveau 5', 4053, '/67/488/1225/4053/9612', 'false', 'Genista hirsuta-dominated formations of thermo- and meso-Mediterranean Luso-Extremaduran regions, widespread and physiognomically striking by the hemispherical port of the shrub, similar to that of many gorses and of phrygana species.', 'Genisto hirsuti-Cistetum ladaniferae', 'Pas de description disponible'),
(9613, 'NR', 22, '32.281', '', '', 'Baetic garrigues', '', 5, 'Niveau 5', 4055, '/67/488/1225/4055/9613', 'false', 'Varied calcicolous formations of Baetic hills; they may be dominated by any of a number of characteristic species of the class, and in particular by Thymus capitatus, Teucrium polium, Helianthemum hirtum, Phlomis purpurea ssp. purpurea or Ulex parviflorus ssp. willkommii; they occur locally throughout the entire Baetic area. A few communities, remarkable for the dominance of less widespread, often endemic, usually striking species, and, in many cases, for their adaptation to noncalcareous soils or to outlying areas, have been listed separately.', 'Saturejo-Coridothymion p.', 'Pas de description disponible'),
(9614, 'NR', 22, '32.282', '', '', 'Ronda Ononis speciosa garrigues', '', 5, 'Niveau 5', 4055, '/67/488/1225/4055/9614', 'false', 'Spectacular formations dominated by the endemic shrub Ononis speciosa with Bupleurum gibraltaricum, Thymus capitatus, Micromeria graeca, Phlomis purpurea ssp. purpurea, Ulex parviflorus ssp. willkommii, Genista umbellata ssp. equisetiformis, Calicotome villosa, Satureja obovata, Ptilostemon hispanicus, locally distributed in calcareous areas of the Serrania de Ronda and satellite ranges.', 'Saturejo-Coridothymion p.: Bupleuro-Ononidetum speciosae', 'Pas de description disponible'),
(9615, 'NR', 22, '32.283', '', '', 'Guadalquivir Genista equisetiformis garrigues', '', 5, 'Niveau 5', 4055, '/67/488/1225/4055/9615', 'false', 'Sub-Baetic formations of calcareous hills lining the Guadalquivir depression of Andalusia with the large cushion-forming Genista umbellata ssp. equisetiformis and Chronanthus biflorus accompanied by Thymus capitatus, T. eryanthus and Ulex parviflorus spp. willkommii.', 'Saturejo-Coridothymion p.: Genisto-Cytisetum fontanesii', 'Pas de description disponible'),
(9616, 'NR', 22, '32.284', '', '', 'Alboran Genista equisetiformis garrigues', '', 5, 'Niveau 5', 4055, '/67/488/1225/4055/9616', 'false', 'Acidophilous formations limited to rare enclaves of the slopes above the Sea of Alboran, with Genista umbellata ssp. equisetiformis, Ulex parviflorus ssp. willkommii, Calicotome villosa, Lavandula stoechas ssp. stoechas, Adenocarpus grandiflorus.', 'Saturejo-Coridothymion p.: Lavandulo stoechidi-Genistetum equisetiformis', 'Pas de description disponible'),
(9617, 'NR', 22, '32.285', '', '', 'Andalusian magnesium garrigues', '', 5, 'Niveau 5', 4055, '/67/488/1225/4055/9617', 'false', 'Ulex baeticus -dominated or -rich formations of ultrabasic dolomites, serpentines and peridotites of the Serrania de Ronda and its peripheral ranges.', 'Staehelino-Ulicion baetici', 'Pas de description disponible'),
(9618, 'NR', 22, '32.286', '', '', 'Bermeja Halimium garrigues', '', 5, 'Niveau 5', 4055, '/67/488/1225/4055/9618', 'false', 'Tall Halimium atriplicifolium formations of the peridotites of the Sierra Bermeja with Phlomis purpurea ssp. purpurea, Genista lanuginosa, G. hirsuta, Lavandula stoechas.', 'Halimio atriplicifolii-Digitaletum laciniatae p.', 'Pas de description disponible'),
(9619, 'NR', 22, '32.291', '', '', 'Aljibe Stauracanthus gorse-heaths', '', 5, 'Niveau 5', 4056, '/67/488/1225/4056/9619', 'false', 'Formations of the sierras del Aljibe, Blanquilla, del Nino and de Ojen with the Gibraltar endemics Genista tridens and Bupleurum foliosum.', '', 'Pas de description disponible'),
(9620, 'NR', 22, '32.292', '', '', 'Algarve Stauracanthus gorse-heaths', '', 5, 'Niveau 5', 4056, '/67/488/1225/4056/9620', 'false', 'Very local formation of the coast of the Algarve, with Genista triacanthos, Erica umbellata, Calluna vulgaris and Tuberaria major.', '', 'Pas de description disponible'),
(9621, 'NR', 22, '32.2A1', '', '', 'Southern Andalusian monte blanco', '', 5, 'Niveau 5', 4057, '/67/488/1225/4057/9621', 'false', 'Formations of the coasts of the Gulf of Cadiz, between the estuaries of the rios Guadalete, Guadalquivir and Tinto, particularly characteristic of the Coto Donana (monte blanco), in which the characteristic shrubs listed above are accompanied by, in particular, Lavandula stoechas ssp. lusitanica, Armeria velutina and Thymus tomentosus and, in the wide transition zone with the monte negro, by Ulex australis and Erica scoparia.', 'Halimio halimifolii-Stauracanthetum genistoidis', 'Pas de description disponible'),
(10240, 'NR', 22, '42.854', '', '', 'Aegean pine woods of Chios', '', 5, 'Niveau 5', 4548, '/68/491/1386/4548/10240', 'false', 'Remnant forests of Chios with a composition and stratification similar to those of the forests of Samos.', '', 'Pas de description disponible'),
(10241, 'NR', 22, '42.855', '', '', 'Aegean pine forests of Thasos', '', 5, 'Niveau 5', 4548, '/68/491/1386/4548/10241', 'false', 'Broad Pinus brutia belt on the lower reaches of Thasos, up to about 400 to 500 metres, mixed with Pinus pallasiana in the higher areas.', '', 'Pas de description disponible'),
(10242, 'NR', 22, '42.856', '', '', 'Aegean pine woods of Samothrace', '', 5, 'Niveau 5', 4548, '/68/491/1386/4548/10242', 'false', 'Mostly sparse Pinus brutia formations of the lowlands of Samothrace.', '', 'Pas de description disponible'),
(10243, 'NR', 22, '42.857', '', '', 'Aegean pine forests of Rhodes', '', 5, 'Niveau 5', 4548, '/68/491/1386/4548/10243', 'false', 'Remnant Pinus brutia forests of Rhodes, still represented by some relatively natural formations with rich scrub undergrowth.', '', 'Pas de description disponible'),
(10244, 'NR', 22, '42.858', '', '', 'Aegean pine forests of Karpathos', '', 5, 'Niveau 5', 4548, '/68/491/1386/4548/10244', 'false', 'Fairly extensive Pinus brutia forests of Karpathos, distributed, in particular, in the northern coastal area, the southern interior and the middle elevation of Kali Limni.', '', 'Pas de description disponible'),
(10245, 'NR', 22, '42.859', '', '', 'Aegean pine forests of the Dodecanese', '', 5, 'Niveau 5', 4548, '/68/491/1386/4548/10245', 'false', 'Pinus brutia formations of the islands of Simi, Kos, Leros and Ikaria.', '', 'Pas de description disponible'),
(10246, 'NR', 22, '42.911', '', '', 'Tenerife pine-rockrose forests', '', 5, 'Niveau 5', 4556, '/68/491/1398/4556/10246', 'false', 'Pine forests of Tenerife, with Lotus campylocladus, Chamaecytisus proliferus (Cytiso proliferi-Pinetum canariensis cistetosum sympytifolii); they are the main habitat of the endangered Dendrocopos major canariensis and of Fringilla teydea teydea.', '', 'Pas de description disponible'),
(10247, 'NR', 22, '44.431', '', '', 'Illyrian ash-oak-alder forests', '', 5, 'Niveau 5', 4558, '/68/515/1396/4558/10247', 'false', 'Riparian forests of the karst region of northeastern Italy, composed of Fraxinus angustifolia, Quercus robur, Ulmus minor, Alnus glutinosa and with an abundance of Leucojum aestivum.', 'Leucojo-Fraxinetum angustifoliae', 'Pas de description disponible'),
(10248, 'NR', 22, '44.432', '', '', 'Hellenic ash-oak-alder forests', '', 5, 'Niveau 5', 4558, '/68/515/1396/4558/10248', 'false', 'Rare mixed riparian forests of northern Greece, dominated by Quercus robur and Fraxinus angustifolia, represented, in particular, by the remarkable Mouries forest in the Kilkis prefectorate.', '', 'Pas de description disponible'),
(10249, 'NR', 22, '45.214', '', '', 'Central Italian cork-oak forests', '', 5, 'Niveau 5', 4552, '/68/517/1397/4552/10249', 'false', 'Very local, relict coastal forests of Toscany and Latium in which Q. ilex often accompanies Q. suber.', '', 'Pas de description disponible'),
(10250, 'NR', 22, '45.215', '', '', 'Southern Italian cork-oak forests', '', 5, 'Niveau 5', 4552, '/68/517/1397/4552/10250', 'false', 'Very local formations of Calabria, Puglia and of northern and southeastern Sicily (Monte Scorace; Bosco di San Pietro, western Iblei), for the most part very degraded.', '', 'Pas de description disponible'),
(10251, 'NR', 22, '45.216', 'Suberaies catalano-pyrénéennes', '', 'Catalan cork-oak woodland', '', 5, 'Niveau 5', 4552, '/68/517/1397/4552/10251', 'true', 'Quercus suber-dominated facies appearing on the more oligotrophic soils within the meso-Mediterranean Q. ilex zone of Catalonia and the Pyrenean foothills.', '', 'Faciès dominé par Quercus suber apparaissant sur les sols les plus oligotrophes de la zone méditerranéenne à Quercus ilex de Catalogne et des contreforts pyrénéens.'),
(10252, 'NR', 22, '45.217', '', '', 'Valencian cork-oak woodland', '', 5, 'Niveau 5', 4552, '/68/517/1397/4552/10252', 'false', 'Isolated, relict formations of the Sierra Espadan, Valencia.', 'Asplenio onopteridis-Quercetum suberis', 'Pas de description disponible'),
(10253, 'NR', 22, '45.218', '', '', 'Balearic cork-oak woodland', '', 5, 'Niveau 5', 4552, '/68/517/1397/4552/10253', 'false', 'Quercus suber-dominated facies appearing on deep siliceous soils of the thermo-Mediterranean Q. rotundifolia formations of Menorca.', '', 'Pas de description disponible'),
(10254, 'NR', 22, '45.221', '', '', 'Thermo-Mediterranean cork-oak woodland', '', 5, 'Niveau 5', 4560, '/68/517/1397/4560/10254', 'false', 'Subhumid thermo-Mediterranean forests and woodlands of the southwestern Iberian peninsula, occurring in sandy coastal areas of western Andalusia and the Algarve, as well as at lower elevations of the sierras of the Campo de Gibraltar, immediately below the following formation, and characterized by the presence of Olea europaea ssp. sylvestris and other thermo-Mediterranean elements.', 'Oleo sylvestris-Quercetum suberis', 'Pas de description disponible'),
(10255, 'NR', 22, '45.222', '', '', 'Aljibian cork-oak forests', '', 5, 'Niveau 5', 4560, '/68/517/1397/4560/10255', 'false', 'Luxuriant, fully developed, humid and hyperhumid meso- to thermo-Mediterranean forests occupying, with the more exiguous and even more umbrophilous Q. canariensis formations, the higher elevations of the sierras of the Campo de Gibraltar and a few enclaves of the Sierra de Ronda, with elements of north African oak forests such as Teucrium scorodonia ssp. baeticum and Ruscus hypophyllum; they are best represented in the Sierra de Aljibe, and are, next to those of Sardinia, the best-preserved cork-oak forests of the Community.', 'Teucrio baetici-Quercetum suberis', 'Pas de description disponible'),
(10256, 'NR', 22, '45.223', '', '', 'Eastern Andalusian cork-oak woodland', '', 5, 'Niveau 5', 4560, '/68/517/1397/4560/10256', 'false', 'Isolated, relict meso-Mediterranean forest of the Sierra de la Contraviesa, eastern Andalusia.', 'Adenocarpo-Quercetum suberis', 'Pas de description disponible'),
(10257, 'NR', 22, '45.224', '', '', 'Extremaduran cork-oak woodland', '', 5, 'Niveau 5', 4560, '/68/517/1397/4560/10257', 'false', 'Meso-Mediterranean forests of the Sierra Morena, the Montes de Toledo system and lower southern slopes of the Cordillera Central (Extremadura and surrounding regions), only locally well developed, with lauriphyllous undergrowth or mantle.', 'Sanguisorbo agrimonioidis-Quercetum suberis', 'Pas de description disponible'),
(10258, 'NR', 22, '45.631', '', '', 'Laurisilvas of La Gomera', '', 5, 'Niveau 5', 4565, '/68/517/1394/4565/10258', 'false', 'Laurel forests of La Gomera, best preserved and most extensive of the archipelago, with large areas of humid Persea indica - Laurus azorica forests (Lauro-Perseetum indicae), particularly in high areas, and good examples of Ocotea foetens - dominated forests, hyperhumid and very rich in ferns and epiphytes (Athyrio-Ocoteetum foetentis).', '', 'Pas de description disponible'),
(10259, 'NR', 22, '42.912', '', '', 'La Palma pine-rockrose forests', '', 5, 'Niveau 5', 4556, '/68/491/1398/4556/10259', 'false', 'Pine forests of La Palma, with Lotus hillebrandii (Loto hillebrandii-Pinetum canariensis cistetosum).', '', 'Pas de description disponible'),
(10260, 'NR', 22, '42.913', '', '', 'Gran Canaria pine-rockrose forests', '', 5, 'Niveau 5', 4556, '/68/491/1398/4556/10260', 'false', 'Pine forests of Gran Canaria, with Cistus symphytifolius var. leucophyllus and Lotus spartioides; they are the main habitat of the threatened Dendrocopos major thanneri and Fringilla teydea polatzeki.', '', 'Pas de description disponible'),
(10261, 'NR', 22, '42.914', '', '', 'Hierro pine-rockrose forests', '', 5, 'Niveau 5', 4556, '/68/491/1398/4556/10261', 'false', 'Pine forests of Hierro, with Lotus hillebrandii.', '', 'Pas de description disponible'),
(10262, 'NR', 22, '42.921', '', '', 'Tenerife pine-dry scrub woods', '', 5, 'Niveau 5', 4566, '/68/491/1398/4566/10262', 'false', '', '', 'Pas de description disponible'),
(10263, 'NR', 22, '42.922', '', '', 'La Palma pine-dry scrub woods', '', 5, 'Niveau 5', 4566, '/68/491/1398/4566/10263', 'false', '', '', 'Pas de description disponible'),
(10264, 'NR', 22, '42.923', '', '', 'Gran Canaria pine-dry scrub woods', '', 5, 'Niveau 5', 4566, '/68/491/1398/4566/10264', 'false', '', '', 'Pas de description disponible'),
(10265, 'NR', 22, '42.924', '', '', 'Hierro pine-dry scrub woods', '', 5, 'Niveau 5', 4566, '/68/491/1398/4566/10265', 'false', '', '', 'Pas de description disponible'),
(10266, 'NR', 22, '42.931', '', '', 'Tenerife pine-heath forests', '', 5, 'Niveau 5', 4567, '/68/491/1398/4567/10266', 'false', '', '', 'Pas de description disponible'),
(10267, 'NR', 22, '42.932', '', '', 'La Palma pine-heath forests', '', 5, 'Niveau 5', 4567, '/68/491/1398/4567/10267', 'false', '', '', 'Pas de description disponible'),
(10268, 'NR', 22, '42.933', '', '', 'Gran Canaria pine-heath forests', '', 5, 'Niveau 5', 4567, '/68/491/1398/4567/10268', 'false', 'Formations of Gran Canaria, harbouring the endemic Micromeria pineolens.', '', 'Pas de description disponible'),
(9932, 'NR', 22, '36.373', 'Pelouses alpines corses des adrets', '', 'Corsican alpine adret grasslands', '', 5, 'Niveau 5', 4270, '/67/495/1297/4270/9932', 'true', 'Open grasslands of adrets and crests of the alpine level of high Corsican mountains with Bellardiochloa violacea and many endemics including Erigeron paolii, Leucanthemopsis alpina ssp. tomentosa, Draba loiseleurii, Acinos corsicus, Myosotis corsicana.', '', 'Pelouses ouvertes des crêtes et des adrets de l\'étage alpin des hautes montagnes corses avec Bellardiochloa variegeta et de nombreuses endémiques incluant Erigeron paolii, Leucanthemopsis alpina subsp. tomentosa, Draba loiseleurii, Acinos corsicus, Myosotis corsicana.'),
(9933, 'NR', 22, '37.714', 'Communautés riveraines à Pétasites', '', 'Butterbur riverine communities', '', 5, 'Niveau 5', 4321, '/67/496/1294/4321/9933', 'true', 'Formations of Petasites hybridus and Cirsium oleraceum of the banks of small streams.', '', 'Formations à Petasites hybridus et Cirsium oleraceum des berges de petits cours d\'eau.'),
(9934, 'NR', 22, '37.715', 'Ourlets riverains mixtes', '', 'Mixed riverine screens', '', 5, 'Niveau 5', 4321, '/67/496/1294/4321/9934', 'true', 'Formations of Senecio fluviatilis, Calystegia sepium, Eupatorium cannabinum, Epilobium hirsutum, Sonchus palustris, Urtica dioica and other species, lining lowland water courses.', '', 'Formations à Senecio fluviatilis, Calystegia sepium, Eupatorium cannabinum, Epilobium hirsutum, Sonchus palustris, Urtica dioica et d\'autres espèces, longeant les cours d\'eau de plaine.'),
(9935, 'NR', 22, '34.331', '', '', 'British Xerobromion grasslands', '', 5, 'Niveau 5', 4269, '/67/490/1236/4269/9935', 'false', 'Very rare, local formations of Devon and Somerset.', '', 'Pas de description disponible');
INSERT INTO `corine` (`CD_HAB`, `FG_VALIDITE`, `CD_TYPO`, `LB_CODE`, `LB_HAB_FR`, `LB_HAB_FR_COMPLET`, `LB_HAB_EN`, `LB_AUTEUR`, `NIVEAU`, `LB_NIVEAU`, `CD_HAB_SUP`, `PATH_CD_HAB`, `FRANCE`, `LB_DESCRIPTION`, `CRSP_PHYTO_CB91`, `DESCRIPTIF_CB97_FR`) VALUES
(9936, 'NR', 22, '34.332', 'Pelouses médio-européennes du Xerobromion', '', 'Middle European Xerobromion grasslands', '', 5, 'Niveau 5', 4269, '/67/490/1236/4269/9936', 'true', 'Formations of southern Belgium, Germany, France, northern Spain and the northern Apennines. Where they occur in the vicinity of communities of the Festucetalia valesiacae, the latter occupy cites with more continental microclimates than those inhabited by the formations of this group.', '', 'Formations de la France. Quand elles viennent au contact avec les communautés des Festucetalia valesiacae, ces dernières occupent les sites marqués par des climats continentaux plus accusés que ceux habités par les formations de ce groupe.'),
(9937, 'NR', 22, '36.374', 'Pelouses alpines des ubacs corses', '', 'Corsican alpine ubac grasslands', '', 5, 'Niveau 5', 4270, '/67/495/1297/4270/9937', 'true', 'Dense grasslands of ubacs of the alpine level of high Corsican mountains with Phleum brachystachyum, Geum montanum, Sibbaldia procumbens, Veronica alpina.', '', 'Pelouses denses des ubacs de l\'étage alpin des hautes montagnes corses avec Phleum parviceps, Geum montanum, Sibbaldia procumbens, Veronica alpina.'),
(9938, 'NR', 22, '36.381', '', '', 'Subalpine southern Italian mat-grass swards', '', 5, 'Niveau 5', 4276, '/67/495/1297/4276/9938', 'false', 'Subalpine representative of the montane southern Italian mat-grass swards of 35.72, characteristic of karstic depressions at the highest altitudes of Pollino.', 'Ranunculo-Nardion p.', 'Pas de description disponible'),
(9939, 'NR', 22, '36.382', '', '', 'Central Apennine closed grasslands', '', 5, 'Niveau 5', 4276, '/67/495/1297/4276/9939', 'false', 'Dense, closed, unsculptured, hygrophilous or chionophilous turfs of often deep soils over siliceous or calcareous substrates of the subalpine and alpine levels (mostly 1800 to 2100 metres) of the central Apennines; they develop on colluvions, on damp soils of seeps or poorly drained areas, on moisture-retaining slopes and in depressions and other situations where snow lingers. Characteristic species include Nardus stricta, Festuca violacea ssp. macrathera, Bellardiochloa (Poa) violacea, Phleum alpinum, Poa alpina, Luzula bulgarica, Carex laevis, Ranunculus montanus, R. oreophilus, Viola eugeniae, Dianthus deltoides, Potentilla crantzii, P. aurea, Geum montanum, Trifolium thalii, Anthyllis vulneraria ssp. vulnerarioides s. l., Crepis aurea, Plantago montana, P. serpentina, Erigeron uniflorus, E. epiroticus, Alchemilla colorata, Hieracium auricula, Armeria majellensis, Minuartia verna, Galium pumilum, Campanula scheuchzeri, Gentiana verna, G. nivalis, G. campestris var. neapolitana, G. lutea, Saxifraga adscendens, Gnaphalium hoppeanum, Euphrasia salisburgensis, Vaccinium myrtillus, Nigritella widderi, Coeloglossum viride, Botrychium lunaria. Closed grasslands occur over both siliceous and calcareous substrates; on the latter their formation is usually accompanied by a decalcification of the topsoil linked to the hygric conditions necessary for their existence, and they may evolve into Vaccinium myrtillus dwarf heaths (31.4A). Thus, formations on siliceous and calcareous terrain are physiognomically similar, share many species and often grade into each other. Nardus stricta is present and often dominant in the more acidophilous variants, Festuca violacea ssp. macrathera and Trifolium thalii in the more basiphilous ones. All may be conveniently referred here, though clearly calcicolous extremes may also, by analogy with similar Alpine formations, be listed under 36.41, as unit 36.4143.', '', 'Pas de description disponible'),
(9940, 'NR', 22, '41.111', 'Hêtraies collinéennes à Luzule', '', 'Collinar woodrush beech forests', '', 5, 'Niveau 5', 4288, '/68/492/1278/4288/9940', 'true', 'Beech forests of the lesser Hercynian ranges and Lorraine, never accompanied by spontaneous conifers.', '', 'Hêtraies des massifs hercyniens mineurs et de Lorraine, jamais accompagnées par des conifères spontanés.'),
(9941, 'NR', 22, '41.112', 'Hêtraies montagnardes à Luzule', '', 'Montane woodrush beech forests', '', 5, 'Niveau 5', 4288, '/68/492/1278/4288/9941', 'true', 'Beech, beech-fir or beech-fir-spruce (43.112) of the greater Hercynian ranges, the Jura, the Alps and the Bavarian Plateau.', '', 'Hêtraies, hêtraies-sapinières ou hêtraies-sapinières-pessières (43.112) des massifs hercyniens, du Jura, des Alpes.'),
(9942, 'NR', 22, '34.341', 'Pelouses sur rochers calcaréo-siliceux', '', 'Calcaro-siliceous rock grasslands', '', 5, 'Niveau 5', 4290, '/67/490/1236/4290/9942', 'true', 'Rupicolous communities, colonizing in particular deep cracks and ledges of calcaro-siliceous rocky slopes or cliffs, with, notably, Festuca heteropachys, Artemisia campestris, Aster linosyris, Lychnis viscaria, Potentilla rupestris. The range of these formations is centered on the Hercynian ranges of middle Germany (notably Rhine, Nahe, Moselle, Mainz valleys and Hartz periphery), extending west to Alsace and to extremely rare and isolated outposts in Ardenne valleys of Luxembourg, Belgium and France, where they are represented by Festuca heteropachys or Potentilla rupestris grasslands.', '', 'Groupements rupicoles, colonisant en particulier les saillies et anfractuosités profondes des falaises ou pentes rocheuses calcaréo-siliceuses, avec notamment, Festuca heteropachys, Artemisia campestris, Aster linosyris, Silene viscaria, Potentilla rupestris. Leur aire de distribution est centrée sur la zone hercynienne de l\'Allemagne (notamment vallées du Rhin, de la Moselle, ...), avec des extensions vers l\'ouest en Alsace et en de très rares stations isolées des vallées ardennaises de la France, du Luxembourg, de Belgique, où elles sont représentées par des pelouses à Festuca heteropachys ou Potentilla rupestris.'),
(9943, 'NR', 22, '34.342', 'Pelouses sur sables légèrement calcaires', '', 'Slightly calcareous sands grasslands', '', 5, 'Niveau 5', 4290, '/67/490/1236/4290/9943', 'true', 'Closed, perennial communities of slightly calcareous sands, in particular of old riverine dunes, with Armeria elongata, Sedum sexangulare, Carex ligerica, Helichrysum arenaria. Mostly characteristic of central Europe, these formations extend west to the fluviatile district of the Netherlands.', '', 'Groupements pérennes fermés, des sables légèrement calcaires, en particulier sur de vieilles dunes fluviales, avec Armeria elongata, Sedum sexangulare, Carex ligerica, Helichrysum arenaria. Principalement caractéristiques de l\'Europe centrale, ces formations s\'étendent à l\'ouest jusqu\'au district fluviatile des Pays-Bas.'),
(9944, 'NR', 22, '36.411', 'Pelouses mésophiles à laîche sempervirente', '', 'Mesophile evergreen sedge grasslands', '', 5, 'Niveau 5', 4287, '/67/495/1277/4287/9944', 'true', 'Mesophile grasslands of the southwestern Alps and the Pyrenees, occupying gentle ubac slopes and humid flats on deep, often slightly acid, soils over calcareous substrates, with Sesleria albicans, Carex sempervirens, Helictotrichon montanum, Arenaria ciliata, Draba aizoides, Globularia nana, Geranium cinereum, Ranunculus gouani, R. thora, Primula elatior ssp. intricata, Oxytropis triflora, Trifolium thalii, Anthyllis vulneraria ssp. pyrenaica, Alchemilla plicatula (A. asterophylla), Adonis pyrenaica, Horminium pyrenaicum, Geum pyrenaicum, Bartsia spicata, B. alpina, Scabiosa cinerea, Leuzea centauroides (Rhaponticum cynaroides), Fritillaria delphinensis, F. burnati, Crocus vernus, Bulbocodium vernum, Carex tendae, Salix pyrenaica.', 'Primulion intricatae p., Laserpitio-Ranunculion thorae', 'Pelouses mésophiles du sud-ouest des Alpes et des Pyrénées, occupant des versants d\'ubac en pente douce et des replats humides sur sols profonds, souvent légèrement acides, sur des substrats calcaires, avec Sesleria albicans, Carex sempervirens, Helictotrichon montanum, Arenaria ciliata, Draba aizoides, Globularia nana, Geranium cinereum, Ranunculus gouani, R. thora, Primula elatior subsp. intricata, Trifolium thalii, Anthyllis vulneraria subsp. bosaii, Alchemilla plicatula (A. asterophylla), Adonis pyrenaica, Horminum pyrenaicum, Geum pyrenaicum, Nothobartsia spicata, N. alpina, Scabiosa cinerea, Stemmacantha centauroides (Rhaponticum cynaroides), Fritillaria tubiformis, F. meleagis subsp. burnati, Crocus vernus, Bulbocodium vernum, Carex ferruginea subsp. tenax, Salix pyrenaica.'),
(9622, 'NR', 22, '32.2A2', '', '', 'Guadalquivir xero-psammitic brushes', '', 5, 'Niveau 5', 4057, '/67/488/1225/4057/9622', 'false', 'Somewhat transitional formations of inland sands of the Guadalquivir valley with Halimium viscosum, Genista hirsuta, Cistus crispus and elements of thermo-Mediterranean brushes.', 'Halimio commutati-Cistetum bourgaeani', 'Pas de description disponible'),
(9623, 'NR', 22, '32.2A3', '', '', 'Algarve xero-psammitic brushes', '', 5, 'Niveau 5', 4057, '/67/488/1225/4057/9623', 'false', 'Very local formation of the Algarve coast with Lavandula stoechas ssp. lusitanica, Armeria macrophylla and the extremely narrow endemic Ulex argenteus ssp. subsericeus.', 'Ulici subsericei-Cistetum bourgaeani', 'Pas de description disponible'),
(9624, 'NR', 22, '32.2A4', '', '', 'Lusitanian xero-psammitic brushes', '', 5, 'Niveau 5', 4057, '/67/488/1225/4057/9624', 'false', 'Formations of sands of the Atlantic coast of Portugal with Helichrysum italicum and Corema album.', 'Helichryso angustifolii-Stauracanthetum genistoides', 'Pas de description disponible'),
(9625, 'NR', 22, '32.2B1', '', '', 'Cabo de São Vicente Teucrium-Armeria garrigue', '', 5, 'Niveau 5', 4058, '/67/488/1225/4058/9625', 'false', 'Very low, open garrigue of Teucrium polium ssp. vincentinum, Armeria pungens, Helichrysum italicum, Asteriscus maritimus of the windswept, karstic tableland of Cabo de Sao Vicente.', '', 'Pas de description disponible'),
(9626, 'NR', 22, '32.2B2', '', '', 'Cabo de São Vicente juniper brush', '', 5, 'Niveau 5', 4058, '/67/488/1225/4058/9626', 'false', 'Dwarf, prostrate Juniperus phoenicea ssp. lycia brush with Cistus palhinhae, Biscutella vincentina, Teucrium polium ssp. vincentinum, Antirrhinum majus ssp. cirrhigerum, Armeria pungens, Iberis procumbens, Cerinthe major ssp. gymnandra.', '', 'Pas de description disponible'),
(9627, 'NR', 22, '32.2B3', '', '', 'Cabo de São Vicente Cistus palhinhae fields', '', 5, 'Niveau 5', 4058, '/67/488/1225/4058/9627', 'false', 'Cistus fields formed by the spectacular, large-flowered, lustrous-leaved, low Cistus palhinhae, endemic to these communities.', '', 'Pas de description disponible'),
(9628, 'NR', 22, '32.2B4', '', '', 'Cabo de São Vicente Ulex garrigue', '', 5, 'Niveau 5', 4058, '/67/488/1225/4058/9628', 'false', 'Formations of Ulex argenteus ssp. erinaceus, restricted endemic found only in this community and that of Cabo de Gata (32.2563), with Cistus crispus, C. palhinhae, C. salvifolius, Armeria pungens, Teucrium polium ssp. vincentinum, Thymus camphoratus.', '', 'Pas de description disponible'),
(9629, 'NR', 22, '32.2B5', '', '', 'Cabo de São Vicente Genista-Thymus garrigue', '', 5, 'Niveau 5', 4058, '/67/488/1225/4058/9629', 'false', 'Phrygana-like formations of Genista hirsuta and Thymus, with Cistus salvifolia, Phlomis purpurea, Ophrys ciliata, Serapias strictiflora.', '', 'Pas de description disponible'),
(9630, 'NR', 22, '32.257', '', '', 'Arid garrigues', '', 5, 'Niveau 5', 4043, '/67/488/1225/4043/9630', 'false', 'Low, open garrigues, often of steppic character, occupying mostly skeletal soils of the arid Iberian Southeast.', 'Anthyllidetalia terniflorae: Thymo-Siderition leucanthae, Anthyllido-Salsolion papillosae', 'Pas de description disponible'),
(9631, 'NR', 22, '32.261', '', '', 'Iberian retama brush', '', 5, 'Niveau 5', 4060, '/67/488/1225/4060/9631', 'false', 'Thermo-, meso- and, locally, lower supra-Mediterranean Lygos sphaerocarpa formations of the Ebro basin, the Meseta, the Iberian Range, the Central Cordillera, Extremadura and eastern Portugal, the Baetic and sub-Baetic mountains, in which the retama either forms pure, often very open, stands or associates with various brooms such as Cytisus multiflorus, C. scoparius or Adenocarpus decorticans.', 'Genisto scorpii-Retametum, Cytiso multiflorae-Retametum, Cytiso scoparii-Retametum, Retamo-Adenocarpetum decorticantis', 'Pas de description disponible'),
(9632, 'NR', 22, '32.262', '', '', 'Lusitanian retama brush', '', 5, 'Niveau 5', 4060, '/67/488/1225/4060/9632', 'false', 'Lygos monosperma formations of coastal southwestern Andalusia and southern Portugal.', '', 'Pas de description disponible'),
(9633, 'NR', 22, '32.263', '', '', 'Genista speciosa broom fields', '', 5, 'Niveau 5', 4060, '/67/488/1225/4060/9633', 'false', 'Tall, open formations dominated by or rich in the endemic Genista cinerea spp. speciosa, with Phlomis purpurea ssp. purpurea, Ulex parviflorus ssp. willkommii, Cronanthus biflorus, Ptilostemon hispanicus, and, sometimes, Lavandula lanata, Catananche coerulea, Teucrium polium, Salvia candelabrum or Satureja graeca, of the lower meso-Mediterranean slopes of hills facing the Guadalquivir depression of eastern Andalusia.', 'Phlomidetalia purpureae: Ulici-Genistetum speciosae', 'Pas de description disponible'),
(9634, 'NR', 22, '32.264', '', '', 'Genista valentina broom fields', '', 5, 'Niveau 5', 4060, '/67/488/1225/4060/9634', 'false', 'Formations of the arid Iberian South-east dominated by the endemic Genista valentina, accompanied by Lygos sphaerocarpa or, in the Sierra de Cartagena area, Calicotome infesta spp. intermedia.', 'Genisto-Phlomidion almeriensis: Genisto valentinae-Calicotometum intermediae, Retamo sphaerocarpae-Genistetum valentinae', 'Pas de description disponible'),
(9635, 'NR', 22, '32.343', 'Maquis à Cistus populifolius', '', 'Cistus populifolius maquis', '', 5, 'Niveau 5', 4076, '/67/488/1226/4076/9635', 'true', 'Formations dominated by Cistus populifolius, often taller, mainly of cooler, moister, shadier, siliceous or serpentine stations of the meso-Mediterranean zone of the southern half of the Iberian peninsula, in particular of Portugal, Extremadura, the Sierra Morena, the Montes de Toledo, the Iberian Range system, the mountains of Andalusia Occidental, entering in several areas into the supra- or thermo- Mediterranean zones and extending north locally to northern Iberia and Languedoc.', '', 'Formations dominées par Cistus populifolius, souvent plus grandes, principalement des stations plus fraîches, plus humides, plus ombragées, sur substrats siliceux ou sur serpentine de l\'étage méso-méditerranéen de la moitié sud de la péninsule Ibérique, entrant pour plusieurs régions dans les étages supra- et thermo-méditerranéens et s\'étendant localement au Languedoc.'),
(9636, 'NR', 22, '32.344', 'Maquis à Cistus laurifolius', '', 'Cistus laurifolius maquis', '', 5, 'Niveau 5', 4076, '/67/488/1226/4076/9636', 'true', 'Formations dominated by Cistus laurifolius, often also of medium height, widespread on siliceous or decalcified soils in meso- and supra-Mediterranean Iberia, particularly in the Quercus pyrenaica realm, extending to the montane zone of the Pyrenees, and locally to sub-Mediterranean areas of the southern Central Massif and the southwestern Alps.', 'Cistion laurifolii p. i.a.', 'Formations dominées par Cistus laurifolius, souvent aussi de taille moyenne, largement répandues sur les sols siliceux ou décalcifiés de l\'Espagne méso- et supraméditerranéenne, particulièrement dans le domaine de Quercus pyrenaica, s\'étendant jusqu\'à la zone montagnarde des Pyrénées, et localement à la région subméditerranéenne du sud du Massif central et du sud-ouest des Alpes.'),
(9637, 'NR', 22, '32.345', '', '', 'Cistus psilosepalus maquis', '', 5, 'Niveau 5', 4076, '/67/488/1226/4076/9637', 'false', 'Formations dominated by Cistus psilosepalus of moist, lime-free soils of the western half of the Iberian peninsula, usually associated with southern heath elements, within the Atlantic influence, frequently located in depressions and gullies.', 'Ericenion umbellatae: Halimio ocymoidis-Cistetum psilosepali p.', 'Pas de description disponible'),
(9638, 'NR', 22, '32.346', 'Maquis à Cistus crispus', '', 'Cistus crispus maquis', '', 5, 'Niveau 5', 4076, '/67/488/1226/4076/9638', 'true', 'Formations of southern and eastern Iberia, southern France and western Sicily dominated by Cistus crispus.', '', 'Formations du sud de la France dominées par Cistus crispus.'),
(9639, 'NR', 22, '32.347', 'Maquis à Cistus creticus', '', 'Cistus incanus maquis', '', 5, 'Niveau 5', 4076, '/67/488/1226/4076/9639', 'true', 'Cistus incanus (including ssp. corsicus and ssp. creticus) formations of the Balearics, Corsica, Sardinia, Sicily and peninsular Italy.', '', 'Formations à Cistus creticus subsp. corsicus de la Corse.'),
(9640, 'NR', 22, '32.348', 'Maquis à Cistus albidus', '', 'Cistus albidus maquis', '', 5, 'Niveau 5', 4076, '/67/488/1226/4076/9640', 'true', 'Silicicolous formations with Cistus albidus. Most C. albidus formations have a pronounced garrigue character and should be listed under 32.4; however, some may be accompanied by a cortège so typical of silicolous maquis that they are better retained here.', '', 'Formations silicicoles avec Cistus albidus. La plupart des formations à C. albidus ont un caractère prononcé de garrigue et devrait être listées sous 32.4 ; cependant, certaines peuvent être accompagnées d\'un cortège tellement typique de maquis silicole qu\'elles sont plutôt à garder ici.'),
(9641, 'NR', 22, '32.351', 'Maquis centraux méditerranéens à lavande', '', 'Central Mediterranean lavender maquis', '', 5, 'Niveau 5', 4061, '/67/488/1226/4061/9641', 'true', 'Formations with Lavandula stoechas ssp. stoechas of northeastern Iberia, France, Italy and the west Mediterranean islands.', 'Calicotomo-Cistion ladaniferi p.', 'Formations avec Lavandula stoechas subsp. stoechas de la France, … .'),
(9642, 'NR', 22, '32.352', '', '', 'Central Iberian lavender maquis', '', 5, 'Niveau 5', 4061, '/67/488/1226/4061/9642', 'false', 'Formations of central Iberia with Lavandula stoechas ssp. pedemontana.', 'Cistion laurifolii p.', 'Pas de description disponible'),
(9643, 'NR', 22, '32.353', '', '', 'Western Iberian lavender maquis', '', 5, 'Niveau 5', 4061, '/67/488/1226/4061/9643', 'false', 'Formations of western Iberia with Lavandula stoechas ssp. luisieri or L. stoechas ssp. sampaiana.', 'Ulici argentei-Cistion ladaniferi p.', 'Pas de description disponible'),
(9644, 'NR', 22, '32.371', '', '', 'Genista hystrix maquis', '', 5, 'Niveau 5', 4063, '/67/488/1226/4063/9644', 'false', 'Formations, widespread in northwestern areas of the Iberian peninsula, with Genista hystrix.', '', 'Pas de description disponible'),
(10269, 'NR', 22, '42.934', '', '', 'Hierro pine-heath forests', '', 5, 'Niveau 5', 4567, '/68/491/1398/4567/10269', 'false', 'Formations of Hierro, harbouring the almost extinct Adenocarpus ombriosus.', '', 'Pas de description disponible'),
(10270, 'NR', 22, '42.941', '', '', 'Tenerife pine-broom woods', '', 5, 'Niveau 5', 4568, '/68/491/1398/4568/10270', 'false', 'Formations of Tenerife, with Adenocarpus viscosus var. viscosus.', '', 'Pas de description disponible'),
(10271, 'NR', 22, '42.942', '', '', 'La Palma pine-broom woods', '', 5, 'Niveau 5', 4568, '/68/491/1398/4568/10271', 'false', 'Formations of La Palma, with Adenocarpus viscosus var. spartioides.', '', 'Pas de description disponible'),
(10272, 'NR', 22, '42.951', '', '', 'Tenerife pine-juniper woods', '', 5, 'Niveau 5', 4569, '/68/491/1398/4569/10272', 'false', 'Formations of the edges of Las Canadas del Teide.', '', 'Pas de description disponible'),
(10273, 'NR', 22, '42.952', '', '', 'La Palma pine-juniper woods', '', 5, 'Niveau 5', 4569, '/68/491/1398/4569/10273', 'false', 'Formations of the summits of La Palma.', '', 'Pas de description disponible'),
(10274, 'NR', 22, '42.A11', '', '', 'Cypress forests of Crete', '', 5, 'Niveau 5', 4570, '/68/491/1400/4570/10274', 'false', 'Cupressus sempervirens and C. sempervirens-Pinus brutia forests of Crete occupying a wide altitudinal range, but a restricted geographical area, in the White Mountains (notably Samaria) with outposts in the Idi and Dikti mountains. Tall, closed, luxuriant forests exist, with cypresses up to 30 metres, as well as more open stands. Accompanying the cypress and Pinus brutia may be Quercus coccifera, Acer sempervirens, Zelkova abelicea.', '', 'Pas de description disponible'),
(10275, 'NR', 22, '44.511', '', '', 'Iberian meso-Mediterranean alder galleries', '', 5, 'Niveau 5', 4571, '/68/515/1399/4571/10275', 'false', 'Meso-Mediterranean Alnus glutinosa riparian galleries of southern Galicia, Portugal, Extremadura, the western Cordillera Central, western Castilla, with Betula celtiberica, Salix atrocinerea, Frangula alnus, Fraxinus angustifolia, Celtis australis, many lianas, Clematis campaniflora, Humulus lupulus, Vitis vinifera ssp. sylvestris and an herb layer comprising Senecio bayonensis, Galium broterianum, Scrophularia scorodonia, Osmunda regalis, Carex acuta ssp. broteriana.', 'Senecio bayonensis-Alnetum glutinosae (Scrophularia scorodoniae-Alnetum, Alneto-Scrophularietum)', 'Pas de description disponible'),
(10276, 'NR', 22, '44.512', '', '', 'Iberian supra-Mediterranean alder galleries', '', 5, 'Niveau 5', 4571, '/68/515/1399/4571/10276', 'false', 'Supra-Mediterranean Alnus glutinosa riparian galleries of water courses with moderate seasonal fluctuations, of western Iberia, with Betula celtiberica, Ilex aquifolium, Populus tremula and Luzula sylvatica ssp. henriquesii, Paris quadrifolia, Galium broterianum, Paradisea lusitanicum, Carex acuta ssp. broteriana.', 'Galio broteriani-Alnetum', 'Pas de description disponible'),
(10277, 'NR', 22, '44.513', 'Galeries d\'Aulnes méditerranéennes occidentales', '', 'Western Mediterranean alder galleries', '', 5, 'Niveau 5', 4571, '/68/515/1399/4571/10277', 'true', 'Alnus glutinosa riparian galleries of southern France and northern Italy, in particular, the Cevennes, the coasts of Liguria and northern Toscany, the Triestine karst, often with Fraxinus angustifolia.', 'Alno-Fraxinetum oxycarpae', 'Galeries riveraines d\'Alnus glutinosa du sud de la France : des Cévennes, souvent avec Fraxinus angustifolia.'),
(10278, 'NR', 22, '44.514', '', '', 'Greek alder galleries', '', 5, 'Niveau 5', 4571, '/68/515/1399/4571/10278', 'false', 'Alnus glutinosa riparian galleries along permanent water courses of noncalcareous regions of Greece, in particular, of Thessaly, the sea-facing slopes of the Pelion, the Ossa, the Pierria, the Pindus, Macedonia, Thrace, northern Euboea and the northern Peloponnese.', '', 'Pas de description disponible'),
(10279, 'NR', 22, '45.311', 'Forêts de Chênes verts ibériques nord-occidentales', '', 'North-western Iberian holm-oak forests', '', 5, 'Niveau 5', 4573, '/68/517/1401/4573/10279', 'true', 'Quercus ilex forests with exuberant undergrowth of Mediterranean, often lauriphyllous, small trees, shrubs, and lianas, including Laurus nobilis, Rhamnus alaternus, Arbutus unedo, Phillyrea media, Rosa sempervirens, Rubia peregrina, Smilax aspera, Hedera helix, often well-preserved on steep slopes of the calcareous mountains rising above the southern coast of the Bay of Biscay.', 'Lauro nobilis-Quercetum ilicis', 'Forêts de Quercus ilex avec un sous-bois exubérant composé de petits arbres, d\'arbustes et des lianes, méditerranéennes, souvent lauriphylles, comprenant Laurus nobilis, Rhamnus alaternus, Arbutus unedo, Phillyrea media, Rosa sempervirens, Rubia peregrina, Smilax aspera, Hedera helix. Elles sont souvent bien conservées sur des versant abrupts de montagnes calcaires s\'élevant au-dessus de la côte méridionale du golfe de Gascogne.'),
(10280, 'NR', 22, '51.141', 'Tourbières à Narthecium', '', 'Bog asphodel seeps', '', 5, 'Niveau 5', 4547, '/71/518/1404/4547/10280', 'true', 'Narthecium ossifragum colonies in seep rivulets, mostly characteristic of western bogs.', '', 'Colonies de Narthecium ossifragum des rigoles de suintement, généralement caractéristiques des tourbières occidentales.'),
(10281, 'NR', 22, '51.142', 'Rigoles à Myrte des marais', '', 'Bog myrtle soaks', '', 5, 'Niveau 5', 4547, '/71/518/1404/4547/10281', 'true', 'Myrica gale thickets of Atlantic raised bog soaks.', '', 'Fourrés à Myrica gale des chenaux des tourbières bombées atlantiques.'),
(10282, 'NR', 22, '51.143', 'Autres communautés des rigoles et chenaux de tourbières', '', 'Other bog soak and runoff gulley communities', '', 5, 'Niveau 5', 4547, '/71/518/1404/4547/10282', 'true', '', '', 'Pas de description disponible'),
(10283, 'NR', 22, '42.A12', '', '', 'Cypress forests of Rhodes', '', 5, 'Niveau 5', 4570, '/68/491/1400/4570/10283', 'false', 'Cupressus sempervirens and C. sempervirens-Pinus brutia forests of Rhodes, represented on most mountain ranges and locally at lower altitudes.', '', 'Pas de description disponible'),
(10284, 'NR', 22, '42.A13', '', '', 'Cypress woodland of Syme', '', 5, 'Niveau 5', 4570, '/68/491/1400/4570/10284', 'false', 'Cupressus sempervirens formations of Syme, rather open and with impoverished undergrowth.', '', 'Pas de description disponible'),
(10285, 'NR', 22, '42.A14', '', '', 'Cypress woodland of Kos', '', 5, 'Niveau 5', 4570, '/68/491/1400/4570/10285', 'false', 'Cupressus sempervirens forest remnants of middle elevations of Kos.', '', 'Pas de description disponible'),
(10286, 'NR', 22, '42.A15', '', '', 'Cypress woodland of Samothrace', '', 5, 'Niveau 5', 4570, '/68/491/1400/4570/10286', 'false', 'Cupressus sempervirens formations of steep slopes of the southeastern side of Samothrace.', '', 'Pas de description disponible'),
(10287, 'NR', 22, '42.A21', '', '', 'Iberian Spanish juniper forests', '', 5, 'Niveau 5', 4576, '/68/491/1400/4576/10287', 'false', 'Juniperus thurifera forests on calcareous substrates in the supra- Mediterranean levels of the Iberian Range and neighbouring plateaux, dispersed throughout the entire system, in an arc extending from the province of Burgos to the Serrania de Cuenca and the mountains of Teruel; these constitute the main range of the species. Pinus sylvestris and P. salzmannii may accompany the juniper; Juniperus hemisphaerica and Berberis hispanica may be common in the undergrowth.', 'Juniperetum hemisphaerico-thuriferae, Junipero thuriferae-Quercetum rotundifoliae p.', 'Pas de description disponible'),
(10288, 'NR', 22, '42.A22', '', '', 'Guadarraman Spanish juniper woods', '', 5, 'Niveau 5', 4576, '/68/491/1400/4576/10288', 'false', 'Relict Juniperus thurifera woods of enclaves on the periphery of and within the Sierra de Guadarrama, occurring both on rare local limestone deposits and in a few siliceous stations.', 'Juniperetum hemisphaerico-thuriferae p.', 'Pas de description disponible'),
(10289, 'NR', 22, '42.A23', '', '', 'Cantabrian Spanish juniper woods', '', 5, 'Niveau 5', 4576, '/68/491/1400/4576/10289', 'false', 'Relict, open Juniperus thurifera woodlands of dry, warm, rocky, calcareous southern slopes of the Cordillera Cantabrica, between the Rio Pisuerga and the Rio Luna, with Juniperus nana, J. sabina, Berberis vulgaris ssp. cantabrica, Rhamnus alpinus, Viburnum lantana.', 'Juniperetum sabino-thuriferae', 'Pas de description disponible'),
(10290, 'NR', 22, '42.A24', '', '', 'Monegros Spanish juniper woods', '', 5, 'Niveau 5', 4576, '/68/491/1400/4576/10290', 'false', 'Juniperus thurifera woodlands on gypsiferous soils of the Ebro basin, with Rhamnus lycioides.', '', 'Pas de description disponible'),
(10291, 'NR', 22, '44.531', 'Galeries d\'Aulnes collinéennes corses', '', 'Collinar Corsican alder galleries', '', 5, 'Niveau 5', 4577, '/68/515/1399/4577/10291', 'true', 'Upper meso- and lower supra-Mediterranean alder galleries, with Hypericum hircinum and Erica terminalis.', '', 'Galeries d\'Aulnes du méso-méditerranéen supérieur et du supra-méditerranéen inférieur de Corse, avec Hypericum hircinum et Erica terminalis.'),
(10292, 'NR', 22, '44.532', 'Galeries d\'Aulnes montagnardes corses', '', 'Montane Corsican alder galleries', '', 5, 'Niveau 5', 4577, '/68/515/1399/4577/10292', 'true', 'Upper supra-Mediterranean and montane alder galleries, with Athyrium filix-femina and Gentiana asclepiadea.', '', 'Galeries d\'Aulnes du supra-méditerranéen supérieur, et montagnardes, avec Athyrium filix-femina et Gentiana asclepiadea.'),
(9945, 'NR', 22, '36.412', 'Pelouses à laîche ferrugineuse septentrionales', '', 'Northern rusty sedge grasslands', '', 5, 'Niveau 5', 4287, '/67/495/1277/4287/9945', 'true', 'Mesophile, often flower-rich grasslands of the northern Alps, occupying deep soils in the subalpine and lower alpine levels of the calcareous ranges, usually dominated by Carex ferruginea and with Astragalus alpinus, A. frigidus, Hedysarum hedysaroides, Lathyrus laevigatus, Astrantia major, Centaurea montana, Anemone narcissiflora, Crepis pyrenaica, C. pontana, Pedicularis foliosa, Traunsteinera globosa, Phleum hirsutum, Agrostis agrostiflora.', 'Caricion ferrugineae', 'Pelouses mésophiles, souvent riches en fleurs, des Alpes septentrionales, occupant des sols profonds dans les étages subalpin et alpin inférieur, des régions calcaires, habituellement dominées par Carex ferruginea et avec Astragalus alpinus, A. frigidus, Hedysarum hedysaroides, Lathyrus laevigatus, Astrantia major, Centaurea montana, Anemone narcissiflora, Crepis pyrenaica, C. bacconei, Pedicularis foliosa, Traunsteineria globosa, Phleum hirsutum, Agrostis agrostiflora.'),
(9946, 'NR', 22, '36.413', '', '', 'Southern rusty sedge grasslands', '', 5, 'Niveau 5', 4287, '/67/495/1277/4287/9946', 'false', 'Mesophile, flower-rich grasslands of the subalpine and lower alpine levels of the southeastern outer Alps (Insubria, Garda, Dolomites), usually dominated by Carex ferruginea, C. austroalpina or C. sempervirens with, in particular, Horminium pyrenaicum, Pedicularis gyroflexa, P. foliosa, Knautia transalpina, Astrantia major, Asphodelus albus, Traunsteinera globosa and many composites and peas.', 'Caricion austroalpinae', 'Pas de description disponible'),
(9947, 'NR', 22, '37.241', 'Pâtures à grand jonc', '', 'Tall rush pastures', '', 5, 'Niveau 5', 4295, '/67/496/1270/4295/9947', 'true', 'Rush (Juncus effusus, J. conglomeratus, J. inflexus) colonies of intensively grazed pastures.', '', 'Colonies de Jonc (Juncus effusus, J. conglomeratus, J. inflexus) des pâturages intensément pâturés.'),
(9948, 'NR', 22, '37.242', 'Pelouses à Agrostide stolonifère et Fétuque faux roseau', '', 'Creeping bent and tall fescue swards', '', 5, 'Niveau 5', 4295, '/67/496/1270/4295/9948', 'true', 'Flood swards with Agrostis stolonifera, Carex hirta, Festuca arundinacea, Juncus inflexus, Alopecurus geniculatus, Rumex crispus, Mentha longifolia, M. pulegium, Potentilla anserina, P. reptans, Ranunculus repens.', '', 'Pelouses inondées à Agrostis stolonifera, Carex hirta, Festuca arundinacea, Juncus inflexus, Alopecurus geniculatus, Rumex crispus, Mentha longifolia, M. pulegium, Potentilla anserina, P. reptans, Ranunculus repens.'),
(9949, 'NR', 22, '36.414', 'Pelouses à fétuque violette et communautés apparentées', '', 'Violet fescue swards and related communities', '', 5, 'Niveau 5', 4287, '/67/495/1277/4287/9949', 'true', 'Closed grasslands of the subalpine and lower alpine levels dominated by Festuca violacea or F. nigrescens and Trifolium thalii, developed on deep, often superficially slightly acidified, soils.', 'Caricion ferrugineae p.: Festuco-Trifolietum thalii, Primulion intricatae p.: Festuco rubrae-Trifolietum thalii', 'Pelouses denses des étages subalpin et alpin inférieur dominées par Festuca violacea ou F. nigrescens et Trifolium thalii, développées sur des sols profonds, souvent légèrement acidifiés superficiellement.'),
(9950, 'NR', 22, '36.415', '', '', 'Cantabrian thrift swards', '', 5, 'Niveau 5', 4287, '/67/495/1277/4287/9950', 'false', 'Chionophilous grasslands of deep soils, somewhat decalcified at the surface, of the subalpine, and locally of the alpine or upper montane, levels of the calcareous Cantabrian Mountains, dominated by Armeria cantabrica, Carex sempervirens, Festuca glacialis or F. gautieri, associated with Sesleria albicans, Poa alpina, P. minor, Festuca burnatii, Bellardiochloa violacea, Agrostis schleicheri, and with Anemone baldensis ssp. pavoniana, Aquilegia pyrenaica ssp. discolor, Jasione cavanillesii, Pedicularis pyrenaica ssp. fallax, Draba aizoides ssp. cantabriae, Pimpinella siifolia, Oxytropis pyrenaica, O. halleri.', 'Armerion cantabricae: Pediculari fallaci-Armerietum cantabricae', 'Pas de description disponible'),
(9951, 'NR', 22, '36.416', 'Pelouses sommitales du Jura', '', 'Jura summital swards', '', 5, 'Niveau 5', 4287, '/67/495/1277/4287/9951', 'true', 'Localized mesophile grasslands of the subalpine level of the French and Swabian Juras, with Calamagrostis varia, Laserpitium siler, L. latifolium, Dryas octopetala, Eryngium alpinum, and very locally, Carex ferruginea.', 'Caricion ferrugineae: Laserpitio-Calamagrostietum variae', 'Pelouses mésophiles localisées de l\'étage subalpin du Jura, avec Calamagrostis varia, Laserpitium siler, L. latifolium, Dryas octopetala, Eryngium alpinum, et très localement, Carex ferruginea.'),
(9952, 'NR', 22, '38.111', 'Pâturages à Ray-grass', '', 'Ryegrass pastures', '', 5, 'Niveau 5', 4300, '/67/494/1282/4300/9952', 'true', 'Relatively species-poor grasslands, dominated by Lolium perenne, often with Cynosurus cristatus.', 'Lolio-Cynosuretum cristati', 'Prairies relativement pauvres en espèces, dominées par Lolium perenne, souvent avec Cynosurus cristatus.'),
(9953, 'NR', 22, '38.112', 'Pâturages à Cynosurus-Centaurea', '', 'Cynosurus-Centaurea pastures', '', 5, 'Niveau 5', 4300, '/67/494/1282/4300/9953', 'true', 'More species-rich grasslands dominated by Cynosurus cristatus and with wany flowering herbs, notably Centaurea nigra.', 'Centaureo-Cynosuretum cristati', 'Prairies plus riches en espèces dominées par Cynosurus cristatus et avec de nombreuses plantes à fleurs, notamment Centaurea nigra.'),
(9954, 'NR', 22, '36.421', 'Pelouses alpines à Elyna', '', 'Alpine naked-rush swards', '', 5, 'Niveau 5', 4304, '/67/495/1277/4304/9954', 'true', 'Brown swards of Alpine crests and ridges submitted to extreme winds.', 'Elynetum, Caricetum curvulae elynetosum', 'Pelouses brunes des crêtes et des arêtes des Alpes soumises aux vents extrêmes.'),
(9955, 'NR', 22, '36.422', 'Pelouses pyrénéennes à Elyna', '', 'Pyrenean naked-rush swards', '', 5, 'Niveau 5', 4304, '/67/495/1277/4304/9955', 'true', 'Relatively extensive formations of the calcareous ranges of the Pyrenees, where the Elyna-Oxytropis swards represent the main grassland formation of the alpine level.', 'Oxytropido halleri-Elynetum, Carici brevicollis-Elynetum, Carici rosae-Elynetum myosuroidis', 'Formations relativement étendues des régions calcaires des Pyrénées, où les pelouses à Elyna-Oxytropis représentent la formation prairiale principale de l\'étage alpin.'),
(9956, 'NR', 22, '36.423', '', '', 'Cantabrian naked-rush swards', '', 5, 'Niveau 5', 4304, '/67/495/1277/4304/9956', 'false', 'Uncommon formations of the high summits of the Picos de Europa.', 'Oxytropido pyrenaicae-Elynetum myosuroidis', 'Pas de description disponible'),
(9957, 'NR', 22, '36.424', '', '', 'Apennine naked-rush swards', '', 5, 'Niveau 5', 4304, '/67/495/1277/4304/9957', 'false', 'Very local formations of the high crests of the Abruzzi.', '', 'Pas de description disponible'),
(9958, 'NR', 22, '36.431', 'Versants à Seslérie et Laîches sempervirentes', '', 'Blue moorgrass-evergreen sedge slopes', '', 5, 'Niveau 5', 4310, '/67/495/1277/4310/9958', 'true', 'Xero-thermophile stepped or garland, species-rich grasslands of the alpine and subalpine levels of the northern and south-eastern Alps, and locally, of the Jura, on slopes with shallow soil and snow-cover of short duration, with Sesleria albicans, Carex sempervirens, C. humilis, Gentiana favrati, Helianthemum alpestre, H. nummularium ssp. grandiflorum, Phyteuma orbiculare, Leontopodium alpinum, Pedicularis rostrato- capitata, P. verticillata, Anthyllis vulneraria ssp. alpestris, Ranunculus thora.', 'Seslerion albicantis p.', 'Pelouses en gradins ou en guirlandes, xéro-thermophiles, riches en espèces, des étages alpin et subalpin du nord et du sud-est des Alpes, et localement, du Jura, sur les versants ayant des sols superficiels et un enneigement de courte durée, avec Sesleria albicans, Carex sempervirens, C. humilis, Gentiana orbicularis, Helianthemum oelandicum subsp. alpestre, H. grandiflorum, Phyteuma orbiculare, Leontopodium alpinum, Pedicularis verticillata, Anthyllis vulneraria subsp. alpestris, Ranunculus thora.'),
(9959, 'NR', 22, '37.311', 'Prairies à Molinie sur calcaires', '', 'Calcareous purple moorgrass meadows', '', 5, 'Niveau 5', 4311, '/67/496/1280/4311/9959', 'true', 'More species-rich variant, on calcareous soils, with Silaum silaus, Sanguisorba officinalis, Selinum carvifolia, Betonica officinalis, Cirsium tuberosum, Carex tomentosa, Tetragonolobus maritimus, Stachys officinalis, Galium boreale, Serratula tinctoria, Inula salicina, Dianthus superbus, Colchicum autumnale (abundant).', 'Eu-Molinion', 'Variante plus riche en espèces, sur sols calcaires, avec Silaum silaus, Sanguisorba officinalis, Selinum carvifolium, Betonica officinalis, Cirsium tuberosum, Carex tomentosa, Tetragonolobus maritimus, Stachys officinalis, Galium boreale, Serratula tinctoria, Inula salicina, Dianthus superbus, Colchicum autumnale (abondant).'),
(9960, 'NR', 22, '34.511', 'Pelouses du Brachypodietum retusi', '', 'Retuse torgrass swards', '', 5, 'Niveau 5', 4312, '/67/490/1291/4312/9960', 'true', 'Grasslands dominated by Brachypodium retusum and with many therophytes and geophytes, often alternating in mosaic fashion with garrigues or occupying their clearings.', 'Brachypodienion retusi (Brachypodietum retusi)', 'Pelouses dominées par Brachypodium retusum avec de nombreux thérophytes et géophytes, alternant souvent en mosaïque avec des garrigues, ou occupant leurs clairières.'),
(9961, 'NR', 22, '34.512', 'Steppe de la Crau', '', 'Crau steppe', '', 5, 'Niveau 5', 4312, '/67/490/1291/4312/9961', 'true', 'Open grasslands of the coussous still covering vast but dwindling expanses of the Crau, fossil delta of the Durance, with Brachypodium retusum, Stipa capillata, Dichanthium ischaemum, Elymus caput-medusae, Thymus vulgaris, Bellis sylvestris, Asphodelus fistulosus, Euphorbia seguieriana, Linum gallicum, Salvia multifida, Bufonia macrosperma; they support a fauna of exceptional originality.', 'Asphodeletum fistulosi', 'Pelouses ouvertes couvrant encore des vastes étendues (mais en diminution) de la Crau, delta fossile de la Durance, avec Brachypodium retusum, Stipa capillata, Dichanthium ischaemum, Elymus caput-medusae (Taeniatherum caput-medusae), Thymus vulgaris, Bellis sylvestris, Asphodelus fistulosus, Euphorbia seguieriana, Linum gallicum, Bufonia paniculata ; elles abritent une faune d\'une exceptionnelle originalité.'),
(9645, 'NR', 22, '32.372', '', '', 'Mixed brooms maquis', '', 5, 'Niveau 5', 4063, '/67/488/1226/4063/9645', 'false', 'Leguminous formations, other than those dominated by Genista hystrix, with numerous local variants.', '', 'Pas de description disponible'),
(9646, 'NR', 22, '32.461', 'Stations à lavande', '', ' Lavender stands', '', 5, 'Niveau 5', 4064, '/67/488/1227/4064/9646', 'true', 'Homogeneous, or almost homogeneous, L. latifolia stands invading grasslands.', '', 'Peuplements homogènes, ou quasi homogènes, de L. latifolia envahissant les pelouses.'),
(9647, 'NR', 22, '32.462', 'Garrigues mixtes à lavande', '', 'Lavender mixed garrigues', '', 5, 'Niveau 5', 4064, '/67/488/1227/4064/9647', 'true', 'Other, more varied, lavender formations.', '', 'Autres formations à lavande, plus variées.'),
(9648, 'NR', 22, '32.481', 'Garrigues à Genista scorpius, G. hispanica', '', 'Genista scorpius, G. hispanica garrigues', '', 5, 'Niveau 5', 4066, '/67/488/1227/4066/9648', 'true', 'Formations of southern France and Spain; some Meseta formations are listed under 31.7 (hedgehog-heaths) or 32.6.', '', 'Formations du sud de la France.'),
(9649, 'NR', 22, '32.482', 'Garrigues à Genista corsica', '', 'Genista corsica garrigues', '', 5, 'Niveau 5', 4066, '/67/488/1227/4066/9649', 'true', 'Formations of Corsica and Sardinia; many formations are hedgehog-heaths (32.7).', '', 'Formations de Corse ; de nombreuses formations sont des landes-hérisson (32.7).'),
(9650, 'NR', 22, '32.483', '', '', 'Genista lucida garrigues', '', 5, 'Niveau 5', 4066, '/67/488/1227/4066/9650', 'false', 'Formations of Mallorca.', '', 'Pas de description disponible'),
(9651, 'NR', 22, '32.431', 'Garrigues à Cistus albidus', '', 'Cistus albidus garrigues', '', 5, 'Niveau 5', 4071, '/67/488/1227/4071/9651', 'true', 'Formations dominated by Cistus albidus, widespread in Iberia, France, the Balearics and Liguria, with local stations in other parts of northern Italy, and in Corsica and Sardinia.', '', 'Formations dominées par Cistus albidus, largement répandues en France, avec des stations locales en Corse.'),
(9652, 'NR', 22, '32.432', '', '', 'Cistus clusii garrigues', '', 5, 'Niveau 5', 4071, '/67/488/1227/4071/9652', 'false', 'Formations of Cistus clusii, mostly widespread in rather warm, dry areas of the southern and eastern parts of the Iberian peninsula and in the Balearics, with a very limited representation on Monte Gargano, in Calabria, and in Sicily.', '', 'Pas de description disponible'),
(9653, 'NR', 22, '32.433', 'Garrigues à C. monspeliensis, C. salviifolius, C. incanus', '', 'C. monspeliensis, C. salvifolius, C. incanus garrigues', '', 5, 'Niveau 5', 4071, '/67/488/1227/4071/9653', 'true', 'Garrigues with Cistus monspeliensis, C. salvifolius or C. incanus. Many formations of these species are maquis or maquis-like communities, best listed under 32.3. Some, however, with a pronounced calciphile character and a garrigue structure, can be listed here.', '', 'Garrigues avec Cistus monspeliensis, C. salvifolius, ou C. incanus. Beaucoup de formations avec ces espèces sont des groupements de maquis ou des communautés d\'aspect similaire, répertoriés de préférence en 32.3. Quelques unes, pourtant, ayant un caractère calciphile marqué et une structure de garrigue, peuvent être listées ici.'),
(9654, 'NR', 22, '32.441', 'Garrigues à euphorbe épineuse', '', 'Spiny spurge garrigues', '', 5, 'Niveau 5', 4072, '/67/488/1227/4072/9654', 'true', 'Euphorbia spinosa cushion garrigues of very dry soils of the meso- or thermo-Mediterranean zones of southern France, Corsica, Sardinia, Sicily and peninsular Italy.', '', 'Garrigues à coussins d\'Euphorbia spinosa des sols très secs des étages méso- ou thermoméditerranéens du sud de la France, de Corse.'),
(9655, 'NR', 22, '32.442', '', '', 'Unarmed spurge garrigues', '', 5, 'Niveau 5', 4072, '/67/488/1227/4072/9655', 'false', 'Formations with other, often woody-stocked, clump-forming Euphorbia species (e.g. E. fragifera, E. characias).', '', 'Pas de description disponible'),
(9656, 'NR', 22, '32.312', '', '', 'Luso-Extremaduran high maquis', '', 5, 'Niveau 5', 4054, '/67/488/1226/4054/9656', 'false', 'Formations with Erica lusitanica, E. arborea, E. scoparia, Cistus psilosepalus, C. populifolius developed in particular in the vicinity of lauriphyllus formations of ravines and water-course edges of the Montes de Toledo.', 'Ericenion umbellatae: Cisto psilosepali-Ericetum lusitanicae i.a.', 'Pas de description disponible'),
(9657, 'NR', 22, '32.313', '', '', 'Eastern Mediterranean high maquis', '', 5, 'Niveau 5', 4054, '/67/488/1226/4054/9657', 'false', 'Formations of Greece and the Balkan peninsula, with Erica arborea, Arbutus unedo, A. andrachne, Pistacia terebinthus, Phillyrea latifolia, Juniperus oxycedrus, Quercus coccifera, Q. ilex.', 'Orno-Quercetum ilicis p.; Andrachno-Quercetum ilicis p.', 'Pas de description disponible'),
(9658, 'NR', 22, '32.331', '', '', 'South-western Iberian tall cistus maquis', '', 5, 'Niveau 5', 4075, '/67/488/1226/4075/9658', 'false', 'Abundant formations rich in gorses, spiny brooms or, occasionally, heathers, developed on usually shallow soils in the thermo- and meso-Mediterranean zones of the southwest of the Iberian peninsula.', 'Ulici argentei-Cistion ladaniferi p.', 'Pas de description disponible'),
(9659, 'NR', 22, '32.332', 'Maquis ibérien central à grand Ciste', '', 'Central Iberian tall cistus maquis', '', 5, 'Niveau 5', 4075, '/67/488/1226/4075/9659', 'false', 'Formations with brooms, heathers and lavenders of siliceous soils, generally rather eroded and oligotrophic of the meso- and, locally, supra-Mediterranean zones of the Meseta, the Iberian Range and its satellites, the eastern Cordillera Central and southern Galicia and Leon.', 'Cistion laurifolii p.', 'Formations avec genêts, bruyères et lavandes des sols siliceux, généralement plutôt érodés et oligotrophes des étages méso- et, localement, supra-méditerranéens de la Meseta, … (France -).'),
(9660, 'NR', 22, '32.333', '', '', 'Baetic tall cistus maquis', '', 5, 'Niveau 5', 4075, '/67/488/1226/4075/9660', 'false', 'Formations of southern Andalusia, developed in siliceous or peridotite ranges in association with local Baetic floras.', 'Phlomidetalia purpureae p. i.a.', 'Pas de description disponible'),
(9661, 'NR', 22, '32.334', 'Maquis tyrrhénéens hauts à Cistus', '', 'Tyrrhenian tall cistus maquis', '', 5, 'Niveau 5', 4075, '/67/488/1226/4075/9661', 'true', 'Localized meso- and thermo-Mediterranean formations of siliceous or decalcified soils and subhumid climates of the Tyrrhenian hinterland (crystalline Provence, Valencia), often with heath elements.', 'Calicotomo-Cistion ladaniferi p.', 'Formations méso- et thermo-méditerranéennes, localisées, des sols siliceux ou décalcifiés et des climats subhumides de l\'arrière pays tyrrhénéens (Provence cristalline, Valence), souvent avec des éléments de la lande.'),
(9662, 'NR', 22, '32.341', 'Maquis à Cistus monspeliensis', '', 'Cistus monspeliensis maquis', '', 5, 'Niveau 5', 4076, '/67/488/1226/4076/9662', 'true', 'Formations dominated by Cistus monspeliensis, widespread in the Mediterranean region; homogeneous fields form in particular after fires.', '', 'Formations dominées par Cistus monspeliensis, largement répandues dans la région méditerranéenne ; peuplements homogènes formés en particulier après les incendies.'),
(9663, 'NR', 22, '32.342', 'Maquis à Cistus salviifolius', '', 'Cistus salvifolius maquis', '', 5, 'Niveau 5', 4076, '/67/488/1226/4076/9663', 'true', 'Formations dominated by Cistus salvifolius, equally widespread, though less often dominant, in the entire Mediterranean region.', '', 'Formations dominées par Cistus salviifolius, également largement répandues dans l\'ensemble de la région méditerranéenne, quoique moins souvent dominantes.'),
(9664, 'NR', 22, '32.571', '', '', 'Tree germander garrigues', '', 5, 'Niveau 5', 4077, '/67/488/1233/4077/9664', 'false', 'Tall or very tall Teucrium fruticans formations.', '', 'Pas de description disponible'),
(9665, 'NR', 22, '32.572', '', '', 'Jerusalem sage garrigues', '', 5, 'Niveau 5', 4077, '/67/488/1233/4077/9665', 'false', 'Fairly tall formations dominated by Phlomis fruticosa. Very degraded habitats occupied by almost monospecific fields of this species can be listed under 32.9.', '', 'Pas de description disponible'),
(9666, 'NR', 22, '32.573', '', '', 'Eastern Salvia and Stachys garrigues', '', 5, 'Niveau 5', 4077, '/67/488/1233/4077/9666', 'false', 'Fairly tall formations dominated by shrubs or woody perennials of genera Salvia (e.g. S. triloba, S. argentea, S. eichlerana, S. pomifera), Stachys (e.g. S. cretica) or others.', '', 'Pas de description disponible'),
(9667, 'NR', 22, '32.574', '', '', 'Eastern dwarf labiate garrigues', '', 5, 'Niveau 5', 4077, '/67/488/1233/4077/9667', 'false', 'Low, open garrigues formed by dwarf shrubs or perennials of genera Thymus (e.g. T. capitatus,T. teucrioides, T. atticus, T. sibthorpii, T. striatus, T.comptus), Teucrium (e.g. T. polium), Sideritis (e.g. S. syriaca , S. clandestina), Micromeria (e.g. M. juliana, M. graeca), Phlomis (e.g. P. cretica, P. floccosa, P. lanata) or others.', '', 'Pas de description disponible'),
(9668, 'NR', 22, '32.811', '', '', 'Cardonales', '', 5, 'Niveau 5', 4097, '/67/488/1232/4097/9668', 'false', 'Formations dominated by the cactiform spurge Euphorbia canariensis and Aeonium percarneum.', '', 'Pas de description disponible'),
(9669, 'NR', 22, '32.812', '', '', 'Tabaibales', '', 5, 'Niveau 5', 4097, '/67/488/1232/4097/9669', 'false', 'Formations dominated by the tree-like spurges Euphorbia aphylla, E. obtusifolia, E. balsamifera, E. atropurpurea, E. bravoana, E. regis-jubae, E. bourgaeana.', '', 'Pas de description disponible'),
(9670, 'NR', 22, '32.813', '', '', 'Kleinia tabaibales', '', 5, 'Niveau 5', 4097, '/67/488/1232/4097/9670', 'false', 'Senecio kleinia (Kleinia neriifolia), Sonchus spp. or other composite-dominated formations.', '', 'Pas de description disponible'),
(9671, 'NR', 22, '32.814', '', '', 'Dragon tree communities', '', 5, 'Niveau 5', 4097, '/67/488/1232/4097/9671', 'false', 'Formations in which the forest relict Dracaena draco is present.', '', 'Pas de description disponible');
INSERT INTO `corine` (`CD_HAB`, `FG_VALIDITE`, `CD_TYPO`, `LB_CODE`, `LB_HAB_FR`, `LB_HAB_FR_COMPLET`, `LB_HAB_EN`, `LB_AUTEUR`, `NIVEAU`, `LB_NIVEAU`, `CD_HAB_SUP`, `PATH_CD_HAB`, `FRANCE`, `LB_DESCRIPTION`, `CRSP_PHYTO_CB91`, `DESCRIPTIF_CB97_FR`) VALUES
(10293, 'NR', 22, '45.312', 'Forêts de Chênes verts de la plaine catalo-provençale', '', 'Catalo-Provençal lowland holm-oak woodland', '', 5, 'Niveau 5', 4573, '/68/517/1401/4573/10293', 'true', 'Lower meso-Mediterranean Quercus ilex formations of Catalonia, Languedoc and Provence rich in lauriphyllous and sclerophyllous shrubs and lianas, in particular Viburnum tinus, Arbutus unedo, Smilax aspera, Phillyrea latifolia, Ruscus aculeatus, Rubia peregrina; they are mostly degraded to arborescent matorral, the few remaining groves of holm oaks with a forest-like canopy being generally heavily modified by intensive human use.', 'Viburno tini-Quercetum ilicis = \"Quercetum galloprovinciale\"', 'Formations de Quercus ilex du méso-méditerranéen inférieur de Catalogne, du Languedoc et de Provence riches en arbustes et lianes lauriphylles et sclérophylles, en particulier Viburnum tinus, Arbutus unedo, Smilax aspera, Phillyrea latifolia, Ruscus aculeatus, Rubia peregrina. Elles sont généralement dégradées en matorral arborescent, les quelques peuplements de Chênes verts à canopée de type forestier qui subsistent sont généralement très modifiés par une utilisation anthropique intensive.'),
(10294, 'NR', 22, '45.313', 'Forêts de Chênes vert des collines catalo-provençales', '', 'Catalo-Provencal hill holm-oak forest', '', 5, 'Niveau 5', 4573, '/68/517/1401/4573/10294', 'true', 'Humid upper meso-Mediterranean Quercus ilex formations of Montseny, Valles, Montserrat, Prades, Ports de Beseit, eastern Pyrenees, high Languedoc, Cévennes, upper Provence and southwestern Alps with an undergrowth poorer in shrubs, especially those of eu-Mediterranean affinities, and richer in often acidocline herbaceous species characteristic of supra-Mediterranean deciduous oak woods. Well-developed stands with full forest characteristics exist in several locations on the slopes of well-watered hills, in particular the tall, dense canopy of Montseny. Sparser, lower formations colonize many rocky hillsides in the entire upper meso-Mediterranean arc of the Gulf of Lions basin, locally ascending into the supra-Mediterranean level.', 'Asplenio onopteridis-Quercetum ilicis = \"Quercetum mediterraneo-montanum\"', 'Formations de Quercus ilex du méso-méditerranéen supérieur, humides de Montserrat, de Prades, des Ports de Beseit, des Pyrénées orientales, du haut Languedoc, des Cévennes, de la haute Provence et du sud-ouest des Alpes avec une strate inférieure pauvre en arbustes, surtout celles ayant des affinitées eu-méditerranéennes, et plus riche en espèces herbacées souvent acidoclines caractéristiques des forêts de Chênes caducifoliés supra-méditerranéens. Des peuplements bien développés à caractère pleinement forestier existent en plusieurs endroits sur les versants des collines bien arrosées, en particulier la canopée haute et dense de Montseny. Des formations plus ouvertes et plus basses colonisent de nombreuses collines rocailleuses dans tout l\'arc du bassin du golfe du Lion du méso-méditerranéen supérieur, montant localement à l\'étage supra-méditerranéen.'),
(10295, 'NR', 22, '45.314', '', '', 'Balearic holm-oak forests', '', 5, 'Niveau 5', 4573, '/68/517/1401/4573/10295', 'false', 'Humid Quercus ilex formations, often well developed, of the higher mountains of northern Mallorca, in which the thermo-Mediterranean elements of the Q. rotundifolia formations of lower altitude have given way to more hygrophilous elements such as Viburnum tinus, Viola alba ssp. dehnhardtii, Monotropa hypopitys, Neottia nidus-avis, Cephalanthera spp.; they are rich in endemics, among which Cyclamen balearicum, Smilax aspera var. balearica, Rhamnus ludovici-salvatoris, Paeonia cambessedesii.', 'Cyclamino balearici-Quercetum ilicis', 'Pas de description disponible'),
(10296, 'NR', 22, '51.111', 'Buttes de Sphaignes colorées (bulten)', '', 'Colourful sphagnum hummocks (bulten)', '', 5, 'Niveau 5', 4579, '/71/518/1404/4579/10296', 'true', 'Cushiony domes or buttes, mainly made of red, yellow or brown sphagnums, with other mosses, liverworts (Odontoschisma sphagni, Campylopus fragilis fragilisfrvar. pyriformis, Mylia anomala), lichens (Cladonia spp., Cladina spp.), Eriophorum vaginatum, Carex pauciflora, Calluna vulgaris, Ledum palustre, Andromeda polifolia, Vaccinium oxycoccos, Scirpus cespitosus, Erica tetralix, Drosera rotundifolia.', '', 'Coussins, dômes ou buttes souvent composés principalement de Sphaignes, rouges, jaunes ou brunes, et accompagnées par d\'autres Mousses et des Hépatiques (Odontoschisma sphagni, Campylopus pyriformis, Mylia anomala), des Lichens (Cladonia spp., Cladina spp.), Eriophorum vaginatum, Carex pauciflora, Calluna vulgaris, Andromeda polifolia, Vaccinium oxycoccos, Trichophorum cespitosum, Erica tetralix, Drosera rotundifolia.'),
(10297, 'NR', 22, '42.A25', '', '', 'Manchegan Spanish juniper woods', '', 5, 'Niveau 5', 4576, '/68/491/1400/4576/10297', 'false', 'Juniperus thurifera woods on La Mancha clay soils of the Campo de Montiel.', 'Junipero thuriferae-Quercetum rotundifoliae p.', 'Pas de description disponible'),
(10298, 'NR', 22, '42.A26', '', '', 'Baetic Spanish juniper woods', '', 5, 'Niveau 5', 4576, '/68/491/1400/4576/10298', 'false', 'Relict, open Juniperus thurifera formations of the pre-Baetic system in the Sierra Taibilla (Albacete, Murcia).', '', 'Pas de description disponible'),
(10299, 'NR', 22, '42.A27', 'Bois pyrénéens de Genévriers thurifères', '', 'Pyrenean Spanish juniper woods', '', 5, 'Niveau 5', 4576, '/68/491/1400/4576/10299', 'true', 'Relict Juniperus thurifera wood of the supra-Mediterranean level of the Montagne de Rie, on the northern flank of the central Pyrenees.', '', 'Bois relictuels de Juniperus thurifera de l\'étage supra-méditerranéen de la Montagne de Rie sur le versant septentrional des Pyrénées centrales.'),
(10300, 'NR', 22, '42.A28', 'Bois sud-alpiens de Genévriers thurifères', '', 'Southern Alpine Spanish juniper woods', '', 5, 'Niveau 5', 4576, '/68/491/1400/4576/10300', 'true', 'Juniperus thurifera formations of warm calcareous supra-Mediterranean slopes of the southwestern Alps, in Drôme, Hautes-Alpes and Alpes-de-Haute-Provence, between 700 and 1200, occasionally 1400, metres.', '', 'Formations de Juniperus thurifera des pentes calcaires chaudes supra-méditerranéennes des Alpes sud-occidentales, dans la Drôme, les Hautes-Alpes et les Alpes-de-Haute-Provence, entre 700 et 1200 m, occasionnellement jusqu\'à 1400 m.'),
(10301, 'NR', 22, '42.A29', 'Bois de Genévriers thurifères de l\'Isère', '', 'Isère Spanish juniper woods', '', 5, 'Niveau 5', 4576, '/68/491/1400/4576/10301', 'true', 'Juniperus thurifera formations of warm calcareous supra-Mediterranean slopes of the Isère valley, in the western Alps, between 300 and 500 metres.', '', 'Formations de Juniperus thurifera des pentes calcaires chaudes supra-méditerranéennes de la vallée de l\'Isère, dans les Alpes occidentales, entre 300 et 500 m.'),
(10302, 'NR', 22, '42.A2A', 'Bois de Génevriers thurifères corses', '', 'Corsican Spanish juniper woods', '', 5, 'Niveau 5', 4576, '/68/491/1400/4576/10302', 'true', 'Open montane forests of Juniperus thurifera, sometimes mixed with Pinus laricio, restricted to a few valleys in the interior of Corsica with extreme temperature ranges (Pinnera, Rudda, Pruniccia)', '', 'Forêts montagnardes ouvertes de Juniperus thurifera, quelquefois mélangés avec Pinus laricio, limitées à quelques vallées de l\'intérieur de la Corse soumises à une amplitude extrême de température (Pinnera, Rudda, Pruniccia).'),
(10303, 'NR', 22, '44.611', '', '', 'Iberian poplar galleries', '', 5, 'Niveau 5', 4584, '/68/515/1403/4584/10303', 'false', 'Riparian poplar galleries on inundatable eutrophic soils with permanent hydromorphy of the Iberian range, the Castilian plateau, the Ebro basin, the Mediterranean Iberian east, the great Baetic rivers, with Populus alba, P. nigra, arborescent willows (Salix neotricha, S. alba, S. fragilis, S. atrocinerea), Fraxinus angustifolia, Ulmus minor and Celtis australis. The naturalized madder, Rubia tinctorum, grows in the shade of the eastern and central formations, the Atlantic Salix atrocinerea is an important component of the formations of the central Meseta, the Montes de Toledo and western Andalusia, and Nerium oleander penetrates the most thermophilous western Andalusian formations.', 'Rubio tinctori-Populetum albae, Rubo caesi-Populetum albae; Salici atrocinereae-Populetum albae, Nerio oleandri-Populetum albae', 'Pas de description disponible'),
(10304, 'NR', 22, '45.315', 'Yeuseraies des plaines corses', '', 'Corsican lowland holm-oak woodland', '', 5, 'Niveau 5', 4573, '/68/517/1401/4573/10304', 'true', 'Quercus ilex formations of the lower meso-Mediterranean level of Corsica with Viburnum tinus, Erica arborea, Lonicera implexa, Phillyrea angustifolia, Clematis flammula, Smilax aspera, Rubia peregrina; generally degraded to arborescent matorral or dense coppice, they still include, mostly above 400 m of altitude, a few better-preserved woodland fragments.', '', 'Formations de Quercus ilex de l\'étage méso-méditerranéen inférieur avec Viburnum tinus, Erica arborea, Lonicera implexa, Phyllyros angustifolia, Clematis flammula, Smilax aspera, Rubia peregrina. Généralement dégradées en matorral arborescent dense, elles incluent cependant encore quelques fragments forestiers mieux préservés, surtout au-dessus de 400 m d\'altitude.'),
(10305, 'NR', 22, '45.316', 'Forêts de Chênes verts des collines corses', '', 'Corsican hill holm-oak woodland', '', 5, 'Niveau 5', 4573, '/68/517/1401/4573/10305', 'true', 'Quercus ilex formations of the upper meso-Mediterranean level (500-600 m to 1100-1200 m) of Corsica with Arbutus unedo, Erica arborea, Viburnum tinus, Ilex aquifolium, Daphne laureola, Teucrium scorodonia, Helleborus lividus, Cyclamen repandum, Sanicula europaea, Melica uniflora; often installed on steep slopes, they include rather more stands with forest characteristics than the lowland formations.', '', 'Formations de Quercus ilex de l\'étage méso-méditerranéen supérieur (500-600 m à 1100-1200 m) de Corse avec Arbutus unedo, Erica arborea, Viburnum tinus, Ilex aquifolium, Daphne laureola, Teucrium scorodonia, Helleborus lividus, Cyclamen repandum, Sanicula europaea, Melica uniflora ; souvent installées sur des versants abrupts, elles incluent davantage de peuplements à caractéristiques forestières que les formations de basse altitude.'),
(10306, 'NR', 22, '45.317', '', '', 'Sardinian holm-oak forests', '', 5, 'Niveau 5', 4573, '/68/517/1401/4573/10306', 'false', 'Lower and upper meso-Mediterranean Q. ilex forests of Sardinia with Viburnum tinus, Phillyrea angustifolia, P. latifolia, Rhamnus alaternus, Arbutus unedo, Erica arborea, Ruscus aculeatus, Crataegus monogyna, Rubia peregrina, Smilax aspera, Clematis flammula, C. cirrhosa, C, vitalba, Rosa sempervirens, Tamus communis, Rubus ulmifolius, Cyclamen repandum, Carex halleriana, C. distachya, Luzula forsteri, Hedera helex, Lonicera implexa and Pistacia lentiscus in more thermo-Mediterranean areas. Extensive, fully developed, mature stands survive in particular in the hinterland of the Golfo di Orosei, around Mount Gennargentu, in the Barbagia, the Iglesiente, the Sarrabus, the Catena di Margine, on Monte Albo. They occupy a wide altitudinal range, grading at the upper limit into the more sub-Mediterranean formations of 45.32.', '', 'Pas de description disponible'),
(9962, 'NR', 22, '34.513', 'Communautés méditerranéennes annuelles sur sols superficiels', '', 'Mediterranean annual communities of shallow soils', '', 5, 'Niveau 5', 4312, '/67/490/1291/4312/9962', 'true', 'Spring-blooming, summer-dessicated formations of therophytes developed on base-rich, often calcareous, superficial soils with annual grasses such as Bromus fasciculatus, Brachypodium distachyum, Lagurus ovatus, Stipa capensis, Parapholis incurva, Hainardia cylindrica, Echinaria todaroana, Desmazeria marina, D. sicula, D. zwierleinii, Lamarckia aurea, Narduroides salzmannii, Vulpia unilateralis, Ctenopsis gypsophila, a few perennial grasses (e.g. Koeleria splendens, Dactylis hispanica) and numerous flowering plants, many of them annuals, and a very significant number restricted endemics; among the characteristic species are Silene tridentata, S. neglecta, S. sedoides, Paronychia argentea, Arenaria capillipes, Ionopsidium prolongoi, Erophila verna, Astragalus sesameus, Ononis ornithopodioides, O. oligophylla, O. sieberi, Onobrychis aequidentata, Trigonella monspeliaca, T. polycerata, Plantago albicans, P. coronopus, P. afra, P. amplexicaulis, P. notata, P. ovata, Polygala monspeliaca, Convolvulus lineatus, Eryngium dichotomum, E. triquetrum, E. ilicifolium, Hedysarum spinosissimum, Callipeltis cucullaris, Catananche lutea, Daucus aureus, D. lopadusanus, D. bocconei, Nigella arvensis, Scorzonera laciniata, Lavatera agrigentina, Scabiosa parviflora, Anthemis muricata, Senecio leucanthemifolius, Limonium calcarae, L. echioides, L. thouinii, Campanula fastigiata, C. erinus, Erodium pulverulentum, Iberis fontqueri, Viola demetria, Arabis verna, Brassica souliei, Aster sorrentinii, Asteriscus aquaticus, Echium parviflorum, Bellis annua, Matricaria aurea, Linaria reflexa, L. pseudolaxiflora, L. amethystea, L. huteri, L. platycalyx, L. saturejoides, L. clementei, Filago cossyrensis, Valantia calva, Sedum litoreum, S. caeruleum, S. stellatum, Saxifraga tridactylites, Hornungia petraea, Parietaria cretica, Biscutella lyrata, Anagallis monelli, Fedia cornucopiae, Evax pygmaea, Jasione penicillata, Andryala ragusina, Allium pallens  ssp. siciliense,  A. agrigentinum, A. chamaemoly.  Various combinations of the species above enter in the constitution of numerous distinctive, often ephemereal and very local communities restricted to small surfaces among, or in clearings of, other formations.  The more widespread pastures dominated by annual grasses are for the most part sub-nitrophilous and better classified under 34.8.', 'Brachypodietalia distachyae', 'Formations thérophytiques à floraison printanière et dessication estivale, développées sur des sols superficiels, riches en bases, souvent calcaires, avec des graminées annuelles telles que Bromus fasciculatus, Brachypodium distachyon, Lagurus ovatus, Stipa capensis, Parapholis incurva, Hainardia cylindrica, Catapodium marinum, Lamarckia aurea, Narduroides salzmannii, Vulpia unilateralis, quelques graminées pérennes (par ex. Koeleria splendens, Dactylis glomerata subsp. hispanica) et de nombreuses plantes à fleurs, dont un bon nombre d\'annuelles, et une quantité très significative d\'endémiques à aire restreinte ; parmi les espèces caractéristiques, on trouve Silene neglecta, S. sedoides, Paronychia argentea, Erophila verna, Astragalus sesameus, Ononis ornithopodioides, Onobrychis aequidentata, Trigonella monspeliaca, T. polyceratia, Plantago albicans, P. coronopus, P. afra, Polygala monspeliaca, Convolvulus lineatus, Hedysarum spinosissimum, Callipeltis cucullaris, Catananche lutea, Daucus aureus, D. carota subsp. drepanensis, Nigella arvensis, Scorzonera laciniata, Senecio leucanthemifolius, Limonium echioides, L. lobatum, Campanula erinus, Arabis verna, Nauplius aquaticus, Echium calycinum, Bellis annua, Linaria reflexa, Sedum litoreum, S. caeruleum, S. stellatum, Saxifraga tridactylites, Hornungia petraea, Biscutella lyrata, Fedia graciliflora, Evax pygmaea, Andryala ragusina, Allium chamaemoly. Diverses combinaisons des espèces ci-dessus sont à l\'origine de nombreuses communautés distinctes, souvent éphémères et très locales, réduites à de petites surfaces parmi, ou dans les clairières, d\'autres formations. Les pâturages les plus largement étendus dominés par des graminées annuelles sont pour la plupart subnitrophiles et à classer de préférence en 34.8.'),
(9963, 'NR', 22, '36.111', 'Communautés acidiphiles des combes à neige alpines', '', 'Alpine acid snow-patch communities', '', 5, 'Niveau 5', 4313, '/67/495/1292/4313/9963', 'true', 'Acid snow-patch communities of the Alps, the Pyrenees and high mountains of the Mediterranean peninsulas, with Salix herbacea, Soldanella pusilla, Sibbaldia procumbens, Omalotheca supina (Gnaphalium supinum), Luzula alpino-pilosa, Cerastium cerastoides and mosses.', 'Salicion herbaceae', 'Communautés acidiphiles des combes à neige des Alpes et des Pyrénées, avec Salix herbacea, Soldanella pusilla, Sibbaldia procumbens, Omalotheca (Gnaphalium) supina, Luzula alpino-pilosa, Cerastium cerastioides et des mousses.'),
(9964, 'NR', 22, '36.432', 'Pelouses à Avoine et Seslérie des Alpes méridionales', '', 'Southern Alpine oatgrass-blue moorgrass swards', '', 5, 'Niveau 5', 4310, '/67/495/1277/4310/9964', 'true', 'Xero-thermophile, open, stepped or garland, species-rich grasslands of the alpine and subalpine levels of the southern Alps, and particularly of the southwestern Alps, similar to those of the previous unit (36.431), but in which Carex sempervirens is less prominent, while various oats, Helictotrichon (Avena) sedenense (H. montanum, A. montana), H. sempervirens, H. parlatorei, H. setaceum, or Festuca dimorpha become important components together with Sesleria albicans, and oro-Mediterranean species such as Globularia nana, Hedysarum hedysarioides, Lilium pomponium, Centaurea triumfetti, Ononis cristata (O. cenisia), O. striata, Iberis sempervirens, Aethionema ovalifolium, Sempervivum calcareum, Arenaria cinerea, Alsine brunati, Galeopsis reuteri, Leuzea rhapontica (Rhaponticum scariosum) ssp. bicknellii and the spiny Astragalus sempervirens appear; several of these species are local endemics of very restricted distribution.', 'Avenion montanae, Avenion sempervirentis, Ononidion cenisiae', 'Pelouses xéro-thermophiles, ouvertes, en gradins ou en guirlandes, riches en espèces, des étages alpin et subalpin des Alpes méridionales et particulièrement du sud-ouest des Alpes, semblables à celles de l\'unité précédente (36.431), mais dans laquelle Carex sempervirens est moins marquant, tandis que diverses avoines, Helictotrichon (Avena) sedenense (H. montanum, A. montana), H. sempervirens, H. parlatorei, H. setaceum, ou Festuca dimorpha deviennent des composantes importantes en compagnie de Sesleria albicans, et des espèces oro-méditeranéennes telles que Globularia nana, Hedysarum hedysarioides, Lilium pomponium, Centaurea triumfetti, Ononis cristata (O. cenisia), O. striata, Iberis sempervirens, Sempervivum calcareum, Arenaria cinerea, Galeopsis reuteri, Stemmacantha helenifolia subsp. bicknellii et l\'apparition de l\'épineuse Astragalus sempervirens ; plusieurs de ces espèces sont des endémiques locales à distribution très restreinte.'),
(9965, 'NR', 22, '36.433', 'Tapis de laîches en coussinets', '', 'Cushion sedge carpets', '', 5, 'Niveau 5', 4310, '/67/495/1277/4310/9965', 'true', 'Open formations of the alpine level of the southeastern Alps, and, to a lesser extent, of the northeastern Alps, composed of cushions of Carex firma and other low-growing rosette or cushion plants among which Saxifraga caesia, Gentiana clusii, G. froelichii, G. terglouensis, Crepis jacquinii, Pedicularis rosea, Saussurea pygmaea, Dianthus monspessulanus ssp. sternbergii, Primula wulfeniana, Chamorchis alpina, Sesleria albicans, Carex mucronata, sometimes in association with mats of Dryas octopetala.', 'Seslerion caeruleae: Caricetum firmae (Firmetum)', 'Formations ouvertes de l\'étage alpin du sud-est des Alpes, et, dans une moindre mesure, du nord-est des Alpes, composées de coussinets de Carex firma et d\'autres plantes en coussinets ou rosettes à croissance lente parmi lesquelles Saxifraga caesia, Gentiana clusii, G. terglouensis, Pedicularis rosea, Chamorchis alpina, Sesleria albicans, Carex mucronata, quelquefois en association avec des tapis de Dryas octopetala.'),
(9966, 'NR', 22, '34.514', 'Arènes dolomitiques des Causses', '', 'Causse dolomitic arenas', '', 5, 'Niveau 5', 4312, '/67/490/1291/4312/9966', 'true', 'Very open formations colonizing, within the supra-Mediterranean steppe zone of the Causses (34.71), local deposits of dolomitic sands, characterized by Armeria girardii (=juncea), Arenaria aggregata, Helianthemum pilosum, Sedum ochroleucum, Alkanna tinctoria, Alyssum serpyllifolium, Helichrysum stoechas, Silene otites, Aster alpinus, Festuca christianii-bernardii, Corynephorus canescens, Phleum arenarium.', 'Armerion junceae', 'Formations très ouvertes colonisant, au sein de la zone des pelouses à caractère steppique supra-méditerranéennes des Causses (34.71), des dépôts localisés de sables dolomitiques, caractérisés par Armeria girardii (= juncea), Arenaria aggregata, Helianthemum violaceum, Sedum ochroleucum, Alkanna tinctoria, Alyssum serpyllifolium, Helichrysum stoechas, Silene otites, Aster alpinus, Festuca christianii-bernardii, Corynephorus canescens, Phleum arenarium.'),
(9967, 'NR', 22, '36.112', '', '', 'Boreo-alpine snow-patch communities', '', 5, 'Niveau 5', 4313, '/67/495/1292/4313/9967', 'false', 'Snow-patches of the high altitudes of the Central and Eastern Highlands of Scotland.', '', 'Pas de description disponible'),
(9968, 'NR', 22, '36.121', 'Communautés des combes à neige sur calcaires à Arabis-Gnaphalium', '', 'Calcareous Arabis-Gnaphalium snow-patch communities', '', 5, 'Niveau 5', 4318, '/67/495/1292/4318/9968', 'true', 'Herbaceous snow-patch swards of humid, carbonated soils under snow for long periods, with Ranunculus alpestris, Arabis caerulea, Omalotheca hoppeana (Gnaphalium hoppeanum), Hutchinsia alpina, Potentilla brauniana (P. minima), Soldanella alpina.', 'Arabidetum caeruleae, Potentillo-Gnaphalietum hoppeanae', 'Gazons herbacés des combes à neige, sur sols carbonatés humides, sous la neige pendant de longues périodes, avec Ranunculus alpestris, Arabis caerulea, Omalotheca (Gnaphalium) hoppeana, Hutchinsia alpina, Potentilla brauniana (P. minima), Soldanella alpina.'),
(9969, 'NR', 22, '36.122', 'Communautés des combes à neige sur calcaires, à Saules en espaliers', '', 'Calcareous espalier willow snow-patch communities', '', 5, 'Niveau 5', 4318, '/67/495/1292/4318/9969', 'true', 'Espalier willow communities of calcareous stone fields with the net-leaved willow, Salix reticulata, and the retuse-leaved willow, Salix retusa, and Gentiana bavarica.', 'Salicetum retuso-reticulatae', 'Communautés de Saules en espalier colonisant des pierriers calcaires avec le saule à feuilles réticulées, Salix reticulata, et le saule à feuilles rétuses, Salix retusa, et Gentiana bavarica.'),
(9672, 'NR', 22, '32.815', '', '', 'Cneorum cushion communities', '', 5, 'Niveau 5', 4097, '/67/488/1232/4097/9672', 'false', 'Cneorum pulverulentum formations.', '', 'Pas de description disponible'),
(9673, 'NR', 22, '32.816', '', '', 'Plocama communities', '', 5, 'Niveau 5', 4097, '/67/488/1232/4097/9673', 'false', 'Formations with Plocama pendula.', '', 'Pas de description disponible'),
(9674, 'NR', 22, '32.821', '', '', 'Western Canarian saxicolous labiate communities', '', 5, 'Niveau 5', 4098, '/67/488/1232/4098/9674', 'false', 'Formations of small ligneous plants colonizing hard, dry rocks with Micromeria spp., Lavandula canariensis, L. pinnata, and the fern Cosentina (Notholaena) vellea.', '', 'Pas de description disponible'),
(9675, 'NR', 22, '32.822', '', '', 'Cardoncillo communities', '', 5, 'Niveau 5', 4098, '/67/488/1232/4098/9675', 'false', 'Formations colonizing lava flows, with the succulent asclepiad cardoncillos Ceropegia dichotoma and C. fusca, Phagnalon purpurascens and Sonchus leptocephalus.', '', 'Pas de description disponible'),
(9676, 'NR', 22, '32.823', '', '', 'Western Canarian crassulid communities', '', 5, 'Niveau 5', 4098, '/67/488/1232/4098/9676', 'false', 'Formations of dry, less sunny rocks dominated by succulent crassulids (Aeonium spp., Greenovia spp.) with Sonchus gummifer, S. radiatus, Picridium ligulatum, Lavandula abrotanoides, Asparagus scoparius, Hypericum reflexum, Lavatera acerifolia, L. phoenicea, Vieraea laevigata and many lichens.', '', 'Pas de description disponible'),
(9677, 'NR', 22, '32.4A1', 'Garrigues à Helichrysum, Santolina, Phagnalon', '', 'Helichrysum, Santolina, Phagnalon garrigues', '', 5, 'Niveau 5', 4068, '/67/488/1227/4068/9677', 'true', 'Usually low, open garrigues formed by dwarf, shrubby composites, often with small grey or whitish leaves and showy yellow bloom, of genera Helichrysum, Staehelina (S. dubia), Phagnalon (P. rupestre), Santolina, Scorzonera.', '', 'Garrigues habituellement basses, ouvertes, formées par des Astéracées naines, arbustives, souvent à feuilles petites, grises ou blanchâtres avec des fleurs d\'un jaune vif, appartenant aux genres Helichrysum, Staehelina (S. dubia), Phagnalon (P. rupestre), Santolina, Scorzonera.'),
(9678, 'NR', 22, '32.4A2', 'Garrigues à Artemisia', '', 'Artemisia garrigues', '', 5, 'Niveau 5', 4068, '/67/488/1227/4068/9678', 'true', 'Formations dominated by the usually small-leaved and inconspicuously flowering species of genus Artemisia.', '', 'Formations dominées par les espèces habituellement à petites feuilles et à floraison discrète du genre Artemisia.'),
(9679, 'NR', 22, '32.4A3', 'Garrigues à Inule visqueuse', '', 'Aromatic inula garrigues', '', 5, 'Niveau 5', 4068, '/67/488/1227/4068/9679', 'true', 'Formations dominated by the invasive Inula viscosa.', '', 'Formations dominées par l\'envahissante Dittrichia viscosa.'),
(9680, 'NR', 22, '32.4A4', 'Garrigues à Composées moyennes à grandes', '', 'Medium-tall composite garrigues', '', 5, 'Niveau 5', 4068, '/67/488/1227/4068/9680', 'true', 'Formations dominated by other large composites.', '', 'Formations dominées par d\'autres grandes Composées.'),
(9681, 'NR', 22, '32.531', '', '', 'Eastern Cistus incanus garrigues', '', 5, 'Niveau 5', 4112, '/67/488/1233/4112/9681', 'false', 'Low to medium-tall, large-flowered, pink Cistus incanus ssp. incanus or C. incanus ssp.creticus formations.', '', 'Pas de description disponible'),
(9682, 'NR', 22, '32.532', '', '', 'Eastern Cistus parviflorus garrigues', '', 5, 'Niveau 5', 4112, '/67/488/1233/4112/9682', 'false', 'Usually low, small-flowered, deep pink Cistus parviflorus formations.', '', 'Pas de description disponible'),
