(9686, 'NR', 22, '32.542', '', '', 'Eastern unarmed spurge garrigues', '', 5, 'Niveau 5', 4113, '/67/488/1233/4113/9686', 'false', 'Formations with other, often woody-stocked, clump-forming Euphorbia species (e.g. E. characias ssp. wulfenii, E. rigida).', '', 'Pas de description disponible'),
(9687, 'NR', 22, '34.111', 'Pelouses à orpins', '', 'Stonecrop swards', '', 5, 'Niveau 5', 4116, '/67/490/1234/4116/9687', 'true', 'Formations dominated by, or rich in, Sedum album or other Sedum species, commonest facies of most communities.', '', 'Formations dominées par, ou riches en, Sedum album ou d\'autres espèces de Sedum, faciès le plus commun de la plupart des communautés.'),
(9688, 'NR', 22, '34.112', 'Formations à Joubarbes', '', 'Houseleek communities', '', 5, 'Niveau 5', 4116, '/67/490/1234/4116/9688', 'true', 'Formations harbouring often rare and local lowland forms of Sempervivum spp. or Jovibarba spp.', '', 'Formations renfermant souvent des formes de basses altitudes, souvent rares et locales, de Sempervivum spp. ou Jovibarba spp.'),
(9689, 'NR', 22, '34.113', 'Formations herbeuses sur débris rocheux', '', 'Grassy rock debris communities', '', 5, 'Niveau 5', 4116, '/67/490/1234/4116/9689', 'true', 'Formations in which perennial grasses such as Poa badensis, Melica ciliata and Festuca spp. play an important physiognomic role.', '', 'Formations dans lesquelles les graminées pérennes telles que Poa badensis, Melica ciliata et Festuca spp. jouent un rôle physionomique important.'),
(9690, 'NR', 22, '34.114', 'Communautés thérophytiques médio-européennes sur débris rocheux', '', 'Middle European rock debris therophyte communities', '', 5, 'Niveau 5', 4116, '/67/490/1234/4116/9690', 'true', 'Formations in which small annuals predominate over sparser crassulids or perennial grasses.', '', 'Formations dans lesquelles les petites annuelles prédominent sur les graminées pérennes ou sur des plantes crassulescentes plus clairsemées.'),
(9691, 'NR', 22, '34.313', '', '', 'Eastern inner Alpine arid grasslands', '', 5, 'Niveau 5', 4122, '/67/490/1236/4122/9691', 'false', 'Formations of the isolated, low-precipitation, high insolation, high summer temperature, inner Alpine valleys of the Val Bregaglia, upper basin of the Adda, the Val Venosta (upper Adige), the middle Adige-Isarco basin, the Val Pusteria.', 'Stipo-Poion xerophilae', 'Pas de description disponible'),
(9692, 'NR', 22, '34.314', 'Pelouses arides des Alpes occidentales internes', '', 'Western inner Alpine arid grasslands', '', 5, 'Niveau 5', 4122, '/67/490/1236/4122/9692', 'true', 'Grasslands of the dry inner valleys of the southwestern Alps in the upper basin of the Durance, the upper valley of the Romanche, the Maurienne and the Tarentaise, the basins of the Dora Riparia (Susa) and of the Chisone and the upper basin of the Dora Baltea (Aosta).', 'Stipo-Poion carniolicae', 'Pelouses des vallées internes sèches du sud-ouest des Alpes, dans le bassin supérieur de la Durance, la haute vallée de la Romanche, la Maurienne et la Tarentaise, ... .'),
(9693, 'NR', 22, '34.221', '', '', 'Viola calaminaria grasslands', '', 5, 'Niveau 5', 4120, '/67/490/1235/4120/9693', 'false', 'Formations of eastern Belgium, the extreme southern Netherlands and the Aachen area, with the yellow-flowered Viola calaminaria.', '', 'Pas de description disponible'),
(9694, 'NR', 22, '34.222', '', '', 'Viola guestphalica grasslands', '', 5, 'Niveau 5', 4120, '/67/490/1235/4120/9694', 'false', 'Formations of northern Westfalia and of southern Lower Saxony, with the purple-flowered Viola guestphalica.', '', 'Pas de description disponible'),
(9695, 'NR', 22, '34.223', 'Pelouses à Armeria halleri de l\'Eifel', '', 'Eifel Armeria halleri grasslands', '', 5, 'Niveau 5', 4120, '/67/490/1235/4120/9695', 'true', 'Communities of the Eifel with Armeria halleri and without violets.', '', 'Communautés de l’Eifel avec Armeria halleri et sans Violettes.'),
(9696, 'NR', 22, '34.311', '', '', 'Greek sub-Mediterranean steppic grasslands', '', 5, 'Niveau 5', 4122, '/67/490/1236/4122/9696', 'false', 'Perennial, steppe-like grasslands of the sub-Mediterranean Ostryo-Carpinion, Quercion frainetto and Fagion moesiacum zones of Greece with, among others, Chrysopogon gryllus, Festuca rupicola, Koeleria macrantha, Carex humilis, Stipa joannis, S. capillata, S. pulcherrima.', 'Chrysopogo-Danthonion, Festucion rupicolae, Saturejon montanae, Asplenion serpentini', 'Pas de description disponible'),
(9697, 'NR', 22, '34.312', 'Pelouses steppiques de l\'Europe centrale', '', 'Central European steppic grasslands', '', 5, 'Niveau 5', 4122, '/67/490/1236/4122/9697', 'true', 'Dry grasslands, developed in areas with a locally high degree of continentality, of Alsace, the upper Rhine valley and hills, Franconia, Thuringe, Saxony and Brandenburg.', 'Festucion valesiacae, Cirsio-Brachypodion', 'Pelouses sèches, développées dans les régions ayant localement un haut degré de continentalité : Alsace, collines et vallées du Rhin supérieur.'),
(9698, 'NR', 22, '33.331', '', '', 'Lesbian Centaurea-Sarcopoterium phryganas', '', 5, 'Niveau 5', 4131, '/67/489/1239/4131/9698', 'false', '.', '', 'Pas de description disponible'),
(9699, 'NR', 22, '33.332', '', '', 'Lesbian Sarcopoterium phryganas', '', 5, 'Niveau 5', 4131, '/67/489/1239/4131/9699', 'false', 'Sarcopoterium phrygana with little or no Centaurea spinosa.', '', 'Pas de description disponible'),
(9700, 'NR', 22, '33.333', '', '', 'Lesbian steppe-phrygana', '', 5, 'Niveau 5', 4131, '/67/489/1239/4131/9700', 'false', 'Open, almost pure, stands of Centaurea spinosa on steppic hills.', '', 'Pas de description disponible'),
(9701, 'NR', 22, '41.762', '', '', 'Greek Quercus frainetto woods', '', 5, 'Niveau 5', 4249, '/68/492/1265/4249/9701', 'false', 'Quercus frainetto-dominated formations.', '', 'Pas de description disponible'),
(10307, 'NR', 22, '45.318', '', '', 'Northern and central Italian holm-oak forests', '', 5, 'Niveau 5', 4573, '/68/517/1401/4573/10307', 'false', 'Quercus ilex-dominated formations of Tyrrhenian and Adriatic coastal areas of the northern half of the Italian peninsula with Phillyrea media, P. angustifolia, Viburnum tinus, Ruscus aculeatus, Daphne gnidium, Fraxinus ornus, Rosa sempervirens, Lonicera implexa, Rubia peregrina, Smilax aspera, Myrtus communis, Clematis flammula, Tamus communis, Carex olbiensis, Luzula forsteri, Cyclamen repandum and often an admixture of Quercus suber or of the deciduous Q. pubescens and Q. cerris; at higher altitude they take on a more montane character with a greater prevalence of sub-Mediterranean elements. Although these formations are, like most other continental holm-oak communities, mostly degraded to arborescent matorral or coppice, fully developed forests subsist very locally, in particular in Toscany and Latium and, to a lesser extent, in Veneto and Emilia-Romagna.', '', 'Pas de description disponible'),
(10308, 'NR', 22, '42.5B1', 'Forêts pyrénéennes xérophiles de Pins sylvestres', '', 'Pyrenean xerophile Scots pine forests', '', 5, 'Niveau 5', 4585, '/68/491/1263/4585/10308', 'true', 'Montane and lower sub-alpine Pinus sylvestris or P. sylvestris and P. uncinata forests of dry adrets of the southern flanks of the Pyrenees and of the Val d\'Aran, with a shrub layer comprising Juniperus hemisphaerica, Cytisus purgans, Buxus sempervirens and an herb layer dominated by Deschampsia flexuosa, accompanied by, among others, Veronica officinalis.', 'Veronico-Pinetum sylvestris', 'Forêts montagnardes et du sub-alpin inférieur de Pinus sylvestris ou de P. uncinata sur les soulanes sèches des versants sud des Pyrénées et du val d\'Aran, avec une strate arbustive comprenant Juniperus hemisphaerica, Cytisus purgans, Buxus sempervirens, et une strate herbacée dominée par Deschampsia flexuosa, accompagnée, entre autres par Veronica officinalis.'),
(10309, 'NR', 22, '42.5B2', '', '', 'Iberian Range silicicolous Scots pine forests', '', 5, 'Niveau 5', 4585, '/68/491/1263/4585/10309', 'false', 'Pinus sylvestris forests of siliceous ground in the oro- and supra-Mediterranean levels of the Northern and Southern Iberian Ranges.', '', 'Pas de description disponible'),
(10310, 'NR', 22, '42.5B3', '', '', 'Cordilleran silicicolous Scots pine forests', '', 5, 'Niveau 5', 4585, '/68/491/1263/4585/10310', 'false', 'Pinus sylvestris forests of siliceous ground in the oro- and supra-Mediterranean levels of the Cordillera Central.', '', 'Pas de description disponible'),
(10311, 'NR', 22, '42.A71', '', '', 'British yew woods', '', 5, 'Niveau 5', 4586, '/68/491/1400/4586/10311', 'false', 'Taxus baccata woods with Sorbus aria or Mercurialis perennis of dry valleys and scarps of the Chalk of south-east England, and, very locally of the Durham Magnesium limestone.', '', 'Pas de description disponible'),
(10312, 'NR', 22, '42.A72', 'Forêts d\'Ifs corses', '', 'Corsican yew woods', '', 5, 'Niveau 5', 4586, '/68/491/1400/4586/10312', 'true', 'Formations of Taxus baccata, Ilex aquifolium, Buxus sempervirens, restricted to cool, montane areas in the Tenda range, the San Pedrone range and the Cap Corse mountains.', '', 'Formations de Taxus baccata, Ilex aquifolium, Buxus sempervirens, limitées aux régions montagnardes froides dans le massif de Tenda, de San Pedrone et des montagnes du cap Corse.'),
(10313, 'NR', 22, '42.A73', '', '', 'Sardinian yew woods', '', 5, 'Niveau 5', 4586, '/68/491/1400/4586/10313', 'false', 'Taxus baccata and Ilex aquifolium woods of the Catena del Marghine and the Mount Limbara system.', '', 'Pas de description disponible'),
(10314, 'NR', 22, '42.A74', '', '', 'Peninsular Italian yew woods', '', 5, 'Niveau 5', 4586, '/68/491/1400/4586/10314', 'false', 'Taxus baccata and Ilex aquifolium of the Macerata region.', '', 'Pas de description disponible'),
(10315, 'NR', 22, '42.A75', '', '', 'Iberian yew woods', '', 5, 'Niveau 5', 4586, '/68/491/1400/4586/10315', 'false', 'Occasional pure Taxus baccata formations of Spanish mountains, most often on steep shady slopes.', '', 'Pas de description disponible'),
(10316, 'NR', 22, '42.A76', 'Forêts d\'Ifs provençales', '', 'Provence yew woods', '', 5, 'Niveau 5', 4586, '/68/491/1400/4586/10316', 'true', 'Taxus baccata formations of southern France, similar to 42.A75.', '', 'Formations à Taxus baccata du sud de la France, similaires à 42.A75.'),
(10317, 'NR', 22, '42.A81', '', '', 'Canarian juniper woods', '', 5, 'Niveau 5', 4587, '/68/491/1400/4587/10317', 'false', 'Juniperus cedrus formations of the high altitudes of Tenerife, La Palma, Gomera, Gran Canaria, restricted to steep rocky slopes.', '', 'Pas de description disponible'),
(10318, 'NR', 22, '42.A82', '', '', 'Azorean juniper woods', '', 5, 'Niveau 5', 4587, '/68/491/1400/4587/10318', 'false', 'Endemic Juniperus brevifolia formations of the Azores.', 'Juniperion brevifoliae p.', 'Pas de description disponible'),
(10319, 'NR', 22, '42.A83', '', '', 'Macaronesian Phoenician juniper woods', '', 5, 'Niveau 5', 4587, '/68/491/1400/4587/10319', 'false', 'Juniperus phoenicea formations of Tenerife, La Palma, Hierro, Gran Canaria, Gomera.', 'Maytenio-Juniperion phoeniceae p.', 'Pas de description disponible'),
(10320, 'NR', 22, '44.612', 'Galeries de Peupliers provenço-languedociennes', '', 'Provenço-Languedocian poplar galleries', '', 5, 'Niveau 5', 4584, '/68/515/1403/4584/10320', 'true', 'Riparian gallery forests lining water courses and other water bodies of Provence and Languedoc, in particular the rivers of the Mediterranean periphery of the Pyrenees, the Languedocian rivers draining the Causses and the southern Central Massif, the Rhône and Durance systems, especially the Camargue, the Verdon, the Var, with Populus alba, P. nigra, Ulmus minor, Fraxinus angustifolia (locally accompanied by F. excelsior), Acer negundo, A. campestre, A. platanoides, Celtis australis, Quercus pubescens, Alnus glutinosa, and an undergrowth with Cornus sanguinea, Rubus caesius, Sambucus nigra, Vitis vinifera ssp. sylvestris, Bryonia cretica, Humulus lupulus, Rubia peregrina, Solanum dulcamara, Alliaria petiolata, Cucubalus baccifer, Saponaria officinalis, Iris foetidissima, Arum italicum, Brachypodium sylvaticum, Carex pendula; Celtis australis may form facies locally (e.g. Estérel).', 'Populetum albae p.', 'Forêts galeries riveraines bordant les cours d\'eaux et les autres plans d\'eau de Provence et du Languedoc, en particulier les rivières de la périphérie méditerranéenne des Pyrénées, les rivières languedociennes drainant les Causses et le Massif central méridional, les réseaux du Rhône et de la Durance, spécialement la Camargue, le Verdon, le Var, avec Populus alba, P. nigra, Ulmus minor, Fraxinus angustiufolia (accompagné localement par F. excelsior), Acer negundo, A. campestre, A. platanoides, Celtis australis, Quercus pubescens, Alnus glutinosa, et un sous-bois avec Cornus sanguinea, Rubus caesius, Sambucus nigra, Vitis vinifera, Bryonia cretica, Humulus lupulus, Rubia peregrina, Solanum dulcamara, Alliaria petiolata, Cucubalus baccifer, Saponaria officinalis, Iris foetidissima, Arum italicum, Brachypodium sylvaticum, Carex pendula ; Celtis australispeut localement former un faciès (ex. Estérel).'),
(10321, 'NR', 22, '44.613', 'Galeries de Peupliers cyrno-sardes', '', 'Cyrno-Sardian poplar galleries', '', 5, 'Niveau 5', 4584, '/68/515/1403/4584/10321', 'true', 'Riparian woods of lower water courses of Corsica and Sardinia, with Populus alba, P. nigra, Fraxinus ornus, F. angustifolia, Alnus glutinosa, A. cordata and arborescent willows.', 'Populetum albae p.', 'Bois riverains de la partie inférieure des cours d\'eau de Corse et de Sardaigne, avec Populus alba, P. nigra, Fraxinus ornus, F. angustifolia, Alnus glutinosa, A. cordata et des Saules arborescents.'),
(10322, 'NR', 22, '44.614', '', '', 'Italian poplar galleries', '', 5, 'Niveau 5', 4584, '/68/515/1403/4584/10322', 'false', 'Riparian poplar galleries of Italian rivers and other water bodies, with Populus alba, P. nigra, Alnus glutinosa, Ulmus minor, Acer campestre, Viburnum lantana, V. opulus, Rhamnus catharticus, Crataegus monogyna, Rubus caesius, Humulus lupulus, Clematis vitalba.', 'Populetum albae p.', 'Pas de description disponible'),
(10323, 'NR', 22, '44.615', '', '', 'Greek poplar galleries', '', 5, 'Niveau 5', 4584, '/68/515/1403/4584/10323', 'false', 'Riparian poplar galleries of Greek rivers and other water bodies, with Populus alba, P. nigra, Ulmus minor, Alnus glutinosa, Platanus orientalis, Salix spp., Periploca graeca, Pyracantha coccinea, Vitex agnus-castus, Cornus sanguinea, Brachypodium sylvaticum.', 'Populetum albae balcanicum', 'Pas de description disponible'),
(9970, 'NR', 22, '36.434', 'Pelouses pyrénéennes à Festuca gautieri', '', 'Pyrenean Festuca gautieri grasslands', '', 5, 'Niveau 5', 4310, '/67/495/1277/4310/9970', 'true', 'Open, xeric, stepped, scraped, species-rich grasslands of calcareous adrets in the subalpine and lower alpine levels of the Pyrenees, formed by the smooth, sharp-pointed, often curved-leaved Festuca gautieri ssp. F. scoparia and often rich in small cushiony plants; characteristic elements include Koeleria vallesiana, Helictotrichon sedense (Avena montana), Sesleria albicans, Sideritis hyssopifolia, S. endressii, Helianthemum oelandicum var. hirtum, Androsace villosa, Gypsophila repens, Alcinos alpinus, Paronychia serpyllifolia, Anthyllis vulneraria, Arenaria grandiflora, Astragalus sempervirens, A. monspessulanus, Eryngium bourgati, Fritillaria pyrenaica, Teucrium pyrenaicum, Erigeron pyrenaicus, Ononis cristata (O. cenisia), Onosma fastigiatum, Saponaria caespitosa, Jurinea humilis, Seseli nanum, Arenaria tetraquetra, Scorzonera aristata, Thymelaea nivalis, Iberis bernardiana, Serratula nudicaulis, Asperula cynanchica, Polygala alpina, Oxytropis pyrenaica, Carex rupestris.', 'Festucion scopariae, Thymelacion nivalis, Saponarion caespitosae', 'Pelouses ouvertes, xériques, en gradins, érodées, riches en espèces, des adrets calcaires des étages subalpin et alpin inférieur des Pyrénées, formées par Festuca gautieri subsp. scoparia aux feuilles lisses, acérées, souvent recourbées, souvent riches en petites plantes en coussinets ; les éléments caractéristiques comprennent Koeleria valesiana, Helictotrichon sedense (Avena montana), Sesleria albicans, Sideritis hyssopifolia, S. endressii, Helianthemum oelandicum var. hirtum, Androsace villosa, Gypsophila repens, Acinos alpinus, Paronychia kapela, Anthyllis vulneraria, Arenaria grandiflora, Astragalus sempervirens, A. monspessulanus, Eryngium bourgati, Fritillaria pyrenaica, Teucrium pyrenaicum, Erigeron pyrenaicus, Ononis cristata (O. cenisia), Onosma fastigiata, Saponaria caespitosa, Jurinea humilis, Seseli nanum, Arenaria tetraquetra, Scorzonera aristata, Thymelaea tinctoris subsp. nivalis, Iberis bernardiana, Serratula nudicaulis, Asperula cynanchica, Polygala alpina, Oxytropis neglecta, Carex rupestris.'),
(9971, 'NR', 22, '36.435', '', '', 'Oro-Iberian calciphilous stripped grasslands', '', 5, 'Niveau 5', 4310, '/67/495/1277/4310/9971', 'false', 'Thermophile, open, stripped and garland fescue grasslands of calcareous upper slopes and summits in the subalpine and oro-Mediterranean levels of the Cantabrian mountains, the Iberian Range and the calcareous Baetic ranges, dominated by Festuca hystrix, F. burnatii, Poa ligulata or Oreochloa confusa. They are closely allied to the Iberian fescue frost-grasslands (34.73) of the supra-Mediterranean and montane levels of the same mountains.', 'Festuco-Poetalia ligulatae p.', 'Pas de description disponible'),
(9972, 'NR', 22, '36.436', '', '', 'Apennine stripped grasslands', '', 5, 'Niveau 5', 4310, '/67/495/1277/4310/9972', 'false', 'Open, xerophile, stripped, stepped, scraped and garland grasslands of alpine and subalpine slopes and summits of the central and southern Apennines, dominated by Sesleria tenuifolia (S. juncifolia), S. nitida, S. italica, Festuca dimorpha, Carex kitaibeliana (C. laevis).', 'Seslerietalia juncifoliae', 'Pas de description disponible'),
(9973, 'NR', 22, '37.711', 'Communautés fluviales à Angelica archangelica', '', 'Angelica archangelica fluvial communities', '', 5, 'Niveau 5', 4321, '/67/496/1294/4321/9973', 'true', 'Angelica archangelica ssp. littoralis formations of great northern rivers, presently rare and threatened.', '', 'Formations à Angelica archangelica subsp. littoralis des grandes rivières nordiques, actuellement rares et menacées.'),
(9974, 'NR', 22, '37.712', 'Communautés fluviales à Angelica heterocarpa', '', 'Angelica heterocarpa fluvial communities', '', 5, 'Niveau 5', 4321, '/67/496/1294/4321/9974', 'true', 'Angelica heterocarpa formations of tidal estuaries of the Loire, the Charente and the Gironde; the species is a rare and very narrow endemic of southwestern France.', '', 'Formations à Angelica heterocarpa des estuaires soumis à la marée de la Loire, de la Charente et de la Gironde ; l\'espèce est une endémique rare et très localisée du sud-ouest de la France.'),
(9975, 'NR', 22, '37.713', 'Ourlets à Althaea officinalis', '', 'Marsh mallow screens', '', 5, 'Niveau 5', 4321, '/67/496/1294/4321/9975', 'true', 'Althaea officinalis formations of river banks and marsh edges, particularly on somewhat saline soils.', '', 'Formations à Althea officinalis des berges de rivières et des lisières marécageuses, particulièrement sur des sols quelque peu salés.'),
(9976, 'NR', 22, '34.531', '', '', 'Eastern retuse torgrass swards', '', 5, 'Niveau 5', 4322, '/67/490/1291/4322/9976', 'false', 'Grasslands dominated by Brachypodium retusum and with many therophytes and geophytes, often alternating in mosaic fashion with garrigues and phryganas or occupying their clearings.', '', 'Pas de description disponible'),
(9977, 'NR', 22, '34.532', '', '', 'Eastern short-grass steppes and therophyte communities', '', 5, 'Niveau 5', 4322, '/67/490/1291/4322/9977', 'false', 'Open, short, grasslands of thermo- and meso-Mediterranean Greece and its islands with numerous annual grasses such as Bromus fasciculatus, B. madritensis, B. intermedius, B. alopecuros, B. rubens, Brachypodium distachyum, Aegilops neglecta, A. geniculata, A. triuncialis, Avena sterilis, A. barbata, Lagurus ovatus, Cynosurus echinatus, Stipa capensis, but sometimes with a strong representation of short or medium-sized perennial grasses such as Hyparrhenia hirta, Andropogon distachyos, Cynodon dactylon, Dactylis hispanica. They are very rich in annual flowering plants, among which of genera Euphorbia, Silene, Nigella, Adonis, Papaver, Fumaria, Biscutella, Rapistrum, Althaea, Malva, Linum, Geranium, Astragalus, Ononis, Trigonella, Medicago, Melilotus, Trifolium, Lotus, Coronilla, Scorpiurus, Hedysarum, Onobrychis, Bupleurum, Daucus, Anagallis, Orobanche, Plantago, Centaurium, Galium, Evax, Filago, Pallenis, Anthemis, Chrysanthemum, Tragopogon, suffrutescent labiates of genera Teucrium, Thymus, Ballota, Phlomis, Micromeria, Salvia and others, and geophytes such as Urginea maritima, Asphodelus microcarpus, Lloydia graeca, Allium spp., Ornithogalum spp., Muscari spp., Romulea spp., Orchis spp., Ophrys spp., Anacamptis pyramidalis. They constitute a wide array of distinctive communities, many of them very local and restricted to small surfaces. Many of the more extensive pastures, in particular those dominated by annual grasses, are sub-nitrophilous or nitrophilous and may be better classified under 34.8.', '', 'Pas de description disponible'),
(9978, 'NR', 22, '36.437', '', '', 'Greek stripped grasslands', '', 5, 'Niveau 5', 4310, '/67/495/1277/4310/9978', 'false', 'Open, scraped, stepped and garland grasslands of the alpine and subalpine levels of the calcareous mountains of Greece, dominated by Sesleria korabensis, S. coerulans, Festuca graeca, Carex kitaibeliana, Stipa pulcherrima with Viola heterophylla ssp. graeca, Minuartia verna, Paronychia rechingeri, Silene ciliata, Dianthus minutiflorus, Draba athoa, Iberis sempervirens, Anthyllis vulneraria ssp. pulchella, Acinos alpinus, Edraianthus graminifolius, Centaurea pindicola, Galium anisophyllum, Morina persica, Bornmuellera baldaccii, B. tymphaea, Poa pirinica, P. thessala, Festuca olympica, and a few woody species, in particular Daphne oleoides and Juniperus nana.', 'Daphno-Festucetalia p.', 'Pas de description disponible'),
(9979, 'NR', 22, '34.321', 'Pelouses calcicoles semi-sèches nord-occidentales', '', 'North-western semi-dry calcareous grasslands', '', 5, 'Niveau 5', 4118, '/67/490/1236/4118/9979', 'true', 'Mesobromion grasslands of Denmark and the British Isles.', '', 'Pelouses du Mesobromion du Danemark et des îles Britanniques.');
INSERT INTO `corine` (`CD_HAB`, `FG_VALIDITE`, `CD_TYPO`, `LB_CODE`, `LB_HAB_FR`, `LB_HAB_FR_COMPLET`, `LB_HAB_EN`, `LB_AUTEUR`, `NIVEAU`, `LB_NIVEAU`, `CD_HAB_SUP`, `PATH_CD_HAB`, `FRANCE`, `LB_DESCRIPTION`, `CRSP_PHYTO_CB91`, `DESCRIPTIF_CB97_FR`) VALUES
(9301, 'NR', 22, '11.121', 'Eaux littorales', '', 'Inshore waters', '', 5, 'Niveau 5', 3862, '/65/475/1180/3862/9301', 'true', 'Waters within the strong influence of land masses, both in terms of physical parameters and of fauna, often arbitrarily defined as waters less than 5 km from low water mark, waters between the continent and islands or islets well in sight of shore, and any seas of depth less than 6 metres.', '', 'Eaux physiquement et biologiquement sous influence du continent, souvent arbitrairement définies comme des eaux situées à moins de 5 km de la plus grande marée basse (eaux entre le continent et les îles ou îlots bien visibles de la côte) et toutes les parties de mer de profondeur inférieure à 6 mètres.'),
(9302, 'NR', 22, '11.122', 'Eaux néritiques lointaines (du large)', '', 'Offshore waters', '', 5, 'Niveau 5', 3862, '/65/475/1180/3862/9302', 'true', 'The zone extending from the limits of inshore waters to the continental slope.', '', 'Masses d\'eau situées entre les eaux littorales et le talus continental.'),
(9303, 'NR', 22, '11.123', 'Talus continental', '', 'Continental slope', '', 5, 'Niveau 5', 3862, '/65/475/1180/3862/9303', 'true', 'Waters situated over the continental slope, the steep descent from the continental shelf to the ocean bottom, an area where upwellings, water mixing or shearing and other anomalies often develop.', '', 'Masses d\'eau situées au-dessus du talus continental, de la pente abrupte descendant du plateau continental vers les fonds océaniques, souvent zone « d\'upwellings » (mélange, cisaillement de masses d\'eau).'),
(9304, 'NR', 22, '11.124', 'Upwellings', '', 'Upwellings', '', 5, 'Niveau 5', 3862, '/65/475/1180/3862/9304', 'true', 'Zones where the warmer surface water is displaced, allowing cooler water rich in nutrients to rise to the surface, often generating much increased biological productivity.', '', 'Zones où l\'eau chaude de surface est déplacée, permettant à l\'eau plus froide, riche en éléments nutritifs, de monter à la surface, générant souvent une productivité biologique accrue.'),
(9305, 'NR', 22, '11.125', 'Hauts-fonds', '', 'Shoals', '', 5, 'Niveau 5', 3862, '/65/475/1180/3862/9305', 'true', 'Shallow waters over permanently submerged elevated features of the sea-floor.', '', 'Eaux peu profondes sur une partie surélevée des fonds marins, immergée en permanence.'),
(9306, 'NR', 22, '11.251', 'Concrétions coralligènes', '', 'Corallogenic concretions', '', 5, 'Niveau 5', 3867, '/65/475/1181/3867/9306', 'true', 'Communities forming and colonizing corallogenic concretions of calcified red algae in the circalittoral zone of the Mediterranean.', '', 'Communautés formant et colonisant les concrétions coralligènes d\'algues rouges calcifiées dans les zones circalittorales de la Méditerranée.'),
(9307, 'NR', 22, '11.252', 'Trottoirs d\'algues encroûtantes', '', 'Encrusting algae pavements', '', 5, 'Niveau 5', 3867, '/65/475/1181/3867/9307', 'true', 'Mediterranean communities associated with mediolittoral pavements of encrusting algae (Lithospermum tortuosum).', '', 'Communautés méditerranéennes associées avec des trottoirs médiolittoraux d\'algues encroûtantes (Lithophyllum tortuosum).'),
(9308, 'NR', 22, '11.253', 'Trottoirs de Gastéropodes et Polychètes', '', 'Gastropod and polychaete ledges', '', 5, 'Niveau 5', 3867, '/65/475/1181/3867/9308', 'true', 'Infralittoral ledges built by gastropods or polychaetes.', '', 'Trottoirs infralittoraux construits par des gastéropodes (Vermets) ou des polychètes (Serpules).'),
(9309, 'NR', 22, '11.254', 'Trottoirs de moules (moulières)', '', 'Mussel beds', '', 5, 'Niveau 5', 3867, '/65/475/1181/3867/9309', 'true', 'Communities of Atlantic and Mediterranean mussel beds.', '', 'Communautés des bancs de moules de l\'Atlantique et de la Méditerranée.'),
(9310, 'NR', 22, '11.321', 'Herbiers à Zostères naines de l\'Atlantique continental', '', 'Mainland Atlantic dwarf eelgrass meadows', '', 5, 'Niveau 5', 3870, '/65/475/1182/3870/9310', 'true', 'Formations of Zostera noltii or Z. angustifolia of the Atlantic and North Sea shores of continental Europe.', '', 'Formations de Zostera noltii des côtes de l\'Atlantique et de la mer du Nord, en Europe continentale.'),
(9311, 'NR', 22, '11.322', '', '', 'Macaronesian dwarf eelgrass meadows', '', 5, 'Niveau 5', 3870, '/65/475/1182/3870/9311', 'false', 'Very local Zostera noltii formations of Fuerteventura and Lanzarote, near the southern limit of the Atlantic range of the genus.', '', 'Pas de description disponible'),
(9312, 'NR', 22, '11.331', 'Herbiers méditerranéens à Cymodocea', '', 'Mediterranean Cymodocea beds', '', 5, 'Niveau 5', 3871, '/65/475/1182/3871/9312', 'true', 'Cymodocea nodosa formations of muddy sands, monospecific or associated with either the alga Caulerpa prolifera or the phanerogam Halophila stipulacea.', 'Cymodocetum nodosae', 'Formations sablo-limoneuses à Cymodocea nodosa, monospécifiques ou associées à l\'algue Caulerpa prolifera.'),
(9313, 'NR', 22, '11.332', 'Herbiers méditerranéens à Zostera', '', 'Mediterranean Zostera beds', '', 5, 'Niveau 5', 3871, '/65/475/1182/3871/9313', 'true', 'Formations of the upper part of the infralittoral zone with Zostera noltii and the alga Giraudya sphacelarioides.', 'Giraudyo-Zosteretum noltii', 'Formations de la partie supérieure de la zone infralittorale avec Zostera noltii et l\'algue Giraudya sphacelarioides.'),
(9314, 'NR', 22, '11.361', '', '', 'Canarian Halophila beds', '', 5, 'Niveau 5', 3874, '/65/475/1182/3874/9314', 'false', 'Halophila decipiens colonies of Tenerife, at depths between 10 and 14 metres.', '', 'Pas de description disponible'),
(9315, 'NR', 22, '11.362', '', '', 'Mediterranean Halophila beds', '', 5, 'Niveau 5', 3874, '/65/475/1182/3874/9315', 'false', 'Colonies of Halophila stipulacea invading the Mediterranean as a result of the opening of the Suez Canal; they have been reported from continental Greece, the Cyclades, Crete, Rhodes, Samos.', '', 'Pas de description disponible'),
(9316, 'NR', 22, '15.321', 'Prés salés avec graminées et Pourpier marin', '', 'Sea purslane-saltmarsh grass meadows', '', 5, 'Niveau 5', 3878, '/65/477/1183/3878/9316', 'true', 'Facies of the saltmarsh grass meadows resulting from their invasion by Halimione portulacoides.', '', 'Faciès de prés salés résultant de leur invasion par Halimione portulacoides.'),
(9317, 'NR', 22, '15.322', 'Prés salés avec graminées et Aster marin', '', 'Sea aster-saltmarsh grass meadows', '', 5, 'Niveau 5', 3878, '/65/477/1183/3878/9317', 'true', 'Lower schorre communities dominated by the conspicuous Aster tripolium.', '', 'Groupements de bas schorre dominés par le remarquable Aster tripolium.'),
(9318, 'NR', 22, '15.323', 'Prés salés avec graminées et Salicorne', '', 'Glasswort-saltmarsh grass meadows', '', 5, 'Niveau 5', 3878, '/65/477/1183/3878/9318', 'true', 'Transitional communities of the lower schorre, with Puccinellia maritima, annual Salicornia and Suaeda maritima.', '', 'Groupements de transition du bas schorre, avec Puccinellia maritima, Salicornia annuelle et Suaeda maritima.'),
(9319, 'NR', 22, '15.324', 'Végétations à Halimione pedunculata', '', 'Stalked orache beds', '', 5, 'Niveau 5', 3878, '/65/477/1183/3878/9319', 'true', 'Formations dominated by the rare, threatened Halimione pedunculata, developing very locally in the Puccinellion maritimae of Denmark, Germany, the Netherlands, Belgium and France, extinct in the British Isles.', '', 'Formations dominées par l\'espèce rare et menacée Halimione pedunculata, se développant très localement dans les Puccinellion maritimae du Danemark, de l\'Allemagne, des Pays-Bas, de la Belgique et de la France, disparues des îles Britanniques.'),
(9702, 'NR', 22, '41.763', '', '', 'Greek Quercus dalechampii woods.', '', 5, 'Niveau 5', 4249, '/68/492/1265/4249/9702', 'false', 'Quercus dalechampii-dominated formations.', '', 'Pas de description disponible'),
(9703, 'NR', 22, '41.764', '', '', 'Greek Quercus petraea woods', '', 5, 'Niveau 5', 4249, '/68/492/1265/4249/9703', 'false', 'Quercus petraea-dominated formations.', '', 'Pas de description disponible'),
(9704, 'NR', 22, '41.765', '', '', 'Greek Quercus virgiliana woods', '', 5, 'Niveau 5', 4249, '/68/492/1265/4249/9704', 'false', 'Quercus virgiliana-dominated formations.', '', 'Pas de description disponible'),
(9705, 'NR', 22, '41.766', '', '', 'Greek Quercus pedunculiflora woods', '', 5, 'Niveau 5', 4249, '/68/492/1265/4249/9705', 'false', 'Quercus pedunculiflora-dominated formations.', '', 'Pas de description disponible'),
(9706, 'NR', 22, '41.767', '', '', 'Greek Quercus polycarpa woods', '', 5, 'Niveau 5', 4249, '/68/492/1265/4249/9706', 'false', 'Quercus polycarpa-dominated formations.', '', 'Pas de description disponible'),
(9707, 'NR', 22, '41.771', '', '', 'Spanish Quercus faginea forests', '', 5, 'Niveau 5', 4140, '/68/492/1265/4140/9707', 'false', 'Xero-mesophile Quercus faginea formations of slopes and plateaux of middle elevations of the Spanish Meseta and associated ranges.', 'Spiraeo obovatae-Quercetum fagineae, Cephalanthero longifoliae-Quercetum fagineae, Violo wilkommii-Quercetum fagineae, Daphno latifoliae-Aceretum granatensis, Fraxino orni-Quercetum fagineae', 'Pas de description disponible'),
(9708, 'NR', 22, '41.772', '', '', 'Portuguese Quercus faginea forests', '', 5, 'Niveau 5', 4140, '/68/492/1265/4140/9708', 'false', 'Humid, epiphyte-clad, dense, relict Quercus faginea forests of Portugal, restricted to a very few isolated localities.', 'Arisaro-Quercetum fagineae', 'Pas de description disponible'),
(9709, 'NR', 22, '41.773', '', '', 'Andalusian Quercus canariensis forests', '', 5, 'Niveau 5', 4140, '/68/492/1265/4140/9709', 'false', 'Humid and hyper-humid, luxuriant Quercus canariensis forests of the sierras of extreme southern Spain, limited to the Aljibe and a very few localities in the Serrania de Ronda.', 'Rusco hypophylli-Quercetum canariensis', 'Pas de description disponible'),
(9710, 'NR', 22, '41.774', '', '', 'Catalonian Quercus canariensis stands', '', 5, 'Niveau 5', 4140, '/68/492/1265/4140/9710', 'false', 'Formations of Catalonia rich in Quercus canariensis.', 'Carici depressae-Quercetum canariensis', 'Pas de description disponible'),
(9711, 'NR', 22, '41.775', '', '', 'Balearic Quercus faginea woods', '', 5, 'Niveau 5', 4140, '/68/492/1265/4140/9711', 'false', 'Relict formations of Mallorca dominated by, or rich in, Quercus faginea.', 'Aceri-Quercetum fagineae p.', 'Pas de description disponible'),
(9712, 'NR', 22, '41.781', '', '', 'Quercus trojana woods of Greece', '', 5, 'Niveau 5', 4141, '/68/492/1265/4141/9712', 'false', 'Usually low formations dominated by Quercus trojana, often with junipers or maples, of Macedonia, Thrace and Thessaly.', '', 'Pas de description disponible'),
(9713, 'NR', 22, '41.782', '', '', 'Quercus trojana woods of Puglia', '', 5, 'Niveau 5', 4141, '/68/492/1265/4141/9713', 'false', 'Relict woods, sometimes of considerable height, of Q. trojana and Q. pubescens, often with an admixture of Q. ilex and its associated vegetation (Murge: e.g. bosco delle Pianelle, foresta Gaglione).', '', 'Pas de description disponible'),
(9714, 'NR', 22, '41.791', '', '', 'Quercus macrolepis woods of Greece', '', 5, 'Niveau 5', 4142, '/68/492/1265/4142/9714', 'false', 'Formations of continental Greece and its archipelagoes; well developed forests exist, in particular, in the Ionian islands and on Lesbos.', '', 'Pas de description disponible'),
(9715, 'NR', 22, '41.792', '', '', 'Quercus macrolepis woods of Puglia', '', 5, 'Niveau 5', 4142, '/68/492/1265/4142/9715', 'false', 'Relict formations of Salento (Tricase).', '', 'Pas de description disponible'),
(9716, 'NR', 22, '41.811', 'Bois de Charmes houblon méso-méditerranéens', '', 'Meso-Mediterranean hop-hornbeam woods', '', 5, 'Niveau 5', 4143, '/68/492/1247/4143/9716', 'true', 'Ravine forests of the meso-Mediterranean Quercus ilex zone.', '', 'Forêts de ravins de l\'étage méso-méditerranéen avec Quercus ilex.'),
(9717, 'NR', 22, '41.131', 'Hêtraies à Mélique', '', 'Wood melick beech forests', '', 5, 'Niveau 5', 4144, '/68/492/1278/4144/9717', 'true', 'Medio-European collinar beech and beech-oak forests of the Hercynian arc and peripheral regions, the Jura, Lorraine, the Paris basin, Burgundy and a few localities of the North Sea - Baltic plain.', 'Melico-Fagetum, Asperulo-Fagetum, Cardamino bulbiferae-Fagetum, Hordelymo-Fagetum, Lathyro-Fagetum', 'Hêtraies et chênaies-hêtraies collinéennes médio-européennes de l\'arc hercynien et des régions périphériques, du Jura, de la Lorraine, du Bassin parisien et de la Bourgogne.'),
(9718, 'NR', 22, '41.813', 'Bois de Charmes houblon montagnards', '', 'Montane hop-hornbeam woods', '', 5, 'Niveau 5', 4143, '/68/492/1247/4143/9718', 'true', 'Formations with an accompanying flora of the Ostryo-Fagion.', '', 'Formations avec une flore compagne de l\'Ostryon-Fagion.'),
(9719, 'NR', 22, '41.831', '', '', 'Andalusian Acer granatense woods', '', 5, 'Niveau 5', 4149, '/68/492/1247/4149/9719', 'false', 'Supra-Mediterranean formations of the mountains of the upper Guadalquivir, with Acer granatense, A. monspessulanum, Quercus faginea, Q. pyrenaica, Sorbus aria, S. torminalis, Taxus baccata, Daphne laureola, Paeonia officinalis ssp. humilis. Vestiges of this type of vegetation also survive in the Serrania de Ronda.', 'Daphno latifoliae-Aceretum granatensis p.', 'Pas de description disponible'),
(9720, 'NR', 22, '41.832', '', '', 'Balearic Acer granatense woods', '', 5, 'Niveau 5', 4149, '/68/492/1247/4149/9720', 'false', 'Formations, extremely rare if not extinct, of the mountains of Majorca (Puig de Maçanella, Puig Major), dominated by Acer granatense, with Quercus faginea, Amelanchier ovalis ssp. comafredensis, Ilex aquifolium var. balearica, Helleborus foetidus var. balearicus, Sorbus aria, Primula acaulis var. balearica, Rubus ulmifolius, Tamus communis, Taxus baccata, Hedera helix, Smilax aspera var. balearica, Paeonia cambessedesii, several of which are relict endemic taxa of very limited distribution and low numbers.', 'Aceri-Quercetum fagineae p.', 'Pas de description disponible'),
(9721, 'NR', 22, '41.861', '', '', 'Sicilian narrow-leaved ash woods', '', 5, 'Niveau 5', 4152, '/68/492/1247/4152/9721', 'false', 'Fraxinus angustifolia woods of western Sicily.', '', 'Pas de description disponible'),
(9722, 'NR', 22, '41.862', '', '', 'Iberian narrow-leaved ash woods', '', 5, 'Niveau 5', 4152, '/68/492/1247/4152/9722', 'false', 'Fraxinus angustifolia woods of the Iberian peninsula.', '', 'Pas de description disponible'),
