(9725, 'NR', 22, '42.592', 'Forêts pré-pyrénéennes à Buis de Pins sylvestres', '', 'Pre-Pyrenean box Scots pine forests', '', 5, 'Niveau 5', 4251, '/68/491/1263/4251/9725', 'true', 'Supra-Mediterranean Pinus sylvestris forests, with abundant box, forming a broad belt on the southern flank of the Pyrenees, with outposts on the northern flank, in the eastern Pyrenees and the east of the Pays de Sault.', '', 'Forêts supra-méditerranéennes de Pinus sylvestris, avec du Buis en abondance, formant une large ceinture sur le versant sud des Pyrénées, avec des avant-postes sur le versant nord, dans les Pyrénées orientales et dans l\'est du Pays de Sault.'),
(9726, 'NR', 22, '42.593', '', '', 'Emilian Scots pine woods', '', 5, 'Niveau 5', 4251, '/68/491/1263/4251/9726', 'false', 'Isolated Pinus sylvestris woods of the base of the Emilian Apennines, mostly on limestones and serpentines, comprising Quercus cerris and Q. pubescens or Carpinus betula, Corylus avellana, Acer campestre, Fraxinus ornus.', '', 'Pas de description disponible'),
(9727, 'NR', 22, '42.5A1', 'Forêts pyrénéennes de Pins sylvestres à sous-bois de lande-hérisson', '', 'Pyrenean hedgehog-heath Scots pine woods', '', 5, 'Niveau 5', 4154, '/68/491/1263/4154/9727', 'false', 'Woods or prewoods of adrets in the montane level of calcareous ranges of the southern flank of the central Pyrenees, with usually low and contorted Pinus sylvestris accompanied by a hedgehog-heath (cf. 31.71) of Echinospartum horridum, Buxus sempervirens, Juniperus hemisphaerica.', '', 'Bois ou prébois des adrets de l\'étage montagnard des massifs calcaires du versant méridional des Pyrénées centrales, avec habituellement des individus tortueux de Pinus sylvestris accompagnés d\'Echinospartum horridum, Buxus sempervirens, Juniperus hemisphaerica.'),
(9728, 'NR', 22, '42.5A2', '', '', 'Savin Scots pine forests', '', 5, 'Niveau 5', 4154, '/68/491/1263/4154/9728', 'false', 'Oro-Mediterranean, calcicolous Pinus sylvestris forests of the Iberian Range and the Baetic ranges, often fairly open, and with a shrub layer that includes the prostrate Juniperus sabina.', 'Pino-Juniperion sabinae', 'Pas de description disponible'),
(9729, 'NR', 22, '41.132', 'Hêtraies à Jacinthe des bois', '', 'Bluebell beech forests', '', 5, 'Niveau 5', 4144, '/68/492/1278/4144/9729', 'true', 'Atlantic beech and beech-oak forests with Hyacinthoides non-scripta, of southern England, the Boulonnais, Picardy, the Oise, Lys and Schelde basins.', 'Endymio-Fagetum', 'Hêtraies et chênaies-hêtraies atlantiques avec Hyacinthoides non-scripta, du Boulonnais, de la Picardie et des bassins de l\'Oise, de la Seine, de la Lys et de l\'Escaut.'),
(9980, 'NR', 22, '34.322', 'Pelouses semi-sèches médio-européennes à Bromus erectus', '', 'Middle European Bromus erectus semi-dry grasslands', '', 5, 'Niveau 5', 4118, '/67/490/1236/4118/9980', 'true', 'Mesophile and meso-xerophile calcareous grasslands of the sub-Atlantic domaine in the Low Countries, Germany, northern, central and western France and northwestern Spain. They are faunistically and floristically rich and the highly discontinuous nature of their distribution gives rise to a considerable geographical variation in the composition of plant and animal communities, marked by the occurrence of numerous species of local or disjunct occurrence in addition to the basic cortège common to most of them. Besides this geographical variation, the nature of these grasslands also depends, to a great extent, on hydric regime, substrate characteristics and agro-pastoral treatment, notably on whether they are mowed or grazed and how intensively. In particular, the relative abundance of the main constituent grass species, Bromus erectus, Brachypodium pinnatum s. l., Sesleria albicans and Koeleria pyramidata, varies both geographically with climatic conditions and locally with topography and agro-pastoral regime. Thus, although separate geographical entities may differ in that relative abundance, similarly differing facies may also coexist locally, producing sharply distinct habitats. To accomodate for these concurrent axes of variation, formations dominated by Brachypodium or by Sesleria, as well as all semi-damp formations, are removed from this division and placed in 34.323, 34.324 and 34.325. Geographical subdivisions, most apt at identifying distinctive plant and animal communities, may be used in the four sections by addition of a fourth decimal digit common to all of them. The regions encompassed by the geographical subdivisions corresponding to each value of this fourth digit are in all cases described under this section although in some of them, or in parts of some of them, there may be no grasslands belonging to 34.322, but only grasslands belonging to units 34.323, 34.324 or 34.325; these cases have, as much as possible, been identified under each of the subdivisions below.', '', 'Pelouses calcaires mésophiles à méso-xérophiles du domaine sub-atlantique du nord, centre et ouest de la France, ... . Elles sont faunistiquement et floristiquement riches. Le caractère très discontinu de leur distribution engendre une variation géographique considérable dans la composition des communautés végétales et animales, marquées par la présence de nombreuses espèces à distribution locale ou à aire disjointe surajoutée au cortège de base, commun à la plupart de ces pelouses. A côté de ces variations géographiques, la nature de ces pelouses dépend aussi, pour une grande part, du régime hydrique, des caractéristiques du substrat et des pratiques agro-pastorales, notamment si elles sont fauchées ou pâturées et selon l\'intensité de ces actions. En particulier, l\'abondance relative des espèces principales de graminées, Bromus erectus, Brachypodium pinnatum s.l., Sesleria albicans et Koeleria pyramidata, varie à la fois géographiquement avec les conditions climatiques et localement avec la topographie et le régime agro-pastoral. Ainsi, bien que des entités séparées géographiquement puissent différer par l\'abondance relative de ces graminées, des faciès se différenciant pareillement peuvent aussi coexister localement, engendrant des habitats nettement distincts. Pour tenir compte de ces causes de variations, les formations dominées par Brachypodium ou par Sesleria, de même que les formations semi-humides, n\'ont pas été prises en compte ici et ont été placées en 34.323, 34.324 et 34.325. Des subdivisions géographiques, plus en mesure de permettre l\'identification de communautés végétales et animales distinctes, peuvent être utilisées dans les quatre sections par l\'introduction d\'une quatrième décimale après le point commun à toutes. Les régions incluses dans les subdivisions géographiques correspondant à chaque valeur de ce quatrième chiffre sont, dans tous les cas décrits, dans cette section, même si pour certaines d\'entre elles, ou pour certaines parties d\'entre elles, il se peut qu\'elles ne soient pas des pelouses appartenant à 34.322, mais seulement des pelouses appartenant aux unités 34.323, 34.324 ou 34.325 ; ces cas ont été, autant que possible, identifiés sous chacune des subdivisions suivantes.'),
(9981, 'NR', 22, '34.621', '', '', 'Iberian esparto steppes', '', 5, 'Niveau 5', 4328, '/67/490/1295/4328/9981', 'false', 'Sometimes extensive Lygeum spartum-dominated formations of the Ebro basin, the arid Iberian Southeast and the Guadalquivir basin.', '', 'Pas de description disponible'),
