(9984, 'NR', 22, '34.631', '', '', 'Berceales', '', 5, 'Niveau 5', 4329, '/67/490/1295/4329/9984', 'false', 'Stipa gigantea-dominated formations of central and southern Spain, mostly on siliceous soils.', '', 'Pas de description disponible'),
(9985, 'NR', 22, '34.632', 'Steppes méditerranéennes à Stipa', '', 'Mediterranean feathergrass steppes', '', 5, 'Niveau 5', 4329, '/67/490/1295/4329/9985', 'true', 'Meso- and thermo-Mediterranean formations of Spain, Italy, Greece and southern France, dominated by tall perennial grasses of genera Stipa (S. lagascae, S. offneri i.a.) or Piptatherum (Oryzopsis), other than the very tall Stipa tenacissima or S. gigantea.', 'Centaureo-Stipetum lagascae, Inulo-Oryzopsietum milliaceae i.a.', 'Formations méso- et thermo-méditerranéennes du sud de la France, ..., dominées par les grandes graminées vivaces des genres Stipa (S. offneri i.a.) ou Piptatherum (Oryzopsis), autres que les très grands Stipa tenacissima.'),
(9986, 'NR', 22, '34.633', '', '', 'Diss steppes', '', 5, 'Niveau 5', 4329, '/67/490/1295/4329/9986', 'false', 'Formations of Italy, Spain and Greece, dominated by Ampelodesmos mauritanica; many chamaephyte and diss formations have the physiognomy of a garrigue or a brush and have been listed under 32.23.', '', 'Pas de description disponible'),
(9987, 'NR', 22, '34.634', 'Steppes à Andropogon', '', 'Andropogonid grass steppes', '', 5, 'Niveau 5', 4329, '/67/490/1295/4329/9987', 'true', 'Meso- and thermo-Mediterranean steppes of Spain, Italy, Greece and southern France, constituted by cespitose andropogonid grasses such as Hyparrhenia hirta, Andropogon distachyos, Heteropogon contortus, Dichanthium insculptum, D. ischaemum or Chrysopogon gryllus.', 'Lygeo-Stipetea p.: Hyparrhenietalia hirtae i.a.; Brachypodio-Chrysopogonetea p.', 'Steppes méso- et thermo-méditerranéennes du sud de la France, ..., constituées par des graminées andropogonides cespiteuses telles que Hyparrhenia hirta, Andropogon distachyos, Heteropogon contortus, Dichanthium ischaemum ou Chrysopogon gryllus.'),
(9988, 'NR', 22, '34.635', '', '', 'Andalusian fescue and oat grasslands', '', 5, 'Niveau 5', 4329, '/67/490/1295/4329/9988', 'false', 'Meso- and supra-Mediterranean grasslands of the Baetic region dominated by the tall, cespitose Festuca scariosa, F. capillifolia, Arrhenatherum album, Helictotrichon filifolium and H. sarracenorum.', 'Festucion scariosae', 'Pas de description disponible'),
(9989, 'NR', 22, '36.311', 'Nardaies mésophiles pyrénéo-alpines', '', 'Pyreneo-Alpine mesophile mat-grasslands', '', 5, 'Niveau 5', 4323, '/67/495/1297/4323/9989', 'true', 'Subalpine and lower alpine mesophile grasslands dominated by, or rich in, Nardus stricta, of the Alps, the Pyrenees and, very locally, the Central Massif, the Jura and the northern Apennines; for the most part, they are heavily grazed grasslands with much reduced species diversity and overwhelming dominance of mat-grass.', 'Nardetum alpigenum = Geo montani-Nardetum, Aveno versicoloris-Nardetum, Leontodonto-Alchemilletum alpinae, Nardo strictae-Polygaletum serpyllaceae, Alchemillo flabellatae-Nardetum strictae i.a.', 'Pelouses mésophiles des étages subalpin et alpin inférieur dominées par, ou riches en, Nardus stricta, des Alpes, des Pyrénées et, très localement du Massif central, du Jura ; il s\'agit pour la plupart de pelouses fortement pâturées avec un diversité d\'espèces très réduite et une dominance énorme du Nard raide.'),
(9990, 'NR', 22, '36.312', 'Nardaies pyrénéo-alpines hygrophiles', '', 'Pyreneo-Alpine hygrophile mat-grass swards', '', 5, 'Niveau 5', 4323, '/67/495/1297/4323/9990', 'true', 'Subalpine and alpine hygro-mesophile, chionophilous mat-grass swards of depressions and humid flats around lakes and marshes, where snow melts slowly.', 'Selino pyrenaei-Nardetum strictae, Ranunculo pyrenaei-Nardetum strictae p., Nardetum alpigenum p.', 'Pelouses subalpines et alpines, hygromésophiles, chionophiles à Nard raide, des dépressions et replats humides autour des lacs et des marais, où la neige fond lentement.'),
(9991, 'NR', 22, '36.313', 'Pelouses pyrénéo-alpines hygrophiles à Vulpins', '', 'Pyreneo-Alpine hygrophile foxtail swards', '', 5, 'Niveau 5', 4323, '/67/495/1297/4323/9991', 'true', 'Subalpine and alpine hygro-mesophile, chionophilous grasslands of depressions with prolonged snow cover dominated by Alopecurus gerardii and Trifolium alpinum; they constitute a transition between siliceous grasslands and snowpatch communities, which they often ring.', 'Trifolio alpini-Alopecuretum gerardii, Ranunculo pyrenaicae-Alopecuretum gerardii p.', 'Prairies subalpines et alpines, hygromésophiles, chionophiles des dépressions longuement recouvertes par la neige dominées par Alopecurus gerardii et Trifolium alpinum ; elles constituent une transition entre les prairies siliceuses et les communautés des combes à neige, qu\'elles entourent souvent.'),
(9992, 'NR', 22, '36.314', 'Pelouses pyrénéennes fermées à Festuca eskia', '', 'Pyrenean closed Festuca eskia grasslands', '', 5, 'Niveau 5', 4323, '/67/495/1297/4323/9992', 'true', 'Subalpine and lower alpine closed mesophile Festuca eskia grasslands of north-facing slopes (ubacs) and depressions in the Pyrenees with Arnica montana, Ranunculus pyrenaeus, Selinum pyrenaeum, Trifolium alpinum, Campanula barbata, Gentiana punctata, Leucorchis albida, Phyteuma betonicifolium.', '', 'Pelouses mésophiles fermées, des étages subalpin et alpin inférieur à Festuca eskia des versants exposés au nord (ubacs) et des dépressions des Pyrénées avec Arnica montana, Ranunculus pyrenaeus, Selinum pyrenaeum, Trifolium alpinum, Campanula barbata, Gentiana punctata, Pseudorchis albida, Phyteuma betonicifolium.'),
