(9994, 'NR', 22, '61.111', 'Eboulis à Oxyria digyna', '', 'Mountain sorrel screes', '', 5, 'Niveau 5', 4332, '/69/497/1300/4332/9994', 'true', 'Typical Alpine and Pyrenean stabilized silicate screes, poor in humus, characterized by Oxyria digyna and with Cerastium uniflorum, Doronicum clusii, D. grandiflorum, Poa laxa.', 'Oxyrietum digynae i.a.', 'Eboulis siliceux stabilisés typiquement alpiens et pyrénéens, pauvres en humus, caractérisés par Oxyria digyna, avec Cerastium uniflorum, Doronicum clusii, D. grandiflorum, Poa laxa.'),
