(9347, 'NR', 22, '15.811', 'Steppes à Lavande de mer ibériques', '', '', '', 5, 'Niveau 5', 3901, '/65/477/1192/3901/9347', 'true', '', '', 'Pas de description disponible'),
(9348, 'NR', 22, '15.911', '', '', 'Meseta gypsum scrubs', '', 5, 'Niveau 5', 3903, '/65/477/1193/3903/9348', 'false', 'Formations of the central meseta dominated by, or rich in, Centaurea hyssopifolia.', '', 'Pas de description disponible'),
(9349, 'NR', 22, '15.912', '', '', 'Eastern Andalusian gypsum scrubs', '', 5, 'Niveau 5', 3903, '/65/477/1193/3903/9349', 'false', 'Formations of eastern Andalusia (Armeria, Granada) dominated by, or rich in, Centaurea hyssopifolia, Jurinea pinnata or Gypsophila struthium.', '', 'Pas de description disponible'),
(9350, 'NR', 22, '15.913', '', '', 'Dueran gypsum scrubs', '', 5, 'Niveau 5', 3903, '/65/477/1193/3903/9350', 'false', 'Formations of the central Duero with Linum suffruticosum and Lepidium subulatum.', '', 'Pas de description disponible'),
(9351, 'NR', 22, '15.921', '', '', 'Gypsophila hispanica garrigues', '', 5, 'Niveau 5', 3904, '/65/477/1193/3904/9351', 'false', 'Open formations dominated by, or very rich in, Gypsophila hispanica, the most widespread northeastern gypsum scrub component.', '', 'Pas de description disponible'),
(9352, 'NR', 22, '15.922', '', '', 'Helianthemum squamatum garrigues', '', 5, 'Niveau 5', 3904, '/65/477/1193/3904/9352', 'false', 'Formations of Helianthemum squamatum, often very homogeneous.', '', 'Pas de description disponible'),
(9353, 'NR', 22, '15.923', '', '', 'Ononis tridentata garrigues', '', 5, 'Niveau 5', 3904, '/65/477/1193/3904/9353', 'false', 'Formations of somewhat deeper calcaro-gypsiferous soils, rich in Ononis tridentata.', '', 'Pas de description disponible'),
(9354, 'NR', 22, '15.611', 'Tapis d\'Arthrocnemum perennis', '', 'Creeping glasswort mats', '', 5, 'Niveau 5', 3883, '/65/477/1185/3883/9354', 'true', 'Prostrate Arthrocnemum perenne carpets of wettest areas of coastal marshes.', 'Arthrocnemenion perennis: Puccinellio festuciformis-Arthrocnemetum perennis, Halimiono portulacoidis-Sarcocornietum alpini', 'Tapis prostrés de Sarcocornia perennis (Arthrocnemum perenne), des dépressions les plus mouillées des marais salés côtiers.'),
(9730, 'NR', 22, '41.133', 'Hêtraies à Dentaires', '', 'Bittercress beech forests', '', 5, 'Niveau 5', 4144, '/68/492/1278/4144/9730', 'true', 'Montane beech or beech-fir (43.133) formations of the Jura, the northern Alps and the great Hercynian ranges.', 'Lonicero alpigenae-Fagenion: Abieti-Fagetum, Dentario enneaphyllidi-Fagetum, Aposeri-Fagetum, Dentario heptaphyllidi-Fagetum, Cardamino trifoliae-Fagetum', 'Hêtraies ou hêtraies-sapinières (43.133) montagnardes du Jura, du nord des Alpes et des grands massifs hercyniens.'),
(9731, 'NR', 22, '42.314', 'Forêts de Mélèzes et d\'Arolles à Calamagrostis', '', 'Small-reed larch-arolla forests', '', 5, 'Niveau 5', 4239, '/68/491/1267/4239/9731', 'false', 'Forests of adrets, usually open, with Larix decidua dominant, Pinus cembra and Picea abies in enclaves, and an undergrowth less rich in heaths but more in gramineous stands with Calamagrostis villosa and woodrushes.', 'Larici-Cembretum calamagrostietosum villosae', 'Forêts d\'adret, généralement ouvertes, à Larix decidua dominant, à Pinus cembra et Picea abies en enclaves, et à sous-bois moins riches en Ericacées et plus riches en Graminées avec Calamagrostis villosa et des Luzules.'),
(9732, 'NR', 22, '42.315', 'Forêts de Mélèze et d\'Arolles à Pin mugo', '', 'Dwarf pine larch-arolla forests', '', 5, 'Niveau 5', 4239, '/68/491/1267/4239/9732', 'false', 'Xerophile forests of adrets with Pinus mugo.', 'Larici-Cembretum mugetosum', 'Forêts xérophiles d\'adret avec Pinus mugo.'),
(9733, 'NR', 22, '42.316', 'Forêts de Mélèzes et d\'Arolles avec Genévriers nains', '', 'Dwarf juniper larch-arolla forests', '', 5, 'Niveau 5', 4239, '/68/491/1267/4239/9733', 'false', 'Xerophile forests of adrets with Juniperus nana and Arctostaphylos uva-ursi.', 'Larici-Cembretum juniperetosum', 'Forêts xérophiles d\'adrets avec Juniperus nana et Arctostaphylos uva-ursi.'),
(9734, 'NR', 22, '42.317', 'Forêts de Mélèzes et d\'Arolles à Aulnes verts et hautes herbes', '', 'Green alder and tall herb arolla-larch forests', '', 5, 'Niveau 5', 4239, '/68/491/1267/4239/9734', 'false', 'Hygrophile forests of stations with prolonged snow cover on lime-poor or lime-rich oligotrophic substrates, usually dominated by Pinus cembra.', 'Larici-Cembretum alnetosum viridis', 'Forêts hygrophiles de stations ayant une couverture nivale prolongée sur substrats oligotrophes pauvres ou riches en carbonates, généralement dominées par Pinus cembra.'),
(9735, 'NR', 22, '42.318', 'Forêts de Mélèzes et d\'Arolles à Lichens', '', 'Lichen larch-arolla forests', '', 5, 'Niveau 5', 4239, '/68/491/1267/4239/9735', 'false', 'Forests of stabilized block screes, dominated by Larix decidua or Larix decidua and Pinus cembra, often with Betula spp. and Pinus mugo.', 'Larici-Cembretum cladonietosum', 'Forêts sur des éboulis stabilisés de blocs, dominées par Larix decidua ou Larix decidua et Pinus cembra, avec souvent Betula spp. et Pinus mugo.'),
(9736, 'NR', 22, '42.319', 'Forêts d\'Arolles à Sphaignes', '', 'Peatmoss arolla forests', '', 5, 'Niveau 5', 4239, '/68/491/1267/4239/9736', 'false', 'Forests of the edge of peatbogs, generally with Pinus cembra and no Larix decidua, accompanied by Pinus mugo, Eriophorum spp. and Andromeda polifolia.', 'Larici-Cembretum sphagnetosum', 'Forêts de bord de tourbières, avec généralement Pinus cembra et sans Larix decidua, accompagnées de Pinus mugo, Eriophorum spp. et Andromeda polifolia.'),
(9737, 'NR', 22, '41.B11', 'Bois de Bouleaux humides', '', 'Humid birch woods', '', 5, 'Niveau 5', 4159, '/68/492/1251/4159/9737', 'true', 'Formations usually formed by Betula pubescens, with Molinia caerulea and sometimes Deschampsia flexuosa, developed on podzolized and hydromorphic soils, as substitution facies of oak and birch woods, or colonization stages of Molinion grasslands or humid heaths.', '', 'Formations usuellement formées par Betula pendula, avec Molinia caerulea et quelquefois Deschampsia flexuosa, développées sur des sols podzolisés et hydromorphes, comme des faciès de substitution aux bois de Chênes et de Bouleau, ou comme des étapes de colonisation des prairies à Molinion ou des landes humides.'),
(9738, 'NR', 22, '41.B12', 'Bois de Bouleaux secs acidiphiles médio-européens', '', 'Medio-European dry acidophilous birch woods', '', 5, 'Niveau 5', 4159, '/68/492/1251/4159/9738', 'true', 'Formations usually formed by Betula pendula, or, in the British Isles, B. pubescens, with Deschampsia flexuosa, Agrostis tenuis, Festuca ovina, Vaccinium myrtillus, developed notably on sands, gravels, moraines and decalcified alluvions of northern and middle European plains and hills, as substitution facies of acidophilous oak woods (Fago-Quercetum, Blechno-Quercetum petraeae, Rusco-Quercetum, Luzulo-Quercetum), occasionally of oak-hornbeam woods (particularly mixed Atlantic bluebell oak forests, Endymio-Carpinetum), or colonization stages of dry heaths and decalcified dunes.', '', 'Formations usuellement formées par Betula pendula, ou, dans les îles Britanniques, par B. pubescens, avec Deschampsia flexuosa, Agrostis tenuis, Festuca ovina, Vaccinium myrtillus, notablement développées sur des sables, des graviers, des moraines et des alluvions décalcifiés des plaines et collines d\'Europe moyenne et septentrionale, comme des faciès de substitution des chênaies acidiphiles (Fago-Quercetum, Blechno-Quercetum petraeae, Rusco-Quercetum, Luzulo-Quercetum), occasionnellement des chênaies-charmaies (en particulier les chênaies mixtes atlantiques à Jacinthe des bois, Endymio-Carpinetum), ou comme des étapes de colonisation des landes sèches et dunes décalcifiées.'),
(9739, 'NR', 22, '41.141', 'Hêtraies pyrénéennes hygrophiles', '', 'Hygrophile Pyrenean beech forests', '', 5, 'Niveau 5', 4160, '/68/492/1278/4160/9739', 'true', 'Humid montane beech and beech-fir (43.141) forests on neutral soils with mild humus (mull) of the western Pyrenees, characterized by the vernal bloom of Scilla lilio-hyacinthus and Lathraea clandestina and by a summer cover rich in ferns (Athyrium filix-femina, Gymnocarpium dryopteris, Asplenium scolopendrium, Dryopteris spp., Polystichum spp.) and species of the ecological group of Melica uniflora and Galium odoratum; they are locally represented in the eastern Pyrenees and the Montes Olositanicos.', 'Scillo-Fagetum p.', 'Hêtraies et hêtraies-sapinières (43.141) montagnardes humides sur sols neutres avec un humus doux (mull) de l\'ouest des Pyrénées, caractérisées par la floraison vernale de Scilla lilio-hyacinthus et Lathraea clandestina, et richement pourvues en été de fougères (Athyrium filix-femina, Gymnocarpium dryopteris, Asplenium scolopendrium, Dryopteris spp., Polystichum spp.) et d\'espèces du groupe écologique de Melica uniflora et Galium odoratum ; elles sont localement représentées dans les Pyrénées orientales.'),
(9740, 'NR', 22, '41.142', 'Hêtraies pyrénéennes mésophiles', '', 'Mesophile Pyrenean beech forests', '', 5, 'Niveau 5', 4160, '/68/492/1278/4160/9740', 'true', 'Neutrophilous mesophile beech forests of the Pyrenees, the Montes Olositanicos and the northern Montes Catalanidicos, less species-rich than the preceding, characterized by the abundance of Helleborus viridis ssp. occidentalis.', 'Helleboro-Fagetum', 'Hêtraies neutrophiles et mésophiles des Pyrénées, ... et du nord des monts Catalans, moins riches en espèces que les précédentes, caractérisées par l\'abondance d\'Helleborus viridis spp. occidentalis.'),
(9741, 'NR', 22, '41.143', 'Hêtraies oro-cantabriques sub-humides', '', 'Sub-humid oro-Cantabrian beech forests', '', 5, 'Niveau 5', 4160, '/68/492/1278/4160/9741', 'true', 'Neutrophilous beech forests of the subhumid montane areas of the Cantabrian mountains and, locally, of the Northern Iberian Range, with Carex sylvatica, Galium odoratum, Lathyrus occidentalis, Melica uniflora, Mercurialis perennis, Paris quadrifolia, Scilla lilio-hyacinthus.', 'Carici sylvaticae-Fagetum', 'Hêtraies neutrophiles des secteurs montagnards subhumides des montagnes cantabriques et, localement, du nord du domaine ibérique, avec Carex sylvatica, Galium odoratum, Lathyrus occidentalis, Melica uniflora, Mercurialis perennis, Paris quadrifolia, Scilla lilio-hyacinthus.'),
(9742, 'NR', 22, '42.321', 'Forêts d\'Arolles et de Mélèzes et d\'Arolles à Rhododendron cilié', '', 'Hairy alpenrose arolla and larch-arolla forests', '', 5, 'Niveau 5', 4158, '/68/491/1267/4158/9742', 'false', 'Forests of the intermediate Alps and the northeastern outer Alps, developed in particular on hard limestone plateaux.', 'Larici-Cembretum rhododendretosum hirsuti', 'Forêts des Alpes intermédiaires et des Alpes externes nord-orientales, développées en particulier sur des plateaux de calcaires durs.'),
(9743, 'NR', 22, '42.322', 'Forêts de Mélèzes sur calcaires', '', 'Limestone larch forests', '', 5, 'Niveau 5', 4158, '/68/491/1267/4158/9743', 'false', 'Calcicolous Larix decidua or Larix decidua-Picea abies forests, mostly of the outer Alps, in which Pinus cembra is rare or absent.', 'Laricetum', 'Forêts calcicoles de Larix decidua ou de Picea abies, surtout dans les Alpes externes, où le Pinus cembra est rare ou absent.'),
(9744, 'NR', 22, '41.B13', '', '', 'Iberian acidophilous birch woods', '', 5, 'Niveau 5', 4159, '/68/492/1251/4159/9744', 'false', 'Medio-European acidophilous birch woods of the collinar and lower montane levels of northwestern Iberia, formed by Betula pendula or B. celtiberica as substitution stages of acidophilous oak woods.', 'Holco mollis-Betuletum celtibericae i.a.', 'Pas de description disponible');
INSERT INTO `corine` (`CD_HAB`, `FG_VALIDITE`, `CD_TYPO`, `LB_CODE`, `LB_HAB_FR`, `LB_HAB_FR_COMPLET`, `LB_HAB_EN`, `LB_AUTEUR`, `NIVEAU`, `LB_NIVEAU`, `CD_HAB_SUP`, `PATH_CD_HAB`, `FRANCE`, `LB_DESCRIPTION`, `CRSP_PHYTO_CB91`, `DESCRIPTIF_CB97_FR`) VALUES
(9745, 'NR', 22, '41.B14', '', '', 'Insubrian acidophilous birch woods', '', 5, 'Niveau 5', 4159, '/68/492/1251/4159/9745', 'false', 'Birch woods of the collinar and lower montane levels of northern Italy, dispersed in the Alpine foothills where they constitute substitution stages of the Insubrian acidophilous oak woods (Castaneo-Quercetum p.), on the fluvio-glacial terraces of the Po system, as facies of the acidophilous pine-birch-oak woods, and in the Euganean hills.', '', 'Pas de description disponible'),
(9746, 'NR', 22, '41.B15', '', '', 'Heavy-metal birch woods', '', 5, 'Niveau 5', 4159, '/68/492/1251/4159/9746', 'false', 'Sub-climax birch woods occupying soils intoxicated by heavy metals, with an herb layer that may include metallophytes and habitually calciphile species.', '', 'Pas de description disponible'),
(9747, 'NR', 22, '41.B16', 'Bois de Bouleaux de dunes', '', 'Dune birch woods', '', 5, 'Niveau 5', 4159, '/68/492/1251/4159/9747', 'true', 'Birch woods formed by Betula pubescens, B. pendula and Populus canescens with Viola hirta, Ligustrum vulgare, Polygonatum odoratum, in calcareous North Sea and Baltic dunes.', 'Crataego-Betuletum', 'Bois de Bouleaux formés par Betula pubescens, B. pendula, Populus canescens avec Viola hirta, Ligustrum vulgare, Polygonatum odoratum, dans les dunes calcaires de la mer du Nord et de la mer Baltique.'),
(9748, 'NR', 22, '41.B31', 'Bois de Bouleaux en limite forestière dans les Alpes', '', 'Alpine treeline birch woods', '', 5, 'Niveau 5', 4164, '/68/492/1251/4164/9748', 'true', 'Tree-limit birch stands, of local distribution in the Alps.', '', 'Stations de Bouleaux à la limite des arbres, de distribution locale dans les Alpes.'),
(9749, 'NR', 22, '41.B32', 'Massifs forestiers de Bouleaux', '', 'Birch block forests', '', 5, 'Niveau 5', 4164, '/68/492/1251/4164/9749', 'true', 'Birch stands, mostly of Betula pubescens (B. carpatica, B. tortuosa), occupying, in the Alps, the Jura and the Hercynian ranges, cold stations on cliff-base rocky screes and boulder-falls through which cold air flows.', 'Betulo-Sorbetum aucuparia i.a.', 'Stations à Bouleaux, principalement de Betula pubescens (B. carpatica, B. tortuosa), occupant, dans les Alpes, le Jura et les chaînes hercyniennes des stations froides sur des éboulis rocheux à la base de falaises et de fronts de moraines traversées par des courants d\'air froid.'),
(9750, 'NR', 22, '41.B33', 'Bois de Bouleaux pyrénéens', '', 'Pyrenean birch woods', '', 5, 'Niveau 5', 4164, '/68/492/1251/4164/9750', 'true', 'Birch-dominated formations of the Pyrenees, locally frequent in all vegetation levels.', '', 'Formations des Pyrénées dominées par des Bouleaux, localement fréquentes dans tous les étages de la végétation.'),
(9997, 'NR', 22, '53.113', 'Phagmitaies géantes', '', 'Giant Phragmites beds', '', 5, 'Niveau 5', 4343, '/71/513/1368/4343/9997', 'true', 'Formations of the very tall Phragmites \"maximus\", occurring locally in the Mediterranean basin, in particular on islets of lagoons of the east coast of Spain, where they harbour the very local, spectacular Kosteletzkya pentacarpos.', '', 'Formations à très grands Phragmites \"maximus\", distribuées localement dans le bassin méditerranéen, en particulier sur les îlots des lagunes.'),
(9998, 'NR', 22, '53.141', 'Communautés de Sagittaires', '', 'Arrowhead communities', '', 5, 'Niveau 5', 4335, '/71/513/1368/4335/9998', 'true', 'Formations of Sagittaria sagittifolia and Sparganium emersum of slowly flowing, and sometimes standing, meso-eutrophic waters.', 'Sagittario-Sparganietum emersi', 'Formations de Sagittaria sagittifolia et Sparganium emersum d\'eaux méso-eutrophes à écoulement lent ou parfois stagnantes.'),
(9999, 'NR', 22, '53.142', 'Communautés à Rubanier négligé', '', 'Neglected bur-reed communities', '', 5, 'Niveau 5', 4335, '/71/513/1368/4335/9999', 'true', 'Formations dominated by Sparganium neglectum, characteristic of standing or slowly flowing waters on mineral-rich, lime-poor muddy substrates.', 'Glycerio-Sparganietum neglecti', 'Formations dominées par Sparganium neglectum, caractéristiques des eaux stagnantes ou à écoulement lent sur des substrats vaseux riches en minéraux et pauvres en calcaires.'),
(10000, 'NR', 22, '54.254', '', '', 'Cantabrian yellow sedge fens', '', 5, 'Niveau 5', 4474, '/71/504/1359/4474/10000', 'false', 'Rare exiguous alkaline spring and gulley communities of the montane level of the Cordillera Cantabrica, with Carex lepidocarpa, C. demissa, C. davalliana, C. equinata, C. nigra, C. panicea, Eriophorum latifolium, Eleocharis quinqueflora, Juncus articulatus, J. alpestris, Equisetum variegatum, Pinguicula grandiflora, Parnassia palustris and, in more eastern communities, Tofieldia caliculata, Primula farinosa, Bartsia alpina.', 'Pinguiculo grandiflorae-Caricetum lepidocarpae, Primulo farinosae-Caricetum lepidocarpae', 'Pas de description disponible'),
(10001, 'NR', 22, '54.255', '', '', 'Eastern Iberian rich fens', '', 5, 'Niveau 5', 4474, '/71/504/1359/4474/10001', 'false', 'Calcareous fens of the southern Iberian Range (Sierra de Gudar, Sierra de Javalambre).', '', 'Pas de description disponible'),
(10002, 'NR', 22, '54.256', '', '', 'Flea sedge fens', '', 5, 'Niveau 5', 4474, '/71/504/1359/4474/10002', 'false', 'Fen formations intermediate between the Caricion davallianae and the Caricion fuscae, often developed in ecotonal situations, with Carex pulicaris and C. dioica, dispersed over a fairly wide range in continental middle Europe.', 'Parnassio-Caricetum pulicaris, Campylio-Caricetum dioicae', 'Pas de description disponible'),
(10003, 'NR', 22, '61.112', 'Eboulis à Androsace alpina', '', 'Rock jasmine screes', '', 5, 'Niveau 5', 4332, '/69/497/1300/4332/10003', 'true', 'Stony silicate screes of the high alpine and nival levels of the central Alps, with Androsace alpina.', 'Androsacetum alpinae', 'Eboulis pierreux silicatés des étages alpin supérieur et nival des Alpes centrales, avec Androsace alpina.'),
(10004, 'NR', 22, '61.113', 'Eboulis à Luzule alpine', '', 'Alpine woodrush screes', '', 5, 'Niveau 5', 4332, '/69/497/1300/4332/10004', 'true', 'Humid, humus-rich silicate screes of slopes long-covered with snow, carpeted by the alpine woodrush, Luzula alpinopilosa.', 'Luzuletum spadiceae', 'Eboulis siliceux humides, riches en humus, des versants longuement recouverts par la neige, tapissés de Luzule alpine, Luzula alpinopilosa.'),
(10005, 'NR', 22, '61.114', 'Eboulis siliceux et froids de blocailles', '', 'Cold silicate block screes', '', 5, 'Niveau 5', 4332, '/69/497/1300/4332/10005', 'true', 'Non-stablized, shady sub-alpine silicate screes with a high proportion of large blocks, colonized by ferns and brambles.', 'Rubo-Dryopteridetum disjunctae', 'Eboulis silicatés non stabilisés subalpins ombragés, avec une grande proportion de gros blocs, colonisés par des Fougères et des Ronces.'),
(10006, 'NR', 22, '53.143', 'Communautés à Rubanier rameux', '', 'Erect bur-reed communities', '', 5, 'Niveau 5', 4335, '/71/513/1368/4335/10006', 'true', 'Formations rich in Sparganium erectum, characteristic of riparian reedbeds along standing waters on lime-rich, mineral-rich muddy substrates.', 'Sparganietum erecti', 'Formations riches en Sparganium erectum, caractéristiques des roselières riveraines le long des eaux stagnantes, sur des substrats vaseux riches en calcaires et en minéraux.'),
(10007, 'NR', 22, '53.144', 'Communautés avec Acore vrai', '', 'Sweet flag communities', '', 5, 'Niveau 5', 4335, '/71/513/1368/4335/10007', 'true', 'Formations dominated by the long-introduced thermophile Acorus calamus.', 'Acoretum calami', 'Formations dominées par Acorus calamus thermophile et introduit depuis longtemps.'),
(10008, 'NR', 22, '53.145', 'Communautés à Jonc fleuri', '', 'Flowering rush communities', '', 5, 'Niveau 5', 4335, '/71/513/1368/4335/10008', 'true', 'Usually open formations dominated by, or rich in, Butomus umbellatus characteristic of strongly fluctuating still or slow-flowing base- and mineral -rich waters.', 'Butometum umbellati', 'Habituellement formations ouvertes dominées par, ou riches en, Butomus umbellatus caractéristique des eaux riches en bases et en minéraux, stagnantes, courantes ou à écoulement lent, à fort battement.'),
(10009, 'NR', 22, '53.146', 'Communautés d\'Oenanthe aquatica et de Rorippa amphibia', '', 'Water dropwort-great yellowcress communities', '', 5, 'Niveau 5', 4335, '/71/513/1368/4335/10009', 'true', 'Formations, often at the edges of reedbeds, rich in Oenanthe aquatica or Rorippa amphibia.', 'Oenantho-Rorippetum amphibiae', 'Formations, souvent du bord des roselières, riches en Oenanthe aquatica ou Rorippa amphibia.'),
(10010, 'NR', 22, '53.147', 'Communautés de Prêles d\'eau', '', 'Water horsetail beds', '', 5, 'Niveau 5', 4335, '/71/513/1368/4335/10010', 'true', 'Low, often extensive, homogeneous, usually inundated formations dominated by Equisetum fluviatile.', '', 'Formations basses, souvent étendues, homogènes, habituellement inondées, dominées par Equisetum fluviatile.'),
(10011, 'NR', 22, '53.148', 'Communautés de Grande Berle', '', 'Water parsnip communities', '', 5, 'Niveau 5', 4335, '/71/513/1368/4335/10011', 'true', 'Formations dominated by or rich in the tall umbellifer Sium latifolium.', '', 'Formations dominées par, ou riches en, Sium latifolium, une grande ombellifère.'),
(10012, 'NR', 22, '53.149', 'Végétation à Hippuris vulgaris', '', 'Marestail beds', '', 5, 'Niveau 5', 4335, '/71/513/1368/4335/10012', 'true', 'Formations, usually of still or running, clear, cold to temperate nutrient-rich water, dominated by Hippuris vulgaris.', '', 'Formations dominées par Hippuris vulgaris, des eaux stagnantes ou courantes, claires, froides et riches en nutriments.'),
(10013, 'NR', 22, '53.14A', 'Végétation à Eleocharis palustris', '', 'Common spikerush beds', '', 5, 'Niveau 5', 4335, '/71/513/1368/4335/10013', 'true', 'Low, often extensive and very homogeneous formations dominated by Eleocharis palustris.', '', 'Formations basses, souvent étendues, et très homogènes dominées par Eleocharis palustris.'),
(10014, 'NR', 22, '64.141', 'Peuplements de Juniperus communis sur dunes continentales', '', 'Inland dune juniper scrubs', '', 5, 'Niveau 5', 4353, '/69/512/1367/4353/10014', 'true', 'Juniperus communis-rich scrubs of inland dunes.', '', 'Fruticées, riches en Juniperus communis, de dunes continentales.'),
(10015, 'NR', 22, '64.142', 'Autres fourrés sur dunes continentales', '', 'Other inland dune thickets', '', 5, 'Niveau 5', 4353, '/69/512/1367/4353/10015', 'true', 'Thickets other than juniper scrubs in inland dune systems; their composition can be speccified by use of codes of 31.8.', '', 'Fourrés autres que des landes de Genévriers dans des systèmes dunaires continentaux ; leur composition peut être spécifiée par l\'utilisation des codes de 31.8.'),
(10016, 'NR', 22, '61.231', 'Eboulis à Petasites', '', 'Butterbur screes', '', 5, 'Niveau 5', 4357, '/69/497/1301/4357/10016', 'true', 'High montane and sub-alpine, relatively humid, fine limestone and marl screes, with Petasites paradoxus, Valeriana montana, Gypsophila repens.', 'Petasition paradoxi', 'Eboulis relativement humides de débris calcaires fins et marnes des étages montagnards supérieur et subalpin, avec Petasites paradoxus, Valeriana montana, Gypsophila repens.'),
(10017, 'NR', 22, '61.232', 'Eboulis à Liondent des montagnes', '', 'Mountain hawkbit screes', '', 5, 'Niveau 5', 4357, '/69/497/1301/4357/10017', 'true', 'Damp, marlo-calcareous screes of the alpine level of the Alps.', 'Leontodontetum montani i.a.', 'Eboulis marno-calcaires humides de l\'étage alpin des Alpes.'),
