(9752, 'NR', 22, '42.331', 'Forêts occidentales de Mélèzes et de Mélèzes et de Pins de montagne', '', 'Western larch and larch-mountain pine forests', '', 5, 'Niveau 5', 4169, '/68/491/1267/4169/9752', 'true', 'Forests of the western inner and intermediate Alps dominated by Larix decidua or by mixed Larix decidua and Pinus uncinata, with an occasional admixture of Pinus cembra or other conifers.', '', 'Forêts des Alpes occidentales internes et intermédiaires dominées par Larix decidua et Pinus uncinata, avec présence occasionnelle de Pinus cembra ou d\'autres conifères.'),
