(9759, 'NR', 22, '41.144', 'Hêtraies-sapinières humides du Massif central', '', 'Humid Central Massif fir-beech forests', '', 5, 'Niveau 5', 4160, '/68/492/1278/4160/9759', 'true', 'Fir-birch or beech forests of volcanic soils in the 1100-1600 metre range of the central and southern Massif Central, with Galium odoratum, Euphorbia hyberna, Lilium martagon, Scilla lilio-hyacinthus.', 'Scillo-Fagetum p.', 'Hêtraies-sapinières ou hêtraies développées sur des sols volcaniques, entre 1 100 et 1 600 mètres, dans le centre et le sud du Massif central, avec Galium odoratum, Euphorbia hyberna, Lilium martagon, Scilla lilio-hyacinthus.'),
(9760, 'NR', 22, '41.162', 'Hêtraies xérophiles nord-ouest ibériques', '', 'North-western Iberian xerophile beech woods', '', 5, 'Niveau 5', 4166, '/68/492/1278/4166/9760', 'false', 'Beech forests of relatively low precipitation zones of the southern ranges of the Pais Vasco and of superficially dry calcareous soils of the Cordillera Cantabrica, with Brachypodium pinnatum ssp. rupestre, Sesleria argentea ssp. hispanica, Carex brevicollis, C. ornithopoda, C. sempervirens, C. caudata, Cephalanthera damasomium, C. longifolia, Epipactis helleborine, E. microphylla, Neottia nidus-avis.', 'Epipactido helleborine-Fagetum', 'Hêtraies des zones de précipitations relativement faibles sur les versants méridionaux du Pays basque et sols calcaires superficiels secs de la Cordillère cantabrique, avec Brachypodium pinnatum spp. rupestre, Sesleria argentea spp. hispanica, Carex brevicollis, C. ornithopoda, C. sempervirens, Cephalanthera damasonium, C. longifolia, Epipactis helleborine, E. microphylla, Neottia nidus-avis.'),
(9761, 'NR', 22, '41.171', 'Hêtraies acidiphiles des Alpes méridionales et des Apennins', '', 'Southern Alpine and Apennine acidophilous beech forests', '', 5, 'Niveau 5', 4175, '/68/492/1278/4175/9761', 'true', 'Acidophilous forests with Luzula nivea and Luzula pedemontana of the Maritime, Ligurian, Insubrian and Illyro-Gardesian Alps and pre-Alps and of the northern and central Apennines.', 'Luzulo niveae-Fagetum, Luzulo pedemontanae-Fagetum', 'Forêts acidiphiles avec Luzula nivea et Luzula pedemontana des Alpes et pré-Alpes maritimes, ligures, insubriennes et illyro-gardésiennes et des Apennins septentrionaux et centraux.'),
(9762, 'NR', 22, '41.521', 'Forêts de Chênes sessiles du nord-ouest', '', 'North-western sessile oak forests', '', 5, 'Niveau 5', 4168, '/68/492/1252/4168/9762', 'true', 'Typical formations of the Baltic and North Sea plains, Picardy, Normandy, Perche, Paris region, western Morvan, Argonne, middle Belgium.', '', 'Formations typiques de la plaine de la mer du Nord et de la mer Baltique, la Picardie, la Normandie, le Perche, la région parisienne, le Morvan occidental, l\'Argonne, la Belgique centrale.'),
(9763, 'NR', 22, '41.522', 'Forêts armoricaine de Chênes sessiles', '', 'Armorican sessile oak forests', '', 5, 'Niveau 5', 4168, '/68/492/1252/4168/9763', 'true', 'Formations of Brittany, richer in epiphytes, mosses and evergreen shrubs, transitional to 41.53.', 'Polypodio-Quercetum', 'Formations de Bretagne, plus riches en épiphytes, en mousses et en arbustes sempervirents, formant la transition vers 41.53.'),
(9764, 'NR', 22, '41.523', 'Forêts sur dune', '', 'Dutch dune oak woods', '', 5, 'Niveau 5', 4168, '/68/492/1252/4168/9764', 'true', 'Oak formations on dunes of the Netherlands, with Acer pseudoplatanus, Euonymus europaeus, Primula vulgaris, Cynoglossum officinale, Cirsium palustre, Doronicum pardalianches, D. plantagineum, Convallaria majalis, Hyacinthoides non-scripta, Polygonatum odoratum, Ornithogalum umbellatum, Asparagus officinalis, Calamagrostis epigejos, Carex arenaria, Dryopteris carthusiana, D. dilatata, Mnium hornum.', 'Convallario-Quercetum dunense', 'Formations de Chênes sur dunes des Pays-Bas, avec Acer pseudoplatanus, Euonymus europaeus, Primula vulgaris, Cynoglossum officinale, Cirsium palustre, Doronicum pardalianches, D. plantagineum, Convallaria majalis, Hyacinthoides non-scripta, Polygonatum odoratum, Ornithogalum umbellatum, Asparagus officinalis, Calamagrostis epigejos, Carex arenaria, Dryopteris carthusiana, D. dilatata, Mnium hornum. A rechercher en France N-W.'),
(9765, 'NR', 22, '41.524', '', '', 'Pennine sessile oak-birch-wavy hairgrass woods', '', 5, 'Niveau 5', 4168, '/68/492/1252/4168/9765', 'false', 'Woods of Quercus petraea, Betula spp. and Sorbus aucuparia, with abundant ericoid shrubs, in particular Vaccinium myrtillus, Deschampsia flexuosa, ferns, notably Pteridium aquilinum and Dryopteris dilatata, and a rather sparse muscinal layer, which is, however, more diverse than in the next unit. They are characteristic of very acid soils on the Pennine fringes, in north-eastern England, the central Pennines, Lancashire, the Welsh border hills and the western Midlands.', '', 'Pas de description disponible'),
(9766, 'NR', 22, '41.525', '', '', 'English pedunculated oak-birch-wavy hairgrass woods', '', 5, 'Niveau 5', 4168, '/68/492/1252/4168/9766', 'false', 'Woods of Quercus robur and Betula pendula, occasionally Quercus petraea, with a species-poor field layer often almost limited to Deschampsia flexuosa and Pteridium aquilinum, with, locally, Calluna vulgaris and Vaccinium myrtillus, characteristic of very acid soils in central, south-eastern, and locally south-western, England. Differentiation from this unit of the uncommon English representatives of 41.51 is probably not well-marked and all highly acidophilous Q. robur stands are perhaps best listed here.', '', 'Pas de description disponible'),
(9767, 'NR', 22, '41.F11', 'Bois d\'Ormes à Violette odorante', '', 'Sweet violet elm woods', '', 5, 'Niveau 5', 4182, '/68/492/1257/4182/9767', 'true', 'Formations of the Low Countries, in particular of dunal regions, and of the Paris Basin.', 'Violo odoratae-Ulmetum i.a.', 'Formations des Pays-Bas, en particulier de régions dunaires et du Bassin parisien.'),
(9768, 'NR', 22, '41.172', 'Hêtraies acidiphiles des Pyrénées orientales et des Cévennes', '', 'Eastern Pyrenees and Cévennes acidophilous beech forests', '', 5, 'Niveau 5', 4175, '/68/492/1278/4175/9768', 'true', 'Similar acidophilous forests of the eastern Pyrenees and Cévennes, with L. nivea, clearly distinguished from forests of the Scillo-Fagenion by their impoverished herb layer, and replacing the more Atlantic forests of the Ilici-Fagenion.', '', 'Forêts acidiphiles identiques de l\'est des Pyrénées et des Cévennes, avec L. nivea, nettement distinctes des forêts du Scillo-Fagenion par leur strate herbacée appauvrie et remplaçant les forêts plus atlantiques de l\'Ilici-Fagenion.'),
(9769, 'NR', 22, '41.173', 'Hêtraies corses', '', 'Corsican beech forests', '', 5, 'Niveau 5', 4175, '/68/492/1278/4175/9769', 'true', 'Beech forests of Corsica, acidophilous, with Luzula pedemontana, Galium rotundifolium and insular endemics such as Helleborus lividus.', 'Poo-Fagetum, Helleboro lividi-Fagetum', 'Hêtraies de Corse, acidiphiles, avec Luzula pedemontana, Galium rotundifolium et des endémiques insulaires comme Helleborus lividus.'),
(9770, 'NR', 22, '41.174', 'Hêtraies neutrophiles des Alpes méridionales et des Apennins', '', 'Southern Alpine and Apennine neutrophile beech forests', '', 5, 'Niveau 5', 4175, '/68/492/1278/4175/9770', 'true', 'Neutrophile montane beech forests of the southwestern Alps, the Maritime Alps, the Ligurian Alps, the Insubrian, Gardesian and Illyric southern pre-Alps, the northern and central Apennines, with Trochischantes nodiflorus, Geranium nodosum, Calamintha grandiflora, various Dentaria.', 'Trochischanto-Fagetum, Geranio nodosi-Fagetum i.a.', 'Hêtraies montagnardes neutrophiles des Alpes sud-occidentales, des Alpes maritimes, des Alpes ligures, des pré-Alpes méridionales insubriennes et illyro-gardésiennes et des Apennins du nord et du centre, avec Trochischanthes nodiflorus, Geranium nodosum, Calamintha grandiflora, diverses Dentaria.'),
(10024, 'NR', 22, '53.211', 'Cariçaies à laîche distique', '', 'Brown sedge beds', '', 5, 'Niveau 5', 4360, '/71/513/1306/4360/10024', 'true', 'Formations of Carex disticha of humid alluvial meadows on clay and of temporarily drying peatbogs; often in contact with grasslands of the Calthion and sometimes placed in that alliance; they tolerate fairly long dessication and have a relatively rich accompanying flora.', 'Caricetum distichae', 'Formations de Carex disticha, de prairies humides alluviales sur argiles et des tourbières se desséchant temporairement ; souvent en contact avec des prairies du Calthion et quelquefois placées dans cette alliance ; elles tolèrent une exondation d\'assez longue durée et ont une flore compagne relativement riche.'),
(10025, 'NR', 22, '53.212', 'Cariçaies à laîche aiguë et communautés s\'y rapportant', '', 'Slender tufted sedge beds and related communities', '', 5, 'Niveau 5', 4360, '/71/513/1306/4360/10025', 'true', 'Formations dominated by Carex acuta, C. acutiformis or their relatives.', '', 'Formations dominées par Carex acuta, C. acutiformis ou des espèces voisines.'),
(10026, 'NR', 22, '61.341', 'Eboulis calcaires fins pyrénéens', '', 'Fine Pyrenean calcareous screes', '', 5, 'Niveau 5', 4376, '/69/497/1305/4376/10026', 'true', 'Fine limestone or calcschists on gentle slopes of the alpine level, with Iberis spathulata, Papaver suaveolens, Galium cometerhizon, Plantago monosperma, Viola lapeyrousiana, Campanula jaubertiana.', '', 'Calcaires fins ou calcschistes sur les versants à pente douce de l\'étage alpin, avec Iberis spathulata, Papaver lapeyrousianum, Galium cometerrhizon, Plantago monosperma, Viola lapeyrousiana, Campanula jaubertiana.'),
(10027, 'NR', 22, '61.342', 'Eboulis calcaires grossiers pyrénéens', '', 'Coarse Pyrenean calcareous screes', '', 5, 'Niveau 5', 4376, '/69/497/1305/4376/10027', 'true', 'Coarse, relatively dry screes on steep slopes, forming debris cones at the foot of cliffs, with Crepis pygmaea, Doronicum grandiflorum, Campanula cochleariaefolia, Carduus carlinoides, Galium cespitosum, Festuca glacialis.', '', 'Eboulis grossiers, relativement secs sur des versants raides, formant des cones de débris au pied des falaises, avec Crepis pygmaea, Doronicum grandiflorum, Campanula cochlearifolia, Carduus carlinoides, Galium cespitosum, Festuca glacialis.'),
(10028, 'NR', 22, '61.343', 'Eboulis calcaires des Pyrénées de haute altitude', '', 'High Pyrenean calcareous screes', '', 5, 'Niveau 5', 4376, '/69/497/1305/4376/10028', 'true', 'Flatish screes of high altitudes of the central Pyrenees, with Androsace ciliata, Saxifraga oppositifolia, Hutchinsia alpina, Galium pyrenaicum, Minuartia cerastiifolia.', '', 'Eboulis à faible déclivité des hautes altitudes des Pyrénées centrales, avec Androsace ciliata, Saxifraga oppositifolia, Hutchinsia alpina, Galium pyrenaicum, Minuartia cerastiifolia.'),
(10029, 'NR', 22, '61.344', 'Eboulis calcaires humides pyrénéens', '', 'Humid Pyrenean calcareous screes', '', 5, 'Niveau 5', 4376, '/69/497/1305/4376/10029', 'true', 'Damp, cool screes with prolonged snow cover, with Saxifraga praetermissa, S. aizoides, Epilobium anagallidifolium, Veronica alpina, Taraxacum alpinum.', '', 'Eboulis humides, froids avec une couverture de neige prolongée, avec Saxifraga praetermissa, S. aizoides, Epilobium anagallidifolium, Veronica alpina, Taraxacum alpinum.'),
(10030, 'NR', 22, '61.345', 'Eboulis calcaires subalpins pyrénéens', '', 'Subalpine Pyrenean calcareous screes', '', 5, 'Niveau 5', 4376, '/69/497/1305/4376/10030', 'true', 'Calcareous screes developed at the foot of the cliffs of the great calcareous ranges, with Crepis pygmaea, Carduus carlinoides and the endemics Borderea pyrenaica, Cirsium glabrum, Lithospermum gastonis, Iberis bernardiana, Armeria pubinervis.', '', 'Eboulis calcaires développés au pied de falaises des grands massifs calcaires, avec Crepis pygmaea, Carduus carlinoides, et les endémiques Borderea pyrenaica, Cirsium glabrum, Lithospermum gastonii, Iberis bernardiana, Armeria pubinervis.'),
(10031, 'NR', 22, '53.213', 'Cariçaies à Carex riparia', '', 'Greater pond sedge beds', '', 5, 'Niveau 5', 4360, '/71/513/1306/4360/10031', 'true', 'Formations of Carex riparia, mostly characteristic of larger valleys and southern regions, intolerant of dessication. They form on mineral or thinly peaty substrates, often in areas almost permenently inundated by somewhat lime-rich water.', 'Caricetum ripariae, Caricetum vulpino-ripariae, Leucojo-Caricetum ripariae', 'Formations à Carex riparia, pour la plupart caractéristiques des grandes vallées et des régions méridionales, ne tolérant pas l\'exondation. Ce sont des formations développées sur des substrats minéraux ou légèrement tourbeux, souvent dans des zones inondées de façon à peu près permanentes par des eaux quelque peu carbonatées.'),
(10032, 'NR', 22, '53.214', 'Cariçaies à Carex rostrata et à Carex vesicaria', '', 'Bottle and bladder sedge beds', '', 5, 'Niveau 5', 4360, '/71/513/1306/4360/10032', 'true', 'Formations of Carex vesicaria and C. rostrata of moderately to strongly acid, fairly constantly inundated soils and poor fens.', 'Caricetum vesicariae, Caricetum rostrato-vesicariae, Caricetum acuto-vesicariae', 'Formations à Carex rostrata et à Carex vesicaria sur des sols modérément à fortement acides, assez constamment inondés, et des bas-marais acides.'),
(10033, 'NR', 22, '53.215', 'Cariçaies à Carex elata et de Carex cespitosa', '', 'Tufted sedge and sward sedge tussocks', '', 5, 'Niveau 5', 4360, '/71/513/1306/4360/10033', 'true', 'Formations dominated by the large, tussock-forming Carex elata or its relatives.', '', 'Formations dominées par les grands touradons formés de Carex elata ou d\'espèces voisines.'),
(10034, 'NR', 22, '54.421', 'Bas-marais alpins à Carex fusca', '', 'Alpine black sedge fens', '', 5, 'Niveau 5', 4370, '/71/504/1314/4370/10034', 'true', 'Acidophilous small sedge communities of the alpine and subalpine levels of the Alps and Alpine periphery, occupying wet gentle slopes and plateaux where melt water lingers or encircling small lakes on the landward, usually emerged, side of the Eriophoretum scheuchzeri girdle. The sward is formed by Carex nigra, C. canescens, C. echinata, Juncus filiformis variously accompanied by Eriophorum angustifolium, Carex magellanica, C. lachenalii, C. norvegica, C. panicea, C. demissa, Phleum alpinum, Agrostis canina, Viola palustris, Parnassia palustris, Pedicularis palustris; the moss layer is formed by Scapania paludosa, Paludella squarrosa, Drepanocladus exannulatus, D. revolvens, D. intermedius, Calliergon stramineum, C. sarmentosum, Willemetia stipitata, Sphagnum recurvum.', 'Caricetum fuscae (Caricetum nigrae) s.s.', 'Communautés acidiphiles de petits Carex des étages apin et subalpin des Alpes et du pourtour des Alpes, occupant les versants humides à pente douce et les plateaux avec stagnation des eaux de fusion soit sur la bordure externe habituellement émergée de la ceinture, d\'Eriophorum scheuchzeri des petits lacs. La pelouse est formée de Carex nigra, C. canescens, C. echinata, Juncus filiformis, diversement accompagnés de Eriophorum angustifolium, Carex magellanica, C. lachenalii, C. norvegica, C. panicea, C. demissa, Phleum alpinum, Agrostis canina, Viola palustris, Parnassia palustris, Pedicularis palustris, Calycocorsus stipitatus ; la strate muscinale est formée de Scapania paludosa, Paludella squarrosa, Drepanocladus exannulatus, D. revolvens, D. intermedius, Calliergon stramineum, C. sarmentosum, Sphagnum recurvum.'),
(10035, 'NR', 22, '61.351', '', '', 'Oro-Cantabrian mobile calcareous screes', '', 5, 'Niveau 5', 4377, '/69/497/1305/4377/10035', 'false', 'Alti-montane, sub-alpine and alpine unstabilized calcareous screes of the Cordillera Cantabrica, made of stones of medium size, with Linaria filicaulis, Arabis cantabrica, Iberis lereschiana, Ranunculus parnassifolius ssp. favargeri, Crepis pygmaea.', '', 'Pas de description disponible'),
(10036, 'NR', 22, '61.352', '', '', 'Fine oro-Cantabrian calcareous screes', '', 5, 'Niveau 5', 4377, '/69/497/1305/4377/10036', 'false', 'Fine screes of the collinar and montane levels, with Iberis aperta and Rumex scutatus.', '', 'Pas de description disponible'),
(10037, 'NR', 22, '61.353', '', '', 'Chionophilous oro-Cantabrian calcareous screes', '', 5, 'Niveau 5', 4377, '/69/497/1305/4377/10037', 'false', 'Somewhat stabilized coarse screes of the sub-alpine and alpine levels, subjected to prolonged snow cover, characterized by Epilobium anagallidifolium, Doronicum grandiflorum ssp. braunblanquetii and Campanula arvatica.', '', 'Pas de description disponible'),
(10038, 'NR', 22, '61.354', '', '', 'Seeping oro-Cantabrian calcareous screes', '', 5, 'Niveau 5', 4377, '/69/497/1305/4377/10038', 'false', 'Fine screes of the sub-alpine and alpine levels, submitted to prolonged snow cover and waterlogging, with Saxifraga praetermissa, Arabis cantabrica and Ranunculus alpestris ssp. leroyi.', '', 'Pas de description disponible'),
(10039, 'NR', 22, '61.355', '', '', 'Oro-Cantabrian calcareous lapiaz screes', '', 5, 'Niveau 5', 4377, '/69/497/1305/4377/10039', 'false', 'Screes developed on the surface of frost-broken rocks in areas of short snow cover in the alpine and sub-alpine levels, with Salix breviserrata and Galium pyrenaicum.', '', 'Pas de description disponible'),
(10040, 'NR', 22, '61.391', '', '', 'Nevadan foxglove screes', '', 5, 'Niveau 5', 4381, '/69/497/1305/4381/10040', 'false', 'Screes at the sub-summital levels of the Sierra Nevada, between 1900 and 2900 metres, with Senecio tournefortii var. granatensis, Digitalis purpurea var. nevadensis, Cirsium gregarium, Solidago virgaurea var. alpestris, Holcus caespitosus, Crepis oporinoides, Eryngium glaciale, Linaria aeruginea var. nevadensis.', 'Digitali purpureae-Senecietum granatensis', 'Pas de description disponible'),
(10041, 'NR', 22, '53.216', 'Cariçaies à Carex paniculata', '', 'Greater tussock sedge tussocks', '', 5, 'Niveau 5', 4360, '/71/513/1306/4360/10041', 'true', 'Formations of large, usually well-spaced tussocks of Carex paniculata, of alkaline to acid, usually mesotrophic, often somewhat shady, habitually peaty stations, including marshy woods. C. paniculata is also a constituent of species-rich alkaline fen sedge communities.', 'Caricetum paniculatae, Galio palustri-Caricetum lusitanicae', 'Formations de grands touradons, habituellement bien espacés, de Carex paniculata de stations ordinairement sur des sols tourbeux ; alcalines à acides, habituellement mésotrophes, souvent quelque peu ombragées, incluant des bois marécageux. Carex paniculata est aussi un constituant de communautés de cariçaies de bas-marais alcalins riches en espèces.'),
(10042, 'NR', 22, '53.217', 'Cariçaies à Carex appropinquata', '', 'Fibrous tussock sedge tussocks', '', 5, 'Niveau 5', 4360, '/71/513/1306/4360/10042', 'true', 'Formations of Carex appropinquata, alone or mixed with C. paniculata, essentially of mesotrophic, basicline peaty or mineral soils.', 'Caricetum appropinquatae p.', 'Formations à Carex appropinquata, seul ou mélangé avec C. paniculata, essentiellement sur des sols mésotrophes, basiclines tourbeux ou minéraux.'),
(10043, 'NR', 22, '53.218', 'Cariçaies à Carex pseudocyperus', '', 'Cyperus sedge tussocks', '', 5, 'Niveau 5', 4360, '/71/513/1306/4360/10043', 'true', 'Formations of Carex pseudocyperus of mostly slightly acid peaty soils, in very wet situations.', 'Cicuto-Caricetum pseudocyperi', 'Formations à Carex pseudocyperus sur des sols le plus souvent tourbeux, légèrement acides, en situations très humides.'),
(9383, 'NR', 22, '16.226', 'Lisières des dunes thermophiles', '', 'Dune thermophile fringes', '', 5, 'Niveau 5', 3934, '/65/478/1195/3934/9383', 'true', 'Geranium sanguineum formations (34.4) incorporated within grey dune systems of the British Isles and Brittany.', 'Trifolio-Geranietea sanguinei: Galio maritimi-Geranion sanguinei', 'Formations à Geranium sanguineum (34.4) incorporées aux systèmes de dunes grises des îles Britanniques et de la Bretagne.'),
(9384, 'NR', 22, '16.227', 'Groupements dunaires à plantes annuelles', '', 'Dune fine-grass annual communities', '', 5, 'Niveau 5', 3934, '/65/478/1195/3934/9384', 'true', 'Sparse pioneer formations (35.2, 35.3) of fine grasses rich in spring-blooming therophytes characteristic of oligotrophic, superficial soils.', 'Thero-Airion p., Nardo-Galion saxatile p. (Botrychio-Polygaletum), Tuberarion guttatae p.', 'Formations pionnières clairsemées (35.2, 35.3) de graminées fines riches en thérophytes à floraison printannière caractéristiques des sols superficiels, oligotrophes.'),
(9385, 'NR', 22, '16.228', 'Groupements dunaires à Malcolmia', '', 'Dune malcolmia annual-herb communities', '', 5, 'Niveau 5', 3934, '/65/478/1195/3934/9385', 'true', 'Associations with many small annuals and often abundant ephemeral spring bloom (35.4), with Malcolmia lacera, M. ramosissima, Evax astericiflora, E. lusitanica, Anthyllis hamosa, Linaria pedunculata, of deep sands in dry interdunal depressions of Iberia, southern France and Italy.', 'Malcolmietalia', 'Communautés à nombreuses petites espèces annuelles à floraison printanière éphémère souvent abondantes (35.4), avec M. ramosissima, des sables profonds au niveau des dépressions sèches interdunales du sud de la France.');
INSERT INTO `corine` (`CD_HAB`, `FG_VALIDITE`, `CD_TYPO`, `LB_CODE`, `LB_HAB_FR`, `LB_HAB_FR_COMPLET`, `LB_HAB_EN`, `LB_AUTEUR`, `NIVEAU`, `LB_NIVEAU`, `CD_HAB_SUP`, `PATH_CD_HAB`, `FRANCE`, `LB_DESCRIPTION`, `CRSP_PHYTO_CB91`, `DESCRIPTIF_CB97_FR`) VALUES
(9386, 'NR', 22, '16.229', 'Pelouses dunaires méditerranéennes xériques', '', 'Dune Mediterranean xeric grasslands', '', 5, 'Niveau 5', 3934, '/65/478/1195/3934/9386', 'true', 'Dunal formations of 34.5.', 'Thero-Brachypodietalia p.', 'Formations dunaires de 34.5.'),
(9387, 'NR', 22, '16.22A', '', '', 'Canarian fixed dunes', '', 5, 'Niveau 5', 3934, '/65/478/1195/3934/9387', 'false', 'Fixed dunes of the Canary Islands, forming, mostly in the centre and east of the archipelago, extensive systems (jables), with Traganum moquinii, Suaeda vera, Atriplex halimus, A. glauca var. ifniensis, Salsola longifolia, S. vermiculata.', 'Traganion moquini', 'Pas de description disponible'),
(9388, 'NR', 22, '16.241', '', '', 'East Anglian ling dunes', '', 5, 'Niveau 5', 3936, '/65/478/1195/3936/9388', 'false', 'Calluna vulgaris-Carex arenaria heaths of East Anglian inner dunes.', 'Carici arenariae-Callunetum', 'Pas de description disponible'),
(9389, 'NR', 22, '16.242', 'Dunes françaises à bruyère', '', 'French ling dunes', '', 5, 'Niveau 5', 3936, '/65/478/1195/3936/9389', 'true', 'Calluna vulgaris-Carex trinervis heaths of northern French inner dunes.', 'Carici trinervis-Callunetum', 'Bruyères à Calluna vulgaris-Carex trinervis des dunes intérieures du nord de la France.'),
(9390, 'NR', 22, '16.243', '', '', 'British bell heather dunes', '', 5, 'Niveau 5', 3936, '/65/478/1195/3936/9390', 'false', 'Erica cinerea-Carex arenaria heaths of decalcified dunes of the west of the British Isles.', 'Carici arenariae-Ericetum cinereae', 'Pas de description disponible'),
(9391, 'NR', 22, '16.244', 'Dunes françaises à bruyère cendrée', '', 'French bell heather dunes', '', 5, 'Niveau 5', 3936, '/65/478/1195/3936/9391', 'true', 'Erica cinererea-Festuca vasconcensis heaths of dry dunes of southwestern France.', 'Festuco vasconcensis-Ericetum cinereae', 'Bruyères à Erica cinerea-Festuca vasconcensis des dunes sèches du sud-ouest de la France.'),
(9392, 'NR', 22, '22.341', 'Petits gazons amphibies méditerranéens', '', 'Short Mediterranean amphibious swards', '', 5, 'Niveau 5', 3942, '/66/484/1204/3942/9392', 'true', 'Formations of Mediterranean, thermo-Atlantic and Macaronesian entirely or partially summer-dry ponds, pools and ditches with Isoetes spp., Marsilea quadrifolia, M. strigosa, Pilularia globulifera, P. minuta, Mentha pulegium, Lythrum hyssopifolia s.l., Trifolium filiforme, Peplis erecta, Teucrium cravense, Serapias lingua, Juncus bufonius, J. capitatus, J. pygmaeus, J. fasciculatus, Scirpus savii, sometimes (rocky edges of fast rivulets), Spiranthes aestivalis and Anagallis tenella.', 'Isoetion', 'Formations des mares, flaques et fossés méditerranéens, thermo-atlantiques et macaronésiens entièrement ou partiellement asséchés l\'été, avec Isoetes spp., Marsilea quadrifolia, M. strigosa, Pilularia globulifera, P. minuta, Mentha pulegium, Lythrum hyssopifolia s.l., Trifolium filiforme, Lythrum borysthenicum (Peplis erecta), Teucrium aristatum (T. cravense), Serapias lingua, Juncus bufonius, J. capitatus, J. pygmaeus, Isolepis cernua (Scirpus savii), et quelquefois (rochers des bords des ruisselets rapides) Spiranthes aestivalis et Anagallis tenella.'),
(9393, 'NR', 22, '22.311', 'Gazons de Littorelles, étangs à Lobélies, gazons d\'Isoètes', '', 'Shoreweed lawns, lobelia ponds, quillwort swards', '', 5, 'Niveau 5', 3941, '/66/484/1204/3941/9393', 'true', 'Littorella uniflora, Lobelia dortmanna and Isoetes spp. formations of oligotrophic waters.', 'Eleocharition acicularis p. (Littorellion), Lobelion, Isoetion lacustris', 'Formations à Littorella uniflora, Lobelia dortmanna et Isoetes spp. des eaux oligotrophes.'),
(9394, 'NR', 22, '22.312', 'Gazons à Eleocharis en eaux peu profondes', '', 'Spike-rush shallow-water swards', '', 5, 'Niveau 5', 3941, '/66/484/1204/3941/9394', 'true', 'Eleocharis acicularis beds on more organic soils in mesotrophic waters.', 'Eleocharition acicularis (Eleocharitetum acicularis i.a.) p.', 'Colonies d\'Eleocharis acicularis sur des sols fortement organiques dans des eaux mésotrophes.'),
(9395, 'NR', 22, '22.313', 'Gazons des bordures d\'étangs acides en eaux peu profondes', '', 'Acid pool fringe shallow-water swards', '', 5, 'Niveau 5', 3941, '/66/484/1204/3941/9395', 'true', 'Eleocharis multicaulis, Scirpus fluitans, Juncus bulbosus, Hypericum elodes, Pilularia globulifera, Deschampsia setacea, Ranunculus flammula, R. ololeucos, Potamogeton polygonifolius, Apium inundatum, Littorella uniflora communities of acid pools and their transition zones.', 'Hydrocotylo-Baldellion p. (Helodo-Sparganion)', 'Communautés à Eleocharis multicaulis, Scirpus fluitans, Juncus bulbosus, Hypericum elodes, Pilularia globulifera, Deschampsia setacea, Ranunculus flammula, R. ololeucos, Potamogeton polygonifolius, Apium inundatum des étangs et mares acides et de leurs zones de transition.'),
(9396, 'NR', 22, '22.314', 'Gazons des berges tourbeuses en eaux peu profondes', '', 'Peaty shores shallow-water swards', '', 5, 'Niveau 5', 3941, '/66/484/1204/3941/9396', 'true', 'Baldellia ranunculoides and Hydrocotyle vulgaris formations of peaty soils.', 'Hydrocotylo-Baldellion p.', 'Communautés à Baldellia ranunculoides et Hydrocotyle sur sols tourbeux.'),
(9397, 'NR', 22, '22.315', 'Gazons à Canche des rivages', '', 'Shore hairgrass swards', '', 5, 'Niveau 5', 3941, '/66/484/1204/3941/9397', 'true', 'Deschampsia littoralis agg. formations of peri-Alpine lakes.', 'Deschampsion littoralis', 'Formations à Deschampsia littoralis agg. des lacs péri-alpins.'),
(9398, 'NR', 22, '22.321', 'Communautés à Eleocharis', '', 'Dwarf spike-rush communities', '', 5, 'Niveau 5', 3943, '/66/484/1204/3943/9398', 'true', 'Rare communities colonising the fluid muds of drying ponds and characterised by Eleocharis ovata, E. carniolica, Carex bohemica, Lindernia procumbens, Scirpus supinus, Limosella aquatica, Cyperus fuscus, Peplis portula, Juncus tenageia, Elatine hexandra, E. hydropiper.', 'Elatino-Eleocharitenion ovatae', 'Communautés rares colonisant les vases fluides des étangs en voie d\'assèchement et caractérisées par Eleocharis ovata, Carex bohemica, Schoenoplectus supinus (Scirpus supinus), Lindernia procumbens, Limosella aquatica, Cyperus fuscus, Peplis portula, Juncus tenageia, Elatine hexandra, E. hydropiper.'),
(9399, 'NR', 22, '22.322', 'Gazons de plantes pionnières des lettes dunaires', '', 'Dune-slack pioneer swards', '', 5, 'Niveau 5', 3943, '/66/484/1204/3943/9399', 'true', 'Formations with Centaurium spp., Blackstonia perfoliata, Samolus valerandi of wet sands in dune slacks belong to this group of communities; they have been listed under 16 (16.32).', 'Juncenion bufonii p.: Gentiano-Erythraeetum littoralis', 'Les formations avec Centaurium spp., Blackstonia perfoliata, Samolus valerandi des sables humides des lettes dunaires appartiennent à ce groupe de communautés ; elles ont été répertoriés sous 16 (16.32).'),
(9400, 'NR', 22, '22.323', 'Communautés naines à Juncus bufonius', '', 'Dwarf toad-rush communities', '', 5, 'Niveau 5', 3943, '/66/484/1204/3943/9400', 'true', 'Associations, often very limited in extent, appearing in the drying phase of temporary pools, flooded ruts of forest paths, wet heath paths, humid forest cuts, seeping mowed lawns and other sufficiently lit temporarily inundated, most often acidic, soils, characterised by Juncus bufonius, Scirpus setaceus, Cyperus flavescens, Centunculus minimus, Spergularia segetalis, Centaurium pulchellum, Blackstonia perfoliata, Samolus valerandi, Cicendia filiformis, Radiola linoides and Illecebrum verticillatum.', 'Juncenion bufonii, Radiolenion linoidis', 'Associations d\'extension souvent très réduite apparaissant au cours de la phase d\'assèchement des mares temporaires, des ornières inondées ou des pistes forestières, des pistes des landes humides, des chemins forestiers humides, des pelouses mouvantes suintantes et autres sols suffisamment éclairés temporairement inondés, le plus souvent acides, caractérisés par Juncus bufonius, Isolepis setacea (Scirpus setaceus), Cyperus flavescens, Centunculus minimus, Spergularia segetalis, Centaurium pulchellum, Blackstonia perfoliata, Samolus valerandi, Cicendia filiformis, Radiola linoides et Illecebrum verticillatum.'),
(9401, 'NR', 22, '22.433', 'Groupements oligotrophes de Potamots', '', 'Oligotrophic pondweed communities', '', 5, 'Niveau 5', 3974, '/66/484/1215/3974/9401', 'true', 'Sparse formations of narrow-leaved floating pondweeds (Potamogeton polygonifolius, P. gramineus, P. alpinus), water starworts (Callitriche), water crowfoots (Ranunculus ololeucos, R. omiophyllus), floating water plantain (Luronium natans), least bur-reed (Sparganium minimum) of shallow, oligotrophic, clean, fluctuating, but usually permanent, often small, waterbodies', 'Potamion graminei', 'Formations clairsemées de Potamots à feuilles flottantes étroites (Potamogeton polygonifolius, P. gramineus, P. alpinus), de Callitriches (Callitriche), de Renoncules d\'eau (Ranunculus ololeucos, R. omiophyllus), de Plantain d\'eau flottant (Luronium natans), de rubanier nain (Sparganium minimum) des bassins d\'eaux peu profondes, oligotrophes, propres, à niveau fluctuant mais généralement permanentes, constituant souvent de petits plans d\'eau.'),
(9402, 'NR', 22, '22.441', 'Tapis de Chara', '', 'Chara carpets', '', 5, 'Niveau 5', 3950, '/66/484/1215/3950/9402', 'true', '', '', 'Pas de description disponible'),
(9403, 'NR', 22, '22.442', 'Tapis de Nitella', '', 'Nitella carpets', '', 5, 'Niveau 5', 3950, '/66/484/1215/3950/9403', 'true', '', '', 'Pas de description disponible'),
(9404, 'NR', 22, '23.211', 'Groupements à Ruppia', '', 'Tasselweed communities', '', 5, 'Niveau 5', 3954, '/66/485/1209/3954/9404', 'true', 'Ruppia, Zannichellia and Najas beds with associated Ranunculus baudotii, Potamogeton pectinatus and Callitriche spp.', 'Ruppion maritimae p.', 'Herbiers de Ruppia, Zannichellia et Najas associée avec Ranunculus baudotii, Potamogeton pectinatus et Callitriche spp.'),
(9405, 'NR', 22, '23.212', 'Communautés lagunaires de végétation marine', '', 'Lagoon communities of marine vegetation', '', 5, 'Niveau 5', 3954, '/66/485/1209/3954/9405', 'true', 'Zostera, Posidonia, Cymodocea beds of coastal lagoons.', '', 'Végétation à Zostera, Posidonia, Cymodocea des lagons côtiers.'),
(9406, 'NR', 22, '24.221', 'Groupements d\'Epilobes des rivières subalpines', '', 'Subalpine willowherb stream community', '', 5, 'Niveau 5', 3969, '/66/486/1212/3969/9406', 'true', 'Subalpine and abyssal stations of herbaceous or suffrutescent vegetation with Epilobium fleischeri, Saxifraga aizoides, S. caerulea, Gypsophila repens, Dryas octopetala).', 'Epilobietum fleischeri', 'Stations subalpines et abyssales de végétations herbacées ou suffrutescentes avec Epilobium fleischeri, Saxifraga aizoides, S. caerulea, Gypsophila repens, Dryas octopetala.'),
(9771, 'NR', 22, '41.175', 'Hêtraies calcicoles sub-méditerranéennes', '', 'Sub-Mediterranean calcicolous beech forests', '', 5, 'Niveau 5', 4175, '/68/492/1278/4175/9771', 'true', 'Thermophile beech forests often rich in box and lavender of the warm, calcareous slopes of the southwestern pre-Alps, Haute Provence, Maritime Alps, of the Causses, the eastern Pyrenees, the Aragonese central Pyrenees.', 'Buxo-Fagetum', 'Hêtraies thermophiles souvent riches en Buis et Lavande sur les versants calcaires chauds des Préalpes sud-occidentales, de la Haute-Provence, des Alpes maritimes, des Causses, des Pyrénées orientales.'),
(9772, 'NR', 22, '41.531', '', '', 'Irish sessile oak woods', '', 5, 'Niveau 5', 4176, '/68/492/1252/4176/9772', 'false', 'Formations of Ireland, particulary rich in evergreen bushes, including Arbutus unedo.', '', 'Pas de description disponible'),
(9773, 'NR', 22, '41.532', '', '', 'British sessile oak woods', '', 5, 'Niveau 5', 4176, '/68/492/1252/4176/9773', 'false', 'Acidophilous Quercus petraea woods of western Britain, mostly found in Scotland, Cumbria, Wales and south-western England, with a few outliers in northern England, in particular in Yorkshire.', '', 'Pas de description disponible'),
(9774, 'NR', 22, '42.411', 'Forêts de Pins de montagne à Rhododendron des Alpes externes', '', 'Outer Alpine alpenrose mountain pine forests', '', 5, 'Niveau 5', 4184, '/68/491/1254/4184/9774', 'true', 'Pinus uncinata forests occupying hard limestone plateaux of the outer Alps, in the Chablais, the Aravis, the Bauges, the Chartreuse, the Vercors, the Dévoluy in which the almost pure calcareous bedrock is covered by a thick layer of raw humus supporting an acidophilous undergrowth dominated by Rhododendron ferrugineum, Vaccininium myrtillus, V. vitis-ideae, V. uliginosum accompanied by Empetrum hermaphroditum, Lycopodium selago, Selaginella spinosa, Cladonia rangiferina, Homogyne alpina, Bartsia alpina, Astrantia minor.', 'Rhododendro ferruginei-Pinetum uncinatae', 'Forêts de Pinus uncinata occupant les plateaux de calcaires compacts des Alpes externes, dans le Chablais, les Aravis, les Bauges, la Chartreuse, le Vercors, le Dévoluy dans lesquels le calcaire à peu près pur est surmonté d\'une couverture épaisse d\'humus brut supportant un sous-bois acidiphile dominée par Rhododendron ferrugineum, Vaccinium myrtillus, V. vitis-idaea, V. uliginosum, accompagnés d\'Empetrum hermaphroditum, Huperzia selago, Selaginella spinosa, Cladonis rangiferina, Homogyne alpina, Bartsia alpina, Astrantia minor.'),
(9775, 'NR', 22, '42.412', 'Forêts de Pins de montagne à Rhododendron du Jura', '', 'Jura alpenrose mountain pine forests', '', 5, 'Niveau 5', 4184, '/68/491/1254/4184/9775', 'true', 'Sub-alpine Pinus uncinata forests of the western Jura, similar to the Alpine formations of 42.411.', 'Lycopodio-Pinetum uncinatae', 'Forêts subalpines de Pinus uncinata du Jura occidental, similaires aux formations alpines de 42.411.'),
(9776, 'NR', 22, '41.F12', 'Bois d\'Ormes thermo-atlantiques', '', 'Thermo-Atlantic elm woods', '', 5, 'Niveau 5', 4182, '/68/492/1257/4182/9776', 'true', 'Formations of the coasts of Normandy, Brittany and Vendée.', 'Aro neglecti-Ulmetum minoris', 'Formations des côtes de Normandie, de Bretagne et de Vendée.'),
(9777, 'NR', 22, '41.F13', '', '', 'British suckering elm woods', '', 5, 'Niveau 5', 4182, '/68/492/1257/4182/9777', 'false', 'Woods of the British Isles, mostly of the Fraxinus-Acer-Mercurialis type, invaded and dominated by suckering elms of the Ulmus minor group (U. carpinifolia, U. procera); postcultural small-leaved elm groves are included.', '', 'Pas de description disponible'),
(9778, 'NR', 22, '42.111', 'Sapinières neutrophiles intra-alpines', '', 'Inner Alpine neutrophilous fir forests', '', 5, 'Niveau 5', 4186, '/68/491/1260/4186/9778', 'true', 'Neutrophilous fir and fir-spruce forests developed on brown soils of the intermediate Alps, outside of the climatic range of the beech.', 'Galio rotundifolii-Abietenion (\"Abietetum albae\") p.: Oxali-Abietetum i.a.', 'Sapinières et sapinières-pessières neutrophiles développées sur des sols bruns dans les Alpes intermédiaires, en dehors de l\'aire climatique du Hêtre.'),
(9779, 'NR', 22, '41.176', '', '', 'Beech forests with hop-hornbeam', '', 5, 'Niveau 5', 4175, '/68/492/1278/4175/9779', 'false', 'Thermophile calcicolous forests rich in Ostrya and Fraxinus ornus of the sub-montane level of the Ligurian and Gardesian southern pre-Alps, mostly reduced to tall coppice.', 'Ostryo-Fagenion', 'Pas de description disponible'),
(9780, 'NR', 22, '41.181', '', '', 'Gargano beech forest', '', 5, 'Niveau 5', 4187, '/68/492/1278/4187/9780', 'false', 'Monte Gargano Foresta Umbra, rich in Taxus baccata, extremely isolated.', '', 'Pas de description disponible'),
(9781, 'NR', 22, '41.182', '', '', 'Campano-Lucanian beech forests', '', 5, 'Niveau 5', 4187, '/68/492/1278/4187/9781', 'false', 'Still relatively extensive beech forests of Campania and Basilicata with Daphne laureola, Galium odoratum, Ranunculus brutius, Geranium versicolor, Melica uniflora, Lathyrus venetus, Euphorbia amygdaloides, Aquilegia vulgaris, A. viscosa, Cardamine bulbifera.', '', 'Pas de description disponible'),
(9782, 'NR', 22, '41.183', '', '', 'Pollino beech forests', '', 5, 'Niveau 5', 4187, '/68/492/1278/4187/9782', 'false', 'Extensive calcicolous beech forests of the montane level of the Pollino system, with Lathyrus venetus, Daphne laureola, Melica uniflora, Ranunculus brutius, Geranium versicolor, Doronicum orientale, Calamintha grandiflora, Epipactis microphylla, E. gracilis, E. purpurata, Monotropa hypopitys.', '', 'Pas de description disponible'),
(9783, 'NR', 22, '41.184', '', '', 'Sila beech forests', '', 5, 'Niveau 5', 4187, '/68/492/1278/4187/9783', 'false', 'Silicicolous beech forests occupying more humid locations of the Sila, alternating with forests of Pinus laricio.', '', 'Pas de description disponible'),
(9784, 'NR', 22, '42.413', 'Forêts pyrénéennes de Pins de montagne à Rhododendron', '', 'Pyrenean alpenrose mountain pine forests', '', 5, 'Niveau 5', 4184, '/68/491/1254/4184/9784', 'true', 'Pinus uncinata forests of ubacs of the Pyrenees developed on siliceous soils, or on decalcified soils in the calcareous ranges, in the more humid and snowy parts of the sub-alpine level, with a ground layer dominated by Rhododendron ferrugineum accompanied by Vaccinium myrtillus, Homogyne alpina, Rosa alpina, Deschampsia flexuosa, Oxalis acetosella, Juniperus nana, Calluna vulgaris, Dryopteris linnaena, Polystichum spinulosum, Solidago virgaurea.', 'Rhododendro ferruginei-Pinetum uncinatae (Saxifrago-Rhododendretum pinetosum)', 'Forêts de Pinus uncinata, des ombrées des Pyrénées développées sur des sols siliceux, ou sur des sols decalcifiés dans les chaînes calcaires, dans les parties plus humides et enneigées de l\'étage subalpin, avec un sous-bois dominé par Rhododendron ferrugineum accompagné de Vaccinium myrtillus, Homogyne alpina, Rosa pendulina, Deschampsia flexuosa, Oxalis acetosella, Juniperus sp., Calluna vulgaris, Gymnocarpium dryopteris, Dryopteris carthusiana, D. dilatata, Solidago virgaurea.'),
(9785, 'NR', 22, '42.421', 'Forêts de Pins de montagne des Alpes internes', '', 'Inner Alpine mountain pine forests', '', 5, 'Niveau 5', 4190, '/68/491/1254/4190/9785', 'true', 'Sub-alpine or montane Pinus uncinata -dominated formations of the inner and intermediate Alps.', '', 'Formations subalpines ou montagnardes à Pinus uncinata dominant des Alpes internes ou intermédiaires.'),
(9786, 'NR', 22, '42.112', 'Sapinières neutrophiles de la zone du Hêtre', '', 'Neutrophilous beech-zone fir forests', '', 5, 'Niveau 5', 4186, '/68/491/1260/4186/9786', 'true', 'Fir or fir-spruce facies of the montane beech-fir neutrophilous forests (41.13, 41.14, 41.17 p.) of the outer Alps, the Pyrenees, the northern Apennines, the Jura and the Hercynian arc, with rich herb and moss layers and a flora similar to that of the beech or beech-fir facies.', '', 'Sapinières ou faciès de sapinières des hêtraies-sapinières montagnardes (41.13, 41.14, 41.17 p.) des Alpes externes, des Pyrénées, du Jura et de l\'arc hercynien, avec des strates herbacées et muscinales riches en espèces et avec une flore similaire à celle des faciès de hêtraie ou de hêtraie-sapinière.'),
(9787, 'NR', 22, '42.113', 'Sapinières intra-pyrénéennes', '', 'Inner Pyrenean fir forests', '', 5, 'Niveau 5', 4186, '/68/491/1260/4186/9787', 'true', 'More acidophilous formations of the inner Pyrenees, with Vaccinium myrtillus, Goodyera repens, Galium rotundifolium and a good representation of species of the neutrophilous beech forests, intermediate between this unit and 42.13.', '', 'Formations très acidiphiles des Pyrénées internes, avec Vaccinium myrtillus, Goodyera repens, Galium rotundifolium et une bonne représentation d\'espèces de forêts de Hêtres neutrophiles, intermédiaires entre cette unité et 42.13K.'),
(9788, 'NR', 22, '41.185', '', '', 'Aspromonte beech forests', '', 5, 'Niveau 5', 4187, '/68/492/1278/4187/9788', 'false', 'Silicicolous beech forests of the Aspromonte range of Calabria with Taxus baccata, Populus tremula, Sorbus aucuparia, Betula pendula.', '', 'Pas de description disponible'),
(9789, 'NR', 22, '41.186', '', '', 'Northern Sicilian beech forests', '', 5, 'Niveau 5', 4187, '/68/492/1278/4187/9789', 'false', 'Relict beech forests of the Madonie, Nebrodi and, very locally, the monti Peloritani, with Ilex aquifolium, Daphne laureola, Crataegus monogyna, Prunus spinosa.', '', 'Pas de description disponible'),
(9790, 'NR', 22, '41.187', '', '', 'Etna beech forests', '', 5, 'Niveau 5', 4187, '/68/492/1278/4187/9790', 'false', 'Isolated beech forests of Mount Etna, at the southern limit of the range of the species.', '', 'Pas de description disponible'),
(9791, 'NR', 22, '41.561', 'Chênaies acidiphiles pyrénéennes', '', 'Pyrenean acidophilous oak forests', '', 5, 'Niveau 5', 4189, '/68/492/1252/4189/9791', 'true', 'Quercus petraea forests, often with Tilia platyphyllos, Prunus avium, Quercus robur, Betula pendula, Sorbus torminalis, Castanea sativa and with Rhamnus frangula, Ilex aquifolium, Mespilus germanica, Corylus avellana, Vaccinium myrtillus, Pteridium aquilinum, Teucrium scorodonia, Melampyrum pratense, Lathyrus montanus, Luzula sylvatica, L. forsteri, Deschampsia flexuosa.', '', 'Forêts de Quercus petraea, souvent avec Tilia platyphyllos, Prunus avium, Quercus robur, Betula pendula, Sorbus torminalis, Castanea sativa, et avec Rhamnus frangula, Ilex aquifolium, Mespilus germanica, Corylus avellana, Vaccinium myrtillus, Pteridium aquilinum, Teucrium scorodonia, Melampyrum pratense, Lathyrus montanus, Luzula sylvatica, L. forsteri, Deschampsia flexuosa.'),
(10044, 'NR', 22, '53.219', 'Cariçaies à Carex vulpina', '', 'Fox sedge tussocks', '', 5, 'Niveau 5', 4360, '/71/513/1306/4360/10044', 'true', 'Formations of Carex vulpina or C. otrubae, of eutrophic humus-poor clay soils, inundated for part of the year.', 'Caricetum vulpinae', 'Formations à Carex vulpina ou de C. otrubae, sur des sols argileux eutrophes pauvres en humus, inondées une partie de l\'année.'),
(10045, 'NR', 22, '53.21A', 'Végétation à Carex buxbaumii', '', 'Club sedge beds', '', 5, 'Niveau 5', 4360, '/71/513/1306/4360/10045', 'true', 'Beds of Carex buxbaumii of wet grasslands, lake shore swamps and fens, on temporarily inundated relatively nutrient-rich, somewhat acid peaty sandy or clayey soils of eastern France, southern and eastern Germany, the southern Alps and the central Apennines.', '', 'Nappes de Carex buxbaumii des prairies humides, des marais des bords de lacs et de bas-marais, sur des sols tourbeux, sableux ou argileux, temporairement inondés, relativement riches en nutriments et quelque peu acides, de l\'est de la France, des Alpes méridionales.'),
(10046, 'NR', 22, '53.221', '', '', 'Common galingale beds', '', 5, 'Niveau 5', 4382, '/71/513/1306/4382/10046', 'false', 'Cyperus longus formations of Greece and Italy.', 'Cyperetum longi', 'Pas de description disponible'),
(10047, 'NR', 22, '53.222', '', '', 'Slender galingale beds', '', 5, 'Niveau 5', 4382, '/71/513/1306/4382/10047', 'false', 'Formations dominated by Cyperus laevigatus, characteristic, in particular, of saline depressions in the Canary Islands and of thermal water bodies on Pantelleria.', '', 'Pas de description disponible'),
(10048, 'NR', 22, '54.422', 'Bas-marais sub-atlantiques à Carex nigra, C. canescens et C. echinata', '', 'Sub-Atlantic black-white-star sedge fens', '', 5, 'Niveau 5', 4370, '/71/504/1314/4370/10048', 'true', 'Acidic fen communities of lowland, collinar and montane areas of northern northwestern and western Europe, excluding the British Isles and the Iberian peninsula. Carex nigra, C. canescens and C. echinata are always represented, often accompanied by dispersed C. rostrata. Rushes, Juncus filiformis, J. articulatus, J. acutiflorus, J. effusus, may be numerous, often marking the transition towards humid grasslands of the Molinietalia, the moss layer is formed by Sphagnum apiculatum, S. cuspidatum, S. recurvum and Polytrichum commune in the more oligotrophic, acidic sites, by brown mosses Drepanocladus fluitans, Calliergon stramineum, C. cuspidatum, in more mesotrophic situations. Other characteristic species include Eriophorum angustifolium, E. vaginatum, Agrostis canina, Molinia caerulea, Pedicularis palustris, Viola palustris, Parnassia palustris, Comarum palustre, Drosera rotundifolia, Menyanthes trifoliata, Ranunculus flammula and Willemetia stipitata. Included in this unit are the extensive peatlands of Hercynian valley fens, often invaded by rushes, and with characters both of the transition mires and of the humid grasslands.', 'Caricetum curto-echinatae (Carici canescenti-Agrostitetum caninae)', 'Communautés des bas-marais acides des régions planitiaires, collinéennes et montagnardes de l\'Europe septentrionale et occidentale, à l\'exclusion des Iles Britanniques et de la péninsule Ibérique. Carex nigra, C. canescens et C. echinata sont toujours représentés, souvent accompagnés par C. rostrata dispersé. Les joncs, Juncus filiformis, J. articulatus, J. acutiflorus, J. effusus peuvent abonder, marquant souvent la transition vers les prairies humides des Molinietalia, la strate muscinale est formée par Sphagnum apiculatum, S. cuspidatum, S. recurvum et Polytrichum commune dans les stations acides les plus oligotrophes, par les mousses brunes Drepanocladus fluitans, Calliergon stramineum, C. cuspidatum, dans les situations les plus mésotrophes. D\'autres espèces caractéristiques incluent Eriophorum angustifolium, E. vaginatum, Agrostis canina, Molinia caerulea, Pedicularis palustris, Viola palustris, Parnassia palustris, Comarum palustre, Drosera rotundifolia, Menyanthes trifoliata, Ranunculus flammula et Willemetia stipitata. Les bas-marais des grandes tourbières des vallées hercyniennes, souvent envahies par des joncs, et montrant à la fois des caractéristiques des marais de transition et des prairies humides, sont compris dans cette unité.'),
(10049, 'NR', 22, '83.111', 'Oliveraies traditionnelles', '', 'Traditional olive groves', '', 5, 'Niveau 5', 4387, '/70/502/1327/4387/10049', 'true', 'Ancient olive groves, often made of very old trees shading herbaceous layer, extensively treated. Greek olive groves are an important habitat of the very restricted sylviid Hippolais olivetorum, as well as of many orchids.', '', 'Bosquets anciens à Oliviers, souvent faits de très vieux arbres cachant la strate herbacée, extensivement traités.'),
(10050, 'NR', 22, '83.112', 'Oliveraies intensives', '', 'Intensive olive groves', '', 5, 'Niveau 5', 4387, '/70/502/1327/4387/10050', 'true', 'Other formations.', '', 'Autres formations.'),
(10051, 'NR', 22, '61.392', '', '', 'Nevadan violet screes', '', 5, 'Niveau 5', 4381, '/69/497/1305/4381/10051', 'false', 'Screes of the summital region of the Sierra Nevada, at around 2800-3000 metres, with a very sparse community formed by Viola crassiuscula, Linaria glacialis, Rhynchosinapis cheiranthos ssp. nevadensis, Ranunculus glacialis, R. parnassifolius, Saxifraga oppositifolia, Papaver suaveolens, Holcus caespitosus, Crepis oporinoides and, in more stabilized areas, Erigeron frigidus.', 'Violo-Linarietum glacialis', 'Pas de description disponible'),
(10052, 'NR', 22, '61.411', '', '', 'Northern mainland screes', '', 5, 'Niveau 5', 4390, '/69/497/1328/4390/10052', 'false', 'Calcareous screes of the northern and central Pindus, with Geranium aristatum, Achillea abrotanoides, Arenaria conferta.', '', 'Pas de description disponible'),
(10053, 'NR', 22, '61.412', '', '', 'Olympus screes', '', 5, 'Niveau 5', 4390, '/69/497/1328/4390/10053', 'false', 'Screes of Olympus, with Asperula muscosa, Rhynchosinapis nivalis, Alyssum handelii, Achillea ambrosiaca.', '', 'Pas de description disponible'),
(10054, 'NR', 22, '61.413', '', '', 'Southern mainland screes', '', 5, 'Niveau 5', 4390, '/69/497/1328/4390/10054', 'false', 'Screes of Parnassus, Giona and other southern Pindus ranges, with Astragalus hellenicus, Corydalis bulbosa, Sclerochorton junceum, Euphorbia deflexa, Geranium macrorrhizum, Rumex scutatus.', '', 'Pas de description disponible'),
(10055, 'NR', 22, '61.414', '', '', 'Peloponnese calcareous screes', '', 5, 'Niveau 5', 4390, '/69/497/1328/4390/10055', 'false', 'Screes of the Taygetos, Kilini and other Peloponnese rangees, with Valantia aprica, Minuartia juniperina.', '', 'Pas de description disponible'),
(10056, 'NR', 22, '61.415', '', '', 'Aegean screes', '', 5, 'Niveau 5', 4390, '/69/497/1328/4390/10056', 'false', 'Screes of Crete and Carpathos.', '', 'Pas de description disponible'),
(10057, 'NR', 22, '54.423', '', '', 'British black-white-star sedge acidic fens', '', 5, 'Niveau 5', 4370, '/71/504/1314/4370/10057', 'false', 'Acidic sphagnum fens of the British Isles in which the herbaceous sward is formed by Carex echinata, C. canescens, C. nigra or Carex rostrata and sometimes Juncus effusus, J. acutiflorus or Nardus stricta.', '', 'Pas de description disponible'),
(10058, 'NR', 22, '54.424', 'Bas-marais acides pyrénéens à Laîche noire', '', 'Pyrenean black sedge acidic fens', '', 5, 'Niveau 5', 4370, '/71/504/1314/4370/10058', 'true', 'Carex nigra dominated acidid fens of the Pyrenees, very similar to those of the Alps, in particular to the floristically rather impoverished southwestern Alpine communities.', 'Caricetum fuscae p.', 'Bas-marais acides des Pyrénées dominés par Carex fusca, très semblables à ceux des Alpes, en particulier plus riches floristiquement que les communautés du sud-ouest des Alpes.'),
(10059, 'NR', 22, '54.425', '', '', 'Iberian black sedge acidic fens', '', 5, 'Niveau 5', 4370, '/71/504/1314/4370/10059', 'false', 'Carex nigra ssp. carpetana-dominated communities of acid infra-aquatic peat mires of the montane and sub-alpine levels of the Cordillera Cantabrica and of the Cryo-Mediterranean level of the Cordillera Central.', 'Caricetum carpetanae, Sphagno recurvi-Caricetum carpetanae', 'Pas de description disponible'),
(10060, 'NR', 22, '83.151', 'Vergers septentrionaux', '', 'Northern fruit orchards', '', 5, 'Niveau 5', 4401, '/70/502/1327/4401/10060', 'true', 'High-stem orchards of apple, pear, cherry of temperate Europe, often extensively treated.', '', 'Vergers de Pommiers, Poiriers, Cerisiers de l\'Europe tempérée, souvent traités extensivement.'),
(10061, 'NR', 22, '83.152', 'Vergers méridionaux', '', 'Southern fruit orchards', '', 5, 'Niveau 5', 4401, '/70/502/1327/4401/10061', 'true', 'Thermophilous Mediterranean and sub-Mediterranean fleshy-fruit Rosaceae orchards, usually intensively treated.', '', 'Vergers thermophiles méditerranéens et sub-méditerranéens à Rosacées à fruits charnus, habituellement traités intensivement.'),
(10062, 'NR', 22, '83.211', 'Vignobles traditionnels', '', 'Traditional vineyards', '', 5, 'Niveau 5', 4405, '/70/502/1330/4405/10062', 'true', 'Vineyards that have preserved their characteristic accompanying flora, generally lightly treated.', '', 'Vignobles ayant préservés leur flore caractéristique, généralement soumis à un traitement léger.'),
(10063, 'NR', 22, '83.212', 'Vignobles intensifs', '', 'Intensive vineyards', '', 5, 'Niveau 5', 4405, '/70/502/1330/4405/10063', 'true', 'Vineyards usually cleared of their herb layer, intensively treated.', '', 'Vignobles généralement nettoyés de leur strate herbacée, soumis à un traitement intensif.'),
(10064, 'NR', 22, '83.311', 'Plantations de conifères indigènes', '', 'Native conifer plantations', '', 5, 'Niveau 5', 4407, '/70/502/1331/4407/10064', 'true', 'Plantations of European conifers outside of the conditions described under \"reforestation\" in the relevant subdivisions of 42.', '', 'Plantations de conifères européens en dehors des conditions décrites sous \"reforestation\" dans les subdivisions appropriées de 42.'),
(10065, 'NR', 22, '83.312', 'Plantations de conifères exotiques', '', 'Exotic conifer plantations', '', 5, 'Niveau 5', 4407, '/70/502/1331/4407/10065', 'true', 'Plantations of non-European species of conifers.', '', 'Plantations de conifères d\'espèces non-européennes.'),
(10066, 'NR', 22, '62.111', 'Falaises calcaires eu-méditerranéennes occidentales', '', 'Western eu-Mediterranean calcareous cliffs', '', 5, 'Niveau 5', 4408, '/69/503/1332/4408/10066', 'true', 'Calcareous cliffs of the Mediterranean region of Spain, of the lowest Mediterranean levels of France, of northwestern Italy, of Sardinia and of the karstic region of northeastern Italy.', 'Asplenietalia glandulosae', 'Falaises calcaires de la région méditerranéenne de basse altitude de la France.'),
(9407, 'NR', 22, '24.222', 'Groupements alpins des bancs de graviers', '', 'Alpine gravel bed community', '', 5, 'Niveau 5', 3969, '/66/486/1212/3969/9407', 'true', 'Open and unstable groupings of alpine and subalpine plants colonizing the downstream edge of gravel islands in mountain streams, including Chondrilla chondrilloides.', 'Chondrilletum chondrilloidis', 'Groupements ouverts et instables de végétaux alpins et subalpins colonisant le bord aval des îlots de graviers dans les cours d\'eau de montagne, renfermant Chondrilla chondrilloides.'),
(9408, 'NR', 22, '24.223', 'Broussailles de Saules et de Myricaire germanique', '', 'Willow-tamarisk brush', '', 5, 'Niveau 5', 3969, '/66/486/1212/3969/9408', 'true', 'Myrica germanica and Salix spp. formations of montane or dealpine river gravels (44.111).', 'Salici-Myricarietum', 'Formations à Myrica germanica et Salix spp. des graviers fluviatiles montagnards et déalpins (44.111).'),
(9409, 'NR', 22, '24.224', 'Fourrés et bois des bancs de graviers', '', 'Gravel bank thickets and woods', '', 5, 'Niveau 5', 3969, '/66/486/1212/3969/9409', 'true', 'Salix, Hippophae, Alnus or Betula thickets or woods on stream gravels, which can be further described by use of the codes of 44.', '', 'Bois ou fourrés de Salix, Hippophae, Alnus ou Betula installés sur les graviers alluviaux ; ils peuvent être décrits plus en détail en utilisant les codes de 44.'),
(9410, 'NR', 22, '24.225', 'Lits de graviers méditerranéens', '', 'Mediterranean gravel beds', '', 5, 'Niveau 5', 3969, '/66/486/1212/3969/9410', 'true', 'Formations with tamarisk (Myricaria germanica), rocket (Erucastrum nasturtiifolium), yellow horned-poppy (Glaucium flavum), evening primrose (Oenothera biennis) of Mediterranean gravel beds.', 'Glaucion flavi', 'Formations avec Myricaria germanica, Erucastrum nasturtiifolium, pavot cornu (Glaucium flavum), Oenothera biennis des lits de graviers des cours d\'eau méditerranéens.'),
(9411, 'NR', 22, '24.226', 'Graviers des rivières de plaine', '', 'Lowland river gravels', '', 5, 'Niveau 5', 3969, '/66/486/1212/3969/9411', 'true', 'Less specialized communities of lowland and hill river gravels (e.g. Filipendulo-Petasition).', '', 'Groupements moins spécialisés des graviers des rivières de plaines et de collines (par ex. Filipendulo-Petasition).'),
(9412, 'NR', 22, '22.342', 'Grands gazons méditerranéens amphibies', '', 'Tall Mediterranean amphibious swards', '', 5, 'Niveau 5', 3942, '/66/484/1204/3942/9412', 'true', 'Vegetation of tall annuals of terrain covered by deep waters during long periods, with Eryngium corniculatum and Mentha cervina.', 'Preslion cervinae', 'Végétation de grandes annuelles des terrains couverts par des eaux profondes pendant de longues périodes, avec Mentha cervina.'),
(9413, 'NR', 22, '22.343', 'Gazons méditerranéens amphibies halo-nitrophiles', '', 'Halo-nitrophile Mediterranean amphibious swards', '', 5, 'Niveau 5', 3942, '/66/484/1204/3942/9413', 'true', 'Slighly halophile and nitrophile post-estival vegetation of temporarily inundated terrains, with Crypsis schoenoides, C. aculeata, C. alopecuroides and Centaurium spicatum.', 'Heleochloion', 'Végétation post-estivale légèrement halophile et nitrophile des terrains temporairement inondés, avec Crypsis schoenoides, C. aculeata, C. alopecuroides et Centaurium spicatum.'),
(9414, 'NR', 22, '22.344', 'Prairies à Serapias', '', 'Serapias grasslands', '', 5, 'Niveau 5', 3942, '/66/484/1204/3942/9414', 'true', 'Meso-hygrophile grasslands of crystalline Provence, with Carex divisa ssp. chaetophylla, often dominant, Briza minor, Oenanthe lachenalii and numerous Serapias (S. lingua, S. neglecta, S. vomeracea).', 'Serapion', 'Prairies méso-hygrophiles de la Provence cristalline, avec Carex divisa subsp. chaetophylla, souvent dominant, Briza minor, Oenanthe lachenalii et de nombreux Serapias (S. lingua, S. neglecta, S. vomeracea).'),
(9415, 'NR', 22, '22.411', 'Couvertures de Lemnacées', '', 'Duckweed covers', '', 5, 'Niveau 5', 3972, '/66/484/1215/3972/9415', 'true', 'Communities of duckweed (Lemna, Spirodela, Wolffia), small ferns (naturalized Azolla) or liverworts (Riccia, Ricciocarpus).', '', 'Communautés de Lemnacées (Lemna, Spirodela, Wolffia), de petites fougères (Azolla naturalisées) ou d\'Hépatiques (Riccia, Ricciocarpus).'),
(9416, 'NR', 22, '22.412', 'Radeaux d\'Hydrocharis', '', 'Frogbit rafts', '', 5, 'Niveau 5', 3972, '/66/484/1215/3972/9416', 'true', 'Formations rich in Hydrocharis morsus-ranae.', '', 'Formations riches en Hydrocharis morsus-ranae.'),
(9417, 'NR', 22, '22.413', 'Radeaux de Stratiotes', '', 'Water-soldier rafts', '', 5, 'Niveau 5', 3972, '/66/484/1215/3972/9417', 'true', 'Formations dominated by Stratiotes aloides.', '', 'Formations dominées par Stratiotes aloides.'),
(9418, 'NR', 22, '22.414', 'Colonies d\'Utriculaires', '', 'Bladderwort colonies', '', 5, 'Niveau 5', 3972, '/66/484/1215/3972/9418', 'true', 'Formations of bladderworts (Utricularia australis, U. vulgaris).', '', 'Formations d\'Utriculaires (Utricularia australis, U. vulgaris).'),
(9419, 'NR', 22, '22.415', 'Couvertures de Salvinia', '', 'Salvinia covers', '', 5, 'Niveau 5', 3972, '/66/484/1215/3972/9419', 'true', 'Often dense and extensive mats dominated by the fern Salvinia natans.', '', 'Tapis souvent denses et étendus dominés par la fougère Salvinia natans.'),
(9420, 'NR', 22, '22.416', 'Groupements à Aldrovanda', '', 'Aldrovanda communities', '', 5, 'Niveau 5', 3972, '/66/484/1215/3972/9420', 'true', 'Formations harbouring the carnivorous, free-floating Droseraceae Aldrovanda vesiculosa.', '', 'Formations abritant la Droséracée carnivore, flottant librement Aldrovanda vesiculosa.'),
(9421, 'NR', 22, '22.421', 'Groupements de grands Potamots', '', 'Large pondweed beds', '', 5, 'Niveau 5', 3973, '/66/484/1215/3973/9421', 'true', 'Associations of large pondweeds (Potamogeton lucens, P. praelongus, P. zizii, P. perfoliatus) characteristic of deep, open waters.', 'Magnopotamion', 'Associations de grands Potamots (Potamogeton lucens, P. praelongus, P. zizii, P. perfoliatus) caractéristiques des eaux libres, profondes.'),
(9422, 'NR', 22, '22.422', 'Groupements de petits Potamots', '', 'Small pondweed communities', '', 5, 'Niveau 5', 3973, '/66/484/1215/3973/9422', 'true', 'Formations of smaller pondweeds, waterweed, hornwort, and other submerged rooted vegetation (Potamogeton crispus, P. filiformis, P. pusillus group, Groenlandia densa, Ranunculus circinatus, Ceratophyllum, Elodea, Najas, Zannichellia, Vallisneria, Hydrilla) that colonize shallower, more sheltered waters.', 'Parvopotamion', 'Formations de Potamots plus petits, de Renoncules, de Cératophylles et autres plantes subaquatiques enracinées (Potamogeton crispus, P. filiformis, P. du groupe pusillus, Groenlandia densa, Ranunculus circinatus, Ceratophyllum, Elodea, Najas, Zannichellia, Vallisneria) qui colonisent ces eaux moins profondes, plus abritées.'),
(9423, 'NR', 22, '22.431', 'Tapis flottant de végétaux à grandes feuilles', '', 'Floating broad-leaved carpets', '', 5, 'Niveau 5', 3974, '/66/484/1215/3974/9423', 'true', 'Formations of rooted aquatic plants with large floating leaves, often with a stratum of submerged species (Ceratophyllum, Myriophyllum, Potamogeton) and occasionally free-floating Utricularia, characteristic of large, permanent water bodies.', 'Nymphaeion albae', 'Formations de plantes aquatiques enracinées à grandes feuilles flottantes, présentant souvent accompagnées d\'une strate d\'espèces immergées (Ceratophyllum, Myriophyllum, Potamogeton) et, occasionnellement des Utricularia flottant librement. Ces formations sont caractéristiques des grands bassins d\'eau permanents.'),
(9424, 'NR', 22, '22.432', 'Communautés flottantes des eaux peu profondes', '', 'Shallow-water floating communities', '', 5, 'Niveau 5', 3974, '/66/484/1215/3974/9424', 'true', 'Communities dominated by water starworts (Callitriche) or water crowfoots (Ranunculus peltatus, R. aquatilis, R. baudotii, R. hederaceus) with both submerged and floating leaves, or by Hottonia palustris, characteristic mostly of shallow waters with fluctuating water levels, susceptible to occasional drying.', 'Callitricho-Batrachion', 'Communautés dominées par des Callitriches (Callitriche) ou par des Renoncules aquatiques (Ranunculus peltatus, R. aquatilis, R. baudotii, R. hederaceus) ayant des racines immergées et des feuilles flottantes, ou par Hottonia palustris. Ces communautés sont principalement caractéristiques des eaux peu profondes sujettes à des fluctuations du niveau de l\'eau et susceptibles d\'être occasionnellement à sec.'),
(9425, 'NR', 22, '31.214', 'Landes submontagnardes alpiennes à Vaccinium', '', 'Sub-montane Alpine Vaccinium heaths', '', 5, 'Niveau 5', 3982, '/67/487/1217/3982/9425', 'true', 'Vaccinium spp. heaths of the collinar and montane levels of the Alps with, Calluna vulgaris, Artemisia alba, Silene otites, Campanula spicata and other thermophile species', '', 'Landes à Vaccinium spp. des étages collinéen et montagnards des Alpes avec Calluna vulgaris, Artemisia alba, Silene otites, Campanula spicata et autres espèces thermophiles.'),
(9426, 'NR', 22, '31.215', 'Landes sub-montagnardes pyrénéo-cantabriques à Vaccinium', '', 'Submontane Pyreneo-Cantabrian Vaccinium heaths', '', 5, 'Niveau 5', 3982, '/67/487/1217/3982/9426', 'true', 'Vaccinium-rich heaths of the collinar and montane levels of the Pyrenees and the Cordillera Cantabrica.', '', 'Landes riches en Vaccinium des étages collinéen et montagnard des Pyrénées.'),
(9427, 'NR', 22, '31.221', '', '', 'Northern Calluna-Genista heaths', '', 5, 'Niveau 5', 3975, '/67/487/1217/3975/9427', 'false', 'Danish, German and northern Dutch (north of the Rhine) heaths with Calluna vulgaris, Genista anglica, G. pilosa and with Vaccinium and Empetrum present.', '', 'Pas de description disponible'),
(9428, 'NR', 22, '31.222', '', '', 'Elbe Calluna-Genista heaths', '', 5, 'Niveau 5', 3975, '/67/487/1217/3975/9428', 'false', 'Elbe basin formations with Genista germanica.', '', 'Pas de description disponible'),
(9429, 'NR', 22, '31.223', 'Landes campino-flandriennes à Callune et Genêt', '', 'Campino-Flandrian Calluna-Genista heaths', '', 5, 'Niveau 5', 3975, '/67/487/1217/3975/9429', 'true', 'Southern Dutch, Belgian and northwestern French heaths with Calluna vulgaris, Genista anglica and G. pilosa.', '', 'Landes du nord ouest de la France (...) avec Calluna vulgaris, Genista anglica et G. pilosa.'),
(9430, 'NR', 22, '31.224', 'Landes campino-flandriennes à Erica cinerea', '', 'Campino-Flandrian Erica cinerea heaths', '', 5, 'Niveau 5', 3975, '/67/487/1217/3975/9430', 'true', 'Erica cinerea-dominated formations of the Southern Dutch, Belgian and northwestern French range of the Calluna-Genista heaths.', '', 'Formations dominées par Erica cinerea du nord ouest de la France (...) des landes à Callune et Genêt.'),
(9431, 'NR', 22, '31.225', '', '', 'British Calluna-Genista heaths', '', 5, 'Niveau 5', 3975, '/67/487/1217/3975/9431', 'false', 'British heaths with Calluna vulgaris or Erica cinerea and often Genista anglica. They include in particular:', '', 'Pas de description disponible'),
(9432, 'NR', 22, '31.241', 'Landes gasconnes', '', 'Biscay heaths', '', 5, 'Niveau 5', 3977, '/67/487/1217/3977/9432', 'true', 'Coastal and collinar Erica-Ulex-Cistus heaths of the periphery of the Bay of Biscay.', '', 'Landes côtières et collinéennes à Erica, Ulex et Cistus de la périphérie du golfe de Gascogne.'),
(9433, 'NR', 22, '31.242', '', '', 'Luso-Galician heaths', '', 5, 'Niveau 5', 3977, '/67/487/1217/3977/9433', 'false', 'Atlantic Galician and Portuguese Erica cinerea, E. umbellata and Ulex europaeus heaths.', '', 'Pas de description disponible'),
(9792, 'NR', 22, '41.562', '', '', 'Cantabrian acidophilous oak forests', '', 5, 'Niveau 5', 4189, '/68/492/1252/4189/9792', 'false', 'Cantabrian and peri-Cantabrian acidophilous Quercus robur or Q. petraea forests, sometimes rich in Betula celtiberica, Quercus pyrenaica or Castanea sativa, with Teucrium scorodonia, Blechnum spicant, Lonicera periclymenum, Deschampsia flexuosa, Veronica officinalis, Hypericum pulchrum, Lathyrus montanus, Melampyrum pratense, Euphorbia dulcis, E. amygdaloides, Stellaria holostea, Oxalis acetosella, Pteridium aquilinum, Dryopteris dilatata, D. affinis, D. aemula, Oreopteris limbosperma, Polypodium vulgare, Ulex europaeus, U. gallii, Vaccinium myrtillus, Daboecia cantabrica, Erica cinerea, E. vagans.', '', 'Pas de description disponible'),
(9793, 'NR', 22, '41.563', '', '', 'Luso-Galician collinar acidophilous oak forests', '', 5, 'Niveau 5', 4189, '/68/492/1252/4189/9793', 'false', 'Galician and northern Portuguese collinar Quercus robur forests, with Ilex aquifolium, Frangula alnus, Pyrus communis, Laurus nobilis, Crataegus monogyna.', '', 'Pas de description disponible'),
(9794, 'NR', 22, '42.422', 'Forêts externes de Pins de montagne à Raisin d\'Ours et Genévriers', '', 'Outer Alpine juniper-bearberry mountain pine forests', '', 5, 'Niveau 5', 4190, '/68/491/1254/4190/9794', 'true', 'Pinus uncinata forests of the calcareous ranges of the western pre-Alps (cf. 42.411) and the Jura, on less evolved soils than those of 42.411, which do not allow the development of Rhododendron ferrugineum heaths.', '', 'Forêts de Pinus uncinata des massifs calcaires des Préalpes occidentales (voir 42.411) et du Jura sur sols moins évolués que ceux de 42.411, sans développement des landes à Rhododendron ferrugineum.'),
(9795, 'NR', 22, '42.121', 'Sapinières calcicoles intra-alpines', '', 'Inner Alpine calcicolous fir forests', '', 5, 'Niveau 5', 4191, '/68/491/1260/4191/9795', 'true', 'Calcicolous fir or fir-spruce forests of the intermediate Alps with Carex alba, Polygala chamaebuxus, Hepatica triloba, Calamagrostis varia.', 'Galio rotundifolii-Abietenion (\"Abietetum albae\") p.: Calamagrostido variae-Abietetum, Carici albae-Abietetum, Adenostylo glabrae-Abietetum', 'Sapinières ou sapinières-pessières des Alpes moyennes avec Carex alba, Polygala chamaebuxus, Hepatica nobilis, Calamagrostis varia.'),
(9796, 'NR', 22, '42.122', 'Sapinières calcicoles de la zone du Hêtre', '', 'Calcicolous beech zone fir forests', '', 5, 'Niveau 5', 4191, '/68/491/1260/4191/9796', 'true', 'Fir facies of calcicolous beech-fir forests in the outer Alps, the Pyrenees, the Jura.', '', 'Faciès à Sapin des hêtraies-sapinières des Alpes externes, des Pyrénées et du Jura.'),
(9797, 'NR', 22, '42.123', '', '', 'Black Forest calcicolous fir-spruce woods', '', 5, 'Niveau 5', 4191, '/68/491/1260/4191/9797', 'false', 'Fir-spruce woods of calcareous soils of the Baar Plateau in the eastern Black Forest foothills, rich in sedges and orchids.', 'Piceo-Abietetum', 'Pas de description disponible'),
(9798, 'NR', 22, '42.131', 'Sapinières acidiphiles intra-alpines', '', 'Inner Alpine acidophilous silver fir forests', '', 5, 'Niveau 5', 4195, '/68/491/1260/4195/9798', 'true', 'Oligotrophic fir and fir-spruce forests of the intermediate Alps, with Luzula nivea, Vaccinium myrtillus, Calamagrostis villosa, Festuca flavescens, Saxifraga cuneifolia.', 'Galio rotundifolii-Albietenion (\"Abietetum albae\") p.: Calamagrostido villosae-Abietetum, Vaccinio-Abietetum, Luzulo-Abietetum', 'Sapinières et sapinières-pessières oligotrophes des Alpes intermédiaires, avec Luzula nivea, Vaccinium myrtillus, Calamagrostis villosa, Festuca flavescens, Saxifraga cuneifolia.'),
(9799, 'NR', 22, '42.132', 'Sapinières acidiphiles de la zone du Hêtre', '', 'Acidophilous beech zone fir forests', '', 5, 'Niveau 5', 4195, '/68/491/1260/4195/9799', 'true', 'Fir or fir-spruce facies of acidophilous beech-fir formations, in the outer Alps, the Pyrenees, the Apennines, the Hercynian arc.', '', 'Faciès à Sapin ou à Sapin et Epicéas des formations de hêtraies-sapinières acidiphiles, dans les Alpes externes, les Pyrénées, et l\'arc hercynien.'),
(9800, 'NR', 22, '42.133', 'Sapinières à Rhododendron', '', 'Fir forests with alpenrose', '', 5, 'Niveau 5', 4195, '/68/491/1260/4195/9800', 'true', 'High-altitude fir forests characteristic of ubacs of high mountains outside of the range of spruce, with Rhododendron ferrugineum, Vaccinium myrtillus, Homogyne alpina, Festuca flavescens.', 'Rhodoreto-Abietetum, Homogyno-Abietetum', 'Sapinières de haute altitude caractéristiques des ombrées et ubacs de hautes montagnes situées hors de l\'aire de distribution de l\'Epicéa, avec Rhododendron ferrugineum, Vaccinium myrtillus, Homogyne alpina, Festuca flavescens.'),
(9801, 'NR', 22, '41.564', '', '', 'Luso-Galician montane acidophilous oak forests', '', 5, 'Niveau 5', 4189, '/68/492/1252/4189/9801', 'false', 'Galician and extreme northern Portuguese (Serra do Gerez) montane Quercus robur forests, characterized by the presence of Betula celtiberica, Vaccinium myrtillus, Saxifraga spathularis, Melampyrum pratense and the absence of thermophile, in particular lauriphyllous, species.', 'Vaccinio myrtilli-Quercetum roboris', 'Pas de description disponible');
INSERT INTO `corine` (`CD_HAB`, `FG_VALIDITE`, `CD_TYPO`, `LB_CODE`, `LB_HAB_FR`, `LB_HAB_FR_COMPLET`, `LB_HAB_EN`, `LB_AUTEUR`, `NIVEAU`, `LB_NIVEAU`, `CD_HAB_SUP`, `PATH_CD_HAB`, `FRANCE`, `LB_DESCRIPTION`, `CRSP_PHYTO_CB91`, `DESCRIPTIF_CB97_FR`) VALUES
(9802, 'NR', 22, '41.571', 'Chênaies à Luzule des bois', '', 'Woodrush oak forests', '', 5, 'Niveau 5', 4197, '/68/492/1252/4197/9802', 'true', 'Mesophile, meso-xerophile or meso-hygrophile oak forests with wood-rush of the middle European Hercynian ranges and their periphery (central, southern and eastern Germany, southern Belgium, Lorraine, Champagne, Burgundy, eastern Morvan).', 'Luzulo-Quercetum', 'Chênaies mésophiles, méso-xérophiles ou méso-hygrophiles à Luzule des bois des massifs hercyniens médioeuropéens et de leur périphérie (centre, sud et est de l\'Allemagne, la Belgique méridionale, la Lorraine, la Champagne, la Bourgogne, l\'est du Morvan).'),
(9803, 'NR', 22, '41.572', 'Chênaies acidiphiles xéro-thermophiles', '', 'Xero-thermophile acidophilous oak forests', '', 5, 'Niveau 5', 4197, '/68/492/1252/4197/9803', 'true', 'Xerophile oak woods on sunny escarpments with dry superficial, siliceous, often schistous soils of the Rhine rift and the schistous Hercynian ranges.', 'Sileno-Quercetum petraeae', 'Chênaies xérophiles sur des escarpements ensoleillés avec des sols superficiels secs, siliceux et souvent schisteux de la vallée du Rhin et des secteurs hercyniens schisteux.'),
(9804, 'NR', 22, '42.423', 'Forêts de Pins de montagne du Ventoux', '', 'Ventoux mountain pine woods', '', 5, 'Niveau 5', 4190, '/68/491/1254/4190/9804', 'true', 'Spontaneous sub-summital Pinus uncinata woods of the Ventoux, with Juniperus nana, J. hemisphaerica and Arctostaphylos uva-ursi.', '', 'Bois spontanés sub-sommitaux de Pinus uncinata du Ventoux, avec Juniperus nana, J. hemisphaerica et Arctostaphylos uva-ursi.'),
(9805, 'NR', 22, '42.424', 'Forêts de Pins de montagne des soulanes pyrénéennes', '', 'Pyrenean adret mountain pine forests', '', 5, 'Niveau 5', 4190, '/68/491/1254/4190/9805', 'true', 'Pinus uncinata -dominated forests of adrets in the sub-alpine level of the Pyrenees, developed on both siliceous and calcicareous substrates.', '', 'Forêts de Pinus uncinata dominant des soulanes de l\'étage subalpin des Pyrénées, développées sur des substrats aussi bien siliceux que calcaires.'),
(9806, 'NR', 22, '42.191', '', '', 'Ronda pinsapo fir forests', '', 5, 'Niveau 5', 4204, '/68/491/1260/4204/9806', 'false', 'Calcicolous formations of the Serrania de Ronda and associated ranges.', 'Paeonio coriaceae-Abietetum pinsapi', 'Pas de description disponible'),
(9807, 'NR', 22, '41.231', 'Frênaies-chênaies à Arum', '', 'Arum ash-oak forests', '', 5, 'Niveau 5', 4206, '/68/492/1261/4206/9807', 'true', 'Typical neutrocline and acidocline ash-oak forests with primrose, developed on silts, marls and clays, characterized by the presence of the ecological groups of Galium odoratum of Arum maculatum, or by the abundance of Lamium galeobdolon.', '', 'Frênaies-chênaies neutrocline et acidocline typique avec Primevère, développées sur des argiles et des marnes, caractérisées par la présence des groupes écologiques Galium odoratum, Arum maculatum, ou par l\'abondance de Lamiastrum galeobdolon.'),
(9808, 'NR', 22, '41.232', 'Frênaies-chênaies à Corydale', '', 'Corydalis ash-oak forests', '', 5, 'Niveau 5', 4206, '/68/492/1261/4206/9808', 'true', 'Ash-oak forests occupying damp colluvions at the bottom of slopes in valleys within sub-Atlantic forests, characterized by the presence of the group of Anemone ranunculoides, Corydalis solida, Gagea lutea and Lathraea squamaria or of Aconitum vulparia, transitional to ravine or alluvial forests.', '', 'Frênaies-chênaies installées sur des colluvions humides accumulées au bas des versants en fond de vallées à l\'intérieur de forêts sub-atlantiques, caractérisées par la présence du groupe écologique à Anemone ranunculoides (Corydalis solida, Gagea lutea et Lathraea squamaria ou Aconitum vulparia), et formant la transition avec les forêts de ravins ou alluviales.'),
(9809, 'NR', 22, '41.233', 'Frênaies-chênaies à Ail', '', 'Garlic ash-oak forests', '', 5, 'Niveau 5', 4206, '/68/492/1261/4206/9809', 'true', 'Ash-oak forests rich in Allium ursinum, of alluvial terraces and adjacent colluvions.', '', 'Frênaies-chênaies riche en Allium ursinum, installées sur terrasses alluviales et sur les colluvions adjacentes.'),
(9810, 'NR', 22, '41.611', '', '', 'Sub-Atlantic Iberian Quercus pyrenaica forests', '', 5, 'Niveau 5', 4210, '/68/492/1262/4210/9810', 'false', 'Quercus pyrenaica forests of the Orensano-Sanabrian and Leonese mountains and of the western Cordillera Central.', '', 'Pas de description disponible'),
(9811, 'NR', 22, '41.612', '', '', 'Iberian sub-continental Quercus pyrenaica forests', '', 5, 'Niveau 5', 4210, '/68/492/1262/4210/9811', 'false', 'Quercus pyrenaica forests of the central and eastern Cordillera Central and of the Northern and Eastern Iberian Ranges.', '', 'Pas de description disponible'),
(9812, 'NR', 22, '42.425', 'Forêts de Pins de montagne à Pulsatille', '', 'Pasqueflower mountain pine forests', '', 5, 'Niveau 5', 4190, '/68/491/1254/4190/9812', 'true', 'Pinus uncinata forests of steep calcareous ubacs of the Pyrenees with very superficial soil and a mostly grassy herb layer comprising Sesleria caerulea, Festuca gautieri, Pulsatilla alpina, Valeriana montana, Salix pyrenaica, Hepatica nobilis, Deschampsia flexuosa, Pyrola uniflora, Listera cordata.', 'Pulsatillo-Pinetum uncinatae', 'Forêts de Pinus uncinatades ombrées calcaires escarpées des Pyrénées développées sur des sols très superficiels. Elles sont pourvues d\'une strate herbacée riche en graminés comprenant Sesleria caerulea, Festuca gautieri, Pulsatilla alpina, Valeriana montana, Salix pyrenaica, Hepatica nobilis, Deschampsia flexuosa, Pyrola uniflora, Listera cordata.'),
(9813, 'NR', 22, '42.426', '', '', 'Mountain pine forests of the Iberian Range', '', 5, 'Niveau 5', 4190, '/68/491/1254/4190/9813', 'false', 'Isolated outposts of Pinus uncinata -dominated formations in the Northern and Southern Iberian Ranges.', '', 'Pas de description disponible'),
(10067, 'NR', 22, '54.441', '', '', 'Nevadan Borreguile fens', '', 5, 'Niveau 5', 4397, '/71/504/1314/4397/10067', 'false', 'Formations occupyingk permanently waterlogged peaty soils of glacial depressions and edges of their small lakes, and also waterholes in Nardus grasslands, at the oro-Mediterranean level of the Sierra Nevada, dominated by Carex intricata, with C. echinata, Eleocharis uniglumis, Viola palustris, Cerastium cerastoides, Veronica repens and Sierra Nevadan endemics Ranunculus alismoides, Festuca frigida, Pinguicula nevadensis, Leontodon microcephalus.', 'Ranunculo-Caricetum intricatae', 'Pas de description disponible'),
(10068, 'NR', 22, '54.442', 'Pozzines complexes corses à Carex intricata', '', 'Corsican intricated sedge pozzines', '', 5, 'Niveau 5', 4397, '/71/504/1314/4397/10068', 'true', 'Peaty swards surrounding waterholes, in particular glacial lakes, in the sub-alpine level of Corsica, dominated by Carex intricata.', 'Caricetum intricatae', 'Gazons tourbeux entourant les points d\'eau, en particulier les lacs glaciaires, à l\'étage subalpin de la Corse, dominés par Carex intricata.'),
(10069, 'NR', 22, '54.443', '', '', 'Nebrodi pozzines', '', 5, 'Niveau 5', 4397, '/71/504/1314/4397/10069', 'false', 'Isolated Carex intricata stations of Mount San Fratello in the Nebrodi mountains of Sicily.', '', 'Pas de description disponible'),
(10070, 'NR', 22, '54.451', 'Bas-marais acides alpiens à Trichophorum cespitosum', '', 'Alpine deergrass acidic fens', '', 5, 'Niveau 5', 4411, '/71/504/1314/4411/10070', 'true', 'Scirpus cespitosus-dominated communities of sub-alpine and alpine fens of the Alps, generally installed on somewhat dryer ground than the Caricetum fuscae and providing the transition between it and the wetter fringe of the Nardus grasslands.', 'Trichophoretum caespitosum', 'Communautés à Trichophorum cespitosum dominant, des bas-marais alpins et subalpins des Alpes, installées généralement sur des substrats quelque peu plus secs que le Caricetum fuscae et faisant la transition entre celui-ci et la marge la plus humide des pelouses à Nardus stricta.'),
(10071, 'NR', 22, '54.452', 'Bas-marais acides pyrénéens à Trichophorum cespitosum', '', 'Pyrenean deergrass acidic fens', '', 5, 'Niveau 5', 4411, '/71/504/1314/4411/10071', 'true', 'Scirpus cespitosus-dominated formations of acidic fens of the Pyrenees , often, particularly in the west, rich in Narthecium ossifragum, and with Carex frigida.', 'Primulo integrifoliae-Trichophoretum caespitosi, Narthecio ossifragi-Trichophoretum caespitosi', 'Formations de bas-marais dominées par Trichophorum cespitosum des Pyrénées, souvent riches (particulièrement dans l\'ouest) en Narthecium ossifragum, et accompagnées de Carex frigida.'),
(10072, 'NR', 22, '54.453', '', '', 'Cantabrian deergrass acidic fens', '', 5, 'Niveau 5', 4411, '/71/504/1314/4411/10072', 'false', 'Sub-alpine formations of the Cordillera Cantabrica, and, very locally, of the Orensano-Sanabrian mountains and the Cordillera Central, dominated by Scirpus cespitosus and Narthecium ossifragum, usually forming an outer fringe to the Caricetum carpetani, on somewhat less wet ground. Among companion species are Carex echinata, C. fusca, C. binervis, Drosera rotundifolia, Erica tetralix.', 'Erico tetralicis-Trichophoretum germanici', 'Pas de description disponible'),
(10073, 'NR', 22, '54.454', 'Bas-marais acides sub-atlantiques à Trichophorum cespitosum', '', 'Sub-Atlantic deergrass acidic fens', '', 5, 'Niveau 5', 4411, '/71/504/1314/4411/10073', 'true', 'Scirpus cespitosus-dominated communities of lowland and collinar middle European acidic fens.', '', 'Communautés dominées par Trichophorum cespitosum, des bas-marais acides des plaines et collines médio-européennes.'),
(10074, 'NR', 22, '83.321', 'Plantations de Peupliers', '', 'Poplar plantations', '', 5, 'Niveau 5', 4412, '/70/502/1331/4412/10074', 'true', '', '', 'Pas de description disponible'),
(10075, 'NR', 22, '83.322', 'Plantations d\'Eucalyptus', '', 'Eucalyptus plantations', '', 5, 'Niveau 5', 4412, '/70/502/1331/4412/10075', 'true', '', '', 'Pas de description disponible'),
(10076, 'NR', 22, '83.323', 'Plantations de Chênes exotiques', '', 'Exotic oak plantations', '', 5, 'Niveau 5', 4412, '/70/502/1331/4412/10076', 'true', '', '', 'Pas de description disponible'),
(10077, 'NR', 22, '83.324', 'Plantations de Robiniers', '', 'Locust tree plantations', '', 5, 'Niveau 5', 4412, '/70/502/1331/4412/10077', 'true', 'Plantations and spontaneous formations of Robinia pseudacacia.', '', 'Plantations et formations spontanées de Robinia pseudoacacia.'),
(10078, 'NR', 22, '83.325', 'Autres plantations d\'arbres feuillus', '', 'Other broad-leaved tree plantations', '', 5, 'Niveau 5', 4412, '/70/502/1331/4412/10078', 'true', '', '', 'Pas de description disponible'),
(10079, 'NR', 22, '62.112', '', '', 'Ibero-montane calcareous cliffs', '', 5, 'Niveau 5', 4408, '/69/503/1332/4408/10079', 'false', 'Cliffs of the supra- and oro-Mediterranean levels of calcareous Iberian mountains.', 'Potentilletalia caulescentis p.', 'Pas de description disponible'),
(10080, 'NR', 22, '54.455', 'Bas-marais acides corses à Trichophorum cespitosum', '', 'Corsican deergrass fens', '', 5, 'Niveau 5', 4411, '/71/504/1314/4411/10080', 'true', 'Scirpus cespitosus-dominated formations of sub-alpine pozzines of Corsica, mostly confined to the edge of rivulets.', 'Pinguiculo-Trichophoretum caespitosi', 'Formations dominées par Trichophorum cespitosum des pozzines subalpines de Corse, la plupart confinées au bord de ruisselets.'),
(10081, 'NR', 22, '62.151', 'Falaises calcaires ensoleillées des Alpes', '', 'Sunny Alpine calcareous cliffs', '', 5, 'Niveau 5', 4416, '/69/503/1332/4416/10081', 'true', 'Well-lit calcareous cliffs of the Alpine system and neighbouring regions, including upper Provence, upper Languedoc, the pre-Pyrenees and Corbières, the Catalonian mountains, with Potentilla caulescens, P. clusiana, P. nitida, Primula auricula, Hieracium humile, Cardaminopsis petraea, Androsace helvetica, Minuartia rupestris.', 'Potentillion caulescentis', 'Falaises calcaires bien ensoleillées du système alpien et des régions voisines, comprenant la Haute-Provence, le Haut-Languedoc, les Pré-Pyrénées et les Corbières, les montagnes de Catalogne, avec Potentilla caulescens, P. nitida, Primula auricula, Hieracium humile, Androsace helvetica, Minuartia rupestris.'),
(10082, 'NR', 22, '62.152', 'Falaises calcaires médio-européennes à Fougères', '', 'Middle-European calcareous fern cliffs', '', 5, 'Niveau 5', 4416, '/69/503/1332/4416/10082', 'true', 'Shady, cool, often moist rockfaces of the Alps and neighbouring regions, of the Jura, the Hercynian ranges, the British Isles, with many ferns, including Cystopteris fragilis, C. regia, Asplenium viride, A. scolopendrium, A. trichomanes, and with Carex brachystachys.', 'Cystopteridion fragilis', 'Parois rocheuses ombragées, fraîches, souvent humides des Alpes et des régions voisines, du Jura... avec de nombreuses Fougères comprenant Cystopteris fragilis, C. regia, Asplenium viride, A. scolopendrium, A. trichomanes, et avec Carex brachystachys.'),
(10083, 'NR', 22, '62.171', '', '', 'Cliffs of Crete', '', 5, 'Niveau 5', 4428, '/69/503/1332/4428/10083', 'false', 'Cliffs and chasms of Crete, with Petromarula pinnata, Galium fruticosum, Centaurea argentea, Ebenus cretica, Verbascum arcturus (= Celsia arcturus), Inula candida, Eryngium ternatum, Asperula incana, Dianthus juniperinus, Aster canus, Campanula pelviformis, C. saxatilis.', 'Petromarulion pinnatae', 'Pas de description disponible'),
(10084, 'NR', 22, '62.172', '', '', 'Cliffs of Karpathos', '', 5, 'Niveau 5', 4428, '/69/503/1332/4428/10084', 'false', 'Cliffs of Karpathos, with Teucrium heliotropifolium, Silene fruticosum, Galium incurvum, Inula heterolepis.', 'Inulion heterolepis: Teucrio-Inuletum', 'Pas de description disponible'),
(10085, 'NR', 22, '62.173', '', '', 'Cliffs of the eastern Aegean', '', 5, 'Niveau 5', 4428, '/69/503/1332/4428/10085', 'false', 'Cliffs of Rhodes, Samos, Ikaria, Lesbos with Campanula hagielia, Lactuca leburnea, Dianthus rhodensis, Inula heterolepis, Rosularia serrata, Sedum creticum.', 'Inulion heterolepis: Campanulo-Inuletum', 'Pas de description disponible'),
(10086, 'NR', 22, '62.174', '', '', 'Cliffs of the Cyclades', '', 5, 'Niveau 5', 4428, '/69/503/1332/4428/10086', 'false', 'Cliffs of the Cyclades, with Fibigia lunarioides, Eryngium amorginum, Amaracus tournefortii, Campanula amorgina, C. heterophylla, Helichrysum amorginum.', 'Inulion heterolepis, Capparo-Amaracion', 'Pas de description disponible'),
(10087, 'NR', 22, '62.175', '', '', 'Cliffs of the Northern Sporades', '', 5, 'Niveau 5', 4428, '/69/503/1332/4428/10087', 'false', 'Cliffs of the Sporades, with Inula sophiae, Capparis spinosa, Dianthus arboreus, Amaracus tournefortii.', 'Capparo-Amaracion', 'Pas de description disponible'),
(10088, 'NR', 22, '54.111', 'Sources d\'eaux douces à Bryophytes', '', 'Soft water bryophyte springs ', '', 5, 'Niveau 5', 4417, '/71/504/1340/4417/10088', 'true', 'Spring communities of waters poor in lime dominated by bryophytes, mostly characteristic of northern upland and high montane, alpine or subalpine levels, also locally of well-lit lowland sites. The principal mosses that compose them are Philonotis fontana, P.seriata, Anthelia julacea, Pohlia wahlenbergii, Scapania paludosa, Bryum schleicheri, Sphagnum auriculatum. A few small vascular plants accompany them, in particular Montia fontana, Saxifraga stellaris, S. rivularis, S. aquatica, Cerastium cerastoides, Epilobium anagallidifolium.', 'Montienion (Cardamino-Montienion)', 'Communautés de sources d\'eaux pauvres en calcaires dominées par des Bryophytes, généralement caractéristiques des étages collinéen septentrional et montagnard, alpin ou subalpin, et localement des stations bien ensoleillées de plaines. Les principales mousses sont Philonotis fontana, P. seriata, Anthelia julacea, Pohlia wahlenbergii, Scapania paludosa, Bryum schleicheri, Sphagnum auriculatum. Le petit nombre de plantes vasculaires qui les accompagnent sont plus particulièrement Montia fontana, Saxifraga stellaris, S. rivularis, S. aquatica, Cerastium cerastioides, Epilobium anagallidifolium.'),
(10089, 'NR', 22, '54.112', 'Sources à Cardamines', '', 'Bittercress springs', '', 5, 'Niveau 5', 4417, '/71/504/1340/4417/10089', 'true', 'Spring communities of mostly collinar and montane, shaded waters poor in lime, with Ranunculus hederaceus, Cardamine amara, C. flexuosa, C. raphanifolia, Chrysosplenium oppositifolium, C. alternifolium, Saxifraga clusii ssp. lepismigena, ranging southwest to the Cordillera Cantabrica.', 'Cardaminenion', 'Communautés fontinales pour la plupart collinéennes et montagnardes, aux eaux ombragées, pauvres en calcaires, avec Ranunculus hederaceus, Cardamine amara, C. flexuosa, C. raphanifolia, Chrysosplenium oppositifolium, C. alternifolium.'),
(9434, 'NR', 22, '31.243', '', '', 'Cabreran heaths', '', 5, 'Niveau 5', 3977, '/67/487/1217/3977/9434', 'false', 'Low Calluna vulgaris-rich heaths of interior northwestern mountains, limited to the Sierra de la Cabrera and the neighbouring Sierra Segundera, Pena Trevinca and Sierra del Teleno.', '', 'Pas de description disponible'),
(9435, 'NR', 22, '31.244', '', '', 'Galicio-Leonese heaths', '', 5, 'Niveau 5', 3977, '/67/487/1217/3977/9435', 'false', 'Erica aragonensis or E. umbellata heaths of the interior slopes of the Cordillera Cantabrica, of interior Galicia and of the Leonese mountains.', '', 'Pas de description disponible'),
(9436, 'NR', 22, '31.226', 'Landes montagnardes à Calluna et Genista', '', 'Montane Calluna-Genista heaths', '', 5, 'Niveau 5', 3975, '/67/487/1217/3975/9436', 'true', 'Heaths of the montane zone (beech forest level) of the Central Massif, Pyrenees and southwestern Alps with Genista anglica, G. pilosa, Vaccinium myrtillus', '', 'Landes de l\'étage montagnard (étage des forêts de Hêtres) du Massif central, des Pyrénées et des Alpes sud-occidentales avec Genista anglica, G. pilosa, Vaccinium myrtillus.'),
(9437, 'NR', 22, '31.227', 'Landes à Empetrum nigrum', '', 'Empetrum nigrum heaths', '', 5, 'Niveau 5', 3975, '/67/487/1217/3975/9437', 'true', 'Coastal non-dunal Calluna and Empetrum nigrum heaths of the Baltic, North Sea and Scotland.', '', 'Landes côtières, non-dunaires, à Calluna et Empetrum nigrum, de la mer du Nord...'),
(9438, 'NR', 22, '31.228', '', '', 'Illyrian heaths', '', 5, 'Niveau 5', 3975, '/67/487/1217/3975/9438', 'false', 'Illyrian heaths with Calluna vulgaris and Genista germanica.', '', 'Pas de description disponible'),
(9439, 'NR', 22, '31.229', '', '', 'Po basin heaths', '', 5, 'Niveau 5', 3975, '/67/487/1217/3975/9439', 'false', 'Calluna vulgaris heaths of the fluvio-glacial terraces that constitute the high plains of the Po river system.', '', 'Pas de description disponible'),
(9440, 'NR', 22, '31.22A', 'Landes à Genista sagittalis', '', 'Genista sagittalis heaths', '', 5, 'Niveau 5', 3975, '/67/487/1217/3975/9440', 'true', 'Calluna vulgaris-Genista sagittalis heaths of the southwestern Alps.', '', 'Landes à Calluna vulgaris et Genista sagittalis des Alpes sud-occidentales.'),
(9441, 'NR', 22, '31.231', 'Landes à Ulex maritimus', '', 'Maritime gorse heaths', '', 5, 'Niveau 5', 3976, '/67/487/1217/3976/9441', 'true', 'Wind-swept heaths with prostrate, cushiony Ulex maritimus and numerous other maritime ecotypes (Cytisus scoparius subsp. maritimus, Ulex gallii f. humilis, Erica vagans) of the immediate proximity of the ocean: Brittany, Cornwall, Cotentin, southern Ireland, Cantabrian coast.', '', 'Landes balayées par le vent avec Ulex europeaus maritimus prostré, en coussinet et de nombreux autres écotypes maritimes (Cytisus scoparius spp. maritimus, Ulex gallii f. humilis, Erica vagans) à proximité immédiate de l\'océan : Bretagne, Cotentin.'),
(9442, 'NR', 22, '31.232', '', '', 'Gallo-Irish Ulex gallii-Erica cinerea heaths', '', 5, 'Niveau 5', 3976, '/67/487/1217/3976/9442', 'false', 'Widespread Irish and Welsh Atlantic heaths, with Ulex gallii and Erica cinerea.', '', 'Pas de description disponible'),
(9443, 'NR', 22, '31.233', '', '', 'Irish Erica mackaiana heaths', '', 5, 'Niveau 5', 3976, '/67/487/1217/3976/9443', 'false', 'Western Irish heaths comprising the northern, isolated, populations of Erica mackaiana.', '', 'Pas de description disponible'),
(9444, 'NR', 22, '31.234', 'Landes septentrionales à Erica vagans', '', 'Northern Erica vagans heaths', '', 5, 'Niveau 5', 3976, '/67/487/1217/3976/9444', 'true', 'Irish, Cornish and Armorican heaths, other than cushiony maritime formations, containing Erica vagans, northern irradiation of 31.241.', '', 'Landes armoricaines, autre que des formations en coussinet, contenant Erica vagans, irradiation septentrionale de 31.241.'),
(9445, 'NR', 22, '31.235', 'Landes anglo-armoricaines occidentales à Ajoncs', '', 'Anglo-Armorican western gorse heaths', '', 5, 'Niveau 5', 3976, '/67/487/1217/3976/9445', 'true', 'Armorican, Cotentin and western English heaths with Ulex gallii and Erica cinerea or Erica ciliaris.', '', 'Landes armoricaines et du Cotentin avec Ulex gallii et Erica cinerea ou Erica ciliaris.'),
(9446, 'NR', 22, '31.236', 'Landes pyrénéo-cantabriques à Erica mackaiana et E. ciliaris', '', 'Cantabro-Pyrenean Erica mackaiana-E. ciliaris heaths', '', 5, 'Niveau 5', 3976, '/67/487/1217/3976/9446', 'true', 'Heaths with Ulex gallii, Erica mackaiana, E. ciliaris, Daboecia cantabrica of the beech level of the Pyrenees and the Cantabrian chain and, very locally, of Galicia; Ulex europaeus and Erica mackaiana heaths of the calcareous Picos de Europa.', '', 'Landes avec Ulex gallii, E. ciliaris, Daboecia cantabrica de l\'étage du Hêtre des Pyrénées.'),
(9447, 'NR', 22, '31.237', 'Landes pyrénéo-cantabriques à Erica vagans et Erica cinerea', '', 'Cantabro-Pyrenean Erica vagans-E. cinerea heaths', '', 5, 'Niveau 5', 3976, '/67/487/1217/3976/9447', 'true', 'Heaths with Ulex gallii, Erica vagans, E. cinerea and Pseudarrhenatherum longifolium of the French and Spanish Basque coast and of the beech level of the Atlantic Pyrenees and of the Cantabrian chain, mostly on mildly acid or sightly calcareous soils.', '', 'Landes avec Ulex gallii, Erica vagans, E. cinerea et Pseudarrhenatherum longifolium de la Côte Basque française et de l\'étage du Hêtre des Pyrénées-Atlantiques, principalement sur des sols moyennement acides ou légèrement carbonatés.'),
(9448, 'NR', 22, '31.238', 'Landes anglo-normandes à Ajoncs nains', '', 'Anglo-Norman dwarf gorse heaths', '', 5, 'Niveau 5', 3976, '/67/487/1217/3976/9448', 'true', 'Heaths with Ulex minor and Erica cinerea or E. ciliaris of interior and oriental Brittany, the Perche, Normandy, the Paris Basin, southern and southeastern England.', '', 'Landes avec Ulex minor et Erica cinerea ou E. ciliaris de l\'intérieur et de l\'ouest de la Bretagne, du Perche, de la Normandie, du Bassin parisien...'),
(9449, 'NR', 22, '31.239', 'Landes aquitano-ligériennes à Ajoncs nains', '', 'Aquitano-Ligerian dwarf gorse heaths', '', 5, 'Niveau 5', 3976, '/67/487/1217/3976/9449', 'true', 'Heaths with Ulex minor and Erica cinerea, E. ciliaris or E. scoparia of Aquitaine, Saintonge, Poitou, Sologne and the Loire region.', '', 'Landes avec Ulex minor et Erica cinerea, E. ciliaris ou E. scoparia d\'Aquitaine, de Saintonge, du Poitou, de la Sologne et de la région de la Loire.'),
(9450, 'NR', 22, '31.211', '', '', 'Northern isles Vaccinium heaths', '', 5, 'Niveau 5', 3982, '/67/487/1217/3982/9450', 'false', 'Calluna-Empetrum hermaphroditum-Vaccinium vitis-idaea heaths of the Orkneys and Shetland.', '', 'Pas de description disponible'),
(9451, 'NR', 22, '31.212', '', '', 'Upland British Vaccinium heaths', '', 5, 'Niveau 5', 3982, '/67/487/1217/3982/9451', 'false', 'Upland Vaccinium-Empetrum heaths of northern and western Britain, with Vaccinium myrtillus or V. vitis-idaea and Empetrum nigrum or E. hermaphroditum. They can be further subdivided according to the Ratcliffe (1980) classification, as follows:', '', 'Pas de description disponible'),
(9452, 'NR', 22, '31.213', 'Landes hercyniennes à Vaccinium', '', 'Hercynian Vaccinium heaths', '', 5, 'Niveau 5', 3982, '/67/487/1217/3982/9452', 'true', 'Sub-montane heaths of the Vosges, the Black Forest, the Ardennes, the Eifel and other Hercynian ranges of Germany, with Calluna vulgaris, Vaccinium myrtillus, V. vitis-idaea, V. uliginosum and montane lycopodes, Diphasiastrum spp..', '', 'Landes submontagnardes des Vosges, de la Forêt Noire, des Ardennes, de l\'Eifel..., avec Calluna vulgaris, Vaccinium myrtillus, V. vitis-idaea, V. uliginosum et à lycopodes montagnards.'),
(9453, 'NR', 22, '31.491', 'Tapis de Dryas de haute montagne', '', 'High montane Dryas mats', '', 5, 'Niveau 5', 3983, '/67/487/1222/3983/9453', 'true', 'Mats of Dryas octopetala of continental mountains, in calcicolous alpine grasslands and on high mountain rocks.', '', 'Tapis de Dryas octopetala, dans les pelouses alpines calcicoles et sur les rochers en haute altitude, des montagnes continentales.'),
(9454, 'NR', 22, '31.492', '', '', 'Durness Dryas mats', '', 5, 'Niveau 5', 3983, '/67/487/1222/3983/9454', 'false', 'Northern Scottish low altitude Dryas heaths associated with Durness limestone and shell sand.', '', 'Pas de description disponible'),
(9455, 'NR', 22, '31.493', '', '', 'Hebridean Dryas mats', '', 5, 'Niveau 5', 3983, '/67/487/1222/3983/9455', 'false', 'Hebridean mixed Dryas-Arctostaphylos heaths of Durness limestones.', '', 'Pas de description disponible'),
(9456, 'NR', 22, '31.494', '', '', 'Burren Dryas mats', '', 5, 'Niveau 5', 3983, '/67/487/1222/3983/9456', 'false', 'Dryas-Arctostaphylos heaths of the Burren in western Ireland.', '', 'Pas de description disponible'),
(9457, 'NR', 22, '31.495', '', '', 'Highland Dryas mats', '', 5, 'Niveau 5', 3983, '/67/487/1222/3983/9457', 'false', 'High-altitude species-rich Dryas cliff-ledge communities of the mica-shist hills of the central Highlands of Scotland, with fragmentary outposts in Lakeland and Snowdonia.', '', 'Pas de description disponible'),
(9458, 'NR', 22, '31.611', 'Fourrés d\'Aulnes verts des Alpes', '', 'Alpine green alder scrub', '', 5, 'Niveau 5', 3989, '/67/487/1219/3989/9458', 'true', 'Green alder (Alnus viridis ssp. viridis)-dominated formations, rich in tall herbs, of slopes with a good water-holding capacity, mostly on siliceous soils, in the sub-alpine and lower alpine belts of the Alps.', 'Alnetum viridis', 'Formations à Aulnes verts dominants (Alnus viridis ssp. viridis), riches en hautes herbes, des sols humides à bonne capacité de rétention en eau, la plupart du temps sur silice, aux étages subalpin et alpin inférieur des Alpes.'),
(9459, 'NR', 22, '31.612', 'Broussailles corses d\'Alnus viridis subsp. suaveolens', '', 'Corsican sweet alder brush', '', 5, 'Niveau 5', 3989, '/67/487/1219/3989/9459', 'true', 'One to three metre-tall brush of the Corsican endemic Alnus viridis ssp. suaveolens, sometimes accompanied by a few Sorbus aucuparia, Acer pseudoplatanus or Rhamnus alpina, limited to the moist, cool, north-facing slopes (ubacs) and, locally, to humid torrent galleries on the south-facing slopes (adrets) of the sub-alpine (1600-2100 m) belt of Corsica.', 'Cymbalarion hepaticifoliae, p.', 'Broussailles d\'un à trois mètres de haut avec l\'endémique corse A. viridis subsp. suaveolens, parfois accompagnées par Sorbus aucuparia, Acer pseudoplatanus ou Rhamnus alpina, limitées aux pentes humides et froides exposées au nord (ubacs) et, localement, aux galeries humides des torrents sur des pentes exposées au sud (adrets) de la ceinture corse subalpine (1 600 - 2 100 m).'),
(9814, 'NR', 22, '42.511', '', '', 'Heather Caledonian forest', '', 5, 'Niveau 5', 4212, '/68/491/1263/4212/9814', 'false', 'Pinus sylvestris var. scotica forests with a heath-like ground cover of Erica cinerea and Calluna vulgaris.', '', 'Pas de description disponible'),
(9815, 'NR', 22, '42.512', '', '', 'Bilberry Caledonian forest', '', 5, 'Niveau 5', 4212, '/68/491/1263/4212/9815', 'false', 'Pinus sylvestris var. scotica forests with a heath-like ground cover of Vaccinium myrtillus and V. vitis-ideae.', '', 'Pas de description disponible'),
(9816, 'NR', 22, '42.513', '', '', 'Moss Caledonian forest', '', 5, 'Niveau 5', 4212, '/68/491/1263/4212/9816', 'false', 'Pinus sylvestris var. scotica forests with a closed canopy and an understorey formed mostly by mosses, in particular Scapania gracilis, Diplophyllum albicans, Thuidium tamariscinum and the hepatic Anastrepta orcadensis.', '', 'Pas de description disponible'),
(9817, 'NR', 22, '42.514', '', '', 'Woodrush Caledonian forest', '', 5, 'Niveau 5', 4212, '/68/491/1263/4212/9817', 'false', 'Pinus sylvestris var. scotica forests with a ground cover rich in grass-like species, in particular Luzula pilosa, Anthoxanthum odoratum, Agrostis capillaris, A. canina, Festuca ovina, together with Vaccinium spp. and bryophytes.', '', 'Pas de description disponible'),
(9818, 'NR', 22, '42.192', '', '', 'Bermeja pinsapo fir forests', '', 5, 'Niveau 5', 4204, '/68/491/1260/4204/9818', 'false', 'Formations occupying ultra basic serpentine outcroppings of the Sierra Bermeja and isolated stands of associated ranges.', 'Bunio macucae-Abietetum pinsapi', 'Pas de description disponible'),
(9819, 'NR', 22, '42.1B1', 'Reboisement en Abies alba', '', 'Abies alba reforestation', '', 5, 'Niveau 5', 4214, '/68/491/1260/4214/9819', 'true', 'Plantations of Abies alba within its area of occurrence or north and west of it.', '', 'Plantations d\'Abies alba à l\'intérieur de son aire de répartition ou au nord ou à l\'ouest de cette dernière.'),
(9820, 'NR', 22, '42.1B2', '', '', 'Abies borisii-regis reforestation', '', 5, 'Niveau 5', 4214, '/68/491/1260/4214/9820', 'false', 'Plantations of A. borisii-regis in Greece.', '', 'Pas de description disponible'),
(9821, 'NR', 22, '42.1B3', 'Reboisement en Abies cephalonica', '', 'Abies cephalonica reforestation', '', 5, 'Niveau 5', 4214, '/68/491/1260/4214/9821', 'true', 'Plantations of A. cephalonica in Greece.', '', 'Plantations de A. cephalonica.'),
(9822, 'NR', 22, '42.1B4', '', '', 'Abies pinsapo reforestation', '', 5, 'Niveau 5', 4214, '/68/491/1260/4214/9822', 'false', 'Plantations of A. pinsapo in Andalucia.', '', 'Pas de description disponible'),
(9823, 'NR', 22, '42.1B5', '', '', 'Abies nebrodensis reforestation', '', 5, 'Niveau 5', 4214, '/68/491/1260/4214/9823', 'false', 'Plantations of A. nebrodensis in the mountains of northern Sicily.', '', 'Pas de description disponible'),
(9824, 'NR', 22, '42.211', 'Pessières à Airelle', '', 'Bilberry spruce forests', '', 5, 'Niveau 5', 4215, '/68/491/1264/4215/9824', 'true', 'Mostly acidophilous, mesophile, sub-alpine Picea abies forests with Oxalis acetosella, Vaccinium vitis-idaea, V. myrtillus, Calamagrostis villosa and the moss Hylocomium splendens.', 'Homogyne-Piceetum, Vaccinio-Piceetum', 'Forêts subalpines de Picea abies généralement acidiphiles, mésophiles, avec Oxalis acetosella, Vaccinium vitis-idaea, V. myrtillus, Calamagrostis villosa, Hylocomium splendens.'),
(9825, 'NR', 22, '41.241', 'Chênaies-charmaies du Nord-Ouest', '', 'North-western oak-hornbeam forests', '', 5, 'Niveau 5', 4207, '/68/492/1261/4207/9825', 'true', 'Typical formations of northern Europe, the eastern Paris basin and Lorraine, with Stellaria holostea, Carex brizoides, Narcissus pseudonarcissus, Polygonatum verticillatum, Potentilla sterilis, Ranunculus nemorosus, Poa chaixii, Luzula sylvatica, L. luzuloides.', 'Stellario-Carpinetum s. s.', 'Formations typiques du nord de l\'Europe, du Bassin parisien oriental et de la Lorraine, avec Stellaria holostea, Carex brizoides, Narcissus pseudonarcissus, Polygonatum verticillatum, Potentilla sterilis, Ranunculus nemorosus, Poa chaixii, Luzula sylvatica, L. luzuloides.'),
(9826, 'NR', 22, '41.242', 'Chênaies-charmaies de Lorraine sur marnes', '', 'Lorraine marl oak-hornbeam forests', '', 5, 'Niveau 5', 4207, '/68/492/1261/4207/9826', 'true', 'Oak-hornbeam forests of Lorraine marls, with Quercus robur, Carpinus betulus, Acer campestre, Sorbus torminalis, Lonicera xylosteum, Galium odoratum, Carex umbrosa, Pulmonaria obscura and Ornithogalum pyrenaicum.', 'Pulmonario-Carpinetum', 'Chênaies-charmaies sur marnes de Lorraine, avec Quercus robur, Carpinus betulus, Acer campestre, Sorbus torminalis, Lonicera xylosteum, Galium odoratum, Carex umbrosa, Pulmonaria obscura et Ornithogalum pyrenaicum.'),
(9827, 'NR', 22, '41.243', 'Chênaies-charmaies collinéennes du Bourgogne', '', 'Burgundy collinar oak-hornbeam forests', '', 5, 'Niveau 5', 4207, '/68/492/1261/4207/9827', 'true', 'Oak-hornbeam forests of the mesozoic hills and plateaux of northwestern Burgundy (Nivernais, Langres plateau, Barrois, Morvan piedmont).', 'Scillo-Carpinetum p., Poo-Carpinetum', 'Chênaies-charmaies des collines et plateaux du mésozoïque du nord-ouest de la Bourgogne (Nivernais, Plateau de Langres, Barrois, Piémont du Morvan).'),
(9828, 'NR', 22, '41.244', 'Chênaies-charmaies des plaines du Bourgogne', '', 'Burgundy plain oak-hornbeam forests', '', 5, 'Niveau 5', 4207, '/68/492/1261/4207/9828', 'true', 'Oak-hornbeam forests of the Saône plain in southern Burgundy and Bresse, of the southern Lyonnais and of the Limagne basin, including the outstanding multicentury-old stands of Cîteaux and similar stations.', '', 'Chênaies-charmaies de la plaine de la Saône dans le sud de la Bourgogne et de la Bresse, du Lyonnais méridional et du Bassin de la Limagne, incluant les peuplement pluriséculaires de Citeaux et de stations similaires.'),
(9829, 'NR', 22, '41.613', '', '', 'Mariano-Oretanian Quercus pyrenaica forests', '', 5, 'Niveau 5', 4210, '/68/492/1262/4210/9829', 'false', 'Quercus pyrenaica forests of the southern Hercynian ranges, limited to enclaves of the Montes de Toledo system and Sierra Morena satellites.', '', 'Pas de description disponible'),
(9830, 'NR', 22, '42.515', '', '', 'Peatmoss Caledonian forest', '', 5, 'Niveau 5', 4212, '/68/491/1263/4212/9830', 'false', 'Pinus sylvestris var. scotica forests of damp hollows, with carpets of Sphagnum spp., Molinia caerulea and Erica tetralix.', '', 'Pas de description disponible'),
(9831, 'NR', 22, '42.521', 'Forêts subcontinentales de Pins sylvestres', '', 'Subcontinental Scots pine forests', '', 5, 'Niveau 5', 4222, '/68/491/1263/4222/9831', 'true', 'Forests dominated by Pinus sylvestris of acid, often podsolized, sands of the plains and hills of middle Europe. Associated trees include Quercus robur, Q. petraea, Betula pendula, Fagus sylvatica; Vaccinium myrtillus, Calluna vulgaris, Dicranum undulatum are usually prominent in the ground layer, Molinia caerulea may be abundant in humid stands.', 'Dicrano-Pinion: Leucobryo-Pinetum (Dicrano-Pinetum, Cladonio-Pinetum)', 'Forêts dominées par Pinus sylvestris sur des sables acides, souvent podzolisés, des plaines et collines de l\'Europe centrale. Les arbres associées incluent Quercus robur, Q. petraea, Betula pendula, Fagus sylvatica ; Vaccinium myrtillus, Calluna vulgaris, Dicranum undulatum sont usuellement prédominants dans le sous-bois, Molinia caerulea peut être abondante dans des stations humides.'),
(9832, 'NR', 22, '42.522', 'Forêts hercyniennes de Pins sylvestres', '', 'Hercynian Scots pine forests', '', 5, 'Niveau 5', 4222, '/68/491/1263/4222/9832', 'true', 'Montane acidophilous woods of indigenous Pinus sylvestris forming local, edaphic or microclimatic enclaves in the beech belt of Hercynian ranges and their periphery, usually with Vaccinium myrtillus or lichens.', '', 'Bois montagnards acidiphiles de Pinus sylvestris indigènes formant des enclaves locales, édaphiques ou microclimatiques, dans la zone du Hêtre des massifs hercyniens et leur périphérie, souvent accompagnés de Vaccinium myrtillus ou de lichens.'),
(9833, 'NR', 22, '42.212', 'Pessières subalpines à hautes herbes', '', 'Tall herb subalpine spruce forests', '', 5, 'Niveau 5', 4215, '/68/491/1264/4215/9833', 'true', 'Tall-herb rich, hygrophile or meso-hygrophile, Picea abies forests of high altitude stations subjected to prolonged snow cover and frequent fogs, with Adenostyles spp., Chaerophyllum hirsutum, Peucedanum ostruthium, Ranunculus aconitifolius, Aconitum vulparia, A. paniculatum, Stellaria nemorum, Geranium sylvaticum, Cicerbita alpina.', 'Adenostylo hirsutae-Piceetum, Adenostylo alliariae-Piceetum', 'Forêts de Picea abies de stations de haute altitude, hygrophiles ou mésophiles, riches en hautes herbes, soumises à une couverture de neige prolongée et à des brouillards fréquents, avec Adenostyles spp., Chaerophyllum hirsutum, Peucedanum ostruthium, Ranunculus aconitifolius, Aconitum vulparia, A. paniculatum, Stellaria nemorum, Geranium sylvaticum, Cicerbita alpina.'),
(9834, 'NR', 22, '42.213', 'Pessières subalpines à sphaignes', '', 'Peatmoss subalpine spruce forests', '', 5, 'Niveau 5', 4215, '/68/491/1264/4215/9834', 'true', 'Sphagnum-rich Picea abies forests of more or less peaty, humid substrates with Listera cordata, Sphagnum acutifolium, S. quinquefarium, S. girgensohnii.', 'Sphagno-Piceetum', 'Forêts de Picea abies riches en Sphagnum sur des substrats plus ou moins tourbeux, humides, avec Listera cordata, Sphagnum acutifolium, S. quinquefarium, S. girgensohnii.'),
(9835, 'NR', 22, '42.214', 'Pessières subalpines xérophiles', '', 'Xerophile subalpine spruce forests', '', 5, 'Niveau 5', 4215, '/68/491/1264/4215/9835', 'true', 'Picea abies forests on dry adrets, with Vaccinium vitis-ideae or with Arctostaphylos uva-ursi, Polygala chamaebuxus, Carex humilis.', '', 'Forêts de Picea abies des adrets secs, avec Vaccinium vitis-idaea ou avec Arctostaphylos uva-ursi, Polygala chamaebuxus, Carex humilis.'),
(9836, 'NR', 22, '42.215', 'Pessières de stations froides', '', 'Cold station spruce forests', '', 5, 'Niveau 5', 4215, '/68/491/1264/4215/9836', 'true', 'Picea abies woods of anomalous stations at the montane or sub-alpine level, in particular block forests of \"ice cellars\" (shaded rocky screes through which cold air flows), woods developed in valleys and depressions where cold air accumulates on clear nights, woods colonizing stabilised screes and narrow bands of rocks, woods on moist sites.', 'Asplenio-Piceetum i.a.', 'Bois de Picea abies dans des stations anormales des étages montagnard et subalpin, en particulier forêts sur blocs des \"creux à glace\" (éboulis rocheux ombragés traversés par des courants d\'air froids), bois développés dans des vallées et des dépressions dans lesquels l\'air froid s\'accumule pendant les nuits claires, bois colonisant les éboulis stabilisés et les barres rocheuses étroites, les bois des sites humides.'),
(10090, 'NR', 22, '54.113', '', '', 'Forget-me-not springs', '', 5, 'Niveau 5', 4417, '/71/504/1340/4417/10090', 'false', 'Spring and rivulet communities of high Iberian mountains, characteristic of the oro- and cryo-Mediterranean levels of the Cordillera Cantabrica, and of the Cordillera Central, the Iberian Range, the Sierra Nevada, with Myosotis stolonifera, Veronica langei, Festuca rivularis, Stellaria alsine, Saxifraga stellaris ssp. alpigena.', 'Myosotidion stoloniferae', 'Pas de description disponible'),
(10091, 'NR', 22, '86.411', 'Carrières de sable, d\'argile et de kaolin', '', 'Sand, clay and kaolin quarries', '', 5, 'Niveau 5', 4430, '/70/507/1351/4430/10091', 'true', '', '', 'Pas de description disponible'),
(10092, 'NR', 22, '86.412', 'Carrières de graviers', '', 'Gravel quarries', '', 5, 'Niveau 5', 4430, '/70/507/1351/4430/10092', 'true', '', '', 'Pas de description disponible'),
(10093, 'NR', 22, '86.413', 'Carrières de pierres', '', 'Hard stone quarries', '', 5, 'Niveau 5', 4430, '/70/507/1351/4430/10093', 'true', '', '', 'Pas de description disponible'),
(10094, 'NR', 22, '62.191', '', '', 'Olympian cliffs', '', 5, 'Niveau 5', 4434, '/69/503/1332/4434/10094', 'false', 'Cliffs of the Thessalian Olympus system, with Saxifraga scardia, S. glabella, Campanula oreadum, Arabis bryoides, Potentilla deorum, Jankaea heldreichii, Omphalodes luciliae.', 'Saxifragion scardici', 'Pas de description disponible'),
(10095, 'NR', 22, '62.192', '', '', 'Pindus calcareous cliffs', '', 5, 'Niveau 5', 4434, '/69/503/1332/4434/10095', 'false', 'Calcareous cliffs of the Pindus, with Galium degenii, Edraianthus graminifolius, Asplenium fissum, Aubrieta gracilis, Achillea clavenae, Satureja parnassica, Hypericum apollinis, Gnaphalium roeseri, Trifolium noricum, Silene pindicola.', 'Galion degenii', 'Pas de description disponible'),
(10096, 'NR', 22, '62.211', 'Falaises siliceuses pyrénéo-alpiennes', '', 'Pyreneo-Alpine siliceous cliffs', '', 5, 'Niveau 5', 4437, '/69/503/1356/4437/10096', 'true', 'Siliceous cliffs of the Alps and the Pyrenees, with Androsace vandellii, Artemisia umbelliformis, Eritrichium nanum, Minuartia cherlerioides, Primula hirsuta, Phyteuma scheuchzeri, Erysimum rhaeticum, Saxifraga aspera, S. cotyledon, S. iratiana, S. retusa, S. bryoides.', 'Androsacion vandellii p., Saxifragion bryoidis', 'Falaises siliceuses des Alpes et des Pyrénées, avec Androsace vandellii, Artemisia umbelliformis, Eritrichium nanum, Minuartia cherlerioides, Primula hirsuta, Phyteuma scheuchzeri, Erysimum rhaeticum, Saxifraga aspera, S. cotyledon, S. pubescens subsp. iratiana, S. retusa, S. bryoides.'),
(10097, 'NR', 22, '54.121', 'Cônes de tufs', '', 'Tufa cones', '', 5, 'Niveau 5', 4438, '/71/504/1340/4438/10097', 'true', 'Large tufa deposits of petrifying springs. When active, they comprise a hydrosere in which the Cratoneurion plants, and in particular, Cratoneuron spp., are accompanied by fen species such as Carex lepidocarpa and Sesleria caerulea; the latter may physiognomically dominate both the hydrosere and the adjacent xerosere, developed on fossil tufa deposits, in which it is accompanied by Brometalia plants.', '', 'Vastes dépôts de tufs des sources pétrifiantes. Lorsqu\'ils sont actifs, ces sources possèdent une hydrosère dans laquelle les plantes du Cratoneurion, et en particulier Cratoneuron spp. sont accompagnées d\'espèces de bas-marais telles que Carex lepidocarpa ou de Sesleria albicans ; cette dernière peut physionomiquement dominer l\'hydrosère et la xérosère adjacente, développée sur des dépôts de tufs fossiles, sur lesquels elle est accompagnée par des espèces des Brometalia.'),
(10098, 'NR', 22, '54.122', 'Sources calcaires', '', 'Calcareous springs', '', 5, 'Niveau 5', 4438, '/71/504/1340/4438/10098', 'true', 'Other calcareous springs, with their associated flush.', '', 'Autres sources calcaires avec les suintements associées.'),
(10099, 'NR', 22, '54.511', 'Pelouses de Carex lasiocarpa et Mousses brunes', '', 'Brown moss slender-sedge swards', '', 5, 'Niveau 5', 4429, '/71/504/1341/4429/10099', 'true', 'Basicline quaking mires and floating mats dominated by Carex lasiocarpa associated with Scorpidium scorpioides and other pleurocarps, and with charophytes. Among characteristic accompanying species are Pedicularis palustris and Liparis loeselii.', 'Caricetum lasiocarpae scorpidietosum', 'Tourbières tremblantes et tapis flottants basiclines dominés par Carex lasiocarpa associé à Scorpidium scorpioides et à d\'autres Mousses pleurocarpes, et à des charophytes. Parmi les espèces caractéristiques accompagnatrices on relève Pedicularis palustris et Liparis loeselii.'),
(10100, 'NR', 22, '54.512', 'Pelouses à Carex lasiocarpa et Sphaignes', '', 'Sphagnum slender-sedge swards', '', 5, 'Niveau 5', 4429, '/71/504/1341/4429/10100', 'true', 'Acidocline quaking mires and floating mats dominated by Carex lasiocarpa associated with sphagnums (Sphagnum angustifolium, S. recurvum, S. lindbergii, S. pulchrum, S. balticum, S. dusenii, S. papillosum, S. subsecundum, S. riparium, S. subnitens, S.cuspidatum, S. flexuosum, S. fimbriatum, S. palustre, S. auriculatum) and Polytrichum commune. Characteristic accompanying species include Carex rostrata, C. nigra, C. panicea, Equisetum fluviatile, Narthecium ossifragum, Dactylorhiza sphagnicola, Comarum palustre, Vaccinium oxycoccos.', 'Caricetum lasiocarpae sphagnetosum recurvae (Sphagno-Caricetum lasiocarpae)', 'Tourbières tremblantes et tapis flottants acidoclines dominés par Carex lasiocarpa associé à des Sphaignes (Sphagnum angustifolium, S. recurvm, S. lindbergii, S. pulchrum, S. balticum, S. dusenii, S. papillosum, S. subsecundum, S. riparium, S. subnitens, S. cuspidatum, S. flexuosum, S. fimbriatum, S. palustre, S. auriculatum) et Polytrichum commune. Les espèces caractéristiques accompagnatrices comprennent Carex rostrata, C. nigra, C. panicea, Equisetum fluviatile, Narthecium ossifragum, Dactylorhiza sphagnicola, Comarum palustre, Vaccinium oxycoccos.'),
(10101, 'NR', 22, '62.212', 'Falaises siliceuses hercyniennes', '', 'Hercynian siliceous cliffs', '', 5, 'Niveau 5', 4437, '/69/503/1356/4437/10101', 'true', 'Siliceous cliffs of Hercynian ranges and their periphery, of the British Isles and, locally, of the Jura, with Saxifraga sponhemica, Biscutella laevigata, Asplenium septentrionale, A. adiantum-nigrum, A. billotii, A. foreziense.', 'Androsacion vandellii p., Asarinion procumbentis', 'Falaises siliceuses des secteurs hercyniens et de leur périphérie, des Iles Britanniques et, localement , du Jura, avec Saxifraga rosacea subsp. sternbergii, Biscutella laevigata, Asplenium septentrionale, A. adiantum-nigrum, A. oboratum subsp. lanceolatum, A. foresiense.'),
(10102, 'NR', 22, '62.213', 'Falaises de serpentines hercyniennes', '', 'Hercynian serpentine cliffs', '', 5, 'Niveau 5', 4437, '/69/503/1356/4437/10102', 'true', 'Serpentine cliffs of Hercynian ranges and their periphery, with Asplenium adulterinum.', 'Asplenion serpentini', 'Falaises de serpentines des secteurs hercyniens et de leur périphérie, avec Asplenium adulterinum.'),
(10103, 'NR', 22, '62.221', '', '', 'Ibero-Carpetanian siliceous cliffs', '', 5, 'Niveau 5', 4448, '/69/503/1356/4448/10103', 'false', 'Siliceous cliffs of the Cordillera Cantabrica, the Iberian Range, the Cordillera Central and the Leonese mountains, with Hieracium pallidum ssp. graniticum, Murbeckiella boryi ssp. boryi, M. boryi ssp. herminii, Saxifraga willkommiana, Spergula viscosa ssp. pourretii.', 'Saxifragion willkommianae', 'Pas de description disponible'),
(10104, 'NR', 22, '62.222', '', '', 'Nevadan siliceous cliffs', '', 5, 'Niveau 5', 4448, '/69/503/1356/4448/10104', 'false', 'Siliceous cliffs of the Sierra Nevada, with Saxifraga nevadensis, Sedum brevifolium, Centranthus nevadensis.', 'Saxifragion nevadensis', 'Pas de description disponible'),
(10105, 'NR', 22, '54.531', 'Tourbières tremblantes acidiclines à Carex rostrata', '', 'Acidocline bottle sedge quaking mires', '', 5, 'Niveau 5', 4440, '/71/504/1341/4440/10105', 'true', 'Mats of acidophilous sphagnums with a usually low, open growth of Carex rostrata, accompanied by C. nigra, C. canescens, C. limosa, Vaccinium oxycoccos; the main sphagnums are Sphagnum recurvum, S. angustifolium, S. auriculatum, S.flexuosum, S. riparium, S. obtusum, S. dusenii.', 'Sphagno-Caricetum rostratae', 'Tapis de Sphaignes acidiphiles avec une végétation généralement basse, ouverte de Carex rostrata, accompagné de Carex nigra, C. canescens, C. limosa, Vaccinium oxycoccos ; les principales Sphaignes sont Sphagnum recurvum, S. angustifolium, S. auriculatum, S. flexuosum, S. riparium, S. obtusum, S. dusenii.'),
(10106, 'NR', 22, '54.532', 'Tourbières tremblantes basiclines à Carex rostrata', '', 'Basicline bottle sedge quaking mires', '', 5, 'Niveau 5', 4440, '/71/504/1341/4440/10106', 'true', 'Formations of Carex rostrata and basiphilous sphagnums or pleurocarps.', '', 'Formations de Carex rostrata et de Sphaignes ou de Pleurocarpes basiphiles.'),
(10107, 'NR', 22, '54.541', 'Pelouses à Carex limosa des bourbiers et Mousses brunes', '', 'Brown moss mud sedge swards', '', 5, 'Niveau 5', 4456, '/71/504/1341/4456/10107', 'true', 'Basicline Carex limosa swards and floating rafts, with Carex lasiocarpa, C. lepidocarpa, Eriophorum gracile and a rich bryophyte cortège formed by the mosses Scorpidium scorpioides, Drepanocladus revolvens, Calliergon giganteum, C. trifarium, C. stramineum, Campylium stellatum, Bryum pseudotriquetum, the liverwort Riccardia pinguis, and occasionally sphagnums. Scheuchzeria palustris or Liparis loeselii may be present. Outside of transition mires, elements of these communities occur in the depressions of rich fens.', 'Caricetum limosae hypnetosum', 'Tapis et radeaux flottants basiclines à Carex limosa, avec Carex lasiocarpa, C. lepidocarpa, Eriophorum gracile et un riche cortège bryophytique formé des Mousses Scorpidium scorpioides, Drepanocladus revolvens, Calliergon giganteum, C. trifarium, C. stramineum, Campylium stellatum, Bryum pseudotriquetrum, l\'Hépatique Riccardia pinguis et, occasionnellement, des Sphaignes. Scheuchzeria palustris et Liparis loeselii peuvent être présents. En dehors des tourbières de transition, les éléments de ces communautés pénètrent dans les dépressions de bas-marais alcalins.');
INSERT INTO `corine` (`CD_HAB`, `FG_VALIDITE`, `CD_TYPO`, `LB_CODE`, `LB_HAB_FR`, `LB_HAB_FR_COMPLET`, `LB_HAB_EN`, `LB_AUTEUR`, `NIVEAU`, `LB_NIVEAU`, `CD_HAB_SUP`, `PATH_CD_HAB`, `FRANCE`, `LB_DESCRIPTION`, `CRSP_PHYTO_CB91`, `DESCRIPTIF_CB97_FR`) VALUES
(10108, 'NR', 22, '54.221', 'Bas-marais péri-alpins à Schoenus ferrugineus (choin ferrugineux)', '', 'Peri-Alpine brown bog-rush fens', '', 5, 'Niveau 5', 4455, '/71/504/1359/4455/10108', 'true', 'Schoenus ferrugineus-dominated formations of Alpine and peri-Alpine regions, with a predominance of Schoenus ferrugineus among the gramineous growth which is often overwhelming, imparting to the fens a distinctive brown tone in summer. Schoenus ferrugineus may be accompanied by Schoenus nigricans, Eriophorium latifolium, Carex hostiana, C. davalliana, C. panicea, C. flacca, C. lepidocarpa, C. demissa, C. dioica, Eleocharis quinqueflora, Molinia caerulea; non-gramineous herbs include Pinguicula vulgaris, Gentiana utriculosa, Drosera anglica, Primula farinosa, Parnassia palustris, Dactylorhiza traunsteineri, D. lapponica, Tofieldia calyculata; the rich moss layer is formed by Drepanocladus intermedius, D. revolvens, Campylium stellatum.', 'Primulo-Schoenetum ferruginei', 'Formations des régions alpiennes et péri-alpiennes dominées par Schoenus ferrugineus, avec la prédominance de Schoenus ferrugineus au milieu d\'une strate graminéenne qu\'elle submerge souvent, conférant une teinte brune distincte au marécage en été. Schoenus ferrugineus peut être accompagné de Schoenus nigricans, Eriophorum latifolium, Carex hostiana, C.davalliana, C. panicea, C. flacca, C. lepidocarpa, C. demissa, C. dioica, Eleocharis quinqueflora, Molinia caerulea ; les herbacées non graminoïdes comprennent Pinguicula vulgaris, Gentiana utriculosa, Drosera longifolia, Primula farinosa, Parnassia palustris, Dactylorhiza traunsteineri, Tofieldia calyculata ; la strate muscinale riche est formée de Drepanocladus intermedius, D. revolvens, Campylium stellatum.'),
(9460, 'NR', 22, '31.723', '', '', 'Estrela hedgehog-heaths', '', 5, 'Niveau 5', 3996, '/67/487/1220/3996/9460', 'false', 'Relict heaths of highly xeric upper supra-Mediterranean and oro-Mediterranean stations of the Serra da Estrela dominated by Echinospartum ibericum ssp. pulviniformis.', '', 'Pas de description disponible'),
(9461, 'NR', 22, '31.724', '', '', 'Western Cordilleran secundary hedgehog-heaths', '', 5, 'Niveau 5', 3996, '/67/487/1220/3996/9461', 'false', 'Secundary Echinospartum lusitanicum-Genista histrix hedgehog-heaths developed on skeletal soils of the supra-Mediterranean zone of the western Cordillera Central and surrounding areas.', '', 'Pas de description disponible'),
(9462, 'NR', 22, '31.731', '', '', 'Lower Nevadan hedgehog-heaths', '', 5, 'Niveau 5', 3991, '/67/487/1220/3991/9462', 'false', 'Supra-Mediterranean (lower xeroacanthic) hedgehog-heaths occupying mainly the 1700-2000 m altitudinal range, often rich in Bupleurum spinosum, with Vella spinosa, Erinacea anthyllis or Echinospartum boissieri.', 'Salvio-Lavanduletum lanatae p., Astragalo-Velletum spinosae p., Santolino-Salvietum oxyodonti p., Thymo-Cistetum laurifolii p.', 'Pas de description disponible'),
(9463, 'NR', 22, '31.732', '', '', 'Middle Nevadan hedgehog-heaths', '', 5, 'Niveau 5', 3991, '/67/487/1220/3991/9463', 'false', 'Oro-Mediterranean (higher xeroacanthic) hedgehog-heaths occupying mainly the 2000-2300 m altitudinal range, with Vella spinosa, Erinacea anthyllis, Ptilotrichum spinosum, Astragalus sempervirens ssp. nevadensis, A. granatensis ssp. granatensis.', 'Astragalo-Velletum spinosae p.', 'Pas de description disponible'),
(9464, 'NR', 22, '31.733', '', '', 'Upper Nevadan hedgehog-heaths', '', 5, 'Niveau 5', 3991, '/67/487/1220/3991/9464', 'false', 'Upper oro-Mediterranean hedgehog-heaths occupying mainly the 2300-2600 m altitudinal range, with Erinacea anthyllis, Astragalus sempervirens ssp. nevadensis, A. granatensis ssp. granatensis, Juniperus nana and J. sabina ssp. humilis.', '', 'Pas de description disponible'),
(9465, 'NR', 22, '31.734', '', '', 'Nevadan dwarf cushion-heaths', '', 5, 'Niveau 5', 3991, '/67/487/1220/3991/9465', 'false', 'Dwarf suffrutescent formations of windswept crests and slopes on very superficial soils.', '', 'Pas de description disponible'),
(9466, 'NR', 22, '31.735', '', '', 'Nevadan Genista hedgehog-heaths', '', 5, 'Niveau 5', 3991, '/67/487/1220/3991/9466', 'false', 'Genista baetica-dominated hedgehog-heaths, often with Juniperus nana and G. purgans, of siliceous soils.', 'Genisto-Juniperetum nanae', 'Pas de description disponible'),
(9467, 'NR', 22, '31.741', 'Landes épineuses à Erinacea', '', 'Erinacea hedgehog-heaths', '', 5, 'Niveau 5', 3992, '/67/487/1220/3992/9467', 'true', 'Oro-Mediterranean Erinacea-dominated and related hedgehog-heaths.', 'Erinacetalia: Xeroacantho-Erinaceion p.', 'Landes épineuses oro-méditerranéennes dominées par Erinacea et genres apparentés.'),
(9468, 'NR', 22, '31.621', 'Fourrés de Saules pyrénéo-alpiens', '', 'Pyreneo-Alpine willow brush', '', 5, 'Niveau 5', 3990, '/67/487/1219/3990/9468', 'true', 'Continental mountain tall herb communities dominated by willow bushes.', '', 'Communautés à hautes herbes des montagnes continentales dominées par des Saules.'),
(9469, 'NR', 22, '31.622', '', '', 'Subarctic willow brush', '', 5, 'Niveau 5', 3990, '/67/487/1219/3990/9469', 'false', 'Subarctic Salix lapponum, S. lanata, S. arbuscula or S. myrsinites formations of ungrazed cliff ledges in the central and northern Highlands of Scotland.', '', 'Pas de description disponible'),
(9470, 'NR', 22, '31.623', '', '', 'Northern willow brush', '', 5, 'Niveau 5', 3990, '/67/487/1219/3990/9470', 'false', 'Mixed S. aurita, S. atrocinerea, S. repens and S. caprea scrub on ungrazed ledges, islands and gullies of the northern British Isles.', '', 'Pas de description disponible'),
(9471, 'NR', 22, '31.721', '', '', 'Gredos hedgehog-heaths', '', 5, 'Niveau 5', 3996, '/67/487/1220/3996/9471', 'false', 'Oro-Mediterranean heaths of the Sierra de Gredos dominated by the endemic Echinospartum lusitanicum ssp. barnadesii', '', 'Pas de description disponible'),
(9472, 'NR', 22, '31.722', '', '', 'Bejar-Pena de Francia hedgehog-heaths', '', 5, 'Niveau 5', 3996, '/67/487/1220/3996/9472', 'false', 'Oro-Mediterranean heaths of the Sierra de Bejar and Pena de Francia dominated by Echinospartum ibericum ssp. pulviniformis.', '', 'Pas de description disponible'),
(9473, 'NR', 22, '31.245', '', '', 'Oro-Castillan heaths', '', 5, 'Niveau 5', 3977, '/67/487/1217/3977/9473', 'false', 'Erica aragonensis heaths of the Cordillera Central and the summits of the Montes de Toledo.', '', 'Pas de description disponible'),
(9474, 'NR', 22, '31.246', '', '', 'Sorian heaths', '', 5, 'Niveau 5', 3977, '/67/487/1217/3977/9474', 'false', 'Erica aragonensis and Calluna vulgaris heath communities of the northern Iberian Range, often with Genista pilosa or, on wetter soils, G. anglica and G. micrantha.', '', 'Pas de description disponible'),
(9475, 'NR', 22, '31.247', '', '', 'Cuencan heaths', '', 5, 'Niveau 5', 3977, '/67/487/1217/3977/9475', 'false', 'Erica aragonensis heaths of the southern Iberian Range (Valdemeca, Serrania de Cuenca) with Thymelaea subrepens.', '', 'Pas de description disponible'),
(9476, 'NR', 22, '31.248', '', '', 'Luso-Extremaduran heaths', '', 5, 'Niveau 5', 3977, '/67/487/1217/3977/9476', 'false', 'Formations rich in Erica umbellata of the meso-Mediterranean and occasionally thermo-Mediterranean zones of the western parts of the Iberian peninsula, intermediate between heath and maquis.', '', 'Pas de description disponible'),
(9477, 'NR', 22, '31.249', '', '', 'Erica andevalensis heaths', '', 5, 'Niveau 5', 3977, '/67/487/1217/3977/9477', 'false', 'Formations constituted by the local endemic Erica andevalensis on soils rich in heavy metals of the rio Odiel basin in western Andalusia.', '', 'Pas de description disponible'),
(9478, 'NR', 22, '31.311', '', '', 'Canarian Erica scoparia heaths', '', 5, 'Niveau 5', 3997, '/67/487/1221/3997/9478', 'false', 'Humid low heaths of high elevations of Tenerife (Anaga) and La Gomera (Incherada), with E. scoparia ssp. platycodon.', '', 'Pas de description disponible'),
(9479, 'NR', 22, '31.312', '', '', 'Canarian Erica arborea heaths', '', 5, 'Niveau 5', 3997, '/67/487/1221/3997/9479', 'false', 'Low and medium-tall stages of the Erica arborea, Myrica faya and Ilex canariensis formations (tall forest-like formations are listed as 45.9).', '', 'Pas de description disponible'),
(9480, 'NR', 22, '31.411', 'Landes à Loiseleuria', '', 'Loiseleuria heaths', '', 5, 'Niveau 5', 4003, '/67/487/1222/4003/9480', 'true', '', '', 'Pas de description disponible'),
(9481, 'NR', 22, '31.412', 'Landes alpines à Vaccinium', '', 'Alpine Vaccinium heaths', '', 5, 'Niveau 5', 4003, '/67/487/1222/4003/9481', 'true', '', '', 'Pas de description disponible'),
(9482, 'NR', 22, '31.431', 'Fourrés à Juniperus communis subsp. nana', '', 'Juniperus nana scrub', '', 5, 'Niveau 5', 4005, '/67/487/1222/4005/9482', 'true', 'Thermophile Juniperus nana-dominated heaths of the sub-alpine zone of the central and southern Alps, northern and central Apennines, Corsica, Sardinia, Forez, Pyrenees and of the upper levels of high Greek and Iberian mountains.', '', 'Landes à Juniperus communis subsp. nana dominant de la zone subalpine des Alpes centrales et méridionales, de Corse, du Forez et des Pyrénées.'),
(9483, 'NR', 22, '31.432', 'Fourrés à Juniperus sabina', '', 'Juniperus sabina scrub', '', 5, 'Niveau 5', 4005, '/67/487/1222/4005/9483', 'true', 'Oro-Mediterranean J. sabina heaths of Iberia, inner Alpine valleys and rare Apennine stations.', '', 'Landes oro-méditerranéennes à Juniperus sabina, des vallées intra-alpines.'),
(9484, 'NR', 22, '31.433', 'Fourrés à Juniperus communis subsp. hemisphaerica', '', 'Juniperus hemisphaerica scrub', '', 5, 'Niveau 5', 4005, '/67/487/1222/4005/9484', 'true', 'J. hemisphaerica heaths of Iberia, the southern Apennines, Sicily (Madonie, Etna) and Greece.', '', 'Landes à Juniperus communis subsp. hemisphaerica d\'Espagne, des Apennins méridionaux, de Sicile et de Grèce. (France méridionale -)'),
(9485, 'NR', 22, '31.434', '', '', 'Juniperus oxycedrus scrub', '', 5, 'Niveau 5', 4005, '/67/487/1222/4005/9485', 'false', 'J. oxycedrus heaths of high Greek mountain slopes.', '', 'Pas de description disponible'),
(9486, 'NR', 22, '31.451', '', '', 'Scottish bearberry-azalea heaths', '', 5, 'Niveau 5', 4007, '/67/487/1222/4007/9486', 'false', 'Arctostaphylos alpina-Loiseleuria procumbens facies of the boreo-alpine Scottish heaths characteristic of the northern Highlands.', '', 'Pas de description disponible'),
(9487, 'NR', 22, '31.452', '', '', 'Scottish crowberry-azalea heaths', '', 5, 'Niveau 5', 4007, '/67/487/1222/4007/9487', 'false', 'Empetrum hermaphroditum-Loiseleuria procumbens facies of the boreo-alpine Scottish heaths characteristic of the Cairngorms.', '', 'Pas de description disponible'),
(9488, 'NR', 22, '31.453', '', '', 'Scottish dwarf juniper heaths', '', 5, 'Niveau 5', 4007, '/67/487/1222/4007/9488', 'false', 'Juniperus nana facies of the boreo-alpine Scottish heaths.', '', 'Pas de description disponible'),
(9489, 'NR', 22, '31.746', '', '', 'Collinar Astragalus hedgehog-heaths', '', 5, 'Niveau 5', 3992, '/67/487/1220/3992/9489', 'false', 'Local meso- and supra-Mediterranean Astragalus formations of the Spanish Meseta.', 'Aphyllantion p.', 'Pas de description disponible'),
(9837, 'NR', 22, '41.261', 'Chênaies-charmaies à Gaillet des bois', '', 'Wood bedstraw oak-hornbeam forests', '', 5, 'Niveau 5', 4217, '/68/492/1261/4217/9837', 'true', 'Oak-hornbeam forests of regions with sub-continental climate within the central European range of Fagus sylvatica, such as the Upper Rhine plain, the rain shadows of the Harz, Rhön and Spessart, the Swabian-Franconian basin, the Bavarian plateau and Thuringe, with Sorbus torminalis, S. domestica, Ligustrum vulgare, Convallaria majalis, Carex montana, C. umbrosa, Festuca heterophylla.', 'Galio-Carpinetum', 'Chênaies-charmaies des régions caractérisées par un climat subcontinental à l\'intérieur de l\'aire centre européenne de Fagus sylvatica, comme la haute plaine du Rhin, ..., du Rhône, ..., avec Sorbus torminalis, S. domestica, Ligustrum vulgare, Convallaria majalis, Carex montana, C. umbrosa, Festuca heterophylla.'),
(9838, 'NR', 22, '41.262', 'Forêts mixtes de Tilleuls de Chênes et de Charmes', '', 'Mixed lime-oak-hornbeam forests', '', 5, 'Niveau 5', 4217, '/68/492/1261/4217/9838', 'false', 'Lime-oak forests of eastern central European regions with continental climate, east of the range of Fagus sylvatica, with Quercus petraea, Q. robur, Tilia cordata, Acer platanoides, Carpinus betulus.', 'Tilio-Carpinetum', 'Forêts de Tilleuls et de Chênes de l\'est de l\'Europe centrale sous un climat continental, à l\'est du secteur de Fagus sylvatica, avec Quercus petraea, Q. robur, Tilia cordata, Acer platanoides, Carpinus betulus.'),
(9839, 'NR', 22, '41.271', 'Chênaies-charmaies xérophiles sur calcaire', '', 'Limestone xerophile oak-hornbeam forests', '', 5, 'Niveau 5', 4224, '/68/492/1261/4224/9839', 'true', 'Generally low formations characteristic of superficial calcareous soils on often steep sunny slopes of southern Germany, southern Belgium and eastern France, with Quercus rubor (usually dominent), Q. petraea, Tilia platyphyllos, Fraxinus excelsior, Carpinus betulus, Acer campestre, Corylus avellana, Cornus sanguinea, C. mas, Crataegus laevigata, C. monogyna, Prunus spinosa, Evouymus europaeus, Ligustrum vulgare, Viburnum lantana, Daphne laureola, Primula veris, Viola hirta, Mercurialis perennis, Scilla bifolia, Orchis mascula, Carex digitata, C. montana.', '', 'Formations généralement basses caractéristiques des sols calcaires superficiels sur des pentes souvent abruptes et ensoleillées du sud de l\'Allemagne, du sud de la Belgique et de l\'est de la France, avec Quercus robur (habituellement dominant), Q. petraea, Tilia platyphyllos, Fraxinus excelsior, Carpinus betulus, Acer campestre, Corylus avellana, Cornus sanguinea, C. mas, Crataegus laevigata, C. monogyna, Prunus spinosa, Euonymus europaeus, Ligustrum vulgare, Viburnum lantana, Daphne laureola, Primula veris, Viola hirta, Mercurialis perennis, Scilla bifolia, Orchis mascula, Carex digitata, C. montana.'),
(9840, 'NR', 22, '42.523', 'Forêts steppiques de Pins sylvestres planitiaires', '', 'Lowland steppe Scots pine forests', '', 5, 'Niveau 5', 4222, '/68/491/1263/4222/9840', 'true', 'Pinus sylvestris woods of areas with extreme continental local climates of middle Europe outside of the Alps, in particular formations with Pinus sylvestris var. haguenensis of the Rhine Valley.', 'Cytiso ruthenici-Pinion: Pyrolo-Pinetum', 'Boisements de Pinus sylvestris des zones à climat local continental extrême d’Europe centrale en dehors des Alpes, en particulier les formations avec Pinus sylvestris var. haguenensis de la vallée du Rhin.'),
(9841, 'NR', 22, '42.221', 'Pessières montagnardes intra-alpines acidiphiles', '', 'Acidophile montane inner Alpine spruce forests', '', 5, 'Niveau 5', 4223, '/68/491/1264/4223/9841', 'true', 'Inner Alpine Picea abies forests of siliceous crystalline or schistous substrates, with Calamagrostis villosa and woodrushes.', 'Calamagrostio villosae-Piceetum, Luzulo-Piceetum, Veronico-Piceetum, Oxali-Piceetum', 'Forêts de Picea abies intra-alpines sur substrats siliceux cristallins ou schisteux, avec Calamagrostis arundinacea et herbacées forestières.'),
(9842, 'NR', 22, '42.222', 'Pessières montagnardes intra-alpines calciphiles', '', 'Calciphile montane inner Alpine spruce forests', '', 5, 'Niveau 5', 4223, '/68/491/1264/4223/9842', 'true', 'Calcicolous inner Alpine Picea abies forests with Calamagrostis varia, Carex flacca, Sesleria caerulea, Hieracium trifidum, Aster bellidiastrum.', 'Calamagrostio variae-Piceetum', 'Forêts calcicoles intra-alpines de Picea abies avec Calamagrostis varia, Carex flacca, Sesleria caerulea, Hieracium trifidum, Aster bellidiastrum.'),
(9843, 'NR', 22, '42.223', 'Pessières montagnardes intra-alpines xérophiles', '', 'Xerophile montane inner Alpine spruce forests', '', 5, 'Niveau 5', 4223, '/68/491/1264/4223/9843', 'true', 'Xerophile, more or less mesotrophic inner Alpine Picea abies forests with Carex montana and Melica nutans.', 'Melico-Piceetum and related communities', 'Forêts de Picea abies intra-alpines plus ou moins mésotrophes avec Carex montana et Melica nutans.'),
(9844, 'NR', 22, '42.224', 'Pessières montagnardes intra-alpines à hautes herbes', '', 'Tall herb montane inner Alpine spruce forests', '', 5, 'Niveau 5', 4223, '/68/491/1264/4223/9844', 'true', 'Upper montane inner Alpine Picea abies forests with tall herb communities.', 'Adenostylo glabrae-Piceetum', 'Forêts de Picea abies de l\'étages supérieur intra-alpin avec des communautés de hautes herbes.'),
(9845, 'NR', 22, '42.225', 'Pessières montagnardes intra-alpines à Sphaignes', '', 'Peatmoss montane inner Alpine spruce forests', '', 5, 'Niveau 5', 4223, '/68/491/1264/4223/9845', 'true', 'Sphagnum-rich inner Alpine Picea abies forests of peaty soils with Listera cordata, Equisetum sylvaticum and Dryopteris dilatata.', '', 'Forêts de Picea abies intra-alpines sur sols tourbeux avec Listera cordata, Equisetum sylvaticum, Calamagrostis villosa.'),
(9846, 'NR', 22, '42.231', '', '', 'Subalpine spruce forests of the Bayerischer Wald', '', 5, 'Niveau 5', 4226, '/68/491/1264/4226/9846', 'false', 'Acidophilous Picea abies forest of the granitic domes of the Bayerischer Wald, with fir, Sorbus aucuparia, Vaccinium myrtillus, Homogyne alpina, Soldanella montana, Calamagrostis villosa.', 'Soldanello-Piceetum', 'Pas de description disponible'),
(9847, 'NR', 22, '42.232', 'Pessières subalpines du Harz et de l\'Erzgebirge', '', 'Subalpine spruce forests of the Harz and Erzgebirge', '', 5, 'Niveau 5', 4226, '/68/491/1264/4226/9847', 'false', 'Spruce forests of the higher elevations of the Harz (above 750 m) and Erzgebirge.', 'Calamagrostio villosae-Piceetum', 'Pessières des hautes élévations du Harz (près de 750m) et de l\'Erzgebirge. A rechercher dans les Alpes françaises (-).'),
(9848, 'NR', 22, '41.272', 'Chênaies-charmaies xérophiles sur schistes', '', 'Schist xerophile oak-hornbeam forests', '', 5, 'Niveau 5', 4224, '/68/492/1261/4224/9848', 'true', 'Low, open formations characteristic of steeep, sunny slopes on slightly calcareous schists in the Ardenne-Eifel periphery, with Quercus petraea (dominent), Carpinus betulus, Quercus robur, Sorbus torminalis, S. aria, Pyrus pyraster, Malus sylvestris, Prunus avium, Amelanchier ovalis, Stellaria holostea, Anemone sylvestris, Silene nutans, S. inflata, Campanula persicifolia, Anthericum liliago, Melica nutans, Carex montana.', '', 'Formations basses et ouvertes caractéristiques des pentes abruptes et ensoleillées sur des schistes légèrement calcaires, dans la périphérie des Ardennes, de l\'Eifel, avec Quercus petraea (dominant), Carpinus betulus, Quercus robur, Sorbus torminalis, S. aria, Pyrus pyraster, Malus sylvestris, Prunus avium, Amelanchier ovalis, Stellaria holostea, Anemone sylvestris. Silene nutans, S. inflata, Campanula persicifolia, Anthericum liliago, Melica nutans, Carex montana.'),
(9849, 'NR', 22, '41.273', 'Chênaies-charmaies calciphiles', '', 'Calciphile ash-oak forests', '', 5, 'Niveau 5', 4224, '/68/492/1261/4224/9849', 'true', 'Formations richer in Fraxinus excelsior and in species characteristic of well-drained, often deep, sometimes rocky, moist or partly dry calcareous soils on gentle slopes of the south Paris basin and adjacent regions, with Quercus robur, Fraxinus excelsior, Carpinus betulus, Acer campestre, Cornus mas, Pyrus pyraster, Daphne laureola, Arum italicum, Asarum europaeum, Doronicum plantagineum, Helleborus foetidus, Hepatica triloba, Orobanche hederae, Lilium martagon, Carex montana.', '', 'Formations plus riches en Fraxinus excelsior et en espèces caractéristiques des sols calcaires bien drainés, souvent profonds, quelquefois rocheux, humides ou partiellement secs, sur pentes douces du sud du Bassin parisien et des régions adjacentes, avec Quercus robur, Fraxinus excelsior, Carpinus betulus, Acer campestre, Cornus mas, Pyrus pyraster, Daphne laureola, Arum italicum, Asarum europaeum, Doronicum plantagineum, Helleborus foetidus, Hepatica nobilis, Orobanche hederae, Lilium martagon, Carex montana.'),
(9850, 'NR', 22, '41.711', 'Bois occidentaux de Quercus pubescens', '', 'Western Quercus pubescens woods', '', 5, 'Niveau 5', 4229, '/68/492/1265/4229/9850', 'true', 'Quercus pubescens ssp. pubescens formations of sub- and supra-Mediterranean regions of France, and of thermal stations in more northerly locations.', '', 'Formations à Quercus pubescens subsp. pubescens des régions sub-méditerranéennes et supra-méditerranéennes de France et de stations chaudes dans des régions plus septentrionales.'),
(9851, 'NR', 22, '41.712', 'Bois sub-méditerranéens de Quercus petraea-Q. robur', '', 'Sub-Mediterranean Quercus petraea-Q. robur woods', '', 5, 'Niveau 5', 4229, '/68/492/1265/4229/9851', 'true', 'Continental thermophilous Quercus petraea or Q. robur woods, outside of the range of Q. pubescens but accompanied by the thermophile, calcicolous cortège of the Quercion pubescenti-petraeae.', '', 'Bois continentaux thermophiles de Quercus petraea ou de Q. robur, hors de l\'aire de distribution de Quercus pubescens, mais accompagnés du cortège thermophile calcicole du Quercion pubescenti-petraeae.'),
(9852, 'NR', 22, '41.713', 'Bois de Quercus palensis', '', 'Quercus palensis woods', '', 5, 'Niveau 5', 4229, '/68/492/1265/4229/9852', 'true', 'Quercus pubescens ssp. palensis formations of the Pyrenees and northeastern Spain.', '', 'Formations de Quercus pubescens subsp. palensis des Pyrénées et du nord-est de l\'Espagne. A rechercher en France.'),
(9853, 'NR', 22, '42.241', '', '', 'Greek spruce forests', '', 5, 'Niveau 5', 4227, '/68/491/1264/4227/9853', 'false', 'Very local Picea abies formations of the Rhodope mountains of extreme northern Greece (Kara-Dere Forest).', '', 'Pas de description disponible'),
(9854, 'NR', 22, '42.242', '', '', 'Apennine spruce forests', '', 5, 'Niveau 5', 4227, '/68/491/1264/4227/9854', 'false', 'Relict woods of spontaneous Picea abies of the northern Apennines (Passo del Cerreto, Emilia-Romagna; Foce del Campolino sull\'Abetone, Tuscany).', '', 'Pas de description disponible'),
(9855, 'NR', 22, '42.251', 'Pessières subalpines du Jura', '', 'Subalpine Jura spruce forests', '', 5, 'Niveau 5', 4232, '/68/491/1264/4232/9855', 'true', 'Sub-alpine Picea abies forests of the Jura, similar to those of the northern outer Alps.', '', 'Forêts de Picea abies subalpines du Jura similaires à celles des Alpes externes nordiques.'),
(9856, 'NR', 22, '42.252', '', '', 'Subalpine Black Forest spruce forests', '', 5, 'Niveau 5', 4232, '/68/491/1264/4232/9856', 'false', 'Sub-alpine Picea abies forests of the Black Forest, with Listera cordata, Lycopodium annotinum.', '', 'Pas de description disponible'),
(10109, 'NR', 22, '54.222', '', '', 'Scottish brown bog-rush fens', '', 5, 'Niveau 5', 4455, '/71/504/1359/4455/10109', 'false', 'Schoenus ferrugineus stands of base-rich Perthshire flushes, with Eleocharis quinqueflora, Carex hostiana, C. panicea, C. lepidocarpa, Saxifraga aizoides, Scirpus cespitosus, Eriophorum latifolium, E. angustifolium, Tofieldia pusilla, Pinguicula vulgaris, Scorpidium scorpioides.', 'Pinguiculo-Caricetum dioicae p.', 'Pas de description disponible'),
(10110, 'NR', 22, '54.223', '', '', 'Baltic brown bog-rush fens', '', 5, 'Niveau 5', 4455, '/71/504/1359/4455/10110', 'false', 'Schoenus ferrugineus-dominated fens of northeastern Jutland, the Danish archipelago and northeastern Germany, with Carex panicea, Tofieldia pusilla, Andromeda poliyfolia and brown mosses.', '', 'Pas de description disponible'),
(10111, 'NR', 22, '54.542', 'Pelouses à Carex limosa et Sphaignes', '', 'Sphagnum mud sedge swards', '', 5, 'Niveau 5', 4456, '/71/504/1341/4456/10111', 'true', 'Acidocline Carex limosa swards and floating rafts, with Scheuchzeria palustris, Drosera rotundifolia, D. anglica, Menyanthes trifoliata and the sphagnums Sphagnum recurvum, S. subsecundum, S. imbricatum, S. papillosum and Menyanthes trifoliata. Outside of transition mires, elements of these communities, and notably Scheuchzeria palustris, occur in deep hollows of bogs (51.121), with Rhynchospora alba and Carex pauciflora and often without Carex limosa.', 'Caricetum limosae sphagnetosum recurvi', 'Tapis et radeaux flottants acidiclines de Carex limosa, avec Scheuchzeria palustris, Drosera rotundifolia, D. anglica, Menyanthes trifoliata, et les Sphaignes Sphagnum recurvum, S. subsecundum, S. imbricatum, S. papillosum. En dehors des tourbières de transition, des éléments de ces communautés, et notamment Scheuchzeria palustris se rencontrent dans les dépressions à l\'intérieur des tourbières (51.121), avec Rhynchospora alba et Carex pauciflora et souvent sans Carex limosa.'),
(10112, 'NR', 22, '54.231', 'Bas-marais à Carex davalliana floristiquement riches', '', 'Species-rich Davall sedge fens', '', 5, 'Niveau 5', 4466, '/71/504/1359/4466/10112', 'true', 'Small Carex, Eriophorum and herb-rich facies of Davall sedge fens, with high species diversity.', 'Caricetum davallianae', 'Faciès à petits Carex, à Eriophorum et riches en plantes herbacées des bas-marais à Carex davalliana, avec une grande diversité spécifique.'),
(10113, 'NR', 22, '54.232', 'Bas-marais à Carex davalliana et Trichophorum cespitosum', '', 'Deergrass Davall sedge fens', '', 5, 'Niveau 5', 4466, '/71/504/1359/4466/10113', 'true', 'Generally impoverished Scirpus cespitosus-dominated facies of Davall sedge fens. Common companions are Carex davalliana, Parnassia palustris, Potentilla erecta and the mosses Campylium stellatum, Drepanocladus intermedius.', 'Caricetum davallianae trichophoretosum', 'Faciès généralement appauvris à Trichophorum cespitosum dominant du bas-marais à Carex davalliana. Les compagnes communes sont Carex davalliana, Parnassia palustris, Potentilla erecta et les Mousses Campylium stellatum, Drepanocladus intermedius.'),
(10114, 'NR', 22, '64.131', '', '', 'Drente crowberry heaths', '', 5, 'Niveau 5', 4472, '/69/512/1367/4472/10114', 'false', 'Heaths of the relict wandering dunes of Drente and southern Friesland, with Empetrum nigrum, Salix arenaria, Lophocolea cuspidata, Pseudoscleropodium purum, Hylocomium splendens.', '', 'Pas de description disponible'),
(10115, 'NR', 22, '64.132', 'Autres landes sur dunes continentales', '', 'Other inland dune heaths', '', 5, 'Niveau 5', 4472, '/69/512/1367/4472/10115', 'true', 'Other heaths colonizing inland dunes; their composition can be speccified by use of codes of 31.22.', '', 'Autres landes colonisant des dunes continentales ; leur composition peut être spécifiée par l\'utilisation des codes de 31.22.'),
(10116, 'NR', 22, '54.251', '', '', 'British dioecious-yellow sedge fens', '', 5, 'Niveau 5', 4474, '/71/504/1359/4474/10116', 'false', 'Small Carex swards of calcareous, soligenous mires on peat or mineral gleys, with Carex dioica, C. lepidocarpa, C. demissa, C. nigra, C. hostiana, C. flacca, C. panicea, Eriophorum latifolium, Eleocharis quinqueflora, Blysmus compressus, Scirpus setacea, Pinguicula vulgaris, Primula farinosa, Bartsia alpina, Tofieldia pusilla and sometimes, Juncus articulatus, J. alpinoarticulatus, Molinia caerulea, Equisetum variegatum, Anagallis tenella, Epipactis palustris and the bryophytes Campylium stellatum, Bryum pseudotriquetrum, Drepanocladus revolvens, Riccardia pinguis, Cratoneurum commutatum, Fissidens adianthoides, characteristic mostly of northern England and Scotland.', 'Pinguiculo-Caricetum dioicae', 'Pas de description disponible'),
(10117, 'NR', 22, '54.252', '', '', 'Scandinavian dioecious-yellow sedge fens', '', 5, 'Niveau 5', 4474, '/71/504/1359/4474/10117', 'false', 'Short Carex-dominated fen communities with Carex flava s. l., C. panicea, C. dioica, Eriophorum latifolium, Tofieldia pusilla and brown mosses.', '', 'Pas de description disponible'),
(10118, 'NR', 22, '54.253', 'Bas-marais à Carex flava médio-européens', '', 'Middle European yellow sedge fens', '', 5, 'Niveau 5', 4474, '/71/504/1359/4474/10118', 'true', 'Fen communities of middle latitudes of continental western Europe (the Netherlands, Belgium, western Germany, France, northern Italy), with Carex dioica, C. lepidocarpa, C. demissa, C. serotina, C. panicea, Eriophorum latifolium, Juncus articulatus and Campylium stellatum.', '', 'Communautés de bas-marais des latitudes moyennes de l\'Europe occidentale continentale (Belgique, Pays-Bas, Allemagne de l\'Ouest, France, Italie septentrionale), avec Carex dioica, C. lepidocarpa, C. demissa, C. serotina, C. panicea, Eriophorum latifolium, Juncus articulatus, J. alpinoarcticus et Campylium stellatum.'),
(10119, 'NR', 22, '45.319', 'Forêts de Chênes verts Illyriennes', '', 'Illyrian holm-oak woodland', '', 5, 'Niveau 5', 4573, '/68/517/1401/4573/10119', 'true', 'Quercus ilex-dominated formations, restricted in the Community to steep slopes of the Riviera Triestina, similar in composition to those of the eastern Adriatic coast, with Pistacia terebinthus, Fraxinus ornus, Coronilla emerus, Ostrya carpinifolia, Carpinus orientalis, Laurus nobilis, Lonicera etrusca, Clematis flammula, Rubia peregrina, Smilax aspera, Vitis vinifera ssp. sylvestris, Cyclamen purpurascens, Prunus mahaleb.', 'Orno-Quercetum ilicis', 'Formations dominées par Quercus ilex avec Pistacia terebinthus, Fraxinus ornus, Coronilla emerus, Ostrya carpinifolia, Laurus nobilis, Lonicera etrusca, Clematis flammula, Rubia peregrina, Smilax aspera, Vitis vinifera, Cyclamen purpurascens, Prunus mahaleb. Présente dans les Alpes maritimes.'),
(10120, 'NR', 22, '45.31A', '', '', 'Southern Italian holm-oak forests', '', 5, 'Niveau 5', 4573, '/68/517/1401/4573/10120', 'false', 'Mostly upper meso-Mediterranean Quercus ilex-dominated formations of southern Italy and Sicily with Viola alba ssp. dehnhardtii, Teucrium siculum, Carex distachya, Cyclamen repandum, Pyrus amygdaliformis, Ruscus aculeatus, Cytisus villosus, Asparagus acutifolius, Rubia peregrina , Asplenium onopteris, Luzula forsteri, Lonicera etrusca, Smilax aspera, Rosa sempervirens and, in some facies, Chamaerops humilis, Pistacia lentiscus, Phillyrea media, Arbutus unedo; like the preceding formations, they are usually degraded to arborescent matorral or coppice, but fine stands survive locally, particularly in Sicily, Puglia (e.g. Bosco delle Pianelle) and Calabria (e.g. Boschi di Badolato).', 'Querco-Teucrietum siculi', 'Pas de description disponible'),
(10121, 'NR', 22, '45.31B', '', '', 'Pantellerian holm-oak woodland', '', 5, 'Niveau 5', 4573, '/68/517/1401/4573/10121', 'false', 'Relictual, mostly degraded pockets of acidophilous Q. ilex woodland of Pantelleria.', 'Viburno-Quercetum ilicis p., \"Erico Quercetum ilicis\" p.', 'Pas de description disponible'),
(10122, 'NR', 22, '45.31C', '', '', 'Greek holm-oak woodland', '', 5, 'Niveau 5', 4573, '/68/517/1401/4573/10122', 'false', 'Quercus ilex-dominated formations of peninsular Greece and the Ionian and Aegean archipelagoes, with the exception of those of Crete; associated with Q. ilex are Quercus coccifera, Arbutus andrachne, A. unedo, Phillyrea latifolia, Pistacia terebinthus, P. lentiscus, Olea europaea, Juniperus oxycedrus; arborescent matorrals (32.1) occur throughout the area, though much less commonly than in the western Mediterranean; reasonably extensive, fully developed, mature forest stands do not appear to remain.', 'Andrachno-Quercetum ilicis', 'Pas de description disponible'),
(10123, 'NR', 22, '45.31D', '', '', 'Cretan holm-oak woodland', '', 5, 'Niveau 5', 4573, '/68/517/1401/4573/10123', 'false', 'Uncommon Quercus ilex formations of Crete; small stands of arborescent matorral (32.1), in which Q. ilex may be associated with Q. coccifera or Q. brachyphylla, occur sporadically, particularly on rocky slopes; orchard-like groves of old Q. ilex, Q. brachyphylla and cultivated Olea europaea exist in the extreme west of the island; heavily grazed, they may be more akin to dehesa (84.5) than to forest.', 'Cyclamino-Quercetum ilicis', 'Pas de description disponible'),
(10124, 'NR', 22, '45.321', 'Forêts de Chênes verts supra-méditerranéennes françaises', '', 'French supra-Mediterranean holm-oak forests', '', 5, 'Niveau 5', 4488, '/68/517/1401/4488/10124', 'true', 'Quercus ilex formations colonizing, with a very reduced cortège of Mediterranean undergrowth species, localized, mostly rocky, stations in the supra-Mediterranean levels of the Pyrenees, Central Massif and Alps.', '', 'Formations de Quercus ilex colonisant, avec un cortège très réduit d\'espèces arbustives méditerranéennes, des stations localisées, généralement rocailleuses, de l\'étage supra-méditerranéen des Pyrénées, du Massif central et des Alpes.'),
(9490, 'NR', 22, '31.747', '', '', 'Summital Balearic labiate hedgehog-heaths', '', 5, 'Niveau 5', 3992, '/67/487/1220/3992/9490', 'false', 'Cushion-forming communities with Teucrium subspinosum, T. asiaticum, Pastinaca lucida, Thymelaea velutina and Paeonia cambessedesii.', 'Hypericion balearici: Teucrietum subspinosae, Pastinacetum lucidae p.', 'Pas de description disponible'),
(9491, 'NR', 22, '31.751', 'Landes épineuses à Astragalus gennargenteus', '', 'Astragalus genargenteus hedgehog-heaths', '', 5, 'Niveau 5', 4011, '/67/487/1220/4011/9491', 'true', 'Oro-Mediterranean Astragalus sirinicus ssp. genargenteus hedgehog-heaths of the Gennargentu and Monte Albo in Sardinia and of the high mountains of Corsica.', 'Astragaletum genargentei', 'Landes épineuses oro-méditerranéennes à Astragalus sirinicus subsp. gennargenteus des hautes montagnes de Corse.'),
(9492, 'NR', 22, '31.752', 'Landes épineuses cyrno-sardes à Euphorbia', '', 'Cyrno-Sardian Euphorbia hedgehog-heaths', '', 5, 'Niveau 5', 4011, '/67/487/1220/4011/9492', 'true', 'Formations of wind-swept crests of Corsica and Sardinia dominated by the low spiny cushions of Euphorbia spinosa.', '', 'Formations de Corse des crêtes exposées au vent dominées par les petits buissons en coussinets épineux d\'Euphorbia spinosa.'),
(9493, 'NR', 22, '31.753', 'Landes en coussinets cyrno-sardes à Thymus', '', 'Cyrno-Sardian Thymus cushion-heaths', '', 5, 'Niveau 5', 4011, '/67/487/1220/4011/9493', 'true', 'Formations of the mountains of Corsica and Sardinia dominated by the hemispherical cushions of the endemic Thymus herba-barona.', '', 'Formations des montagnes de Corse dominées par les buissons hémisphériques en coussinets de l\'endémique Thymus herba-barona.'),
(9494, 'NR', 22, '31.7F1', '', '', 'Tenerife cushion-heaths', '', 5, 'Niveau 5', 4021, '/67/487/1220/4021/9494', 'false', 'Formations of Tenerife with Spartocytisus supranubius, Adenocarpus viscosus var. viscosus, Descurainia bourgaena, Pterocephalus lasiospermus, Erysimum scoparium, Scrophularia glabrata, Nepeta teydea, Echium wildpretii, E. auberianum, Cheirolophus teydis, Plantago webbii, Sideritis cretica, Argyranthemum teneriffae, Pimpinella cumbrae, Arrhenatherum calderae.', 'Spartocytisetum nubigeni', 'Pas de description disponible'),
(9495, 'NR', 22, '31.7F2', '', '', 'La Palma cushion-heaths', '', 5, 'Niveau 5', 4021, '/67/487/1220/4021/9495', 'false', 'Formations of La Palma with Adenocarpus viscosus var. spartioides, the very rare Genista benehoavensis and Descurainia gilba, Pterocephalus porphyranthus, Viola palmensis, Echium wildpretii, E. gentianoides, Micromeria lasiophylla ssp. palmensis.', 'Telino benehoavensi-Adenocarpetum spartioidis', 'Pas de description disponible'),
(9496, 'NR', 22, '31.754', 'Landes épineuses cyrno-sardes à Genista', '', 'Cyrno-Sardian Genista hedgehog-heaths', '', 5, 'Niveau 5', 4011, '/67/487/1220/4011/9496', 'true', 'Hedgehog-heaths of high mountains of Corsica and Sardinia and secondary heaths of the montane level dominated by Genista salzmannii (including var. lobelioides) or G. corsica.', '', 'Landes épineuses des hautes montagnes de Corse et secondairement landes de l\'étage montagnard dominées par Genista salzmanii (incluant var. lobeloides) ou G. corsica.'),
(9497, 'NR', 22, '31.755', 'Landes épineuses cyrno-sardes à Berberis', '', 'Cyrno-Sardian Berberis hedgehog-heaths', '', 5, 'Niveau 5', 4011, '/67/487/1220/4011/9497', 'true', 'Formations of the mountains of Corsica and Sardinia dominated by Berberis aetnensis.', '', 'Formations des montagnes de Corse dominées par Berberis aetnensis.'),
(9498, 'NR', 22, '31.756', 'Landes épineuses cyrno-sardes à Anthyllis', '', 'Cyrno-Sardian Anthyllis hedgehog-heaths', '', 5, 'Niveau 5', 4011, '/67/487/1220/4011/9498', 'true', 'Formations of the mountains of Corsica and Sardinia dominated by Anthyllis hermanniae.', '', 'Formations des montagnes de Corse dominées par Anthyllis hermanniae.'),
(9499, 'NR', 22, '31.771', '', '', 'Madonie Astragalus hedgehog-heaths', '', 5, 'Niveau 5', 4013, '/67/487/1220/4013/9499', 'false', 'Oro-Mediterranean hedgehog-heaths of the Madonie with Astragalus granatensis ssp. nebrodensis.', 'Astragaletum nebrodensis', 'Pas de description disponible'),
(9500, 'NR', 22, '31.772', '', '', 'Sila-Aspromonte Astragalus hedgehog-heaths', '', 5, 'Niveau 5', 4013, '/67/487/1220/4013/9500', 'false', 'Oro-Mediterranean hedgehog-heaths of the Sila and Aspromonte with Astragalus parnassi ssp. calabrus.', 'Astragaletum calabri', 'Pas de description disponible'),
(9501, 'NR', 22, '31.773', '', '', 'Apennine Astragalus sirinicus hedgehog-heaths', '', 5, 'Niveau 5', 4013, '/67/487/1220/4013/9501', 'false', 'Hedgehog-heaths with Astragalus sirinicus ssp. sirinicus of the central and southern Apennines, south to northern Calabria.', '', 'Pas de description disponible'),
(9502, 'NR', 22, '31.774', '', '', 'Madonie Genista cupanii hedgehog-heaths', '', 5, 'Niveau 5', 4013, '/67/487/1220/4013/9502', 'false', 'Montane Genista cupanii-dominated hedgehog-heaths of the Madonie.', 'Genistetum cupanii', 'Pas de description disponible'),
(9503, 'NR', 22, '31.775', '', '', 'Gargano Genista hedgehog-heaths', '', 5, 'Niveau 5', 4013, '/67/487/1220/4013/9503', 'false', 'Montane hedgehog-heaths of Monte Gargano with Genista sylvestris ssp. dalmatica.', 'Chamaecytiso-Genistetum michelii', 'Pas de description disponible'),
(9504, 'NR', 22, '31.791', '', '', 'Greek tragacanth hedgehog-heaths', '', 5, 'Niveau 5', 4015, '/67/487/1220/4015/9504', 'false', 'Hedgehog-heaths of the Taygetos, Kyllini, Chelmos, Parnassus, Vardousia, Giona and calcareous central and northern Pindus, dominated by the large hemispherical tussocks of the tragacanths Astragalus creticus ssp. rumelicus, and/or A. parnassi, and with Marrubium velutinum, M. cyllenaeum, Juniperus hemisphaerica, Daphne oleoides, Eryngium amethystinum, Sideritis clandestina, Cirsium cylleneum.', '', 'Pas de description disponible'),
(9505, 'NR', 22, '31.792', '', '', 'Greek Astragalus angustifolius hedgehog-heaths', '', 5, 'Niveau 5', 4015, '/67/487/1220/4015/9505', 'false', 'Astragalus angustifolius heaths, with Marrubium thessalum or M. velutinum ssp. haussknechtii.', '', 'Pas de description disponible'),
(9506, 'NR', 22, '31.793', '', '', 'Greek cushion-heaths', '', 5, 'Niveau 5', 4015, '/67/487/1220/4015/9506', 'false', 'Cushion formations not dominated by thorny, tussock-forming species of Astragalus.', '', 'Pas de description disponible'),
(9507, 'NR', 22, '31.7A1', '', '', 'Upper alpine Astragalus hedgehog-heaths', '', 5, 'Niveau 5', 4016, '/67/487/1220/4016/9507', 'false', 'Formations dominated by the dense tussocks of Astragalus angustifolius.', '', 'Pas de description disponible'),
(9508, 'NR', 22, '31.7A2', '', '', 'Minuartia cushion-heaths', '', 5, 'Niveau 5', 4016, '/67/487/1220/4016/9508', 'false', 'Communities dominated by the large, domed mats of Minuartia stellata.', '', 'Pas de description disponible'),
(9509, 'NR', 22, '31.7A3', '', '', 'Greek dwarf cushion-heaths', '', 5, 'Niveau 5', 4016, '/67/487/1220/4016/9509', 'false', 'Formations of the high reaches of Greek mountains, rich in dwarf suffrutescents.', '', 'Pas de description disponible'),
(9510, 'NR', 22, '31.7A4', '', '', 'Upper alpine bushy grasslands', '', 5, 'Niveau 5', 4016, '/67/487/1220/4016/9510', 'false', 'Bushy facies of the high altitude stripped grasslands (36.437).', '', 'Pas de description disponible'),
(9511, 'NR', 22, '31.7B1', '', '', 'Cretan tragacanth hedgehog-heaths', '', 5, 'Niveau 5', 4017, '/67/487/1220/4017/9511', 'false', 'Astragalus creticus ssp. creticus-dominated hedgehog-heaths of the Psiloriti and Dikti mountains of central and eastern Crete.', 'Astragalion cretici p.', 'Pas de description disponible'),
(9512, 'NR', 22, '31.7B2', '', '', 'Cretan Astragalus angustifolius hedgehog-heaths', '', 5, 'Niveau 5', 4017, '/67/487/1220/4017/9512', 'false', 'Astragalus angustifolius-dominated hedgehog-heaths of the Lefka Ori, Psiloriti and Dikti mountains of Crete.', 'Verbascion spinosae p.; Astragalion cretici p.', 'Pas de description disponible'),
(9513, 'NR', 22, '31.7B3', '', '', 'Cretan Chamaecytisus hedgehog-heaths', '', 5, 'Niveau 5', 4017, '/67/487/1220/4017/9513', 'false', 'Chamaecytisus creticus-dominated hedgehog-heaths of Crete.', '', 'Pas de description disponible'),
(9514, 'NR', 22, '31.7B4', '', '', 'Other Cretan hedgehog-heaths', '', 5, 'Niveau 5', 4017, '/67/487/1220/4017/9514', 'false', '', '', 'Pas de description disponible'),
(9515, 'NR', 22, '31.7C1', '', '', 'Aegean tragacanth hedgehog-heaths', '', 5, 'Niveau 5', 4018, '/67/487/1220/4018/9515', 'false', 'Hedgehog-heaths of mountain summits of Aegean islands, characterised by large tragacanths.', '', 'Pas de description disponible'),
(9516, 'NR', 22, '31.7C2', '', '', 'Aegean Astragalus angustifolius hedgehog-heaths', '', 5, 'Niveau 5', 4018, '/67/487/1220/4018/9516', 'false', 'Communities characterised by the dense tussocks of Astragalus angustifolius.', '', 'Pas de description disponible'),
(9517, 'NR', 22, '31.742', '', '', 'Peri-Nevadan dwarf cushion-heaths', '', 5, 'Niveau 5', 3992, '/67/487/1220/3992/9517', 'false', 'Oro-Mediterranean, and sometimes supra-Mediterranean, formations of dwarf white-tomentose, cushion-forming suffrutescents of the high sub-Baetic and Baetic ranges; characteristic are Andryala agardhii, Convolvulus boissieri, Hippocrepis squamata ssp. eriocarpa, Pterocephalus spathulatus and Thymus granatensis.', 'Andryalion agardhii p.', 'Pas de description disponible'),
(9857, 'NR', 22, '42.253', 'Pessières montagnardes à déterminisme édaphique', '', 'Montane edaphic spruce forests', '', 5, 'Niveau 5', 4232, '/68/491/1264/4232/9857', 'true', 'Edaphic Picea abies enclaves of the montane and sub-montane levels of the Jura and Hercynian ranges and their vicinity, and of the pre-Alpine plateaux, in particular, block forests, boulder field forests, frost-pocket forests and woods on moist soils.', 'Asplenio-Piceetum p., Bazzanio-Piceetum p., i.a.', 'Enclaves édaphiques de Picea abies des étages montagnard et sub-montagnard du Jura et des massifs hercyniens et de leurs alentours, et des plateaux pré-alpins, en particulier des forêts sur des blocs rocheux, sur des champs morainiques, sur des creux à froids et des bois sur des sols humides.'),
(9858, 'NR', 22, '42.254', 'Pessières de la zone montagnarde du Hêtre', '', 'Montane beech-zone spruce forests', '', 5, 'Niveau 5', 4232, '/68/491/1264/4232/9858', 'true', 'Spruce facies of montane beech-fir forests in the outer Alps, the Jura system and the Hercynian arc.', '', 'Faciès à Epicéa des forêts montagnardes de Hêtre et de Sapins dans les Alpes externes, le Jura et l\'arc hercynien.'),
(9859, 'NR', 22, '41.714', 'Bois de Chênes blancs eu-méditerranéens', '', 'Eu-Mediterranean white oak woods', '', 5, 'Niveau 5', 4229, '/68/492/1265/4229/9859', 'true', 'Q. pubescens forests occupying fresh stations within the meso-Mediterranean zone, usually on ubacs and relatively deep soils, accompanied by Q. ilex and an associated vegetation characteristic of the Quercion ilicis.', 'Quercion ilicis p.', 'Forêts de Quercus pubescens occupant des stations fraîches à l\'intérieur de la zone méso-méditerranéenne, usuellement sur des ubacs ou sur des sols relativement profonds, avec Q. ilex et la végétation associée caractéristique du Quercion ilicis.'),
(9860, 'NR', 22, '41.731', 'Chênaies pubescentes d\'Italie septentrionale', '', 'Northern Italian Quercus pubescens woods', '', 5, 'Niveau 5', 4236, '/68/492/1265/4236/9860', 'true', 'Formations of Quercus pubescens ssp. pubescens, Fraxinus ornus, Ostrya carpinifolia, Carpinus betulus, and, locally, Carpinus orientalis occupying the lower supra-Mediterranean (100-500 metres) level of the central and northern Apennines, the Ligurian ranges and the Alpine foothills of Italy, with local impoverished irradiations to the upper supra-Mediterranean level on calcareous soils.', '', 'Formations de Quercus pubescens ssp. pubescens, Fraxinus ornus, Ostrya carpinifolia, Carpinus betulus, et, localement, Carpinus orientalis occupant l\'étage supra-méditerranéen inférieur (100-500 m) du centre et du nord des Apennins, des massifs liguriens et des contreforts des Alpes italiennes, avec des irradiations locales appauvries dans le supra-méditerranéen supérieur sur sols calcaires.'),
(9861, 'NR', 22, '42.561', 'Forêts mésophiles calcicoles pyrénéennes de Pins sylvestres', '', 'Pyrenean calcicolous mesophile Scots pine forests', '', 5, 'Niveau 5', 4237, '/68/491/1263/4237/9861', 'true', 'Calcicolous formations of Pinus sylvestris with Sorbus aria, Amelanchier ovalis, Ribes alpinum, Prunus mahaleb, Cotoneaster integerrimus, Polygala calcarea, Helleborus foetidus, Valeriana montana, Festuca gautieri.', 'Polygalo-Pinetum', 'Formations calcicoles de Pinus sylvestris avec Sorbus aria, Amelanchier ovalis, Ribes alpinum, Prunus mahaleb, Cotoneaster integerrimus, Polygala calcarea, Helleborus foetidus, Valeriana montana, Festuca gautieri.'),
(9862, 'NR', 22, '42.562', 'Forêts mésophiles acidiphiles pyrénéennes de Pins sylvestres', '', 'Pyrenean siliceous mesophile Scots pine forests', '', 5, 'Niveau 5', 4237, '/68/491/1263/4237/9862', 'true', 'Silicicolous formations of Pinus sylvestris with Sorbus aucuparia, Salix caprea, Calluna vulgaris, Galium rotundifolium, Melampyrum sylvaticum, M. pratense, Lathyrus linifolius (L. montanus), Potentilla erecta, Helleborus viridis ssp. occidentalis, Deschampsia flexuosa.', 'Hylocomio-Pinetum', 'Formations silicicoles de Pinus sylvestris avec Sorbus aucuparia, Salix caprea, Calluna vulgaris, Galium rotundifolium, Melampyrum sylvaticum, M. pratense, Lathyrus linifolius (L. montanus), Potentilla erecta, Helleborus viridis, Deschampsia flexuosa.'),
(9863, 'NR', 22, '42.311', 'Forêts d\'Arolles à Myrtille', '', 'Bilberry arolla forests', '', 5, 'Niveau 5', 4239, '/68/491/1267/4239/9863', 'false', 'Forests limited to ubacs, formed by vigorous Pinus cembra in often pure, dense, shady stands, with rarer Larix decidua and sporadic Picea abies; the ground layer may include Linnaea borealis, Listera cordata.', 'Larici-Cembretum myrtilletosum', 'Forêts cantonnées aux ubacs, formées de Pinus cembra vigoureux en stations souvent pures, denses, ombragées, avec de rares Larix decidua et de sporadiques Picea abies ; la strate inférieure peut renfermer Linnaea borealis, Listera cordata.'),
(9864, 'NR', 22, '42.312', 'Forêts d\'Arolles à Luzules', '', 'Woodrush arolla forests', '', 5, 'Niveau 5', 4239, '/68/491/1267/4239/9864', 'false', 'Forests characteristic of steep adrets in the lower sub-alpine level of the eastern intermediate Alps, usually dominated by Pinus cembra, often in dense stands.', 'Larici-Cembretum luzuletosum albidae', 'Forêts caractéristiques des adrets abrupts de l\'étage sub-alpin des Alpes orientales moyennes, généralement dominées par Pinus cembra, souvent en peuplements denses.'),
(9865, 'NR', 22, '42.313', 'Forêts de Mélèzes et d\'Arolles à Rhododendron ferrugineux', '', 'Rusty alpenrose arolla-larch forests', '', 5, 'Niveau 5', 4239, '/68/491/1267/4239/9865', 'false', 'More open forests than those of 42.311 and 42.312, with Pinus cembra usually dominant, but Larix decidua more abundant and a more extensive heath element.', 'Larici-Cembretum rhododendretosum', 'Forêts plus ouvertes que celles de 42.311 et 42.312, avec Pinus cembra généralement dominant, avec Larix decidua plus abondant et avec une plus grande extension de l\'élément éricoïde.'),
(9866, 'NR', 22, '41.732', '', '', 'Southern Italian and Sicilian Quercus pubescens woods', '', 5, 'Niveau 5', 4236, '/68/492/1265/4236/9866', 'false', 'Formations of Quercus pubescens ssp. pubescens, Ostrya carpinifolia, Carpinus orientalis of the supra-Mediterranean level of southern Italy and Sicily.', '', 'Pas de description disponible'),
(9867, 'NR', 22, '41.733', '', '', 'Greek Quercus pubescens woods', '', 5, 'Niveau 5', 4236, '/68/492/1265/4236/9867', 'false', 'Formations of Quercus pubescens ssp. pubescens, Carpinus orientalis, C. betulus, Ostrya carpinifolia of the lower supra-Mediterranean level of Thessaly, Macedonia, Thrace, and locally on calcareous soils, of western Greece.', '', 'Pas de description disponible'),
(9868, 'NR', 22, '41.734', '', '', 'Quercus anatolica woods', '', 5, 'Niveau 5', 4236, '/68/492/1265/4236/9868', 'false', 'Usually open woods formed by Quercus pubescens ssp. anatolica, often associated with Quercus macrolepis, of Lesbos and Samothrace.', '', 'Pas de description disponible'),
(9869, 'NR', 22, '41.735', '', '', 'Quercus brachyphylla woods', '', 5, 'Niveau 5', 4236, '/68/492/1265/4236/9869', 'false', 'Stands of Quercus brachyphylla, often associated with Quercus macrolepis or Q. ilex, of the Peloponnese and Crete.', '', 'Pas de description disponible');
INSERT INTO `corine` (`CD_HAB`, `FG_VALIDITE`, `CD_TYPO`, `LB_CODE`, `LB_HAB_FR`, `LB_HAB_FR_COMPLET`, `LB_HAB_EN`, `LB_AUTEUR`, `NIVEAU`, `LB_NIVEAU`, `CD_HAB_SUP`, `PATH_CD_HAB`, `FRANCE`, `LB_DESCRIPTION`, `CRSP_PHYTO_CB91`, `DESCRIPTIF_CB97_FR`) VALUES
(9870, 'NR', 22, '41.751', '', '', 'Southern Italian Quercus cerris-Q. frainetto woods', '', 5, 'Niveau 5', 4248, '/68/492/1265/4248/9870', 'false', 'Formations of Quercus cerris, Q. frainetto or, locally, Q. petraea, of the Campanian, Lucanian and Calabrian Apennines and of Monte Gargano.', '', 'Pas de description disponible'),
(9871, 'NR', 22, '41.752', '', '', 'Southern Greek Quercus cerris-Q. frainetto woods', '', 5, 'Niveau 5', 4248, '/68/492/1265/4248/9871', 'false', 'Formations dominated by Quercus cerris, by Q. frainetto, or both, of the Peloponnese, Attica and Beotia', '', 'Pas de description disponible'),
(9872, 'NR', 22, '41.761', '', '', 'Greek Quercus cerris woods', '', 5, 'Niveau 5', 4249, '/68/492/1265/4249/9872', 'false', 'Quercus cerris-dominated formations.', '', 'Pas de description disponible'),
(9873, 'NR', 22, '42.591', 'Forêts péri-alpines à Buis de Pins sylvestres', '', 'Peri-Alpine box Scots pine forests', '', 5, 'Niveau 5', 4251, '/68/491/1263/4251/9873', 'true', 'Supra-Mediterranean Pinus sylvestris forests of the western, southwestern and Insubrian Alps and their foothills, and of the Central Massif periphery.', '', 'Forêts supra-méditerranéennes de Pinus sylvestris des Alpes occidentales et sud-occidentales, de leurs contreforts et du pourtour du Massif central.'),
(9874, 'NR', 22, '41.121', 'Hêtraies acidiphiles de la mer du Nord', '', 'North Sea acidophilous beech forests', '', 5, 'Niveau 5', 4289, '/68/492/1278/4289/9874', 'true', 'Fragmented and insularized forests of the western seaboard of Europe, in Denmark, northern Germany, the Netherlands, middle Belgium, Picardy, Normandy and southern England.', 'Periclymeno-Fagetum, Ilici-Fagetum, Milio-Fagetum, Fago-Quercetum p.', 'Forêts fragmentées et \"insularisées\" de la côte ouest de l\'Europe, de Picardie et de Normandie.'),
(9875, 'NR', 22, '41.122', 'Hêtraies acidiphiles sub-atlantiques', '', 'Sub-Atlantic acidophilous beech forests', '', 5, 'Niveau 5', 4289, '/68/492/1278/4289/9875', 'true', 'Transition forests of the Paris basin, the Morvan, the periphery of the Central Massif, the eastern and central Pyrenees.', 'Deschampsio-Fagetum i.a.', 'Forêts de transition du Bassin parisien, du Morvan, de la périphérie du Massif central, de l\'est et du centre des Pyrénées.'),
(9876, 'NR', 22, '41.123', 'Hêtraies acidiphiles armoricaines', '', 'Armorican acidophilous beech forests', '', 5, 'Niveau 5', 4289, '/68/492/1278/4289/9876', 'true', 'Hyper-Atlantic forests of Brittany with an abundance of epiphytes and an understory of ferns and evergreen bushes.', 'Rusco-Fagetum', 'Forêts hyper-atlantiques de Bretagne avec une abondance d\'épiphytes et une strate basse de fougères et de buissons sempervirents.'),
(9877, 'NR', 22, '41.124', 'Hêtraies acidiphiles pyrénéo-cantabriques', '', 'Pyreneo-Cantabrian acidophilous beech forests', '', 5, 'Niveau 5', 4289, '/68/492/1278/4289/9877', 'true', 'Humid forests with luxuriant epiphytism of the western Pyrenees and eastern Cantabrian mountains.', 'Saxifrago hirsutae-Fagetum', 'Forêts humides de l\'ouest des Pyrénées et de l\'est des chaînes cantabriques avec une végétation épiphytique luxuriante.'),
(9878, 'NR', 22, '41.125', '', '', 'Western Cantabrian acidophilous beech forests', '', 5, 'Niveau 5', 4289, '/68/492/1278/4289/9878', 'false', 'Humid acidophilous beech forests of western Cantabrian and Asturian mountains.', 'Luzulo henriquesii-Fagetum', 'Pas de description disponible'),
(9879, 'NR', 22, '41.126', '', '', 'Galician acidophilous beech forests', '', 5, 'Niveau 5', 4289, '/68/492/1278/4289/9879', 'false', 'Humid beech forests of high, snowy dolomitic and calcareous sierras of Galicia (Ancares, Cebreiro, Caurel), somewhat intermediate between unit 41.12 and unit 41.13.', 'Luzulo henriquesii-Fagetum mercurialetosum perennis', 'Pas de description disponible'),
(10125, 'NR', 22, '42.5B4', '', '', 'Cantabrian Scots pine forests', '', 5, 'Niveau 5', 4585, '/68/491/1263/4585/10125', 'false', 'Isolated Pinus sylvestris forests of the Cantabrian mountain system, in the Cordillera Cantabrica, the Montes de Leon and the Serra do Geres.', '', 'Pas de description disponible'),
(10126, 'NR', 22, '42.611', '', '', 'Alpine Pinus nigra forests', '', 5, 'Niveau 5', 4492, '/68/491/1369/4492/10126', 'false', 'Pinus nigra ssp. austriaca forests of dry, sunny, rocky steep slopes and cliffs of the southeastern pre-Alps (Carnian pre-Alps, Julian pre-Alps, Carso), between 200 and 1200 m altitude, with Cyclamen purpurascens and Aquilegia einseleana.', '', 'Pas de description disponible'),
(10127, 'NR', 22, '42.612', '', '', 'Apennine Pinus nigra forests', '', 5, 'Niveau 5', 4492, '/68/491/1369/4492/10127', 'false', 'Relict \"Villetta Barrea pine\" (Pinus nigra ssp. italica) stations of the Abruzzi (Costa Camosciara, Villetta Barrea), the Campanian Apennines (monti Picentini), the Pollino system (Orsomarso).', '', 'Pas de description disponible'),
(10128, 'NR', 22, '44.111', 'Saussaies à Myricaria', '', 'Willow-tamarisk brush', '', 5, 'Niveau 5', 4495, '/68/515/1378/4495/10128', 'true', 'Low, prostrate Myricaria germanica and Salix spp. formations of low, silty shoals.', 'Salici-Myricarietum', 'Formations basses prostrées à Myricaria germanica et Salix spp. des bancs de sables vaseux de sites alluvionnaires.'),
(10129, 'NR', 22, '44.631', '', '', 'Iberian supra-Mediterranean ash galleries', '', 5, 'Niveau 5', 4487, '/68/515/1403/4487/10129', 'false', 'Fraxinus angustifolia and Quercus pyrenaica-dominated galleries of supra-Mediterranean watercourses of the Cordillera Central, the Leonese mountains and the Iberian Range, developed on siliceous, sandy soils with temporary hydromorphy (pseudogleys).', 'Querco pyrenaicae-Fraxinetum angustifoliae', 'Pas de description disponible'),
(10130, 'NR', 22, '44.632', '', '', 'Iberian meso-Mediterranean ash galleries', '', 5, 'Niveau 5', 4487, '/68/515/1403/4487/10130', 'false', 'Fraxinus angustifolia -dominated galleries of western Iberia, developed in meso- and thermo-Mediterranean areas on siliceous sandy, rarely inundated soils; Populus alba, P. nigra, Salix atrocinerea, Rubus ulmifolius, Osmunda regalis, Ranunculus ficaria, Arum italicum frequently accompany the ashes.', 'Ficario ranunculoidis-Fraxinetum angustifoliae', 'Pas de description disponible'),
(10131, 'NR', 22, '44.633', '', '', 'Baetic ash-maple galleries', '', 5, 'Niveau 5', 4487, '/68/515/1403/4487/10131', 'false', 'Meso- and supra-Mediterranean riparian galleries of the siliceous Sierra Nevada formed by Fraxinus angustifolia and Acer granatense.', 'Aceri granatensis-Fraxinetum angustifoliae', 'Pas de description disponible'),
(10132, 'NR', 22, '44.634', 'Galeries de Frênes et d\'Aulnes tyrrhéniennes', '', 'Tyrrhenian ash-alder galleries', '', 5, 'Niveau 5', 4487, '/68/515/1403/4487/10132', 'true', 'Fraxinus angustifolia-dominated galleries, usually with Alnus glutinosa, of southern France and Tyrrhenian northern and central Italy.', 'Alno-Fraxinetum angustifoliae p.', 'Galeries dominées par Fraxinus angustifolia, généralement avec Alnus glutinosa, du sud de la France et des zones tyrrhéniennes du nord et du centre de l\'Italie.'),
(10133, 'NR', 22, '44.635', '', '', 'Italian ash galleries', '', 5, 'Niveau 5', 4487, '/68/515/1403/4487/10133', 'false', 'Fraxinus angustifolia-dominated galleries of the Adriatic slope of the Italian peninsula, the lower Po basin, the plain of Foggia, the Gulf of Taranto and Sicily, with Ulmus campestris, Salix alba, Populus nigra, Equisetum talmatea, Brachypodium sylvaticum, Carex pendula, Ligustrum vulgare, Rubus ulmifolius.', 'Carici-Fraxinetum angustifoliae', 'Pas de description disponible'),
(10134, 'NR', 22, '44.636', '', '', 'Greek ash galleries', '', 5, 'Niveau 5', 4487, '/68/515/1403/4487/10134', 'false', 'Uncommon Fraxinus angustifolia-dominated galleries of continental Greece, reported in particular from the lower Achelos and Pinios.', '', 'Pas de description disponible'),
(10135, 'NR', 22, '45.322', 'Forêts supra-méditerranéennes corses de Chênes verts', '', 'Corsican supra-Mediterranean holm-oak forests', '', 5, 'Niveau 5', 4488, '/68/517/1401/4488/10135', 'true', 'Quercus ilex formations of the supra-Mediterranean (Pinus laricio) level of Corsica with an undergrowth rich in mesophilous species and practically devoid of meso-Mediterranean elements.', 'Ilici-Quercetum ilicis', 'Formations de Quercus ilex de l\'étage supra-méditerranéen (Pinus laricio) de Corse avec une strate inférieure riche en espèces mésophiles et pratiquement dépourvue d\'éléments méso-méditerranéens.'),
(10136, 'NR', 22, '45.323', '', '', 'Sardinian supra-Mediterranean holm-oak forests', '', 5, 'Niveau 5', 4488, '/68/517/1401/4488/10136', 'false', 'Uppermost levels of the Quercus ilex forests of the Gennargentu and Marghine regions of Sardinia with Quercus pubescens, Taxus baccata, Ilex aquifolium, Acer monspessulanum, Ostrya carpinifolia, Amelanchier ovalis. The separation between these formations and those of 45.31 is not as well-marked as in more northern locations; only the stations most impoverished in meso-Mediterranean elements should be listed here.', '', 'Pas de description disponible'),
(10137, 'NR', 22, '45.324', '', '', 'Italian supra-Mediterranean holm-oak forests', '', 5, 'Niveau 5', 4488, '/68/517/1401/4488/10137', 'false', 'Quercus ilex-dominated formations colonizing enclaves within the supra-Mediterranean deciduous forest belt of northern and central Italy, in particular on sunny slopes of the southern Alps, of the Egadean hills and of the Bolognese Apennines, along the great Insubrian lakes, on sea-facing slopes of the Apennines of Toscany, Latium, Marche and Abruzzi and in a few central valleys of the Apennines of Umbria and Latium, accompanied by an undergrowth typical of the Ostryo-Carpinion. Very well preserved, fully developed examples survive, in particular at Monte Subasio (Umbria).', '', 'Pas de description disponible'),
(10138, 'NR', 22, '45.341', '', '', 'Continental Quercus rotundifolia woodland', '', 5, 'Niveau 5', 4499, '/68/517/1401/4499/10138', 'false', 'Forests and woodland of Q. rotundifolia occupying mostly base-rich soils of the meso- and supra-Mediterranean areas of the central and eastern Meseta, the edges of the Ebro basin and of their bordering northern and eastern mountain ranges, under fairly continental, dry climates.', '', 'Pas de description disponible'),
(10139, 'NR', 22, '42.631', 'Forêts de Pins de Salzmann des Causses', '', 'Causses Salzmann\'s pine forests', '', 5, 'Niveau 5', 4500, '/68/491/1369/4500/10139', 'true', 'Isolated P. salzmannii var. cebennensis woods of the southern edge of the Causses, with an undergrowth typical of supra-Mediterranean white oak forests at the upper limit and of evergreen oak forests at lower altitudes; Buxus sempervirens is usually abundant.', '', 'Bois isolés de P. salzmannii var. cebennensis du bord méridional des Causses, avec un sous-bois typique de forêts de Chênes blancs supra-méditerranéennes à leur limite supérieure et de celui des forêts de Chênes sempervirents à des altitudes inférieures ; Buxus sempervirens est habituellement abondant.'),
(10140, 'NR', 22, '42.632', 'Forêts pré-pyrénéennes de Pins de Salzmann', '', 'Pre-Pyrenean Salzmann\'s pine forests', '', 5, 'Niveau 5', 4500, '/68/491/1369/4500/10140', 'true', 'Meso- and supra-Mediterranean P. salzmannii var. pyrenaica forests of Pyrenean foothills; they are extensive in the southeastern foothills, with outposts in the central foothills, in Catalonian ranges and, very locally, on the north side of the range (Valley of the Têt, Conflent). The understorey is formed by the cortège of Quercus ilex (Juniperus oxycedrus, Rosmarinus officinalis, Quercus ilex) at low altitudes, and by that of Q. pubescens (Buxus sempervirens, Juniperus communis, Amelanchier ovalis, Cornus sanguineus, Lonicera etrusca) at higher altitudes.', '', 'Forêts méso- et supra-méditerranéennes de Pinus salzmannii var. pyrenaica du piémont pyrénéen ; elles sont étendues dans le piémont sud-oriental, avec des avant-postes dans le piémont central et, très localement, sur le versant nord de la chaîne (Vallée de la Têt, Conflent) ; le sous-bois est formé par le cortège de Quercus ilex (Juniperus oxycedrus, Rosmarinus officinalis, Quercus ilex) aux basses altitudes, et par celui de Quercus pubescens (Buxus sempervirens, Juniperus communis, Amelanchier ovalis, Cornus sanguinea, Lonicera etrusca) aux altitudes plus élevées.'),
(10141, 'NR', 22, '42.633', '', '', 'Northern-Iberian Salzmann\'s pine forests', '', 5, 'Niveau 5', 4500, '/68/491/1369/4500/10141', 'false', 'Isolated Pinus salzmannii var. pyrenaica woods of the northern Iberian Range (Soria).', '', 'Pas de description disponible'),
(10142, 'NR', 22, '42.634', '', '', 'Cordilleran Salzmann\'s pine forests', '', 5, 'Niveau 5', 4500, '/68/491/1369/4500/10142', 'false', 'Isolated silicicolous Pinus salzmannii var. iberica woods of the Cordillera Central, limited to small enclaves in the Sierra de Gredos and associated ranges, in the Rio Tietar-Rio Alberche area.', '', 'Pas de description disponible'),
(10143, 'NR', 22, '42.635', '', '', 'Southern-Iberian Salzmann\'s pine forests', '', 5, 'Niveau 5', 4500, '/68/491/1369/4500/10143', 'false', 'Supra- and, locally, oro-Mediterranean Pinus salzmannii var. hispanica forests of the Southern Iberian Range, occupying extensive areas in the Serrania de Cuenca, the Maestrazgo and associated ranges, mostly on limestones.', '', 'Pas de description disponible'),
(9518, 'NR', 22, '31.743', '', '', 'Echinospartum boissieri hedgehog-heaths', '', 5, 'Niveau 5', 3992, '/67/487/1220/3992/9518', 'false', 'Mostly supra-Mediterranean hedgehog-heaths colonizing superficial, eroded soils and windswept stations of calcareous Baetic and sub-Baetic ranges, comprising many cushion plants and generally physiognomically dominated by the large hemispherical shrubs of Echinospartum boissieri.', 'Lavandulo-Genistion boissieri', 'Pas de description disponible'),
(9519, 'NR', 22, '31.744', '', '', 'Catalano-Valencian Erinacea hedgehog-heaths', '', 5, 'Niveau 5', 3992, '/67/487/1220/3992/9519', 'false', 'Unommon hedgehog-heaths with Erinacea anthyllis and Anthyllis montana, and related cushion plant formations, colonizing windswept stations with skeletal soil of the Mediterranean mountains of northeastern Spain (Montsant, Llaveria, Cardo, Maestrazgo septentrional, Beceite; Montserrat; Bergueda, Solsones).', 'Genistion lobelii p.: Erinaceo-Anthyllidetum montanae i.a.', 'Pas de description disponible'),
(9520, 'NR', 22, '31.745', 'Landes en coussinets de Genista', '', 'Genista cushion-heaths', '', 5, 'Niveau 5', 3992, '/67/487/1220/3992/9520', 'true', 'Mostly supra-Mediterranean hedgehog garrigues and heaths physiognomically dominated by small, hemispherical Genista.', 'Genistion lobelii p., Genistion occidentalis', 'Garrigues épineuses surtout supra-méditerranéennes et landes-hérisson physionomiquement dominées par des Genêts bas hémisphériques.'),
(9521, 'NR', 22, '31.831', 'Ronciers', '', 'Bramble thickets', '', 5, 'Niveau 5', 4023, '/67/487/1223/4023/9521', 'true', 'Formations dominated by Rubus spp., including British Rubus fruticosus-Holcus lanatus underscrub.', '', 'Formations dominées par Rubus spp.'),
(9522, 'NR', 22, '31.832', 'Fourrés à Bourdaine, Sorbiers, Chèvrefeuilles', '', 'Alder buckthorn, rowan, honeysuckle thickets', '', 5, 'Niveau 5', 4023, '/67/487/1223/4023/9522', 'true', 'Other formations (except broom fields, gorse thickets, hazel thickets and bracken fields, separately coded below).', '', 'Autres formations à l\'exception des landes de Genêts, des fourrés d\'Ajoncs, des fourrés de Noisetier et des landes à Fougères (qui font l\'objet d\'un code spécial).'),
(9523, 'NR', 22, '31.841', 'Landes médio-européennes à Cytisus scoparius', '', 'Medio-European Cytisus scoparius fields', '', 5, 'Niveau 5', 4024, '/67/487/1223/4024/9523', 'true', 'Expanses of broom (Cytisus scoparius), a common recolonization stage of the Quercion in the plains and hills of northern and middle Europe, reaching the montane zone in the higher mountains.', 'Sarothamnion scoparii (Pruno-Rubion fruticosi: Sarothamnenion)', 'Grandes étendues de Genêts (Cytisus scoparius), stades de recolonisation communs du Quercion dans les plaines et les collines de l\'Europe septentrionale et moyenne, s\'étendant jusqu\'à l\'étage montagnard des hautes montagnes.'),
(9524, 'NR', 22, '31.842', 'Landes à Cytisus purgans', '', 'Cytisus purgans fields', '', 5, 'Niveau 5', 4024, '/67/487/1223/4024/9524', 'true', 'Cytisus purgans-dominated formations of higher levels (upper montane, subalpine, oro-Mediterranean) of southwestern European mountains, often associated with dwarf juniper scrubs (31.43) or hedgehog-heaths (31.7), and physiognomically reminiscent of the latter.', 'Pino-Cytision purgantis p., Genistion polygaliphyllae p.', 'Formations des étages élevés (montagnard supérieur, subalpin, oroméditerranéen) dominées par Cytisus purgans dans les montagnes du sud-ouest de l\'Europe, souvent associées aux broussailles de Genévriers prostrés (31.43) ou aux landes épineuses (31.7), et rappelant physionomiquement celles-ci.'),
(9525, 'NR', 22, '31.872', 'Clairières à couvert arbustif', '', 'Shrubby clearings', '', 5, 'Niveau 5', 4029, '/67/487/1223/4029/9525', 'true', 'Formations of Salix caprea, Sambucus nigra, S. racemosa, Sorbus aucuparia, Rubus spp. succeeding the herbaceous formations in the regrowth of clearings.', 'Sambuco-Salicion capreae', 'Formations de Salix caprea, Sambucus nigra, S. racemosa, Sorbus aucuparia, Rubus spp. succédant aux stades herbacés au cours de la fermeture des clairières.'),
(9526, 'NR', 22, '31.881', 'Landes à Genévriers', '', 'Juniper downs', '', 5, 'Niveau 5', 4025, '/67/487/1223/4025/9526', 'true', 'Juniperus communis colonization of medio-European calcareous grasslands.', '', 'Colonisation par Juniperus communis des pelouses calcicoles médio-européennes.'),
(9527, 'NR', 22, '31.882', 'Landes à Genévriers', '', 'Juniper heaths', '', 5, 'Niveau 5', 4025, '/67/487/1223/4025/9527', 'true', 'J. communis colonization of heaths and related communities.', '', 'Colonisation par Juniperus communis des landes et communautés apparentées.'),
(9528, 'NR', 22, '31.883', '', '', 'Juniper-wood sorrel woodland', '', 5, 'Niveau 5', 4025, '/67/487/1223/4025/9528', 'false', 'Upland formations of the central highlands of Scotland and of northern England, in which Juniperus communus is the most abundant small tree or large shrub, accompanied by ericoids, ferns, grasses, bryophytes and a fairly rich flora of herbaceous dicots.', '', 'Pas de description disponible'),
(9529, 'NR', 22, '31.843', '', '', 'Piornales', '', 5, 'Niveau 5', 4024, '/67/487/1223/4024/9529', 'false', 'Cytisus multiflorus, C. striatus, C. scoparius, C. grandiflorus, C. cantabricus, Genista florida and other tall broom fields of the Iberian peninsula, mostly characteristic of the transition between the Atlantic and Mediterranean domaines.', 'Genistion floridae, Genistion polygaliphyllae', 'Pas de description disponible'),
(9530, 'NR', 22, '31.844', '', '', 'Tyrrhenian broom fields', '', 5, 'Niveau 5', 4024, '/67/487/1223/4024/9530', 'false', 'Broom fields of peninsular Italy and of the large Tyrrhenian islands.', '', 'Pas de description disponible'),
(9531, 'NR', 22, '31.845', '', '', 'Genista aetnensis stands', '', 5, 'Niveau 5', 4024, '/67/487/1223/4024/9531', 'false', 'Formations of the very large Genista aetnensis, endemic to the western Mediterranean and of considerable biogeographical interest, with a distribution limited to Sicily and Sardinia.', '', 'Pas de description disponible'),
(9532, 'NR', 22, '31.846', '', '', 'Canary Island broom fields', '', 5, 'Niveau 5', 4024, '/67/487/1223/4024/9532', 'false', 'Canary Island formations with Teline spp., Micromeria spp., Adenocarpus foliolosus developed in particular in the humid montane zone where they replace heaths on sunnier exposures.', 'Micromerio-Telinion teneriffae', 'Pas de description disponible'),
(9533, 'NR', 22, '31.861', 'Landes subatlantiques à Fougères', '', 'Sub-Atlantic bracken fields', '', 5, 'Niveau 5', 4028, '/67/487/1223/4028/9533', 'true', 'Pteridium aquilinum fields appearing as a recolonization stage of the Quercion of the Atlantic and sub-Atlantic areas of continental Europe, including the British Isles and the Iberian peninsula.', '', 'Landes à Pteridium aquilinum apparaissant comme une étape de recolonisation du Quercion des régions atlantiques et sub-atlantiques de l\'Europe continentale.'),
(9534, 'NR', 22, '31.862', '', '', 'Macaronesian bracken fields', '', 5, 'Niveau 5', 4028, '/67/487/1223/4028/9534', 'false', 'Pteridium facies of the heaths of the Atlantic Islands.', '', 'Pas de description disponible'),
(9535, 'NR', 22, '31.863', 'Landes supra-méditerranéennes à Fougères', '', 'Supra-Mediterranean bracken fields', '', 5, 'Niveau 5', 4028, '/67/487/1223/4028/9535', 'true', 'Pteridium aquilinum fields of the Quercetalia pubescenti - petraeae zone.', '', 'Landes à Pteridium aquilinum dans la zone des Quercetalia pubescenti-petraeae.'),
(9536, 'NR', 22, '31.871', 'Clairières herbacées forestières', '', 'Herbaceous clearings', '', 5, 'Niveau 5', 4029, '/67/487/1223/4029/9536', 'true', 'Short-lived herbaceous communities colonizing recent clearings.', 'Epilobion angustifolii, Atropion', 'Communautés herbacées transitoires colonisant les clairières récentes.'),
(9537, 'NR', 22, '31.811', 'Fruticées à Prunus spinosa et halliers à Rubus fruticosus', '', 'Blackthorn-bramble scrub', '', 5, 'Niveau 5', 4030, '/67/487/1223/4030/9537', 'true', 'Mesophile, often luxuriant, communities characteristic of Carpinion forest edges and substitution formations with, among others, Prunus spinosa, Carpinus betulus, Crataegus spp., Sambucus nigra, Rosa spp., Viburnum opulus, Rubus spp. Included are species-poor Prunus spinosa thickets, such as British <prunus spinosa-Rubus fruticosa scrub and corresponding mainland formations with Rubus fruticosus, R. elegantispinosus, R. bifrons, R. armenicus.', 'Pruno-Rubion fruticosi p.: Pruno-Rubenion fruticosi (\"Prunion spinosae\")', 'Communautés mésophiles et souvent luxuriantes caractéristiques des bords de forêts du Carpinion et formations de substitution avec Prunus spinosa, Carpinus betulus, Crataegus spp., Sambucus nigra, Rosa spp., Viburnum opulus, Rubus spp. Sont incluses les fruticées à Prunus spinosa pauvres en espèces telles que les formes à Prunus spinosa-Rubus fruticosus et les formations à Rubus.'),
(9538, 'NR', 22, '31.812', 'Fruticées à Prunelliers et Troènes', '', 'Blackthorn-privet scrub', '', 5, 'Niveau 5', 4030, '/67/487/1223/4030/9538', 'true', 'Communities of more calcareous, drier soils and warmer exposure characteristic of the Quercion pubescenti-petraeae and of xeric, calciphilous forms of the Carpinion, with, among others, Prunus spinosa, Ligustrum vulgare, Viburnum lantana, Cornus mas, Rhamnus catharticus.', 'Berberidion', 'Communautés de sols plus calcaires, plus humides en exposition plus chaude, caractéristiques du Quercion pubescenti-petraeae et des formes xériques calciphiles du Carpinion, avec entre autres Prunus spinosa, Ligustrum vulgare, Viburnum lantana, Cornus mas, Rhamnus catharticus.'),
(9539, 'NR', 22, '32.133', '', '', 'Juniperus excelsa and J. foetidissima arborescent matorrals', '', 5, 'Niveau 5', 4039, '/67/488/1224/4039/9539', 'false', 'Arborescent matorrals of Greece dominated by Juniperus excelsa or J. foetidissima.', '', 'Pas de description disponible'),
(9540, 'NR', 22, '32.134', 'Matorral arborescent à Juniperus communis', '', 'Juniperus communis arborescent matorral', '', 5, 'Niveau 5', 4039, '/67/488/1224/4039/9540', 'true', 'Mediterranean formations dominated by Juniperus communis.', '', 'Formations méditerranéennes dominées par Juniperus communis.'),
(9541, 'NR', 22, '32.135', '', '', 'Juniperus drupacea arborescent matorral', '', 5, 'Niveau 5', 4039, '/67/488/1224/4039/9541', 'false', 'Formations derived from 42.A5, limited to the Peloponnese.', '', 'Pas de description disponible'),
(9542, 'NR', 22, '32.136', 'Matorral arborescent à Juniperus thurifera', '', 'Juniperus thurifera arborescent matorral', '', 5, 'Niveau 5', 4039, '/67/488/1224/4039/9542', 'true', 'Formations derived from 42.A2.', '', 'Formations dérivées de 42.A2.'),
(9880, 'NR', 22, '41.127', 'Hêtraies acidiphiles ibériques humides', '', 'Humid Iberian acidophilous beech forests', '', 5, 'Niveau 5', 4289, '/68/492/1278/4289/9880', 'false', 'Humid acidophilous beech forests of the Northern Iberian Range.', 'Galio rotundifolii-Fagetum p.', 'Hêtraies acidiphiles humides du nord du secteur ibérique.'),
(9881, 'NR', 22, '41.128', 'Hêtraies acidiphiles ibériques hyper-humides', '', 'Hyper-humid Iberian acidophilous beech forests', '', 5, 'Niveau 5', 4289, '/68/492/1278/4289/9881', 'false', 'Hyper-humid acidophilous beech forests of the Northern Iberian Range.', 'Ilici-Fagetum', 'Hêtraies acidiphiles hyper-humides du nord du secteur ibérique.'),
(9882, 'NR', 22, '41.129', '', '', 'Ayllon acidophilous beech forests', '', 5, 'Niveau 5', 4289, '/68/492/1278/4289/9882', 'false', 'Relict acidophilous beech forests of the Sierra de Ayllon (Montejo, Puerto de la Quesera, Cantalojas).', 'Galio rotundifolii-Fagetum p.', 'Pas de description disponible'),
(9883, 'NR', 22, '36.316', 'Nardaies sommitales hercyniennes', '', 'Hercynian summital mat-grass swards', '', 5, 'Niveau 5', 4323, '/67/495/1297/4323/9883', 'true', 'Summital mat-grass swards of the greater Hercynian ranges.', '', 'Pelouses sommitales à Nard raide des grands massifs hercyniens.'),
(9884, 'NR', 22, '36.321', '', '', 'Oro-Caledonian Carex bigelowii communities', '', 5, 'Niveau 5', 4252, '/67/495/1297/4252/9884', 'false', 'High-altitude formations dominated by Carex bigelowii. with Dicranum fuscescens, Polytrichum alpinum, Cladonia uncialis, C. arbuscula, Galium saxatile of the Central and Eastern Highlands, with outliers in the Northern Highlands and Cumbria (Cross Fell).', '', 'Pas de description disponible'),
(9885, 'NR', 22, '36.322', '', '', 'Oro-Caledonian Rhacomitrium carpets', '', 5, 'Niveau 5', 4252, '/67/495/1297/4252/9885', 'false', 'Summital carpets of Rhacomitrium lanuginosum with Carex bigelowii, Galium saxatile, Vaccinium myrtillus, Deschampsia flexuosa, Cladonia uncialis, of Scotland, northern England and northern Wales.', '', 'Pas de description disponible'),
(9886, 'NR', 22, '36.323', '', '', 'Highland Juncus trifidus formations', '', 5, 'Niveau 5', 4252, '/67/495/1297/4252/9886', 'false', 'Communities of the Scottish Highlands, limited to granitic summital plateaux, summit block detritus, steep block screes, summit ridges and very open ablation areas within Rhacomitrium- Carex bigelowii formations, with Juncus trifidus, Rhacomitrium lanuginosum, Cetraria islandica, Cladonia sylvatica, C. uncialis, C. gracilis, C. arbuscula, Salix herbacea, Deschampsia flexuosa, Alchemilla alpina and sometimes ericoid shrubs.', '', 'Pas de description disponible'),
(9887, 'NR', 22, '36.324', '', '', 'Boreo-alpine mat-grass swards', '', 5, 'Niveau 5', 4252, '/67/495/1297/4252/9887', 'false', 'Nardus stricta communities developed in areas of prolonged snow cover in Scotland, Cumbria, the northern Pennines and north Wales, with Carex bigelowii, Cetraria islandica, Rhacomitrium lanuginosum, Rhytidiadelphus loreus, Galium saxatile, Alchemilla alpina, Empetrum hermaphroditum.', '', 'Pas de description disponible'),
(9888, 'NR', 22, '36.331', 'Pelouses à Festuca paniculata', '', 'Festuca paniculata swards', '', 5, 'Niveau 5', 4254, '/67/495/1297/4254/9888', 'true', 'Thermophile, luxuriant, relatively closed grasslands formed by the very tall, blue-grey Festuca paniculata (F. spadicea) on south-facing slopes (adrets) of the upper montane and lower subalpine levels of the Pyrenees, the southern Alps and, locally, the Central Massif and the Abruzzi; characteristic and often abundant accompanying species include Centaurea uniflora, Silene nutans, Trifolium montanum, Hieracium peleterianum, Hypochoeris maculata, Potentilla grandiflora, Lilium martagon, Eryngium alpinum, Luzula pediformis, Meum athamanticum, Nigritella nigra, Helictotrichon parlatorei, Asphodelus albus, Iris xiphioides, Paradisea liliastrum, Dianthus monspessulanus, Carduus defloratus. Many have been traditionally treated as hay meadows and are of extraordinary floristic richness; they are nowadays increasingly abandoned or left to grazing.', 'Festucion spadiceae: Festucetum spadiceae, Centaureo uniflorae-Festucetum spadiceae, Irido-Festucetum spadiceae, Scorzonero-Festucetum spadiceae, Hieracio-Festucetum spadiceae', 'Pelouses thermophiles, luxuriantes, relativement denses, formées par la très grande Festuca paniculata (F. spadicea) bleu-gris, des versants sud (adrets) des étages montagnard supérieur et subalpin inférieur des Pyrénées, des Alpes méridionales et, localement du Massif central. Les espèces caractéristiques et compagnes, souvent abondantes comprennent Centaurea uniflora, Silene nutans, Trifolium montanum, Hieracium peleterianum, Hypochoeris maculata, Potentilla grandiflora, Lilium martagon, Eryngium alpinum, Luzula nutans, Meum athamanticum, Nigritella nigra, Helictotrichon parlatorei, Asphodelus albus, Iris xiphioides, Paradisea liliastrum, Dianthus monspessulanus, Carduus defloratus. Beaucoup ont été traditionnellement traitées en prés de fauches et sont d\'une richesse floristique extraordinaire ; elles sont de nos jours de plus en plus abandonnées ou transformées en pâturage.'),
(9889, 'NR', 22, '34.711', 'Steppes méditerranéo-montagnardes à Stipa', '', 'Mediterraneo-montane Stipa steppes', '', 5, 'Niveau 5', 4253, '/67/490/1269/4253/9889', 'true', 'Steppes dominated by Stipa pennata, with Festuca auquieri, Koeleria vallesiana, Brachypodium pinnatum, Ononis striata, occupying vast expanses of the Causses, and locally represented on crests and plateaux of Haute Provence, the southeastern Alps and the Corbières.', 'Stipo-Ononidetetum striatae p., Festucetum duriusculae calciense p., Potentillo velutinae-Ononidetum striatae', 'Steppes dominées par Stipa pennata, avec Festuca auquieri, Koeleria vallesiana, Brachypodium pinnatum, Ononis striata, occupant de vastes étendues sur les Causses, et localement représentées sur les crêtes et plateaux de Haute-Provence, des Alpes sud-occidentales et des Corbières.'),
(9890, 'NR', 22, '34.712', 'Pelouses méditerranéo-montagnardes à Sesleria', '', 'Mediterraneo-montane Sesleria steppes', '', 5, 'Niveau 5', 4253, '/67/490/1269/4253/9890', 'true', 'More closed Sesleria albicans var. elegantissima-dominated grasslands occupying usually exiguous surfaces of somewhat shaded slopes, ledges, rocky corridors and snow-retaining cliff-bases in the Causses and other low mountains of the Mediterranean periphery of southern France and Catalonia, in particular Montserrat, the Corbières, the montagne d\'Alaric and western Provence.', 'Seslerio-Phyteumetum = \"Helianthemeto-Seslerietum\"; Conopodio-Seslerietum elegantissimae; \"Seslerieto-Gentianetum corbariensis, Seslerietum mediterraneo-montanum, Erysimeto-Seslerietum caeruleae', 'Pelouses plus fermées dominées par Sesleria albicans var. elegantissima occupant habituellement des surfaces exiguës des pentes quelque peu ombragées, des saillies, des couloirs rocheux et des pieds de falaises retenant la neige, dans les Causses et les autres montagnes basses de la périphérie méditerranéenne du sud de la France, en particulier les Corbières, la montagne d\'Alaric, et la Provence occidentale.'),
(9891, 'NR', 22, '34.713', 'Steppes méditerranéo-montagnardes à Festuca-Koeleria', '', 'Mediterraneo-montane Festuca-Koeleria steppes', '', 5, 'Niveau 5', 4253, '/67/490/1269/4253/9891', 'true', 'Mediterraneo-montane steppe-grasslands poor in Stipa pennata, for the most part Festuca auquieri-, Koeleria vallesiana- or Carex humilis-dominated facies of 34.711.', '', 'Pelouses steppiques méditerranéo-montagnardes pauvres en Stipa pennata, pour la plupart des faciès de 34.711 dominés par Festuca auquieri, Koeleria vallesiana ou Carex humilis.'),
(9892, 'NR', 22, '36.332', 'Pelouses en gradins à Festuca eskia', '', 'Festuca eskia garland-grasslands', '', 5, 'Niveau 5', 4254, '/67/495/1297/4254/9892', 'true', 'Open, thermophile, stripped grasslands organized in ribbons retaining stony, almost bare steps on the adrets of the upper sub-alpine and lower alpine zones in the Pyrenees, formed by the hard, sharp-pointed, slippery, bright green, tufted Festuca eskia, sometimes associated with Carex sempervirens s. l.', 'Festucion eskiae', 'Pelouses ouvertes, thermophiles, organisées en gradins retenant les pierres, avec des marches quasi nues sur les adrets des zones subalpines supérieures et alpines inférieures des Pyrénées, formées par Festuca eskia touffue, d\'un vert brillant, coriace, à pointes acérées, glissante, et quelquefois associées avec Carex sempervirens s.l.'),
(9893, 'NR', 22, '36.333', 'Pelouses en gradins à Festuca varia', '', 'Varicoloured fescue garland-grasslands', '', 5, 'Niveau 5', 4254, '/67/495/1297/4254/9893', 'true', 'Open, thermophile, stripped grasslands of the adrets of the (mostly) southern Alps and Central Massif, formed by calcifuge species of the hard, sharp-pointed Festuca varia group (F. varia, F. scabriculmis), often associated with Carex sempervirens s. l.', 'Festucion variae: Festucetum variae, Festuco-Potentilletum valderiae', 'Prairies thermophiles, ouvertes, en gradins, développées sur les adrets des Alpes méridionales (le plus souvent) et du Massif central, constituées d\'espèces calcifuges à feuilles coriaces et pointues du groupe de Festuca varia (F. varia, F. scabriculmis), souvent associées avec Carex sempervirens s.l.'),
(9894, 'NR', 22, '37.211', 'Prairies humides à cirse des maraîchers', '', 'Cabbage thistle meadows', '', 5, 'Niveau 5', 4255, '/67/496/1270/4255/9894', 'true', 'Cabbage thistle meadows and related species-rich communities, characteristic of base-rich soils in lowland valleys.', 'Angelico-Cirsietum oleracei i.a.', 'Prairies humides à cirse des maraîchers et communautés riches en espèces apparentées, caractéristiques des sols riches en bases dans les vallées de plaine.'),
(9895, 'NR', 22, '37.212', 'Prairies humides à Trolle et Cirse des ruisseaux', '', 'Globe flower-brook thistle meadows', '', 5, 'Niveau 5', 4255, '/67/496/1270/4255/9895', 'true', 'Globe flower - brook thistle meadows and related communities, replacing the cabbage thistle meadows in montane areas.', 'Trollio-Cirsietum rivularis i.a.', 'Prairies à Trollius europaeus et Cirsium rivularis et communautés apparentées ; des lambeaux de ces prairies trouvant place dans les régions montagneuses.'),
(9896, 'NR', 22, '37.213', 'Prairies à Canche cespiteuse', '', 'Tufted hairgrass meadows', '', 5, 'Niveau 5', 4255, '/67/496/1270/4255/9896', 'true', 'Tufted hairgrass meadows and related communities, widespread in eastern and southeastern Europe (northern Greece, in the Quercion frainetto and Fagion moesiacum zones).', 'Deschampsietum cespitosae i.a.', 'Prairies avec Deschampsia cespitosa et communautés apparentées, largement répandues dans l\'est et le sud-est de l\'Europe.'),
(10144, 'NR', 22, '42.636', '', '', 'Baetic Salzmann\'s pine forests', '', 5, 'Niveau 5', 4500, '/68/491/1369/4500/10144', 'false', 'Supra- and, locally, oro-Mediterranean Pinus salzmannii var. hispanica forests of the Baetic and sub-Baetic ranges, covering vast expanses, mostly on limestones, in the sierras de Cazorla, Segura and Alcaraz, with outposts in the Sierra de Baza, the Sierra de Filabres and the calcareous periphery of the Sierra Nevada.', '', 'Pas de description disponible'),
(10145, 'NR', 22, '44.112', 'Saussaies à Argousier', '', 'Willow and sea-buckthorn brush', '', 5, 'Niveau 5', 4495, '/68/515/1378/4495/10145', 'true', 'Formations of Salix spp. and Hippophae rhamnoides of higher gravel shoals.', 'Salicetum elaeagno-daphnoidis', 'Formations à Salix spp. et Hippophae rhamnoides sur levées de galets.'),
(10146, 'NR', 22, '44.121', 'Saussaies à Osier et Salix triandra', '', 'Almond willow-osier scrub', '', 5, 'Niveau 5', 4501, '/68/515/1378/4501/10146', 'true', 'Willow scrub, often dense, lining water courses of medio-European and Atlantic lowlands and hills, with Salix purpurea ssp. lambertiana, S. triandra, S. viminalis.', 'Salicetum triandro-viminalis', 'Fourrés de Saules, souvent denses, bordant les cours d\'eau des plaines et collines médioeuropéennes atlantiques avec Salix purpurea spp. lambertiana, S. triandra, S. viminalis.'),
(10147, 'NR', 22, '44.122', 'Saussaies à Saule pourpre méditerranéennes', '', 'Mediterranean purple willow scrub', '', 5, 'Niveau 5', 4501, '/68/515/1378/4501/10147', 'true', 'Willow scrub dominated by Salix purpurea ssp. lambertiana and S. elaeagnos ssp. angustifolia of water courses of southern France, Mediterranean eastern Spain south to the Rio Segura basin, Italy.', 'Saponario officinalis-Salicetum pupureae', 'Fourrés de Saules dominés par Salix purpurea subsp. lambertiana et S. eleagnos subsp. angustifolia des cours d\'eaux de la France méridionale.'),
(10148, 'NR', 22, '44.123', '', '', 'Balkanic purple willow scrub', '', 5, 'Niveau 5', 4501, '/68/515/1378/4501/10148', 'false', 'Willow-dominated scrub of banks and shoals of Greek rivers, with Salix purpurea, S. amplexicaulis, S. elaeagnos, S. triandra, S. viminalis.', 'Tamarici-Salicetum purpureae, Nerio-Salicetum purpureae, Salicetum triandrae balcanicum, Alneto-Salicetum amplexicaulis i.a.', 'Pas de description disponible'),
(10149, 'NR', 22, '44.124', '', '', 'Ibero-montane willow scrub', '', 5, 'Niveau 5', 4501, '/68/515/1378/4501/10149', 'false', 'Willow scrub, up to 2-3 metres tall, lining water courses of the Pyrenees, the Iberian Range, the Sierra Nevada, formed by Salix purpurea, S. elaeagnos ssp. angustifolia, S. triandra.', 'Salicetum triandro-elaeagni', 'Pas de description disponible'),
(10150, 'NR', 22, '44.711', '', '', 'Greek riparian plane forests', '', 5, 'Niveau 5', 4497, '/68/515/1379/4497/10150', 'false', 'Platanus orientalis gallery forests of Greek watercourses, temporary rivers and gorges; they are distributed throughout the mainland and archipelagoes, colonizing poorly stabilized alluvions of large rivers, gravel or boulder deposits of permanent or temporary torrents, spring basins, and particularly, the bottom of steep, shady gorges, where they constitute species-rich commuities. The accompanying flora may include Salix alba, S. elaeagnos, S. purpurea, Alnus glutinosa, Cercis siliquastrum, Celtis australis, Populus alba, P. nigra, Juglans regia, Fraxinus ornus, Alnus glutinosa, Crataegus monogyna, Cornus sanguinea, Ruscus aculeatus, Vitex agnus-castus, Nerium oleander, Rubus spp., Rosa sempervirens, Hedera helix, Clematis vitalba, Vitis vinifera ssp. sylvestris, Ranunculus ficaria, Anemone blanda, Aristolochia rotunda, Saponaria officinalis, Symphytum bulbosum, Hypericum hircinum, Calamintha grandiflora, Melissa officinalis, Helleborus cyclophyllus, Cyclamen hederifolium, C. repandum, C. creticum, Galanthus nivalis ssp. reginae-olgae, Dracunculus vulgaris, Arum italicum, Biarum tenuifolium, Brachypodium sylvaticum, Dactylis glomerata and may be rich in mosses, lichens and ferns, among which Pteridium aquilinum is often abundant. Various associations have been described, reflecting regional and ecological variation in the composition of the undergrowth. The plane tree galleries are particularly well represented along the Ionian coast and in the Pindus; other important local complexes exist in Macedonia, in Thrace, around the Olympus massif, in the Pelion, in the Peloponnese, particularly in the Taygetos, where luxuriant gorge forests reach 1300m, in Euboea and in Crete; local, distinctive, representatives occur in other Aegean islands, such as Rhodes, Samos, Samothrace, Thasos. Restriction to gorges is increasingly pronounced towards the south.', '', 'Pas de description disponible'),
(10151, 'NR', 22, '44.712', '', '', 'Greek slope plane woods', '', 5, 'Niveau 5', 4497, '/68/515/1379/4497/10151', 'false', 'Platanus orientalis woods on colluvions, detritus cones, ravine sides or other poorly stabilized substrates.', '', 'Pas de description disponible'),
(10152, 'NR', 22, '44.713', '', '', 'Sicilian plane tree canyons', '', 5, 'Niveau 5', 4497, '/68/515/1379/4497/10152', 'false', 'Relict Platanus orientalis-dominated or -rich galleries of the Cassabile, the Anapo, the Irminio and the Carbo rivers, in the Iblei range of southeastern Sicily, of the gorge of the Sirmeto, in the vicinity of the Nebrodi. Some of these formations, in particular, in the gorges of the Cassabile and of the Anapo, are true plane tree woods. Others, such as on the Sirmeto, are Populus alba, Fraxinus angustifolia, Salix spp. formations with Platanus orientalis; as they grade into each other, and because of the very isolated occurrence, and great biogeographical and historical interest of Platanus orientalis in Sicily, they are all listed here. Plane tree woods have had a much greater extension in Sicily and probably in Calabria. A large forest has, in particular, existed on the Alcantara, where the species is now extinct.', '', 'Pas de description disponible'),
(10153, 'NR', 22, '45.342', '', '', 'Western Quercus rotundifolia woodland', '', 5, 'Niveau 5', 4499, '/68/517/1401/4499/10153', 'false', 'Forests and woodland of Q. rotundifolia occupying mostly siliceous soils of the meso- and supra-Mediterranean areas of the western Meseta and neighbouring regions under more Atlantic, though generally dry, climates. Well-preserved examples are rare, most of the remaining wooded areas being under dehesa (84.5) regime.', '', 'Pas de description disponible'),
(10154, 'NR', 22, '45.343', '', '', 'Andalusian Quercus rotundifolia woodland', '', 5, 'Niveau 5', 4499, '/68/517/1401/4499/10154', 'false', 'Forests and woodland of Q. rotundifolia developed in the meso- and supra-Mediterranean levels of Baetic mountains and foothills, and neighbouring interior plains. Well-preserved examples are extremely rare.', '', 'Pas de description disponible'),
(10155, 'NR', 22, '42.641', 'Forêts denses montagnardes de Pin laricio', '', 'Dense montane laricio forests', '', 5, 'Niveau 5', 4503, '/68/491/1369/4503/10155', 'true', 'Pinus laricio forests of the montane level of Corsica, where they replace beech forests, either entirely in some ranges or mostly on adrets and as subclimax communities elsewhere. The undergrowth, fairly similar to that of beech forests, includes Ilex aquifolium, Daphne laureola, Pteridium aquilinum, Allium pendulinum, Helleborus lividus ssp. corsicus, Galium odoratum. Epiphytic lichens are often abundant, including Cetraria glauca, Hypogymnia bitteriana.', 'Galio-Pinetum luzuletosum', 'Forêts de Pinus laricio de l\'étage montagnard de Corse, où elles remplacent les forêts de Hêtres, soit entièrement sur certaines chaînes soit surtout sur les adrets et comme communautés subclimaciques partout ailleurs. La strate inférieure, assez similaire à celle des hêtraies, inclut Ilex aquifolium, Daphne laureola, Pteridium aquilinum, Allium pendulinum, Helleborus lividus subsp. corsicus, Galium odoratum. Les lichens épiphytes sont souvent abondants, incluant Cetraria glauca, Hypogymnia bitteriana.'),
(10156, 'NR', 22, '42.642', 'Forêts ouvertes montagnardes de Pins laricio', '', 'Open montane laricio forests', '', 5, 'Niveau 5', 4503, '/68/491/1369/4503/10156', 'true', 'Open Pinus laricio forests of Corsica, growing at the upper forest limit or on steep rocky slopes, often with birches, Betula pendula.', 'Galio-Pinetum anthyllidetosum', 'Forêts ouvertes de Pinus laricio de Corse, se développant à la limite supérieure de la forêt ou sur des versants rocheux et abrupts, souvent avec des bouleaux, Betula pendula.'),
(10157, 'NR', 22, '42.643', 'Forêts de Pins laricio supra-méditerranéennes', '', 'Supra-Mediterranean laricio forests', '', 5, 'Niveau 5', 4503, '/68/491/1369/4503/10157', 'true', 'Pinus laricio forests of the supra-Mediterranean level of Corsica, with an often dense understorey of Erica arborea and E. scoparia.', 'Galio-Pinetum ericetosum', 'Forêts de Pinus laricio de l\'étage supra-méditerranéen de la Corse, avec un sous-bois souvent dense d\'Erica arborea et E. scoparia.'),
(10158, 'NR', 22, '44.125', '', '', 'Cantabrian willow scrub', '', 5, 'Niveau 5', 4501, '/68/515/1378/4501/10158', 'false', 'Willow scrub of montane rivers and arroyos of the Cordillera Cantabrica, with the endemic Salix cantabrica and with S. elaeagnos ssp. angustifolia, S. purpurea ssp. lambertiana, S. triandra ssp. discolor.', 'Salicetum cantabricae', 'Pas de description disponible'),
(9543, 'NR', 22, '32.141', 'Matorral arborescent à Pin mésogéen (Pinus pinaster)', '', 'Mesogean pine arborescent matorral', '', 5, 'Niveau 5', 4035, '/67/488/1224/4035/9543', 'true', 'Formations dominated by Pinus pinaster ssp. pinaster.', '', 'Formations dominées par Pinus pinaster subsp. pinaster.'),
(9544, 'NR', 22, '32.142', 'Matorral arborescent à Pin pignon (Pinus pinea)', '', 'Stone pine arborescent matorral', '', 5, 'Niveau 5', 4035, '/67/488/1224/4035/9544', 'true', 'Formations dominated by Pinus pinea.', '', 'Formations dominées par Pinus pinea.'),
(9545, 'NR', 22, '32.143', 'Matorral arborescent à Pin d\'Alep (Pinus halepensis)', '', 'Aleppo pine arborescent matorral', '', 5, 'Niveau 5', 4035, '/67/488/1224/4035/9545', 'true', 'Formations dominated by Pinus halepensis.', '', 'Formations dominées par Pinus halepensis.'),
(9546, 'NR', 22, '32.144', '', '', 'Aegean pine arborescent matorral', '', 5, 'Niveau 5', 4035, '/67/488/1224/4035/9546', 'false', 'Formations dominated by Pinus brutia.', '', 'Pas de description disponible'),
(9547, 'NR', 22, '32.145', 'Matorral arborescent à Pin noir ou à Pin sylvestre', '', 'Black pine and scots pine arborescent matorral', '', 5, 'Niveau 5', 4035, '/67/488/1224/4035/9547', 'true', 'Formations dominated by black pines (Pinus pallasiana, P. salzmannii) or occasionnally by scots pines (P. sylvestris).', '', 'Formations dominées par des pins noirs (Pinus salzmannii) ou occasionnellement par des pins sylvestres (Pinus sylvestris).'),
(9548, 'NR', 22, '32.111', 'Matorral de Quercus suber', '', 'Quercus suber matorral', '', 5, 'Niveau 5', 4037, '/67/488/1224/4037/9548', 'true', 'Arborescent matorral mostly of Quercus suber. Detailed habitats can be coded by placing at the fourth and fifth decimal places of 32.111 the second and third digits after the decimal point of 45.2 that characterize the corresponding cork oak forest.', '', 'Matorral arborescent formé principalement par Quercus suber. Les habitats plus détaillés peuvent être codés en plaçant en quatrième et cinquième décimales de 32.111, les second et troisième chiffres après le point décimal de 45.2 qui caractérisent les forêts de Chêne liège correspondantes.'),
(9549, 'NR', 22, '32.112', 'Matorral acidiphile de Quercus ilex', '', 'Acidiphile Quercus ilex and Q. rotundifolia matorral', '', 5, 'Niveau 5', 4037, '/67/488/1224/4037/9549', 'true', 'Arborescent matorral mostly of Q. ilex or Q. rotundifolia, usually with Erica arborea and Arbutus unedo, on siliceous substrates of the western Mediterranean. Detailed habitats can be coded by placing at the fourth, fifth and sixth decimal places of 32.112 the second, third and fourth digits after the decimal point of 45.3 that characterize the corresponding evergreen oak forest.', '', 'Matorral arborescent plutôt de Q. ilex, habituellement accompagné par Erica arborea et Arbutus unedo, sur des substrats siliceux de la Méditerranée occidentale. Les habitats détaillés peuvent être codés en plaçant en quatrième, cinquième et sixième décimales de 32.112 les second, troisième et quatrième chiffres après le point décimal de 45.3 qui caractérisent la forêt de Chêne sempervirent correspondante.'),
(9550, 'NR', 22, '32.113', 'Matorral calciphile à Quercus ilex, Q. coccifera', '', 'Calciphile Quercus ilex, Q. rotundifolia, Q. coccifera matorral', '', 5, 'Niveau 5', 4037, '/67/488/1224/4037/9550', 'true', 'Arborescent matorral mostly of Q. ilex, Q. rotundifolia or Q. coccifera on calcareous substrates of the western Mediterranean. For Q. ilex or Q. rotundifolia matorrals, detailed habitats can be coded by placing at the fourth, fifth and sixth decimal places of 32.113 the second, third and fourth digits after the decimal point of 45.3 that characterize the corresponding evergreen oak forest. For Italian Q. coccifera formations, use 32.1135.', '', 'Matorrals arborescents principalement formés de Quercus ilex ou Q. coccifera sur des substrats calcaires de la Méditerranée occidentale. Pour les matorrals de Q. ilex, les habitats détaillés peuvent être codés en plaçant en quatrième, cinquième et sixième décimales de 32.113 les second, troisième et quatrième chiffres après le point décimal de 45.3 qui caractérisent la forêt de Chêne sempervirent correspondante.'),
(9551, 'NR', 22, '32.114', '', '', 'Eastern Mediterranean Quercus ilex, Q. coccifera matorral', '', 5, 'Niveau 5', 4037, '/67/488/1224/4037/9551', 'false', 'Arborescent matorral mostly of Q. ilex or Q. coccifera (Q. calliprinos) on both siliceous and calcareous substrates of the eastern Mediterranean.', '', 'Pas de description disponible'),
(9552, 'NR', 22, '32.115', '', '', 'Mixed oak arborescent matorral', '', 5, 'Niveau 5', 4037, '/67/488/1224/4037/9552', 'false', 'Arborescent matorral organized around mixed evergreen (Q. suber, Q. ilex, Q. rotundifolia) and deciduous (Q. pyrenaica, Q. faginea) oaks of Iberia.', '', 'Pas de description disponible');
INSERT INTO `corine` (`CD_HAB`, `FG_VALIDITE`, `CD_TYPO`, `LB_CODE`, `LB_HAB_FR`, `LB_HAB_FR_COMPLET`, `LB_HAB_EN`, `LB_AUTEUR`, `NIVEAU`, `LB_NIVEAU`, `CD_HAB_SUP`, `PATH_CD_HAB`, `FRANCE`, `LB_DESCRIPTION`, `CRSP_PHYTO_CB91`, `DESCRIPTIF_CB97_FR`) VALUES
(9553, 'NR', 22, '32.116', '', '', 'Evergreen oak low woods', '', 5, 'Niveau 5', 4037, '/67/488/1224/4037/9553', 'false', 'Dense, low, coppice-like formations of evergreen oaks.', '', 'Pas de description disponible'),
(9554, 'NR', 22, '32.121', 'Matorral arborescent à Olivier sauvage', '', 'Olive arborescent matorral', '', 5, 'Niveau 5', 4038, '/67/488/1224/4038/9554', 'true', 'Olea europaea ssp. sylvestris-dominated formations (cf. 45.11).', '', 'Formations dominées par Olea europea subsp. sylvestris.'),
(9555, 'NR', 22, '32.122', 'Matorral arborescent à Caroubier', '', 'Carob arborescent matorral', '', 5, 'Niveau 5', 4038, '/67/488/1224/4038/9555', 'true', 'Ceratonia siliqua-dominated formations (cf. 45.12).', '', 'Formations dominées par Ceratonia siliqua (voir 45.12).'),
(9556, 'NR', 22, '32.123', 'Matorral arborescent à Lentisque', '', 'Lentisc arborescent matorral', '', 5, 'Niveau 5', 4038, '/67/488/1224/4038/9556', 'true', 'Tall Pistacia lentiscus-dominated formations.', '', 'Formations dominées par de grands Pistacia lentiscus.'),
(9557, 'NR', 22, '32.124', 'Matorral arborescent à Myrte', '', 'Myrtle arborescent matorral', '', 5, 'Niveau 5', 4038, '/67/488/1224/4038/9557', 'true', 'Tall Myrtus communis-dominated formations (e.g. Balearic murtedas, Clematidi-Myrtetum).', '', 'Formations dominées par de grands Myrtus communis.'),
(9558, 'NR', 22, '32.125', '', '', 'Canarian olive-lentisc arborescent matorral', '', 5, 'Niveau 5', 4038, '/67/488/1224/4038/9558', 'false', 'Canary Island Olea europaea ssp. cerasiformis or Pistacia atlantica-dominated formations (cf. 45.13).', '', 'Pas de description disponible'),
(9559, 'NR', 22, '32.131', 'Matorral arborescent à Juniperus oxycedrus', '', 'Juniperus oxycedrus arborescent matorral', '', 5, 'Niveau 5', 4039, '/67/488/1224/4039/9559', 'true', 'Arborescent matorral dominated by Juniperus oxycedrus s.l.', '', 'Matorral arborescent dominé par Juniperus oxycedrus s.l.'),
(9560, 'NR', 22, '32.132', 'Matorral arborescent à Juniperus phoenicea', '', 'Juniperus phoenicea arborescent matorral', '', 5, 'Niveau 5', 4039, '/67/488/1224/4039/9560', 'true', 'Arborescent matorral dominated by Juniperus phoenicea s.l..', '', 'Matorral arborescent dominés par Juniperus phoenicea s.l.'),
(9561, 'NR', 22, '31.891', 'Fourrés caducifoliés sub-méditerranéens franco-ibériques', '', 'Franco-Iberian sub-Mediterranean deciduous thickets', '', 5, 'Niveau 5', 4026, '/67/487/1223/4026/9561', 'true', 'Formations mostly of moist stations within the Mediterranean zone of France, Catalonia, the Balearics and Valencia, with Rosa sempervirens, Rubus ulmifolius, Tamus communis, Prunus spinosa, Cornus sanguinea, Crataegus monogyna and, locally, Coraria myrtifolia.', 'Rubo-Coriaretum i.a.', 'Formations principalement liées aux stations humides de la zone méditerranéenne de France, ... avec Rosa sempervirens, Rubus ulmifolius, Tamus communis, Prunus spinosa, Cornus sanguinea, Crataegus monogyna et localement, Coriaria myrtifolia.'),
(9562, 'NR', 22, '31.892', '', '', 'Western Iberian sub-Mediterranean deciduous thickets', '', 5, 'Niveau 5', 4026, '/67/487/1223/4026/9562', 'false', 'Formations of the western, particularly northwestern, part of the Iberian peninsula, with Crataegus monogyna, Prunus spinosa, Cornus sanguinea, Ligustrum vulgare, Sambucus nigra, Euonymus europaeus, brambles, particularly the Mediterranean Rubus ulmifolius, various roses, notably Rosa sempervirens and Rosa canina agg., and particularly rich in lianas, Tamus communis, Smilax aspera, Clematis vitalba, Lonicera periclymenum, L. etrusca, Rubia peregrina, Bryonia cretica, Vitis vinifera, Humulus lupulus.', 'Rubo ulmifolii-Tametum communis, Lonicero hispanicae-Rubetum ulmifolii, Rhamno catharticae-Crataegetum laevigatae, Lonicero etruscae-Rosetum agrestis i.a.', 'Pas de description disponible'),
(9563, 'NR', 22, '31.893', '', '', 'Central Iberian sub-Mediterranean deciduous thickets', '', 5, 'Niveau 5', 4026, '/67/487/1223/4026/9563', 'false', 'More continental formations of central Iberia, developed mostly on deep, moist soils in the supra-Mediterranean zone of the Meseta, the Ebro basin, the Cordillera Central, the Southern Iberian Range, the Montes de Toledo, the Sierra Morena and the western Baetic or sub-Baetic mountains, with Berberis hispanica, Prunus spinosa, P. mahaleb, Crataegus monogyna, Ribes uva-crispa, Rubus ulmifolius, Lonicera xylosteum, L. etrusca, Amelanchier ovalis, Rhamnus saxatilis, numerous roses of the Rosa agrestis and R. canina aggregates (e.g. Rosa micrantha, R. pouzinii, R. corymbifera, R. sicula) and, locally, Hippophae rhamnoides.', 'Sabino-Berberitum hispanicae, Pruno malahebo-Berberitum hispanicae, Rosetum micrantho-agrestis i.a.', 'Pas de description disponible'),
(9564, 'NR', 22, '31.894', '', '', 'Oro-Baetic sub-Mediterranean deciduous thickets', '', 5, 'Niveau 5', 4026, '/67/487/1223/4026/9564', 'false', 'Supra- and oro-Mediterranean formations of eastern sub-Baetic and Baetic mountains (sierras de Cazorla, Segura, Baza, Magina, Alcaraz and the Sierra Nevada), with Lonicera arborea, L. splendida, Prunus ramburii, Cotoneaster granatensis, Berberis hispanica, Crataegus monogyna, Rosa spp.', 'Lonicero-Berberidion hispanicae: Crataego-Loniceretum arboreae', 'Pas de description disponible'),
(9897, 'NR', 22, '34.323', 'Pelouses semi-arides médio-européennes dominées par Brachypodium', '', 'Middle European Brachypodium-dominated semi-dry grasslands', '', 5, 'Niveau 5', 4118, '/67/490/1236/4118/9897', 'true', 'Brachypodium pinnatum ssp. pinnatum or B. pinnatum ssp. rupestre facies of 34.322. Geographical subdivisions can be introduced by use of the fourth decimal digit of 34.322 in the fourth place of 34.323. Brachypodium-dominated facies may form in all the regional types of grasslands inventoried in 34.322 as a result of nitrification or of dominance of grazing over mowing. Such processes are accompanied by a drastic reduction in species diversity. Southwestern grasslands of units H to K of 34.322 and 34.323 are, however, generally rich in Brachypodium even in the apparent absence of degradation processes.', '', 'Faciès à Brachypodium pinnatum subsp. pinnatum ou B. pinnatum subsp. rupestre de 34.322. Des subdivisions géographiques peuvent être introduites en utilisant la quatrième décimale de 34.322 à la place de 34.323. Les faciès dominés par Brachypodium peuvent se former dans tous les types régionaux de prairies inventoriées en 34.322 comme un résultat de la nitrification ou de la dominance du pâturage sur le fauchage. De tels processus sont accompagnés d\'une réduction drastique de la diversité en espèces. Les pelouses du sud-ouest des unités H à K de 34.322 et 34.323 sont, quoi qu\'il en soit, généralement riches en Brachypodium même en l\'absence apparente de processus de dégradation.'),
(9898, 'NR', 22, '34.714', 'Steppes méditerranéo-montagnardes à Artemisia', '', 'Mediterraneo-montane Artemisia steppes', '', 5, 'Niveau 5', 4253, '/67/490/1269/4253/9898', 'true', 'Open formations with Artemisia alba and Hyssopus officinalis, rich in chamaephytes, of eroded steep slopes of the Causses, harbouring, in particular, Convolvulus cantabricus and Allium flavum; similar formations of the southwestern Alps appear best included in the sub-continental steppe-grasslands (34.314).', '', 'Formations ouvertes avec Artemisia alba et Hyssopus officinalis, riches en chaméphytes, des pentes escarpées érodées des Causses, abritant, en particulier, Convolvulus cantabricus et Allium flavum ; les formations similaires du sud-ouest des Alpes sont à classer plutôt dans les pelouses steppiques sub-continentales (34.314).'),
(9899, 'NR', 22, '36.341', 'Pelouses à Carex curvula', '', 'Carex curvula grasslands', '', 5, 'Niveau 5', 4257, '/67/495/1297/4257/9899', 'true', 'Formations of the upper and middle alpine levels of the Alps, of the upper alpine level of the eastern Pyrenees and of the alpine level of the central and western Pyrenees, to which the dominance of the crooked sedge, Carex curvula, with twisted leaves whithering early at the tip, gives a highly distinctive texture and yellow-brown hue.', 'Caricion curvulae: Caricetum curvulae, Primulo-Caricetum curvulae; Festucion supinae: Gentiano-Caricetum curvulae, Curvulo-Leontodetum pyrenaici', 'Formations de l\'étage alpin supérieur et moyen des Alpes, de l\'étage alpin supérieur des Pyrénées orientales et de l\'étage alpin des Pyrénées centrales et occidentales. La dominance de la laîche courbée, Carex curvula, avec ses feuilles tordues se desséchant rapidement à l\'extrêmité, leur confère un aspect particulièrement typique et une teinte brun-jaune.'),
(9900, 'NR', 22, '36.342', 'Pelouses à Festuca halleri', '', 'Festuca halleri grasslands', '', 5, 'Niveau 5', 4257, '/67/495/1297/4257/9900', 'true', 'Formations of flats and gentle slopes of the lower alpine level of the Alps, dominated by Festuca halleri and Juncus trifidus, particularly widespread in the southwestern Alps.', 'Caricion curvulae: Festucetum halleri', 'Formations des surfaces planes et des pentes douces de l\'étage alpin inférieur des Alpes, dominées par Festuca halleri et Juncus trifidus, particulièrement répandues dans le sud-ouest des Alpes.'),
(9901, 'NR', 22, '37.214', 'Prairies à Séneçon aquatique', '', 'Marsh ragwort meadows', '', 5, 'Niveau 5', 4255, '/67/496/1270/4255/9901', 'true', 'Marsh ragwort meadows and related communities, mostly developed on lowland acidocline soils.', 'Senecionetum aquatici i.a.', 'Prairies à Sénéçon aquatique et communautés apparentées, principalement développés sur sols acidiclines de plaine.'),
(9902, 'NR', 22, '37.215', 'Prairies à Renouée bistorte', '', 'Bistort meadows', '', 5, 'Niveau 5', 4255, '/67/496/1270/4255/9902', 'true', 'Bistort meadows and related communities, occupying acidocline soils of montane and submontane regions.', 'Deschampsio cespitosae-Polygonetum bistortae i.a.', 'Prairies à Polygonum bistorta et communautés associées, occupant les sols acidiclines des régions montagnardes et submontagnardes.'),
(9903, 'NR', 22, '37.216', 'Prairies à Jonc filiforme', '', 'Thread rush meadows', '', 5, 'Niveau 5', 4255, '/67/496/1270/4255/9903', 'true', 'Thread rush meadows and related communities.', 'Juncetum filiformis i.a.', 'Prairies à Juncus filiformis et communautés apparentées.'),
(9904, 'NR', 22, '37.217', 'Prairies à Jonc diffus', '', 'Soft rush meadows', '', 5, 'Niveau 5', 4255, '/67/496/1270/4255/9904', 'true', 'Soft rush meadows and related communities.', 'Epilobio-Juncetum effusi i.a.', 'Prairies à Juncus effusus et communautés apparentées.'),
(9905, 'NR', 22, '37.218', 'Prairies à Jonc subnoduleux', '', 'Blunt-flowered rush meadows', '', 5, 'Niveau 5', 4255, '/67/496/1270/4255/9905', 'true', 'Blunt-flowered rush meadows and related communities, characteristic of very wet calcareous soils or soils flushed by calcareous waters, transitional to the small sedge fens of the Caricion davallianae (54.2), surviving mostly in the British Isles and in the Alpine foothills; many formations are rather oligotrophic and could equally be listed under 37.3.', 'Juncetum subnodulosi i.a.', 'Prairies à Jonc subnoduleux et communautés voisines, caractéristiques des sols calcaires très humides ou des sols avec suintements d\'eaux calcaires, formant transition vers les bas-marais à laîches courtes du Caricion davallianae (54.2), subsistant principalement dans les contreforts alpins ; de nombreuses formations sont plus oligotrophes et peuvent également être listées en 37.3.'),
(9906, 'NR', 22, '37.219', 'Prairies à Scirpe des bois', '', 'Wood clubrush meadows', '', 5, 'Niveau 5', 4255, '/67/496/1270/4255/9906', 'true', 'Wood clubrush meadows and related communities.', 'Scirpetum sylvatici i.a.', 'Prairies à Scirpe des bois et communautés apparentées.'),
(9907, 'NR', 22, '34.324', 'Pelouses alluviales et humides du Mesobromion', '', 'Alluvial and humid Mesobromion grasslands', '', 5, 'Niveau 5', 4118, '/67/490/1236/4118/9907', 'true', 'Closed grasslands rich in species of the Mesobromion and in particular Bromus erectus, developed on calcareous marls, on somewhat elevated expanses of alluvial plains and on other water retentive soils within the range of the grasslands listed under 34.322. They are transitional to humid grasslands (37) and are often marked by the abundance of Carex flacca. Among characteristic elements are also Thalictrum majus, Peucedanum carvifolia, Silaum silaus, Festuca hirundinacea. Geographical subdivisions can be introduced by use of the fourth decimal digit of 34.322 in the fourth place of 34.324. Extensive examples are known in particular from the marls of Lorraine, the Belgian low Meuse and the great rivers of the Netherlands, Westphalia, the alluvial plains of the French Moselle and Meuse, the Rhine valley in Germany and Alsace, various valleys in south Germany and the valley of the Sarthe.', '', 'Pelouses fermées riches en espèces du Mesobromion et en particulier en Bromus erectus, développées sur marnes calcaires, sur des étendues quelque peu surélevées des plaines alluviales et sur d\'autres sols qui retiennent de l\'eau au sein de l\'aire des pelouses listées en 34.322. Elles font la transition avec les pelouses humides (37) et sont souvent marquées par l\'abondance de Carex flacca. Parmi les éléments caractéristiques, on trouve aussi Thalictrum minus subsp. majus, Peucedanum carvifolia, Silaum silaus, Festuca arundinacea. Des subdivisions géographiques peuvent être introduites en utilisant la quatrième décimale de 34.322 à la quatrième place de 34.324. De exemples sur de grandes surfaces sont connus en particulier sur les marnes de Lorraine, les plaines alluviales de la Meuse et de la Moselle françaises, la vallée du Rhin en Alsace et la vallée de la Sarthe.'),
(9908, 'NR', 22, '34.325', 'Pelouses semi-sèches médio-européennes dominées par Sesleria', '', 'Middle European Sesleria-dominated semi-dry grasslands', '', 5, 'Niveau 5', 4118, '/67/490/1236/4118/9908', 'true', 'Sesleria albicans-dominated facies of 34.322, often rich in dealpine species, occurring in particular in the Alpine and Pyrenean periphery, but also occurring locally, farther from the immediate Alpine influence, in anomalous stations such as steep, more or less shaded slopes or cliffs; Sesleria argentea-dominated grasslands of Alava and Navarra. Geographical subdivisions can be introduced by use of the fourth decimal digit of 34.322 in the fourth place of 34.323.', '', 'Faciès de 34.322 dominés par Sesleria albicans, souvent riches en espèces déalpines, se rencontrant en particulier à la périphérie des Alpes et des Pyrénées, mais présents aussi localement, au-delà de l\'influence alpine immédiate, dans des stations particulières telles que des falaises ou des versants escarpés, plus ou moins ombragés ; pelouses dominées par Sesleria argentea de Navarre. Des subdivisions géographiques peuvent être introduites en utilisant la quatrième décimale de 34.322 à la quatrième place de 34.325.'),
(9909, 'NR', 22, '34.326', 'Mesobromion subméditerranéens', '', 'Sub-Mediterranean Mesobromion', '', 5, 'Niveau 5', 4118, '/67/490/1236/4118/9909', 'true', 'Closed mesophile grasslands, usually rich in Bromus erectus and orchids, of the periphery of the Mediterranean basin in Catalonia, the eastern Pyrenees, the Corbières, the Causses, Provence, the southwestern Alps and the northern Apennines. Many are comparatively dry and have sometimes been included in the Xerobromion.', '', 'Pelouses mésophiles fermées, habituellement riches en Bromus erectus et orchidées, situées à la périphérie du bassin méditerranéen, dans les Pyrénées orientales, les Corbières, les Causses, la Provence et le sud-ouest des Alpes.'),
(9910, 'NR', 22, '34.721', 'Pelouses à Aphyllanthes', '', 'Aphyllanthes grasslands', '', 5, 'Niveau 5', 4256, '/67/490/1269/4256/9910', 'true', 'Supra- and upper meso-Mediterranean grasslands, often on compact calcareous marls, dominated by, or rich in, the rush-like lily Aphyllanthes monspeliensis and with Catananche caerulea, Linum suffruticosum ssp. suffruticosum and ssp. salsoloides, L. narbonense, L. strictum, L. campanulatum, L. tenuifolium, Dorycnium suffruticosum, Staehelina dubia, Lavandula latifolia, Potentilla crantzii, Stipa offneri, S. iberica, Koeleria vallesiana, Brachypodium phoenicoides, Carex humilis of southern France, northern and northeastern Spain, and Liguria.', '', 'Pelouses supra- et méso-méditerranéennes supérieures, souvent sur des marnes calcaires compactes, dominées par, ou riches en, Aphyllanthes monspeliensis et avec Catananche caerulea, Linum suffruticosum subsp. suffruticosum et subsp. appresum, L. narbonense, L. strictum, L. campanulatum, L. tenuifolium, Dorycnium suffruticosum, Staehelina dubia, Lavandula latifolia, Potentilla crantzii, Stipa offneri, S. iberica, Koeleria vallesiana, Brachypodium phoenicoides, Carex humilis du sud de la France.'),
(9911, 'NR', 22, '34.722', '', '', 'Supra-Mediterranean feathergrass steppes', '', 5, 'Niveau 5', 4256, '/67/490/1269/4256/9911', 'false', 'Steppe-like Stipa-dominated supra-Mediterranean garrigues and hedgehog-heaths of the mountains and plateaux of eastern Spain; Stipa-dominated facies of Aphyllanthes grasslands.', '', 'Pas de description disponible'),
(9912, 'NR', 22, '34.741', '', '', 'Upper central Apennine dry grasslands', '', 5, 'Niveau 5', 4260, '/67/490/1269/4260/9912', 'false', 'Grasslands of the 350-1350 m range of the central Apennines with Asperula purpurea, Eryngium amethystinum, Crepis lacera, Allium sphaerocephalon, Teucrium montanum.', 'Asperulo purpureae-Brometum erecti', 'Pas de description disponible'),
(17219, 'NR', 22, '61.3122', 'Eboulis à Rumex scutatus', '', 'French sorrel screes', '', 6, 'Niveau 6', 10022, '/69/497/1305/4367/10022/17219', 'true', 'Pioneering community of dry screes of southwestern central Europe.', 'Rumicetum scutati', 'Communautés pionnières des éboulis secs de l\'Europe centrale sud-occidentale.'),
(17220, 'NR', 22, '61.3123', 'Eboulis calcaires à Fougères', '', 'Limestone fern screes', '', 6, 'Niveau 6', 10022, '/69/497/1305/4367/10022/17220', 'true', 'Fern swards of Gymnocarpium robertianum colonizing often slightly damp screes.', 'Gymnocarpietum robertiani', 'Eboulis souvent relativement humides colonisés par des gazons de Gymnocarpium robertianum.'),
(17221, 'NR', 22, '53.2121', 'Cariçaies à laîche aiguë', '', 'Slender tufted sedge beds', '', 6, 'Niveau 6', 10025, '/71/513/1306/4360/10025/17221', 'true', 'Formations of Carex acuta of wet, alkaline or slightly acid depressions with mineral soil; C. acuta does not tolerate prolonged dessication.', 'Caricetum gracilis', 'Formations à Carex acuta des dépressions humides, alcalines ou légèrement acides, sur des sols minéraux ; C. acuta ne tolère pas une exondation prolongée.'),
(17222, 'NR', 22, '53.2122', 'Cariçaies à laîche des marais', '', 'Lesser pond sedge beds', '', 6, 'Niveau 6', 10025, '/71/513/1306/4360/10025/17222', 'true', 'Carex acutiformis is more tolerant of dessication than C. acuta. It forms beds on mesotrophic, base-rich, neutral to slightly acid, peaty or mineral soils. Large beds may form in fens, often with Carex paniculata; otherwise, they are widespread along watercourses on the landward side of Carex acuta or C. vesicaria beds, in alluvial plains, ditches and depressions of humid meadow systems; they may occupy stations that almost totally escape periodical inundation.', '', 'Carex acutiformis est plus tolérant à l\'exondation que C. acuta. Il forme des nappes sur des sols mésotrophes riches en bases, neutres à légèrement acides, tourbeux ou minéraux. Il peut former de grandes nappes dans les bas-marais, souvent avec C. paniculata ; il est également répandu le long des cours d\'eau, du côté terrestre des nappes de Carex acuta ou de C. vesicaria, dans les plaines alluviales, dans les fossés et les dépressions des systèmes prairiaux humides. Elles peuvent occuper des stations qui échappent à peu près complètement aux inondations périodiques.'),
(17223, 'NR', 22, '53.2123', '', '', 'Inn sedge beds', '', 6, 'Niveau 6', 10025, '/71/513/1306/4360/10025/17223', 'false', 'Formations of Carex oenensis, restricted to oligotrophic, base-rich streamsides of the pre-Alpine Bavarian plateau.', 'Caricetum oenensis', 'Pas de description disponible'),
(17224, 'NR', 22, '53.2124', '', '', 'Banat sedge beds', '', 6, 'Niveau 6', 10025, '/71/513/1306/4360/10025/17224', 'false', 'Carex buekii formations of mesotrophic sandy or clayey soils in Franconia, eastern Bavaria, Saxony and northern Italy.', 'Caricetum buekii', 'Pas de description disponible'),
(17225, 'NR', 22, '53.2125', '', '', 'Water sedge beds', '', 6, 'Niveau 6', 10025, '/71/513/1306/4360/10025/17225', 'false', 'Mesotrophic Carex aquatilis formations of Lower Saxony, Wales, Lakeland, Scotland and Ireland.', 'Caricetum aquatilis', 'Pas de description disponible'),
(17226, 'NR', 22, '53.2126', '', '', 'Brotero sedge beds', '', 6, 'Niveau 6', 10025, '/71/513/1306/4360/10025/17226', 'false', 'Carex acuta ssp. broteriana formations of Iberia, lining river courses on the inner side of alder galleries, or replacing them.', 'Galio broteriani-Caricetum broterianae', 'Pas de description disponible'),
(17227, 'NR', 22, '53.2141', 'Cariçaies à Carex rostrata', '', 'Bottle sedge beds', '', 6, 'Niveau 6', 10032, '/71/513/1306/4360/10032/17227', 'true', 'Dense formations of Carex rostrata, of usually very wet, meso-oligotrophic substrates.', '', 'Formations dense de Carex rostrata sur des substrats généralement très humides, méso-oligotrophes.'),
(17228, 'NR', 22, '53.2142', 'Cariçaies à Carex vesicaria', '', 'Bladder sedge beds', '', 6, 'Niveau 6', 10032, '/71/513/1306/4360/10032/17228', 'true', 'Formations of Carex vesicaria, usually characteristic of less oligotrophic situations than the previous ones. C. vesicaria, however, often accompanies C. rostrata, forming then the outer, drier edge of the sedge bed.', '', 'Formations de Carex vesicaria, généralement caractéristiques des situations moins oligotrophes que les précédentes. C. vesicaria, quoiqu\'il en soit, souvent accompagné de Carex rostrata, forme alors la bordure extérieure plus sèche de la cariçaie.'),
(17229, 'NR', 22, '53.2151', 'Cariçaies à Carex elata', '', 'Tufted sedge tussocks', '', 6, 'Niveau 6', 10033, '/71/513/1306/4360/10033/17229', 'true', 'Formations of large, often crowded tussocks of Carex elata, of alkaline or eutrophic, peaty or organic soils. Carex elata is, in particular, one of the constituents of species-rich sedge communities in alkaline fens. It is also typical of the flood plain of large, slow-flowing rivers.', 'Caricetum elatae', 'Formations de grands et souvent nombreux touradons de Carex elata, sur des sols alcalins ou eutrophes, tourbeux ou organiques. C. elata est en particulier, l\'un des constituants des communautés riches en espèces de laîches des bas-marais alcalins. C\'est aussi une végétation typique de la plaine alluviale des grandes rivières lentes.'),
(17230, 'NR', 22, '53.2152', 'Cariçaies à Carex cespitosa', '', 'Sward sedge tussocks', '', 6, 'Niveau 6', 10033, '/71/513/1306/4360/10033/17230', 'true', 'Formations of Carex cespitosa, characteristic of nutrient- and base-rich, neutral to acid peaty soils of northeastern Central Europe and northern Italy.', 'Caricetum cespitosae', 'Formations de touradons à Carex cespitosa, caractéristiques des sols tourbeux neutres à basiques, riches en nutriments et en bases, du nord-est de l\'Europe centrale.'),
(17231, 'NR', 22, '53.2191', 'Cariçaies à Carex vulpina', '', 'True fox sedge tussocks', '', 6, 'Niveau 6', 10044, '/71/513/1306/4360/10044/17231', 'true', 'Formations of the very large Carex vulpina.', '', 'Formations à très grands Carex vulpina.'),
(17232, 'NR', 22, '53.2192', 'Cariçaies à Carex cuprina', '', 'False fox sedge tussocks', '', 6, 'Niveau 6', 10044, '/71/513/1306/4360/10044/17232', 'true', 'Formations of the often less robust Carex otrubae.', '', 'Formations de Carex cuprina, souvent moins robustes que Carex vulpina.'),
(17233, 'NR', 22, '54.4221', 'Bas-marais acides sub-atlantiques à Carex', '', 'Sub-Atlantic Carex acidic fens', '', 6, 'Niveau 6', 10048, '/71/504/1314/4370/10048/17233', 'true', 'Sedge-dominated formations in which Carex canescens, accompanied by Agrostis canina, is often the most abundant, with a brown moss layer that can sometimes be very partial; Carex nigra and C. echinata facies also occur.', '', 'Formations dominées par des Laîches parmi lesquelles Carex canescens, accompagné par Agrostis canina, est souvent la plus abondante, avec une strate de Mousses brunes qui peut être parfois très fragmentaire ; des faciès à Carex nigra et C. echinata s\'y retrouvent également.'),
(17234, 'NR', 22, '54.4222', 'Bas-marais acides subatlantiques à Carex et Juncus', '', 'Sub-Atlantic Carex-Juncus acidic fens', '', 6, 'Niveau 6', 10048, '/71/504/1314/4370/10048/17234', 'true', 'Acidic fen formations in which Carex nigra, C. canescens, C. echinata, and sometimes C. rostrata are accompanied by, and sometimes dominated by, abundant rushes, in particular Juncus filiformis, and J. acutiflorus, and with a pleurocarpic moss layer.', '', 'Formations de bas-marais acides dans lesquelles Carex nigra, C. canescens, C. echinata, et parfois C. rostrata sont accompagnés voire parfois dominés par de nombreux Joncs, en particulier Juncus filiformis et J. acutiflorus, avec une strate muscinale de mousses pleurocarpes.'),
(17235, 'NR', 22, '54.4223', 'Bas-marais sub-atlantiques à Carex et Sphagnum', '', 'Sub-Atlantic Carex-Sphagnum fens', '', 6, 'Niveau 6', 10048, '/71/504/1314/4370/10048/17235', 'true', 'Sphagnum peatlands in which the herbaceous sward is formed by Carex nigra, C. canescens, C. echinata and C. rostrata, generally with Eriophorum angustifolium and E. vaginatum. These very wet formations are closely related to transition mires.', '', 'Tourbières à Sphagnum dans lesquelles la strate herbacée est formée par Carex nigra, C. canescens, C. echinata et C. rostrata, généralement avec Eriophorum angustifolium et E. vaginatum. Ces formations très humides sont étroitement apparentées aux marais de transition.'),
(17236, 'NR', 22, '54.4224', 'Bas-marais sub-atlantiques à Carex, Juncus et Sphagnum', '', 'Sub-Atlantic Carex-Juncus-Sphagnum fens', '', 6, 'Niveau 6', 10048, '/71/504/1314/4370/10048/17236', 'true', 'Sphagnum peatlands in which the herbaceous sward is formed by Carex nigra, C. canescens, C. echinata, C. rostrata and abundant rushes, in particular Juncus filiformis and J. acutiflorus, generally with Eriophorum angustifolium and E. vaginatum. These formations are often related to wet grasslands.', '', 'Tourbières à Sphagnum dans lesquelles la strate herbacée est formée par Carex nigra, C. canescens, C. echinata, C. rostrata et de nombreux Joncs, en particulier Juncus filiformis et Juncus acutiflorus, généralement avec Eriophorum angustifolium et E. vaginatum. Ces formations sont souvent apparentées à des prairies humides.'),
(17237, 'NR', 22, '54.4231', '', '', 'British Carex-Sphagnum fens', '', 6, 'Niveau 6', 10057, '/71/504/1314/4370/10057/17237', 'false', 'Acidic sphagnum fens of the British Isles dominated by C. canescens, C. echinata, C. nigra, C. panicea, C. demissa, C. rostrata, with Sphagnum recurvum, S. papillosum, S. russowii.', '', 'Pas de description disponible'),
(17238, 'NR', 22, '54.4232', '', '', 'British Juncus-Sphagnum fens', '', 6, 'Niveau 6', 10057, '/71/504/1314/4370/10057/17238', 'false', 'Acidic sphagnum fens of the British Isles physiognomically dominated by Juncus effusus and J. acutiflorus, with Carex echinata, C. nigra, Agrostis stolonifera, Sphagnum recurvum, Polytrichum commune.', '', 'Pas de description disponible'),
(17239, 'NR', 22, '54.4233', '', '', 'British high montane Sphagnum fens', '', 6, 'Niveau 6', 10057, '/71/504/1314/4370/10057/17239', 'false', 'Very local fens of the high Scottish Highlands, with Carex echinata, C. nigra, C. bigelowii, C. aquatilis, C. rariflora, Saxifraga stellaris, Sphagnum recurvum, S. lindbergii, S. riparium, S. russowii.', '', 'Pas de description disponible'),
(17240, 'NR', 22, '83.3111', 'Plantations de Sapins, d\'Epicéas et de Mélèzes européens', '', 'European fir, spruce, larch plantations', '', 6, 'Niveau 6', 10064, '/70/502/1331/4407/10064/17240', 'true', '', '', 'Pas de description disponible'),
(17241, 'NR', 22, '83.3112', 'Plantations de Pins européens', '', 'European pine plantations', '', 6, 'Niveau 6', 10064, '/70/502/1331/4407/10064/17241', 'true', '', '', 'Pas de description disponible'),
(17242, 'NR', 22, '83.3113', 'Plantations de Cyprès et de Genévriers européens', '', 'European cypress and juniper plantations ', '', 6, 'Niveau 6', 10064, '/70/502/1331/4407/10064/17242', 'true', '', '', 'Pas de description disponible'),
(16860, 'NR', 22, '22.3152', '', '', 'Lake Constance shore hairgrass swards', '', 6, 'Niveau 6', 9397, '/66/484/1204/3941/9397/16860', 'false', 'Deschampsia rhenana swards of Lake Constance.', '', 'Pas de description disponible'),
(16861, 'NR', 22, '22.3231', 'Gazons à Juncus bufonius', '', 'Toad-rush swards', '', 6, 'Niveau 6', 9400, '/66/484/1204/3943/9400/16861', 'true', 'Communities dominated by Juncus bufonius.', '', 'Communautés dominées par Juncus bufonius.'),
(16862, 'NR', 22, '22.3232', 'Gazons à petits Souchets', '', 'Small galingale swards', '', 6, 'Niveau 6', 9400, '/66/484/1204/3943/9400/16862', 'true', 'Medio-European communities dominated by the annual galingales Cyperus flavescens, C. fuscus and C. michelianus.', 'Cyperetum flavescentis, Samolo-Cyperetum fusci i.a.', 'Communautés médio-européennes dominées par les Souchets annuels Pycreus flavescens (Cyperus flavescens), C. fuscus et C. michelianus.'),
(16863, 'NR', 22, '22.3233', 'Communautés d\'herbes naines des substrats humides', '', 'Wet ground dwarf herb communities', '', 6, 'Niveau 6', 9400, '/66/484/1204/3943/9400/16863', 'true', 'Varied communities, some very rare and threatened, of small annuals of wet ground.', 'Centunculo-Anthocerotetum, Stellario uliginosae-Scirpetum setaceae, Erythraeo-Blackstonietum, Ranunculo-Radioletum linoidis, Cicendietum filiformis, Spergulario-Illecebretum verticillati i.a.', 'Communautés diverses, dont certaines très rares et menacées, de petites plantes annuelles sur substrat humide.'),
(16864, 'NR', 22, '22.3417', 'Groupements à Spiranthes et Anagallis', '', 'Bog pimpernel-summer lady\'s tresses communities', '', 6, 'Niveau 6', 9392, '/66/484/1204/3942/9392/16864', 'true', 'Formations of the sandy, rocky edges of rivulets of the Mediterranean region.', 'Spirantho-Anagalletum tenellae', 'Formations des bordures sableuses ou rocheuses des ruisselets de la région méditerranéenne.'),
(16865, 'NR', 22, '22.3418', 'Groupements méditerranéens amphibies à plantes de taille réduite', '', 'Mediterranean amphibious small herb communities', '', 6, 'Niveau 6', 9392, '/66/484/1204/3942/9392/16865', 'true', 'Other, often highly ephemereal, annual communities of temporarily inundated or wet terrain.', '', 'Autres groupements annuels, souvent très éphémères, des terrains temporairement inondés ou humides.'),
(16866, 'NR', 22, '22.4311', 'Tapis de Nénuphars', '', 'Waterlily carpets', '', 6, 'Niveau 6', 9423, '/66/484/1215/3974/9423/16866', 'true', 'Formations of Nymphaea alba, N. candida, Nuphar lutea or N. pumila.', '', 'Formations de Nymphaea alba, N. candida, Nuphar lutea ou N. pumila.'),
(16867, 'NR', 22, '22.4312', 'Tapis de chataîgnes d\'eau', '', 'Water chestnut carpets', '', 6, 'Niveau 6', 9423, '/66/484/1215/3974/9423/16867', 'true', 'Formations of Trapa natans.', '', 'Formations de Trapa natans.'),
(16868, 'NR', 22, '22.4313', 'Tapis de Nymphoides', '', 'Fringed waterlily carpets', '', 6, 'Niveau 6', 9423, '/66/484/1215/3974/9423/16868', 'true', 'Formations of Nymphoides peltata.', '', 'Formations de Nymphoides peltata.'),
(16869, 'NR', 22, '22.4314', 'Tapis de Potamot flottant', '', 'Broad-leaved pondweed carpets', '', 6, 'Niveau 6', 9423, '/66/484/1215/3974/9423/16869', 'true', 'Formations of Potamogeton natans.', '', 'Formations à Potamogeton natans.'),
(16870, 'NR', 22, '22.4315', 'Tapis de Renouées', '', 'Bistort carpets', '', 6, 'Niveau 6', 9423, '/66/484/1215/3974/9423/16870', 'true', 'Formations of Polygonum amphibium.', '', 'Formations de Polygonum amphibium.'),
(16871, 'NR', 22, '31.2251', '', '', 'East Anglian Calluna-Festuca heaths', '', 6, 'Niveau 6', 9431, '/67/487/1217/3975/9431/16871', 'false', 'Lowland, species-poor Calluna vulgaris-Festuca ovina heaths of East Anglia and adjacent areas.', '', 'Pas de description disponible'),
(16872, 'NR', 22, '31.2252', '', '', 'Spring squill heath', '', 6, 'Niveau 6', 9431, '/67/487/1217/3975/9431/16872', 'false', 'Maritime Calluna vulgaris-Erica cinerea heaths with Scilla verna, of the coasts of southwestern England, western Wales, Cumbria, Scotland and the isles.', '', 'Pas de description disponible'),
(16873, 'NR', 22, '31.2411', 'Landes aquitaniennes à Erica et Cistus', '', 'Aquitanian Erica-Cistus heaths', '', 6, 'Niveau 6', 9432, '/67/487/1217/3977/9432/16873', 'true', 'Erica cinerea and Cistus salvifolius heaths of the Aquitanian coast, with irradiations in the Landes and to the Montagne noire and Minervois.', '', 'Landes à Erica cinerea et Cistus salviifolius de la côte aquitanienne, avec des irradiations dans les Landes, dans la Montagne Noire et dans le Minervois.'),
(16874, 'NR', 22, '31.2412', 'Landes arides de Gascogne et de Sologne', '', 'Gascony-Sologne arid heaths', '', 6, 'Niveau 6', 9432, '/67/487/1217/3977/9432/16874', 'true', 'Arid Erica cinerea heaths of interior sandy hills and dunes of the Landes of Gascony and of Sologne gravels, with Halimium alyssoides.', '', 'Landes arides à Erica cinerea des collines et des dunes intérieures sableuses des Landes, de Gascogne et des graviers de Sologne, avec Halimium lasianthum subsp. alyssoides.'),
(16875, 'NR', 22, '31.2413', '', '', 'Northern Iberian heaths', '', 6, 'Niveau 6', 9432, '/67/487/1217/3977/9432/16875', 'false', 'Erica vagans, E. cinerea and sometimes E. ciliaris heaths, with Calluna vulgaris and Ulex europaeus, of the coasts, hills and lower montane areas of the Atlantic slope of Cantabria, the Asturias and Galicia.', '', 'Pas de description disponible'),
(16876, 'NR', 22, '31.2421', '', '', 'Luso-Galician collinar heaths', '', 6, 'Niveau 6', 9433, '/67/487/1217/3977/9433/16876', 'false', 'Coastal and collinar, thermo-Atlantic Galician and northern Portuguese heaths with Erica cinerea, E. umbellata , Ulex minor, U. europaeus, U. micranthus, Cistus salvifolius and Halimium alyssoides.', '', 'Pas de description disponible'),
(16877, 'NR', 22, '31.2422', '', '', 'Luso-Galician maritime heaths', '', 6, 'Niveau 6', 9433, '/67/487/1217/3977/9433/16877', 'false', 'Cushiony heaths with Ulex europaeus ssp. latebracteatus f. humilis and Erica cinerea of cliff-tops of Galicia, north and central Portugal (southern vicariant of 31.231).', '', 'Pas de description disponible'),
(16878, 'NR', 22, '31.2431', '', '', 'Cabreran dry whin heaths', '', 6, 'Niveau 6', 9434, '/67/487/1217/3977/9434/16878', 'false', 'Open, cushiony formations of Calluna vulgaris, Erica umbellata, Genista sanabrensis, Halimium umbellatum, H. alyssoides occupying dry, superficial soils.', '', 'Pas de description disponible'),
(16879, 'NR', 22, '31.2432', '', '', 'Cabreran mesophile whin heaths', '', 6, 'Niveau 6', 9434, '/67/487/1217/3977/9434/16879', 'false', 'Formations of Calluna vulgaris, Genista carpetana, G. anglica, G. micrantha and Thymelaea coridifolia (T. dendryobryum) of wetter stations.', '', 'Pas de description disponible'),
(16880, 'NR', 22, '31.2441', '', '', 'Galicio-Leonese Erica aragonensis heaths', '', 6, 'Niveau 6', 9435, '/67/487/1217/3977/9435/16880', 'false', 'Supra-Mediterranean Erica aragonensis heaths with Chamaespartium tridentatum, Calluna vulgaris, Halimium alyssoides of the interior slopes of the Cantabrian Cordillera, eastern Galician ranges, Leon mountains and the Sierra de Cabrera).', '', 'Pas de description disponible'),
(16881, 'NR', 22, '31.2442', '', '', 'Galicio-Leonese Erica umbellata heaths', '', 6, 'Niveau 6', 9435, '/67/487/1217/3977/9435/16881', 'false', 'Lower altitude heaths on the confines of Galicia and Leon dominated by Erica umbellata accompanied by Erica cinerea, Calluna vulgaris, Chamaespartium tridentatum, Halimium alyssoides, H. umbellatum and Mediterranean elements such as Lavendula stoechas ssp. pedunculata.', '', 'Pas de description disponible'),
(16882, 'NR', 22, '31.2443', '', '', 'Galicio-Leonese Erica cinerea heaths', '', 6, 'Niveau 6', 9435, '/67/487/1217/3977/9435/16882', 'false', 'Erica cinerea-dominated variants of the Galician and Leonese heaths of 31.2442.', '', 'Pas de description disponible'),
(16883, 'NR', 22, '31.2253', '', '', 'British Calluna-Sieglingia heaths', '', 6, 'Niveau 6', 9431, '/67/487/1217/3975/9431/16883', 'false', 'Species-rich Calluna vulgaris-Danthonia (Sieglingia) decumbens heaths.', '', 'Pas de description disponible'),
(16884, 'NR', 22, '31.2254', '', '', 'English Calluna-Deschampsia heaths', '', 6, 'Niveau 6', 9431, '/67/487/1217/3975/9431/16884', 'false', 'Species-poor Calluna vulgaris-Deschampsia flexuosa heaths of northern Pennine foothills, North Yorkshire moors and west Midlands.', '', 'Pas de description disponible'),
(16885, 'NR', 22, '31.2255', '', '', 'British Calluna-bearberry heaths', '', 6, 'Niveau 6', 9431, '/67/487/1217/3975/9431/16885', 'false', 'Arctostaphylos uva-ursi-Calluna vulgaris heaths with Genista anglica and often Erica cinerea and Vaccinium vitis-idaea of eastern Highlands, Teesdale, Lake District and Orkney.', '', 'Pas de description disponible'),
(16886, 'NR', 22, '31.2256', '', '', 'Upland Calluna-bell heather heath', '', 6, 'Niveau 6', 9431, '/67/487/1217/3975/9431/16886', 'false', 'Sub-montane heather-moors dominated by Calluna vulgaris, with varying amounts of Erica cinerea and Vaccinium vitis-idaea, related to 31.212.', '', 'Pas de description disponible'),
(16887, 'NR', 22, '31.2257', '', '', 'Highland prostrate Calluna heath', '', 6, 'Niveau 6', 9431, '/67/487/1217/3975/9431/16887', 'false', 'Wind-clipped, prostrate Calluna vulgaris or Calluna and lichen mats, of montane passes and lower summits of the Highlands and other isolated upland areas.', '', 'Pas de description disponible'),
(16888, 'NR', 22, '31.2258', '', '', 'Southern English Calluna-bristle bent heath', '', 6, 'Niveau 6', 9431, '/67/487/1217/3975/9431/16888', 'false', 'Calluna vulgaris-Agrostis curtisii heaths of Dorset and Hampshire.', '', 'Pas de description disponible'),
(16889, 'NR', 22, '31.2341', 'Landes armoricaines à Erica vagans', '', 'Armorican Erica vagans heaths', '', 6, 'Niveau 6', 9444, '/67/487/1217/3976/9444/16889', 'true', 'Heaths of Brittany, other than prostrate coastal ones, containing the uncommon and local Erica vagans.', '', 'Landes de Bretagne, autres que les formations côtières prostrées, comprenant Erica vagans espèce peu commune et locale.'),
(16890, 'NR', 22, '31.2342', '', '', 'Lizard Erica vagans heaths', '', 6, 'Niveau 6', 9444, '/67/487/1217/3976/9444/16890', 'false', 'Extensive Erica vagans-dominated communities of the Lizard peninsula of Cornwall.', '', 'Pas de description disponible'),
(16891, 'NR', 22, '31.2351', 'Landes anglo-armoricaines à Ulex gallii et Erica cinerea', '', 'Anglo-Armorican Ulex gallii-Erica cinerea heaths', '', 6, 'Niveau 6', 9445, '/67/487/1217/3976/9445/16891', 'true', 'Driest variants of the Atlantic western gorse Anglo-Armorican heaths.', '', 'Variantes les plus sèches des landes atlantiques anglo-armoricaines à Ajoncs.'),
(16892, 'NR', 22, '31.2352', 'Landes anglo-armoricaines à Ulex gallii et Erica ciliaris', '', 'Anglo-Armorican Ulex gallii-Erica ciliaris heaths', '', 6, 'Niveau 6', 9445, '/67/487/1217/3976/9445/16892', 'true', 'More mesophile western gorse heaths, marked by the replacement of Erica cinerea by E. ciliaris.', '', 'Landes plus mésophiles occidentales à Ajoncs, marquées par le remplacement d\'Erica cinerea par E. ciliaris.'),
(16893, 'NR', 22, '31.2353', 'Landes anglo-armoricaines à Ulex gallii et Calluna', '', 'Anglo-Armorican Ulex gallii-Calluna heaths', '', 6, 'Niveau 6', 9445, '/67/487/1217/3976/9445/16893', 'true', 'Calluna vulgaris facies of the Anglo-Armorican western gorse heaths.', '', 'Faciès à Calluna vulgaris, des landes anglo-armoricaines occidentales à Ajoncs.'),
(16894, 'NR', 22, '31.2354', '', '', 'Ulex gallii-bristle bent heaths', '', 6, 'Niveau 6', 9445, '/67/487/1217/3976/9445/16894', 'false', 'Southern English, short, often grassy heaths in which Ulex gallii is accompanied by Erica spp. and various grasses, in particular Agrostis curtisii.', '', 'Pas de description disponible'),
(16895, 'NR', 22, '31.2381', 'Landes anglo-normandes à Ulex minor et Erica cinerea', '', 'Anglo-Norman Ulex minor-Erica cinerea heaths', '', 6, 'Niveau 6', 9448, '/67/487/1217/3976/9448/16895', 'true', 'Driest variants of the dwarf gorse Anglo-Normand heaths.', '', 'Variantes les plus sèches des landes anglo-normandes à Ajoncs nains.'),
(16896, 'NR', 22, '31.2382', 'Landes anglo-normandes à Ulex minor et Erica ciliaris', '', 'Anglo-Norman Ulex minor-Erica ciliaris heaths', '', 6, 'Niveau 6', 9448, '/67/487/1217/3976/9448/16896', 'true', 'More mesophile dwarf gorse heaths, marked by the replacement of Erica cinerea by E. ciliaris.', '', 'Landes plus mésophiles à Ajoncs nains, marquées par le remplacement d\'Erica cinerea par E. ciliaris.'),
(16897, 'NR', 22, '31.2383', 'Landes anglo-normandes à Ulex minor et Calluna', '', 'Anglo-Norman Ulex minor-Calluna vulgaris heaths', '', 6, 'Niveau 6', 9448, '/67/487/1217/3976/9448/16897', 'true', 'Calluna vulgaris facies of the Anglo-Normand dwarf gorse heaths.', '', 'Faciès à Calluna vulgaris des landes anglo-normandes à Ajoncs nains.'),
(16898, 'NR', 22, '31.2391', 'Landes aquitano-ligériennes à Ulex minor et Erica cinerea', '', 'Aquitano-Ligerian Ulex minor-Erica cinerea heaths', '', 6, 'Niveau 6', 9449, '/67/487/1217/3976/9449/16898', 'true', 'Driest variants of the dwarf gorse Aquitano-Ligerian heaths.', '', 'Variantes les plus sèches des landes aquitano-ligériennes à Ajoncs nains.'),
(16899, 'NR', 22, '31.2392', 'Landes aquitano-ligériennes à Ulex minor et Erica ciliaris', '', 'Aquitano-Ligerian Ulex minor-Erica ciliaris heaths', '', 6, 'Niveau 6', 9449, '/67/487/1217/3976/9449/16899', 'true', 'More mesophile dwarf gorse heaths, marked by the replacement of Erica cinerea by E. ciliaris, accompanied or not by E. scoparia.', '', 'Landes plus mésophiles à Ajoncs nains, marquées par le remplacement d\'Erica cinerea par E. ciliaris, accompagné ou non par E. scoparia.'),
(16900, 'NR', 22, '31.2393', 'Landes aquitano-ligériennes à Ulex minor et Erica scoparia', '', 'Aquitano-Ligerian Ulex minor-Erica scoparia heaths', '', 6, 'Niveau 6', 9449, '/67/487/1217/3976/9449/16900', 'true', 'Mesophile dwarf gorse heaths with Erica scoparia and no E. ciliaris.', '', 'Landes mésophiles à Ajoncs nains avec Erica scoparia mais sans Erica ciliaris.'),
(16901, 'NR', 22, '31.2121', '', '', 'British southern bilberry heaths', '', 6, 'Niveau 6', 9451, '/67/487/1217/3982/9451/16901', 'false', 'Southern Vaccinium myrtillus dominated heaths characteristic of well drained sub-montane sites south of the Highlands', '', 'Pas de description disponible'),
(16902, 'NR', 22, '31.2122', '', '', 'British chionophilous bilberry heaths', '', 6, 'Niveau 6', 9451, '/67/487/1217/3982/9451/16902', 'false', 'Vaccinium myrtillus dominated heaths of areas with prolonged snow cover in eastern and central Highlands, Cheviots and Moffat-Tweedsmuir hills with Empetrum hermaphroditum and Vaccinium uliginosum.', '', 'Pas de description disponible'),
(16903, 'NR', 22, '31.2123', '', '', 'British species-rich bilberry heaths', '', 6, 'Niveau 6', 9451, '/67/487/1217/3982/9451/16903', 'false', 'Species-rich Vaccinium myrtillus heaths with Alchemilla alpina and abundant grasses, mainly of the central and southwest Highlands, with outliers in northern English and Welsh uplands.', '', 'Pas de description disponible'),
(16904, 'NR', 22, '31.2124', '', '', 'British mat-grass-bilberry heaths', '', 6, 'Niveau 6', 9451, '/67/487/1217/3982/9451/16904', 'false', 'Vaccinium myrtillus-Nardus stricta heaths of northern England and Wales.', '', 'Pas de description disponible'),
(16905, 'NR', 22, '31.2125', '', '', 'British mountain crowberry-bilberry heaths', '', 6, 'Niveau 6', 9451, '/67/487/1217/3982/9451/16905', 'false', 'Vaccinium myrtillus heaths with abundant Empetrum hermaphroditum, Carex bigelowii, bryophytes and lichens mostly associated with large shallow snow beds in the central and western Highlands, with related outliers in England and Wales.', '', 'Pas de description disponible'),
(16906, 'NR', 22, '31.2126', '', '', 'British lichen-bilberry heaths', '', 6, 'Niveau 6', 9451, '/67/487/1217/3982/9451/16906', 'false', 'Vaccinium myrtillus-Empetrum heaths rich in Cetraria and Cladonia lichens, but poor in bryophytes, mostly of the eastern and central Highlands.', '', 'Pas de description disponible'),
(16907, 'NR', 22, '31.2127', '', '', 'British cowberry heaths', '', 6, 'Niveau 6', 9451, '/67/487/1217/3982/9451/16907', 'false', 'Vaccinium vitis-idaea heaths, generally species-poor, mainly of the Peak District and eastern Wales.', '', 'Pas de description disponible'),
(16908, 'NR', 22, '31.2128', '', '', 'British ling-liverwort heaths', '', 6, 'Niveau 6', 9451, '/67/487/1217/3982/9451/16908', 'false', 'Tall Calluna vulgaris-Vaccinium heaths with a ground layer dominated by leafy liverworts, characteristic of the northwest Highlands, with fragmentary stands in more southern western uplands.', '', 'Pas de description disponible'),
(16909, 'NR', 22, '31.7341', '', '', 'Siliceous Nevadan dwarf cushion-heaths', '', 6, 'Niveau 6', 9465, '/67/487/1220/3991/9465/16909', 'false', 'Formations of base-rich siliceous soils at 2 600-2 900 m with Sideritis glacialis, Arenaria pungens, Astragalus sempervirens ssp. nevadensis.', 'Arenario-Sideritetum glacialis', 'Pas de description disponible'),
(16910, 'NR', 22, '31.7342', '', '', 'Calcareous Nevadan dwarf cushion-heaths', '', 6, 'Niveau 6', 9465, '/67/487/1220/3991/9465/16910', 'false', 'Formations of white-tomentose dwarf cushions developed on calcareous soils (Trevenque, Dornajo, Dilar) with Andryala agardhii, Erodium boissieri, Scabiosa pulsatilloides, Santolina elegans, Globularia spinosa, Pterocephalus spathulatus, Helianthemum pannosum.', 'Andryalion agardhii: Convolvulo-Andryaletum agardhii = Andryalo-Convolvuletum p.', 'Pas de description disponible'),
(16911, 'NR', 22, '31.6211', 'Brousses à Saules bas des Alpes', '', 'Alpine small willow brush', '', 6, 'Niveau 6', 9468, '/67/487/1219/3990/9468/16911', 'true', 'Brushes of Salix hastata, S. glaucocinerea, S. helvetica or other small willows, similar in appearance to, and often interspersed with, green alder brush', '', 'Brousses à Salix hastata, S. glaucosericea, S. helvetica et autres Saules bas, d\'apparence similaire et souvent parsemées de buissons d\'Aulnes verts.'),
(16912, 'NR', 22, '31.6212', 'Brousses alpiennes à Saules prostrés', '', 'Alpine prostrate willow brush', '', 6, 'Niveau 6', 9468, '/67/487/1219/3990/9468/16912', 'true', 'Lower formations of prostrate or near-prostrate Salix alpina, S. breviserrata, S. waldsteiniana, S. caesia, S. foetida, S. glabra; formations of very small prostrate willows characteristic of snow patches (36.1) are excluded.', '', 'Formations plus basses d\'arbustes prostrés ou à peu près prostrés avec Salix alpina, S. breviserrata, S. caesia, S. foetida ; formations de Saules nains caractéristiques des combes à neige (36.1) exclues.'),
(16913, 'NR', 22, '31.6213', 'Brousses alpiennes de Saules élevés', '', 'Alpine tall willow brush', '', 6, 'Niveau 6', 9468, '/67/487/1219/3990/9468/16913', 'true', 'Taller Salix pentandra, S. appendiculata thickets.', '', 'Fourrés hauts à Salix pentandra, S. appendiculata.'),
(16914, 'NR', 22, '31.6214', 'Broussailles de Saules pyrénéens', '', 'Pyrenean willow brush', '', 6, 'Niveau 6', 9468, '/67/487/1219/3990/9468/16914', 'true', 'Salix pyrenaica formations of the Pyrenees, often with Dryas octopetala', '', 'Formations des Pyrénées à Salix pyrenaica, souvent accompagné de Dryas octopetala.'),
(16915, 'NR', 22, '31.2451', '', '', 'Western Cordilleran Erica aragonensis heaths', '', 6, 'Niveau 6', 9473, '/67/487/1217/3977/9473/16915', 'false', 'E. aragonensis formations of the western Cordillera Central (Serra da Estrela, Sierra de Gata, Sierra de Pena de Francia) with E. umbellata, Halimium alyssoides and sometimes Juniperus nana.', '', 'Pas de description disponible'),
(16916, 'NR', 22, '31.2452', '', '', 'Ayllon Erica aragonensis heaths', '', 6, 'Niveau 6', 9473, '/67/487/1217/3977/9473/16916', 'false', 'E. aragonensis formations of the Sierra de Ayllon with H. viscosum, H. ocymoides, Genista pilosa and, sometimes Arctostaphylos uva-ursi.', '', 'Pas de description disponible'),
(16917, 'NR', 22, '31.2453', '', '', 'Villuercan Erica aragonensis heaths', '', 6, 'Niveau 6', 9473, '/67/487/1217/3977/9473/16917', 'false', 'Isolated summital Erica aragonensis heaths of the Montes de Toledo (Villuercas).', '', 'Pas de description disponible'),
(16918, 'NR', 22, '31.2461', '', '', 'Sorian summital heaths', '', 6, 'Niveau 6', 9474, '/67/487/1217/3977/9474/16918', 'false', 'Calluna heaths of high peaks, with Viola montcaunica.', '', 'Pas de description disponible'),
(16919, 'NR', 22, '31.2462', '', '', 'Sorian Erica aragonensis heaths', '', 6, 'Niveau 6', 9474, '/67/487/1217/3977/9474/16919', 'false', 'Beech-zone E. aragonensis heaths with Arctostaphylos uva-ursi.', '', 'Pas de description disponible');
