(16924, 'NR', 22, '31.7462', '', '', 'Southern Mesetan Astragalus hedgehog-heaths', '', 6, 'Niveau 6', 9489, '/67/487/1220/3992/9489/16924', 'false', 'Meso- and supra-Mediterranean hedgehog-heaths with Astragalus clusii (A. tumidus) of the southern Meseta, from La Mancha to the Baetic hills of eastern Andalusia (Orce, Sagra, Baza, Maria), with Paronychia aretioides, Genista pumila ssp. mugronensis, G. scorpius.', 'Paronychio-Astragaletum tumidi', 'Pas de description disponible'),
(16925, 'NR', 22, '31.7471', '', '', 'Mallorcan hedgehog-heaths', '', 6, 'Niveau 6', 9490, '/67/487/1220/3992/9490/16925', 'false', 'Formations of high elevations of Mallorca, dominated by Teucrium subspinosum.', '', 'Pas de description disponible'),
(16926, 'NR', 22, '31.7472', '', '', 'Menorcan hedgehog-heaths', '', 6, 'Niveau 6', 9490, '/67/487/1220/3992/9490/16926', 'false', 'Formations of Menorca with Cistus creticus and Teucrium subspinosum var. spinescens.', '', 'Pas de description disponible'),
