(16930, 'NR', 22, '31.7921', '', '', 'Olympus Astragalus angustifolius hedgehog-heaths', '', 6, 'Niveau 6', 9505, '/67/487/1220/4015/9505/16930', 'false', 'Formations of the Olympus system dominated by A. angustifolius.', '', 'Pas de description disponible'),
