(17264, 'NR', 22, '45.3413', '', '', 'Northern supra-Mediterranean formations', '', 6, 'Niveau 6', 10138, '/68/517/1401/4499/10138/17264', 'false', 'Q. rotundifolia woods of superficial calcareous soils of crests, spurs and upper adret slopes of the upper Ebro basin and southern slopes of the Cordillera Cantabrica, locally entering also Euro-Siberian Cantabrian areas, with Amelanchier ovalis, Rosa agrestis, Lonicera etrusca, Spiraea hypericifolia ssp. obovata, Juniperus communis, J. oxycedrus, J. phoenicea.', 'Spiraeo obovatae-Quercetum rotundifoliae', 'Pas de description disponible'),
(17265, 'NR', 22, '45.3414', '', '', 'Oro-Cantabrian formations', '', 6, 'Niveau 6', 10138, '/68/517/1401/4499/10138/17265', 'false', 'Relict, xerophile collinar-montane Q. rotundifolia and Q. rotundifolia x Q. ilex forests developed on mostly calcareous, well-drained shallow soils of steep slopes and gorges in the Cordillera Cantabrica and a very few areas of Galicia, rich in Cephalanthera and Epipactis orchids.', 'Cephalanthero longifoliae-Quercetum rotundifoliae', 'Pas de description disponible'),
(16972, 'NR', 22, '31.8431', '', '', 'White-flowered broom fields', '', 6, 'Niveau 6', 9529, '/67/487/1223/4024/9529/16972', 'false', 'Formations rich in white-flowered Cytisus multiflorus of the western Meseta, the (mostly western) Cordillera Central, the sierras of southern Galicia and Leon and the western Cantabrian mountains, in which C. multiflorus is either the only tall broom or is an important component of broom fields also containing yellow-flowered Genista florida ssp. polygaliphylla, G. florida ssp. florida, G. cinerea ssp. cinerascens, Cytisus scoparius and others.', 'Genistion polygaliphyllae: Cytisenion multiflorae, Genistenion polygaliphyllae p.; Genistion floridae p.', 'Pas de description disponible'),
(16973, 'NR', 22, '31.8432', '', '', 'North-western Iberian Genista florida fields', '', 6, 'Niveau 6', 9529, '/67/487/1223/4024/9529/16973', 'false', 'Formations rich in Genista florida ssp. polygaliphylla of the oro-Cantabrian region, the sierras of southern Galicia and Leon, the Serra da Estrela, the northern Iberian range, with Cytisus cantabricus, C. scoparius, C. striatus, Genista obtusiramea, Adenocarpus complicatus.', 'Genistion polygaliphyllae: Genistenion polygaliphyllae, Cytisenion striati p.', 'Pas de description disponible'),
(16974, 'NR', 22, '31.8433', '', '', 'North-western Iberian Cytisus fields', '', 6, 'Niveau 6', 9529, '/67/487/1223/4024/9529/16974', 'false', 'Formations rich in Cytisus striatus or C. ingramii of the western Cordillera Central and of Galician hills and plateaux, with Genista florida ssp polygaliphylla, Cytisus scoparius, C. multiflorus or Ulex europaeus.', 'Genistion polygaliphyllae: Cytisenion striati', 'Pas de description disponible'),
(16975, 'NR', 22, '31.8434', '', '', 'Central Iberian Genista florida fields', '', 6, 'Niveau 6', 9529, '/67/487/1223/4024/9529/16975', 'false', 'Formations rich in Genista florida ssp. florida of the Cordillera Central and the Southern Iberian Range with Cytisus scoparius, C. multiflorus, C. striatus, Genista cinerea ssp. cinerascens, Adenocarpus hispanicus.', 'Genistion floridae: Genistenion floridae', 'Pas de description disponible'),
(16976, 'NR', 22, '31.8435', '', '', 'Upper Cordilleran Genista cinerea fields', '', 6, 'Niveau 6', 9529, '/67/487/1223/4024/9529/16976', 'false', 'Formations dominated by Genista cinerea ssp. cinerascens of higher elevations of the Cordillera Central.', '', 'Pas de description disponible'),
(16977, 'NR', 22, '31.8436', '', '', 'Central Iberian Cytisus fields', '', 6, 'Niveau 6', 9529, '/67/487/1223/4024/9529/16977', 'false', 'Formations rich in Cytisus striatus or C. scoparius of the Cordillera Central and the Montes de Toledo with Genista florida ssp. florida or Chamaespartium tridentatum.', 'Genistion floridae p.', 'Pas de description disponible'),
(16978, 'NR', 22, '31.8437', '', '', 'Andalusian broom fields', '', 6, 'Niveau 6', 9529, '/67/487/1223/4024/9529/16978', 'false', 'Formations of Cytisus reverchonii, C. grandiflorus, Adenocarpus decorticans of the supra-Mediterranean zone of Andalucian mountains.', 'Genistion floridae: Adenocarpenion decorticantis', 'Pas de description disponible'),
(16979, 'NR', 22, '31.8441', '', '', 'Peninsular Italian broom fields', '', 6, 'Niveau 6', 9530, '/67/487/1223/4024/9530/16979', 'false', 'Supra-Mediterranean and montane peninsular formations with Cytisus scoparius, C. sessilifolius or Adenocarpus complicatus.', '', 'Pas de description disponible'),
(16980, 'NR', 22, '31.8442', '', '', 'Insular Tyrrhenian broom fields', '', 6, 'Niveau 6', 9530, '/67/487/1223/4024/9530/16980', 'false', 'Supra-Mediterranean and montane formations of Corsica, Sardinia and Sicily with Cytisus scoparius.', '', 'Pas de description disponible'),
(16981, 'NR', 22, '31.8451', '', '', 'Etna Genista aetnensis stands', '', 6, 'Niveau 6', 9531, '/67/487/1223/4024/9531/16981', 'false', 'Formations of Genista aetnensis colonizing the lava fields of the eastern flank of Mount Etna.', '', 'Pas de description disponible'),
(16982, 'NR', 22, '31.8452', '', '', 'Sardinian Genista aetnensis stands', '', 6, 'Niveau 6', 9531, '/67/487/1223/4024/9531/16982', 'false', 'Very rare and localized Genista aetnensis formations of Sardinia (east and Iglesiente).', '', 'Pas de description disponible'),
(16983, 'NR', 22, '31.8711', 'Clairières à Epilobes et Digitales', '', 'Willowherb and foxglove clearings', '', 6, 'Niveau 6', 9536, '/67/487/1223/4029/9536/16983', 'true', 'Communities of acid soils with raw humus, composed of Epilobium angustifolium, Digitalis purpurea, D. grandiflora, Senecio sylvaticus, Calamagrostis epigeios, Carex pilulifera.', 'Epilobion angustifolii', 'Communautés des sols acides sur sols à humus brut, composées d\'Epilobium angustifolium, Digitalis purpurea, D. grandiflora, Senecio sylvaticus, Calamagrostis epigeios, Carex pilulifera.'),
(16984, 'NR', 22, '31.8111', 'Fruticées subatlantiques Prunus spinosa et Rubus fruticosus', '', 'Sub-Atlantic blackthorn-bramble scrub', '', 6, 'Niveau 6', 9537, '/67/487/1223/4030/9537/16984', 'true', 'Prunus spinosa, Carpinus betulus, Crataegus spp., Rosa spp., Rubus spp. communities of the European mainland, under sub-Atlantic or sub-continental climates.', '', 'Communautés du continent européen à Prunus spinosa, Carpinus betulus, Crataegus spp., Rubus spp., Rosa spp., soumises à des climats subatlantiques ou subcontinentaux.'),
(16985, 'NR', 22, '31.8112', 'Fruticées atlantiques Prunus spinosa et Rubus fruticosus', '', 'Atlantic blackthorn-bramble scrub', '', 6, 'Niveau 6', 9537, '/67/487/1223/4030/9537/16985', 'true', 'Prunus spinosa, Rubus spp. communities of the British Isles and other areas of strongly Atlantic climates. Ulex europea, Hedera helix, Lonicera periclymenum and Pteridium aquilinum are often present.', '', 'Communautés à Prunus spinosa, Rubus spp. des régions à climat fortement atlantique. Ulex europaeus, Hedera helix, Lonicera periclymenum, Pteridium aquilinum sont souvent présents.'),
(16986, 'NR', 22, '31.8121', 'Fruticées atlantiques et médio-européennes à Prunelliers et Troènes', '', 'Atlantic and medio-European blackthorn-privet scrub', '', 6, 'Niveau 6', 9538, '/67/487/1223/4030/9538/16986', 'true', 'Communities occupying the domaine of the Carpinion and northern irradiations of Quercion pubescenti-petraeae communities.', '', 'Communautés occupant le domaine du Carpinion et des irradiations nordiques des communautés du Quercion pubescenti-petraeae.'),
(16987, 'NR', 22, '31.8122', 'Fruticées subméditerranéennes de Prunelliers et de Troènes', '', 'Sub-Mediterranean blackthorn-privet scrub', '', 6, 'Niveau 6', 9538, '/67/487/1223/4030/9538/16987', 'true', 'Communities with Prunus mahaleb, Acer monspessulanum and other xero-thermophile species, occupying the southern part of the west European range of the unit as well as a few highly xero-thermic central European sites.', 'Prunetum mahaleb, i.a.', 'Communautés à Prunus mahaleb, Acer monspessulanum et autres espèces xéro-thermophiles, occupant la partie méridionale de l\'espace ouest-européen ou se rapportant à un très petit nombre de sites éminemment xérothermiques d\'Europe centrale.'),
(16988, 'NR', 22, '31.8123', 'Fruticées de stations rocailleuses à Cotoneaster et Amélanchier', '', 'Rock pear scrub', '', 6, 'Niveau 6', 9538, '/67/487/1223/4030/9538/16988', 'true', 'Possibly primary scrub formations with Cotoneaster integerrimus, C. tomentosus and Amelanchier ovalis developed on very shallow soils between Xerobromion grasslands and open xerothermic oak woods.', 'Berberidion: Cotoneastro-Amelanchieretum', 'Formations broussailleuses pouvant être primaires à Cotoneaster integerrimus, C. nebrodensis et Amelanchier ovalis développées sur des sols très peu profonds entre les pelouses du Xerobromion et les forêts ouvertes xérothermiques de Chênes.'),
(16989, 'NR', 22, '31.8124', 'Fruticées d\'Argousiers', '', 'Sea buckthorn scrub', '', 6, 'Niveau 6', 9538, '/67/487/1223/4030/9538/16989', 'true', 'Formations characterized by the physiognomically distinctive presence of Hippophae rhamnoides, ssp. fluviatilis or ssp. carpatica.', 'Berberidion: Salici-Hippophaetum rhamnoidis', 'Formations caractérisées par la présence physionomique différentielle d\'Hippophae rhamnoides subsp. fluviatilis.'),
(16990, 'NR', 22, '31.8125', 'Fruticées intra-alpines à Epine vinette', '', 'Inner Alpine barberry scrub', '', 6, 'Niveau 6', 9538, '/67/487/1223/4030/9538/16990', 'true', 'Thorny heaths of inner Alpine valleys with Berberis vulgaris.', '', 'Landes épineuses constituées par Berberis vulgaris des vallées intra-alpines.'),
(16991, 'NR', 22, '31.8126', '', '', 'Iberian barberry scrub', '', 6, 'Niveau 6', 9538, '/67/487/1223/4030/9538/16991', 'false', 'Northwestern Iberian montane communities with Berberis vulgaris ssp. cantabrica, Prunus spinosa, Corylus avellana, Sorbus aria, Taxus baccata, Crataegus monogyna, Ribes alpinum, R. petraeum, Rhamnus alpinus.', 'Berberidion: Pruno spinosae-Berberidetum cantabricae', 'Pas de description disponible'),
(16992, 'NR', 22, '32.1322', 'Matorral arborescent à Juniperus lycia', '', 'Juniperus lycia arborescent matorral', '', 6, 'Niveau 6', 9560, '/67/488/1224/4039/9560/16992', 'true', 'Juniperus phoenicea ssp. lycia-dominated formations of coastal sands, alluvions and abrupt shores. Many are dunal and can be coded under 16.27.', '', 'Formations dominées par Juniperus phoenicea subsp. lycia de sables côtiers, des alluvions et des rivages abrupts. Nombre de ces formations sont dunaires et peuvent être codées sous 16.27.'),
(16993, 'NR', 22, '32.1331', '', '', 'Juniperus excelsa arborescent matorral', '', 6, 'Niveau 6', 9539, '/67/488/1224/4039/9539/16993', 'false', 'Formations derived from 42.A3.', '', 'Pas de description disponible'),
(16994, 'NR', 22, '32.1332', '', '', 'Juniperus foetidissima arborescent matorral', '', 6, 'Niveau 6', 9539, '/67/488/1224/4039/9539/16994', 'false', 'Formations derived from 42.A4.', '', 'Pas de description disponible'),
(16995, 'NR', 22, '32.1141', '', '', 'Greek Q. ilex arborescent matorral', '', 6, 'Niveau 6', 9551, '/67/488/1224/4037/9551/16995', 'false', 'Formations derived from 45.31C.', '', 'Pas de description disponible'),
(16996, 'NR', 22, '32.1142', '', '', 'Cretan Q. ilex arborescent matorral', '', 6, 'Niveau 6', 9551, '/67/488/1224/4037/9551/16996', 'false', 'Formations derived from 45.31D.', '', 'Pas de description disponible'),
(17266, 'NR', 22, '45.3421', '', '', 'Luso-Extremaduran formations', '', 6, 'Niveau 6', 10153, '/68/517/1401/4499/10153/17266', 'false', 'Meso-Mediterranean Q. rotundifolia formations widespread on the plains and plateaux of Extremadura, Alentejo and neighbouring regions, and in the Sierra Morena and the Montes de Toledo. It is almost entirely transformed into dehesa.', 'Pyro bourgaeneae-Quercetum rotundifoliae', 'Pas de description disponible'),
(17267, 'NR', 22, '45.3422', '', '', 'Castilian formations', '', 6, 'Niveau 6', 10153, '/68/517/1401/4499/10153/17267', 'false', 'More northern, upper meso-Mediterranean and lower supra-Mediterranean Q. rotundifolia formations, poorer in Mediterranean species, of the western plateaux of Old Castile and adjacent southern Leon and Galicia; Genista hystrix is a physiognomically striking element. Also essentially eliminated as forest formations, these woodlands constitute, together with the preceding unit, the basis for the western Iberian dehesa, one of the most characteristic landscapes of the peninsula and an importand habitat of larger fauna.', 'Genisto hystricis-Quercetum rotundifoliae', 'Pas de description disponible'),
(17268, 'NR', 22, '45.3423', '', '', 'Cordilleran formations', '', 6, 'Niveau 6', 10153, '/68/517/1401/4499/10153/17268', 'false', 'Q. rotundifolia formations of the Cordillera Central, characteristic of cool meso-Mediterranean and sunny supra-Mediterranean slopes of the sierras de Guadarrama, de Gredos, de Bejar, de Ayllon and neighbouring areas; they extend east to siliceous enclaves of the Iberian Range. Adapted to a more continental climate than the two previous units, they are poorer in shrubs and lianas. They often constitute low, open woodland.', 'Junipero oxycedri-Quercetum rotundifoliae', 'Pas de description disponible'),
(17269, 'NR', 22, '45.3424', '', '', 'Villuercan formations', '', 6, 'Niveau 6', 10153, '/68/517/1401/4499/10153/17269', 'false', 'Summital Q. rotundifolia elfin forests of the high elevations of the Montes de Toledo.', '', 'Pas de description disponible'),
(17270, 'NR', 22, '45.3431', '', '', 'Meso-Mediterranean basophilous formations', '', 6, 'Niveau 6', 10154, '/68/517/1401/4499/10154/17270', 'false', 'Woodland dominated by Q. rotundifolia with Juniperus oxycedrus, Daphne gnidium, Ruscus aculeatus, Asparagus acutifolius, Crataegus monogyna, Lonicera implexa, Rubia peregrina, Paeonia coriacea, P. broteroi, Endymion hispanicus that represents the potential, mature vegetation of a great part of Andalusia, in the Guadalquivir basin, coastal areas and Baetic ranges, on base-rich and often silt-laden soils, under meso-Mediterranean conditions. They have been largely replaced by cultivation and, where they subsist, are often very degraded.', 'Paeonio coriaceae-Quercetum rotundifoliae', 'Pas de description disponible'),
(17271, 'NR', 22, '42.6361', '', '', 'Supra-Mediterranean Baetic Salzmann\'s pine forests', '', 6, 'Niveau 6', 10144, '/68/491/1369/4500/10144/17271', 'false', 'Forests of Pinus salzmannii accompanied by a cortège similar to that of thermophilous oak forests, including Quercus rotundifolia, Juniperus oxycedrus, Lavandula latifolia, Erinacea anthyllis, Rosmarinus officinalis, Genista scorpius, Crataegus monogyna, Berberis hispanica, Rosa pouzinii, Daphne laureola, Acer granatense, Paeonia officinalis, of the sierras de Cazorla, Segura and Alcaraz, the erra de Baza, the Sierra de Filabres and the calcareous periphery of the Sierra Nevada.', 'Daphno latifoliae-Aceretum granatensis p., Salvio-Lavanduletum lanatae p.', 'Pas de description disponible'),
(17272, 'NR', 22, '42.6362', '', '', 'Oro-Mediterranean Baetic Salzmann\'s pine forests', '', 6, 'Niveau 6', 10144, '/68/491/1369/4500/10144/17272', 'false', 'Oro-Mediterranean woods of Pinus salzmannii, more open than those of 42.6361 and occupying very limited areas in the sierras de Cazorla, Segura and Alcaraz, with a shrub layer of Juniperus sabina and J. nana, accompanied by Ononis aragonensis, Genista lobelii ssp. longipes, Daphne oleoides and Prunus prostrata.', 'Daphno oleoidis-Pinetum sylvestris pinetosum salzmannii', 'Pas de description disponible'),
(17273, 'NR', 22, '44.1271', '', '', 'Andalusian willow scrub', '', 6, 'Niveau 6', 10160, '/68/515/1378/4501/10160/17273', 'false', 'Willow scrub of southwestern Iberian stream courses, fringing, in particular, humid Quercus canariensis forests in conjunction with rhododendron-alder galleries (44.52), dominated by Salix pedicellata and Salix salvifolia ssp. australis.', 'Equiseto telmateiae-Salicetum pedicellatae (Salicetum pedicellatae)', 'Pas de description disponible'),
(17274, 'NR', 22, '44.1272', '', '', 'Sardinian pedicellated willow scrub', '', 6, 'Niveau 6', 10160, '/68/515/1378/4501/10160/17274', 'false', '', '', 'Pas de description disponible'),
(17275, 'NR', 22, '44.1273', '', '', 'Sicilian pedicellated willow scrub', '', 6, 'Niveau 6', 10160, '/68/515/1378/4501/10160/17275', 'false', '', '', 'Pas de description disponible'),
(17276, 'NR', 22, '44.1274', '', '', 'Calabrian pedicellated willow scrub', '', 6, 'Niveau 6', 10160, '/68/515/1378/4501/10160/17276', 'false', '', '', 'Pas de description disponible'),
(17277, 'NR', 22, '45.3432', '', '', 'Supra-Mediterranean basophilous formations', '', 6, 'Niveau 6', 10154, '/68/517/1401/4499/10154/17277', 'false', 'Woodland dominated by Q. rotundifolia, with Q. faginea, Acer monspessulanum, Sorbus aria, S. aucuparia, Taxus baccata, Berberis hispanica, Crataegus monogyna, Lonicera arborea, Daphne laureola, Rosa spp., Polygala boissieri, Helleborus foetidus and many orchids, of the supra-Mediterranean level (1400-1900 m) of calcareous Baetic ranges.', 'Berberido hispanicae-Quercetum rotundifoliae', 'Pas de description disponible'),
(17278, 'NR', 22, '45.3433', '', '', 'Meso- and supra-Mediterranean silicicolous formations', '', 6, 'Niveau 6', 10154, '/68/517/1401/4499/10154/17278', 'false', 'Q. rotundifolia-dominated woodland characteristic of the meso- and supra-Mediterranean levels of the Sierra Nevada and of a few siliceous mountain ranges of the arid Iberian South-east. Totally destroyed in the Sierra Nevada, this community is still represented by well-preserved examples in the sierras de Carrascoy and Alhamilla, and to a lesser extent, in the Sierra de Cabrera.', 'Adenocarpo-Quercetum rotundifoliae', 'Pas de description disponible'),
(17279, 'NR', 22, '45.3441', '', '', 'Basophilous formations', '', 6, 'Niveau 6', 10163, '/68/517/1401/4499/10163/17279', 'false', 'Q. rotundifolia formations of thermo-Mediterranean calcareous slopes of the Quadalquivir basin and the coastal foothills of Baetic and arid southeastern ranges, with Olea europaea ssp. sylvestris, Chamaerops humilis, Pistacia lentiscus, Smilax aspera, Asparagus albus, Rhamnus oleoides, Quercus coccifera, Clematis cirrhosa, Aristolochia baetica, Bupleurum gibraltarium and, locally, Maytenus senegalensis or Buxus balearica. They have almost disappeared in forest form except in a few ranges of the arid Iberian South-east.', 'Oleo sylvestris-Quercetum rotundifoliae', 'Pas de description disponible'),
(17280, 'NR', 22, '45.3442', '', '', 'Silicicolous formations', '', 6, 'Niveau 6', 10163, '/68/517/1401/4499/10163/17280', 'false', 'Formations of Q. rotundifolia with Myrtus communis, Pulicaria odora, Pistacia lentiscus, Phillyrea angustifolia and Arbutus unedo occupying the siliceous soil of the thermo-Mediterranean levels of eastern Andalusia between the Sea of Alboran and the coastal Tejeda, Almijara, Alpujarra and Gador ranges, a few granitic outcroppings of the Sierra Morena and limited enclaves of the Badajos region. They have almost entirely disappeared.', 'Myrto communis-Quercetum rotundifoliae', 'Pas de description disponible'),
(17281, 'NR', 22, '44.1411', 'Galeries ibériques de grands Saules', '', 'Iberian tall willow galleries', '', 6, 'Niveau 6', 10171, '/68/515/1378/4505/10171/17281', 'false', 'Arborescent willow galleries dominated by Salix neotricha accompanied by Salix alba, S. fragilis, Populus nigra and sometimes P. alba, Fraxinus angustifolia, Frangula alnus, Sambucus nigra, Ulmus spp., forming as the ligneous vegetation closest to the water along the middle and lower course of large rivers of little seasonal amplitude in the meso- and supra-Mediterranean foothills of the Cantabrian Cordillera, the Iberian Range and neighbouring regions.', 'Populo nigrae-Salicetum neotrichae', 'Galeries de Saules arborescents dominées par Salix neotricha accompagné par Salix alba, S. fragilis, Populus nigra et quelquefois Populus alba, Fraxinus angustifolia, Frangula alnus, Sambucus nigra, Ulmus spp., formant aussi la végétation ligneuse la plus proche de l\'eau le long du cours moyen ou inférieur des grandes rivières, soumises à des amplitudes saisonnières faibles dans les contreforts méso- et supra-méditerranéens de la cordillère cantabrique, du secteur ibérique et des régions avoisinantes.'),
(16997, 'NR', 22, '32.1143', '', '', 'Greek Q. coccifera arborescent matorral', '', 6, 'Niveau 6', 9551, '/67/488/1224/4037/9551/16997', 'false', 'Formations derived from 45.41.', '', 'Pas de description disponible'),
(16998, 'NR', 22, '32.1161', '', '', 'Q. ilex, Q. rotundifolia low woods', '', 6, 'Niveau 6', 9553, '/67/488/1224/4037/9553/16998', 'false', 'Q. ilex, Q. rotundifolia formations. Detailed habitats can be coded by placing at the fifth, sixth and seventh decimal places of 32.1161 the second, third and fourth digits after the decimal point of 45.3 that characterize the corresponding evergreen oak forest.', '', 'Pas de description disponible'),
(16999, 'NR', 22, '32.1162', '', '', 'Q. coccifera low woods', '', 6, 'Niveau 6', 9553, '/67/488/1224/4037/9553/16999', 'false', 'Q. coccifera (Q. calliprinos) formations. Detailed habitats can be coded by placing at the fifth decimal place of 32.1162 the second digit after the decimal point of 45.4 that characterizes the corresponding kermes oak forest.', '', 'Pas de description disponible'),
(17000, 'NR', 22, '32.1311', 'Matorral arborescent interne à Juniperus oxycedrus', '', 'Inland Juniperus oxycedrus arborescent matorral', '', 6, 'Niveau 6', 9559, '/67/488/1224/4039/9559/17000', 'true', 'Juniperus oxycedrus ssp. oxycedrus-dominated formations of dry, rocky slopes and deforested areas.', '', 'Formations dominées par Juniperus oxycedrus subsp. oxycedrus des versants secs et rocheux et des zones déboisées.'),
(17001, 'NR', 22, '32.1312', 'Matorral arborescent à Juniperus macrocarpa', '', 'Juniperus macrocarpa arborescent matorral', '', 6, 'Niveau 6', 9559, '/67/488/1224/4039/9559/17001', 'true', 'Juniperus oxycedrus ssp. macrocarpa formations of coastal sands and abrupt shores; many are dunal and can be coded under 16.27.', '', 'Formations à Juniperus oxycedrus subsp. macrocarpa des sables côtiers et des rivages abrupts ; beaucoup sont des formations dunaires et peuvent être codés sous 16.27.'),
(17002, 'NR', 22, '32.1313', '', '', 'Juniperus transtagana arborescent matorral', '', 6, 'Niveau 6', 9559, '/67/488/1224/4039/9559/17002', 'false', 'Juniperus oxycedrus ssp. transtagana formations of maritime sands of southwestern Portugal; they should usually be listed under 16.27.', '', 'Pas de description disponible');
INSERT INTO `corine` (`CD_HAB`, `FG_VALIDITE`, `CD_TYPO`, `LB_CODE`, `LB_HAB_FR`, `LB_HAB_FR_COMPLET`, `LB_HAB_EN`, `LB_AUTEUR`, `NIVEAU`, `LB_NIVEAU`, `CD_HAB_SUP`, `PATH_CD_HAB`, `FRANCE`, `LB_DESCRIPTION`, `CRSP_PHYTO_CB91`, `DESCRIPTIF_CB97_FR`) VALUES
(17003, 'NR', 22, '32.1321', 'Matorral arborescent, intérieur, à Juniperus phoenicea', '', 'Inland Juniperus phoenicea arborescent matorral', '', 6, 'Niveau 6', 9560, '/67/488/1224/4039/9560/17003', 'true', 'Juniperus phoenicea ssp. phoenicea-dominated formations occupying steep rocky slopes of the meso-Mediterranean and, locally, thermo-Mediterranean or lower supra-Mediterranean zones, particularly developed on crests and spurs of the mountains bordering the Ebro depression, in calcareous mountains of Valencia, in the southwestern Alps and Provence, in Sardinia, in Sicily, in Puglia and in southern Greece. Remarkable, generally uncommon, stands of old, tall trees may take on an almost woodland appearance.', '', 'Formations dominées par Juniperus phoenicea subsp. phoenicea occupant des pentes rocheuses abruptes des étages méso-méditerranéen et, localement, thermo-méditerranéen ou supra-méditerranéen, particulièrement développées sur les crêtes et éperons des Alpes sud-occidentales et de Provence... Des parcelles remarquables, généralement peu communes, constituées d\'arbres grands et vieux peuvent pratiquement prendre l\'apparence d\'un bois.'),
(17004, 'NR', 22, '32.2121', 'Landes-garrigues occidentales à Erica multiflora', '', 'Western Erica multiflora heath-garrigues', '', 6, 'Niveau 6', 9571, '/67/488/1225/4052/9571/17004', 'true', 'Usually calciphile Erica multiflora formations of the Iberian and Italian peninsulas and the large western Mediterranean islands.', '', 'Formations à Erica multiflora habituellement calciphiles.'),
(17005, 'NR', 22, '32.2122', '', '', 'Western Erica manipuliflora heath-garrigues', '', 6, 'Niveau 6', 9571, '/67/488/1225/4052/9571/17005', 'false', 'Rare, calciphile Erica manipuliflora formations of Puglia and Sicily.', '', 'Pas de description disponible'),
(17006, 'NR', 22, '32.2123', '', '', 'Eastern Erica manipuliflora heath-garrigues', '', 6, 'Niveau 6', 9571, '/67/488/1225/4052/9571/17006', 'false', 'Erica manipuliflora formations of Greece and its archipelagoes.', '', 'Pas de description disponible'),
(17007, 'NR', 22, '32.2191', '', '', 'Iberian thermo-Mediterranean kermes oak brush', '', 6, 'Niveau 6', 9578, '/67/488/1225/4052/9578/17007', 'false', 'Formations of Quercus coccifera of southern Portugal, southern and eastern Spain and the Ebro basin.', 'Melico-Cocciferetum, Rhamno lycioidis-Quercetum cocciferae, Bupleuro gibraltarii-Pistacietum lentisci, Querco cocciferae-Pistacietum lentisci, Asparago albi-Rhamnetum oleoides, Chamaeropo-Rhamnetum lycioides, Rhamno lycioidis-Quercetum cocciferae', 'Pas de description disponible'),
(17008, 'NR', 22, '32.2192', 'Fruticées thermo-méditerranéennes tyrrhéniennes à chêne kermès', '', 'Tyrrhenian thermo-Mediterranean kermes oak brush', '', 6, 'Niveau 6', 9578, '/67/488/1225/4052/9578/17008', 'true', 'Rare Quercus coccifera formations of Liguria, Corsica, Sardinia and Sicily.', '', 'Formations rares de Corse comprenant Quercus coccifera.'),
(17009, 'NR', 22, '32.2193', '', '', 'Greek thermo-Mediterranean kermes oak brush', '', 6, 'Niveau 6', 9578, '/67/488/1225/4052/9578/17009', 'false', 'Formations of Quercus coccifera of the thermo-Mediterranean zone of Greece and its archipelagoes.', '', 'Pas de description disponible'),
(17010, 'NR', 22, '32.21A1', '', '', 'Minorcan lentiscares', '', 6, 'Niveau 6', 9579, '/67/488/1225/4052/9579/17010', 'false', 'Thickets of Phillyrea media var. rodriguezii restricted to Minorca.', 'Aro picti-Phillyreetum rodriguezii', 'Pas de description disponible'),
(17011, 'NR', 22, '32.21A2', '', '', 'Valencian mata', '', 6, 'Niveau 6', 9579, '/67/488/1225/4052/9579/17011', 'false', 'Thickets of Phillyrea angustifolia, Pistacia lentiscus, Quercus coccifera, Rhamnus lycioides ssp. oleoides var. angustifolia, R. alaternus of fixed dunes of Valencia. They are almost extinct, surviving only in the Dehesa de la Albufera. The code should be used in conjunction with 16.28.', 'Phillyreo-Rhamnetum angustifoliae', 'Pas de description disponible'),
(17012, 'NR', 22, '32.21A3', 'Fourrés occidentaux à Phillyrea', '', 'Western Phillyrea thickets', '', 6, 'Niveau 6', 9579, '/67/488/1225/4052/9579/17012', 'true', 'Phillyrea angustifolia or P. media-dominated formations; of the westerm Mediterranean.', '', 'Formations dominées par Phillyrea angustifolia ou par P. media de la Méditerranée occidentale.'),
(17013, 'NR', 22, '32.21A4', '', '', 'Eastern Phillyrea thickets', '', 6, 'Niveau 6', 9579, '/67/488/1225/4052/9579/17013', 'false', 'Phillyrea angustifolia or P. media-dominated formations of the eastern Mediterranean.', '', 'Pas de description disponible'),
(17014, 'NR', 22, '32.21G1', '', '', 'Karpathos and Kasos tall spiny broom brush', '', 6, 'Niveau 6', 9591, '/67/488/1225/4052/9591/17014', 'false', 'Genista fasselata formations of Karpathos and Kasos.', '', 'Pas de description disponible'),
(17015, 'NR', 22, '32.21G2', '', '', 'Pantelleria tall spiny broom brush', '', 6, 'Niveau 6', 9591, '/67/488/1225/4052/9591/17015', 'false', 'Genista aspalathoides formations of Pantelleria.', '', 'Pas de description disponible'),
(17016, 'NR', 22, '32.2851', '', '', 'Ronda dolomite garrigues', '', 6, 'Niveau 6', 9617, '/67/488/1225/4055/9617/17016', 'false', 'Dolomitic formations with Ulex baeticus, Phlomis purpurea ssp. purpurea, Cistus clusii, Halimium viscosum, Euphorbia baetica, Linaria clementei and, sometimes, Genista haenseleri of the Serrania de Ronda, Sierra Blanquilla, de Ojen and surrounding areas.', 'Ulici-Halimietum viscosi = Cisto clusii-Ulicetum baetici', 'Pas de description disponible'),
(17017, 'NR', 22, '32.2852', '', '', 'Ronda serpentine and peridotite garrigues', '', 6, 'Niveau 6', 9617, '/67/488/1225/4055/9617/17017', 'false', 'Formations of serpentines and peridotites of the Sierra de Carratraca and a few nearby stations of the Serrania de Ronda with Ulex baeticus (or sometimes Genista umbellata ssp. equisetiformis), Galium boissieranum, Staehelina baetica, Centaurea carratracensis.', 'Asperulo-Staehelinetum baeticae', 'Pas de description disponible'),
(17018, 'NR', 22, '32.2853', '', '', 'Bermeja Ulex garrigues', '', 6, 'Niveau 6', 9617, '/67/488/1225/4055/9617/17018', 'false', 'Formations of the Sierra Bermeja dominated by Ulex baeticus.', 'Halimio atriplicifolii-Digitaletum laciniatae p.', 'Pas de description disponible'),
(17019, 'NR', 22, '32.2561', '', '', 'Salsola webbii brush', '', 6, 'Niveau 6', 9585, '/67/488/1225/4043/9585/17019', 'false', 'Tall brush communities of arid slopes at the base of coastal mountains with Salsola webbii, Launaea arborescens, Anthyllis terniflora, Frankenia webbii, Echium pycnanthum.', 'Frankenio-Salsoletum webbii', 'Pas de description disponible'),
(17020, 'NR', 22, '32.2562', '', '', 'Sideritis brush', '', 6, 'Niveau 6', 9585, '/67/488/1225/4043/9585/17020', 'false', 'Montane brush of sunny calcareous slopes of the Sierra de Gador and the Sierra de Alhamilla, rich in endemics among which the shrubs Sideritis foetens and Lavandula lanata and the woody perennials Salvia candelabrum, Lavatera oblongifolia and Ptilostemon hispanicus.', 'Salvio-Sideritetum foetens', 'Pas de description disponible'),
(17282, 'NR', 22, '44.1412', 'Galeries de Salix alba méditerranéennes', '', 'Mediterranean Salix alba galleries', '', 6, 'Niveau 6', 10171, '/68/515/1378/4505/10171/17282', 'true', 'Other Mediterranean riparian forests formed by white willows, Salix alba, S. fragilis- or S. x rubens- dominated facies of poplar-ash-elm forests developed along lowland Iberian, southern French, Italian, Greek rivers; the accompanying cortège does not differ from that of poplar or ash - dominated facies.', 'Populion albae: Rubo caesi-Populetum albae i.a.', 'Autres forêts riveraines méditerranéennes formées par des Saules blancs, faciès dominé par Salix alba, S. fragilis ou S. x rubens des ripisylves de Peupliers, de Frênes et d\'Ormes développés le long des plaines méridionales françaises ; le cortège associé ne diffère pas de celui des faciès à Peupliers ou à Frênes dominant.'),
(17283, 'NR', 22, '44.8131', 'Fourrés de Tamaris ouest-méditerranéens', '', 'West Mediterranean tamarisk thickets', '', 6, 'Niveau 6', 10173, '/68/515/1380/4506/10173/17283', 'true', 'Tamarix gallica, T. africana or T. canariensis thickets of water-course galleries, humid depressions and slightly saline coastal flats in Iberia, southern and western France, peninsular Italy, the Balearics, Corsica, Sardinia and Sicily. The accompanying flora comprises Scirpus holoschoenus, Saccharum ravennae, Arundo donax, Brachypodium phoenicoidis, Piptatherum miliaceum, Asparagus acutifolius, Equisetum ramosissimum, Rubia peregrina, R. longifolia, R. angustifolia, Dittrichia viscosa.', 'Tamaricion africanae: Tamaricetum gallicae, Polygono equisetiformis-Tamaricetum africanae, Glycirrhizo glabrae-Tamaricetum canariensis i.a.', 'Fourrés de Tamarix gallica, T. africana ou T. canariensis des galeries riveraines, des dépressions humides et des marais côtiers légèrement salés au sud et à l\'ouest de la France, en Corse. La flore compagne comprend Scirpoides holoschoenus, Erianthus ravennae, Arundo donax, Brachypodium phoenicoidis, Piptatherum miliaceum, Asparagus acutifolius, Equisetum ramosissimum, Rubia peregrina, R. peregrina subsp. longifolia, R. peregrina subsp. requienii, Dittrichia viscosa.'),
(17284, 'NR', 22, '44.8132', '', '', 'Macaronesian tamarisk thickets', '', 6, 'Niveau 6', 10173, '/68/515/1380/4506/10173/17284', 'false', 'Tamarix spp.-dominated formations of the Canary Islands and Madeira.', '', 'Pas de description disponible'),
(17285, 'NR', 22, '44.8133', '', '', 'East Mediterranean tamarisk thickets', '', 6, 'Niveau 6', 10173, '/68/515/1380/4506/10173/17285', 'false', 'Tamarix parviflora, T. tetrandra, T. dalmatica, T. smyrnensis and T. hampeana thickets of lowland water-course galleries, humid depressions and slightly saline coastal flats of Greece and its islands.', 'Tamaricetum parviflorae, Tamaricetum tetrandrae i.a.', 'Pas de description disponible'),
(17286, 'NR', 22, '44.1421', '', '', 'Iberian olive-leaved willow woods', '', 6, 'Niveau 6', 10172, '/68/515/1378/4505/10172/17286', 'false', 'Riparian woods of Salix atrocinerea of central and eastern Iberia, with Salix neotricha, S. salvifolia, Frangula alnus, Populus tremula, Fraxinus angustifolia and many lianas and brambles (Rubus spp.).', 'Rubo corylifolii-Salicetum atrocinereae', 'Pas de description disponible'),
(17287, 'NR', 22, '44.1422', '', '', 'Andalusian olive-leaved willow woods', '', 6, 'Niveau 6', 10172, '/68/515/1378/4505/10172/17287', 'false', 'Riparian woods formed almost exclusively by Salix atrocinerea, with a few Fraxinus angustifolia, numerous lianas and brambles (Rubus spp.) and an abundance of Thelypteris palustris in the undergrowth, characteristic of the southwestern Iberian peninsula.', 'Viti viniferae-Salicetum atrocinereae', 'Pas de description disponible'),
(17288, 'NR', 22, '44.1423', '', '', 'Sardinian olive-leaved willow woods', '', 6, 'Niveau 6', 10172, '/68/515/1378/4505/10172/17288', 'false', 'Riparian woods of Salix atrocinerea of Sardinia.', '', 'Pas de description disponible'),
(17289, 'NR', 22, '44.1424', '', '', 'Ashy willow riparian woods', '', 6, 'Niveau 6', 10172, '/68/515/1378/4505/10172/17289', 'false', 'Riparian woods of Salix cinerea of Italy and Greece.', 'Frangulo-Salicetum cinereae i.a.', 'Pas de description disponible'),
(17290, 'NR', 22, '44.8134', '', '', 'Hyper-saline tamarisk stands', '', 6, 'Niveau 6', 10173, '/68/515/1380/4506/10173/17290', 'false', 'Thickets of Tamarix boveana, T. canariensis or, sometimes, T. gallica, accompanied by typical salt marsh flora, in particular, Arthrocnemum fruticosum, A. glaucum, Suaeda brevifolia, Halimione portulacoides, Atriplex halimus, A. hastata, Limonium lactibracteatum, L. eugeniae, L. cossonianum, L. angustibracteanum, L. sinuosum, Inula crithmoides.', 'Tamaricion boveana-canariensis', 'Pas de description disponible'),
(17291, 'NR', 22, '42.8211', '', '', 'Northern-Iberian mesogean pine forests', '', 6, 'Niveau 6', 10182, '/68/491/1386/4521/10182/17291', 'false', 'Very extensive Pinus pinaster forests of the Northern Iberian Range and neighbouring areas, occupying siliceous, often sandy substrates.', '', 'Pas de description disponible'),
(17292, 'NR', 22, '42.8212', '', '', 'Cordilleran mesogean pine forests', '', 6, 'Niveau 6', 10182, '/68/491/1386/4521/10182/17292', 'false', 'Extensive Pinus pinaster forests of the Cordillera Central and neighbouring areas, particularly developed on the southern slope of the range, occupying siliceous substrates, mostly gneiss and granite.', '', 'Pas de description disponible'),
(17293, 'NR', 22, '42.8213', '', '', 'Southern-Iberian mesogean pine forests', '', 6, 'Niveau 6', 10182, '/68/491/1386/4521/10182/17293', 'false', 'Pinus pinaster forests of the Southern Iberian Range and plateaux of eastern New Castile.', '', 'Pas de description disponible'),
(17294, 'NR', 22, '42.8214', '', '', 'Cazorlan mesogean pine forests', '', 6, 'Niveau 6', 10182, '/68/491/1386/4521/10182/17294', 'false', 'Extensive Pinus pinaster forests of the Sierras de Cazorla, Segura, Alcaraz and Sagra, mostly on Mesozoic limestones.', '', 'Pas de description disponible'),
(17295, 'NR', 22, '42.8215', '', '', 'Southern Andalusian mesogean pine forests', '', 6, 'Niveau 6', 10182, '/68/491/1386/4521/10182/17295', 'false', 'Pinus pinaster forests of southern mountains.', '', 'Pas de description disponible'),
(17296, 'NR', 22, '44.9111', 'Bois d\'Aulnes marécageux atlantiques à grandes touffes de laîches', '', 'Atlantic greater tussock-sedge alder woods', '', 6, 'Niveau 6', 10184, '/68/515/1388/4523/10184/17296', 'true', 'Alnus glutinosa-Carex paniculata formations of the British Isles, poor in Carex elongata, and harbouring, in particular, Oenanthe crocata and abundant Osmunda regalis.', '', 'Formations d\'Alnus glutinosa-Carex paniculata des îles Britanniques, pauvres en Carex elongata, et abritant, en particulier, Oenanthe crocata et des populations abondantes d\'Osmunda regalis.'),
(17297, 'NR', 22, '44.9112', 'Bois d\'Aulnes marécageux à laîche allongée', '', 'Elongated-sedge swamp alder woods', '', 6, 'Niveau 6', 10184, '/68/515/1388/4523/10184/17297', 'true', 'Formations of sub-Atlantic and subcontinental regions of the continent characterized in particular by the constant presence of Carex elongata.', '', 'Formations des régions sub-atlantiques et sub-continentales du continent caractérisées en particulier par la présence constante de Carex elongata.'),
(17298, 'NR', 22, '51.1113', 'Couronnes de buttes à Sphagnum rubellum', '', 'Sphagnum rubellum hummock wreaths', '', 6, 'Niveau 6', 10296, '/71/518/1404/4579/10296/17298', 'true', 'Dark red Sphagnum rubellum communities often encircling the bases of Sphagnum magellanicum or S. fuscum hummocks.', '', 'Communautés rouges sombres de Sphagnum rubellum encerclant souvent la base des buttes de Sphagnum magellanicum ou de S. fuscum.'),
(17299, 'NR', 22, '51.1114', 'Buttes de Sphagnum rubellum', '', 'Sphagnum rubellum hummocks', '', 6, 'Niveau 6', 10296, '/71/518/1404/4579/10296/17299', 'true', 'Hummocks dominated by Sphagnum rubellum.', '', 'Buttes dominées par Sphagnum rubellum.'),
(17300, 'NR', 22, '51.1115', 'Buttes de Sphagnum imbricatum', '', 'Sphagnum imbricatum hummocks', '', 6, 'Niveau 6', 10296, '/71/518/1404/4579/10296/17300', 'true', 'Often tall hummocks formed by the large, orange-gold Sphagnum imbricatum, mostly western and increasingly uncommon.', '', 'Buttes souvent élevées formées par la grande sphaigne jaune d\'or Sphagnum imbricatum. Cette unité est surtout occidentale et est en voie de raréfaction.'),
(17301, 'NR', 22, '51.1116', 'Buttes de Sphagnum papillosum', '', 'Sphagnum papillosum hummocks', '', 6, 'Niveau 6', 10296, '/71/518/1404/4579/10296/17301', 'true', 'Low hummocks of olive-brown or ocre Sphagnum papillosum, formed mostly in western bogs.', '', 'Buttes basses de la sphaigne brun-olive ou ocre : Sphagnum papillosum, se formant principalement dans les tourbières occidentales.'),
(17302, 'NR', 22, '42.8216', '', '', 'Leonese mesogean pine forests', '', 6, 'Niveau 6', 10182, '/68/491/1386/4521/10182/17302', 'false', 'Isolated Pinus pinaster woods of Nogarejas and Castrocontrigo in southern Leon.', '', 'Pas de description disponible'),
(17303, 'NR', 22, '42.8217', '', '', 'Catalonian mesogean pine forests', '', 6, 'Niveau 6', 10182, '/68/491/1386/4521/10182/17303', 'false', 'Pinus pinaster forests of Catalonia.', '', 'Pas de description disponible'),
(17304, 'NR', 22, '42.8261', '', '', 'Pantellerian mesogean pine-Genista forests', '', 6, 'Niveau 6', 10189, '/68/491/1386/4521/10189/17304', 'false', 'Dominant, probably subclimactic woodlands of Pantelleria, constituted by Pinus pinaster, with Genista aspalathoides, Erica multiflora, Cistus salvifolius, Lavandula stoechas, Rosmarinus officinalis, Daphne gnidium, Arbutus unedo, Myrtus communis, Erica arborea, Carex illegitima.', 'Pino-Genistetum aspalathoidis pinetosum pinastri', 'Pas de description disponible'),
(17305, 'NR', 22, '42.8262', '', '', 'Pantellerian mesogean pine-holm oak forests', '', 6, 'Niveau 6', 10189, '/68/491/1386/4521/10189/17305', 'false', 'Mixed Pinus pinaster and Quercus ilex formations of Pantelleria Grande and Monte Gibele, with Arbutus unedo and Erica arborea.', 'Erico-Quercetum ilicis pinetosum pinastri', 'Pas de description disponible'),
(17021, 'NR', 22, '32.2563', '', '', 'Gorse-phlomis scrub', '', 6, 'Niveau 6', 9585, '/67/488/1225/4043/9585/17021', 'false', 'Formation endemic to the base-rich volcanic rocks of the mountains of Cabo de Gata, dominated by the gorse Ulex argenteus ssp. erinaceus, of extraordinarily limited range, accompanied by Phlomis purpurea ssp. almeriensis, P. caballeroi and numerous elements of thermo-Mediterranean brushes, Asparagus spp., Pistacia lentiscus, Quercus coccifera, Chamaerops humilis.', 'Phlomidi-Ulicetum canescentis', 'Pas de description disponible'),
(17022, 'NR', 22, '32.2564', '', '', 'Genista umbellata garrigues', '', 6, 'Niveau 6', 9585, '/67/488/1225/4043/9585/17022', 'false', 'Open scrub rich in dwarf shrubs and dominated by the large cushions of var. umbellata of the remarkable, taxonomically widely isolated, southern and southeastern Spanish endemic Genista umbellata, in association with the also cushion-forming Thymus capitatus, Genista spartioides ssp. retamoides, another southern Spanish endemic, and Phlomis purpurea ssp. almeriensis. This formation, which presents physiognomic similarities with phryganas (33), constitutes a transition between the arid brushes and the thermo-Mediterranean garrigues of section 32.27, in particular those formed by the only other population of G. umbellata (ssp. equisetiformis). Many of the accompanying dwarf shrubs, such as Thymus glandulosus, Satureja obovata, Teucrium eriocephalum, however, are Iberian Southeast endemics or preferentials.', 'Corydothymo-Phlomidetum almeriensis', 'Pas de description disponible'),
(17023, 'NR', 22, '32.2571', '', '', 'Murcio-Alicantian arid garrigues', '', 6, 'Niveau 6', 9630, '/67/488/1225/4043/9630/17023', 'false', 'Diverse formations of the northern part of the arid Iberian Southeast characterized by various combinations of the dwarf shrubs Helianthemum caput-felis, H. cinereum ssp. cinereum, H. pilosum ssp. violaceum, Hypericum ericoides, Launaea pumila and the endemic Astragalus hispanicus, Sideritis leucantha ssp. tragoriganum, Teucrium pumilum ssp. carolipaui, Thymus longiflorus ssp. moroderi.', 'Thymeo-Siderition leucanthae', 'Pas de description disponible'),
(17024, 'NR', 22, '32.2572', '', '', 'Almerian arid garrigues', '', 6, 'Niveau 6', 9630, '/67/488/1225/4043/9630/17024', 'false', 'Very open formations limited to the areas of the Iberian Southeast, with the most extreme arid conditions, characterized by Anabasis articulata, Frankenia webbii, Haloxylon articulatum, Launaea lanata, Limonium album, Teucrium gnaphalodes, Sideritis pusilla ssp. flavovirens, and an exceptional number of endemics, including Coris hispanica, Euzomodendron bourgaeanum, Herniaria fontanesii ssp. almeriana, Limonium insignis, Salsola papillosa, Santolina viscosa, Sideritis pusilla ssp. pusilla, S. pusilla ssp. osteoxyla, Teucrium eriocephalum, T. almeriense.', 'Anthyllido-Salsolion papillosae', 'Pas de description disponible'),
(17025, 'NR', 22, '34.1121', 'Communautés à Sempervivum tectorum', '', 'Sempervivum tectorum communities', '', 6, 'Niveau 6', 9688, '/67/490/1234/4116/9688/17025', 'true', 'Formations with Sempervivum tectorum, of the Jura, the Lake Constance area, the Moselle Valley, Hesse.', '', 'Formations avec Sempervivum tectorum, du Jura, de la région du lac de Constance, de la vallée de la Moselle.'),
(17026, 'NR', 22, '34.1122', '', '', 'Jovibarba sobolifera communities', '', 6, 'Niveau 6', 9688, '/67/490/1234/4116/9688/17026', 'false', 'Formations with Jovibarba sobolifera, of Franconia, Rhon, southern Saxony and Brandenburg.', '', 'Pas de description disponible'),
(17027, 'NR', 22, '34.1123', '', '', 'Amblève houseleek community', '', 6, 'Niveau 6', 9688, '/67/490/1234/4116/9688/17027', 'false', 'The unique, and therefore highly vulnerable, formation of Sempervivum funckii var. aqualiense known from only one site on the cliffs of the Amblève Valley, eastern Condroz.', '', 'Pas de description disponible'),
(17028, 'NR', 22, '34.3121', 'Pelouses steppiques xérophiles de l\'Europe centrale', '', 'Xerophile Central European steppic grasslands', '', 6, 'Niveau 6', 9697, '/67/490/1236/4122/9697/17028', 'true', 'Dry formations.', 'Festucion valesiacae: Potentillo-Stipetum capillatae, Allio-Stipetum capillatae', 'Formations sèches.'),
(17029, 'NR', 22, '34.3122', 'Pelouses steppiques mésophiles de l\'Europe centrale', '', 'Mesophile Central European steppic grasslands', '', 6, 'Niveau 6', 9697, '/67/490/1236/4122/9697/17029', 'true', 'More mesic formations.', 'Cirsio-Brachypodion: Stipetum stenophyllae, Genisto-Stipetum stenophyllae, Adonido-Brachypodietum', 'Formations plus mésophiles.'),
(17030, 'NR', 22, '34.3123', 'Pelouses steppiques à brachypode penné de l\'Europe centrale', '', 'Central European Tor grass steppic grasslands', '', 6, 'Niveau 6', 9697, '/67/490/1236/4122/9697/17030', 'true', 'Brachypodium pinnatum-dominated facies of 34.3122.', '', 'Faciès de 34.3122 dominé par Brachypodium pinnatum.'),
(17031, 'NR', 22, '41.7711', '', '', 'Western Quercus faginea forests', '', 6, 'Niveau 6', 9707, '/68/492/1265/4140/9707/17031', 'false', 'Quercus faginea forests of the supra-Mediterranean, sub-humid level of the Cantabrian periphery and upper Ebro basin.', 'Spiraeo obovatae-Quercetum fagineae', 'Pas de description disponible'),
(17032, 'NR', 22, '41.7712', '', '', 'Central Quercus faginea forests', '', 6, 'Niveau 6', 9707, '/68/492/1265/4140/9707/17032', 'false', 'Quercus faginea forests of the meso-supra-Mediterranean levels of the Iberian Range, upper Douro basin and neighbouring regions.', 'Cephalanthero longifoliae-Quercetum fagineae', 'Pas de description disponible'),
(17033, 'NR', 22, '41.7713', '', '', 'Eastern Quercus faginea forests', '', 6, 'Niveau 6', 9707, '/68/492/1265/4140/9707/17033', 'false', 'Quercus faginea forests of the meso-supra-Mediterranean levels of the Maestrazgo, interior Catalonia and adjacant Aragon.', 'Violo wilkommii-Quercetum fagineae', 'Pas de description disponible'),
(17034, 'NR', 22, '41.7714', '', '', 'Baetic Quercus faginea forests', '', 6, 'Niveau 6', 9707, '/68/492/1265/4140/9707/17034', 'false', 'Southern forests of the sub-humid to humid supra-Mediterranean level of calcareous Baetic ranges, limited to a few enclaves in the Serrania de Ronda and the ranges of the upper Guadalquivir basin, dominated by Quercus faginea associated with Acer granatense, A. monspessulanum, Sorbus aria, S. torminalis, Taxus baccata and sometimes Quercus pyrenaica.', 'Daphno latifoliae-Aceretum granatensis', 'Pas de description disponible'),
(17035, 'NR', 22, '41.7715', '', '', 'Valencian Quercus faginea forests', '', 6, 'Niveau 6', 9707, '/68/492/1265/4140/9707/17035', 'false', 'Quercus faginea forests of ubacs of the southern Valencian mountains (Aitana, Montcabrer, Benicadell), with Acer granatense, Fraxinus ornus and Taxus baccata.', 'Fraxino orni-Quercetum fagineae', 'Pas de description disponible'),
(17036, 'NR', 22, '41.1311', 'Hêtraies calciclines à Mélique', '', 'Calcicline wood melick beech forests', '', 6, 'Niveau 6', 9717, '/68/492/1278/4144/9717/17036', 'true', 'Slightly-moist beech forests developed over calcareous bedrock on stony, neutral or weakly acid rendzina or similar humus-carbonate soils, with Galium odoratum, Melica uniflora, Mercurialis perennis, Lathyrus vernus, Asarum europaeum, Hordelymus europaeus, Epipactis helleborine, E. leptochila, Neottia nidus-avis, Circaea lutetiana, Viola reichenbachiana.', '', 'Hêtraies légèrement fraîches développées sur roche mère calcaire avec des sols caillouteux, neutres ou faiblement acides, parfois à humus carbonaté, avec Galium odoratum, Melica uniflora, Mercurialis perennis, Lathyrus vernus, Asarum europaeum, Hordelymus europaeus, Epipactis helleborine, E. leptochila, Neottia nidus-avis, Circaea lutetiana, Viola reichenbachiana.'),
(17037, 'NR', 22, '42.5A21', '', '', 'Iberian Range calcicolous Scots pine forests', '', 6, 'Niveau 6', 9728, '/68/491/1263/4154/9728/17037', 'false', 'Oro-Mediterranean, calcicolous forests of Pinus sylvestris var. iberica of the Southern Iberian Range (Maestrazgo: Gudar, Jabalambre, Penyagolosa; serrania de Cuenca: sierra de San Felipe, Montes Universales.), with a shrub layer constituted mainly by Juniperus sabina; secondary calcicolous Scots pine formations of lower altitude in the Iberian Range.', 'Junipero sabinae-Pinetum sylvestris', 'Pas de description disponible'),
(17038, 'NR', 22, '41.1312', 'Hêtraies neutroclines à Mélique', '', 'Neutrocline wood melick beech forests', '', 6, 'Niveau 6', 9717, '/68/492/1278/4144/9717/17038', 'true', 'Beech forests developed on a more or less deep layer of brown loess-loam, less rich in calciphile plants and richer in acid- and drought- tolerant species; Melica uniflora (in northern formations) and Galium odoratum are usually well represented; Carex brizoides, C. pilosa, Milium effusum are characteristic of various sub-types.', '', 'Hêtraies développées sur des sols plus ou moins profonds de lœss argileux brun, moins riches en plantes calciphiles et plus riches en espèces tolérantes à la sécheresse et à l\'acidité ; Melica uniflora (dans les formations du nord) et Galium odoratum sont habituellement bien représentés ; Carex brizoides, C. pilosa, Milium effusum sont caractéristiques de divers sous-types.'),
(17306, 'NR', 22, '51.1117', 'Buttes de Sphagnum capillifolium', '', 'Sphagnum capillifolium hummocks', '', 6, 'Niveau 6', 10296, '/71/518/1404/4579/10296/17306', 'true', 'Large cushion hummocks formed by the reddish Sphagnum capillifolium, mostly western.', '', 'Volumineuses buttes en coussins formées par la sphaigne rougeâtre : Sphagnum capillifolium, principalement occidentales.'),
(17307, 'NR', 22, '51.1131', 'Buttes à buissons de Callune prostrée', '', 'Ling dwarf shrub hummocks', '', 6, 'Niveau 6', 10201, '/71/518/1404/4579/10201/17307', 'true', 'Calluna vulgaris - dominated communities characteristic of Central European formations.', '', 'Communautés dominées par Calluna vulgaris caractéristiques des formationscentre-européennes.'),
(17308, 'NR', 22, '51.1132', 'Buttes à buissons de Bruyère tétragone', '', 'Cross-leaved heather shrub hummocks', '', 6, 'Niveau 6', 10201, '/71/518/1404/4579/10201/17308', 'true', 'Erica tetralix - dominated communities characteristic of Atlantic formations.', '', 'Communautés dominées par Erica tetralix caractéristiques des formations atlantiques.'),
(17309, 'NR', 22, '51.1133', 'Buttes à buissons de Camarine', '', 'Crowberry shrub hummocks', '', 6, 'Niveau 6', 10201, '/71/518/1404/4579/10201/17309', 'true', 'Empetrum nigrum - dominated communities of slightly more mineral-rich formations.', '', 'Communautés dominées par Empetrum nigrum des formations légèrement plus riches en sels minéraux.'),
(17310, 'NR', 22, '51.1134', 'Buttes à buissons de Vaccinium', '', 'Vaccinium shrub hummocks', '', 6, 'Niveau 6', 10201, '/71/518/1404/4579/10201/17310', 'true', 'Formations of taller hummocks with Vaccinium uliginosum, V. vitis-idaeae, V. myrtillus and, locally, Betula nana.', '', 'Formations de buttes plus élevées avec Vaccinium uliginosum, V. vitis-idaea, V. myrtillus et, localement Betula nana.'),
(17311, 'NR', 22, '51.1135', '', '', 'Labrador tea shrub hummocks', '', 6, 'Niveau 6', 10201, '/71/518/1404/4579/10201/17311', 'false', 'Ledum palustre communities of tall hummocks of northeastern bogs.', '', 'Pas de description disponible'),
(17312, 'NR', 22, '51.1136', 'Buttes à buissons de Myrte des marais (ou piment royal)', '', 'Bog myrtle hummocks', '', 6, 'Niveau 6', 10201, '/71/518/1404/4579/10201/17312', 'true', 'Myrica gale communities of hummocks of western bogs.', '', 'Communautés de buissons de Myrica gale des tourbières occidentales.'),
(17313, 'NR', 22, '42.8311', '', '', 'Western Andalusian stone pine forests', '', 6, 'Niveau 6', 10204, '/68/491/1386/4525/10204/17313', 'false', 'Pinus pinea forests of the lowlands of western Andalusia and adjacent areas, with Halimium halimifolium, H. rosmarinifolium, Calicotome villosa, Cistus salvifolius, C. crispus, Erica scoparia, Corema album, Rhamnus oleoides, Chamaerops humilis, Juniperus phoenicea.', '', 'Pas de description disponible'),
(17314, 'NR', 22, '42.8312', '', '', 'Lusitanian stone pine forests', '', 6, 'Niveau 6', 10204, '/68/491/1386/4525/10204/17314', 'false', 'Pinus pinea forests of the coasts of Portugal, notably the Setubal peninsula, pure or with Pinus pinaster.', '', 'Pas de description disponible'),
(17315, 'NR', 22, '42.8313', '', '', 'Castilian stone pine forests', '', 6, 'Niveau 6', 10204, '/68/491/1386/4525/10204/17315', 'false', 'Pinus pinea forests of the plateaux of Old Castile in the provinces of Valladolid, Zamora, Avila and Segovia, pure or with Pinus pinaster; the undergrowth includes Cistus laurifolius, Cytisus scoparius, Crataegus monogyna, Salvia officinalis, Lavandula latifolia, Juniperus communis, J. thurifera and tufts of Corynephorus canescens.', '', 'Pas de description disponible'),
(17316, 'NR', 22, '42.8314', '', '', 'Cordilleran stone pine forests', '', 6, 'Niveau 6', 10204, '/68/491/1386/4525/10204/17316', 'false', 'Pinus pinea forests of the foothills of the Cordillera Central, particularly in areas between Guadarrama and Gredos, pure or with Pinus pinaster; the undergrowth, similar to that of evergreen oak forests, includes Juniperus oxycedrus, Retama sphaerocarpa, Cytisus scoparius, Pistacia terebinthus, Lavandula pedunculata, Helichrysum serotinum.', '', 'Pas de description disponible'),
(17317, 'NR', 22, '42.8315', '', '', 'Catalonian stone pine forests', '', 6, 'Niveau 6', 10204, '/68/491/1386/4525/10204/17317', 'false', 'Pinus pinea forests of coastal and lowland Catalonia, often natural, and with an abundant shrub layer comprising Arbutus unedo, Erica arborea, Ulex australis, Calicotome spinosa, Cistus albidus, C. monspeliensis, C. salvifolius, C. laurifolius.', '', 'Pas de description disponible'),
(17318, 'NR', 22, '42.8316', '', '', 'Morena stone pine forests', '', 6, 'Niveau 6', 10204, '/68/491/1386/4525/10204/17318', 'false', 'Pinus pinea forests of the Sierra Morena, largely represented by plantations.', '', 'Pas de description disponible'),
(17319, 'NR', 22, '42.8317', '', '', 'Manchegan stone pine forests', '', 6, 'Niveau 6', 10204, '/68/491/1386/4525/10204/17319', 'false', 'Pinus pinea forests of the foothills of the Southern Iberian Range and the plateaux of La Mancha, also mostly of artificial origin.', '', 'Pas de description disponible'),
(17320, 'NR', 22, '42.8331', 'Forêts provençales côtières de Pins parasols', '', 'Coastal Provence stone pine forests', '', 6, 'Niveau 6', 10208, '/68/491/1386/4525/10208/17320', 'true', 'Pinus pinea woods of coastal sands, particularly of the Camargue, where it is associated with Juniperus phoenicea ssp. lycia.', '', 'Bois de Pinus pinea des sables côtiers du sud de la France, particulièrement de Camargue où le pin est associé à Juniperus phoenicea subsp. lycia.'),
(17321, 'NR', 22, '42.8332', 'Forêts provençales permiennes de Pins parasols', '', 'Permian Provence stone pine forests', '', 6, 'Niveau 6', 10208, '/68/491/1386/4525/10208/17321', 'true', 'Pinus pinea woods of the Permian depression encircling the Maures, and a few neighbouring localities, associated mostly with maquis of Cistus monspeliensis, C. salvifolius, C. ladanifer, Erica scoparia.', '', 'Bois de Pinus pinea de la dépression permienne entourant les Maures, et de quelques localités voisines, associés pour la plupart à des maquis de Cistus monspeliensis, C. salviifolius, C. ladanifer, Erica scoparia.'),
(17322, 'NR', 22, '42.8351', '', '', 'Iglesiente near-natural stone pine forests', '', 6, 'Niveau 6', 10210, '/68/491/1386/4525/10210/17322', 'false', 'Pinus pinea forest of coastal dunes of Iglesiente, west of Monte Linas, comprising plurisecular trees and of undoubted indigenous origin.', '', 'Pas de description disponible'),
(17323, 'NR', 22, '42.8352', '', '', 'Sardinian semi-natural stone pine forests', '', 6, 'Niveau 6', 10210, '/68/491/1386/4525/10210/17323', 'false', 'Other Pinus pinea woods of Sardinia, some particularly in the vicinity of Monte Linas, of possible native origin.', '', 'Pas de description disponible'),
(17324, 'NR', 22, '42.8461', '', '', 'Mainland Sicilian Aleppo pine forests', '', 6, 'Niveau 6', 10222, '/68/491/1386/4542/10222/17324', 'false', 'Pinus halepensis woods of mainland Sicily, where native formations occur on the southwestern slope of the Iblei massif (Vittoria).', '', 'Pas de description disponible'),
(17325, 'NR', 22, '42.8462', '', '', 'Egadi Aleppo pine forests', '', 6, 'Niveau 6', 10222, '/68/491/1386/4542/10222/17325', 'false', 'Pinus halepensis woods of the Egadi islands (Marettimo, Isla Grande, San Pantaleo).', '', 'Pas de description disponible'),
(17326, 'NR', 22, '44.3411', '', '', 'Eume near-natural alder galleries', '', 6, 'Niveau 6', 10223, '/68/515/1389/4543/10223/17326', 'false', 'Relict near-natural Alnus glutinosa galleries of the Eume basin, with the rare ferns Trichomanes speciosum (=Vandenboschia speciosa) and Culcita macrocarpa.', '', 'Pas de description disponible'),
(17327, 'NR', 22, '44.3412', '', '', 'Semi-natural Galicio-Cantabrian alder galleries', '', 6, 'Niveau 6', 10223, '/68/515/1389/4543/10223/17327', 'false', 'Other formations.', '', 'Pas de description disponible'),
(17328, 'NR', 22, '42.8463', '', '', 'Lampedusa Aleppo pine forests', '', 6, 'Niveau 6', 10222, '/68/491/1386/4542/10222/17328', 'false', 'Pinus halepensis woods of the Pelagie (Lampedusa).', '', 'Pas de description disponible'),
(17329, 'NR', 22, '42.8464', '', '', 'Pantelleria Aleppo pine forests', '', 6, 'Niveau 6', 10222, '/68/491/1386/4542/10222/17329', 'false', 'Uncommon Pinus halepensis - dominated facies of the pine woods of Pantelleria.', 'Pino-Genistetum aspalathoidis pinetosum halepensis', 'Pas de description disponible'),
(17330, 'NR', 22, '42.8471', '', '', 'Gargano Aleppo pine forests', '', 6, 'Niveau 6', 10232, '/68/491/1386/4542/10232/17330', 'false', 'Pinus halepensis forests of monte Gargano and the Tremiti islands.', '', 'Pas de description disponible'),
(17331, 'NR', 22, '42.8472', '', '', 'Metapontine Aleppo pine forests', '', 6, 'Niveau 6', 10232, '/68/491/1386/4542/10232/17331', 'false', 'Pinus halepensis forests of the Gulf of Taranto area, in particular of the Metapontine littoral.', '', 'Pas de description disponible'),
(17332, 'NR', 22, '42.8473', '', '', 'Umbrian Aleppo pine forests', '', 6, 'Niveau 6', 10232, '/68/491/1386/4542/10232/17332', 'false', 'Pinus halepensis forests of southern Umbria, in the Narni and Spoleto-Terni areas.', '', 'Pas de description disponible'),
(17333, 'NR', 22, '42.8474', '', '', 'Italian Aleppo pine reforestation', '', 6, 'Niveau 6', 10232, '/68/491/1386/4542/10232/17333', 'false', 'Other Pinus halepensis formations of peninsular Italy.', '', 'Pas de description disponible'),
(17039, 'NR', 22, '41.1321', 'Hêtraies calciclines à Jacinthe des bois', '', 'Calcicline bluebell beech forests', '', 6, 'Niveau 6', 9729, '/68/492/1278/4144/9729/17039', 'true', 'Atlantic beech, beech-oak or beech-ash forests developed on base-rich and calcareous soils, particularly of limestone scarplands, of southern England (Fagus sylvatica-Mercurialis perennis woodland) and neighbouring regions of western France.', '', 'Hêtraies, chênaies-hêtraies ou frênaies-hêtraies atlantiques développées sur des sols calcaires et riches en bases, particulièrement dans les régions calcaires escarpées du sud de l\'Angleterre (région boisée à Fagus sylvatica-Mercurialis perennis) et les régions correspondantes de l\'ouest de la France.'),
(17040, 'NR', 22, '41.1322', 'Hêtraies neutroclines à Jacinthe des bois', '', 'Neutrocline bluebell beech forests', '', 6, 'Niveau 6', 9729, '/68/492/1278/4144/9729/17040', 'true', 'Atlantic beech and beech-ash forests developed on neutral or slightly acid brown soils of southern England (Fagus sylvatica-Rubus fruticosus woodland) and ajacent regions of the mainland.', '', 'Hêtraies et frênaies-hêtraies atlantiques développées sur des sols bruns neutres ou légèrement acides du sud de l\'Angleterre (région boisée à Fagus sylvatica-Rubus fruticosus) et des régions adjacentes du continent.'),
(17041, 'NR', 22, '41.B111', 'Bois de Bouleaux humides septentrionaux', '', 'Northern humid birch woods', '', 6, 'Niveau 6', 9737, '/68/492/1251/4159/9737/17041', 'true', 'Widespread birch-dominated formations characteristic of the North Sea - Baltic plain.', 'Querco-Betuletum p.', 'Formations sauvages à Bouleaux dominants caractéristiques du nord de la plaine de la mer Baltique.'),
(17042, 'NR', 22, '41.B112', 'Bois de Bouleaux humides aquitano-ligériens', '', 'Aquitano-Ligerian humid birch woods', '', 6, 'Niveau 6', 9737, '/68/492/1251/4159/9737/17042', 'true', 'Southern formations common, in particular, in the Sologne and neighbouring areas.', 'Peucedano-Quercetum p.', 'Formations méridionales, communes, en particulier, en Sologne et dans les régions voisines.'),
(17043, 'NR', 22, '42.3211', 'Forêts de Mélèzes et d\'Arolles à Rhododendron cilié', '', 'Hairy alpenrose larch-arolla forests', '', 6, 'Niveau 6', 9742, '/68/491/1267/4158/9742/17043', 'false', 'Forests of limestone plateaux with Pinus cembra and Larix decidua.', '', 'Forêts de plateaux calcaires à Pinus cembra et Larix decidua.'),
(17044, 'NR', 22, '42.3212', 'Forêts d\'Arolles à Rhododendron cilié', '', 'Hairy alpenrose arolla forests', '', 6, 'Niveau 6', 9742, '/68/491/1267/4158/9742/17044', 'false', 'Forests of limestone plateaux with Pinus cembra and no or little Larix decidua.', '', 'Forêts de substrats calcaires, avec Pinus cembra et sans ou peu de Larix decidua.'),
(17045, 'NR', 22, '42.3221', 'Forêts calcicoles de Mélèzes à Rhododendron', '', 'Limestone alpenrose larch forests', '', 6, 'Niveau 6', 9743, '/68/491/1267/4158/9743/17045', 'false', 'Larix decidua forests of limestone plateaux, with Rhododendron hirsutum dominating the ground layer.', 'Laricetum rhododendretosum hirsuti', 'Forêts de plateaux calcaires de Larix decidua, avec Rhododendron hirsutum dominant le sous-bois.'),
(17046, 'NR', 22, '42.3222', 'Forêts de Mélèzes calcicoles sur prairies', '', 'Limestone larch meadow forests', '', 6, 'Niveau 6', 9743, '/68/491/1267/4158/9743/17046', 'false', 'Calcicolous forests of ubacs, often with very tall, vigorous trees and a rich grassy undergrowth in which, together with Luzula sylvatica and L. luzulina, Calamagrostis villosa, Sesleria albicans, Festuca rubra, Carex ferruginea or C. firma can all locally dominate; acidophilous species, including Vaccinium vitis-idaea, V. myrtillus and Lycopodium annotinum, are confined to the foot of the larches.', 'Laricetum luzuletosum sylvaticae', 'Forêts calcicoles d\'ubac, souvent composées d\'arbres très grands et vigoureux et d\'un sous-bois riche en herbes dans lequel, on trouve ensemble Luzula sylvatica, et L. luzulina, Calamagrostis villosa, Sesleria albicans, Festuca rubra, Carex ferruginea ou C. firma elles peuvent toutes dominer localement ; les espèces acidophiles, incluant Vaccinium vitis-idaea, V. myrtillus et Lycopodium annotinum sont confinées aux pieds des Mélèzes.'),
(17047, 'NR', 22, '42.3223', 'Forêts de Mélèzes calcicoles sur éboulis', '', 'Limestone rockfall larch forests', '', 6, 'Niveau 6', 9743, '/68/491/1267/4158/9743/17047', 'false', 'Larix decidua forest developed on shady limestone screes.', 'Laricetum asplenietosum', 'Forêts de Larix decidua développées sur éboulis calcaires et ombragés.'),
(17048, 'NR', 22, '42.3224', 'Forêts calcicoles de Mélèzes et d\'Epicéas sur pente abrupte', '', 'Limestone steep slope larch-spruce forests', '', 6, 'Niveau 6', 9743, '/68/491/1267/4158/9743/17048', 'false', 'Larix decidua and Larix decidua-Picea abies forests, usually of steep slopes in the montane and locally sub-alpine levels of the northern and southern eastern outer Alps, with Erica herbacea, Buphthalmum salicifolium, Polygala chamaebuxus.', 'Laricetum rhodothamnetosum', 'Pas de description disponible'),
(17049, 'NR', 22, '42.3311', 'Forêts occidentales de Mélèzes et de Mélèzes et de Pins de montagne sur landes', '', 'Western larch and larch-mountain pine heath forests', '', 6, 'Niveau 6', 9752, '/68/491/1267/4169/9752/17049', 'true', 'Larix decidua and Larix decidua-Pinus uncinata forests with heath understorey formed by Rhododendron ferrugineum, Vaccinium myrtillus, V. vitis-idaea, V. uliginosum.', '', 'Forêts à Larix decidua et à Larix decidua et Pinus uncinata avec en sous-bois une lande formée de Rhododendron ferrugineum, Vaccinium myrtillus, V. vitis-idaea, V. uliginosum.'),
(17050, 'NR', 22, '42.3312', 'Forêts occidentales de Mélèzes et de Mélèzes et de Pins de montagne sur prairies', '', 'Western larch and larch-mountain pine meadow forests', '', 6, 'Niveau 6', 9752, '/68/491/1267/4169/9752/17050', 'true', 'Larix decidua and Larix decidua-Pinus uncinata forests with grass-rich understorey.', '', 'Forêts de Larix decidua et de Larix decidua et Pinus uncinata avec une strate herbacée riche en graminées.'),
(17051, 'NR', 22, '42.3313', 'Forêts occidentales de Mélèzes et de Mélèzes et de Pins de montagne sur hautes herbes', '', 'Western larch and larch-mountain pine tall herb forests', '', 6, 'Niveau 6', 9752, '/68/491/1267/4169/9752/17051', 'true', 'Larix decidua and Larix decidua-Pinus uncinata forests with tall-herb understorey.', '', 'Forêts de Larix decidua et de Larix decidua et Pinus uncinata avec un sous-bois de hautes herbes.'),
(17052, 'NR', 22, '42.3321', 'Forêts occidentales d\'Arolles sur silice', '', 'Western silicicolous arolla forests', '', 6, 'Niveau 6', 9753, '/68/491/1267/4169/9753/17052', 'true', 'Silicicolous Pinus cembra forests of ubacs and mesic stations in the inner and intermediate western Alps (Belledonne, Chamrousse; Briançonnais).', '', 'Forêts silicicoles de Pinus cembra des ubacs et des stations mésiques des Alpes occidentales internes et intermédiaires (Belledonne, Chamrousse, Briançonnais).'),
(17053, 'NR', 22, '42.3322', 'Forêts occidentales d\'Arolles à Genévriers nains', '', 'Western dwarf juniper arolla forests', '', 6, 'Niveau 6', 9753, '/68/491/1267/4169/9753/17053', 'true', 'Pinus cembra forests of adrets of the western inner Alps, in which Pinus cembra may be accompanied by P. uncinata and P. sylvestris over a heath of Juniperus nana and Arctostaphylos uva-ursi.', '', 'Forêts de Pinus cembra des adrets des Alpes occidentales internes dans lesquelles Pinus cembra peut être accompagné de Pinus uncinata et de Pinus sylvestris sur une lande à Juniperus nana et Arctostaphylos uva-ursi.'),
(17054, 'NR', 22, '42.3323', 'Forêts occidentales calcicoles d\'Arolles', '', 'Western calcicolous arolla forests', '', 6, 'Niveau 6', 9753, '/68/491/1267/4169/9753/17054', 'true', 'Limestone and gypsum Pinus cembra forests, developed on raw humus accumulated over calcic or hyper calcic substrates, with an exceptional juxtaposition of acidophilous and basiphilous companion species, occasional in the inner and intermediate Alps (Maurienne; Tarentaise, La Plagne, mont Charvet; Flaine) and very locally the outer Alps (Haut Giffre, Les Bornes) of France.', '', 'Forêts de Pinus cembra sur calcaire et gypse, développées sur un humus brut accumulé sur des substrats calciques ou hyper-calciques, avec une juxtaposition exceptionnelle d\'espèces compagnes acidiphiles et basiphiles, occasionnellement dans les Alpes internes et intermédiaires (Maurienne ; Tarentaise, La Plagne, Mont Charvet ; Flaine) et, très localement, dans les Alpes externes (Haut Giffre, Les Bornes) de France.'),
(17055, 'NR', 22, '41.1741', 'Hêtraies neutrophiles des Alpes sud-occidentales', '', 'South-western Alpine neutrophile beech forests', '', 6, 'Niveau 6', 9770, '/68/492/1278/4175/9770/17055', 'true', 'Hygrophile and meso-hygrophile forests of the upper montane level of the southwestern outer Alps in the Baronnies, the Ventoux, the Montagne de Lure.', '', 'Forêts hygrophiles et méso-hygrophiles de l\'étage montagnard supérieur des Alpes externes sud-occidentales, dans les Baronnies, le Ventoux, la Montagne de Lure.'),
(17056, 'NR', 22, '41.1742', 'Hêtraies neutrophiles des Alpes maritimes', '', 'Maritime Alps neutrophile beech forests', '', 6, 'Niveau 6', 9770, '/68/492/1278/4175/9770/17056', 'true', 'Isolated La Cabanette beech forest of Peira-Cava, in the Maritime Alps, with a unique species cortège.', '', 'Hêtraies isolées de La Cabanette, de Peira Cava, dans les Alpes maritimes, avec un cortège spécifique unique.'),
(17057, 'NR', 22, '41.1743', '', '', 'Southern Alpine neutrophile beech forests', '', 6, 'Niveau 6', 9770, '/68/492/1278/4175/9770/17057', 'false', 'Ligurian, Insubrian, Gardesian and Illyric hygrophile and meso-hygrophile beech forests with Cardamine (Dentaria) spp., including the eastern Cardamine kitaibelii (C. pollyphylos), or with Calamintha grandiflora.', '', 'Pas de description disponible'),
(17058, 'NR', 22, '41.1744', '', '', 'Northern Apennine neutrophile beech forests', '', 6, 'Niveau 6', 9770, '/68/492/1278/4175/9770/17058', 'false', 'Mesotrophic beech forests of the Toscano-Emilian and Abruzzian Apennines, with Trochiscanthes nodiflora, Geranium nodosum, G. reflexum, Aquilegia vulgaris, Pulmonaria saccharata, Neottia nidus-avis.', '', 'Pas de description disponible'),
(17334, 'NR', 22, '42.8511', '', '', 'Cretan lentisc Aegean pine forests', '', 6, 'Niveau 6', 10234, '/68/491/1386/4548/10234/17334', 'false', 'Pinus brutia forests with garrigue undergrowth of Pistacia lentiscus, Cistus creticus.', '', 'Pas de description disponible'),
(17335, 'NR', 22, '42.8512', '', '', 'Cretan phrygana Aegean pine forests', '', 6, 'Niveau 6', 10234, '/68/491/1386/4548/10234/17335', 'false', 'Pinus brutia forests with a phrygana undergrowth of Sarcopoterium spinosum or Thymus capitatus.', '', 'Pas de description disponible'),
(17336, 'NR', 22, '42.8513', '', '', 'Cretan grassy Aegean pine forests', '', 6, 'Niveau 6', 10234, '/68/491/1386/4548/10234/17336', 'false', 'Pinus brutia forests with sparce grassy undergrowth on stony ground.', '', 'Pas de description disponible'),
(17337, 'NR', 22, '42.8521', '', '', 'Lesbian humid montane Aegean pine forests', '', 6, 'Niveau 6', 10235, '/68/491/1386/4548/10235/17337', 'false', 'Humid montane Pinus brutia forests of Lesbos, with a high, fairly dense Quercus coccifera - dominated understorey and abundant lichen growth.', '', 'Pas de description disponible'),
(17338, 'NR', 22, '42.8522', '', '', 'Lesbian cistus Aegean pine forests', '', 6, 'Niveau 6', 10235, '/68/491/1386/4548/10235/17338', 'false', 'Dry collinar Pinus brutia forests of Lesbos, with low, sparse undergrowth formed mostly by Cistus salvifolius.', '', 'Pas de description disponible'),
(17339, 'NR', 22, '42.8523', '', '', 'Lesbian heath Aegean pine forests', '', 6, 'Niveau 6', 10235, '/68/491/1386/4548/10235/17339', 'false', 'Dry collinar Pinus brutia forests of Lesbos, with continuous ericaceous undergrowth.', '', 'Pas de description disponible'),
(17340, 'NR', 22, '42.8531', '', '', 'Samian collinar Aegean pine forests', '', 6, 'Niveau 6', 10239, '/68/491/1386/4548/10239/17340', 'false', 'Lower altitude Pinus brutia forests of Samos, with Pistacia lentiscus, Cistus salvifolius, C. parviflorus, Sarcopoterium spinosum, Quercus coccifera.', '', 'Pas de description disponible'),
(17341, 'NR', 22, '42.8532', '', '', 'Samian montane Aegean pine forests', '', 6, 'Niveau 6', 10239, '/68/491/1386/4548/10239/17341', 'false', 'Higher altitude Pinus brutia forests of Samos, sometimes including Pinus pallasiana, and with an undergrowth comprising Quercus coccifera, Prunus cocomila (=P. pseudarmeniaca), Crataegus spp..', '', 'Pas de description disponible'),
(17342, 'NR', 22, '42.8551', '', '', 'Thasian kermes Aegean pine forests', '', 6, 'Niveau 6', 10241, '/68/491/1386/4548/10241/17342', 'false', 'Thasos Pinus brutia forests with a dense Quercus coccifera undergrowth.', '', 'Pas de description disponible'),
(17343, 'NR', 22, '42.8552', '', '', 'Thasian bracken Aegean pine forests', '', 6, 'Niveau 6', 10241, '/68/491/1386/4548/10241/17343', 'false', 'Thasos Pinus brutia forests with sparse undergrowth.', '', 'Pas de description disponible'),
(17344, 'NR', 22, '42.8553', '', '', 'Thasian heath Aegean pine forests', '', 6, 'Niveau 6', 10241, '/68/491/1386/4548/10241/17344', 'false', 'Thasos Pinus brutia forests with dense ericaceous undergrowth.', '', 'Pas de description disponible');
INSERT INTO `corine` (`CD_HAB`, `FG_VALIDITE`, `CD_TYPO`, `LB_CODE`, `LB_HAB_FR`, `LB_HAB_FR_COMPLET`, `LB_HAB_EN`, `LB_AUTEUR`, `NIVEAU`, `LB_NIVEAU`, `CD_HAB_SUP`, `PATH_CD_HAB`, `FRANCE`, `LB_DESCRIPTION`, `CRSP_PHYTO_CB91`, `DESCRIPTIF_CB97_FR`) VALUES
(17345, 'NR', 22, '42.A221', '', '', 'Guadarraman calciphilous Spanish juniper woods', '', 6, 'Niveau 6', 10288, '/68/491/1400/4576/10288/17345', 'false', 'Formations of Juniperus thurifera linked to local limestone deposits of the Sierra de Guadarrama area.', '', 'Pas de description disponible'),
(17346, 'NR', 22, '42.A222', '', '', 'Guadarraman silicicolous Spanish juniper woods', '', 6, 'Niveau 6', 10288, '/68/491/1400/4576/10288/17346', 'false', 'Anomalous silicicolous Juniperus thurifera formations, with J. oxycedrus.', 'Juniperetum hemisphaerico-thuriferae juniperetosum oxycedri', 'Pas de description disponible'),
(17347, 'NR', 22, '51.1111', 'Buttes de Sphagnum magellanicum', '', 'Sphagnum magellanicum hummocks', '', 6, 'Niveau 6', 10296, '/71/518/1404/4579/10296/17347', 'true', 'Typical Central European hummocks, formed by the swollen-leaved, brownish or greenish-red Sphagnum magellanicum', '', 'Buttes typiques des tourbières centre-européennes formées par la sphaigne à feuilles gonflées brunâtre ou rouge verdâtre, Sphagnum magellanicum.'),
(17348, 'NR', 22, '51.1112', 'Buttes de Sphagnum fuscum', '', 'Sphagnum fuscum hummocks', '', 6, 'Niveau 6', 10296, '/71/518/1404/4579/10296/17348', 'true', 'Shiny brown Sphagnum fuscus hummocks replacing or accompanying the Sphagnum magellanicum hummocks in eastern, Alpine and some western communities.', '', 'Buttes formées par la sphaigne brune et luisante Sphagnum fuscum remplaçant ou accompagnant les buttes de Sphagnum magellanicum dans les tourbières orientales, alpiennes et quelquefois occidentales.'),
(17349, 'NR', 22, '42.5A22', '', '', 'Baetic calcicolous Scots pine forests', '', 6, 'Niveau 6', 9728, '/68/491/1263/4154/9728/17349', 'false', 'Oro-Mediterranean forests of Pinus sylvestris var. nevadensis of the Baetic ranges, Sierra Magina, Sierra de Baza, Sierra Tejeda, Sierra del Trevenque (calcareous periphery of the Sierra Nevada), with a shrub layer of Juniperus sabina and J. nana accompanied by Ononis aragonensis, Genista lobelii ssp. longipes, Daphne oleoides and Prunus prostrata, on limestones and dolomites.', 'Daphno oleoidis-Pinetum sylvestris pinetosum sylvestris', 'Pas de description disponible'),
(17350, 'NR', 22, '42.5B21', '', '', 'Upper Sorian silicicolous Scots pine forests', '', 6, 'Niveau 6', 10309, '/68/491/1263/4585/10309/17350', 'false', 'Oro-Mediterranean, acidophilous forests of Pinus sylvestris var. iberica of the Northern Iberian Range (Soria), with Juniperus nana, Cytisus purgans, Deschampsia flexuosa ssp iberica, and abundant Vaccinium myrtillus.', 'Vaccinio myrtilli-Juniperetum nanae pinetosum p.', 'Pas de description disponible'),
(17351, 'NR', 22, '42.5B22', '', '', 'Lower Iberian Range silicicolous Scots pine forests', '', 6, 'Niveau 6', 10309, '/68/491/1263/4585/10309/17351', 'false', 'Supra-Mediterranean, acidophilous Pinus sylvestris var. iberica woods of the Iberian Range, forming in particular as a substitution stage of Quercus pyrenaica woodland of which they largely retain the accompanying flora.', 'Luzulo-Quercetum pyrenaicae deschampsio-pinetosum sylvestris p. i.a.', 'Pas de description disponible'),
(17352, 'NR', 22, '44.6151', '', '', 'Nestos riparian forests', '', 6, 'Niveau 6', 10323, '/68/515/1403/4584/10323/17352', 'false', 'Hodja Orman forest of the Nestos, dominated by Populus alba, formerly one of the most extensive riparian complexes in the Balkans.', '', 'Pas de description disponible'),
(17353, 'NR', 22, '44.6152', '', '', 'Greek white poplar riparian forests', '', 6, 'Niveau 6', 10323, '/68/515/1403/4584/10323/17353', 'false', 'Other Populus alba riparian galleries.', '', 'Pas de description disponible'),
(17059, 'NR', 22, '41.5321', '', '', 'Sessile oak-pubescent birch-wood sorrel woods', '', 6, 'Niveau 6', 9773, '/68/492/1252/4176/9773/17059', 'false', 'More neutrocline formations, characteristic of argilous soils, shales, colluvions, till and fluvio-glacial deposits, dominated by Quercus petraea - occasionally Q. robur - , with Betula pubescens, B. pendula, Sorbus aucuparia, occasional Tilia cordata, Fraxinus excelsior; the bush layer is generally sparse, with Corylus avellana the most abundant species; grasses are prominent in the herb layer, in particular Holcus mollis, Deschampsia flexuosa, Anthoxanthum odoratum, Agrostis spp., Festuca spp.; Hyacynthoides non-scripta is often a typical vernal dominant; other components of the field layer, some characteristic of various subtypes, are Anemone nemorosa, Trientalis europaea, Viola riviniana, Oxalis acetosella, Galium saxatile, Potentilla erecta, Stellaria holostea, Hypericum pulchrum, Luzula sylvatica, Dryopteris dilatata, Blechnum spicant, Pteridium aquilinum. Bryophytes are abundant and varied, in particular, Rhytidiadelphus squarrosus, Pseudoscleropodium purum, Thuidium tamariscinum, Hylocomium splendens.', '', 'Pas de description disponible'),
(17060, 'NR', 22, '41.5322', '', '', 'Sessile oak-pubescent birch-Dicranum majus woodland', '', 6, 'Niveau 6', 9773, '/68/492/1252/4176/9773/17060', 'false', 'Highly acidophile formations characteristic of often shallow, strongly leached, soils developed over Palaeozoic sandstones and igneous rocks in cooler and wetter parts of western Britain, dominated by Quercus petraea - rarely Q. robur - with Betula pubescens, B. pendula, Sorbus aucuparia, occasional Tilia cordata, Fraxinus excelsior, Acer pseudoplatanus. Corylus avellana and occasional Ilex aquifolium, together with tree saplings form the bush layer. Grasses (mostly Deschampsia flexuosa), bracken and ericoid shrubs (Vaccinium myrtillus, Calluna vulgaris, Erica cinerea) constitute the herb layer. Bryophytes are abundant and varied, often forming a dense carpet that covers ground, rocks, roots and lower trunks of trees; Dicranum majus, Rhytidiadelphus loreus, Polytrichum formosum, Pleurosum schreberi, Plagiothecium undulatum are characteristic.', '', 'Pas de description disponible'),
(17061, 'NR', 22, '41.1751', 'Hêtraies à Buis', '', 'Box beech forests', '', 6, 'Niveau 6', 9771, '/68/492/1278/4175/9771/17061', 'true', 'Beech forests with an undergrowth dominated by Buxus sempervirens.', '', 'Hêtraies avec une strate inférieure dominée par Buxus sempervirens.'),
(17062, 'NR', 22, '41.1752', 'Hêtraies à Androsace', '', 'Androsace beech forests', '', 6, 'Niveau 6', 9771, '/68/492/1278/4175/9771/17062', 'true', 'Beech forests with a more reduced shrub layer and an herb layer characterized by the presence of the restricted southwestern Alpine endemics Androsace chaixii and Fritillaria involucrata.', '', 'Forêts de Hêtres avec une strate buissonnante plutôt réduite et une strate herbacée caractérisée par la présence des endémiques strictement alpines sud-occidentales Androsace chaixii et Fritillaria involucrata.'),
(17063, 'NR', 22, '41.1753', 'Hêtraies à Lavande', '', 'Lavender beech forests', '', 6, 'Niveau 6', 9771, '/68/492/1278/4175/9771/17063', 'true', 'Beech forests with Lavandula angustifolia.', '', 'Forêts de Hêtres avec Lavandula angustifolia.'),
(17064, 'NR', 22, '41.1754', 'Hêtraies de la Sainte-Baume', '', 'Sainte-Baume beech forest', '', 6, 'Niveau 6', 9771, '/68/492/1278/4175/9771/17064', 'true', 'Isolated, species-rich beech forest of the Sainte-Baume range of Provence, characterized by the strong representation of evergreen undergrowth, the development of the vegetation strata and the multiple waves of flowering. Among accompanying species are Taxus baccata, Ilex aquifolium, Acer opulifolium, Viburnum lantana, Coronilla emerus, Ruscus aculeatus, Mycelis muralis, Lilium martagon, Neottia nidus-avis, Helleborus foetidus, Digitalis lutea.', '', 'Hêtraies isolées de la Sainte-Baume dans la région provençale, floristiquement riche, caractérisée par la forte représentation d\'une sous-strate sempervirente, le développement de la végétation de cette strate et les sous-bois fleuris. Parmi les espèces accompagnatrices on peut citer Taxus baccata, Ilex aquifolium, Acer opalus, Viburnum lantana, Coronilla emerus, Ruscus aculeatus, Mycelis muralis, Lilium martagon, Neottia nidus-avis, Helleborus foetidus, Digitalis lutea.'),
(17065, 'NR', 22, '42.4211', 'Forêts de Pins de montagne à laîche humble', '', 'Dwarf sedge mountain pine forests', '', 6, 'Niveau 6', 9785, '/68/491/1254/4190/9785/17065', 'true', 'Xerophile adret Pinus uncinata forests of limestones and gypsums in the sub-alpine level of the inner Alps, with Carex humilis, Arctostaphylos uva-ursi.', '', 'Forêts xérophiles d\'adrets à Pinus uncinata sur calcaires et gypses de l\'étage subalpin des Alpes internes, avec Carex humilis, Arctostaphylos uva-ursi.'),
(17066, 'NR', 22, '42.4212', 'Forêts de Pins de montagne à Erica herbacea', '', 'Spring heath mountain pine forests', '', 6, 'Niveau 6', 9785, '/68/491/1254/4190/9785/17066', 'true', 'Meso-xerophile ubac Pinus uncinata forests of limestones and gypsums in the sub-alpine level of the inner Alps, with Erica herbacea, Amelanchier ovalis, Arctostaphylos uva-ursi, Carduus defloratus, Sesleria caerulea.', '', 'Forêts méso-xérophiles d\'ubac de Pinus uncinata sur calcaires et gypses de l\'étage subalpin des Alpes internes avec Erica herbacea, Amelanchier ovalis, Arctostaphylos uva-ursi, Carduus defloratus, Sesleria caerulea.'),
(17067, 'NR', 22, '42.1111', 'Sapinières à Oxalis', '', 'Sorrel fir forests', '', 6, 'Niveau 6', 9778, '/68/491/1260/4186/9778/17067', 'true', 'Typical inner Alpine formations with a predominance of mull-moder species such as Veronica latifolia, Melampyrum sylvaticum, Prenanthes purpurea, Oxalis acetosella, Luzula nivea; all fir forests of the intermediate and inner Alps can be included in this category with the exception of those that present clearly acidophilous or calciphilous facies and of the well-characterized local types listed immediately below.', '', 'Formations typiquement intra-alpines avec prédominance d\'espèces de mull-moder telles que Veronica latifolia, Melampyrum sylvaticum, Prenanthes purpurea, Oxalis acetosella, Luzula nivea ; toutes sapinières des Alpes intermédiaires et internes peuvent être incluses dans cette catégorie à l\'exception de celles qui présentent des faciès nettement acidiphiles ou calciphiles et des types locaux bien caractérisés codés immédiatement en dessous.'),
(17068, 'NR', 22, '42.1112', 'Sapinières à hautes herbes', '', 'Tall herb fir forests', '', 6, 'Niveau 6', 9778, '/68/491/1260/4186/9778/17068', 'true', 'High altitude, upper montane, tall-herb rich formations with Adenostyles alliariae, Geranium sylvaticum, Cicerbita alpina, Chaerophyllum villarsii, Peucedanum ostruthium, Alnus viridis and Sorbus aucuparia.', '', 'Formations de haute altitude, à l\'étage montagnard supérieur, riches en hautes herbes, avec Adenostyles alliariae, Geranium sylvaticum, Cicerbita alpina, Chaerophyllum villarsii, Peucedanum ostruthium, Alnus viridis, Sorbus aucuparia.'),
(17069, 'NR', 22, '42.1113', 'Sapinières à Trochiscanthes', '', 'Trochiscantes fir forests', '', 6, 'Niveau 6', 9778, '/68/491/1260/4186/9778/17069', 'true', 'Formations of the Maritime Alps with Trochiscanthes nodiflorus, Galium sylvaticum, Luzula pedemontana, Aquilegia atrata, Phyteuma halleri.', '', 'Formations des Alpes maritimes avec Trochiscanthes nodiflorus, Galium sylvaticum, Luzula pedemontana, Aquilegia atrata, Phyteuma halleri.'),
(17070, 'NR', 22, '41.5611', 'Chênaies acidiphiles pyrénéennes mésophiles', '', 'Mesophile Pyrenean acidophilous oak forests', '', 6, 'Niveau 6', 9791, '/68/492/1252/4189/9791/17070', 'true', 'Mesophile, typical formations.', 'Teucrio-Quercetum petraeae', 'Formations typiques mésophiles.'),
(17071, 'NR', 22, '41.5612', 'Chênaies acidiphiles pyrénéennes hygrophiles', '', 'Hygrophile Pyrenean acidophilous oak forests', '', 6, 'Niveau 6', 9791, '/68/492/1252/4189/9791/17071', 'true', 'Hygrophile formations, characteristic of humid ubacs and valley floors, with abundance of Vaccinium myrtillus and presence of beech forest species.', 'Veronico-Beuletum', 'Formations hygrophiles, caractéristiques des ombrées humides et des fonds de vallées, avec en abondance Vaccinium myrtillus et la présence d\'espèces de la hêtraie.'),
(17072, 'NR', 22, '41.5621', '', '', 'Eastern Cantabrian acidophilous oak forests', '', 6, 'Niveau 6', 9792, '/68/492/1252/4189/9792/17072', 'false', 'Cantabro - Euskaldian collinar to montane Quercus robur forests.', 'Tamo communis-Quercetum roboris', 'Pas de description disponible'),
(17073, 'NR', 22, '41.5622', '', '', 'Western Cantabrian acidophilous oak forests', '', 6, 'Niveau 6', 9792, '/68/492/1252/4189/9792/17073', 'false', 'Galicio - Asturian collinar to montane Quercus robur forests, richer in western Iberian species such as Linaria triornitophora, Omphalodes nitida, Saxifraga spathularis.', 'Blechno spicanti-Quercetum roboris', 'Pas de description disponible'),
(17074, 'NR', 22, '41.5623', '', '', 'Oro-Cantabrian acidophilous oak forests', '', 6, 'Niveau 6', 9792, '/68/492/1252/4189/9792/17074', 'false', 'Oro-Cantabrian montane Quercus petraea forests.', 'Linario triornitophorae-Quercetum petraeae', 'Pas de description disponible'),
(17075, 'NR', 22, '41.5631', '', '', 'Mesophile Luso-Galician collinar acidophilous oak forests', '', 6, 'Niveau 6', 9793, '/68/492/1252/4189/9793/17075', 'false', 'Widely distributed mesophile formations.', 'Rusco aculeati-Quercetum roboris p.', 'Pas de description disponible'),
(17076, 'NR', 22, '41.5632', '', '', 'Humid Luso-Galician collinar acidophilous oak forests', '', 6, 'Niveau 6', 9793, '/68/492/1252/4189/9793/17076', 'false', 'Meso-hygrophile formations rich in ferns, with Betula celtiberica and the northwestern Iberian endemic Narcissus cyclamineus, limited to valley situations in contact with riparian forests.', 'Narcisso cyclaminei-Quercetum roboris', 'Pas de description disponible'),
(17077, 'NR', 22, '42.4213', 'Forêts de Pins de montagne à Silène rupestre', '', 'Rock campion mountain pine forests', '', 6, 'Niveau 6', 9785, '/68/491/1254/4190/9785/17077', 'true', 'Pinus uncinata formations of dry, sunny siliceous slopes in the sub-alpine level of the inner Alps, with Silene rupestris, Vaccinium vitis-idaea, Juniperus nana, Sempervivum arachnoideum, Arctostaphylos uva-ursi.', '', 'Formations de Pinus uncinata sur des versants siliceux ensoleillés, secs, de l\'étage subalpin des Alpes internes, avec Silene rupestris, Vaccinium vitis-idaea, Juniperus nana, Sempervivum arachnoideum, Arctostaphylos uva-ursi.'),
(17078, 'NR', 22, '42.4214', 'Forêts de Pins de montagne sur amphilobites', '', 'Amphibolite mountain pine forests', '', 6, 'Niveau 6', 9785, '/68/491/1254/4190/9785/17078', 'true', 'Dry Pinus uncinata facies of pine woods developed on amphibolites in the Belledonne and Taillefer ranges.', '', 'Faciès secs à Pinus uncinata de pinèdes développées sur amphilobites dans les secteurs de Belledonne et du Taillefer.'),
(17079, 'NR', 22, '42.4215', 'Forêts de Pins de montagne à Ononis', '', 'Restharrow mountain pine forests', '', 6, 'Niveau 6', 9785, '/68/491/1254/4190/9785/17079', 'true', 'Pinus uncinata facies of montane Pinus sylvestris woods of inner Alpine valleys, developed, in particular on gypsum in Haute Maurienne and Tarentaise, and on stony calcareous slopes, screes, debris cones in Briançonnais.', 'Ononido-Pinetum uncinatae', 'Faciès à Pinus uncinata des forêts motagnardes de Pinus sylvestris des vallées internes des Alpes, développés, en particulier, sur gypse en Haute Maurienne et Tarentaise, et sur versants pierreux calcaires, éboulis et cônes de débris dans le Briançonnais.'),
(17080, 'NR', 22, '42.4221', 'Forêts externes xérophiles de Pins de montagne', '', 'Xerophile outer Alpine mountain pine forests', '', 6, 'Niveau 6', 9794, '/68/491/1254/4190/9794/17080', 'true', 'Sub-alpine xerophile, often pioneer or sub-climax formations of steep slopes and very drained soils, with Arctostaphylos uva-ursi, Juniperus nana, Amelanchier ovalis, Rhamnus alpinus, Cotoneaster integerrima, Dryas octopetala, Globularia cordifolia, Alchemilla hoppeana, Sesleria caerulea, Teucrium montanum, Biscutella laevigata, Saxifraga paniculata (S. aizoon).', '', 'Formations subalpines xérophiles, souvent pionnières ou sub-climaciques sur des versants escarpés et des sols biens drainés, avec Arctostaphylos uva-ursi, Juniperus nana, Amelanchier ovalis, Rhamnus alpinus, Cotoneaster integerrimus, Dryas octopetala, Globularia cordifolia, Alchemilla hoppeana, Sesleria caerulea, Teucrium montanum, Biscutella laevigata, Saxifraga paniculata (S. aizoon).'),
(17081, 'NR', 22, '42.4222', 'Forêts de Pins de montagne à Vaccinium', '', 'Vaccinium mountain pine forests', '', 6, 'Niveau 6', 9794, '/68/491/1254/4190/9794/17081', 'true', 'More mesophile sub-alpine formations of gentler slopes, with Vaccinium spp..', '', 'Formations subalpines plus mésophiles des versants plus doux, avec Vaccinium spp.'),
(17082, 'NR', 22, '42.4223', 'Forêts abyssales de Pins de montagne', '', 'Abyssal mountain pine forests', '', 6, 'Niveau 6', 9794, '/68/491/1254/4190/9794/17082', 'true', 'Pinus uncinata forests of the montane level of the Grande Chartreuse, the Vercors, the Jura and the Devoluy, developed mostly on screes of massive limestone blocks with trapped ice (block forests).', '', 'Forêts de Pinus uncinata de l\'étage montagnard de la Grande Chartreuse, du Vercors, du Jura et du Dévoluy, développées principalement sur éboulis ou blocs de calcaires compacts piégeant la glace.'),
(17083, 'NR', 22, '42.4241', 'Forêts de Pins de montagne à Véronique', '', 'Speedwell mountain pine forests', '', 6, 'Niveau 6', 9805, '/68/491/1254/4190/9805/17083', 'true', 'Pinus uncinata forests of siliceous Pyrenean adrets, on schists, granites or gneises, with Arctostaphylos uva-ursi, Juniperus nana, J. hemisphaerica, Calluna vulgaris, Genista pilosa, Cytisus purgans, Cotoneaster integerrimus and a predominantly acidophilous herb layer comprising Deschampsia flexuosa, Cruciata glabra, Festuca eskia, Veronica officinalis, Silene rupestris, Potentilla erecta, Antennaria dioica.', 'Veronico-Pinetum pinetosum uncinatae', 'Forêts de Pinus uncinata des soulanes Pyrénéennes, sur schistes, granites ou gneiss, avec Arctostaphylos uva-ursi, Juniperus nana, J. hemisphaerica, Calluna vulgaris, Genista pilosa, Cytisus purgans, Cotoneaster integerrimus et avec prédominance d\'une strate herbacée acidiphile comprenant Deschampsia flexuosa, Cruciata glabra, Festuca eskia, Veronica officinalis, Silene rupestris, Potentilla erecta, Antennaria dioica.'),
