(17137, 'NR', 22, '34.322I', 'Mesobromion du Quercy', '', 'Quercy Mesobromion', '', 6, 'Niveau 6', 9980, '/67/490/1236/4118/9980/17137', 'true', 'Closed mesophile calcareous grasslands of Quercy.', '', 'Pelouses calcaires mésophiles fermées du Quercy.'),
(17138, 'NR', 22, '34.322J', 'Mesobromion des Pyrénées occidentales', '', 'Western Pyrenean Mesobromion', '', 6, 'Niveau 6', 9980, '/67/490/1236/4118/9980/17138', 'true', 'Hill and montane mesophile calcareous grasslands of the western Pyrenees.', '', 'Pelouses calcaires mésophiles collinéennes et montagnardes des Pyrénées occidentales.'),
(17139, 'NR', 22, '34.322K', '', '', 'Western Iberian Mesobromion', '', 6, 'Niveau 6', 9980, '/67/490/1236/4118/9980/17139', 'false', 'Hill, montane and sometimes lower subalpine calcareous grasslands of the Picos de Europa, Cantabria, Asturias, Alava, Navarra dominated by Brachypodium pinnatum ssp. rupestre (to be listed as 34.323K) or by Bromus erectus, Carex brevicollis, Sesleria argentea, Helictotrichon cantabricum, Avenula vasconica, A. marginata, and often with Seseli montanum, S. cantabricum, Chamaespartium sagittale, Pulsatilla rubra ssp. hispanica, Phyteuma orbiculare ssp. hispanicum, Carduus argemone.', '', 'Pas de description disponible'),
(17140, 'NR', 22, '34.7131', 'Pelouses rases des Causses à Festuca', '', 'Causses short Festuca swards', '', 6, 'Niveau 6', 9891, '/67/490/1269/4253/9891/17140', 'true', 'Short, very open grasslands of the Causses dominated by Festuca auquieri, Ononis striata, or Thymus praecox.', 'Festucetum duriusculae calciense p., Astero-Anthyllidetum p.', 'Pelouses rases, très ouvertes des Causses dominées par Festuca auquieri, Ononis striata, ou Thymus praecox.'),
(17141, 'NR', 22, '34.7132', 'Pelouses rases des Causses à Carex-Anthyllis', '', 'Causses Carex-Anthyllis swards', '', 6, 'Niveau 6', 9891, '/67/490/1269/4253/9891/17141', 'true', 'Carex humilis-Anthyllis montana formations of small windswept buttes and stony knolls of the Causses with Aster alpinus var. cebennensis and Festuca auquieri.', 'Astero-Anthyllidetum montanae', 'Formations à Carex humilis-Anthyllis montana des petites buttes venteuses et monticules pierreux des Causses avec Aster alpinus var. cebennensis et Festuca auquieri.'),
(17142, 'NR', 22, '34.7133', 'Steppes méditerranéo-montagnardes franco-ibériennes', '', 'Franco-Iberian Mediterraneo-montane steppes', '', 6, 'Niveau 6', 9891, '/67/490/1269/4253/9891/17142', 'true', 'Other Mediterraneo-montane formations with Ononis striata, Anthyllis montana, Festuca spp. or Koeleria vallesiana, locally distributed in southern France and northeastern Spain.', '', 'Autres formations méditerranéo-montagnardes avec Ononis striata, Anthyllis montana, Festuca spp. ou Koeleria valesiana, distribuées localement dans le sud de la France.'),
(17143, 'NR', 22, '34.3261', 'Mesobromion pyrénéo-catalan', '', 'Pyreneo-Catalonian Mesobromion', '', 6, 'Niveau 6', 9909, '/67/490/1236/4118/9909/17143', 'true', 'Formations of the supra-Mediterranean and montane zones of the mountains of Catalonia and of the supra-Mediterranean and montane zones of the Pyrenees, where the absence of Brachypodium pinnatum separates them from the more western formations of 34.322-34.323.', '', 'Formations des étages montagnard et supra-méditerranéen des Pyrénées, où l\'absence de Brachypodium pinnatum les sépare des formations plus occidentales de 34.322-34.323.'),
(17144, 'NR', 22, '34.3262', 'Mesobromion des Corbières', '', 'Corbières Mesobromion', '', 6, 'Niveau 6', 9909, '/67/490/1236/4118/9909/17144', 'true', 'Widespread and diverse formations of the Corbières with, in particular, isolated populations of Ophrys catalaunica and Dactylorhiza insularis.', '', 'Formations diverses et largement répandues des Corbières avec, en particulier, des populations isolées d\'Ophrys catalaunica et Dactylorhiza insularis.'),
(17145, 'NR', 22, '34.3263', 'Mesobromion des Causses', '', 'Causses Mesobromion', '', 6, 'Niveau 6', 9909, '/67/490/1236/4118/9909/17145', 'true', 'Formations of the Causses; in the southern Causses they are mostly limited to the valleys where they occur at the base of slopes and, more rarely, on alluvial terraces; they also occupy the plateaux of the Causse de Sauveterre; the endemics Ophrys aveyronensis and O. aymonini find their optimal habitat in these communities (\"Orchideto-Brometum\").', '', 'Formations des Causses ; dans les Causses méridionaux elles sont principalement limitées aux vallées où elles sont présentes à la base des pentes et, plus rarement, sur les terrasses alluviales ; elles occupent aussi les plateaux du Causse de Sauveterre ; les endémiques Ophrys aveyronensis et O. aymoninii trouvent leur habitat optimal dans ces groupements (Orchideto-Brometum).'),
(17146, 'NR', 22, '34.3264', 'Mesobromion provençal', '', 'Provence Mesobromion', '', 6, 'Niveau 6', 9909, '/67/490/1236/4118/9909/17146', 'true', 'Local formations of the Mediterranean region of France developed on high plateaux, north-facing slopes and in clearings of pubescent oak woodlands.', '', 'Formations locales de la région méditerranéenne développées sur les hauts plateaux, sur des ubacs et dans les clairières des forêts de chênes pubescents.'),
(17147, 'NR', 22, '34.3265', 'Mesobromion des Alpes sud-occidentales', '', 'South-western Alpine Mesobromion', '', 6, 'Niveau 6', 9909, '/67/490/1236/4118/9909/17147', 'true', 'Formations occupying considerable surfaces of the supra-Mediterranean and montane zones of the southern Alps, where their line of demarcation from the grasslands of 32.322 can be, somewhat arbitrarily, placed at the line which, through the Col de Rousset, the Col de la Croix Haute and the Col Bayard, separates the southern Alps, including the Diois, from the northern Alps, including the Vercors.', '', 'Formations occupant des surfaces considérables dans les étages supra-méditerranéen et montagnard des Alpes méridionales, où leur distinction par rapport aux pelouses de 32.322 peut, quelque peu arbitrairement, correspondre à une ligne qui, passant par le col Rousset, le col de la Croix Haute et le col Bayard, sépare les Alpes du sud, Diois inclus, des Alpes du nord, Vercors compris.'),
(17148, 'NR', 22, '34.3266', '', '', 'Northern Apennine Mesobromion', '', 6, 'Niveau 6', 9909, '/67/490/1236/4118/9909/17148', 'false', 'Local formations of the northern Apennines, in particular in Liguria and in Tuscany.', '', 'Pas de description disponible'),
(17149, 'NR', 22, '36.3611', '', '', 'Cantabrian acidophilous stripped grasslands', '', 6, 'Niveau 6', 9927, '/67/495/1297/4265/9927/17149', 'false', 'Festuca indigesta and Festuca eskia grasslands of the oro- Mediterranean, cryoro-Mediterranean and subalpine levels of the antabrian mountains and other high mountains of the northwest.', 'Teesdaliopsio confertae-Festucetum indigestae, Teesdaliopsio confertae-Festucetum eskiae', 'Pas de description disponible'),
(17150, 'NR', 22, '36.3612', '', '', 'Iberian Range acidophilous stripped grasslands', '', 6, 'Niveau 6', 9927, '/67/495/1297/4265/9927/17150', 'false', 'Festuca indigesta grasslands of the oro- and cryoro-Mediterranean levels of the Iberian Range.', 'Antennario dioicae-Festucetum indigestae', 'Pas de description disponible'),
(17151, 'NR', 22, '36.3613', '', '', 'Cordilleran Festuca stripped grasslands', '', 6, 'Niveau 6', 9927, '/67/495/1297/4265/9927/17151', 'false', 'Festuca indigesta and Festuca summilusitana grasslands of the oro- and cryoro-Mediterranean levels of the Cordillera Central.', 'Hieracio castellanae-Festucetum indigestae, Hieracio myriadeni-Festucetum indigestae, Arenario querioidis-Festucetum summilusitanae', 'Pas de description disponible'),
(17152, 'NR', 22, '36.3614', '', '', 'Cordilleran Agrostis stripped grasslands', '', 6, 'Niveau 6', 9927, '/67/495/1297/4265/9927/17152', 'false', 'Agrostis rupestris grasslands of the cryoro-Mediterranean level of the Cordillera Central.', 'Agrostio rupestris-Armerietum bigerrensis', 'Pas de description disponible'),
(17153, 'NR', 22, '36.3615', '', '', 'Nevadan Festuca indigesta stripped grasslands', '', 6, 'Niveau 6', 9927, '/67/495/1297/4265/9927/17153', 'false', 'Psychro-xerophile garland grasslands of Festuca indigesta, Thymus serpylloides, and Arenaria tetraquetra var. granatensis, widespread in the oro-Mediterranean level (2000-2900 metres) of the Sierra Nevada.', 'Arenario granatensis-Festucetum indigestae', 'Pas de description disponible'),
(17154, 'NR', 22, '36.3616', '', '', 'Nevadan Agrostis stripped grasslands', '', 6, 'Niveau 6', 9927, '/67/495/1297/4265/9927/17154', 'false', 'Chionophilous grasslands with Agrostis nevadensis and Armeria splendens of depressions and sheltered areas within the oro-Mediterranean level of the Sierra Nevada, often in contact with, and forming a transition to, the closed mat-grass swards of 36.362.', 'Armerio splendentis-Agrostietum nevadensis', 'Pas de description disponible'),
(17155, 'NR', 22, '36.3617', '', '', 'Nevadan tall fescue stripped grasslands', '', 6, 'Niveau 6', 9927, '/67/495/1297/4265/9927/17155', 'false', 'Pioneer grasslands formed by the robust Festuca pseudeskia and F. paniculata on steep slopes submitted to intense insolation and severe erosion of the oro-Mediterranean and locally cryoro-Mediterranean levels of the Sierra Nevada.', 'Festucetum spadiceo-pseudeskiae', 'Pas de description disponible'),
(17156, 'NR', 22, '36.3618', '', '', 'Nevadan Festuca clementei stripped grasslands', '', 6, 'Niveau 6', 9927, '/67/495/1297/4265/9927/17156', 'false', 'Psychro-xerophile grasslands of the cryoro-Mediterranean level (above 2900 m) of the Sierra Nevada, formed by Festuca clementei, Erigeron frigidus, Artemisia granatensis, Ptilotrichum purpureum, Papaver lapeyrousianum, all, except the last, Sierra Nevada endemics.', 'Erigeronto frigidi-Festucetum clementei', 'Pas de description disponible'),
(17157, 'NR', 22, '36.3619', '', '', 'Nevadan Trisetum stripped grasslands', '', 6, 'Niveau 6', 9927, '/67/495/1297/4265/9927/17157', 'false', 'Communities of wind-beaten crests of the Sierra Nevada, with Trisetum glaciale and Galium pyrenaicum.', 'Galio pyrenaici-Trisetetum glacialis', 'Pas de description disponible');
INSERT INTO `corine` (`CD_HAB`, `FG_VALIDITE`, `CD_TYPO`, `LB_CODE`, `LB_HAB_FR`, `LB_HAB_FR_COMPLET`, `LB_HAB_EN`, `LB_AUTEUR`, `NIVEAU`, `LB_NIVEAU`, `CD_HAB_SUP`, `PATH_CD_HAB`, `FRANCE`, `LB_DESCRIPTION`, `CRSP_PHYTO_CB91`, `DESCRIPTIF_CB97_FR`) VALUES
(17158, 'NR', 22, '36.3621', '', '', 'Cantabrio-Cordilleran oro-Mediterranean mat-grass swards', '', 6, 'Niveau 6', 9929, '/67/495/1297/4265/9929/17158', 'false', 'Hygrophile and chionophile, closed grasslands of the oro- and cryoro- Mediterranean levels of the Cordillera Central and of the high Orensano-Sanabrian mountains, and of the subalpine level of the Cantabrian mountains, with Nardus stricta, Festuca iberica, Juncus squarrosus, Luzula campestris ssp. carpetana, Campanula herminii.', 'Campanulo-Nardion p., Poo legionensis-Nardetum, Campanulo herminii-Trifolietum alpini, Luzulo carpetanae-Juncetum squarosi, Campanulo herminii-Festucetum ibericae, Campanulo herminii-Nardetum strictae', 'Pas de description disponible'),
(17159, 'NR', 22, '36.3622', '', '', 'Nevadan borreguiles', '', 6, 'Niveau 6', 9929, '/67/495/1297/4265/9929/17159', 'false', 'Dense hygrophilous grasslands occupying humid flats around lakes, gullies, glacial basins, depressions at the oro- and cryoro-Mediterranean levels of the Sierra Nevada, with Nardus stricta, Festuca hispanica, Agrostis nevadensis, Plantago nivalis, Carex intricata, Ranunculus acetosellifolius, Vaccinium uliginosus, Lotus glareosus, Leontodon microcephalus, Galium nevadense, Gentiana boryi, Meum nevadense, Jasione crispa ssp. amethystina, many of which Sierra Nevada endemics.', 'Plantaginion nivalis: Nardo strictae-Festucetum ibericae, Ranunculo acetosellifolii-Vaccinietum uliginosi', 'Pas de description disponible'),
(17160, 'NR', 22, '34.3321', 'Xerobromion mosan', '', 'Mosan Xerobromion', '', 6, 'Niveau 6', 9936, '/67/490/1236/4269/9936/17160', 'true', 'Xerophile grasslands of the north-western Hercynian periphery, on mostly Devonian or Carboniferous limestones, in the Mosan district of Belgium and the French Meuse, with outposts in the Ardenne-Eifel of Luxembourg and Rhineland; the stations are for the most part very limited in extent and widely isolated.', '', 'Pelouses xérophiles du nord-ouest de la périphérie hercynienne, principalement sur des calcaires du dévonien ou du carbonifère, dans le district mosan de la Belgique, et la Meuse française ; les stations sont pour la plupart très limitées en étendue et très isolées.'),
(17161, 'NR', 22, '34.3322', '', '', 'Harz Xerobromion', '', 6, 'Niveau 6', 9936, '/67/490/1236/4269/9936/17161', 'false', 'Xerophile grasslands, on substrates derived from Mesozoic limestones of the periphery of the Harz, notably in Thuringe.', '', 'Pas de description disponible'),
(17162, 'NR', 22, '34.3323', 'Xerobromion du Bassin parisien crétacé', '', 'Paris basin Cretaceous Xerobromion', '', 6, 'Niveau 6', 9936, '/67/490/1236/4269/9936/17162', 'true', 'Xerophile grasslands of rare localities of the Cretaceous northwestern and western periphery of the Paris basin, in particular in the valleys of the Seine and Somme.', '', 'Pelouses xérophiles de rares localités de la périphérie nord-ouest et ouest sur crétacé du bassin de Paris, en particulier dans les vallées de la Seine et de la Somme.'),
(17163, 'NR', 22, '34.3324', 'Xerobromion du Tertiaire parisien', '', 'Parisian Tertiary Xerobromion', '', 6, 'Niveau 6', 9936, '/67/490/1236/4269/9936/17163', 'true', 'Xerophile calcareous grasslands of the Parisian Tertiary in the central Paris basin.', '', 'Pelouses calcaires xérophiles du Tertiaire parisien dans le centre du bassin de Paris.'),
(17164, 'NR', 22, '34.3325', 'Xerobromion du Bassin parisien jurassique', '', 'Paris basin Jurassic Xerobromion', '', 6, 'Niveau 6', 9936, '/67/490/1236/4269/9936/17164', 'true', 'Xerophile grasslands of the north-eastern, eastern and south-eastern Jurassic belt of the Paris basin and adjacent Cretaceous areas in Lorraine, Champagne, Haute Marne, Burgundy, Haute Saône.', '', 'Pelouses xérophiles du nord-est, de l\'est et du sud-est de la ceinture jurassique du Bassin parisien et des régions crétacées adjacentes de Lorraine, Champagne, Haute-Marne, Bourgogne, Haute-Saône.'),
(17165, 'NR', 22, '34.3326', 'Xerobromion du Rhin moyen', '', 'Middle Rhine Xerobromion', '', 6, 'Niveau 6', 9936, '/67/490/1236/4269/9936/17165', 'true', 'Xerophile calcareous grasslands of the Rhine, Mainz, Moselle, Neckar, Nahe and Lahn valleys in their crossing of the northern Hercynian ranges.', '', 'Pelouses xérophiles calcaires du Rhin, de la Moselle, ..., à leur traversée des massifs hercyniens septentrionaux.'),
(17166, 'NR', 22, '34.3327', 'Xerobromion du Rhin supérieur', '', 'Upper Rhine Xerobromion', '', 6, 'Niveau 6', 9936, '/67/490/1236/4269/9936/17166', 'true', 'Xerophile calcareous grasslands of the upper Rhine rift and adjacent hills, in Alsace and Baden-Württemberg.', '', 'Pelouses xérophiles calcaires du fossé du haut Rhin et des collines adjacentes, en Alsace.'),
(17167, 'NR', 22, '34.3328', 'Xerobromion du Jura français', '', 'French Jura Xerobromion', '', 6, 'Niveau 6', 9936, '/67/490/1236/4269/9936/17167', 'true', 'Xerophile calcareous grasslands of the French Jura and adjacent areas.', '', 'Pelouses xérophiles calcaires du Jura français et des régions adjacentes.'),
(17168, 'NR', 22, '34.3329', '', '', 'Swabian Xerobromion', '', 6, 'Niveau 6', 9936, '/67/490/1236/4269/9936/17168', 'false', 'Xerophile calcareous grasslands of the Swabian Alb, Lake Constance region and adjacent areas.', '', 'Pas de description disponible'),
(17169, 'NR', 22, '34.332A', '', '', 'Franconian Xerobromion', '', 6, 'Niveau 6', 9936, '/67/490/1236/4269/9936/17169', 'false', 'Xerophile calcareous grasslands of the Franconian Alb, Franconian plateaux and adjacent areas.', '', 'Pas de description disponible'),
(17170, 'NR', 22, '34.332B', 'Xerobromion des Préalpes du nord-ouest', '', 'North-western pre-Alpine Xerobromion', '', 6, 'Niveau 6', 9936, '/67/490/1236/4269/9936/17170', 'true', 'Hill and montane xerophile grasslands of the northwestern calcareous pre-Alps.', '', 'Pelouses xérophiles collinéennes et montagnardes du nord-ouest des Préalpes calcaires.'),
(17171, 'NR', 22, '34.332C', '', '', 'Bavarian Xerobromion', '', 6, 'Niveau 6', 9936, '/67/490/1236/4269/9936/17171', 'false', 'Hill and montane xerophile calcareous grasslands of the Bavarian plateau.', '', 'Pas de description disponible'),
(17172, 'NR', 22, '34.332D', 'Xerobromion ligérien', '', 'Ligerian Xerobromion', '', 6, 'Niveau 6', 9936, '/67/490/1236/4269/9936/17172', 'true', 'Xerophile calcareous grasslands of the southern Paris basin, Berry and Auvergne.', '', 'Pelouses calcaires xérophiles du sud du bassin de Paris, du Berry et de l\'Auvergne.'),
(17173, 'NR', 22, '34.332E', 'Xerobromion aquitanien', '', 'Aquitanian Xerobromion', '', 6, 'Niveau 6', 9936, '/67/490/1236/4269/9936/17173', 'true', 'Xerophile calcareous grasslands of southwestern France in Charentes, Perigord and Aquitaine.', '', 'Pelouses calcaires xérophiles de la France du sud-ouest : Charentes, Périgord et Aquitaine.'),
(17174, 'NR', 22, '34.332F', 'Xerobromion du Quercy', '', 'Quercy Xerobromion', '', 6, 'Niveau 6', 9936, '/67/490/1236/4269/9936/17174', 'true', 'Xerophile calcareous grasslands of Quercy.', '', 'Pelouses xérophiles calcaires du Quercy.'),
(16828, 'NR', 22, '15.1111', 'Gazons à salicorne des côtes basses', '', 'Low shore samphire flats', '', 6, 'Niveau 6', 9334, '/65/477/1189/3895/9334/16828', 'true', 'Colonies of non-reddening tetraploid glassworts Salicornia dolichostachya, S. fragilis, S. decumbens and of Suaeda maritima ssp. flexilis, occupying the lowest, dampest areas of northern and western coastal flats.', 'Salicornion dolichostachyo-fragilis', 'Colonies de salicornes tétraploïdes non rougissantes Salicornia oliveri, S. procumbens et de Suaeda albescens, occupant les niveaux les plus bas et les plus mouillés de la partie supérieure (haute slikke) des vasières côtières septentrionales et occidentales.'),
(16829, 'NR', 22, '15.1112', 'Groupements à Suaeda et salicorne', '', 'Seablite-samphire communities', '', 6, 'Niveau 6', 9334, '/65/477/1189/3895/9334/16829', 'true', 'Colonies of often much-branched, diploid glassworts Salicornia ramosissima, S. europaea, S. obscura i.a. and/or of Suaeda maritima, occupying higher, drier areas of coastal flats.', 'Salicornion europaeo-ramosissimae p. (Thero-Suaedion auct.)', 'Colonies de salicornes diploïdes, souvent fortement ramifiés Salicornia appressa, S. europea, S. obscura i.a. et/ou de Suaeda maritima, occupant les zones les plus élevées, les moins inondées ou les plus ressuyées des vasières côtières.'),
(16830, 'NR', 22, '15.1121', 'Suintements continentaux à salicorne', '', 'Continental glasswort seeps', '', 6, 'Niveau 6', 9335, '/65/477/1189/3895/9335/16830', 'true', 'Colonies of the orange-turning Salicornia emerici var. vicensis, of unstable, fluid, seeping muds.', 'Salicornietum vicensis', 'Colonies de Salicornia emerici var. vicensis tournant à l\'orange en automne, des vases instables, fluides et continuellement suintantes.'),
(16831, 'NR', 22, '15.1122', 'Gazons continentaux secs à salicorne', '', 'Continental drier glasswort swards', '', 6, 'Niveau 6', 9335, '/65/477/1189/3895/9335/16831', 'true', 'Colonies of the reddening Salicornia ramosissima or of S. europaea, of firmer ground.', 'Salicornietum ramosissimae lotharingiense, Puccinellio distantis-Salicornietum europaeae p.', 'Colonies de la rougeoyante Salicornia appressa ou de S. europaea, des sols dénudés salés s\'asséchant en été.'),
(16832, 'NR', 22, '15.1131', 'Gazons à salicorne des basses côtes méditerranéennes', '', 'Low-shore Mediterranean glasswort swards', '', 6, 'Niveau 6', 9336, '/65/477/1189/3895/9336/16832', 'true', 'Formations dominated by the reddening tetraploid glasswort Salicornia emerici occupying long-inundated basins of Mediterranean, southwestern French and Iberian coastal saltmarshes.', 'Salicornion emerici p.', 'Formations dominées par la salicorne rougeoyante tétraploïde Salicornia emerici occupant les bassins de la Méditerranée longuement inondés, des marais salés ibériques et du sud-ouest de la France.'),
(16833, 'NR', 22, '15.1132', '', '', 'Venetian glasswort swards', '', 6, 'Niveau 6', 9336, '/65/477/1189/3895/9336/16833', 'false', 'Endemic, threatened Salicornia veneta swards of basins of the Venice lagoon.', 'Salicornion emerici p.: Salicornietum veneti', 'Pas de description disponible'),
(17175, 'NR', 22, '34.332G', 'Xerobromion pyrénéen', '', 'Pyrenean Xerobromion', '', 6, 'Niveau 6', 9936, '/67/490/1236/4269/9936/17175', 'true', 'Hill and montane xerophile calcareous grasslands of the Pyrenees and adjacent areas; in the pubescent oak level of the eastern part of the range Xerobromion grasslands with Koeleria vallesiana, Festuca ovina s.l. and Bromus erectus come in contact with Aphyllanthion formations occupying more humid soils and closed postcultural Brachypodium grasslands of the Brachypodion phoenicoidis. On the south side of the range, xerophile pastures are represented in lower zones and on the protected adrets by communities of the Aphyllanthion, of decidedly Mediterranean hue, while the formations of the Xerobromion, of more Euro-Siberian character, occupy the other situations. Chamaephytes such as Helianthemum nummularium, Artemisia alba, Teucrium pyrenaicum, Ononis spinosa, O. natrix are abundant alongside the gramineous Phleum phleoides, Festuca ovina s.l., and Carex humilis.', '', 'Pelouses xérophiles calcaires collinéennes et montagnardes des Pyrénées et des régions adjacentes ; à l\'étage du chêne pubescent dans la partie orientale de leur aire de distribution, les pelouses du Xerobromion avec Koeleria vallesiana, Festuca ovina s.l. et Bromus erectus viennent au contact des formations de l\'Aphyllanthion occupant des sols plus humides, et des pelouses post-culturales compactes à Brachypodium du Brachypodion phoenicoidis. Dans la partie sud de l\'aire, des pâturages xérophiles sont représentés dans les zones inférieures et sur les versants abrités exposés au sud (adrets) par des groupements de l\'Aphyllanthion, de nuance incontestablement méditerranéenne, tandis que les formations du Xerobromion, de caractère plus euro-sibérien, occupent les autres stations. Les chaméphytes tels que Helianthemum nummularium, Artemisia alba, Teucrium pyrenaicum, Ononis spinosa, O. natrix sont abondants aux côtés des graminées Phleum phleoides, Festuca ovina s.l. et Carex humilis.'),
(17176, 'NR', 22, '34.332H', 'Xerobromion des Alpes sud-occidentales', '', 'South-western Alpine Xerobromion', '', 6, 'Niveau 6', 9936, '/67/490/1236/4269/9936/17176', 'true', 'Xerobromion grasslands of the southwestern Alps.', '', 'Pelouses du Xerobromion du sud-ouest des Alpes.'),
(17177, 'NR', 22, '41.1121', '', '', 'Bayerischer Wald woodrush beech forests', '', 6, 'Niveau 6', 9941, '/68/492/1278/4288/9941/17177', 'false', 'Near-natural forests of the Bayerischer Wald.', '', 'Pas de description disponible'),
(17178, 'NR', 22, '41.1122', 'Hêtraies montagnardes semi-naturelles à Luzule françaises', '', 'Semi-natural montane woodrush beech forests', '', 6, 'Niveau 6', 9941, '/68/492/1278/4288/9941/17178', 'true', 'Other formations.', '', 'Autres formations.'),
(17179, 'NR', 22, '36.4111', 'Pelouses à laîche sempervirente des Alpes', '', 'Alpine evergreen sedge grasslands', '', 6, 'Niveau 6', 9944, '/67/495/1277/4287/9944/17179', 'true', '', '', 'Pas de description disponible'),
