(17181, 'NR', 22, '34.332I', '', '', 'Northern Apennine Xerobromion', '', 6, 'Niveau 6', 9936, '/67/490/1236/4269/9936/17181', 'false', 'Open, arid pastures developed in the thermophilous deciduous Quercus cerris-Q. pubescens-Ostrya carpinifolia belt of the northern Apennines, south approximately to the area of the Monte della Luna, southeastern Tuscany, where they occupy arenaceous-marly substrates and come in contact with the grasslands of unit 34.74, located on limestones and much richer in Apennine endemics. At their southern limit, the northern formations are rich in chamaephytes, notably Coronilla minima, Asperula purpurea, Fumana procumbens, alongside Astragalus monspessulanus, Bromus erectus, Brachypodium pinnatum and Festuca inops.', 'Coronillo minimae-Astragaletum monspessulani, \"Xerobrometum apenninum\"', 'Pas de description disponible'),
(17182, 'NR', 22, '36.4141', 'Pelouses alpines à fétuque violette', '', 'Alpine violet fescue swards', '', 6, 'Niveau 6', 9949, '/67/495/1277/4287/9949/17182', 'true', 'Alpine formations with Festuca violacea, Trifolium thalii, T. badium, Trollius europaeus, Linum alpinum, Anemone narcissiflora, Onobrychis montana, Lathyrus laevigatus, Oxytropis campestris, O. triflora, Pedicularis verticillata, Phyteuma orbiculata; usually grazed, they tend, with increased fertilization, towards the pastures of the Poion alpinae (36.52).', '', 'Formations alpines avec Festuca violacea, Trifolium thalii, T. badium, Trollius europaeus, Linum alpinum, Anemone narcissiflora, Onobrychis montana, Lathyrus laevigatus, Oxytropis campestris, Pedicularis verticillata, Phyteuma orbiculare ; habituellement pâturées, elles tendent, avec une fertilisation accrue, vers les pâtures du Poion alpinae (36.52).'),
(17183, 'NR', 22, '36.4142', 'Pelouses pyrénéennes à fétuque noircissante', '', 'Pyrenean blackish fescue swards', '', 6, 'Niveau 6', 9949, '/67/495/1277/4287/9949/17183', 'true', 'Eastern Pyrenean formations with Festuca nigrescens (F. rubra ssp. commutata) and Trifolium thalii.', '', 'Formations des Pyrénées orientales avec Festuca nigrescens (F. rubra subsp. commutata) et Trifolium thalii.'),
(17184, 'NR', 22, '36.4143', '', '', 'Apennine violet fescue swards', '', 6, 'Niveau 6', 9949, '/67/495/1277/4287/9949/17184', 'false', 'Calciphilous extremes of the closed Apennine grasslands, dominated by Festuca violacea ssp. macrathera and Trifolium thalii (see 36.382).', '', 'Pas de description disponible'),
(17185, 'NR', 22, '36.4311', 'Pelouses alpines à Seslérie et Laîche sempervirente', '', 'Alpine blue moorgrass-evergreen sedge swards', '', 6, 'Niveau 6', 9958, '/67/495/1277/4310/9958/17185', 'true', 'Widespread calciphilous formations of the Alps.', 'Seslerio-Caricetum sempervirentis = Seslerio-Sempervirentum', 'Formations calcicoles des Alpes largement répandues.'),
(17186, 'NR', 22, '36.4312', 'Pelouses à Seslérie et Laîche sempervirente du Jura', '', 'Jura blue moorgrass - evergreen sedge swards', '', 6, 'Niveau 6', 9958, '/67/495/1277/4310/9958/17186', 'true', 'Very local formations of the high Jura.', 'Laserpitio-Seslerietum', 'Formations très locales du haut Jura.'),
(17187, 'NR', 22, '36.1111', 'Communautés acidiphiles des combes à neige alpines à mousses', '', 'Alpine acid moss snow-patch communities', '', 6, 'Niveau 6', 9963, '/67/495/1292/4313/9963/17187', 'true', 'Moss snow-patches of the Alps and Pyrenees, occupying areas free from snow for less than two months, with the mosses Polytrichum sexangularis, P. juniperinum, Pohlia commutata, Kiaeria falcata (Dicranum falcatum), the liverwort Anthelia juratzkana or sometimes lichens.', 'Polytrichetum sexangularis, Polytrichetum norvegici', 'Combes à neige à Bryophytes des Alpes et des Pyrénées, occupant des surfaces libres de neige moins de deux mois par an, avec les mousses Polytrichum sexangularis, P. juniperinum, Pohlia commutata, Kiaeria falcata (Dicranum falcatum), l\'hépatique Anthelia juratzkana ou quelquefois des lichens.'),
(17188, 'NR', 22, '36.1112', 'Communautés acidiphiles des combes à neige alpines à Saule nain', '', 'Alpine acid dwarf willow snow-patch communities', '', 6, 'Niveau 6', 9963, '/67/495/1292/4313/9963/17188', 'true', 'Dwarf willow (Salix herbacea) snow-patches of the Alps and Pyrenees, occupying areas covered by snow for eight to ten months.', 'Salicetum herbaceae, Anthelio-Salicetum herbaceae', 'Combes à neige à Saule nain (Salix herbacea) des Alpes et des Pyrénées, occupant des zones couvertes par la neige pendant huit à dix mois.'),
(17189, 'NR', 22, '36.1113', 'Communautés acidiphiles de combes à neige alpines à Carex-Gnaphalium', '', 'Alpine acid Carex-Gnaphalium snow-patch communities', '', 6, 'Niveau 6', 9963, '/67/495/1292/4313/9963/17189', 'true', 'Communities of areas covered by snow for six to eight months, with Carex foetida (western Alps), Alopecurus gerardii, Omalotheca supina (Gnaphalium supinum) (including O. supina var. pusilla), Lepidium stylatum, Alchemilla pentaphylla, Sedum candollei (Mucizonia sedoides, Umbellicus sedoides), S. alpestre, Cardamine alpina, Carex pyrenaica; they extend to the subalpine level and include the isolated cryoro-Mediterranean formations of the Cordillera Central and the Sierra Nevada.', 'Caricetum foetidae, Alopecuro-Caricetum foetideae, Cardamino alpinae-Gnaphalietum supini, Cerastio-Mniobryetum, Gnaphalio-Sedetum candollei, Sedo-Gnaphalietum pusilli, Omalotheco pusillae-Lepidietum stylati i.a.', 'Communautés des zones couvertes de neige pendant six à huit mois, avec Carex foetida (Alpes occidentales), Alopecurus gerardii, Omalotheca (Gnaphalium) supina (incluant O. supina var. pusilla), Alchemilla pentaphylla, Sedum candollei (Mucizonia sedoides, Umbellicus sedoides), S. alpestre, Cardamine alpina, Carex pyrenaica ; elles s\'étendent à l\'étage subalpin'),
(17190, 'NR', 22, '34.5131', 'Communautés annuelles calciphiles de l\'ouest méditerranéen', '', 'Western Mediterranean calciphile annual communities', '', 6, 'Niveau 6', 9962, '/67/490/1291/4312/9962/17190', 'true', 'Thermo- meso- and occasionally supra-Mediterranean calciphile formations of Mediterranean France, Iberia and Italy.', 'Thero-Brachypodion = Trachynion distachyae', 'Formations calciphiles thermo-, méso- et occasionnellement supra-méditerranéennes de la France méditerranéenne.'),
(17191, 'NR', 22, '34.5132', '', '', 'South-eastern Iberian pre-desert annual communities', '', 6, 'Niveau 6', 9962, '/67/490/1291/4312/9962/17191', 'false', 'Ephemereal formations of the arid Iberian southeast, appearing among the pre-desert scrub communities of 32.25.', 'Stipion capensis', 'Pas de description disponible'),
(17192, 'NR', 22, '34.5133', '', '', 'Iberian gypsum annual communities', '', 6, 'Niveau 6', 9962, '/67/490/1291/4312/9962/17192', 'false', 'Formations of small annuals developing on gypsum soils of interior Iberia, among the gypsum-scrub communities of 15.19.', 'Sedo-Ctenopsion gypsophilae', 'Pas de description disponible'),
(17193, 'NR', 22, '34.5134', '', '', 'Andalusian magnesium annual communities', '', 6, 'Niveau 6', 9962, '/67/490/1291/4312/9962/17193', 'false', 'Formations on dolomites, ophiolites, peridotites and serpentines of Andalusia, developing among garrigue communities of 32.28.', 'Omphalodion brassicifoliae', 'Pas de description disponible'),
(17194, 'NR', 22, '34.5135', '', '', 'Sicilian saxicolous annual communities', '', 6, 'Niveau 6', 9962, '/67/490/1291/4312/9962/17194', 'false', 'Formations of Sicily, Linosa, Lampedusa and Pantelleria, sometimes subhalophile, developed on steep slopes, exposed crests, coastal rocks and volcanic material, often among the rocky shore communities of 18.22 or the pre-desert scrub of 32.255.', 'Plantagini-Catapodion marini', 'Pas de description disponible'),
(17195, 'NR', 22, '34.5136', '', '', 'Northern Sicilian aster annual communities', '', 6, 'Niveau 6', 9962, '/67/490/1291/4312/9962/17195', 'false', 'Aster sorrentini formations of steep clay and marl slopes of northern Sicily.', 'Dauco-Catananchion luteae: Asteretum sorrentinii', 'Pas de description disponible'),
(16834, 'NR', 22, '15.1133', 'Gazons à salicorne des hautes côtes méditerranéennes', '', 'Upper shore Mediterranean glasswort swards', '', 6, 'Niveau 6', 9336, '/65/477/1189/3895/9336/16834', 'true', 'Formations dominated by the reddening diploid glasswort Salicornia patula occupying firmer, drier muds of Mediterranean, southwestern French and Iberian coastal saltmarshes.', 'Salicornion patuli', 'Formations dominées par la salicorne rougeoyante diploïde Salicornia patula occupant les vases sèches, stables des marais salés côtiers méditerranéens, ibériques et du sud-ouest de la France.'),
(16835, 'NR', 22, '15.1141', '', '', 'Microcnemum swards', '', 6, 'Niveau 6', 9337, '/65/477/1189/3895/9337/16835', 'false', 'Formations of the endemic Microcnemum coralloides ssp. coralloides, associated or not with Salicornia europaea s. l., of interior salt basins of central and east-central Spain.', '', 'Pas de description disponible'),
(16836, 'NR', 22, '15.1142', '', '', 'Iberian interior Salicornia swards', '', 6, 'Niveau 6', 9337, '/65/477/1189/3895/9337/16836', 'false', 'Formations of Salicornia europaea s. l. of interior salt basins of Iberia.', '', 'Pas de description disponible'),
(16837, 'NR', 22, '16.2111', 'Dunes embryonnaires atlantiques', '', 'Atlantic embryonic dunes', '', 6, 'Niveau 6', 9343, '/65/478/1195/3900/9343/16837', 'true', 'Embryonic dunes of the Atlantic, the North Sea and the Baltic coasts, with Elymus farctus (Agropyron junceum) accompanied by Leymus arenarius in the north, by Euphorbia paralias on middle and southern Atlantic shores.', 'Elymo-Agropyretum juncei, Euphorbio-Agropyretum juncei', 'Dunes embryonnaires des côtes de l\'Atlantique, de la mer du Nord et de la mer Baltique, avec Elytrigia juncea (Elymus farctus) accompagné par Leymus arenarius au nord, par Euphorbia paralias sur le littoral de l\'Atlantique « centre » et « sud ».'),
(16838, 'NR', 22, '16.2112', 'Dunes embryonnaires méditerranéennes', '', 'Mediterranean embryonic dunes', '', 6, 'Niveau 6', 9343, '/65/478/1195/3900/9343/16838', 'true', 'Embryonic dunes of the Mediterranean coasts, on which Elymus farctus is accompanied by Sporobolus pungens, Euphorbia peplis, Otanthus maritimus, Medicago marina, Anthemis maritima, A. tomentosa, Eryngium maritimum, Pancratium maritimum.', 'Agropyrion juncei: Agropyretum mediterraneum', 'Dunes embryonnaires des côtes méditerranéennes, sur lesquelles Elytrigia juncea est accompagné par Sporobolus pungens, Euphorbia peplis, Otanthus maritimus, Medicago marina, Anthemis maritima, Eryngium maritimum, Pancratium maritimum.'),
