(16841, 'NR', 22, '15.6152', '', '', 'Interior glaucous glasswort scrubs', '', 6, 'Niveau 6', 9358, '/65/477/1185/3883/9358/16841', 'false', 'Arthrocnemum glaucum formations of Iberian interior salt basins.', '', 'Pas de description disponible'),
