(16843, 'NR', 22, '16.2121', 'Dunes blanches de l\'Atlantique', '', 'Atlantic white dunes', '', 6, 'Niveau 6', 9377, '/65/478/1195/3900/9377/16843', 'true', 'White dunes of the North Sea, the Baltic and the Atlantic coasts, dominated, when vegetated, by marram grass (Ammophila arenaria) accompanied by, among others, Eryngium maritimum, Euphorbia paralias, Calystegia soldanella, Otanthus maritimus.', 'Ammophilion arenariae: Elymo-Ammophiletum, Euphorbio-Ammophiletum, Othanto-Ammophiletum', 'Dunes blanches des côtes de la mer du Nord, de la mer Baltique et de l\'Atlantique, dominées, quand la végétation est présente, par l\'oyat (Ammophila arenaria) accompagné par Eryngium maritimum, Euphorbia paralias, Calystegia soldanella, Otanthus maritimus, parmi d\'autres.'),
(16844, 'NR', 22, '16.2122', 'Dunes blanches de la Méditerranée', '', 'Mediterranean white dunes', '', 6, 'Niveau 6', 9377, '/65/478/1195/3900/9377/16844', 'true', 'White dunes of the Mediterranean coasts, dominated, when vegetated, by marram grass (Ammophila arenaria) accompanied by, among others, Echinophora spinosa, Eryngium maritimum, Euphorbia paralias, Cutandia maritima, Medicago marina, Anthemis maritima.', 'Ammophilion arenariae: Echinophoro-Ammophiletum', 'Dunes blanches des côtes méditerranéennes, dominées, quand la végétation est présente, par l\'oyat (Ammophila arenaria) accompagné par Echinophora spinosa, Eryngium maritimum, Euphorbia paralias, Cutandia maritima, Medicago marina, Anthemis maritima.'),
(16845, 'NR', 22, '16.2123', '', '', 'Canarian white dunes', '', 6, 'Niveau 6', 9377, '/65/478/1195/3900/9377/16845', 'false', 'Mobile dunes of the Canary Islands, with Zygophyllum fontanesii, Euphorbia paralias, Polycarpaea nivea, Cyperus capitatus, Ononis natrix, Convolvulus caput-medusae, Polygonum maritimum and the threatened Lanzarote endemic lily Androcymbium psammophilum.', 'Zygophyllion fontanesii', 'Pas de description disponible'),
(16846, 'NR', 22, '16.2211', 'Groupements dunaires à Tortula', '', 'Tortula moss dune communities', '', 6, 'Niveau 6', 9378, '/65/478/1195/3934/9378/16846', 'true', 'Calciphile communities with Koeleria, Galium verum, Viola curtisii, Ononis repens, Festuca rubra, and moss (e.g. Tortula ruraliformis) and lichen carpets.', '', 'Groupements calciphiles avec Koeleria, Galium verum, Viola saxatilis subsp. curtisii, Ononis repens, Festuca rubra, et tapis de mousses (par ex. Tortula ruraliformis) et lichens.'),
(16847, 'NR', 22, '16.2212', 'Groupements dunaires à Corynephorus canescens', '', 'Grey-hairgrass dune communities', '', 6, 'Niveau 6', 9378, '/65/478/1195/3934/9378/16847', 'true', 'Communities of less calcareous or decalcified slopes rich in Corynephorus canescens and Viola canina.', '', 'Groupements des pentes moins calcaires ou décalcifiées, riches en Corynephorus canescens et Viola canina.'),
(16848, 'NR', 22, '16.2213', 'Groupements dunaires à Myosoton', '', 'Mouse-ear dune communities', '', 6, 'Niveau 6', 9378, '/65/478/1195/3934/9378/16848', 'true', 'Short-lived, warmth-loving mouse-ear dune communities with Cerastium diffusum, C. semidecandrum, C. subtetrandrum, Erodium lebelii, Phleum arenarium, Silene conica.', '', 'Groupements dunaires à Myosoton éphémères, thermophiles avec Cerastium diffusum, C. semidecandrum, Erodium lebelii, Phleum arenarium, Silene conica.'),
