(16850, 'NR', 22, '22.3412', 'Gazons méditerranéens aquatiques à Isoètes', '', 'Mediterranean aquatic quillwort swards', '', 6, 'Niveau 6', 9392, '/66/484/1204/3942/9392/16850', 'true', 'Communities formed by Isoetes boryana, I. delilei, I. heldreichii, I. velata, I. azorica or I. malinverniana in fluctuating waterbodies.', '', 'Groupements constitués par Isoetes boryana, I. setacea (I. delilei) ou I. velata des pièces d\'eau à niveau variable.'),
(16851, 'NR', 22, '22.3413', '', '', 'Azorean quillwort swards', '', 6, 'Niveau 6', 9392, '/66/484/1204/3942/9392/16851', 'false', 'Endemic Isoetes azorica communities of pools and small lakes of the Azores.', '', 'Pas de description disponible'),
(16852, 'NR', 22, '22.3414', 'Gazons méditerranéens à Cyperus', '', 'Mediterranean small galingale swards', '', 6, 'Niveau 6', 9392, '/66/484/1204/3942/9392/16852', 'true', 'Mediterranean and thermo-Atlantic formations dominated by Cyperus fuscus, C. flavescens or C. michelianus.', '', 'Formations méditerranéennes et thermo-atlantiques dominées par Cyperus fuscus, Pycreus flavescens (C. flavescens) ou C. michelianus.'),
(16853, 'NR', 22, '22.3415', 'Gazons méditerranéens à Fimbristylis', '', 'Mediterranean Fimbristylis swards', '', 6, 'Niveau 6', 9392, '/66/484/1204/3942/9392/16853', 'true', 'Formations dominated by Fimbristylis bisumbellata, often with Cyperus spp..', '', 'Formations dominées par Fimbristylis bisumbellata, souvent avec Cyperus spp.'),
(16854, 'NR', 22, '22.3416', '', '', 'Mediterranean Chaetopogon swards', '', 6, 'Niveau 6', 9392, '/66/484/1204/3942/9392/16854', 'false', 'Formations dominated by Chaetopogon fasciculatus.', '', 'Pas de description disponible'),
(16855, 'NR', 22, '22.3111', 'Gazons de Littorelles', '', 'Shoreweed lawns', '', 6, 'Niveau 6', 9393, '/66/484/1204/3941/9393/16855', 'true', 'Dense, almost monospecific Littorella uniflora lawns of lake shores subject to great annual variations of the water level and long emergence, and other Littorella - dominated associations.', '', 'Pelouses denses, généralement monospécifiques à Littorella uniflora des rives lacustres soumises à de grandes variations annuelles du niveau de l\'eau et à une exondation de longue durée ; autres associations dominées par Littorella.'),
(16856, 'NR', 22, '22.3112', 'Etangs à Lobélies', '', 'Lobelia ponds', '', 6, 'Niveau 6', 9393, '/66/484/1204/3941/9393/16856', 'true', 'Lobelia dortmanna colonies of shallow oligotrophic, moderately acid ponds.', '', 'Colonies de Lobelia dortmanna des étangs peu profonds, modérément acides, oligotrophes.'),
(16857, 'NR', 22, '22.3113', 'Gazons d\'Isoètes euro-sibériens', '', 'Euro-Siberian quillwort swards', '', 6, 'Niveau 6', 9393, '/66/484/1204/3941/9393/16857', 'true', 'Clear-water quillwort swards formed by the northern European and montane Isoetes lacustris and I. echinospora or by the very local endemics I. tenuissima of central-western France and I. brochonii of the eastern Pyrenees.', '', 'Gazons d\'Isoètes des eaux limpides formés par les montagnardes nord-européennes Isoetes lacustris et Isoetes echinospora ou même par des endémiques locales Isoetes velata subsp. tenuissima de la France centro-occidentale et Isoetes lacustris (I. brochonii) de l\'Est des Pyrénées.'),
(16858, 'NR', 22, '22.3114', 'Communautés flottantes de Sparganium', '', 'Floating bur-reed communities', '', 6, 'Niveau 6', 9393, '/66/484/1204/3941/9393/16858', 'true', 'Sparganium angustifolium formations of, in particular, sub-alpine ponds.', '', 'Formations à Sparganium angustifolium, caractéristiques notamment des étangs subalpins.'),
(16859, 'NR', 22, '22.3151', 'Gazons péri-alpins à Canche des rivages', '', 'Peri-Alpine shore hairgrass swards', '', 6, 'Niveau 6', 9397, '/66/484/1204/3941/9397/16859', 'true', 'Deschampsia littoralis swards of the shores of Lake Geneva and of a few lakes of the southern Alpine periphery (Lago di Poschiavo, Lago di Cavazzo).', '', 'Gazons à Deschampsia littoralis des berges du lac de Genève et de quelques lacs de la périphérie sud des Alpes (lac de Poschiavo, lac de Cavazzo).'),
