(17197, 'NR', 22, '36.1121', '', '', 'Highland moss snow-patch communities', '', 6, 'Niveau 6', 9967, '/67/495/1292/4313/9967/17197', 'false', 'Moss snow-patches of the Scottish Highlands, formed of mats of mosses and lichens, with, in particular, Polytrichum sexangularis, Kiaeria (Dicranum) starkei, K. falcatum.', '', 'Pas de description disponible'),
(17198, 'NR', 22, '36.1122', '', '', 'Highland dwarf willow snow-patch communities', '', 6, 'Niveau 6', 9967, '/67/495/1292/4313/9967/17198', 'false', 'Moss and dwarf willow snow-patches of the Scottish Highlands, with Salix herbacea, Saxifraga stellaris, Silene acaulis, Omalotheca supina, Luzula spicata and mosses Rhacomitrium heterostictum, R. fasciculare, Gymnomitrium concinnatum, Polytrichum norvegicum, Oligotrichum hercynicum, Nardia scalaris.', '', 'Pas de description disponible'),
(17199, 'NR', 22, '36.1123', '', '', 'Highland Rhytidiadelphus-Deschampsia snow-patch communities', '', 6, 'Niveau 6', 9967, '/67/495/1292/4313/9967/17199', 'false', 'Rhytidiadelphus loreus-Deschampsia cespitosa snow-patches of the western Central Highlands with Rhytidiadelphus loreus, R. squarrosus, R. triquetrus, Deschampsia caespitosa, Anthoxanthum odoratum, Carex bigelowii, Galium saxatile, Alchemilla alpina.', '', 'Pas de description disponible'),
(17200, 'NR', 22, '36.1124', '', '', 'Highland Silene-Festuca snow-patch communities', '', 6, 'Niveau 6', 9967, '/67/495/1292/4313/9967/17200', 'false', 'Species-rich Silene-Festuca snow-patch turf forming at the foot of cliffs in the Central and Eastern Highlands, with Silene acaulis, Alchemilla alpina, Sibbaldia procumbens, Minuartia (Cherleria) sedoides, Cerastium alpinum, Festuca ovina, Anthoxanthum odoratum, Agrostis canina, A. capillaris.', '', 'Pas de description disponible'),
(17201, 'NR', 22, '36.1125', '', '', 'Highland fern snow-patch communities', '', 6, 'Niveau 6', 9967, '/67/495/1292/4313/9967/17201', 'false', 'Fern snow-patch communities forming on screes with prolonged snow cover in the Central and Eastern Highlands, with Cryptogramma crispa, Athyrium distentifolium (A. alpestre), Dryopteris oreades (D. abbreviata), D. expansa (D. assimilis), Galium saxatile, Barbilophozia floerkii, Polytrichum alpinum.', '', 'Pas de description disponible'),
(17202, 'NR', 22, '34.3211', '', '', 'Danish Mesobromion', '', 6, 'Niveau 6', 9979, '/67/490/1236/4118/9979/17202', 'false', 'Dry or mesophile calcareous grasslands of central Jutland and the Danish archipelago with Festuca ovina, Avenula pratensis, A. pubescens, Galium verum, Plantago media, Pulsatilla vulgaris, Artemisia campestris, Geranium sanguineum, Potentilla argentea.', '', 'Pas de description disponible'),
(17203, 'NR', 22, '34.3212', '', '', 'Irish Mesobromion', '', 6, 'Niveau 6', 9979, '/67/490/1236/4118/9979/17203', 'false', 'Calcareous grasslands of central and central-western Ireland.', '', 'Pas de description disponible'),
(17204, 'NR', 22, '34.3213', '', '', 'Scottish Mesobromion', '', 6, 'Niveau 6', 9979, '/67/490/1236/4118/9979/17204', 'false', 'Very local, dry or mesophile grasslands occupying isolated limestone outcrops or deposits of Scotland, in particular on the Durness limestone of the northwest, the Dalradian limestones of Perthshire and basalt hills of the east, with Koeleria macrantha, Festuca ovina, F. rubra, Briza media, Avenula pratensis, Carex flacca, C. caryophyllea, C. capillaris, Helianthemum nummularium, Astragalus danicus, Thymus drucei.', '', 'Pas de description disponible'),
(17205, 'NR', 22, '34.3214', '', '', 'Northern English Mesobromion', '', 6, 'Niveau 6', 9979, '/67/490/1236/4118/9979/17205', 'false', 'Grasslands of mostly Carboniferous or Magnesian limestone substrates in the Pennines of Derbyshire, Yorkshire and Lancashire, the Lake District and Durham, including Teesdale, rich in Sesleria albicans and with many isolated populations of restricted or rare plants including Carex ericetorum, Viola rupestris, Gentiana verna.', '', 'Pas de description disponible'),
(17206, 'NR', 22, '34.3215', '', '', 'Welsh Mesobromion', '', 6, 'Niveau 6', 9979, '/67/490/1236/4118/9979/17206', 'false', 'Grasslands of mostly Carboniferous limestone outcrops of Wales and adjacent areas with Koeleria macrantha, Avenula pubescens, A. pratensis.', '', 'Pas de description disponible'),
(17207, 'NR', 22, '34.3216', '', '', 'Southern English Mesobromion', '', 6, 'Niveau 6', 9979, '/67/490/1236/4118/9979/17207', 'false', 'Grasslands of the chalk downs and mainly Jurassic calcareous hills of southern and eastern England, with Bromus erectus and Brachypodium pinnatum, often very rich in orchids.', '', 'Pas de description disponible'),
(17208, 'NR', 22, '34.3221', 'Mesobromion mosan', '', 'Mosan Mesobromion', '', 6, 'Niveau 6', 9980, '/67/490/1236/4118/9980/17208', 'true', 'Mesophile grasslands of the northwestern Hercynian periphery, on mostly Devonian or Carboniferous limestones or dolomitic limestones, occasionally on calcschists, in the Mosan district of Belgium and the French Meuse, with isolated stations in the Ardenne-Eifel of Luxembourg and Rhineland.', '', 'Pelouses mésophiles de la périphérie hercynienne, au nord-ouest, sur calcaires principalement du dévonien ou du carbonifère ou sur calcaires dolomitiques, occasionnellement sur schistes calcaires, du district mosan de la Belgique et de la Meuse française, avec des stations isolées dans l\'Ardenne, l\'Eifel du Luxembourg et la Rhénanie.'),
(17209, 'NR', 22, '34.3222', 'Mesobromion de la basse Meuse', '', 'Low Meuse Mesobromion', '', 6, 'Niveau 6', 9980, '/67/490/1236/4118/9980/17209', 'true', 'Chalk grasslands of the Belgian low Meuse, extreme southeastern Netherlands and Westphalia, generally without Bromus erectus, and alluvial Mesobromion grasslands of adjacent regions (these to be listed under 34.324).', '', 'Pelouses sur craie de la basse vallée de la Meuse belge, de l\'extrême sud-est des Pays-Bas généralement sans Bromus erectus ; pelouses alluviales du Mesobromion des régions adjacentes.'),
(17210, 'NR', 22, '34.6351', '', '', 'Calcicolous fescue and oat grasslands', '', 6, 'Niveau 6', 9988, '/67/490/1295/4329/9988/17210', 'false', 'Formations of calcareous and dolomitic soils of the Serrania de Ronda mountain system, the peripheral ranges of the Sierra Nevada and the Sierra de Alhamilla.', 'Helictotricho filifolii-Festucetum scariosae', 'Pas de description disponible'),
(17211, 'NR', 22, '61.1112', 'Eboulis du sud-ouest des Alpes à Oxyria digyna', '', 'South-western Alpine mountain sorrel screes', '', 6, 'Niveau 6', 9994, '/69/497/1300/4332/9994/17211', 'true', 'Local formations comprising the endemics Viola valderia and Thlaspi limosellifolium.', 'Thlaspeetum limosellifolii', 'Formations locales comprenant les endémiques Viola valderia et Thlapsi limosellifolium.'),
(17212, 'NR', 22, '61.1113', 'Eboulis pyrénéens à Oxyria', '', 'Pyrenean mountain sorrel screes', '', 6, 'Niveau 6', 9994, '/69/497/1300/4332/9994/17212', 'true', 'Stabilized silicate screes of the Pyrenees.', 'Oxyrio digynae-Doronicetum viscosae i.a.', 'Eboulis siliceux stabilisés des Pyrénées'),
(17213, 'NR', 22, '61.1111', 'Eboulis à Oxyria digyna des Alpes', '', 'Alpine mountain sorrel screes', '', 6, 'Niveau 6', 9994, '/69/497/1300/4332/9994/17213', 'true', 'Formations of most of the Alpine system.', 'Oxyrietum digynae i.a.', 'Formations de la plus grande partie du système alpien.'),
(17214, 'NR', 22, '61.2321', 'Eboulis à Liondent des montagnes des Alpes centrales', '', 'Central Alpine mountain hawkbit screes', '', 6, 'Niveau 6', 10017, '/69/497/1301/4357/10017/17214', 'true', 'Screes of the northwestern and central Alps, with Leontodon montanus, Ranunculus parnassifolius, Saxifraga biflora.', 'Leontodontetum montani', 'Eboulis des Alpes nord-occidentales et centrales, avec Leontodon montanus, Ranunculus parnassifolius, Saxifraga biflora.'),
(17215, 'NR', 22, '61.2322', 'Eboulis à Berardia', '', 'Berardia screes', '', 6, 'Niveau 6', 10017, '/69/497/1301/4357/10017/17215', 'true', 'Screes of the southwestern Alps, with the spectacular endemics Berardia subacaulis and Brassica repanda ssp. repanda.', 'Berardietum lanuginosi', 'Eboulis des Alpes sud-occidentales, avec les endémiques spectaculaires Berardia subacaulis et Brassica repanda subsp. repanda.'),
(17216, 'NR', 22, '64.6111', 'Végétation de cannes sur dunes du Rhône', '', 'Rhône dune cane beds', '', 6, 'Niveau 6', 10018, '/69/512/1309/4365/10018/17216', 'true', 'Imperata cylindrica and Saccharum ravennae formations of the Camargue.', '', 'Imperata cylindrica et Erianthus ravennae de Camargue.'),
(17217, 'NR', 22, '64.6112', 'Autres pelouses des dunes du Rhône', '', 'Other Rhône dune grasslands', '', 6, 'Niveau 6', 10018, '/69/512/1309/4365/10018/17217', 'true', 'Dry grasslands of the Malcomietalia (35.4), Thero-Brachypodietea (34.5), Brachypodietalia phoenicoidis (34.36) colonizing inland Camargue dunes.', '', 'Prairies sèches des Malcomietalia (35.4), Thero-Brachypodietea (34.5), Brachypodietalia phoenicoidis (34.36) colonisant les dunes continentales de Camargue.'),
(17218, 'NR', 22, '61.3121', 'Eboulis à Galeopsis angustifolia', '', 'Hemp-nettle screes', '', 6, 'Niveau 6', 10022, '/69/497/1305/4367/10022/17218', 'true', 'Galeopsis angustifolia communities of central Europe.', 'Galeopsietum angustifoliae', 'Communautés à Galeopsis angustifolia d\'Europe centrale.'),
(22152, 'NR', 22, '31.81212', 'Fruticées atlantiques calciclines', '', 'Atlantic calcicline scrub', '', 8, 'Niveau 8', 20807, '/67/487/1223/4030/9538/16986/20807/22152', 'true', 'Widespread neutrophilous to calciphilous, species-rich thorny scrub and seminatural hedge communities of the British Isles, with Crataegus monogyna, Hedera helix, Rubus spp., Prunus spinosa, Fraxinus excelsior. Included are the Hedera helix-Urtica dioica, Mercurialis perennis and Brachypodium sylvaticum sub-communities of the Crataegus monogyna-Hedera helix scrub.', '', 'Fruticées épineuses neutrophiles à calcaires, riches en espèces, largement répandues et communautés semi-naturelles du bords des Iles britanniques, avec Crataegus monogyna, Hedera helix, Rubus spp., Prunus spinosa, Fraxinus excelsior. Sont inclus les groupements à Hedera helix-Urtica dioica, Mercurialis perennis et Brachypodium sylvaticum, de broussailles à Crataegus monogyna-Hedera helix.'),
(22153, 'NR', 22, '31.81212', 'Fruticées calcicoles de bord de route, sur craie', '', 'Wayfaring tree chalk scrub', '', 8, 'Niveau 8', 20807, '/67/487/1223/4030/9538/16986/20807/22153', 'true', 'Species-rich communities mostly of southeastern England, characterized by the abundance of Viburnum lantana, Legustrum vulgarae, Cornus sanguinea, Tamus communus and Clematis vitalba, the frequency of Taxus baccata saplings and Juniperus communis. There is often a field layer with Bromus erectus, Brachypodium pinnatum and other dry grassland species in less dense stands. Some orchid species rare to the British Isles, such as Himantoglossum hircinum, Orchis militaris, O. purpurea, O. simia, are strongly associated with this habitat.', '', 'Communautés riches en espèces caractérisées par l\'abondance de Viburnum lantana, Ligustrum vulgare, Cornus sanguinea, Tamus communis et Clematis vitalba, et la fréquence de jeunes Taxus baccata et Juniperus communis.'),
(20804, 'NR', 22, '31.23421', '', '', 'Lizard tall heath', '', 7, 'Niveau 7', 16890, '/67/487/1217/3976/9444/16890/20804', 'false', 'Erica vagans-Schoenus nigricans heath of moist, shallow depressions of the Lizard plateau, dominated by Cornish heath.', '', 'Pas de description disponible'),
(20805, 'NR', 22, '31.23422', '', '', 'Lizard mixed heath', '', 7, 'Niveau 7', 16890, '/67/487/1217/3976/9444/16890/20805', 'false', 'Erica vagans-Ulex europaeus heath of well-drained areas of the Lizard plateau, dominated by Cornish heath and common gorse.', '', 'Pas de description disponible'),
(20806, 'NR', 22, '31.81211', 'Fruticées médio-européennes à Prunelliers et Troènes', '', 'Medio-European blackthorn-privet scrubs', '', 7, 'Niveau 7', 16986, '/67/487/1223/4030/9538/16986/20806', 'true', 'Prunus spinosa, Ligustrum vulgare, Viburnum lantana, Cornus mas, Rhamnus catharticus, Crataegus spp., Carpinus betulus communities of the European mainland, under sub-Atlantic or sub-continental climates.', '', 'Communautés continentales à Prunus spinosa, Ligustrum vulgare, Viburnum lantana, Cornus mas, Rhamnus catharticus, Crataegus spp., Carpinus betulus sous climats sub-atlantique ou subcontinental.'),
(20807, 'NR', 22, '31.81212', 'Fruticées atlantiques à Crataegus et Hedera', '', 'Atlantic hawthorn-ivy scrubs', '', 7, 'Niveau 7', 16986, '/67/487/1223/4030/9538/16986/20807', 'true', 'Communities of the British Isles and areas of strongly Atlantic climates differing from 31.81211 in particular in the scarcity of Carpinus betulus.', '', 'Communautés des Iles britanniques et des régions de climat fortement atlantique différant de 31.81211 en particulier dans la rareté de Carpinus betulus.'),
(20808, 'NR', 22, '31.81251', 'Fruticées à Prunus brigantiaca', '', 'Marmot plum scrub', '', 7, 'Niveau 7', 16990, '/67/487/1223/4030/9538/16990/20808', 'true', 'Inner Alpine formations with Prunus brigantina.', 'Berberido-Prunetum brigantiacae', 'Formations intra-alpine à Prunus brigantiaca.'),
(20809, 'NR', 22, '31.81252', 'Autres fruticées intra-alpines à Epine vinette', '', 'Other inner Alpine barberry scrubs', '', 7, 'Niveau 7', 16990, '/67/487/1223/4030/9538/16990/20809', 'true', '', '', 'Pas de description disponible'),
(20810, 'NR', 22, '32.25721', '', '', 'Limonium-Anabasis arid garrigues', '', 7, 'Niveau 7', 17024, '/67/488/1225/4043/9630/17024/20810', 'false', 'Formations rich in succulent plants of argillous and stony soils of Murcia and Almeria, with Anabasis articulata and Limonium insignis.', 'Limonio-Anabasetum articulatae p.', 'Pas de description disponible'),
(20811, 'NR', 22, '32.25722', '', '', 'Cabo de Gata arid garrigue', '', 7, 'Niveau 7', 17024, '/67/488/1225/4043/9630/17024/20811', 'false', 'Formations of Cabo de Gata (Charidemum Promontorium) with Teucrium charidemi, Caralluma europaea var. confusa, Lapiedra martinezii, Anthirrhinum charidemi, Dianthus charidemii, Sideritis pusilla ssp. osteoxyla, taxa for the most part endemic to the promontory.', 'Limonio-Anabasetum articulatae charidemetosum', 'Pas de description disponible'),
(20812, 'NR', 22, '32.25723', '', '', 'Tabernas arid garrigues', '', 7, 'Niveau 7', 17024, '/67/488/1225/4043/9630/17024/20812', 'false', 'Species-rich formations of the arid depression between the Sierras de Gador, Filabres and Alhamilla, with Euzomodendron bourgaeanum, Coris hispanica, Koelpinia linearis.', 'Anabaso-Euzomodendretum', 'Pas de description disponible'),
(20813, 'NR', 22, '32.25724', '', '', 'Coastal Almerian arid garrigues', '', 7, 'Niveau 7', 17024, '/67/488/1225/4043/9630/17024/20813', 'false', 'Coastal Murcio-Almerian formations with Teucrium gnaphalodes, T. baltasari, Sideritis pusilla ssp. pusilla and ssp. flavovirens, Launaea nudicaulis.', 'Teucrio-Sideritetum pusillae', 'Pas de description disponible'),
(20814, 'NR', 22, '42.32111', 'Forêts de Mélèzes et d\'Arolles à Pin mugo et Rhododendron cilié', '', 'Dwarf pine-hairy alpenrose larch-arolla forests', '', 7, 'Niveau 7', 17043, '/68/491/1267/4158/9742/17043/20814', 'false', 'Forests of Pinus cembra and Larix decidua with an undergrowth of Pinus mugo and Rhododendron hirsutum.', '', 'Forêts de Pinus cembra et Larix decidua avec un sous-bois de Pinus mugo et Rhododendron hirsutum.'),
(20815, 'NR', 22, '42.32112', 'Forêts de Mélèzes et d\'Arolles à Aulne vert et Rhododendron cilié', '', 'Green alder-hairy alpenrose larch-arolla forests', '', 7, 'Niveau 7', 17043, '/68/491/1267/4158/9742/17043/20815', 'false', 'Forests of Pinus cembra and Larix decidua with an undergrowth of Alnus viridis, tall herbs and Rhododendron hirsutum.', '', 'Forêts de Pinus cembra et Larix decidua avec un sous-bois d\'Alnus viridis, de hautes herbes et avec Rhododendron hirsutum.'),
(20816, 'NR', 22, '42.32113', 'Autres forêts de Mélèzes et d\'Arolles à Rhododendron cilié', '', 'Other hairy alpenrose larch-arolla forests', '', 7, 'Niveau 7', 17043, '/68/491/1267/4158/9742/17043/20816', 'false', '', '', 'Pas de description disponible'),
(20817, 'NR', 22, '42.42151', 'Forêts de Pins de montagne à Ononis d\'adret', '', 'Adret restharrow mountain pine forests', '', 7, 'Niveau 7', 17079, '/68/491/1254/4190/9785/17079/20817', 'true', 'Dryer, sunny slope formations.', 'Ononido-Pinetum uncinatae s.s.', 'Formations de versants ensoleillés, plus sèches.');
INSERT INTO `corine` (`CD_HAB`, `FG_VALIDITE`, `CD_TYPO`, `LB_CODE`, `LB_HAB_FR`, `LB_HAB_FR_COMPLET`, `LB_HAB_EN`, `LB_AUTEUR`, `NIVEAU`, `LB_NIVEAU`, `CD_HAB_SUP`, `PATH_CD_HAB`, `FRANCE`, `LB_DESCRIPTION`, `CRSP_PHYTO_CB91`, `DESCRIPTIF_CB97_FR`) VALUES
(20818, 'NR', 22, '42.42152', 'Forêts de Pins de montagne à Ononis d\'ubac', '', 'Ubac restharrow mountain pine forests', '', 7, 'Niveau 7', 17079, '/68/491/1254/4190/9785/17079/20818', 'true', 'Heather-rich shady slope formations.', 'Ononido-Pinetum uncinatae ericetosum', 'Formations de versants ombragés riches en Ericacées.'),
(20819, 'NR', 22, '34.32161', '', '', 'Southern English tall Mesobromion', '', 7, 'Niveau 7', 17207, '/67/490/1236/4118/9979/17207/20819', 'false', 'Tall grasslands with Bromus erectus, Brachypodium pinnatum, Arrhenatherum elatius, Avenula pratensis, A. pubescens.', '', 'Pas de description disponible'),
(20820, 'NR', 22, '34.32162', '', '', 'Southern English tor grass Mesobromion', '', 7, 'Niveau 7', 17207, '/67/490/1236/4118/9979/17207/20820', 'false', 'Brachypodium pinnatum -dominated facies.', '', 'Pas de description disponible'),
(20821, 'NR', 22, '34.32163', '', '', 'Southern English short Mesobromion', '', 7, 'Niveau 7', 17207, '/67/490/1236/4118/9979/17207/20821', 'false', 'Short turfs with Festuca ovina, F. rubra, Cynosurus cristatus, Koeleria macrantha.', '', 'Pas de description disponible'),
(20822, 'NR', 22, '44.81321', '', '', 'Canarian tamarisk thickets', '', 7, 'Niveau 7', 17284, '/68/515/1380/4506/10173/17284/20822', 'false', 'Tamarix canariensis and T. africana galleries and thickets of the lower zone of the Canary Islands, lining the low part of barrancos and occupying the deltas of greater water courses. They are particularly abundant in the eastern desert islands, Lanzarote and, mostly, Fuenteventura, where they constitute one of the principal ligneous habitats for the fauna. They have also important representatives along the north coast of Tenerife and on Gran Canaria (Charca de Maspalomas, La Aldea).', '', 'Pas de description disponible'),
(20823, 'NR', 22, '44.81322', '', '', 'Madeiran tamarisk thickets', '', 7, 'Niveau 7', 17284, '/68/515/1380/4506/10173/17284/20823', 'false', 'Tamarix gallica thickets of the lowlands of Madeira.', '', 'Pas de description disponible'),
(20824, 'NR', 22, '44.81341', '', '', 'Tamarix boveana stands', '', 7, 'Niveau 7', 17290, '/68/515/1380/4506/10173/17290/20824', 'false', 'Rare and vulnerable formations of the Ibero-African Tamarix boveana, alone or associated with T. canariensis, characteristic of arid areas of eastern Iberia, limited to a few stations in the Iberian South-east (Murcia, Almeria, Alicante), the Ebro depression (Salada de Chiprana), the Ebro delta and Mallorca (Alcudia).', 'Inulo crithmoidis-Tamaricetum boveanae', 'Pas de description disponible'),
(20825, 'NR', 22, '44.81342', '', '', 'Saline Tamarix canariensis stands', '', 7, 'Niveau 7', 17290, '/68/515/1380/4506/10173/17290/20825', 'false', 'Formations of Tamarix canariensis, sometimes with T. gallica, characteristic of strongly saline sites, in particular, of Iberian interior saline depressions (La Mancha) and of Arid Southeast coastal areas.', 'Agrosto stoloniferae-Tamaricetum canariensis, Lycio intricati-Tamaricetum canariensis', 'Pas de description disponible'),
(20826, 'NR', 22, '44.81343', '', '', 'Saline eastern tamarisk stands', '', 7, 'Niveau 7', 17290, '/68/515/1380/4506/10173/17290/20826', 'false', 'Tamarix smyrnensis, T. hampeana, T. dalmatica stands of the strongly saline part of Greek coastal marshes.', '', 'Pas de description disponible'),
(20827, 'NR', 22, '42.82131', '', '', 'Siliceous southern-Iberian mesogean pine forests', '', 7, 'Niveau 7', 17293, '/68/491/1386/4521/10182/17293/20827', 'false', 'Widespread and extensive silicicolous Pinus pinaster forests, mostly occupying reddish sandy soils (rodenales).', '', 'Pas de description disponible'),
(20828, 'NR', 22, '42.82132', '', '', 'Calcicolous southern-Iberian mesogean pine forests', '', 7, 'Niveau 7', 17293, '/68/491/1386/4521/10182/17293/20828', 'false', 'Less common calcicolous Pinus pinaster forests of Jurassic and Cretaceous limestones.', '', 'Pas de description disponible'),
(20829, 'NR', 22, '42.82151', '', '', 'Aljibe mesogean pine forests', '', 7, 'Niveau 7', 17295, '/68/491/1386/4521/10182/17295/20829', 'false', 'Silicicolous thermo-Mediterranean Pinus pinaster forests of the Aljibe.', '', 'Pas de description disponible'),
(20830, 'NR', 22, '42.82152', '', '', 'Andalusian peridotite mesogean pine forests', '', 7, 'Niveau 7', 17295, '/68/491/1386/4521/10182/17295/20830', 'false', 'Peridotite Pinus pinaster forests of Western Malaga.', '', 'Pas de description disponible'),
(20831, 'NR', 22, '42.82153', '', '', 'Andalusian dolomite mesogean pine forests', '', 7, 'Niveau 7', 17295, '/68/491/1386/4521/10182/17295/20831', 'false', 'Dolomite Pinus pinaster forests of Malaga and Granada mountains, with a calciphilous undergrowth formed by Buxus balearica, Ulex agrgenteus, Cistus libanotis, Thymelaea tartonraira, Linum suffruticosum, Thymus erianthus, T. longiflorus.', '', 'Pas de description disponible'),
(20832, 'NR', 22, '42.82154', '', '', 'Eastern Andalusian calcicolous mesogean pine forests', '', 7, 'Niveau 7', 17295, '/68/491/1386/4521/10182/17295/20832', 'false', 'Limestone Pinus pinaster forests of eastern Andalusia.', '', 'Pas de description disponible'),
(20833, 'NR', 22, '42.82155', '', '', 'Eastern Andalusian silicicolous mesogean pine forests', '', 7, 'Niveau 7', 17295, '/68/491/1386/4521/10182/17295/20833', 'false', 'Siliceous Pinus pinaster forests of eastern Andalusia.', '', 'Pas de description disponible'),
